import{_ as g,o as t,c as n,a as i,t as u,C as h,M as _,U as k,f as p,F as w,p as b,e as D,q as v}from"./chunks/framework.B1z0IdBH.js";const f={name:"PoemCard",props:{poem:{type:Object,required:!0}},methods:{handleImageError(a){a.target.src="/images/logo.svg"}}},B={class:"entry-container"},y={class:"entry"},A={class:"entry-image"},z=["src","alt"],j={class:"entry-content"},C={class:"entry-title"},E=["href"],S={class:"entry-description"};function x(a,e,s,m,o,r){return t(),n("div",B,[i("div",y,[i("div",A,[i("img",{src:s.poem.image_url,alt:s.poem.page_title,onError:e[0]||(e[0]=(...d)=>r.handleImageError&&r.handleImageError(...d))},null,40,z)]),i("div",j,[i("h2",C,[e[1]||(e[1]=i("span",{class:"title-icon"},null,-1)),i("a",{href:s.poem.page_url,target:"_blank"},u(s.poem.page_title),9,E)]),i("p",S,u(s.poem.context_page_description),1)])])])}const M=g(f,[["render",x],["__scopeId","data-v-85f2b583"]]),P=JSON.parse(`[{"page_url":"https://cs.wikipedia.org/wiki/Mars_(planeta)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/TerraformedMarsGlobeRealistic.jpg","page_title":"Mars (planeta)","context_page_description":"Mars je čtvrtá planeta sluneční soustavy, druhá nejmenší planeta soustavy po Merkuru. Byla pojmenována po římském bohu války Martovi. Jedná se o planetu terestrického typu, tj. s pevným horninovým povrchem pokrytým impaktními krátery, vysokými sopkami, hlubokými kaňony a dalšími útvary. Má dva měsíce nepravidelného tvaru nazvané Phobos a Deimos.\\nV období, kdy je Mars v opozici ke Slunci a Země se tak nachází mezi těmito dvěma tělesy, lze Mars vidět na obloze celou noc. Spolehlivé informace o prvních pozorováních Marsu jako planety neexistují, ale pravděpodobně k nim došlo mezi lety 3000 až 4000 př. n. l. Všechny starověké civilizace, Egypťané, Babylóňané i Řekové, tuto „putující hvězdu“ znaly a měly pro ni své pojmenování. Kvůli načervenalému nádechu způsobenému červenou barvou zoxidované půdy na jejím povrchu považovaly staré národy Mars většinou za symbol ohně, krve a zániku.\\nDetailní zkoumání planety umožnilo od 60. let 20. století již takřka 20 úspěšných automatických sond. V současné době je na oběžné dráze kolem Marsu šest funkčních sond a na povrchu planety jedno funkční vozítko Curiosity mise Mars Science Laboratory a jedna nepohyblivá funkční sonda InSight."},{"page_url":"https://es.wikipedia.org/wiki/Leo_Stadium","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Leostadium120318.jpg","page_title":"Leo Stadium","context_page_description":"El Leo Stadium es un recinto deportivo situado en la Provincia de Pathum Thani en Tailandia. El estadio es propiedad del Bangkok Glass Football Club que participa en la Liga Premier de Tailandia. Se inauguró en 2010 y su aforo actualmente es de 13 000 espectadores."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Helmstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Holzkirchhausen_Kreuzwegstationen%2C_zwei_Engelsfiguren%2C_Kreuz_02.jpg","page_title":"Liste der Baudenkmäler in Helmstadt","context_page_description":"Auf dieser Seite sind die Baudenkmäler des unterfränkischen Marktes Helmstadt zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 15. April 2020 wieder und enthält 41 Baudenkmäler."},{"page_url":"https://no.wikipedia.org/wiki/Harran_(Mesopotamia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Harran-beehouses.jpg","page_title":"Harran (Mesopotamia)","context_page_description":"Harran var en betydelig oldtidsby i øvre Mesopotamia som i dag ligger nær den moderne landsbyen Altınbaşak i Tyrkia, 55 km sørøst for Şanlıurfa. Beliggenheten er i et distrikt i provinsen Şanlıurfa som også heter Harran.\\nNoen få km fra landsbyen Altınbaşak ligger de arkeologiske levningene av oldtidens Harran, et betydelig kommersielt, kulturelt og religiøst senter som først ble bosatt i tidlig bronsealder III. Det var kjent som Ḫarrānu i den assyriske perioden; muligens חָרָן, Ḥārān, i den hebraiske Bibelen; Κάῤῥαι av grekerne og Carrhae under Romerriket; Hellenopolis i tidlig kristen periode; og Ḥarrān i den islamske perioden."},{"page_url":"https://ro.wikipedia.org/wiki/Lista_celor_mai_apropiate_galaxii","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Phoenix_Dwarf_Hubble_WikiSky.jpg","page_title":"Lista celor mai apropiate galaxii","context_page_description":"Aceasta este o listă a galaxiilor cunoscute, aflate la o distanță maximă de 3,59 de megaparseci de Sistemul solar, ordonate crescător după distanță.\\nAceastă listă reflectă cunoștințele prezente:\\nNu toate galaxiile aflate pe o rază de 3,59 Mpc au fost descoperite. Galaxii pitice apropiate sunt descoperite mereu, iar cele aflate dedesubtul planului central al Căii Lactee sunt foarte greu de deosebit. Există și posibilitatea ca orice galaxie să acopere pe o alta aflată în spatele său.\\nMăsurarea distanțelor intergalactice este marcată de incertitudine. Datele listate sunt rezultatele mai multor măsurători, iar unele dintre ele pot avea erorile proprii."},{"page_url":"https://vi.wikipedia.org/wiki/Erebus_strigipennis","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Nyctipao_strigipennis_male.JPG","page_title":"Erebus strigipennis","context_page_description":"Erebus strigipennis là một loài bướm đêm trong họ Erebidae."},{"page_url":"https://es.wikipedia.org/wiki/Charles_Le_Brun","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Galerie1.jpg","page_title":"Charles Le Brun","context_page_description":"Charles Le Brun fue un pintor y teórico del arte francés, uno de los artistas dominantes en la Francia del siglo XVII."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%85%E0%AE%AE%E0%AF%8D%E0%AE%AE%E0%AE%BE%E0%AE%A3%E0%AF%8D%E0%AE%9F%E0%AE%BF_%E0%AE%B5%E0%AE%BF%E0%AE%B3%E0%AF%88,%E0%AE%85%E0%AE%B0%E0%AE%9A%E0%AF%81_%E0%AE%AA%E0%AE%B3%E0%AF%8D%E0%AE%B3%E0%AE%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Ghss.ammandivilai.jpg","page_title":"அம்மாண்டி விளை,அரசு பள்ளி","context_page_description":"அரசு மேல்நிலைப்பள்ளியில் மாதம் ஒரு முறை பள்ளி மேலாண்மை குழு கூட்டம் நடைபெறுகிறது."},{"page_url":"https://sv.wikipedia.org/wiki/Patara_(djur)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Das_kleine_Theater_von_Patara.jpg","page_title":"Patara (djur)","context_page_description":"Patara är ett släkte av insekter. Patara ingår i familjen Derbidae.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://fr.wikipedia.org/wiki/Basilique-cath%C3%A9drale_Saint-Michel_de_Sherbrooke","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Fondations_de_la_chapelle_Pauline.jpg","page_title":"Basilique-cathédrale Saint-Michel de Sherbrooke","context_page_description":"La basilique-cathédrale Saint-Michel de Sherbrooke, située dans la province de Québec, au Canada, est le siège de l’archidiocèse de Sherbrooke, qui couvre les diocèses de Sherbrooke, Nicolet et Saint-Hyacinthe. Elle est également l’église régimentaire de la 52ᵉ Ambulance de campagne.\\nElle fut construite sur les hauteurs de la falaise Saint-Michel selon les plans de l'architecte Louis-Napoléon Audet, au centre-ville de Sherbrooke. Avec une architecture de style gothique, l'édifice fut inspiré de la Cathédrale Notre-Dame de Paris de par sa conception avec les deux tours à l’avant. Sa construction, pourtant, reste inachevée, faute de financement : deux petites tours restent à construire.\\nL’évêque Georges Cabana a obtenu que la cathédrale soit érigée en basilique mineure par Jean XXIII le 31 juillet 1959."},{"page_url":"https://pt.wikipedia.org/wiki/Veere","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/03/Koudekerke%2C_Micha%C3%ABlskerk_foto5_2010-09-18_11.12.JPG","page_title":"Veere","context_page_description":"Veere é uma cidade e um município da província da Zelândia. Está situada a orlas do lago Veerse, na ilha de Walcheren."},{"page_url":"https://af.wikipedia.org/wiki/Belfast","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Two_unusual_ships_in_Belfast_-_geograph.org.uk_-_958692.jpg","page_title":"Belfast","context_page_description":"Belfast is die hoofstad en grootste stad van Noord-Ierland, een van die vier lande van die Verenigde Koninkryk, met 'n oppervlak van 115 vierkante kilometer en 'n bevolking van 281 000 volgens die sensus van 2011. Die metropolitaanse gebied van Belfast het 'n bevolking van 641 638.\\nDie naam Belfast is afgelei van die Iers-Gaeliese Bél Feirste. Die stad was oorspronklik teen die Farsetrivier geleë, maar intussen is die Lagan die belangrikste rivier van Belfast. Die Farsetrivier vloei tans onder High Street en het byna in vergetelheid geraak.\\nDie vroegste nedersettings in die gebied dateer uit die Bronstydperk. Vanaf die 18de eeu het Belfast tot 'n belangrike stedelike sentrum in Ierland gegroei wat vandag as die administratiewe hoofstad van Noord-Ierland dien. Die nywerheidsomwenteling het van die stad 'n belangrike industriële en handelspilpunt gemaak waaraan vanweë sy indrukwekkende 19de eeuse argitektuur die bynaam Athene van die Noorde gegee is, maar in die laat 20ste eeu het sy tradisionele nywerheidsbedrywe, waaronder skeepsbou, 'n groot mate van agteruitgang beleef."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%A1%97%E9%A0%AD%E3%83%86%E3%83%AC%E3%83%93","image_url":"http://upload.wikimedia.org/wikipedia/ja/8/8f/Gaitou_tv.JPG","page_title":"街頭テレビ","context_page_description":"街頭テレビは、不特定多数の人が集まる場所に設置され、無料で視聴できるテレビ受像機である。テレビジョン放送およびテレビの普及初期には随所に置かれ、大変な人気を博した。"},{"page_url":"https://da.wikipedia.org/wiki/York_Minster","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/YorkMinsterStainedGlass.jpg","page_title":"York Minster","context_page_description":"York Minster er en stor gotisk katedral i York, i Nordengland. Den er sæde for ærkebiskoppen af York og domkirke for bispedømmet York. Katedralen er den største kirkebygning fra Middelalderen i Storbritannien og i Commonwealth of Nations, tidligere kaldet Det britiske statssamfund.\\nDen har et meget bredt skib og kapitelsal i stilen Decorated Gothic, \\"udsmykket gotisk stil\\" 1290–1350 en:Decorated Gothic.\\nKor og østenden er i stilen Perpendicular Gothic, \\"lodret gotisk stil\\" begyndende ca. 1350 en:Perpendicular Period, mens nord- og syd-tværskib er i stilen Early English, \\"tidlig engelsk stil\\" ca 1190–1250 ifølge Sir Nikolaus Pevsner en:Early English Period,\\nVestsiden af midtskibet indeholder et vindue fra 1338 og østsiden af skibet har det store østvindue, som er over for Vor Frue Kapel, kapellet for Jomfru Maria, i den østlige ende. I det hele taget er York Minster berømt for sine vinduer\\nI det nordlige tværskib ligger De fem søstres vinduer, hvert lancet-vindue mere end 16 meter højt. Orglet i koret er to gange blevet ødelagt ved brand; det nuværende orgel er fra 1829 og blev restaureret i 1993."},{"page_url":"https://en.wikipedia.org/wiki/Locomotives_of_the_North_Eastern_Railway","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Hull_Daircoates_Locomotive_Depot_with_Ex-North_Eastern_Atlantic_geograph-2319353-by-Ben-Brooksbank.jpg","page_title":"Locomotives of the North Eastern Railway","context_page_description":"The North Eastern Railway was formed by merger in 1854 and merged into the London and North Eastern Railway at the grouping in 1923. Between those dates five men held the post of Locomotive Superintendent.\\nIn addition many locomotives were inherited from the NER's constituents, and also from subsequent acquisitions, which are not listed here."},{"page_url":"https://pl.wikipedia.org/wiki/Bitwa_nad_rzek%C4%85_Tollense","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cc/Tollensetal_Kessin_Weltzin.jpg","page_title":"Bitwa nad rzeką Tollense","context_page_description":"Bitwa nad rzeką Tollense – bitwa stoczona w epoce brązu, orientacyjnie pomiędzy latami 1300 i 1250 p.n.e. w dolinie rzeki Tollense na terenie dzisiejszych Niemiec. Żadne przekazy historyczne o niej nie są znane, zatem cała wiedza na jej temat pochodzi wyłącznie z badań archeologicznych na pobojowisku. Na podstawie przebadanego do 2017 roku fragmentu terenu badacze oceniają, że mogło w niej wziąć udział od 1000 do 4000 wojowników, z których nawet do 750 poległo. Są liczne poszlaki wskazujące na nielokalną genezę konfliktu i takież pochodzenie walczących."},{"page_url":"https://en.wikipedia.org/wiki/Black_metal","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Cradle_of_Filth_2005.jpg","page_title":"Black metal","context_page_description":"Black metal is an extreme subgenre of heavy metal music. Common traits include fast tempos, a shrieking vocal style, heavily distorted guitars played with tremolo picking, raw recording, unconventional song structures, and an emphasis on atmosphere. Artists often appear in corpse paint and adopt pseudonyms.\\nDuring the 1980s, several thrash metal and death metal bands formed a prototype for black metal. This so-called first wave included bands such as Venom, Bathory, Mercyful Fate, Hellhammer and Celtic Frost. A second wave arose in the early 1990s, spearheaded by Norwegian bands such as Mayhem, Darkthrone, Burzum, Immortal, Emperor, Satyricon and Gorgoroth. The early Norwegian black metal scene developed the style of their forebears into a distinct genre. Norwegian-inspired black metal scenes emerged throughout Europe and North America, although some other scenes developed their own styles independently. Some prominent Swedish bands spawned during this second wave, the second generation in Sweden being led by Dissection, Abruptum, Marduk, and Nifelheim."},{"page_url":"https://en.wikipedia.org/wiki/100_film_italiani_da_salvare","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/CerviBenetti.jpg","page_title":"100 film italiani da salvare","context_page_description":"The list of the 100 Italian films to be saved was created with the aim to report \\"100 films that have changed the collective memory of the country between 1942 and 1978\\". The project was established in 2008 by the Venice Days festival section of the 65th Venice International Film Festival, in collaboration with Cinecittà Holding and with the support of the Ministry of Cultural Heritage.\\nThe list was edited by Fabio Ferzetti, film critic of the newspaper Il Messaggero, in collaboration with film director Gianni Amelio and the writers and film critics Gian Piero Brunetta, Giovanni De Luna, Gianluca Farinelli, Giovanna Grignaffini, Paolo Mereghetti, Morando Morandini, Domenico Starnone and Sergio Toffetti."},{"page_url":"https://fi.wikipedia.org/wiki/Hala%E2%80%99ibin_kolmio","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Cut_Map_of_the_Hala%27ib_triangle.jpg","page_title":"Hala’ibin kolmio","context_page_description":"Hala'ibin kolmio eli Halayebin kolmio on 20 480 km²:n laajuinen kiistan­alainen alue Punaisen­meren rannalla Koillis-Afrikassa. Se on saanut nimensä siellä sijaitsevan Hala'ibin kaupungin mukaan. Sitä vaativat itselleen Egypti ja Sudan. Kiista aiheutuu siitä, että Sudanin anglo­egyptiläinen yhteis­hallinto vahvisti vuonna 1899 \\"poliittiseksi rajaksi\\" 22. pohjoisen leveyspiirin, jota myöten raja kulki Punaiseen­mereen saakka, mutta vuonna 1902 britit vahvistivat siitä osittain poikkevan \\"hallinnollisen rajan\\", jolla osa mainitun leveys­piirin pohjois­puolellakin olevasta alueesta yhdistettiin hallinnollisesti Britannian ja Egyptin yhteis­hallinnossa olleeseen Sudaniin. Siitä lähtien kun Sudan vuonna 1956 itsenäistyi, sekä Egypti että Sudan ovat vaatineet vanhan \\"poliittisen\\" ja \\"hallinnollisen\\" rajan väliin jäävää Hala'ibin aluetta itselleen. Egypti sijoitti alueelle 1990-luvulla sotaväkeä, ja siitä lähtien se on käytännössä, de facto, ollut Egyptin hallinnassa osana Al Bahr al-Ahmarin kuvernoraattia. Egypti on myös tehnyt alueelle huomattavia investointeja.\\nAlue on likipitäen kolmion muotoinen."},{"page_url":"https://sk.wikipedia.org/wiki/Ma%C5%BEoretka","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Ma%C5%BCoretki_orkiestry_d%C4%99tej_z_G%C5%82ogowa.JPG","page_title":"Mažoretka","context_page_description":"Mažoretky sú tanečnice, ktorých choreografia je založená predovšetkým na pestrej manipulácii s náčiním v tvare paličky, tzv. baton. Skupina vystupuje s rovnakou choreografiou. Na čele mažoretiek je trénerka, ktorá ju tvorí.\\nPri vystupovaní na rôznych podujatiach sú mažoretky aj kostýmovo a farebne zladené. Na hlave majú obvykle lodičku, ktorá sa pripevní sponkami."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_de_champignons_comestibles","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Poria_cocos.jpg","page_title":"Liste de champignons comestibles","context_page_description":"Aucune garantie d'exactitude ne peut être offerte par la liste contenue dans cet article.\\nLes informations sont données dans un but strictement encyclopédique, et ne doivent en aucun cas servir à l'identification d'un champignon ou à sa consommation.\\nVoyez également Wikipédia:Mise en garde médicale.\\nCet article présente une liste de champignons comestibles.\\nÀ strictement parler, un champignon comestible est la fructification des macrochampignons qui se prêtent à l'alimentation humaine. Le terme est mis en opposition avec celui de champignon toxique, qui désigne les espèces contenant une mycotoxine et pouvant provoquer une intoxication alimentaire. L'intoxication par consommation de champignon peut prendre de nombreuses formes, peut survenir à différentes échelles de temps après ingestion et peut avoir des conséquences très diverses : du léger malaise à l'empoisonnement mortel.\\nIl est néanmoins impossible de déterminer de façon définitive et universelle la liste exacte des champignons propres à l'alimentation. La comestibilité d'une espèce peut varier en fonction de la variété, du substrat, de la localisation géographique, de l'âge ou encore de la saison de récolte."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D8%B1%DB%8C%DA%86%D9%87_%D8%B3%D9%87%E2%80%8C%D9%84%D8%AA%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Gray495.png","page_title":"دریچه سه‌لتی","context_page_description":"دریچهٔ سه‌لَختی دریچه‌ای است که بین دهلیز راست و بطن راست قلب قرار گرفته‌است و شامل سه دهانه است. به‌طور طبیعی دهانه‌های این دریچه هنگام دیاستول باز است و خون از دهلیز راست وارد بطن راست می‌شود. طی انقباض بطن راست دریچه سه‌لختی به وسیله تارهای نگه‌دارنده محکم بسته نگه داشته می‌شوند.\\nوجه نام‌گذاری این دریچه به خاطر داشتن سه لَت است.\\nیک دریچه طبیعی باید سه لَت و سه عضلهٔ پاپیلاری داشته باشد. لت‌ها به وسیلهٔ طناب‌های کوردا تمپانی به ماهیچه‌های پاپیلاری متصل هستند. دریچهٔ سه‌لتی همیشه دارای فقط سه لت نیست و ممکن است در بعضی افراد دو یا چهار لت داشته باشد؛ و این تعداد در طول عمر فرد هم می‌تواند متغیر باشد\\nاز بیماری‌های مهم دریچه سه‌لختی، نارسایی دریچه سه‌لتی و تنگی دریچه سه‌لتی است.\\nبراثر سو مصرف مواد مخدر برخی داروها این دریچه ضعیف می‌شود و عملکرد طبیعی‌اش دچار اختلال می‌شود که به این بیماری رگرسیون یا نارسایی دریچه سه‌لختی گفته می‌شود.\\nنارسایی دریچه سه‌لختی در اثر عفونت‌های اندوکارد ممکن است ایجاد شود یا بر اثر تزریق‌های درون‌سیاهرگی مواد مخدر و داروهای دیگر عفونتی ایجاد شود که به قلب راست هم کشیده شود. این عفونت اغلب به وسیله باکتری‌های استافیلوکوکوس اورئوس ایجاد می‌شود.\\nهمچنین رماتیسم قلبی می‌تواند باعث تنگی یا نارسایی دریچهٔ سه‌لتی شود."},{"page_url":"https://en.wikipedia.org/wiki/Haleakal%C4%81_National_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Haleakala_National_Park_map_2008.08.jpg","page_title":"Haleakalā National Park","context_page_description":"Haleakalā National Park is an American national park located on the island of Maui in the state of Hawaii. Named after Haleakalā, a dormant volcano within its boundaries, the park covers an area of 33,265 acres, of which 24,719 acres is a wilderness area. The land was designated a national park in 1976 and its boundaries expanded in 2005."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%99%D7%96%D7%91%D7%9C_%D7%94%D7%A8%D7%90%D7%A9%D7%95%D7%A0%D7%94,_%D7%9E%D7%9C%D7%9B%D7%AA_%D7%99%D7%A8%D7%95%D7%A9%D7%9C%D7%99%D7%9D","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d8/IsabelaKOnrad.jpg","page_title":"איזבל הראשונה, מלכת ירושלים","context_page_description":"איזבל הראשונה, מלכת ירושלים הייתה מלכת ממלכת ירושלים הצלבנית. איזבל נולדה בשנת 1172, עלתה לכיסא המלוכה בשנת 1190 ונפטרה בשנת 1205. לכאורה - בת למשפחת מלוכה הקרובה למוקדי כוח ומחזיקה במושכות השלטון - הייתה המלכה איזבל דמות טרגית וחלשה ששימשה כבובה בידי כוחות פוליטיים חזקים ממנה שהשתמשו במעמדה החוקי כטוענת לכתר ממלכת ירושלים על מנת להשיא אותה לאצילים הזקוקים לה כ\\"חותמת כשרות\\" למימוש שאיפותיהם לכתר."},{"page_url":"https://vi.wikipedia.org/wiki/Val%C3%A9rie_Lemercier","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/VLemercier-Le_Petit_Nicolas%2C_Avant_Premi%C3%A8re.jpg","page_title":"Valérie Lemercier","context_page_description":"Valérie Lemercier là nữ ca sĩ, nữ diễn viên, người viết kịch bản và nữ đạo diễn người Pháp."},{"page_url":"https://fr.wikipedia.org/wiki/Dorstenia_gigas","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Dorstenia_gigas_3.jpg","page_title":"Dorstenia gigas","context_page_description":"Dorstenia gigas ou figuier de Socotra est une plante succulente de la même famille que le figuier, les Moraceae.\\nOn la trouve à l'état endémique sur l'île de Socotra au Yémen. Elle est généralement accrochée au sommet des falaises rocheuses de l'île, et a probablement disparu des autres parties de l'île du fait qu'elle est consommée par les chèvres à l'état sauvage sur l'île.\\nElle peut atteindre 1,20 mètre de diamètre pour 4 mètres de hauteur. Sur la partie basse du tronc se trouve un caudex."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%B0%D1%81%D0%BA%D0%BB%D0%B0%D0%B4%D1%83%D1%88%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/P240110_17.27_-01-.jpg","page_title":"Раскладушка","context_page_description":"Раскладушка — раскладная кровать, основа которой изготовлена из металлических труб с натянутой на них плотной тканью.\\nГлавное преимущество такой кровати — её транспортабельность и компактность."},{"page_url":"https://da.wikipedia.org/wiki/Renault_FT","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/FT-17-argonne-1918.gif","page_title":"Renault FT","context_page_description":"Renault FT eller Automitrailleuse à chenilles Renault FT modèle 1917 var en let fransk kampvogn. Det var en af de mest revolutionerende og indflydelsesrige kampvognsmodeller\\ni historien. FT var den første kampvogn, der var udstyret med et tårn der kunne drejes 360grader, og placeringen af tårnet øverst, motoren bagi og chaufføren foran blev den normale måde at udforme kampvogne på helt frem til i dag. Da den kom frem var det en revolutionerende fornyelse, der fik kampvognshistorikeren Steven Zaloga til at beskrive typen som \\"verdens første moderne kampvogn\\"."},{"page_url":"https://it.wikipedia.org/wiki/Lista_delle_piramidi_di_Lepsius","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Piramide_Khafra.jpg","page_title":"Lista delle piramidi di Lepsius","context_page_description":"Nel 1842 Karl Richard Lepsius guidò una esplorazione nel Basso Egitto ed elaborò una lista di tutte le piramidi esistenti. Lepsius le numerò partendo dal nord, iniziando da Abu Rawash. In seguito è stato dimostrato che alcune di queste strutture non erano vere piramidi, però tuttora la lista di Lepsius fornisce la base per la catalogazione delle piramidi egizie."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B8%E3%82%A7%E3%82%A4%E3%82%BD%E3%83%B3%E3%83%BB%E3%83%86%E3%83%AA%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/4_Jason_Terry.jpg","page_title":"ジェイソン・テリー","context_page_description":"ジェイソン・ユージーン・テリーは、アメリカ合衆国のワシントン州シアトル出身のバスケットボール選手。ポジションは主にシューティングガードだがポイントガードもできる。身長188cm、体重82kg。ひざの怪我を防ぐためにハイソックスを履いてプレーしていた。NBAでのスリーポイントフィールドゴール成功数は歴代3位である。"},{"page_url":"https://gl.wikipedia.org/wiki/Trento","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Trento_Duomo.jpg","page_title":"Trento","context_page_description":"Trento é unha cidade situada na rexión italiana de Trentino-Alto Adige ou Trentino-Südtirol. É a capital da rexión e da provincia autónoma de Trento. Trento foi territorio austríaco cando Benito Mussolini entrou a traballar nun xornal da cidade en 1908."},{"page_url":"https://sv.wikipedia.org/wiki/Amerikabrev","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/En_svensk_familjs_f%C3%B6rsta_hem_i_Minneapolis_i_Amerika.jpg","page_title":"Amerikabrev","context_page_description":"Amerikabrev var en del av den brevväxling som skedde i samband med emigrationen till Amerika.\\nAmerikabrev var en del av brevväxlingen mellan amerikanska immigranter och sina ursprungsländer, bland annat Sverige. De allra flesta amerikabreven skrevs på svenskamerikanska. Det som kännetecknar svenskamerikanska är blandningen av svensk bygdedialekt och engelska. Ibland var det svårt för mottagaren att kunna läsa innehållet på grund av språket. Brevväxlingen varade från år ca 1841 till 1928 i samband med den Amerikanska invandringen som skedde på grund av att Sverige befann sig i en svår ekonomisk situation. Förutom den svåra ekonomiska situationen var orsakerna till den svenska emigrationen brist på odlingsbar jord, religiös förföljelse och arbetslöshet. Många svenskar såg därför Amerika som “det lovande landet” eftersom amerikanerna hade kommit längre i sin utveckling. Därför beslöt sig många svenskar att emigrera till Amerika i hopp om ett bättre liv. Många av svenskarna bosatte sig i Minnesota vilket resulterade i en stat med en omfattande svensk befolkning."},{"page_url":"https://id.wikipedia.org/wiki/Musa","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Memorial_of_Moses%2C_Mt._Nebo.jpg","page_title":"Musa","context_page_description":"Musa adalah tokoh dalam Al-Qur'an, Alkitab, dan Tanakh. Dia merupakan sosok yang sangat dihormati dan dikenal dalam agama-agama Abrahamik. Bersama Harun, Musa dikenal sebagai seorang pemimpin dan nabi yang membebaskan Bani Israel dari perbudakan di Mesir. Taurat yang dialamatkan padanya menjadi landasan hukum utama bagi para nabi Bani Israel dan kehidupan beragama bangsa Yahudi."},{"page_url":"https://it.wikipedia.org/wiki/Lawil","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Emblem_Lawil.JPG","page_title":"Lawil","context_page_description":"La Lawil, ovvero Lawil Costruzioni Meccaniche e Automobilistiche fu una casa automobilistica italiana con sede a Varzi nell'Oltrepò Pavese che produsse autovetture tra il 1968 e il 1980 al ritmo di circa 5-10 esemplari al giorno."},{"page_url":"https://eo.wikipedia.org/wiki/Dax_(stacidomo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/TER_AQUITAINE_%2821443818839%29.jpg","page_title":"Dax (stacidomo)","context_page_description":"Dax estas franca stacidomo sur linioj Bordeaux-Saint-Jean - Irún kaj Puyoô - Dax, situanta en komunumo Dax, en departemento Landes, regiono Nova Akvitanio.\\nTemas pri stacidomo de Société nationale des chemins de fer français, priservata de trajnoj TGV kaj TER Nova Akvitanio."},{"page_url":"https://fr.wikipedia.org/wiki/Mus%C3%A9e_des_Avelines","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Saint-Cloud_Mus%C3%A9e_des_Avelines_001.JPG","page_title":"Musée des Avelines","context_page_description":"Le musée des Avelines, musée d'art et d'histoire de Saint-Cloud, est un musée municipal bénéficiant de l'appellation musée de France."},{"page_url":"https://en.wikipedia.org/wiki/Capitol_Park_Historic_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/DIME-JM_2116-C_Small.jpg","page_title":"Capitol Park Historic District","context_page_description":"The Capitol Park Historic District is a historic district located in downtown Detroit, Michigan. It is roughly bounded by Grand River, Woodward and Michigan Avenues, and Washington Boulevard. The district was listed on the National Register of Historic Places in 1999."},{"page_url":"https://nds.wikipedia.org/wiki/S%C3%BCnnerklaas","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Sinterklaas_zwarte_piet.jpg","page_title":"Sünnerklaas","context_page_description":"Sünnerklaas warrt in Bremen un ümto de Hillige Nikolaus nömmt. Up Nedderlannsch heet he Sinterklaas."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A8%D9%8A%D9%84_%D9%85%D9%83%D8%AC%D9%88%D9%86%D9%8A%D8%AC%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/BillMcGunnigle.jpg","page_title":"بيل مكجونيجل","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nبيل مكجونيجل كان لاعب كورة قدم من امريكا."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A3%D1%81%D1%82%D0%B5%D0%BD%D0%BA%D0%BE_%D0%9E%D0%BB%D0%B5%D0%BA%D1%81%D1%96%D0%B9_%D0%9E%D0%BB%D0%B5%D0%B3%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/%D0%9D%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D0%B8%D0%B9_%D0%B4%D0%B5%D0%BF%D1%83%D1%82%D0%B0%D1%82_%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B8_%D0%9E%D0%BB%D1%96%D0%BA%D1%81%D1%96%D0%B9_%D0%A3%D1%81%D1%82%D0%B5%D0%BD%D0%BA%D0%BE.jpg","page_title":"Устенко Олексій Олегович","context_page_description":"Олексій Олегович Устенко — український політик та економіст. Народний депутат України IX скликання."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D0%BB%D0%B1%D0%B5%D1%80_%D0%AE%D0%B4%D0%B5%D1%80%D0%B7%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Albert_Uderzo_2012.jpg","page_title":"Албер Юдерзо","context_page_description":"Албѐр Юдерзо̀ е френски художник.\\nИзвестен е главно с комиксите за Астерикс.\\nПрез 1959 г. участват в създаването на детското списание „Пилот“. В първия му брой се появява гал, наречен Астерикс.\\nТази статия за французин все още е мъниче. Помогнете на Уикипедия, като я редактирате и разширите.\\nТази статия, свързана с комикси все още е мъниче. Помогнете на Уикипедия, като я редактирате и разширите."},{"page_url":"https://nl.wikipedia.org/wiki/Marvin_Friedrich","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Marvin_Friedrich_20150416.jpg","page_title":"Marvin Friedrich","context_page_description":"Marvin Friedrich is een Duits voetballer die bij voorkeur als centrale verdediger speelt. Hij tekende in juni 2016 een contract tot medio 2019 bij FC Augsburg, dat hem overnam van Schalke 04. In zijn verbintenis werd een optie voor nog een seizoen opgenomen."},{"page_url":"https://de.wikipedia.org/wiki/Moderne21","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Martin_Reiter-Nadia_Panknin-Hartmut_Luehr-2010.jpg","page_title":"Moderne21","context_page_description":"moderne21 ist eine Gruppe politischer Aktivisten, die 2007 aus einer Initiative des Berliner Kunsthauses Tacheles hervorging. Nach der Zwangsräumung des Kunsthauses im September 2012 besteht die Gruppe im Internet fort, wo sie gesellschaftliche Probleme, wie Vereinsamung und Politikverdrossenheit, satirisch aufgreift."},{"page_url":"https://gl.wikipedia.org/wiki/1630","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Jos%C3%A9_de_Ribera_054.jpg","page_title":"1630","context_page_description":"16 de febreiro - Invasión holandesa do Brasil, tomando a cidade de Olinda.\\n17 de setembro - Fundación da cidade de Boston en Norteamérica."},{"page_url":"https://pl.wikipedia.org/wiki/Bastan%C3%A8s","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Bastan%C3%A8s2.jpg","page_title":"Bastanès","context_page_description":"Bastanès – miejscowość i gmina we Francji, w regionie Nowa Akwitania, w departamencie Pireneje Atlantyckie.\\nWedług danych na rok 1990 gminę zamieszkiwało 105 osób, a gęstość zaludnienia wynosiła 20 osób/km²."},{"page_url":"https://ne.wikipedia.org/wiki/%E0%A4%97%E0%A5%8B%E0%A4%B0%E0%A4%96%E0%A4%BE_%E0%A4%9C%E0%A4%BF%E0%A4%B2%E0%A5%8D%E0%A4%B2%E0%A4%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Kings_Palace_Gorkha_Nepal.jpg","page_title":"गोरखा जिल्ला","context_page_description":"गोरखा नेपालको गण्डकी अञ्चल अवस्थित एक जिल्ला हो। यो हालको संरचना अनुसार गण्डकी प्रदेशको ११ जिल्ला मध्ये ऐतिहासिक, धार्मिक, साँस्कृतिक तथा पर्यटकीय दृष्टिले महत्त्वपूर्ण जिल्ला हो। गोरखा जिल्लाको सदरमुकाम गोरखा बजार हो जुन पृथ्वीनारायण नगरपालिकामा पर्दछ। गोरखा जिल्लामा ११ स्थानीय निकाय अन्तर्गत २ नगरपालिका, ९ गाउँपालिका र २ निर्वाचन क्षेत्र रहेको छ। भौगोलिकरुपमा मध्यपहाडीदेखि उत्तरी हिमाली क्षेत्रसम्म फेलिएको जैविक विविधताले सम्पन्न जिल्ला हो। यसको क्षेत्रफल ३ हजार ३१० वर्ग किलोमिटर छ। समुद्र सतहदेखि २२८ मिटरदेखि ८१६३ मिटरसम्म उचाइमा अवस्थित तथा २७ हजार ०१५ देखि २८ हजार ०१५’ अक्षांश र ८४ हजार ०२७’ देखि ८४ हजार ०५८’ देशान्तरमा फैलिएको यस जिल्लामा उष्ण, सम-शितोष्ण, शितोष्ण, लेकाली र हिमाली हावापानी पाइन्छ। यस जिल्लाको पूर्वतिर धादिङ जिल्ला र तिब्बत; पश्चिम सीमानामा तनहुँ जिल्ला, लमजुङ जिल्ला, मनाङ जिल्ला र तिब्बत, उत्तर सीमानामा तिब्बत तथा दक्षिण सीमानामा चितवन जिल्ला, तनहुँ जिल्ला र धादिङ जिल्ला पर्दछन्।\\nराष्ट्रिय जनगणना २०६८ अनुसार गोरखा जिल्लाको कूल जनसङ्ख्या २, ७१, ०६१ जना मध्ये पुरुष १, २१, ०४१ जना र महिला १, ५०, ०२० रहेका छन्।"},{"page_url":"https://ko.wikipedia.org/wiki/%EB%8C%80%EB%A5%99%EB%B6%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Continental_shelf.png","page_title":"대륙붕","context_page_description":"대륙붕은 수심이 35미터 ~ 240미터인 대륙의 연장 부분으로 해수면의 상승과 파도의 침식작용에 의해 운반된 퇴적물이 쌓여서 만들어진 지형으로, 쉽게 설명하자면, 영해의 밖에 있는 비교적 얕은 공해의 해저 부분을 말한다.\\n해양 면적의 8%에 불과하지만 수산, 광산 자원이 풍부하다. 생물의 종류는 매우 많고, 그 양은 해양 전체의 거의 절반을 차지한다. 대륙붕을 구성하는 퇴적물은 그 지역의 기후와 해수면의 변화와 관련이 있으며 천연가스나 석유 같은 지하자원이 매장되어 있는 경우가 많다."},{"page_url":"https://es.wikipedia.org/wiki/Caelestis","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ec/Dougga_caelestis.jpg","page_title":"Caelestis","context_page_description":"Dea Caelestis o Calestis era una diosa romana asimilada a la diosa púnica Tanit, patrona de Cartago.​"},{"page_url":"https://de.wikipedia.org/wiki/Forschungsstation","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Amundsen-scott-south_pole_station_2006.jpg","page_title":"Forschungsstation","context_page_description":"Eine Forschungsstation ist meist eine Ansammlung von Behausungen, die Wissenschaftlern während Forschungskampagnen als Unterkunft in oft unwirtlichen Gebieten, wie z. B. der Antarktis, dient. Geografisch werden Forschungsstationen als Siedlungsinseln in den nicht nutzbaren Räumen der Erdoberfläche der sogenannten Periökumene zugeordnet.\\nSie beherbergt meist verschiedene Labore, Freizeiträumlichkeiten oder auch Garagen für Fahrzeuge."},{"page_url":"https://en.wikipedia.org/wiki/First_Toa_Payoh_Secondary_School","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/FTPSS_School_Campus_at_Toa_Payoh_East.JPG","page_title":"First Toa Payoh Secondary School","context_page_description":"First Toa Payoh Secondary School was a former secondary school in Toa Payoh, Singapore. Founded in 1968, the school was the first secondary school to cater to the population of Singapore's satellite town, Toa Payoh. First Toa Payoh Secondary School was merged into Bartley Secondary School in January 2016."},{"page_url":"https://pt.wikipedia.org/wiki/Covington_(Ohio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Post_office_in_Covington%2C_Ohio.jpg","page_title":"Covington (Ohio)","context_page_description":"Covington é uma vila localizada no estado norte-americano de Ohio, no Condado de Miami."},{"page_url":"https://arz.wikipedia.org/wiki/%DA%86%D9%8A%D8%A7%D9%86_%D9%BE%D9%88%D9%84_%D9%84%D9%8A%D9%84%D9%8A%D9%86%D9%81%D9%8A%D9%84%D8%AF","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d3/Jean-Paul_Lilienfeld_2013.jpg","page_title":"چيان پول ليلينفيلد","context_page_description":"چيان پول ليلينفيلد مخرج افلام من فرنسا."},{"page_url":"https://fr.wikipedia.org/wiki/Mae_Sot","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Seal_of_Mae_Sot.png","page_title":"Mae Sot","context_page_description":"Mae Sot est une ville de l'Ouest de la Thaïlande située dans la province de Tak et frontalière de la Birmanie, dont elle est séparée par la Moei. La ville est connue pour son commerce et pour son importante communauté de réfugiés birmans. Mae Sot se trouve sur la route principale entre la Thaïlande et la Birmanie."},{"page_url":"https://es.wikipedia.org/wiki/Cascada_del_%C3%89zaro","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/%C3%89zaro_-_Cascada_-BT-_02.jpg","page_title":"Cascada del Ézaro","context_page_description":"La cascada del Ézaro o cascada del Jallas, es una cascada que forma el río Jallas en su desembocadura al mar. Está situada en el municipio de Dumbría, provincia de La Coruña, en la comunidad autónoma de Galicia.\\nDesde hace 7 años aproximadamente tiene un caudal mínimo ecológico. Por lo que se puede disfrutar de ella en cualquier época del año.\\nDesde luego, su mejor época es en el invierno, donde hay mayores cantidades de precipitaciones."},{"page_url":"https://sv.wikipedia.org/wiki/Islandstorget_(tunnelbanestation)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Islandstorget_Tunnelbana.png","page_title":"Islandstorget (tunnelbanestation)","context_page_description":"Islandstorget är en station inom Stockholms tunnelbana belägen i stadsdelen Södra Ängby i Västerort inom Stockholms kommun längs den gröna linjen. Den ligger mellan stationerna Ängbyplan och Blackeberg. Avståndet från station Slussen är 13,3 kilometer. Tunnelbanestationen togs i bruk den 26 oktober 1952 när t-banan Hötorget–Vällingby invigdes, men innan dess hade Islandstorget varit ändhållplats för spårvagnarna på Ängbybanan linje 11 sedan den 1 oktober 1944.\\nStationen ligger utmed Bergslagsvägen, öster om Blackebergsvägen. Det finns en plattform utomhus med entré i den västra änden från Blackebergsvägen 112–114."},{"page_url":"https://sv.wikipedia.org/wiki/Bitterskr%C3%A5p","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Petasites_japonicus.jpg","page_title":"Bitterskråp","context_page_description":"Bitterskråp är en växtart i familjen korgblommiga växter."},{"page_url":"https://it.wikipedia.org/wiki/Algyroides_fitzingeri","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Algyroides_fitzingeri.JPG","page_title":"Algyroides fitzingeri","context_page_description":"L'algiroide nano o algiroide di Fitzinger è un rettile della famiglia Lacertidae, diffuso in Sardegna e Corsica.\\nL'epiteto specifico è un omaggio al naturalista austriaco Leopold Josef Fitzinger."},{"page_url":"https://en.wikipedia.org/wiki/Ateneo_de_Sevilla","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Ateneo_Isla_Cristina.JPG","page_title":"Ateneo de Sevilla","context_page_description":"The Ateneo de Sevilla, originally called Excursions Ateneo and Society, is a cultural association in Seville founded in 1887 by D. Manuel Sales y Ferré. It became prominent in the early 20th century and was known for its meetings of the Generation of '27."},{"page_url":"https://no.wikipedia.org/wiki/Almeirim_(Par%C3%A1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Cachoeira_de_Panama.JPG","page_title":"Almeirim (Pará)","context_page_description":"Almeirim er en kommune i delstaten Pará i nordregionen av Brasil."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D9%83%D8%AA%D8%A7%D8%A8_%D8%A3%D8%B1%D8%AC%D9%86%D8%AA%D9%8A%D9%86%D9%8A%D9%8A%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8c/Jos%C3%A9_Hern%C3%A1ndez_Argentino.jpg","page_title":"قائمة كتاب أرجنتينيين","context_page_description":"قائمة للكُتّاب الأرجنتينيون المشهورون أو البارزون:"},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D9%84%DB%8C%D8%B3%D8%A7%DB%8C_%D8%B1%D8%B3%D8%AA%D8%A7%D8%AE%DB%8C%D8%B2_%D9%85%D8%B3%DB%8C%D8%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Ivanovo_Obl_Vichuga_asv2018-08_img02.jpg","page_title":"کلیسای رستاخیز مسیح","context_page_description":"کلیسای رستاخیز مسیح یا کلیسای سرخ نام یک کلیسای ارتدکس شرقی است که در شهر ویچوگا در استان ایوانوف، روسیه واقع شده‌است. این کلیسا توسط ایوان سرگییویچ کوزنیتسوف و در سبک معماری احیاگری روسی ساخته‌شد.\\nکلیسای رستاخیز مسیح، یکی از بزرگترین کلیساهای ارتدکس شرقی در روسیه مرکزی و یکی از بناهای شاخص معماری سده ۲۰ در سبک نرو روسی است. طراحی منحصر به‌فرد نمای خارجی با پانل‌های مایولیکا جلوه‌ای ویژه به کلیسا بخشیده‌است."},{"page_url":"https://en.wikipedia.org/wiki/Pitcairnioideae","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Puya_berteroana.jpg","page_title":"Pitcairnioideae","context_page_description":"The Pitcairnioideae comprise the terrestrial subfamily of the bromeliads with over 1000 species in 16 genera. Unlike the many epiphytes and lithophytes which make up the rest of the family, with a few exceptions, all of the members of this subfamily are either terrestrial or saxicolous. Common to arid and high-altitude regions, this subfamily is considered to have the most ancient lineage, more closely resembling its grassy relatives than the exotic novelties represented in the other two subfamilies. The commonly cultivated genera from this group include Dyckia, Hechtia, Pitcairnia, and Puya."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%8F%99%E5%88%A9%E4%BA%9A%E6%80%BB%E7%BB%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Khalid_al-Azm.jpg","page_title":"叙利亚总统","context_page_description":"敘利亞總統是敘利亞的國家元首，敘利亞從鄂圖曼帝國獨立以後，於1918年實行君主制，1920年被法國委任統治。1946年，獨立實行共和制。"},{"page_url":"https://nl.wikipedia.org/wiki/Museum_van_Anatolische_beschavingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Museum_of_Anatolian_Civilizations_1320259_nevit.jpg","page_title":"Museum van Anatolische beschavingen","context_page_description":"Het Museum van de Anatolische beschavingen of Museum van de Anatolische culturen/Archeologisch museum in de Turkse hoofdstad Ankara is ondergebracht in een gerestaureerde bazaar die tussen 1464 en 1471 onder Mehmet II werd gebouwd. Het is gelegen op de zuidzijde van het Ankara-kasteel in de wijk Atpazarı. Het bestaat uit de oude Mahmut Paşa-bazaar en de Kurşunlu Han. Het is zonder twijfel een van de belangrijkste bezienswaardigheden van Ankara. In de centrale zaal bevinden zich sculpturen uit de tijd der Hettieten, in de ruimten daaromheen kleinere vondsten vanaf het paleolithicum tot en met de klassieke tijd."},{"page_url":"https://ga.wikipedia.org/wiki/Asturias","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/PicosDeEuropa.jpg","page_title":"Asturias","context_page_description":"Is comhphobal féinrialaithe é Asturias laistigh de ríocht na Spáinne.\\nTá Asturias suite ar chósta thuaidh na Spáinne lena aghaidh ar Bhá na Bioscáine. Tá sé teorainn ar theorainn le Cantabria san oirthear, le Castilla y León ó dheas agus le Galicia san iarthar.\\nIs iad na cathracha is tábhachtaí ná, an phríomhchathair, Oviedo, an calafort agus an chathair is mó sa réigiún Gijón, agus an baile tionscalaíochta, Avilés.\\nBailte eile: Mieres, Langreo, Siero, Cangas de Onís, Cangas del Narcea, Grado, Lena, Laviana, El Entrego, Villaviciosa, agus Llanes."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Auerbach_in_der_Oberpfalz","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Auerbach_in_der_Oberpfalz_-_Unterer_Markt_31_-_01.jpg","page_title":"Liste der Baudenkmäler in Auerbach in der Oberpfalz","context_page_description":"Auf dieser Seite sind die Baudenkmäler der Oberpfälzer Stadt Auerbach in der Oberpfalz zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://fr.wikipedia.org/wiki/Cartel%C3%A8gue","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f9/Cartelegue_foyer.JPG","page_title":"Cartelègue","context_page_description":"Cartelègue est une commune du Sud-Ouest de la France, dans le département de la Gironde, en région Nouvelle-Aquitaine.\\nSes habitants s'appellent les Cartelèguais."},{"page_url":"https://da.wikipedia.org/wiki/Oldtidens_Athen","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b6/Ac.agora3.jpg","page_title":"Oldtidens Athen","context_page_description":"Byen Athen var i Oldtidens Grækenland og i oldtiden generelt et kraftcenter for kultur, videnskab og filosofi og den vigtigste bystat, der ledte Det Deliske Søforbund i den [Peloponnesiske Krig]] mod Sparta."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%D9%85%D9%86%D8%AF%D8%B1%D9%87%D8%A7%DB%8C_%D8%A2%D8%B3%DB%8C%D8%A7%DB%8C%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Hynobius_kimurae_%28cropped%29_edit.jpg","page_title":"سمندرهای آسیایی","context_page_description":"سمندرهای آسیایی تیره‌ای از راسته سمندرها می‌باشند. این تیره در بیشتر جاهای آسیا و اوراسیا یافت می‌گردد. تیره سمندرهای آسیایی شامل ۵۴ گونه‌است. سمندر کوهستانی ایران گونه‌ای از این تیره است."},{"page_url":"https://de.wikipedia.org/wiki/NGC_2747","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/NGC2747_-_SDSS_DR14.jpg","page_title":"NGC 2747","context_page_description":"NGC 2747 ist eine spiralförmige Zwerggalaxie vom Hubble-Typ S im Sternbild Krebs auf der Ekliptik. Sie ist schätzungsweise 183 Millionen Lichtjahre von der Milchstraße entfernt und hat einen Durchmesser von etwa 20.000 Lichtjahren.\\nIm selben Himmelsareal befinden sich u. a. die Galaxien NGC 2744, NGC 2749, NGC 2751, NGC 2752.\\nDas Objekt wurde am 29. März 1865 von Albert Marth entdeckt."},{"page_url":"https://en.wikipedia.org/wiki/Nicolaas_Beets","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Hildebrand_monument_Haarlem.JPG","page_title":"Nicolaas Beets","context_page_description":"Nicolaas Beets was a Dutch theologian, writer and poet. He published under the pseudonym, Hildebrand."},{"page_url":"https://sk.wikipedia.org/wiki/Wei%C3%9Fenbach_an_der_Enns","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Wei%C3%9Fenbach_Enns_ehem_Sch%C3%BCttkasten.JPG","page_title":"Weißenbach an der Enns","context_page_description":"Weißenbach an der Enns bola do 31. decembra 2014 samostatná trhová obec v Rakúsku v spolkovej krajine Štajersko v okrese Liezen. 1. januára 2015 bola trhová obec Weißenbach an der Enns spojená s trhovou obcou Sankt Gallen. Spojená trhová obec má názov Sankt Gallen.\\nObec mala rozlohu 68,59 km² a 1. januára 2014 v nej žilo 483 obyvateľov."},{"page_url":"https://it.wikipedia.org/wiki/Principato_di_Benevento_(et%C3%A0_napoleonica)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Benevento_1742.JPG","page_title":"Principato di Benevento (età napoleonica)","context_page_description":"Il principato di Benevento fu un piccolo Stato formalmente indipendente costituito da Napoleone I nel 1806, retto dal marchese Charles Maurice de Talleyrand-Périgord. Il suo territorio era limitato alla città e a pochi borghi, ricalcando così la precedente enclave pontificia all'interno del regno di Napoli. Aveva un perimetro di 36 miglia napoletane ed una superficie di 40.000 moggi. Oltre al capoluogo comprendeva un contado suddiviso in dodici centri: Sant'Angelo a Cupolo, Motta, Panelli, Pastene, Maccabei, Bagnara, Montorso, Maccoli, Perillo, Sciarra, San Leucio, San Marco ai Monti."},{"page_url":"https://cs.wikipedia.org/wiki/Hippies","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/RussianRainbowGathering_4Aug2005.jpg","page_title":"Hippies","context_page_description":"Hippies [hipíz], jedn. čís. hippy, je hnutí, které vzniklo v 60. letech v USA.\\nJednalo se o hnutí neorganizované, vycházející z generace beatniků. Samo slovo hippie je zdrobnělinou výrazu hipster, který beatnici často užívali k popisu nonkonformních hrdinů svých děl. Šířit se začalo v polovině 60. let ze západního pobřeží USA, ze San Francisca. Cíle „hippísáků“ byly nejednotné, za základní lze ale považovat vzpouru proti společnosti, mír, lásku, přátelství, svobodu. K naplnění těchto cílů se sdružovali do skupin či komun, které pak často provozovaly volnou lásku. Často se užívaly drogy – zvláště psychedelické. Častým cílem byl někdy ale jen opak chování většinové společnosti a vyjádření protestu. Hippies propagovali spontánní chování, lásku a prosazovali názor, že si člověk má užít života a nebudovat kariéru, nehonit se za penězi. Příslušníci hippies nosili často dlouhé vlasy, volné oblečení a korálky a celkově prosazovali „primitivní“ vzhled jako projev negativní reakce proti většinové metrosexualitě u mužů v 30., 40. a 50. letech 20. století."},{"page_url":"https://sv.wikipedia.org/wiki/Henrik_Meurman","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Henrik_Muerman.jpg","page_title":"Henrik Meurman","context_page_description":"Henrik Meurman, född 15 juli 1625, död före 6 augusti 1672 i Stockholm, var sidenhandlande, borgare och extra ordinarie rådman i Stockholm. Vid Västerlånggatan 52 hade han Sidenhuset Pärlan, Sveriges första handelsbod för siden och silke."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BB%D0%B0%D1%82%D0%BE%D0%BD_(%D0%BB%D1%83%D0%BD%D0%BD%D1%8B%D0%B9_%D0%BA%D1%80%D0%B0%D1%82%D0%B5%D1%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Plato_%28LRO%29.png","page_title":"Платон (лунный кратер)","context_page_description":"Кратер Платон — древний крупный ударный кратер на видимой стороне Луны на северо-восточной границе Моря Дождей, в северо-западной оконечности гор Альпы. Назван в честь древнегреческого философа Платона, название впервые предложено Джованни Риччоли в 1651 году, окончательно закреплено Международным астрономическим союзом в 1935 году. Кратер образовался в позднеимбрийскую эпоху, возраст его оценивается в 3,84 миллиарда лет, что немного меньше возраста Моря Дождей. Диаметр кратера составляет приблизительно 95-100 км."},{"page_url":"https://pl.wikipedia.org/wiki/Nacjonalizm_ukrai%C5%84ski","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/OUN-r_Flag_1941.svg","page_title":"Nacjonalizm ukraiński","context_page_description":"Nacjonalizm ukraiński – ukraiński nurt myśli politycznej i związany z nim ruch polityczny, powstały w pierwszej połowie XIX wieku.\\nJego celem było utworzenie niepodległego i zjednoczonego państwa ukraińskiego. Ukraiński ruch narodowy w okresie tworzenia toczył zażartą walkę z ruchem moskalofilskim.\\nJednym ze skutków działań nacjonalistów ukraińskich było ludobójstwo polskiej ludności cywilnej na Wołyniu i w Małopolsce Wschodniej. Innym – po zakończeniu II wojny światowej – był opór przeciw sowietyzacji zachodniej Ukrainy.\\nNacjonalizm ukraiński w latach 30. XX w. wykazywał wiele cech charakterystycznych dla faszyzmu i nacjonalizmu integralnego, określanego w ukraińskiej literaturze nacjonalistycznej mianem „czynnego nacjonalizmu”, jako przeciwstawienie do tradycyjnych nacjonalizmów europejskich. Jego głównym reprezentantem w XX w. była Organizacja Ukraińskich Nacjonalistów, powstała w 1929 roku w Wiedniu z połączenia kilku mniejszych organizacji, przede wszystkim Ukraińskiej Organizacji Wojskowej, utworzonej w 1920 roku."},{"page_url":"https://pl.wikipedia.org/wiki/Ratibo%C5%99_(powiat_Jind%C5%99ich%C5%AFv_Hradec)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Kapli%C4%8Dka_Ratibo%C5%99.jpg","page_title":"Ratiboř (powiat Jindřichův Hradec)","context_page_description":"Ratiboř – wieś i gmina w Czechach, w powiecie Jindřichův Hradec, w kraju południowoczeskim. Według danych z dnia 1 stycznia 2013 liczyła 187 mieszkańców."},{"page_url":"https://sv.wikipedia.org/wiki/Perros-Guirec","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Moulin_du_Crach.jpg","page_title":"Perros-Guirec","context_page_description":"Perros-Guirec är en kommun i departementet Côtes-d'Armor i regionen Bretagne i nordvästra Frankrike. Kommunen ligger i kantonen Perros-Guirec som tillhör arrondissementet Lannion. År 2009 hade Perros-Guirec 7 375 invånare."},{"page_url":"https://de.wikipedia.org/wiki/Altes_Elberfelder_Rathaus","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Das_neue_Rathaus%2C_Detail_aus_Henry_Abbott%2C_Elberfeld_im_Grundri%C3%9F_und_mit_seinen_vorz%C3%BCglichsten_Geb%C3%A4uden%2C_1828.png","page_title":"Altes Elberfelder Rathaus","context_page_description":"Das Alte Elberfelder Rathaus ist das ehemalige Rathausgebäude der bis 1929 selbständigen Stadt Elberfeld, heute ein Stadtteil von Wuppertal.\\nSchon 1815 hatte es Überlegungen gegeben, das ältere, zu klein gewordene Rathaus zu erweitern oder umzubauen. Der damalige Oberbürgermeister Johann Rütger Brüning hatte hierfür 1816 Entwürfe bei verschiedenen Architekten in Auftrag gegeben. Mit dem Bau der Laurentiuskirche und dem Abriss der alten Kirche war aber schließlich am Turmhof eine geeignete Fläche für einen Neubau entstanden. Ursprünglich befand sich an der Stelle die mittelalterliche Burg Elberfeld, die heutigen Straßen wie Burgstraße, Wall oder Turmhof den Namen gegeben hat. Die Burg war bei einem Brand 1537 zerstört worden.\\nFür den dreigeschossigen Bau von Johann Peter Cremer mit starken Anleihen bei der italienischen Renaissancearchitektur wurde am 21. Mai 1828 den Grundstein gelegt. Zum 1. November 1831 konnte der damals ausgeführte Teil schon von der Stadtverwaltung bezogen werden. In einem zweiten Bauabschnitt bis 1842 wurde der Bau dann vollendet. Hierzu gehören etwa die Reihen von Rundbogenfenstern, die profilierten Fensterlaibungen und eine Arkadenreihe."},{"page_url":"https://tr.wikipedia.org/wiki/Brazil,_Indiana","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/West_National_in_downtown_Brazil.jpg","page_title":"Brazil, Indiana","context_page_description":"Brazil, Amerika Birleşik Devletleri'nin Indiana eyaletinde yer alan ve Clay ilçesinde yer alan bir şehirdir. Şehrin nüfusu 26 Kasım 2009 tarihinde toplam nüfusu 7,912'dir."},{"page_url":"https://sv.wikipedia.org/wiki/Clermont-le-Fort","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/France-Clermont-le-Fort-Mairie.jpg","page_title":"Clermont-le-Fort","context_page_description":"Clermont-le-Fort är en kommun i departementet Haute-Garonne i regionen Occitanien i södra Frankrike. Kommunen ligger i kantonen Castanet-Tolosan som tillhör arrondissementet Toulouse. År 2009 hade Clermont-le-Fort 524 invånare."},{"page_url":"https://tr.wikipedia.org/wiki/Phocas","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/RomaForoRomanoColonnaFoca2.JPG","page_title":"Phocas","context_page_description":"Phocas Bizans imparatoru. Lejyon gedikli subaylarındandı. İmparator Mauricius'a karşı bir askeri ayaklanmaya elebaşılık yapıp isyan başarılı olunca imparatorluk görevini gaspedip meşru İmparator Mauricius'un boynunu vurdurdu. Hükümdarlığı zamanında Pers-Sasani istilaları ve içeride ardı arkası gelmeyen suikastler oldu. 610'da Herakleios tarafından tahttan indirildi ve öldürüldü."},{"page_url":"https://vi.wikipedia.org/wiki/Acer_pseudoplatanus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Acer_pseudoplatanusAA.jpg","page_title":"Acer pseudoplatanus","context_page_description":"Acer pseudoplatanus là một loài thực vật có hoa thuộc chi Phong, họ Bồ hòn. Loài này được Carl von Linné mô tả khoa học đầu tiên năm 1753."},{"page_url":"https://fr.wikipedia.org/wiki/Arthur_Conan_Doyle","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Sherlock_Holmes_%26_Watson_-_The_Greek_Interpreter_-_Sidney_Paget.jpg","page_title":"Arthur Conan Doyle","context_page_description":"Arthur Conan Doyle, né Arthur Ignatius Conan Doyle le 22 mai 1859 à Édimbourg et mort le 7 juillet 1930 à Crowborough, est un écrivain et médecin britannique. Conan est l'un de ses prénoms et Doyle son nom de famille. Il doit sa célébrité à ses romans et nouvelles mettant en scène le détective Sherlock Holmes — considérés comme une innovation majeure du roman policier — et le professeur Challenger. Cet écrivain prolifique a également été l'auteur de livres de science-fiction, de romans historiques, de pièces de théâtre, de poésies et d'œuvres historiques.\\nIl est élevé au rang de Chevalier de l'ordre du Très vénérable ordre de Saint-Jean par le roi Édouard VII le 24 octobre 1902."},{"page_url":"https://ro.wikipedia.org/wiki/Soporu_de_C%C3%A2mpie,_Cluj","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Soporu_de_Campie-DSCF3164.JPG","page_title":"Soporu de Câmpie, Cluj","context_page_description":"Soporu de Câmpie, este un sat în comuna Frata din județul Cluj, Transilvania, România. Pe teritoriul actualei așezări s-au descoperit urmele unui cimitir dacic. Pe baza întregului material arheologic și a caracteristicilor sale, cimitirul de la Soporu de Câmpie a fost datat începând cu mijlocul sec. II d. Hr., până la sfârșitul epocii romane și atribuit unei comunități autohtone din provincie. Satul este cunoscut pentru tradițiile populare românești promovate de Taraful din Soporu de Câmpie și de formațiile de dansuri populare din localitate. Până în 1966 a avut statut de comună."},{"page_url":"https://ast.wikipedia.org/wiki/Asia_del_Sur","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c6/Mittlerer_Osten_Karte.png","page_title":"Asia del Sur","context_page_description":"Asia del Sur, Asia Meridional o Sur d'Asia ye una de los ventidós subrexones en que la ONX estrema'l mundu. Ta compuesta por nueve paísesː Afganistán, Bangladex, Bután, India, Irán, Maldives, Nepal, Paquistán y Sri Lanka. Los sos Aglomeraciones urbanes más poblaes del mundu mayores ciudaes son: Delhi, Karachi, Bombay y Daca.\\nLlenda al norte con Asia Central y Asia del Este, al este con Sudeste Asiáticu y la badea de Bengala, al sur y suroeste col océanu Índicu, mar Arábigu, golfu de Omán y golfu Pérsicu, y al oeste con Asia Occidental. Ye la rexón más poblada de los seis, con 1 831 046 000 hab. en 2013, y tamién ye la más densamente poblada con 271,3 hab/km².\\nXeográficamente toma los países entendíos ente la meseta iranina y el subcontinente indiu. Dende un puntu de vista cultural Asia del Sur constitúi l'orixe de los pueblos indoarios de llingües indoiranias y tópase arrodiáu pol mundu árabe, los pueblos túrquicos y el alloñáu Oriente.\\nA pesar de les carauterístiques comunes descrites, estos países tán escasamente cohesionados. Anque los idiomes nacionales de toos estos países son llingües indoeuropees esisten grandes grupos non indoeuropeos especialmente n'India."},{"page_url":"https://sh.wikipedia.org/wiki/Opatija_V%C3%A9zelay","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Basilique_Ste-Marie-Madeleine_-_Chapiteau_2N.JPG","page_title":"Opatija Vézelay","context_page_description":"Opatija Vézelay, znana i kao Bazilika Svete Marije Magdalene je bila samostan u Vézelayu u francuskom departmanu Yonne u pokrajini Burgundiji. Benediktinska opatska crkva Svete Marije Magdalene iz 12. stoljeća, zajedno sa svojim slikama i skulpturama na kapitelima i portalima, predstavlja jedinstveno remek-djelo burgundske romaničke umjetnosti i arhitekture, premda je veći dio izvanjskih skulptura uništen za vrijeme francuske revolucije. Crkva i brdo u Vézelayu su dospjeli na UNESCOv popis mjesta svjetske baštine u Europi 1979. godine."},{"page_url":"https://ro.wikipedia.org/wiki/Octav_B%C4%83ncil%C4%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Octav_Bancila_-_Caruta_cu_nomazi.jpg","page_title":"Octav Băncilă","context_page_description":"Octav Băncilă a fost un pictor realist român. Datorită influențelor pe care le-a avut din copilărie din partea deputatului socialist Ion Nădejde, a feministei marxiste jurnalista Sofia Nădejde și a lui Nicolae Beldiceanu care au înființat revista Contemporanul, principiile care l-au călăuzit în viață precum și întreaga carieră plastică a lui Octav Băncilă au fost tributare ideilor socialiste, fapt pentru care a fost și un fervent activist politic de stânga. Ca urmare, a înființat în anul 1919 împreună cu Constantin Ion Parhon și cu Paul Bujor Partidul Muncitor, care a avut o viață scurtă, deoarece a fuzionat în scurt timp de la înființare cu Partidul Țărănesc. Cu toate că la sfârșitul vieții a fost un simpatizant al ideilor comuniste, el nu a fost niciodată membru al Partidului Comunist Român.\\nOctav Băncilă a făcut studiile la Școala de Arte Frumoase din Iași și i-a avut ca profesori pe Gheorghe Panaiteanu-Bardasare și Constantin Stahi."},{"page_url":"https://ca.wikipedia.org/wiki/%C3%89manville_(Eure)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/%C3%89manville_%28Eure%2C_fr%29_city_limit_sign.JPG","page_title":"Émanville (Eure)","context_page_description":"Émanville és un municipi francès, situat al departament de l'Eure i a la regió de Normandia. L'any 2007 tenia 533 habitants."},{"page_url":"https://de.wikipedia.org/wiki/Blutwunder_von_Walld%C3%BCrn","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Blutaltar%2C_Walld%C3%BCrn_%28Germany%29_2.JPG","page_title":"Blutwunder von Walldürn","context_page_description":"Das Blutwunder von Walldürn gab den Ursprung der Wallfahrt nach Walldürn in Baden-Württemberg. In der dortigen Wallfahrtsbasilika St. Georg wird ein Korporale aus dem Jahr 1330 mit dem Bild des Gekreuzigten verehrt."},{"page_url":"https://cs.wikipedia.org/wiki/Peter_Roget","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Roget_P_M.jpg","page_title":"Peter Roget","context_page_description":"Peter Mark Roget byl britský vědec. Byl synem švýcarského kněze, vystudoval medicínu na univerzitě v Edinburghu, později se stal přírodovědcem, teologem, fyzikem a lexikografem. Jeho nejslavnějším dílem je Thesaurus of English words and phrases, známější jako Rogetův tezaurus, přestože jde „jen“ o kompilaci starších prací podobného druhu. Roget pomohl založit fakultu medicíny na univerzitě v Manchesteru, byl také jedním ze zakladatelů Medical and chirurgical society of London, později změněné na Královskou lékařskou společnost, jejímž byl sekretářem. V roce 1815 vynalezl logaritmické pravítko, které umožňovalo počítání logaritmů, což umožňovalo přímé umocňování a odmocňování. Publikoval mnoho studií, týkajících se přírodních věd.\\nSeznam děl v Souborném katalogu ČR, jejichž autorem nebo tématem je Peter Roget\\nAutoritní data: AUT: uk2005277643 | GND: 117534404 | ISNI: 0000 0001 0863 1905 | LCCN: n79097382 | VIAF: 2594700 | WorldcatID: lccn-n79097382"},{"page_url":"https://sv.wikipedia.org/wiki/V%C3%A4stra_Grekland","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/18/GreeceWest.png","page_title":"Västra Grekland","context_page_description":"Västra Grekland är en av Greklands tretton regioner. Regionen uppdelas i de tre prefekturerna Achaia, Aitolien och Akarnanien samt Elis."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%82%B9_%EC%95%95%EB%91%98%EB%9D%BC_%EC%8A%A4%ED%8F%AC%EC%B8%A0_%EC%8B%9C%ED%8B%B0_%EC%8A%A4%ED%83%80%EB%94%94%EC%9B%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/King_Abdullah_Sport_City_Stadium_A.jpg","page_title":"킹 압둘라 스포츠 시티 스타디움","context_page_description":"킹 압둘라 스포츠 시티 스타디움는 사우디아라비아 부라이다에 위치한 다목적 경기장이다. 현재 주로 축구 경기장으로 이용되며 알타아원와 알라에드의 홈구장으로 사용된다. 수용 인원은 30,000명이다."},{"page_url":"https://no.wikipedia.org/wiki/Parkveien_(Oslo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Parkveien_51a_-_2009-06-21_at_13-58-20.jpg","page_title":"Parkveien (Oslo)","context_page_description":"Parkveien er en gate i Bydel Frogner i Oslo. Den starter ved Høgskolen i Oslo ved Pilestredet, går langs Slottsparken, krysser Henrik Ibsens gate ved Nobelinstituttet, går forbi Oslo Handelsgymnas og ender ved Munkedamsveien. Gaten er 1,6 kilometer lang.\\nParkveien fikk sitt navn i 1864 og er oppkalt etter Slottsparken. Gaten ble anlagt med navnet Store Parkvei som del av villastrøket Bak Slottet i 1840-årene.\\nStatens representasjonsbolig ligger i Parkveien 45.\\nI den norske utgaven av spillet Monopol er Parkveien den første gaten på spillebrettet."},{"page_url":"https://fr.wikipedia.org/wiki/Marco_Del_Re","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Marco_Del_Re.jpg","page_title":"Marco Del Re","context_page_description":"Marco Del Re, né à Rome le 21 janvier 1950 et mort à Paris le 23 novembre 2019, est un graveur et peintre italien contemporain."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Einbeck","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/B%C3%BCrgermeisterwall_8_Einbeck_20171222_001.jpg","page_title":"Liste der Baudenkmale in Einbeck","context_page_description":"In der Liste der Baudenkmale in Einbeck sind alle denkmalgeschützten Bauten der niedersächsischen Stadt Einbeck aufgelistet. Die Baudenkmale in den Ortsteilen sind in der Liste der Baudenkmale in Einbeck aufgeführt. Diese Liste orientiert sich an der 2017 erschienenen Denkmaltopographie.\\nDer Altstadtkern erstreckt sich auf einer Fläche von 36,4 ha innerhalb des Mauerrings. Von den 650 Gebäuden innerhalb des Mauerrings sind 573 Fachwerkbauten, darunter 346 Sichtfachwerkbauten. Auf die Bauzeit der Gotik und Frührenaissance entfallen 93, auf Renaissance und Barock 138 und auf Klassizismus und Eklektizismus 115 Sichtfachwerkbauten."},{"page_url":"https://en.wikipedia.org/wiki/Amity,_Maine","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/MEMap-location-of-Amity.png","page_title":"Amity, Maine","context_page_description":"Amity is a town in Aroostook County, eastern Maine, United States, near the Canada–US border. The population was 238 at the 2010 census."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%A9%AC%E6%9D%A5%E8%B1%AA%E7%8C%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Hystrix_brachyura%2C_Malayan_porcupine.jpg","page_title":"马来豪猪","context_page_description":"馬來豪豬也稱馬來箭豬、喜馬拉雅豪豬，為豪豬科豪豬屬的動物。分布於孟加拉國，印度，印度尼西亞，寮國，馬來西亞，緬甸，尼泊爾，泰國，越南以及中國大陸雲南等地。該物種的模式產地在馬六甲。\\n棲息在森林中，也會出沒在森林附近的開放地帶。生活的海拔高度可達1300米。有時還會出現在農田裡。群居。以植物的根、塊莖、樹皮和掉落的水果為食。也會吃腐肉和昆蟲。"},{"page_url":"https://hu.wikipedia.org/wiki/T%C3%B3g%C3%B3_Heihacsir%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/SempillMission.jpg","page_title":"Tógó Heihacsiró","context_page_description":"Tógó Heihacsiró japán főnemes, a Japán Császári Haditengerészet flottatengernagya, az egyik leghíresebb japán haditengerész. Nyugati újságírók előszeretettel nevezték a Kelet Nelsonjának."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A8%D8%B1%D8%A7%D9%85_%D8%A7%D8%B3%D8%AA%D9%88%DA%A9%D8%B1","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/38/BramStokerDedicace.jpg","page_title":"برام استوکر","context_page_description":"برام استوکر رومانچی و یازیچی - ۸ نوْوامبر ۱۸۴۷ تاریخیندا دۆنیایا گؤز آچیب. ۶۴ ایل عومر ائله‌ییب و ۲۰ آوریل ۱۹۱۲ میلادی تاریخیندا وفات ائدیب."},{"page_url":"https://nl.wikipedia.org/wiki/Bert_Flugelman","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Adelaide_Festival_Centre_Triangles.jpg","page_title":"Bert Flugelman","context_page_description":"Bert Flugelman was een Australische beeldhouwer."},{"page_url":"https://en.wikipedia.org/wiki/Ohio_State_Route_732","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Easton_732_us_35.jpg","page_title":"Ohio State Route 732","context_page_description":"State Route 732 is a state highway in the U.S. state of Ohio. This two-lane state route begins at SR 129 in Butler County, and extends northward to end at the junction of U.S. Route 127 and US 35/SR 122 in Eaton in Preble County, Ohio, traveling 30.94 miles.\\nThis route gives access from northern and western Ohio via Interstate 70 or US 127 to Miami University in Oxford and Hueston Woods State Park. It also passes the historic Fort St. Clair."},{"page_url":"https://sv.wikipedia.org/wiki/Muraena_pavonina","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Muraena_pavonina_range.png","page_title":"Muraena pavonina","context_page_description":"Muraena pavonina är en fiskart som beskrevs av Richardson, 1845. Muraena pavonina ingår i släktet Muraena och familjen Muraenidae. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://en.wikipedia.org/wiki/Sturgeon_Bay,_Wisconsin","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Sturgeon_Bay_Tower_4_-_panoramio.jpg","page_title":"Sturgeon Bay, Wisconsin","context_page_description":"Sturgeon Bay is a city in and the county seat of Door County, Wisconsin, United States. The population was 9,144 at the 2010 census. The city is 38.4 miles north of Green Bay, 127 miles north of Milwaukee, 169 miles south of Houghton, Michigan, and 289 miles east of Minneapolis."},{"page_url":"https://sv.wikipedia.org/wiki/Chrysozephyrus_zoa","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/ZoaDeNiceville1889OD.jpg","page_title":"Chrysozephyrus zoa","context_page_description":"Chrysozephyrus zoa är en fjärilsart som beskrevs av De Nicéville 1889. Chrysozephyrus zoa ingår i släktet Chrysozephyrus och familjen juvelvingar. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D0%BE%D0%BA%D1%83%D1%80%D0%B8%D0%BA%D1%83-%D1%81%D0%B8%D0%BD%D0%BA%D0%B0%D0%BD%D1%81%D1%8D%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Fukui-C-3082.jpg","page_title":"Хокурику-синкансэн","context_page_description":"Хокурику-синкансэн — линия высокоскоростных железных дорог в Японии, являющаяся продолжением линии Нагано-синкансен. Нагано-синкансен - линия между Такасаки и Нагано - был открыт 1 октября 1997-го года, а Хокурику-синкансен - 14 марта 2015 года, в настоящее время строятся новые участки линии. Несмотря на то, что Нагано и Хокурику могут использоваться для одних и тех же маршрутов, линия Нагано принадлежит Восточной Железнодорожной Компании, а Хокурику - Западной Железнодорожной Компании. Однако и та, и другая линия имеет прямое сообщение с другими линиями, следующими непосредственно в Токио. На всех 13 станциях синкансэна уставлены автоматические платформенные ворота.\\nСкорость движения по линии до 260 км/ч."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B0%D0%B2%D0%B8%D0%B0%D0%BF%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D0%B8%D0%BA%D0%BE%D0%B2_%D0%BD%D0%B0_%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/MiG-17_Berdyansk.jpg","page_title":"Список авиапамятников на Украине","context_page_description":"В список вносятся памятники военным и гражданским самолётам, вертолётам, планёрам и БПЛА, находящиеся на постаментах или в любых музеях Украины."},{"page_url":"https://cs.wikipedia.org/wiki/Protiletadlov%C3%BD_raketov%C3%BD_komplet","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/58/Mistral-2.jpg","page_title":"Protiletadlový raketový komplet","context_page_description":"Protiletadlový raketový komplet je systém využívající raket k ničení vzdušných cílů – letadel, vrtulníků, bezpilotních letounů, ale i jiných řízených střel či balistických raket. Protiletadlové raketové komplety tak tvoří jeden z prvků protivzdušné obrany."},{"page_url":"https://et.wikipedia.org/wiki/AIDAaura","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/AIDAaura_06.jpg","page_title":"AIDAaura","context_page_description":"AIDAaura on kolmas AIDA-laevastiku ristluslaev, mis kuulub firmale Costa Crociere S.p.A. ja mida käitab laevakompanii Aida Cruises German Branch of Costa Crociere S.p.A.. Laev ehitati Aker MTW Werfti laevatehases Saksamaal ja laeva ristis Warnemündes 12. aprillil 2003 Heidi Klum.\\nLaeva kodusadam on Genova Itaalias."},{"page_url":"https://it.wikipedia.org/wiki/Don_McCullin","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Don_McCullin.jpg","page_title":"Don McCullin","context_page_description":"Donald McCullin è un fotografo e fotoreporter britannico, noto particolarmente per i suoi reportage di guerra e per le sue immagini sui conflitti urbani.\\nLa sua carriera di fotogiornalista, iniziata nel 1959, si è specializzata nel raccontare i ceti più bassi della società, raffigurando i disoccupati, gli oppressi e i poveri."},{"page_url":"https://en.wikipedia.org/wiki/John_E._Whitley","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/John_E._Whitley_official_photo_%28cropped%29.jpg","page_title":"John E. Whitley","context_page_description":"John Euler Whitley currently serves as the United States Assistant Secretary of the Army and is also performing the duties of Director of Cost Assessment and Program Evaluation for the Department of Defense."},{"page_url":"https://hr.wikipedia.org/wiki/Zastava_Sjevernomarijanskih_Otoka","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Flag_of_the_Northern_Mariana_Islands_%281972%29.svg","page_title":"Zastava Sjevernomarijanskih Otoka","context_page_description":"Zastava Sjevernomarijanskih Otoka je usvojena 4. srpnja 1976. Kao i zastave drugih pacifičkih država, kao na primjer Maršalovih Otoka i Naurua, i zastava Sjevernomarijanskih Otoka se sastoji od plavog polja sa bijelom zvijezdom. Zvijezda je inspirirana UN-om, jer je UN jedno vrijeme upravljao njihovim teritorijem. Iza zvijezde se nalazi tradicionalni \\"latte\\" kamen, oko kojeg je vijenac od cvijeća, koji je na zastavu dodan 1981., te predstavlja povezanost između otoka i njegove povijesti i običaja."},{"page_url":"https://no.wikipedia.org/wiki/Ole_Vig","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c2/Ole_Vig_litography.jpg","page_title":"Ole Vig","context_page_description":"Ole Vig var en norsk skole- og folkeopplysningsmann som arbeidet for utdanning for alle. I Rune Slagstads bok De nasjonale strateger karakteriseres Vig som «en folkeopplysningsmann og nasjonsbygger som har hatt stor betydning for utviklingen av vårt demokrati». Vig regnes av mange som den norske folkehøyskolens far, selv om Vig selv ikke fikk oppleve skoleslagets etablering i løpet av sitt korte liv."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Berlin-Kreuzberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Berlin%2C_Kreuzberg%2C_Adalbertstrasse_17%2C_Mietshaus.jpg","page_title":"Liste der Kulturdenkmale in Berlin-Kreuzberg","context_page_description":"In der Liste der Kulturdenkmale von Kreuzberg sind die Kulturdenkmale des Berliner Ortsteils Kreuzberg im Bezirk Friedrichshain-Kreuzberg aufgeführt."},{"page_url":"https://en.wikipedia.org/wiki/Lundgaard_%26_Tranberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/%C3%85aljiset_%29Langelinie%3D.jpg","page_title":"Lundgaard & Tranberg","context_page_description":"Lundgaard & Tranberg Arkitekter is a Danish architectural firm, based in Copenhagen Denmark. It is most noted for the Tietgenkollegiet student housing in Ørestad from 2006 and the Royal Danish Playhouse on the Copenhagen harbourfront from 2008. Lundgaard & Tranberg has won RIBA European Awards three years in a row in 2006, 2007 and 2008."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A3%CF%85%CE%BC%CE%BC%CE%B5%CF%84%CE%BF%CF%87%CE%AE_%CF%84%CE%B7%CF%82_%CE%91%CE%BD%CE%B4%CF%8C%CF%81%CF%81%CE%B1%CF%82_%CF%83%CF%84%CE%B7_Eurovision","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Escportal.png","page_title":"Συμμετοχή της Ανδόρρας στη Eurovision","context_page_description":"Η Ανδόρα έχει συμμετάσχει 6 φορές στο Διαγωνισμό Τραγουδιού της Eurovision, κάνοντας το ντεμπούτο της το 2004. Παρά το γεγονός πως οι τοπικοί τηλεοπτικοί σταθμοί δεν προέβαλλαν το διαγωνισμό μέχρι πριν λίγα χρόνια, το ενδιαφέρον του κοινού ήταν μεγάλο. Η πλειοψηφία των τραγουδιών που έχει στείλει μέχρι σήμερα έχουν τραγουδηθεί στα Καταλανικά, την εθνική γλώσσα της Ανδόρας.\\nΜέχρι το 2017, η Ανδόρα είναι η μόνη χώρα που έχει συμμετάσχει στο διαγωνισμό και δεν έχει προκριθεί ποτέ στον τελικό."},{"page_url":"https://fr.wikipedia.org/wiki/Curvelo","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/CurveloMG-MatrizDeSantoAntonio01.JPG","page_title":"Curvelo","context_page_description":"Curvelo est une ville et une municipalité dans l'État du Minas Gerais de sud-ouest du Brésil."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9A%CE%B1%CF%84%CE%AC%CE%BB%CE%BF%CE%B3%CE%BF%CF%82_%CF%87%CF%89%CF%81%CF%8E%CE%BD_%CE%BA%CE%B1%CF%84%CE%AC_%CE%B1%CF%81%CE%B9%CE%B8%CE%BC%CF%8C_%CF%87%CF%81%CE%B7%CF%83%CF%84%CF%8E%CE%BD_%CE%B4%CE%B9%CE%B1%CE%B4%CE%B9%CE%BA%CF%84%CF%8D%CE%BF%CF%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Internet_users_per_100_inhabitants_ITU.svg","page_title":"Κατάλογος χωρών κατά αριθμό χρηστών διαδικτύου","context_page_description":"Αυτός είναι ένας ταξινομούμενος κατάλογος χωρών με βάση τον αριθμό των χρηστών του Διαδικτύου από το 2013. Χρήστες διαδικτύου είναι άτομα που χρησιμοποιούν το Διαδίκτυο τους τελευταίους 12 μήνες από οποιαδήποτε συσκευή, συμπεριλαμβανομένων των κινητών τηλεφώνων. Το ποσοστό είναι το ποσοστό του πληθυσμού μιας χώρας που είναι χρήστες του διαδικτύου. Οι εκτιμήσεις προέρχονται είτε από έρευνες σε νοικοκυριά ή από τα στοιχεία εγγραφής στο διαδίκτυο.\\nΠεριοχές που δεν είναι χώρες και αμφισβητούμενες περιοχές εμφανίζονται σε πλάγια γραφή. Όλα τα κράτη μέλη των Ηνωμένων Εθνών περιλαμβάνονται, εκτός από το Νότιο Σουδάν και τη Βόρεια Κορέα. Η Ταϊβάν, παρατίθεται ως κυρίαρχο κράτος."},{"page_url":"https://io.wikipedia.org/wiki/Listo_di_Nobel-laureati_pri_literaturo","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Pearl_Buck.jpg","page_title":"Listo di Nobel-laureati pri literaturo","context_page_description":"La Nobel-premio pri literaturo adjudikesas omnayare da Suedian Akademio a skriptisti kun eminenta kontributaji en la feldo di literaturo. La premio administresas da Nobel-fonduro depos 1901.\\nPro ke ne havas Nobel premio pri filozofio esas ta premio pri literaturo uzata tri foyi por Bergson, Russell e Sartre.\\nYen la listo di Nobel-laureati pri literaturo de 1901 til nun."},{"page_url":"https://fr.wikipedia.org/wiki/Grande_Mosqu%C3%A9e_de_Kairouan","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Plan_grande_mosquee_kairouan_vect.svg","page_title":"Grande Mosquée de Kairouan","context_page_description":"La Grande Mosquée de Kairouan, également appelée mosquée Oqba Ibn Nafi en souvenir de son fondateur Oqba Ibn Nafi, est l'une des principales mosquées de Tunisie située à Kairouan. Historiquement première métropole musulmane du Maghreb, Kairouan, dont l'apogée sur les plans politique et intellectuel se situe au IXᵉ siècle, est réputée comme étant le centre spirituel et religieux de la Tunisie ; elle est aussi parfois considérée comme la quatrième ville sainte de l'islam sunnite.\\nReprésentant l'édifice emblématique de la cité, sa Grande Mosquée reste le sanctuaire le plus ancien et le plus prestigieux de l'Occident musulman. Figurant, depuis le décret beylical du 13 mars 1912, sur la liste des monuments historiques et archéologiques classés et protégés en Tunisie, elle a également été classée, avec l'ensemble historique de Kairouan, au patrimoine mondial de l'Unesco en 1988.\\nBâtie, initialement, par Oqba Ibn Nafi à partir de 670, alors que la ville de Kairouan est fondée, elle est agrandie et reconstruite aux VIIIᵉ et IXᵉ siècles."},{"page_url":"https://pl.wikipedia.org/wiki/Carlos_Gomes_J%C3%BAnior","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Carlos_Gomes_Junior.jpg","page_title":"Carlos Gomes Júnior","context_page_description":"Carlos Domingos Gomes Júnior – polityk z Gwinei Bissau, premier w latach 2004–2005 oraz 2008–2012.\\nGomes jest przywódcą Afrykańskiej Partii Niepodległości Gwinei i Wysp Zielonego Przylądka, która sprawowała władzę nad krajem od czasu uzyskania niepodległości w 1974 r. aż do zamachu stanu w 1999.\\nGomes jest uważany za najbogatszego człowieka w kraju. Po raz pierwszy został wybrany do parlamentu w 1994 r. Na stanowisko premiera został powołany 9 maja 2004 i następnego dnia zaprzysiężony. Funkcję pełnił do listopada 2005, a jego następcą został Aristides Gomes.\\nPo wygranych przez PAIGC wyborach parlamentarnych w listopadzie 2008, Carlos Gomes Júnior 25 grudnia 2008 ponownie objął funkcję szefa rządu.\\n10 lutego 2012 zrezygnował ze stanowiska, by wziąć udział w wyborach prezydenckich, zaplanowanych na 18 marca 2012 i organizowanych w następstwie śmierci prezydenta Malama Bacaia Sanhy. Tego samego dnia pełniącą obowiązki szefa rządu mianował Adiato Djaló Nandignę.\\n12 kwietnia 2012, po dokonaniu przez wojsko zamachu stanu, został aresztowany razem z pełniącą obowiązki prezydenta Raimundo Pereirą. Władzę w kraju przejęło Dowództwo Wojskowe na czele z generałem Mamadu Ture Kurumą."},{"page_url":"https://ga.wikipedia.org/wiki/R%C3%A9imse_maighn%C3%A9adach","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Magnet0873.png","page_title":"Réimse maighnéadach","context_page_description":"Réigiún mórthimpeall ar mhaighnéad inar féidir iarmhairt an mhaighnéid a bhrath, mar shampla, ar lucht atá ag gluaiseacht, sreang shruthiompartha nó maighnéad eile. Cuirtear síos ar an réimse agus tomhaistear é leis an bhfloscdhlús maighnéadach, B, a thomhaistear i dteislí, is leis an déine mhaighnéadach, H, a thomhaistear in aimpéir in aghaidh an mhéadair. Bíonn an-chuid feidhmeanna teicniúla ag réimsí maighnéadacha, an dineamó/gineadóir is an mótar ina measc."},{"page_url":"https://pl.wikipedia.org/wiki/Remiza_stra%C5%BCacka","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/2018_Remiza_OSP_w_Lewinie_K%C5%82odzkim.jpg","page_title":"Remiza strażacka","context_page_description":"Remiza strażacka – rodzaj budynku służący do magazynowania sprzętu przeciwpożarowego, osobistego sprzętu ochrony, węży pożarniczych, gaśnice i inny sprzęt gaśniczy. Mogą tutaj znajdować się pomieszczenia mieszkalne i biurowe, takie jak świetlica, warsztat czy pralnia.\\nPomieszczenia zwykle usytuowane są ponad garażami i strażacy mogą mieć zainstalowane w remizie specjalne rury do szybkiego zjeżdżania do garaży. Zwykle też znajduje się pomieszczenie do suszenia węży, a starsze remizy zwykle posiadały wieżyczki obserwacyjne. W remizach ochotniczej straży pożarnej w Polsce zwykle znajduje się też syrena do zwoływania strażaków w razie alarmu, a obok remizy wieża do suszenia węży strażackich.\\nW dwudziestoleciu międzywojennym w Polsce remizy strażackie zaczęto licznie budować na terenach wiejskich. Były one niewielkimi budynkami drewnianymi lub murowanymi z wieżą, w której zawieszano dzwon. W okresie powojennym stawiane remizy zawierały także sale służące m.in. do organizowania zebrań i zabaw wiejskich."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%BE%D0%BB%D0%B5%D0%BC%D0%B8%D0%BD%D0%B8%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Map_of_comune_of_Soleminis_%28province_of_South_Sardinia%2C_region_Sardinia%2C_Italy%29_-_2016.svg","page_title":"Солеминис","context_page_description":"Солѐминис е село и община в Южна Италия, провинция Южна Сардиния, автономен регион и остров Сардиния. Разположено е на 200 m надморска височина. Населението на общината е 1872 души."},{"page_url":"https://hu.wikipedia.org/wiki/Szlav%C3%B3niai_uralkod%C3%B3k_h%C3%A1zast%C3%A1rsainak_list%C3%A1ja","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Hans_Maler_Anna_von_Ungarn_1521.jpg","page_title":"Szlavóniai uralkodók házastársainak listája","context_page_description":"Szlavónia királynéinak listáját tartalmazza az alábbi táblázat 925-től 1943-ig. „A késő középkori Szlavónia területileg Kőrös, Zágráb és Varasd megyéket foglalta magában. Utóbbi azonban, bár kétségen felül Szlavóniához számították, egészen 1486-ig nem volt alávetve a szlavón bán hatalmának, hanem a mindenkori varasdi ispán gyakorolta benne a bírói joghatóságot. A báni hatalmat tekintve tehát Szlavónia csupán Kőrös és Zágráb megyékből állt.” Dmitar Zvonimir horvát király is már használta a szlavón királyi címet 1075-ben: „Zvonimirus Demetrius Rex Sclavoniae, Croat, Dalmat.” Imre magyar király szintén élt\\nszlavón királyi titulussal: „Aimericus rex Hungarie et Sclavoniae.” I. Ulászló magyar király 1442. szeptember 29-én Budán kelt okiratában a Szlavónia királya címet is felsorolja a titulusai között: „nos Wladislaus Dei gratia Hungarie, Polonie, Dalmatie, Croatie, Rascie, Servie, Sclavonie etc. Rex, [...]”."},{"page_url":"https://sv.wikipedia.org/wiki/Lista_%C3%B6ver_slott_och_herrg%C3%A5rdar_i_S%C3%B6dermanland","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Br%C3%A4nninge_g%C3%A5rd_2017a.jpg","page_title":"Lista över slott och herrgårdar i Södermanland","context_page_description":"Lista över slott och herrgårdar i Södermanland.\\nListan visar ett urval av de viktigaste slotten och herrgårdarna och redovisar även numera försvunna egendomar. Listan bygger huvudsakligen på Historiskt-geografiskt och statistiskt lexikon öfver Sverige i 7 band, Stockholm 1856–1870 och Carl Martin Rosenbergs Geografiskt-statistiskt handlexikon öfver Sverige, Stockholm 1882–1883 samt Slott och herresäten i Sverige, Allhems förlag, Malmö, 1966–1971."},{"page_url":"https://it.wikipedia.org/wiki/Hrade%C5%A1ice","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Hradesice14.jpg","page_title":"Hradešice","context_page_description":"Hradešice è un comune della Repubblica Ceca facente parte del distretto di Klatovy, nella regione di Plzeň."},{"page_url":"https://no.wikipedia.org/wiki/Harald_Thingnes","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/ba/Harald_Thingnes_2010-06-04.jpg","page_title":"Harald Thingnes","context_page_description":"Harald Endre Thingnes er en norsk programleder og stuntreporter for NRK Sport.\\nThingnes har siden Vinter-OL 2010 hatt som oppdrag å lage innslag til NRKs sendinger fra byen og nærområdet til større arrangementer. Han har også gjort intervjuer med familie og fans av deltakerne på tribunene mens renn pågår.\\nThingnes kommer fra Sunnfjord, men er bosatt på Risløkka i Oslo. Han er onkel til skiskytterne Johannes Thingnes Bø og Tarjei Bø.\\nI 2011 ble han tildelt Alf Helleviks Mediemålspris og 3. mai 2018 ble han tildelt Kulturdepartementets nynorskpris for journalister for 2018.\\nTidligere Norge Rundt programleder."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8E%D6%80%D5%A1%D6%81%D5%A1%D5%AF%D5%A1%D5%B6_%D5%A5%D6%80%D5%A1%D5%AA%D5%B7%D5%BF%D5%A1%D5%AF%D5%A1%D5%B6_%D5%A3%D5%B8%D6%80%D5%AE%D5%AB%D6%84%D5%B6%D5%A5%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Phanduri_Georgian_traditional_instrument.jpg","page_title":"Վրացական երաժշտական գործիքներ","context_page_description":"Վրացական երաժշտության գործիքների արմատները գալիս են հազարամյակներ առաջվանից:\\nՍկսած հնագույն ժամանակներից, վրացական գործիքներից են.\\nՓողավոր գործիքներ՝ վեց փողանի սոինարի, նեստվի, ստվիրի, ավիլի, նայ, բուկի, կվիրոստվիրի, սակվիրի, կարախսա, գուդաստվիրի, չիբոնի ։\\nԼարային գործիքներ՝ չանգի, քնարա, էբանի, փանդուրի, չոնգուրու, ցինցիլի ։\\nԼարային աղեղնավոր գործիքներ՝ չիանուրի, չունիրի:\\nՀարվածային գործիքներ՝ բոբգանի, դաբդաբի, դումբո, նոբա, դոլի, կոսի, թաբլակի, ցինցիլա, դայրա, սպիլենդզչուրի:"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9E%E3%83%BC%E3%83%86%E3%82%A3%E3%83%B3%E3%83%BB%E3%83%AB%E3%83%BC%E3%82%B5%E3%83%BC%E3%83%BB%E3%82%AD%E3%83%B3%E3%82%B0%E3%83%BB%E3%82%B8%E3%83%A5%E3%83%8B%E3%82%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Westminster_Abbey_C20th_martyrs.jpg","page_title":"マーティン・ルーサー・キング・ジュニア","context_page_description":"マーティン・ルーサー・キング・ジュニアは、アメリカ合衆国のプロテスタントバプテスト派の牧師である。キング牧師の名で知られ、アフリカ系アメリカ人公民権運動の指導者として活動した。\\n「I Have a Dream」で知られる有名な演説を行った人物。1964年のノーベル平和賞受賞者。本人死後、2004年の議会名誉黄金勲章受章者。アメリカの人種差別の歴史を語る上で重要な人物の一人である。"},{"page_url":"https://ko.wikipedia.org/wiki/%EC%86%8C%EB%A0%A8%EC%9D%98_%EC%83%81%ED%9B%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Medal_for_the_liberation_of_Prague%2C_Soviet_Union.png","page_title":"소련의 상훈","context_page_description":"소련의 상훈은 칭호와 훈장과 포장로 나뉜다.\\n칭호는 가장 높은 훈격으로, 3개의 영웅칭호와 9개의 영예칭호, 5개의 인민칭호가 있다. 훈장은 포괄적인 공적 분야에 대해 수여되고, 포장은 각 분야에서 구체적으로 어떤 일을 했다는 점에 대하여 수여된다. 대개 분야별 훈장과 사안별 포장이 함께 수여되지만 둘 중 한 쪽만 수여되기도 한다. 훈격은 훈장이 포장보다 높다.\\n칭호는 수장만 존재하고 약장이 존재하지 않는다. 군사훈장은 수장 또는 부장 형태에 약장이 존재하고, 민사훈장과 포장들은 모두 수장 형태이며 약장이 존재한다."},{"page_url":"https://en.wikipedia.org/wiki/Macrotoma_serripes","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Cerambycidae_-_Macrotoma_serripes.JPG","page_title":"Macrotoma serripes","context_page_description":"Macrotoma serripes is a species of beetle belonging to the family Cerambycidae."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%91%89%E5%B7%A5%E5%BB%A0%E6%8E%92%E7%90%83%E3%83%81%E3%83%BC%E3%83%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Kure_Bombing_Damage_map_1945.jpg","page_title":"呉工廠排球チーム","context_page_description":"呉工廠排球チームは、かつて広島県呉市を本拠地に活動していた、大日本帝国海軍呉海軍工廠の実業団バレーボールチームである。\\n名称は資料によっては「呉工廠バレーボールチーム」「呉工廠排球部」「呉工廠代表チーム」など。なおこの前身となったチームについても記載する。"},{"page_url":"https://de.wikipedia.org/wiki/Roda_Antar","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Roda_Antar_Shandong_Luneng%2C_2009.jpg","page_title":"Roda Antar","context_page_description":"Roda Antar ist ein ehemaliger libanesischer Fußballspieler und heutiger Fußballtrainer. Er war Mittelfeldspieler. Seit der Saison 2017/18 trainiert er Racing Beirut."},{"page_url":"https://nl.wikipedia.org/wiki/Grote_Bazaar_van_Istanboel","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Grand_Bazaar_Istanbul_Turkey_2007.JPG","page_title":"Grote Bazaar van Istanboel","context_page_description":"De Grote Bazaar van Istanboel of Overdekte Bazaar in Istanboel is een van de grootste overdekte markten ter wereld met meer dan 58 straten, 1.200 winkels en heeft tussen de 250.000 en 400.000 bezoekers per dag. De bazaar is bekend voor zijn winkels voor sieraden, aardewerk, specerijgewassen en tapijten. Veel van de kraampjes in de bazaar zijn gegroepeerd per type van goederen, met speciale gebieden voor leren jassen, gouden sieraden en dergelijke. De bazaar is sterk uitgebreid in de 16e eeuw tijdens de heerschappij van sultan Süleyman I.\\nOp 2 maart 2007 werd de Grote Bazaar bezocht door toenmalig koningin Beatrix, prins Willem Alexander en prinses Maxima."},{"page_url":"https://en.wikipedia.org/wiki/Mike_Sansing","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Mike_Sansing_2014.jpg","page_title":"Mike Sansing","context_page_description":"Mike Sansing is an American college baseball coach, currently serving as head coach of the Kennesaw State Owls baseball team. He was named to that position prior to the 1992 season, when Kennesaw State was an NAIA team. He led the Owls as they joined the NCAA's Division II in 1994, and in 2005 began the process to elevate the program to Division I, completed for the 2010 season.\\nSansing played at Gordon College and West Georgia, being named all-conference all four years, and team MVP honors three times. He began his coaching career with the Wolves in 1985. He served two seasons as an assistant, then two seasons at Southern Poly before his first head coaching position at Shorter. In his final year with the Hawks, he led the team to the 1991 conference title; he was named the conference coach of the year in both 1990 and 1991. He then moved to Kennesaw State. In his time with the Owls, he led Kennesaw State to the 1994 NAIA World Series title in their final season in the NAIA. The Owls then claimed the 1996 NCAA Division II Baseball Championship and a pair of national runner-up finishes in 1998 and 1999."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A1%AF%EB%8D%B0%EC%9B%94%EB%93%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Lotte_World_Monorail_Intamin.jpg","page_title":"롯데월드","context_page_description":"롯데월드는 대한민국 서울특별시 송파구 올림픽로 240에 위치한 테마파크다. 롯데그룹의 계열사인 호텔롯데 운영월드 사업부.\\n놀이시설은 실내의 롯데월드 어드벤처와 야외의 매직아일랜드가 운영되고 있으며, 민속박물관, 아이스링크, 백화점, 마트, 호텔 등이 포함된다."},{"page_url":"https://pt.wikipedia.org/wiki/Machado_(Minas_Gerais)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Ponte_do_Rio_Sapuca%C3%AD.jpg","page_title":"Machado (Minas Gerais)","context_page_description":"Machado é um município brasileiro do estado de Minas Gerais. Sua população estimada em 2017 era de 41.920 habitantes. A principal atividade econômica é o cultivo do café."},{"page_url":"https://tr.wikipedia.org/wiki/Eurovision_%C5%9Eark%C4%B1_Yar%C4%B1%C5%9Fmas%C4%B1%27nda_Fransa","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/86/Eurovision_Song_Contest_1965_-_Guy_Mardel.jpg","page_title":"Eurovision Şarkı Yarışması'nda Fransa","context_page_description":"Fransa, Eurovision Şarkı Yarışması'na ilk kez 1956 yılında, France Télévisions isimli kamusal yayın kuruluşunun Avrupa Yayın Birliği'nin aktif bir üyesi olmasının ardından katılmıştır. Fransa, Almanya, Belçika, Hollanda, İsviçre, İtalya ve Lüksemburg ile birlikte yarışmaya ilk katılan yedi ülkeden birisi olmuştur.\\nFransa yarışmaya 1956 yılından beri altmış defa katılmış ve 1958, 1960, 1962, 1969 ve 1977 yıllarında olmak üzere beş kez galip olmuştur. Ülkenin en kötü sonucu ise 2014 yılında Twin Twin'in seslendirdiği \\"Moustache\\" isimli şarkı ile sonuncu olmuştur. Ülke, 1974 ve 1982 yıllarında olmak üzere iki defa yarışmadan uzak kalmıştır.\\nFransa, Eurovision Şarkı Yarışması'na üç kez ev sahipliği yapmıştır. Yarışma iki kez Cannes'da, bir kez Paris'te yapılmıştır."},{"page_url":"https://en.wikipedia.org/wiki/Recreational_gold_mining","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Stringer156_nugget.jpg","page_title":"Recreational gold mining","context_page_description":"Recreational gold mining and prospecting has become a popular outdoor recreation in a number of countries, including New Zealand, Australia, South Africa, Wales, in Canada and in the United States especially. Recreational mining is often small-scale placer mining but has been challenged for environmental reasons. The disruption of old gold placer deposits risks the reintroduction of post gold rush pollution, including mercury in old mining deposits and mine tailings."},{"page_url":"https://gl.wikipedia.org/wiki/Nathaniel_Lyon","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Nathaniel_Lyon_on_horseback_1.jpg","page_title":"Nathaniel Lyon","context_page_description":"Nathaniel Lyon, nado o 14 de xullo de 1818 e finado o 10 de agosto de 1861, foi o primeiro xeneral da Unión en morrer no decurso da Guerra Civil americana; é célebre polas súas accións no estado de Missouri no inicio do conflito. Trátase dunha figura controvertida na historia americana. Algúns apoian a súa rápida acción e liña dura para frear o secesionismo en Missouri, outros bótanlle en cara as súas accións contra a poboación civil como o Incidente de Camp Jackson, que polarizou os sentimentos dos cidadáns de Missouri sobre a cuestión da secesión."},{"page_url":"https://ceb.wikipedia.org/wiki/Parribacus_caledonicus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Popinee.jpg","page_title":"Parribacus caledonicus","context_page_description":"Espesye sa krustaseo ang Parribacus caledonicus. Una ning gihulagway ni Lipke Bijdeley Holthuis ni adtong 1960. Ang Parribacus caledonicus sakop sa kahenera nga Parribacus sa kabanay nga Scyllaridae. Giklaseklase sa IUCN ang espesye sa kinaminosang kalabotan. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://gl.wikipedia.org/wiki/Mapa_mental","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Guru_Mindmap.jpg","page_title":"Mapa mental","context_page_description":"Un mapa mental é un diagrama usado para representar as palabras, ideas, tarefas ou outros conceptos ligados e dispostos radialmente ao redor dunha palabra clave ou dunha idea central."},{"page_url":"https://ca.wikipedia.org/wiki/Mas_d%27en_Grau_(Tor%C3%A0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/MAS_D%27EN_GRAU_-_TOR%C3%80.JPG","page_title":"Mas d'en Grau (Torà)","context_page_description":"El Mas d'en Grau és una masia de Torà inclosa a l'Inventari del Patrimoni Arquitectònic de Catalunya."},{"page_url":"https://fr.wikipedia.org/wiki/Eug%C3%A8ne_Deloncle","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Eugene_Deloncle_1937cr.jpg","page_title":"Eugène Deloncle","context_page_description":"Antoine Octave Eugène Deloncle est un homme politique français, né à Brest le 20 juin 1890 et mort à Paris le 7 janvier 1944, cofondateur de la Cagoule en 1935."},{"page_url":"https://de.wikipedia.org/wiki/Zeche_Hansa","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Alte_Schmiede_Zeche_Hansa_20080529.jpg","page_title":"Zeche Hansa","context_page_description":"Die Zeche Hansa war ein Steinkohlen-Bergwerk im Dortmunder Stadtteil Huckarde."},{"page_url":"https://en.wikipedia.org/wiki/List_of_cities_and_towns_in_Russia","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Saratov_City_Centre.jpg","page_title":"List of cities and towns in Russia","context_page_description":"This is a list of cities and towns in Russia. According to the data of 2010 Russian Census, there are 1,110 cities and towns in Russia. After the Census, Innopolis, a town in the Republic of Tatarstan, was established in 2012 and granted town status in 2014."},{"page_url":"https://id.wikipedia.org/wiki/Laba-laba","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Spider_web_near_Cikaniki_Research_Station_Halimun_Salak_National_Park.jpg","page_title":"Laba-laba","context_page_description":"Laba-laba adalah sejenis hewan berbuku-buku dengan dua segmen tubuh, empat pasang kaki, tak bersayap, dan tak memiliki mulut pengunyah. Semua jenis laba-laba digolongkan ke dalam ordo Araneae; dan bersama dengan kalajengking, ketonggeng, tungau —semuanya berkaki delapan— dimasukkan ke dalam kelas Arachnida. Bidang studi mengenai laba-laba disebut arachnologi.\\nAraneae adalah ordo terbesar dalam arachnida dan peringkat ketujuh dalam total keragaman spesies di antara seluruh ordo organismse. Laba-laba dapat ditemukan di seluruh dunia di setiap benua kecuali di Antartika, dan telah bertahan lama di hampir semua habitat dengan perkecualian kolonisasi udara dan laut. Per Februari 2016, sedikitnya 45.800 spesies dan 114 suku laba-laba telah dicatat oleh para taksonomis. Tetapi, telah terjadi perpecahan di dalam komunitas ilmiah mengenai cara semua suku-suku tersebut diklasifikasikan karena sejak tahun 1900 telah ada lebih dari 20 klasifikasi berbeda telah diusulkan.\\nLaba-laba merupakan hewan pemangsa, bahkan kadang-kadang kanibal. Mangsa utamanya adalah serangga."},{"page_url":"https://fr.wikipedia.org/wiki/Montagne","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Pan-african_belts.png","page_title":"Montagne","context_page_description":"Une montagne est une forme topographique de relief positif, à la surface de planètes telluriques, et faisant partie d'un ensemble — une chaîne de montagnes — ou formant un relief isolé. Elle est caractérisée par son altitude et, plus généralement, par sa hauteur relative, voire par sa pente. Il n'existe toutefois pas de définition unique de ce qu'est une montagne, terme apparu entre le Xᵉ et le XIIᵉ siècle, et de nombreux régionalismes coexistent pour décrire les formes de relief. Elle peut désigner à la fois un sommet pentu et une simple élévation de terrain, comme une colline, aussi bien que le milieu dans son ensemble. Les montagnes prennent en effet des formes très diverses en fonction des processus qui mènent à leur orogenèse : des escarpements de marges continentales et rifts en domaine extensif, aux chaînes de collision et plissement, en passant par les phases de subduction créant des volcans de type explosif en arcs insulaires ou le long de cordillères, sans oublier le volcanisme de point chaud de type effusif ni les intrusions mises au jour par l'érosion."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A8%E3%83%8F%E3%83%B3%E3%83%BB%E3%82%AF%E3%83%AA%E3%83%BC%E3%82%AC%E3%83%BC","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b6/Zittau_1744.jpg","page_title":"ヨハン・クリーガー","context_page_description":"ヨハン・クリーガーは、ドイツの作曲家、オルガニスト。作曲家のヨハン・フィリップ・クリーガーは彼の兄にあたる。\\nニュルンベルクに生まれバイロイト、ツァイツ、グライツで勤務した後ツィッタウに落ち着く。彼の時代では屈指の鍵盤楽器奏者であり、ゲオルク・フリードリヒ・ヘンデルなどからも高い尊敬を受けていた。教会音楽、世俗音楽を旺盛に作曲して数十曲を出版した他、草稿のまま今日に伝えられる作品もある。しかしながら、七年戦争中の1757年にツィッタウが破壊された際、数百曲以上が失われてしまった。\\nその鍵盤楽器作品群により、クリーガーは当時の最重要の作曲家の1人に位置づけられる。出版された2つの作品集『Sechs musicalische Partien』と『Anmuthige Clavier-Übung』にはハープシコード組曲、オルガンのためのトッカータ、フーガ、リチェルカーレ等が収録されている。同時代の作曲家は、現存するフーガやリチェルカーレに見られるようなクリーガーの対位法の腕前を称賛した。とりわけ、クリーガーの二重フーガに感銘を受けたヨハン・マッテゾンは、この形式においてクリーガーを凌ぐ者をヘンデルを除くと他に誰も知らないと述べている。ヘンデルもクリーガーを称賛してその作品を研究しており、イングランドへ向かう際には『Anmuthige Clavier-Übung』の写しを携えて行った程であった。"},{"page_url":"https://simple.wikipedia.org/wiki/Irina_Kirichenko","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Irina_Kirichenko_1967b.jpg","page_title":"Irina Kirichenko","context_page_description":"Irina Ivanovna Kirichenko was a Soviet sprint cyclist. He won two gold, four silver and one bronze medal at the UCI Track Cycling World Championships in 1962–1969.\\nBetween 1960 and 1969 she also won 10 national titles. After retirement from competitions she worked as a cycling coach in Kharkiv."},{"page_url":"https://oc.wikipedia.org/wiki/Mercurey","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Map_commune_FR_insee_code_71294.png","page_title":"Mercurey","context_page_description":"Mercurey es una comuna francesa, situada dins lo departament de Sòna e Léger e la region de Borgonha."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_de_l%27Eure_(A-I)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Eglise_Saint_Lo_Bourg-Achard.jpg","page_title":"Liste des monuments historiques de l'Eure (A-I)","context_page_description":"Cet article recense une partie des monuments historiques de l'Eure, en France."},{"page_url":"https://pt.wikipedia.org/wiki/Villa_Mills","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Postcard_of_Villa_Mills_%28ca._1900%29.jpg","page_title":"Villa Mills","context_page_description":"Villa Mills, antiga Villa Mattei al Palatino, era uma villa localizado no alto do monte Palatino entre a Via di San Bonaventura e a Via dei Cerchi, no rione Campitelli de Roma. Construída sobre a Palácio Augustano e o Palácio Flávio, foi demolida no início do século XX para permitir que os sítios arqueológicos no local pudessem ser escavados."},{"page_url":"https://eo.wikipedia.org/wiki/Tepekermeno","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Tepe_view.jpg","page_title":"Tepekermeno","context_page_description":"Tepekermeno estas aparte situanta monto en la Baĥĉisaraja distrikto de Aŭtonoma Respubliko Krimeo. La monto situas 7 kilometrojn sud-oriente de Baĥĉisarajo kaj altas 544 metrojn. Oni povas suriri la monton nur de nordo, ĉar de ĉiuj aliaj flankoj ĝi havas krutajn deklivojn. Sur la monto troviĝas restaĵoj de mezepoka kavern-urbo, kiu havas la saman nomon.\\nLa nomo de la monto havas tjurkan devenon: tradukite el la krime-tatara lingvo ĝi signifas \\"monteto-fortreso\\", \\"fortreso sur monteto\\".\\nInter la 6-a kaj 14-a jarcentoj sur la monto troviĝis kavern-urbo, kovranta areon de ĉirkaŭ 1 hektaro. La urbo plej prosperis en la 12-a kaj 13-a jarcentoj. Grandas la kvanto de artefaritaj kavernoj — pli ol 230. Ĝis nun konserviĝis kaverna preĝejo kun elĉizitaj krucoj, tomboj kaj grek-lingvaj skribaĵoj. La muroj de konstruaĵoj ne konserviĝis; videblas nur la restaĵoj de la fundamentoj. Laŭ la plej verŝajna teorio la urbo pereis en la jaro 1299 post la milit-iro de orhordaj trupoj.\\nLa monto estas vaste konata natura vidindaĵo de Krimeo."},{"page_url":"https://it.wikipedia.org/wiki/Roberto_Boninsegna","image_url":"https://upload.wikimedia.org/wikipedia/it/6/63/Juventus%2C_Coppa_UEFA_1977%2C_Boninsegna_e_Benetti.jpg","page_title":"Roberto Boninsegna","context_page_description":"Roberto Boninsegna è un dirigente sportivo, allenatore di calcio ed ex calciatore italiano, di ruolo attaccante.\\nÈ stato vicecampione mondiale nel 1970 con la nazionale italiana."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%AC%E0%B2%B0%E0%B3%8D%E0%B2%9F%E0%B3%8D%E0%B2%B0%E0%B2%BE%E0%B2%A8%E0%B3%8D%E0%B2%A1%E0%B3%8D_%E0%B2%B0%E0%B2%B8%E0%B2%B2%E0%B3%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Bertrand_Russell_transparent_bg.png","page_title":"ಬರ್ಟ್ರಾನ್ಡ್ ರಸಲ್","context_page_description":"ಬರ್ಟ್ರಾನ್ಡ್ ರಸಲ್ ಒಬ್ಬ ಬ್ರಿಟಿಷ್ ತತ್ವಜ್ಞಾನಿ, ಗಣಿತಜ್ಞ, ಇತಿಹಾಸಕಾರ, ಬರಹಗಾರ, ರಾಜಕೀಯ ಹೋರಾಟಗಾರ, ಸಮಾಜವಾದಿ ಹಾಗೂ ತರ್ಕಶಾಸ್ತ್ರಜ್ಞ. ಇವನೊಬ್ಬ ಶಾಂತಿದೂತ, ಸಮಾಜವಾದಿ ಹಾಗೂ ಪ್ರಗತಿಪರ ಚಿಂತಕ. ೨೦ನೆಯ ಶತಮಾನದ ಬೌದ್ಧಿಕವಲಯದಲ್ಲಿ ರಸೆಲ್‌ದು ಬಹು ದೊಡ್ಡ ಹೆಸರು. ಅವನು ಬಹುಶ್ರುತ ವಿದ್ವಾಂಸ, ಘನ ಪಂಡಿತ, ಇವನ ಕೃತಿಗಳು ಭಾಷಾಶಾಸ್ತ್ರ, ತತ್ವಶಾಸ್ತ್ರ, ಸಮಾಜಶಾಸ್ತ್ರ, ಅಧ್ಯಾತ್ಮಶಾಸ್ತ್ರ, ಜ್ಞಾನಮೀಮಾಂಸೆ, ಗಣಿತಶಾಸ್ತ್ರ, ಮನಃಶಾಸ್ತ್ರಗಳಂತ ಹತ್ತಾರು ಅನೇಕ ಗಂಭೀರ ಪ್ರಕಾರಗಳ ಮೇಲೆ ತಕ್ಕ ಮಟ್ಟಿನ ಪ್ರಭಾವ ಬೀರಿವೆ."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%94%D0%B6%D1%83%D0%B7%D1%8D%D0%BF%D1%8D_%D0%90%D1%80%D1%87%D1%8B%D0%BC%D0%B1%D0%BE%D0%BB%D1%8C%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Giuseppe_Arcimboldo.jpg","page_title":"Джузэпэ Арчымбольда","context_page_description":"Джузэпэ Арчымбольда — італьянскі жывапісец, дэкаратар, прадстаўнік маньерызму. У яго творчасьці адзначаюць прадугадваньне сюррэалізму."},{"page_url":"https://es.wikipedia.org/wiki/Torre_CFN","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/CFNQuito.jpg","page_title":"Torre CFN","context_page_description":"La Torre CFN es un edificio de la ciudad de Quito D.M., en Ecuador. Es el edificio más alto de la capital ecuatoriana con una altura de 82.4 metros, solo superado por la Basílica del Voto Nacional, cuyas torres de 115 metros de alto se llevan el título oficial. Durante diez años fue además el edificio moderno más alto del país, hasta la inauguración del Edificio La Previsora en Guayaquil.\\nEstá ubicado en el extremo sur de la parroquia conocida como La Mariscal, en un solar flanqueado por la avenida Patria y las calles Reina Victoria, Juan León Mera y 18 de Septiembre. El edificio alberga las oficinas de la Corporación Financiera Nacional, Secretaría Nacional de Planificación y Desarrollo, una agencia del Banco del Pacífico, entre otras instituciones."},{"page_url":"https://sv.wikipedia.org/wiki/Akhuryani_Jrambar","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/%D4%B1%D5%AD%D5%B8%D6%82%D6%80%D5%B5%D5%A1%D5%B6%D5%AB_%D5%BB%D6%80%D5%A1%D5%B4%D5%A2%D5%A1%D6%80%D5%A812.jpg","page_title":"Akhuryani Jrambar","context_page_description":"Akhuryani Jrambar är en reservoar i Armenien, på gränsen till Turkiet. Den ligger i den västra delen av landet, 80 kilometer nordväst om huvudstaden Jerevan. Akhuryani Jrambar ligger 1 439 meter över havet. Arean är 17,1 kvadratkilometer. Den sträcker sig 9,2 kilometer i nord-sydlig riktning, och 5,1 kilometer i öst-västlig riktning.\\nTrakten runt Akhuryani Jrambar består i huvudsak av gräsmarker. Runt Akhuryani Jrambar är det ganska tätbefolkat, med 129 invånare per kvadratkilometer. Inlandsklimat råder i trakten. Årsmedeltemperaturen i trakten är 9 °C. Den varmaste månaden är augusti, då medeltemperaturen är 26 °C, och den kallaste är januari, med -14 °C. Genomsnittlig årsnederbörd är 644 millimeter. Den regnigaste månaden är maj, med i genomsnitt 102 mm nederbörd, och den torraste är augusti, med 32 mm nederbörd."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9D%D0%B0%D1%81%D0%B5%D0%BB%D1%8C%D0%BD%D1%96%D1%86%D1%82%D0%B2%D0%B0_%D0%9D%D1%96%D0%B3%D0%B5%D1%80%D1%8B%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Population_density_map_of_Nigerian_states_-_English.png","page_title":"Насельніцтва Нігерыі","context_page_description":"Нігерыя з насельніцтвам амаль 200 млн чалавек з'яўляецца сёмай паводле колькасці насельніцтва краінай у свеце, і нават кансерватыўныя ацэнкі колькасці насельніцтва Афрыкі прыводзяць да высновы, што больш за 20 % чорнага насельніцтва свету пражывае ў Нігерыі. Нізерыя з'яўляецца самай населенай краінай у Афрыцы, у наступнай краіне — Эфіопіі — пражывае некалькі болей за 100 млн чал.. Нацыянальныя вынікі перапісу ў апошнія некалькі дзесяцігоддзяў былі даволі спрэчнымі. Вынікі апошняга перапісу насельніцтва былі выпушчаныя ў снежні 2006 года, паводле якіх насельніцтва краіны складала 140 003 542 чалавек. Сённяшняя лічба колькасці насельніцтва атрымана метадам ацэнкі."},{"page_url":"https://id.wikipedia.org/wiki/Fujairah","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Fujairah_Fort%2C_2007_%2803%29.JPG","page_title":"Fujairah","context_page_description":"Kota Fujairah adalah ibu kota dari Keamiran Fujairah di Uni Emirat Arab, terletak di Teluk Oman."},{"page_url":"https://fr.wikipedia.org/wiki/H%C3%B4tel_Beau-Rivage_Palace","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Picswiss_VD-46-35.jpg","page_title":"Hôtel Beau-Rivage Palace","context_page_description":"Le Beau-Rivage Palace est un hôtel cinq étoiles ou « palace ». Il se situe au bord du lac Léman, à Ouchy, dans la commune de Lausanne en Suisse.\\nIl appartient au groupe hôtelier Sandoz Foundation Hotels."},{"page_url":"https://sv.wikipedia.org/wiki/Lista_%C3%B6ver_fornl%C3%A4mningar_i_Vallentuna_kommun_(Angarn)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/U204.jpg","page_title":"Lista över fornlämningar i Vallentuna kommun (Angarn)","context_page_description":"Lista över fornlämningar i Vallentuna kommun (Angarn) är en förteckning av ett urval av de fornlämningar som finns i Angarn i Vallentuna kommun."},{"page_url":"https://sv.wikipedia.org/wiki/Meurival","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Map_commune_FR_insee_code_02482.png","page_title":"Meurival","context_page_description":"Meurival är en kommun i departementet Aisne i regionen Hauts-de-France i norra Frankrike. Kommunen ligger i kantonen Neufchâtel-sur-Aisne som ligger i arrondissementet Laon. År 2009 hade Meurival 53 invånare."},{"page_url":"https://pl.wikipedia.org/wiki/Otto_Pfister","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Otto_Pfister.jpg","page_title":"Otto Pfister","context_page_description":"Otto Pfister – niemiecki piłkarz, grający na pozycji napastnika, trener piłkarski. Prowadził między innymi reprezentację Togo na Mistrzostwach Świata w Niemczech w 2006 roku."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%85%88%E7%A7%A6%E6%9C%8D%E9%A3%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Konfuzius-1770.jpg","page_title":"先秦服飾","context_page_description":"先秦服饰是指先秦时代华夏衣冠，根据古代文献记载，有“黄帝作冕旒”、“胡曹作冕”、“胡曹作衣”、“伯余作衣裳”等。传说黄帝制定服饰制度，“始于黄帝，备于尧舜”，定型于周朝，形成完备的服制，并影响到宗周尊儒汉朝服制。王逸《机赋说》认为，上古人们拿兽皮当衣服，伏羲、炎帝以来，已经出现了真正的衣裳，到黄帝时期，则出现了衮冕等较为完备的服饰制度。\\n古老的天子六服、王后六服、儒服、剑服位于汉服体系的中心。玄衣𫄸裳的思想渊源，来自“尊天法地”的“天道”思想。传世的礼经载称先秦的礼服有“玄端”，用于朝服、冠礼及婚礼的新郎服等。根据《仪礼》及《礼记》的记载，玄端是造型正直端方，以表“端正”的玄色上衣。作为表征或劝勉世人，必当端庄正直的“常礼服”。西周册命金文中，只有大夫以上的贵族才有资格受赐玄衮。\\n《周礼》规定的服饰制度展现了当时华夏文明的等级文化、亲属文化、政治文化、重嫡轻庶、重长轻幼以及儒家的仁义思想。在周代宗法文化背景下，服饰具有昭名分、辨等威、别 贵贱的作用。周礼对周代及后世的服饰产生了重要的影响。五礼各有不同的礼服。孔子在姬姓鲁国衣逢掖之衣，来自周公的燕居之服，长居宋国则冠章甫之冠。“章甫之冠”指的是一种殷冠，周朝叫委貌冠或缁布冠，治理朝政所冠。庄子则提到了儒服以及武士之服剑服。因此儒服和剑服成为汉朝文官和武官的法服，也是士大夫和武士的基本服制。"},{"page_url":"https://hu.wikipedia.org/wiki/Szent_M%C3%A9n%C3%A1sz_nagyv%C3%A9rtan%C3%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Menas.jpg","page_title":"Szent Ménász nagyvértanú","context_page_description":"Szent Ménász Egyiptomban született gazdag szülőktől. Alig 15 éves korában vesztette el szüleit, mindenét odaadta a szegényeknek, hogy Istennek szentelt életet élhessen. Elhatározása ellenére katona lett. Mikor értesült Dioclecián keresztényellenes intézkedéseiről intézkedéseiről, otthagyta a légióját, és a Kotiaion város melletti pusztába vonult. Magányában ima, böjt, virrasztás és munka mellett, a lelki élet legmélyebb titkaiban is sikerült elmélyülnie.\\nKotiaionban lóversenyt tartottak. Korábban látomásában értesült arról, mily nehéz s fájdalmas vértanúságot fog szenvedni, mégis a lóverseny idején a versenytér közepére sietett, s ott megvallotta keresztény hitét.\\nPyrrhus helytartó másnapra halasztotta a tárgyalását...\\nElőször csak fenyegették s hízelegtek neki, miután ez nem bírta őt hittagadásra rettenetes kínzási folyamat vette kezdetét...\\nElőször kínpadon megostorozták, testét négy felé feszítették. Sebeiből patakzott a vér. Közben egy poroszló a császár iránti engedelmességre próbálta buzdítani. Ezek után oszlopra kötötték, és vaskampókkal marcangolták a testét. Testét szőrposztóval dörzsölték égő fáklyával sütögették."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Schiffe_der_K%C3%B6ln-D%C3%BCsseldorfer_Deutsche_Rheinschiffahrt","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/Victoria_Cruziana.jpg","page_title":"Liste der Schiffe der Köln-Düsseldorfer Deutsche Rheinschiffahrt","context_page_description":"Diese Liste umfasst alle Passagierschiffe, die sich im Einsatz der Köln-Düsseldorfer Deutsche Rheinschiffahrt AG befinden oder befunden haben."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%9A%E0%A4%95%E0%A5%8D%E0%A4%B0%E0%A4%B5%E0%A4%BE%E0%A4%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Greensburg3_small.gif","page_title":"चक्रवात","context_page_description":"चक्रवात घूमती हुई वायुराशि का नाम है।\\nउत्पत्ति के क्षेत्र के आधार पर चक्रवात के दो भेद हैं:\\nउष्ण कटिबंधीय चक्रवात या वलकियक चक्रवात, तथा\\nबाह्योष्णकटिबंधीय चक्रवात या शीतोष्णकटिबंधीय चक्रवात या उष्णवलयपार चक्रवात\\nउष्णवलयिक चक्रवात - ये वायुसंगठन या तूफान हैं, जो उष्ण कटिबंध में तीव्र और अन्य स्थानों पर साधारण होते हैं। इनसे प्रचुर वर्षा होती है। इनका व्यास ५० से लेकर १, ००० मील तक का तथा अपेक्षाकृत निम्न वायुदाब वाला क्षेत्र होता है। ये २० से लेकर ३० मील प्रति घंटा तक के वेग से चलते हैं। इनमें वायुघूर्णन ९० से लेकर १३० मील प्रति घंटे तक का होता है। ये वेस्ट इंडीज में प्रभंजन तथा चीनसागर एवं फिलिपिन में बवंडर और अमेरिका में टोर्नेडो तथा ऑस्ट्रेलिया में विल्ली विलिज कहे जाते हैं।\\nउष्णवलयपार चक्रवात - यह मध्य एवं उच्च अक्षांशों का निम्न वायुदाब वाला तूफान है। इसका वेग २० से लेकर ३० मील प्रति घंटे के वेग से सर्पिल रूप से चलती है। प्राय: इससे हिमपात एवं वर्षा होती है।\\nदोनों प्रकार के चक्रवात उत्तरी गोलार्ध में वामावर्त तथा दक्षिणी गोलार्ध में दक्षिणावर्त रूप में संचारित होते हैं। उष्णवलयपार चक्रवात में साधरणतया वायु-विचनल-रेखा होती है, जो विषुवत की ओर निम्नवायुकेंद्र में सैकड़ों मील तक बढ़ी रहती है तथा गरम एवं नम वायु को ठंडी और शुष्क वायु से पृथक् करती है।"},{"page_url":"https://en.wikipedia.org/wiki/Scientific_Detective_Monthly","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Amazing_Detective_Stories_March_1931.jpg","page_title":"Scientific Detective Monthly","context_page_description":"Scientific Detective Monthly was a pulp magazine that published fifteen issues beginning in January 1930. It was launched by Hugo Gernsback as part of his second venture into science-fiction magazine publishing, and was intended to focus on detective and mystery stories with a scientific element. Many of the stories involved contemporary science without any imaginative elements—for example, a story in the first issue turned on the use of a bolometer to detect a black girl blushing—but there were also one or two science fiction stories in every issue.\\nThe title was changed to Amazing Detective Tales with the June 1930 issue, perhaps to avoid the word \\"scientific\\", which may have given readers the impression of \\"a sort of scientific periodical\\", in Gernsback's words, rather than a magazine intended to entertain. At the same time, the editor—Hector Grey—was replaced by David Lasser, who was already editing Gernsback's other science-fiction magazines. The title change apparently did not make the magazine a success, and Gernsback closed it down with the October issue."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%B8%D1%97%D0%B2%D1%81%D1%8C%D0%BA%D0%B5_%D1%82%D0%BE%D0%B2%D0%B0%D1%80%D0%B8%D1%81%D1%82%D0%B2%D0%BE_%D1%84%D0%BE%D1%82%D0%BE%D0%B3%D1%80%D0%B0%D1%84%D1%96%D0%B2-%D0%B0%D0%BC%D0%B0%D1%82%D0%BE%D1%80%D1%96%D0%B2_%C2%AB%D0%94%D0%B0%D0%B3%D0%B5%D1%80%C2%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/%D0%9A%D0%B8%D1%97%D0%B2_-_%D0%A1%D0%B0%D0%BA%D1%81%D0%B0%D0%B3%D0%B0%D0%BD%D1%81%D1%8C%D0%BA%D0%BE%D0%B3%D0%BE_%D0%B2%D1%83%D0%BB.%2C_74_DSCF8978.JPG","page_title":"Київське товариство фотографів-аматорів «Дагер»","context_page_description":"Київське товариство фотографів-аматорів «Дагер» — товариство сприяння розвиткові теорії і практики фотографічної справи, сприяло розвиткові й поширенню художньої, технічної й наукової фотографії."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D1%8E%D1%81_(%D0%9F%D0%B0-%D0%B4%D0%B5-%D0%9A%D0%B0%D0%BB%D0%B5)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Bus_%C3%A9glise_1.jpg","page_title":"Бюс (Па-де-Кале)","context_page_description":"Бюс — муніципалітет у Франції, у регіоні О-де-Франс, департамент Па-де-Кале. Населення — 129 осіб.\\nМуніципалітет розташований на відстані близько 145 км на північ від Парижа, 65 км на південь від Лілля, 29 км на південний схід від Арраса."},{"page_url":"https://ro.wikipedia.org/wiki/Biserica_de_lemn_%C3%8En%C4%83l%C8%9Barea_Domnului_din_Vama","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Inaltarea_Domnului_wooden_church_from_Vama%2C_Suceava_county%2C_RO%284%29.JPG","page_title":"Biserica de lemn Înălțarea Domnului din Vama","context_page_description":"Biserica de lemn „Înălțarea Domnului” din Vama este un lăcaș de cult ortodox construit în anul 1783 în satul Vama din comuna omonimă aflată în județul Suceava. Edificiul religios are hramul Înălțarea Domnului. În anul 2001, biserica, împreună cu clopotnița acesteia, au fost strămutate în incinta Muzeului Satului Bucovinean din municipiul Suceava, unde se află în prezent.\\nAnsamblul bisericii „Înălțarea Domnului” din Vama a fost inclus pe Lista monumentelor istorice din județul Suceava din anul 2015 la numărul 440, având codul de clasificare SV-II-a-B-05654. El este format din două obiective:\\nBiserica de lemn „Înălțarea Domnului” – construită în 1783 și având codul SV-II-m-B-05654.01 și\\nClopotniță – construită în 1787 și având codul SV-II-m-B-05654.02."},{"page_url":"https://da.wikipedia.org/wiki/Gullaug_Station","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Gullaug_hp.jpg","page_title":"Gullaug Station","context_page_description":"Gullaug Station var en jernbanestation på Drammenbanen, der lå i området Gullaug i Lier kommune i Norge.\\nStationen åbnede som trinbræt 21. november 1956 og bestod af et spor og en perron med et læskur i træ. Den blev nedlagt i 1973, da Lieråsen tunnel åbnede, og banen fik et andet trace mellem Asker og Brakerøya. Den gamle trace er efterfølgende omdannet til en vandre- og cykelsti, der ligger i et populært turistområde."},{"page_url":"https://de.wikipedia.org/wiki/Suzuki_Swift","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/1994_Suzuki_Swift_Cino_5-door_hatchback_%282010-09-19%29.jpg","page_title":"Suzuki Swift","context_page_description":"Der Suzuki Swift ist ein seit Herbst 1983 gebautes Modell des japanischen Automobilherstellers Suzuki.\\nDer Swift wurde als Suzuki Cultus auf der 25. Tokyo Motor Show, als Resultat der Zusammenarbeit mit General Motors, vorgestellt. Anfangs auch als SA 310 sowie als SA 413 verkauft, erlebte er als Swift in den Jahren 1989 bis 2005 drei Modellwechsel. Facelifts fanden 1986, 1992 und 1996 statt. Der 2005 präsentierte Swift hat mit seinen Vorgängern nicht mehr viel gemeinsam. Der Typ ist robuster, größer und zudem auch schwerer.\\nAuf dem internationalen Markt wurde der Swift auch unter anderen Markennamen verkauft, u. a. in Japan als Suzuki Cultus, in Indien als Maruti Esteem, in Amerika als Chevrolet Sprint, Pontiac Firefly und Geo Metro, sowie in Australien als Holden Barina. In Japan wurde die erste Generation auch von Isuzu als Isuzu Geminett vermarktet. Mit dem Suzuki Dzire wird seit 2008 eine auf dem Swift basierende Stufenheck-Version gebaut.\\nSeit 1996 werden die Fahrzeuge für den deutschen Markt bei Magyar Suzuki Zrt. in Esztergom hergestellt."},{"page_url":"https://cy.wikipedia.org/wiki/Farmers_Branch,_Texas","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Coca_Cola_Enterprises_Bottling_in_Farmers_Branch%2C_Texas.JPG","page_title":"Farmers Branch, Texas","context_page_description":"Dinas yn Dallas County, yn nhalaith Texas, Unol Daleithiau America yw Farmers Branch, Texas. ac fe'i sefydlwyd ym 1850.\\nCeir 9 cylchfa amser yn UDA, ac mae hon yn perthyn i'r cylchfa amser a elwir yn: Cylchfa Amser Canolog."},{"page_url":"https://it.wikipedia.org/wiki/Premi_C%C3%A9sar_2018","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Camelia_Jordana_C%C3%A9sar_du_cin%C3%A9ma_2018.jpg","page_title":"Premi César 2018","context_page_description":"La cerimonia di premiazione della 43ª edizione dei Premi César ha avuto luogo il 2 marzo 2018 presso il Salle Pleyel di Parigi. È stata presentata da Manu Payet.\\nAd ottenere il maggior numero di candidature sono state le pellicole Ci rivediamo lassù e 120 battiti al minuto."},{"page_url":"https://mg.wikipedia.org/wiki/Henri_Lansbury","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/HenriLansbury.jpg","page_title":"Henri Lansbury","context_page_description":"Henri Lansbury dia mpilalao baolina kitra mizaka ny zom-pirenen'i Fanjakana Mitambatra teraka ny 12 Oktobra 1990 tao London"},{"page_url":"https://ur.wikipedia.org/wiki/%D8%B6%D9%84%D8%B9_%D8%A7%D8%B1%D8%BA%D9%86%D8%AC_%D8%AE%D9%88%D8%A7%DB%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Afghanistan_Badakhshan_Fayzabad_district_location.PNG","page_title":"ضلع ارغنج خواہ","context_page_description":"ضلع ارغنج خواہ افغانستان کا ایک ضلع جو صوبہ بدخشاں میں واقع ہے۔"},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D9%87%D8%B1%D8%B3%D8%AA_%D8%A8%D9%84%D9%86%D8%AF%D8%AA%D8%B1%DB%8C%D9%86_%D8%B3%D8%A7%D8%AE%D8%AA%D9%85%D8%A7%D9%86%E2%80%8C%D9%87%D8%A7_%D8%AF%D8%B1_%D8%A2%D9%85%D8%B1%DB%8C%DA%A9%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Trump_International_Hotel_and_Tower_%28Chicago%29.jpg","page_title":"فهرست بلندترین ساختمان‌ها در آمریکا","context_page_description":"جدول زیر حاوی ۱۱ تا بلندترین برج کنونی کشور آمریکا تا سال ۲۰۱۳ است.\\nهنگام ساخت، بلندترین برج جهان بود"},{"page_url":"https://ja.wikipedia.org/wiki/%E6%96%B0%E9%9D%99%E5%B2%A1%E3%82%A4%E3%83%B3%E3%82%BF%E3%83%BC%E3%83%81%E3%82%A7%E3%83%B3%E3%82%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/31/SHIN-TOMEI_EXPRESSWAY_shinshizuoka_IC.JPG","page_title":"新静岡インターチェンジ","context_page_description":"新静岡インターチェンジは、静岡県静岡市葵区下にある新東名高速道路のインターチェンジである。地域高規格道路である静岡南北道路に接続されているが、同道路の下インターチェンジと一体化しており、一般道路に向かうことができる。また、そのまま自動車専用道路のみを利用することもできる為、ジャンクションとしても機能している。静岡市山間部へはこのインターチェンジが近い。静岡市中心部へはこのインターチェンジより、東名高速道路の静岡ICのほうが近い。\\n2017年11月1日より、当インターチェンジから森掛川インターチェンジ間の約50kmで制限速度110km/hの試行区間となり、2019年3月1日に120km/hに引き上げられた。"},{"page_url":"https://sh.wikipedia.org/wiki/Rano_hri%C5%A1%C4%87anstvo","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Marcion_teaching.jpg","page_title":"Rano hrišćanstvo","context_page_description":"Rano hrišćanstvo obuhvata početno razdoblje hrišćanstva od smrti Isusa Hrista u 33-im godinama 1. vijeka, do postajanja državnom religijom u 4. vijeku, kada je legalizovano, dogmatizovano te konačno etatizovano.\\nRano hrišćanstvo je nastalo kao verski pokret, odnosno sekta unutar judaizma, da bi se tokom 1. veka od njega potpuno odvojilo. Središte nove religije je u početku bio u Jerusalimu, ali nakon uništenja Hrama u jevrejsko-rimskom ratu 70. godine, jevrejski hrišćani gube prvenstvo. Rim, kao prestonica Carstva, postaje glavno sedište hrišćanstva, a rimski episkop postaje dominantni episkop, koji kasnije uzima titulu pape.\\nRazni vidovi hrišćanstva su cvetali u ranom periodu pokreta. Ranohrišćanske zajednice su često bile veoma podeljene iznutra, u većoj meri nego samo društvo, jer su u njima često Jevreji i nejevreji bili zajedno. Oni koji su se nazivali hrišćanima imali su mnoga, bitno različita religijska verovanja i prakse. U hrišćanstvu drugog i trećeg veka teološka raznovrsnost je bila toliko naglašena da su se grupe koje su se nazivale hrišćanima držale verovanja i praksi za koje bi većina današnjih hrišćana tvrdila da uopšte nisu hrišćanske."},{"page_url":"https://it.wikipedia.org/wiki/Motu","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Raiatea_Motu.JPG","page_title":"Motu","context_page_description":"La parola motu nelle lingue polinesiane significa 'isola' ed è usata anche per definire un rilievo sabbioso sul livello dell'oceano, con un'altezza che va da poche decine di centimetri fino a qualche metro, sul margine delle barriere coralline."},{"page_url":"https://de.wikipedia.org/wiki/Sauerland-Netz","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/DB_620_537_Br%C3%BCgge%28Westf%29.jpg","page_title":"Sauerland-Netz","context_page_description":"Als Sauerland-Netz wird eine Gruppe von Linien des Schienenpersonennahverkehrs im Sauerland bezeichnet, die vom zuständigen ÖPNV-Aufgabenträger zusammen ausgeschrieben und vergeben werden. Hierzu zählen die Regional-Expresse bzw. Regional-Bahnen:\\nRE 17 Sauerland-Express,\\nRB 43 Emschertal-Bahn,\\nRB 52 Volmetal-Bahn,\\nRB 53 Ardey-Bahn\\nRB 54 Hönnetal-Bahn,\\nRE 57 Dortmund-Sauerland-Express.\\nIm Dezember 2004 übernahm die DB Regio NRW den Betrieb der RB 52 von der Dortmund-Märkischen Eisenbahn. Die RB 53, RB 54 und RE 57 wurden schon vorher von der DB Regio NRW gefahren.\\nDen Betrieb der RB 43 hat die DB Regio NRW im Dezember 2015 von der NordWestBahn übernommen.\\nMit der Vergabe des Betriebs ab Dezember 2016 ist auch die Linie RE 17 Teil des Sauerland-Netzes.\\nDie Eisenbahnen im Sauerland bildeten demgegenüber ein wesentlich umfangreicheres Netz."},{"page_url":"https://en.wikipedia.org/wiki/Itaoca","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Bras%C3%A3o_de_Itaoca_SP.png","page_title":"Itaoca","context_page_description":"Itaoca is a municipality in the state of São Paulo in Brazil. The population is 3,337 in an area of 183 km². The elevation is 155 m."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E4%B8%8A%E6%B0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Sheung_Shui_Centre_Interior.jpg","page_title":"上水","context_page_description":"上水位于香港新界北区西部，是香港最北面的主要市镇，也是粉岭／上水新市镇的一部分。上水一带原为农田，于1980年代起发展为现代化新市镇，区内住宅和商业区以石湖墟和港铁上水站一带的市中心发展，是上水人口最密集的地区，也是北区的主要商业经济中心，昔日的农田现只可在市中心北部，西南部等村落找到。\\n上水因靠近中国大陆边境，为大陆居民进入香港的首站，因此区内不论假日均有大量来自深圳一带的自由行旅客和水货客在区内消费和从事水货活动，使到区内人流和商业活动增加，为区内居民正常生活造成滋扰，上水的区内民生店铺和小店都变成了药房，而政府亦无积极解决居民需要，因此曾触发多次示威而表达不满。"},{"page_url":"https://fr.wikipedia.org/wiki/Kanishka","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/StonePaletteIndianNobleman.jpg","page_title":"Kanishka","context_page_description":"Kanishka Iᵉʳ est le souverain le plus connu de l'Empire kouchan au début de notre ère. Malheureusement les dates sont encore l'objet de controverses. Fils de Vima Kadphisès, c'est un grand conquérant et un sage administrateur. Il règne sur un vaste empire, de l’Asie centrale à la principauté de Bénarès. Il porte à la fois le titre indien de « maharaja », iranien de « Roi des Rois », et chinois de « Fils du Ciel ». Sa capitale est à Purushapura.\\nSi les textes bouddhiques font de Kanishka celui qui a favorisé l'expansion du bouddhisme, aujourd'hui il y a tout lieu de penser que les bouddhistes se sont approprié cette image de Kanishka en protecteur de leur foi, mais on peut légitimement en douter. Néanmoins c'est effectivement sous son règne que l'on assiste à cette expansion dans son empire, et surtout au Gandhara. Aussi le Bouddha, autrefois représenté sous forme symbolique, prit très rapidement de nombreuses formes dans un syncrétisme culturel singulier.\\nLes talibans ont détruit en 2000 une statue le représentant, une pièce unique du musée de Kaboul.\\nL'Empereur Huvishka lui succède."},{"page_url":"https://fi.wikipedia.org/wiki/Pyh%C3%A4n_Markuksen_kellotorni","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/San_Marco_two_bells.JPG","page_title":"Pyhän Markuksen kellotorni","context_page_description":"Pyhän Markuksen kellotorni eli kampaniili on Venetsian Pyhän Markuksen torilla sijaitseva 98,6-metrinen torni ja kaupungin korkein rakennus. Kellotornin rakentaminen aloitettiin vuosien 888 ja 911 välillä ja se valmistui doge Tribuno Memmon aikana 979–991. Tornin nykyinen asu on 1500-luvun alusta.\\nVenetsian kellotorneja käytettiin alun perin majakkoina ja tulipalojen torjunnassa. Torneihin ei useinkaan päästetty ulkomaalaisia, jotta he eivät voisi vakoilla kaupunkivaltion satamien toimintaa tai puolustusta. Varakkaat kaupunkilaiset sen sijaan saattoivat kilpailla sillä kuka pystyy ratsastamaan kellotornin huipulle. Vuonna 1609 Galileo Galilei demonstroi kehittämänsä kaukoputken toimintaa Pyhän Markuksen tornissa. Tornin viidellä kellolla oli tasavallan aikana kullakin oma tehtävänsä. Esimerkiksi marangona-kello ilmoitti työpäivän alkamisen ja loppumisen, kun taas malefigo-kello ilmoitti mestauksesta. Nykyisin kaikki viisi kelloa soivat tasatunnein.\\nTorni kesti siihen kohdistuneet salamaniskut ja tulipalot vuoteen 1902 asti, jolloin se romahti. Aluksi heinäkuun alkupuolella havaittiin murtumia tornin pohjoissivulla, ja 14. heinäkuuta torni kaatui pohjoisen suuntaan."},{"page_url":"https://fr.wikipedia.org/wiki/Trinity_College_(Dublin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/The_entrance_of_the_historic_Trinity_College_%28Unsplash%29.jpg","page_title":"Trinity College (Dublin)","context_page_description":"Le Trinity College est le seul collège constituant de l'université de Dublin, une université de recherche située à Dublin, en Irlande. Officiellement le College of the Holy and Undivided Trinity of Queen Elizabeth near Dublin, il a été fondé en 1592 par la reine Elizabeth Iʳᵉ en tant que « mère d'université » sur le modèle des universités collégiales d'Oxford et de Cambridge, mais contrairement à ces institutions affiliées, un seul collège a été créé ; à ce titre, les désignations « Trinity College » et « Université de Dublin » sont généralement synonymes pour des raisons pratiques Première université irlandaise par son ancienneté et par son importance, elle fait partie l'une des sept anciennes universités du Royaume-Uni et de l'Irlande. L'admission est basée exclusivement sur le mérite académique. Ses recherches portent sur les nanotechnologies, l'informatique, l'immunologie, les mathématiques, l'ingénierie, la psychologie, les sciences politiques, l'anglais et les sciences humaines et sociales."},{"page_url":"https://vi.wikipedia.org/wiki/Hylonympha_macrocerca","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Hylonympha_macrocerca.jpg","page_title":"Hylonympha macrocerca","context_page_description":"Hylonympha macrocerca là một loài chim trong họ Chim ruồi."},{"page_url":"https://pl.wikipedia.org/wiki/Tavaux","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Mairie_-_Tavaux_%28Jura%29.jpg","page_title":"Tavaux","context_page_description":"Tavaux – miejscowość i gmina we Francji, w regionie Burgundia-Franche-Comté, w departamencie Jura.\\nWedług danych na rok 1990 gminę zamieszkiwało 4387 osób, a gęstość zaludnienia wynosiła 317 osób/km²."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%A7%E6%BD%AD_(%E9%A6%99%E6%B8%AF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Tai_Tam_Tuk_Reservoir.jpg","page_title":"大潭 (香港)","context_page_description":"大潭是一個位於香港港島南區東南部的近郊地方，赤柱以東、石澳以西。其唯一主要道路是大潭道，大部分地方為大潭水塘、大潭郊野公園和大潭郊野公園所覆蓋。沿著大潭道的都是一些歷史悠久的豪華公寓。大潭，名字意指「一大片的深水處」，亦即赤柱半島、鶴咀半島和大潭篤所包圍的三角水域。"},{"page_url":"https://en.wikipedia.org/wiki/Polatl%C4%B1%E2%80%93Konya_high-speed_railway","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Konya_Gar.JPG","page_title":"Polatlı–Konya high-speed railway","context_page_description":"The Polatlı–Konya high-speed railway is a 211 km long high-speed railway running from the town of Polatlı to the central Anatolian city of Konya."},{"page_url":"https://de.wikipedia.org/wiki/Intel_8259","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/NEC_D8259AC.jpg","page_title":"Intel 8259","context_page_description":"Der Intel 8259 ist ein programmierbarer Unterbrechungs-Steuerbaustein, der primär für die Intel-8080/8085-Prozessoren entwickelt wurde. Später wurde der Chip auch zusammen mit dem Intel 8086/8088 und seinen Nachfolgern eingesetzt. Der Baustein wird hauptsächlich im 28-Pin-DIL-Gehäuse geliefert. Er wurde u. a. an NEC und Siemens lizenziert.\\nEr besitzt 8 Interrupt-Eingänge und einen Interrupt-Ausgang. Er wird seit den ersten PCs eingesetzt. Die Eingänge sind dabei mit den Interrupt-Pins der Geräte im System verbunden, der Ausgang mit der CPU."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%BA%9C%E4%B8%AD%E5%B8%82%E9%83%B7%E5%9C%9F%E3%81%AE%E6%A3%AE%E5%8D%9A%E7%89%A9%E9%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Gate_of_Former_Mitsuoka_Family_of_House.JPG","page_title":"府中市郷土の森博物館","context_page_description":"府中市郷土の森博物館は、東京都府中市にある、多くの建築物を含む森全体が一体となった野外博物館である。多摩川の是政緑地に隣接した自然の多い場所にあり、敷地面積は約14haである。\\n「府中の歴史と文化と人の調和に貢献すること」を館の使命とし、施設運営を行っている。\\n郷土資料の展示などをしている二階建ての本館を中核としてプラネタリウムを併設し、府中市域の江戸中期から昭和初期の建築物を移築復元して保存している。府中市は武蔵国の国府という中心地であったため遺跡が多く、それら市内遺跡からの出土品を展示している。昔の生活道具や農耕道具の展示と体験イベントを通じて当時の民俗を伝えている。\\n多摩川の砂利採掘跡を利用しており、はけ、小川、浅間山、梅園など、地形を再現し、それを生かした建物や田畑などと歴史と自然を楽しめるようになっている。\\n水平型関東最大級、ドーム径２３ｍのプラネタリウムでも知られる。自然の多い園内を活かし、天体観望会なども行われる。\\n常設展展示解説・復元建築物解説をはじめ、各種イベント等が活発に行われる。梅園では梅が収穫され、梅干・梅ジャム・梅羊羹・梅酢が製造販売されている。"},{"page_url":"https://sl.wikipedia.org/wiki/Otokar_II._P%C5%99emysl","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/PecetpoII.jpg","page_title":"Otokar II. Přemysl","context_page_description":"Otokar II. Přemysl, češki kralj, * okrog 1230, † 26. avgust 1278.\\nOtokarju II. je uspelo združiti ozemlje od Češke pa do Jadranskega morja. Po njem je poimenovan Kraljevec, nemško Königsberg."},{"page_url":"https://ca.wikipedia.org/wiki/Vol_Gastron%C3%B2mic","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Vol_gastron%C3%B2mic_Girona_2015.jpg","page_title":"Vol Gastronòmic","context_page_description":"El Vol Gastronòmic fou un projecte culinari ubicat al costat del Pont de Pedra de Girona. Es va inaugurar el 2014 i es va retirar els darrers dies de setembre de 2015. El Vol Gastronòmic de Girona es va inaugurar a finals de juliol de 2014. Es tractava d'una estructura de vidre i ferro de 28 tones i 20 metres de llargada que sobrevolava sobre la llera del riu Onyar. El seu objectiu era reunir alguns dels xefs destacats del país i promoure la gastronomia gironina i catalana. La idea inicial era que fos un element temporal i que posteriorment viatgés per altres ciutats europees com Londres, Madrid, Moscou o Sant Sebastià, però la fallida econòmica de la seva estada a Girona els va fer replantejar el projecte."},{"page_url":"https://hsb.wikipedia.org/wiki/Melanie_Safka","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Melanie_Safka_mch3-2b.jpg","page_title":"Melanie Safka","context_page_description":"Melanie Anne Safka-Schekeryk je US-ameriska spěwarka a awtorka spěwow.\\nHłownje je wona pod mjenom Melanie znata, wosebje za jeje wuspěšne spěwy \\"Brand New Key\\", \\"Lay Down\\" and \\"What Have They Done To My Song Ma\\". Hač dotal je wona wjace hač 25 milionow zynkonošaki předała."},{"page_url":"https://it.wikipedia.org/wiki/Firenze","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Basilica_di_san_lorenzo_33.JPG","page_title":"Firenze","context_page_description":"Firenze è un comune italiano di 372 038 abitanti, capoluogo della Toscana e centro della città metropolitana, è il primo comune della regione per popolazione, cuore dell'area metropolitana di Firenze-Prato-Pistoia.\\nNel Medioevo è stata un importante centro artistico, culturale, commerciale, politico, economico e finanziario; nell'età moderna ha ricoperto il ruolo di capitale del Granducato di Toscana dal 1569 al 1859 che, con il governo delle famiglie dei Medici e dei Lorena, divenne uno degli stati più ricchi e moderni. Le varie vicissitudini politiche, la potenza finanziaria e mercantile e le influenze in ogni campo della cultura hanno fatto della città un crocevia fondamentale della storia italiana ed europea. Nel 1865 Firenze fu proclamata capitale del Regno d'Italia, mantenendo questo status fino al 1871, anno che segna la fine del Risorgimento.\\nImportante centro universitario e patrimonio dell'umanità UNESCO dal 1982, è considerata luogo d'origine del Rinascimento – la consapevolezza di una nuova era moderna dopo il Medioevo, periodo di cambiamento e \\"rinascita\\" culturale e scientifica – e della lingua italiana grazie al volgare fiorentino usato nella letteratura."},{"page_url":"https://he.wikipedia.org/wiki/%D7%99%D7%95%D7%A1%D7%A3_%D7%A0%D7%99%D7%99%D7%92%D7%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/%D7%A0%D7%99%D7%99%D7%92%D7%95-3.jpg","page_title":"יוסף נייגו","context_page_description":"יוסף נייגו היה אגרונום אשר שימש כמנהל מקוה ישראל בשנים 1891–1904 ותרם רבות לפיתוחו. בשנים 1904–1923 שימש כיועץ של חברת יק\\"א ישראל ועסק בעידוד התיישבות יהודית חקלאית במזרח התיכון. הגה את רעיון הקמת חוות סג'רה מטעם כל ישראל חברים והביא לארץ ישראל את מטעי האבוקדו וההדרים. מנהל לשכת \\"בני ברית\\" באיסטנבול ומייסדה. סייע בהקמתו של בית הספר התיכון היהודי הראשון באיסטנבול והיה מנהלו הראשון."},{"page_url":"https://en.wikipedia.org/wiki/Wyoming_State_Hospital","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Wyoming_State_Insane_Asylum.jpeg","page_title":"Wyoming State Hospital","context_page_description":"The Wyoming State Hospital, once known as the Wyoming State Insane Asylum, is located in Evanston, Wyoming, United States. The historic district occupies the oldest portion of the grounds and includes fifteen contributing buildings, including the main administrative building, staff and patient dormitories, staff apartments and houses, a cafeteria and other buildings, many of which were designed by Cheyenne, Wyoming architect William Dubois. Established in 1887, the historic buildings span the period 1907-1948. At one point it was common for new hall additions to be named after the counties in Wyoming. The recent addition of Aspen, Cottonwood, and Evergreen halls do not follow this trend.\\nFour buildings were designed by Casper architects Goodrich & Wilking."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A4%D7%A8%D7%95%D7%99%D7%A7%D7%98_%D7%9E%D7%A1%D7%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Endorsement-Stamp_web.png","page_title":"פרויקט מסע","context_page_description":"פרויקט \\"מסע\\" הוא ארגון ללא כוונת רווח שנוסד בשנת 2004, בשותפות ממשלת ישראל והסוכנות היהודית.\\nפרויקט מסע הוא הפלטפורמה המובילה את עולם התוכניות הארוכות בישראל עבור צעירים יהודים מהתפוצות. מאז היווסדו השתתפו במסגרת 'מסע' מעל 110,000 יהודים צעירים מלמעלה מ–60 מדינות בעולם, כאשר היעד הוא הבאת 20,000 צעירים בשנה לתוכניות באורך סמסטר עד שנה בישראל.\\nבמסגרת מסע מועברים מגוון רחב של תוכניות חינוכיות בתחומי - התנדבות, לימודים אקדמאים, פיתוח קריירה ולימודי יהדות. התוכניות מיועדות לצעירים בני 18–30, כאשר עד שנה זו אורכן של התוכניות אשר נכללו במסגרת הפרויקט היה בין סמסטר לשנה ואלו החל משנה זו, לאור החלטת ממשלה שהתקבלה באוקטובר 2015, נכללות במסגרת הפרויקט גם תוכניות באורך ביניים של בין 8–10 שבועות.\\nפרויקט מסע מציע לכל משתתף זכאי סיוע כספי הנע בין $10,000-$500 להשתתפות בתוכנית מוכרת מטעם מסע בישראל ואף קובע את הסטנדרטים להפעלת התוכניות. כמו כן מבצע הארגון בקרת איכות תוך פיתוח רשת גלובלית הכוללת ישראלים ויהודים מרחבי העולם."},{"page_url":"https://pl.wikipedia.org/wiki/Liderzy_Ukrai%C5%84skiej_Socjalistycznej_Republiki_Radzieckiej","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Petrovskiy_Grigoriy.jpg","page_title":"Liderzy Ukraińskiej Socjalistycznej Republiki Radzieckiej","context_page_description":null},{"page_url":"https://da.wikipedia.org/wiki/Tsingy_de_Namoroka_Strict_Nature_Reserve","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Namoroka_Tsingy.jpg","page_title":"Tsingy de Namoroka Strict Nature Reserve","context_page_description":"Tsingy de Namoroka Strict Nature Reserve er en nationalpark i den nordvestlige del af Madagaskar, i Soalala-distriktet i provinsen Mahajanga-provinsen"},{"page_url":"https://pl.wikipedia.org/wiki/Dw%C3%B3jka_(karta)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/DB_from_48_German_Cards.jpg","page_title":"Dwójka (karta)","context_page_description":"Dwójka – karta do gry tradycyjnie przedstawiająca dwa symbole danego koloru karcianego. W tradycyjnej hierarchii ważności dwójka jest liczona jako 2 karta w talii, występującą po jedynce i przed trójką. Pełna talia kart do gry zawiera cztery dwójki, po jednej w każdym kolorze.\\nDwójka występuje również w kartach polskich i szwajcarskich, gdzie jest odpowiednikiem zarówno francuskiej dwójki i francuskiego asa. W tych pierwszych jest oznaczana: w przypadku dzwonków i czerwieni jako dwa rzędy symboli po 1, a w przypadku żołędzi i win jako część rośliny posiadającej jedną gałąź po obu stronach."},{"page_url":"https://en.wikipedia.org/wiki/Ports_of_the_Republic_of_Siena","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Mura_di_Talamone_%28GR%29.jpg","page_title":"Ports of the Republic of Siena","context_page_description":"The Republic of Siena in its progressive territorial growth saw its borders expanding especially in the territories of southern Tuscany in the current province of Grosseto. The possession of an \\"access to the sea\\" by Siena was therefore a natural continuation of its expansionary and commercial policy in the Maremma with the conquest of the ports of Talamone, Porto Ercole and Porto Santo Stefano.\\nIn order to ensure access to maritime traffic and a competitive sales network, Siena already tried to secure the use of the Grosseto river port in the 13th century. However, the port, swept away during the 14th century by the violent flood that removed the course of the Ombrone from the city, never had any development, also due to the incorrect economic policy of Siena and the lack of a productive background."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Castelletto_di_Branduzzo","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Map_of_comune_of_Castelletto_di_Branduzzo_%28province_of_Pavia%2C_region_Lombardy%2C_Italy%29.svg","page_title":"Castelletto di Branduzzo","context_page_description":"Castelletto di Branduzzo sī Italia Lombardia toā-khu Pavia Séng ê chi̍t ê comune."},{"page_url":"https://en.wikipedia.org/wiki/Islamism","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Reagan_sitting_with_people_from_the_Afghanistan-Pakistan_region_in_February_1983.jpg","page_title":"Islamism","context_page_description":"Islamism is a concept whose meaning has been debated in both public and academic contexts. The term can refer to diverse forms of social and political activism advocating that public and political life should be guided by Islamic principles or more specifically to movements which call for full implementation of sharia. It is commonly used interchangeably with the terms political Islam or Islamic fundamentalism. In academic usage, the term Islamism does not specify what vision of \\"Islamic order\\" or sharia are being advocated, or how their advocates intend to bring them about. In Western mass media it tends to refer to groups whose aim is to establish a sharia-based Islamic state, often with implication of violent tactics and human rights violations, and has acquired connotations of political extremism. In the Muslim world, the term has positive connotations among its proponents.\\nDifferent currents of Islamist thought include advocating a \\"revolutionary\\" strategy of Islamizing society through exercise of state power, and alternately a \\"reformist\\" strategy to re-Islamizing society through grass-roots social and political activism."},{"page_url":"https://vi.wikipedia.org/wiki/S%C3%B4ng_Shinano","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Ryuto-Ohashi.JPG","page_title":"Sông Shinano","context_page_description":"Sông Shinano dài 367 km là con sông dài nhất Nhật Bản. Sông Shinano xuất phát từ huyện Nagano chảy qua Niigata và đổ vào biển Nhật Bản tại thành phố Niigata. Shinano có lưu vực rộng 11.900 km², lớn thứ ba ở Nhật Bản. Sông này còn có tên là Chikuma.\\nNguồn chính của sông Shinano là vùng núi Kuboshi chỗ giáp ranh giữa các huyện Saitama, Yamanashi và Nagano. Sông chảy về phía Tây Bắc, hợp với sông Sai từ Kumamoto đổ về rồi chuyển hướng về phía Đông Bắc. Kawanakajima ở Nagano, chỗ hợp lưu giữa sông Shinano và sông Sai, là trận địa lịch sử trong Cuộc chiến Kawanakajima.\\nSông Shinano có công bồi đắp đồng bằng Niigata thêm màu mỡ, tạo điều kiện thích hợp cho việc trồng lúa."},{"page_url":"https://en.wikipedia.org/wiki/Old_Goa","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Se_Cathedral%2C_Old_Goa.JPG","page_title":"Old Goa","context_page_description":"Old Goa is a historical city situated on the southern banks of the Mandovi River in the Ilhas sub-district of North Goa in the Indian state of Goa.\\nThe city was established by the Bijapur Sultanate in the 15th century and served as capital of Portuguese India from the 16th century until its abandonment in the 18th century due to a plague. Under the Portuguese, it is said to have once been a city of nearly 200,000 wherefrom, before the plague, the Portuguese traded across continents. The remains of the city are a UNESCO World Heritage Site. Old Goa is approximately 10 kilometres east of the state capital Panaji."},{"page_url":"https://de.wikipedia.org/wiki/Kirchen_in_Leipzig","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Bundesarchiv_Bild_183-25704-0006%2C_Leipzig%2C_Kirche.jpg","page_title":"Kirchen in Leipzig","context_page_description":"Die Kirchen in Leipzig haben sich zusammen mit der Ausbreitung der Stadt entwickelt. Im heutigen Leipziger Stadtgebiet gibt es mehr als 90 Kirchenbauten, davon gehören allein 65 zur Evangelisch-Lutherischen Landeskirche Sachsens, der in Leipzig mitgliederstärksten Kirche.\\nDie zwei größten und bedeutendsten Kirchenbauten des Mittelalters befanden sich innerhalb der ehemaligen Stadtmauer. Diese beiden noch heute das Stadtzentrum bestimmenden Kirchen, die Nikolai- und die Thomaskirche, waren von 1539 bis 1876 auch die einzigen Pfarrkirchen der Stadt.\\nAls 1889 mit Reudnitz und Anger-Crottendorf die ersten Orte nach Leipzig eingemeindet wurden, kamen die ländlichen Ortschaften mit den alten Dorfkirchen, die sich meist in der Mitte der alten Ortslage befanden, hinzu. Viele dieser Kirchen sind bis heute erhalten. Einige zu klein gewordene Dorfkirchen wurden nach der Entwicklung der ehemaligen Dörfer zu bevölkerungsreichen Industrievororten in der zweiten Hälfte des 19. Jahrhunderts durch größere Neubauten ersetzt. Meist entstanden Kirchen jedoch als Neugründungen.\\nDie Andreaskapelle aus dem 11."},{"page_url":"https://fy.wikipedia.org/wiki/Hedwich_fan_Saksen","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Hedwig_of_Saxony.jpg","page_title":"Hedwich fan Saksen","context_page_description":"Hedwich fan Saksen, hartoginne fan Frânsje wie de dochter fan de Dútske kening Hindrik I de Fûgelder en syn twadde frou Mattilde en suster fan keizer Otto I en mem fan Hugo Capet, fan wa't de Kapetinger ôfstamme.\\nHedwich wie jonger as har broer Otto I en har suster Gerberga, mar âlder as har broer Hindrik I fan Beieren. Yn 937 of 938 boaske hja mei Hugo de Grutte fan Frânsje. Harren soan Hugo Capet, dy't yn 987 Frânsk kening waard, waard om 940 hinne berne. Oare soannen binne Odo"},{"page_url":"https://ceb.wikipedia.org/wiki/New_Salem_(lungsod_sa_Tinipong_Bansa,_North_Dakota)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/NewSalemND.jpeg","page_title":"New Salem (lungsod sa Tinipong Bansa, North Dakota)","context_page_description":"Lungsod ang New Salem sa Tinipong Bansa. Ang New Salem nahimutang sa kondado sa Morton County ug estado sa North Dakota, sa sentro nga bahin sa nasod, 2,200 km sa kasadpan sa ulohang dakbayan Washington, D.C. 662 metros ibabaw sa dagat kahaboga ang nahimutangan sa New Salem, ug adunay 946 ka molupyo.\\nAng yuta palibot sa New Salem kay patag. Kunhod pa sa 2 ka tawo kada kilometro kwadrado sa palibot sa New Salem. New Salem ang kinadak-ang lungsod sa maong dapit. Hapit nalukop sa kaumahan ang palibot sa New Salem.\\nAng klima hemiboreal. Ang kasarangang giiniton 7 °C. Ang kinainitan nga bulan Hulyo, sa 25 °C, ug ang kinabugnawan Enero, sa -10 °C. Ang kasarangang pag-ulan 684 milimetro matag tuig. Ang kinabasaan nga bulan Mayo, sa 127 milimetro nga ulan, ug ang kinaugahan Enero, sa 13 milimetro."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Falkenstein/Harz","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Waldstra%C3%9Fe_2_%28Pansfelde%29.jpg","page_title":"Liste der Kulturdenkmale in Falkenstein/Harz","context_page_description":"In der Liste der Kulturdenkmale in Falkenstein/Harz sind alle Kulturdenkmale der Stadt Falkenstein/Harz und ihrer Ortsteile aufgelistet. Grundlage ist das Denkmalverzeichnis des Landes Sachsen-Anhalt, das auf Basis des Denkmalschutzgesetzes vom 21. Oktober 1991 durch das Landesamt für Denkmalpflege und Archäologie Sachsen-Anhalt erstellt und seither laufend ergänzt wurde."},{"page_url":"https://en.wikipedia.org/wiki/Don_Padgett","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Don_Padgett_Cardinals.jpg","page_title":"Don Padgett","context_page_description":"Don Wilson Padgett was an American professional baseball player, a catcher/outfielder for the St. Louis Cardinals, Brooklyn Dodgers, Boston Braves and Philadelphia Phillies. Padgett, born in Caroleen, North Carolina, batted left-handed, threw right-handed, stood 6 feet tall and weighed 190 pounds. He attended Lenoir-Rhyne College.\\nPadgett's professional career stretched from 1935 through 1951. From 1942 to 1945 Padgett served in the United States Navy during World War II.\\nIn 1939, Padgett — while serving as backup catcher to Cardinals receiver Mickey Owen — batted a lofty .399 in 92 games played, 257 plate appearances and 233 at bats, but did not qualify for the National League batting championship. All told, in eight Major League seasons he played in 699 games and had 1,991 At Bats, 247 Runs, 573 Hits, 111 Doubles, 16 Triples, 37 Home Runs, 338 RBI, 6 Stolen Bases, 141 Walks, .288 Batting Average, .336 On-base percentage, .415 Slugging Percentage, 827 Total Bases and 10 Sacrifice Hits.\\nPadgett died in High Point, North Carolina, four days after his 69th birthday."},{"page_url":"https://sv.wikipedia.org/wiki/Pe%C3%B1ausende_(kommunhuvudort)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/PE%C3%91AUSENDE_vista_parcial.JPG","page_title":"Peñausende (kommunhuvudort)","context_page_description":"Peñausende är en kommunhuvudort i Spanien. Den ligger i provinsen Provincia de Zamora och regionen Kastilien och Leon, i den centrala delen av landet, 200 km nordväst om huvudstaden Madrid. Peñausende ligger 870 meter över havet och antalet invånare är 490.\\nTerrängen runt Peñausende är platt. Den högsta punkten i närheten är 896 meter över havet, 1,1 km nordost om Peñausende. Runt Peñausende är det mycket glesbefolkat, med 7 invånare per kvadratkilometer. Närmaste större samhälle är Corrales, 14,3 km nordost om Peñausende. Trakten runt Peñausende består i huvudsak av gräsmarker.\\nMedelhavsklimat råder i trakten. Årsmedeltemperaturen i trakten är 13 °C. Den varmaste månaden är juli, då medeltemperaturen är 28 °C, och den kallaste är december, med 2 °C. Genomsnittlig årsnederbörd är 649 millimeter. Den regnigaste månaden är oktober, med i genomsnitt 88 mm nederbörd, och den torraste är augusti, med 2 mm nederbörd."},{"page_url":"https://fr.wikipedia.org/wiki/Lily_Was_Here","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Candy_Dulfer_Tour_2010_team_presentation.jpg","page_title":"Lily Was Here","context_page_description":"Lily Was Here est un single musical-instrumental-tube de smooth jazz, de l'auteur-compositeur-interprète guitariste anglais Dave Stewart, sorti en 1989, interprété avec la saxophoniste néerlandaise Candy Dulfer, pour la musique de film du film dramatique néerlandais La Caissière de Ben Verbong de 1989. Extrait de l'album Saxualité de Candy Dulfer en 1990, le titre a atteint la première place des charts néerlandais, et est un des plus célèbres tubes internationaux de la fin des années 1980."},{"page_url":"https://id.wikipedia.org/wiki/Baqa-Jatt","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Baqa_el_gharbiya_2007_04_14.jpg","page_title":"Baqa-Jatt","context_page_description":"Baqa-Jatt adalah sebuah kota Arab – Israel yang terletak di Distrik Haifa, Israel, dan didirikan sejak tahun 2003 melalui penggabungan dari kota Baqa al-Gharbiyye dan Jatt. Berdasarkan data dari Israel Central Bureau of Statistics, kota ini berpenduduk 32,400 pada paruh akhir tahun 2007. Memiliki area tidak kurang dari 18,100 dunams, Baqa-Jatt adalah bagian dari daerah yang dikenal dengan nama the Triangle."},{"page_url":"https://sk.wikipedia.org/wiki/Boiry-Saint-Martin","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/59/Map_commune_FR_insee_code_62146.png","page_title":"Boiry-Saint-Martin","context_page_description":"Boiry-Saint-Martin je francúzska obec, ktorá sa nachádza v departemente Pas-de-Calais, v regióne Nord-Pas-de-Calais."},{"page_url":"https://fr.wikipedia.org/wiki/I_Gusti_Ngurah_Rai","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/NgurahRai.png","page_title":"I Gusti Ngurah Rai","context_page_description":"I Gusti Ngurah Rai est un Héros national d'Indonésie. Lieutenant-colonel commandant les forces armées indonésiennes à Bali contre les Néerlandais durant la Guerre d'indépendance indonésienne, il fut tué lors de la bataille de Margarana."},{"page_url":"https://bs.wikipedia.org/wiki/Trsteno_(Dubrovnik)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Trsteno%2C_akvadukt_k_fontane.jpg","page_title":"Trsteno (Dubrovnik)","context_page_description":"Trsteno je naseljeno mjesto u sastavu grada Dubrovnika, Dubrovačko-neretvanska županija, Republika Hrvatska."},{"page_url":"https://en.wikipedia.org/wiki/USS_James_K._Polk_(SSBN-645)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/23/Insignia_of_SSN-645_James_K_Polk.PNG","page_title":"USS James K. Polk (SSBN-645)","context_page_description":"USS James K. Polk (SSBN-645), a Benjamin Franklin class fleet ballistic missile submarine, was the second ship of the United States Navy to be named for James K. Polk, the eleventh President of the United States. She was later converted into an attack submarine and redesignated SSN-645."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BD%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D1%85_%D0%BF%D0%B0%D1%80%D0%BA%D0%BE%D0%B2_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/26_swiatoinos.jpg","page_title":"Список национальных парков России","context_page_description":"По состоянию на конец 2015 года на территории России действовало 49 национальных парков, суммарная площадь территории которых составляла 21,29 млн га или 14,12 млн га без учёта морских акваторий, что составляет 0,82 % от площади России. За 2016—2019 годы их общее число достигло 62."},{"page_url":"https://fr.wikipedia.org/wiki/Scheiditz","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Scheidtz%2C_Dorfstra%C3%9Fe.JPG","page_title":"Scheiditz","context_page_description":"Scheiditz est une commune allemande de l'arrondissement de Saale-Holzland, Land de Thuringe."},{"page_url":"https://de.wikipedia.org/wiki/Liebesn%C3%A4chte_in_der_Taiga_(Roman)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/4Y1A9351_%2828548870205%29.jpg","page_title":"Liebesnächte in der Taiga (Roman)","context_page_description":"Liebesnächte in der Taiga ist ein Spionage- und Liebesroman vor dem Hintergrund des Ost-West-Konfliktes von Heinz G. Konsalik aus dem Jahr 1966. Diese Erzählung gehört mit zu den populärsten Titeln des Erfolgschriftstellers."},{"page_url":"https://fr.wikipedia.org/wiki/Unterseeboot_12_(1911)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/German_submarine_U-12.jpg","page_title":"Unterseeboot 12 (1911)","context_page_description":"Le sous-marin allemand Unterseeboot 12 de type U 9 a été construit par la Kaiserliche Werft de Dantzig, et lancé le 6 mai 1910 pour une mise en service le 13 août 1911. Il a servi pendant la Première Guerre mondiale sous pavillon de la Kaiserliche Marine."},{"page_url":"https://it.wikipedia.org/wiki/Parsons_Green","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Parsons_Green_Park.JPG","page_title":"Parsons Green","context_page_description":"Parsons Green Park è un parco della città di Londra. Si trova nell'area Parsons Green all'interno di London Borough of Hammersmith and Fulham, quartiere cittadino, ed è un piccolo parco triangolare. Vicino a esso si trova una stazione che porta lo stesso nome.\\nOgni anno è sede del 'Fair on the Green', occasione di divertimento per tutti.\\nEsattamente dirimpetto al parco si trova la scuola Lady Margaret School"},{"page_url":"https://eu.wikipedia.org/wiki/Neuvecelle","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Neuvecelle_-_l%27%C3%A9glise_03.JPG","page_title":"Neuvecelle","context_page_description":"Neuvecelle Frantziako udalerria da, Savoia Garaia departamenduan dagoena, Auvernia-Rhône-Alpeak eskualdean. 2013an 2.520 biztanle zituen."},{"page_url":"https://fr.wikipedia.org/wiki/Heterometrus_mysorensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Heterometrus_mysorensis_08.JPG","page_title":"Heterometrus mysorensis","context_page_description":"Heterometrus mysorensis est une espèce de scorpions de la famille des Scorpionidae."},{"page_url":"https://war.wikipedia.org/wiki/Boletus_legaliae","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/B.legaliae_button.jpg","page_title":"Boletus legaliae","context_page_description":"An Boletus legaliae in uska species han Fungi in nahilalakip ha divisio nga Basidiomycota, ngan nga ginhulagway ni Albert Pilát hadton 1968. An Boletus legaliae in nahilalakip ha genus nga Boletus, ngan familia nga Boletaceae. Waray hini subspecies nga nakalista."},{"page_url":"https://fr.wikipedia.org/wiki/S%C3%A9rie_de_pi%C3%A8ces_am%C3%A9ricaines_de_10_dollars_des_Premi%C3%A8res_%C3%A9pouses_des_%C3%89tats-Unis","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/2014_FS-Coolidge-Unc_R_2000.jpg","page_title":"Série de pièces américaines de 10 dollars des Premières épouses des États-Unis","context_page_description":"À partir de 2007, la série de pièces de 10 dollars des Premières épouses des États-Unis honore les femmes de chacun des présidents honorés par la série de pièces de 1 dollar des Présidents des États-Unis en émettant des pièces d'or à leur image, dans l'ordre où elles ont servi en tant que conjoint. À ce jour, cela a toujours été des femmes souvent appelées « premières dames », mais la loi utilise le terme « première épouse ».\\nL'avers de ces pièces présente les portraits des premières épouses, leurs noms, les dates et l'ordre de leurs statut en tant que première dame, ainsi que l'année de frappe avec en légende « In God We Trust » et « Liberty ». La Monnaie des États-Unis a émis ces pièces d'or selon le même calendrier que les pièces présidentielles d'un dollar. Chaque pièce a un dessin inversé unique comportant une image emblématique de la vie et du travail de ce conjoint, ainsi que les mots « The United States of America », « E Pluribus Unum », « $10 », « 1/2 oz. », et « .9999 Fine Gold »."},{"page_url":"https://es.wikipedia.org/wiki/Tony_Marshall","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1d/TonyMarshall.jpg","page_title":"Tony Marshall","context_page_description":"Tony Marshall es un cantante alemán de schlager y ópera."},{"page_url":"https://pt.wikipedia.org/wiki/Camila_%26_Haniel","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Camila_%26_Haniel_na_Sony_Music_Brasil_em_2015.png","page_title":"Camila & Haniel","context_page_description":"Camila & Haniel foi uma dupla de cantores de música sertaneja formada por Camila Braga de Jesus, artisticamente conhecida por Mila, e Felipe Pereira dos Santos, artisticamente conhecido por Haniel. A dupla se conheceu em 2013 após a participação de Haniel em um show de Camila. Unidos em 21 de janeiro de 2013 a dupla esteve junta até sua ultimá apresentação em 26 de maio de 2019.\\nO hit \\"Gelo na Balada\\", com participação de Fernando & Sorocaba, tornou-se uma das canções mais tocadas de 2016 no Brasil, ficando em 7.º lugar no Ranking do ECAD."},{"page_url":"https://id.wikipedia.org/wiki/Surat-surat_Lakhis","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Lakhish_Letters.jpg","page_title":"Surat-surat Lakhis","context_page_description":"Surat-surat Lakhis adalah sekumpulan surat-surat kuno yang ditulis dengan tinta karbon dalam abjad Ibrani Kuno pada sejumlah ostrakon tanah liat. Surat-surat ini diperkirakan berasal dari abad ke-6 SM. Diketemukan kembali pada ekskavasi di bekas-bekas kota Lakhis."},{"page_url":"https://fr.wikipedia.org/wiki/Grand_Site_Occitanie","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Niaux%2C_bisons.JPG","page_title":"Grand Site Occitanie","context_page_description":"Un Grand Site Occitanie est un lieu promu comme ayant un intérêt touristique majeur dans la région Occitanie.\\nLe label avait été lancé par l'ancienne région Midi-Pyrénées en 2008.\\nEn 2018, on compte 39 Grands Sites répartis sur l'ensemble du territoire régional."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BB%D1%8E%D0%B4%D1%8F%D0%BD%D0%BA%D0%B0_(%D0%B3%D0%BE%D1%80%D0%BE%D0%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/%D0%A1%D0%BB%D1%8E%D0%B4%D1%8F%D0%BD%D0%BA%D0%B0_%D1%81_%D1%8E%D0%B3%D0%BE-%D0%B2%D0%BE%D1%81%D1%82%D0%BE%D0%BA%D0%B0.jpg","page_title":"Слюдянка (город)","context_page_description":"Слюдя́нка — город в Иркутской области Российской Федерации, административный центр Слюдянского района. Расположен на западной оконечности озера Байкал, в 110 км от Иркутска. Население — 18 213 чел.\\nКрупный железнодорожный узел на Транссибирской магистрали. От станции Слюдянка II начинается также Кругобайкальская железная дорога. Через город проходит федеральная автодорога Р258 «Байкал». Туристический центр Иркутской области. Вблизи производилась добыча мрамора, в настоящее время производится цементное сырье. В прошлом Слюдянка была известна добычей слюды-флогопита и лазурита.\\nНа месте города в 1647 году был создан Култукский острог, впоследствии перенесённый на место, где сейчас находится посёлок Култук. После этого лишь в 1802 году на этом месте появилось поселение Слюдянское зимовье на Кругобайкальском тракте. В 1899 году был основан железнодорожный посёлок Слюдянка, получивший статус рабочего посёлка в 1928, статус города — в 1936 году."},{"page_url":"https://en.wikipedia.org/wiki/Pterostegia","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Pterostegiadrymarioides.jpg","page_title":"Pterostegia","context_page_description":"Pterostegia is a monotypic plant genus containing only the single species Pterostegia drymarioides, which is known as the woodland threadstem, woodland pterostegia, fairy mist, or fairy bowties."},{"page_url":"https://eo.wikipedia.org/wiki/Ban%C4%9Dulo","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Banjul_great_mosque.jpg","page_title":"Banĝulo","context_page_description":"Banĝulo estas ĉefurbo de Gambio kun 34.828 loĝantoj. Ĝi estas la tria plej granda urbo de Gambio post Serekunda kaj Brikama. Banĝulo estas ankaŭ propra administra distrikto."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D0%B5%D0%B2%D1%96%D0%B4_%D2%90%D1%80%D0%B5%D0%BD%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/David_Grann_2018.jpg","page_title":"Девід Ґренн","context_page_description":"Девід Ґренн — американський письменник, автор бестселерів, журналіст та штатний працівник журналу «Нью-Йоркер».\\nНасамперед відомий завдяки своїй дебютній книзі «Загублене місто Z: Історія убивчої одержимості в Амазонці», яка побачила світ 2009 року у видавництві «Даблдей». Після першого ж тижня продажів, роман посів четверте місце у списку бестселерів за версією газети «Нью-Йорк Таймс».\\nҐреннові публіцистичні твори зібрано у декількох антологіях, серед яких «Те, що ми бачили. Події 11 вересня 2001», «Найкращі американські твори 2004—2005 років», «Найкращі американські твори на спортивну тематику 2003—2006 років». Загалом, письменник співпрацював з такими періодичними виданнями: «Нью-Йорк таймс мегезін», «Атлантік манслі», «Вашингтон пост», «Волл-стріт джорнел» та «Віклі стендарт». Згідно з його профілем у журналі «Слейт», Ґренн має репутацію «репортера, який виконує більшу частину загальної роботи», що робить його відомим журналістом, який «вселяє прихильність у своїх читачів, що знаходяться на межі маніакальною зацікавленістю його працею»."},{"page_url":"https://en.wikipedia.org/wiki/Theodore_II_Laskaris","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Theodore_II_Laskaris_miniature.jpg","page_title":"Theodore II Laskaris","context_page_description":"Theodore II Doukas Laskaris or Ducas Lascaris was Emperor of Nicaea from 1254 to 1258. He was the only child of Emperor John III Doukas Vatatzes and Empress Irene Laskarina. His mother was the eldest daughter of Theodore I Laskaris who had established the Empire of Nicaea as a successor state to the Byzantine Empire in Asia Minor, after the crusaders captured the Byzantine capital, Constantinople, during the Fourth Crusade in 1204. Theodore received an excellent education from two renowned scholars, Nikephoros Blemmydes and George Akropolites. He made friends with young intellectuals, especially with a page of low birth, George Mouzalon. Theodore began to write treatises on theological, historical and philosophical themes in his youth.\\nEmperor John III arranged for Theodore to marry Elena of Bulgaria in 1235, to forge an alliance with her father, Ivan Asen II, against the Latin Empire of Constantinople. According to Theodore himself, their marriage was happy, and they had five or six children. From 1241, Theodore acted as his father's lieutenant in Asia Minor during his frequent military campaigns in the Balkan Peninsula."},{"page_url":"https://no.wikipedia.org/wiki/Machados","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/PE-mapa-Machados.png","page_title":"Machados","context_page_description":"Machados er en kommune i delstaten Pernambuco i nordøstregionen av Brasil."},{"page_url":"https://en.wikipedia.org/wiki/Empress_Elisabeth_of_Austria","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9a/Territet_Elisabeth_01.JPG","page_title":"Empress Elisabeth of Austria","context_page_description":"Empress Elisabeth of Austria was Empress of Austria and Queen of Hungary by marriage to Emperor Franz Joseph I. She was born into the royal Bavarian House of Wittelsbach. Nicknamed Sisi, she enjoyed an informal upbringing before marrying Emperor Franz Joseph I at the age of sixteen. The marriage thrust her into the much more formal Habsburg court life, for which she was unprepared and which she found uncongenial. Early in the marriage she was at odds with her mother-in-law, Archduchess Sophie, who took over the rearing of Elisabeth's daughters, one of whom, Sophie, died in infancy. The birth of the heir apparent, Crown Prince Rudolf, improved her standing at court, but her health suffered under the strain, and she would often visit Hungary for its more relaxed environment. She came to develop a deep kinship with Hungary, and helped to bring about the dual monarchy of Austria–Hungary in 1867.\\nThe death of her only son and his mistress Mary Vetsera in a murder–suicide at his hunting lodge at Mayerling in 1889 was a blow from which Elisabeth never recovered. She withdrew from court duties and travelled widely, unaccompanied by her family."},{"page_url":"https://fr.wikipedia.org/wiki/Daytona_USA:_C.C.E._Net_Link_Edition","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Volant_Sega_Saturn.jpg","page_title":"Daytona USA: C.C.E. Net Link Edition","context_page_description":"Daytona USA C.C.E. Net Link Edition est un jeu vidéo de course de NASCAR sorti le 16 février 1998 exclusivement sur Saturn, uniquement en Amérique du Nord. Le jeu a été développé par Sega AM2 et Sega AM3 et édité par Sega. Il fait partie de la série Daytona USA, dont il représente la quatrième et dernière adaptation sur Saturn.\\nDaytona USA C.C.E. Net Link Edition est également l'un des cinq jeux compatibles avec le Sega Net Link, le périphérique de la console permettant de jouer en ligne en Amérique du Nord."},{"page_url":"https://en.wikipedia.org/wiki/Brendan_Benson","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Brendan-Benson-2005.jpg","page_title":"Brendan Benson","context_page_description":"Brendan Benson is an American musician and singer-songwriter. He plays guitar, bass guitar, keyboard, and drums. He has released six solo albums and is a member of the band The Raconteurs."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AF%D8%A7%D9%85%D8%A7%D8%B3%D9%83%D9%8A%D9%88%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/VAMap-doton-Damascus.PNG","page_title":"داماسكيوس","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nداماسكيوس تاون فى امريكا."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AD%E3%83%B3%E3%83%A1%E3%83%80%E3%82%A4%E7%A7%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Centroberyx_affinis%2C_Redfish.jpg","page_title":"キンメダイ科","context_page_description":"キンメダイ科は、キンメダイ目に所属する魚類の分類群の一つ。キンメダイ亜目を構成する唯一の科で、キンメダイ・ナンヨウキンメなど底生性の深海魚を中心に2属9種が記載される。"},{"page_url":"https://hu.wikipedia.org/wiki/Csengey_D%C3%A9nes","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Csengey_D%C3%A9nes_eml%C3%A9kt%C3%A1bl%C3%A1ja.jpg","page_title":"Csengey Dénes","context_page_description":"Csengey Dénes magyar író, politikus."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A0%D1%83%D0%B2%D1%80%D0%BE%D0%B0%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Montquintin_JPG00.JPG","page_title":"Рувроай","context_page_description":"Рувроай е селище в Южна Белгия, окръг Виртон на провинция Люксембург. Населението му е около 2000 души."},{"page_url":"https://fr.wikipedia.org/wiki/Muscadet_(AOC)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1c/Vinillustresoiseliniere.jpg","page_title":"Muscadet (AOC)","context_page_description":"Le muscadet est un vin blanc sec d'appellation d'origine contrôlée produit principalement en Loire-Atlantique au sud de Nantes, et débordant partiellement sur le Maine-et-Loire et la Vendée. Ce vin du vignoble de la vallée de la Loire est issu d'un cépage unique, le melon de Bourgogne. Cette appellation est classée AOC depuis 1937 et couvre une superficie d'environ 8 300 hectares vers l'an 2016.\\nLe vignoble du muscadet comporte plusieurs appellations : le muscadet-sèvre-et-maine, le muscadet-côtes-de-grandlieu, le muscadet-coteaux-de-la-loire et le muscadet sans dénomination particulière. Le muscadet est un vin sec aux arômes floraux et fruités qui peut être élevé sur lie d'où il tirera une légère effervescence dite « perlante ». Ce vin s'accorde particulièrement bien avec les fruits de mer."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D1%85%D0%B0%D0%BB%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%B3%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D0%BD%D0%BE%D0%B9_%D0%BA%D1%80%D0%B0%D0%B5%D0%B2%D0%B5%D0%B4%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D1%83%D0%B7%D0%B5%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/%D0%97%D0%B4%D0%B0%D0%BD%D0%B8%D0%B5_%D0%BC%D1%83%D0%B7%D0%B5%D1%8F._%D0%9E%D0%BA%D1%82%D1%8F%D0%B1%D1%80%D1%8C_2018_%D0%B3%D0%BE%D0%B4%D0%B0.jpg","page_title":"Сахалинский государственный областной краеведческий музей","context_page_description":"Сахали́нский областно́й краеве́дческий музе́й — центральный музей Сахалинской области. Краеведческий музей основан в 1896 году военным губернатором Сахалина Д. В. Мерказиным. В настоящее время занимает японское здание 1937 года, построенное в традиционном национальном стиле тэйкан-дзукури, единственное в своём роде на территории как Сахалина, так и всей России."},{"page_url":"https://de.wikipedia.org/wiki/Tatort_(Fernsehreihe)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Grimmepreis_2014_002.jpg","page_title":"Tatort (Fernsehreihe)","context_page_description":"Tatort ist eine Kriminalfilm-Reihe, deren Ausstrahlung 1970 im westdeutschen Fernsehen begann. Ursprünglich als Produktion des Deutschen Fernsehens gestartet, ist sie heute eine Gemeinschaftsproduktion von ARD, ORF und SRF. Bislang erschienen über 1100 Tatort-Filme. Jeder Film erzählt in der Regel eine in sich abgeschlossene Geschichte, in der wechselnd und wiederkehrend ein Kommissar oder ein Team aus Kommissaren in einem Kriminalfall an deutschen, schweizerischen oder österreichischen, meist großstädtischen, Schauplätzen ermittelt.\\nIn den ersten Jahren erschien durchschnittlich ein neuer Film pro Monat. Ab den frühen 1990er Jahren erhöhte sich die Häufigkeit der Erstsendungen und liegt mittlerweile bei etwa 35 pro Jahr. Ein neuer Teil wird in der Regel sonntags zur Hauptsendezeit im Ersten, im ORF 2 und im SRF 1 erstmals gezeigt.\\nTatort ist die langlebigste und – mit teils über 10 Millionen Zuschauern bei der Erstausstrahlung – beliebteste Krimireihe im deutschsprachigen Raum. Etliche Filme aus der Reihe erhielten Nominierungen und Prämierungen für bekannte Film- und Fernsehpreise, darunter den Grimme-Preis, den Deutschen Fernsehpreis, die Goldene Kamera und die Romy."},{"page_url":"https://de.wikipedia.org/wiki/Walzen-,_Kissen-_und_Noppen-Seesterne","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Halityle_regularis.jpg","page_title":"Walzen-, Kissen- und Noppen-Seesterne","context_page_description":"Die Familie der Walzen-, Kissen- und Noppen-Seesterne enthält große, stark gepanzerte und voluminöse Formen, die ein netzförmiges Skelett haben. Oft sind sie mit kräftigen, bunten Stacheln und Warzen deutlich gemustert.\\nDie etwa 20 Gattungen leben überwiegend im Indopazifik. Nur zwei Arten der Gattung Oreaster leben im Atlantik.\\nViele Oreasteridae ernähren sich von Kleinstlebewesen, andere sind Aasfresser oder Nahrungsspezialisten. Die Kissenseesterne der Gattung Culcita fressen Polypen von Steinkorallen. Bei den meisten Arten wird beim Fressen der Magen ausgestülpt und die Nahrung außerhalb des Körpers verdaut.\\nDa sie selbst tot sehr dekorativ aussehen, werden sie oft gesammelt, getrocknet und dann an Touristen verkauft. Viele Arten wie der Genetzte Kissenstern aus der Karibik sind deshalb sehr selten geworden."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%9C%A3%E8%8B%A5%E7%BF%B0%E6%B4%97%E8%80%85%E5%9C%A3%E6%AE%BF_(%E4%BB%80%E5%88%87%E9%9D%92)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Szczecin_kosciol_sw._Jana_Chrzciciela_witraz.jpg","page_title":"圣若翰洗者圣殿 (什切青)","context_page_description":"聖若翰洗者聖殿是一座羅馬天主教宗座聖殿，新哥德式，供奉聖若翰洗者，位于波蘭西北部城市什切青。\\n該堂建於1888-1890年。在1945年以前是該市唯一的天主教堂，一部分信徒和神父都是波蘭人。1944年蓋世太保燒毀教堂的屋頂和鐘樓，殺害了神父。逮捕了許多教友。戰爭結束後，教堂被重建。\\n2008年，教宗本篤十六世將其升格為宗座聖殿。"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A4%D0%B8%D0%BD%D1%81%D0%BA%D0%B8_%D0%B7%D0%B0%D0%BB%D0%B8%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Espoon_kaupungintalo_-_panoramio.jpg","page_title":"Фински залив","context_page_description":"Фински залив релативно је плитки залив на крајњем истоку акваторије Балтичког мора, на подручју северне Европе. Ограничен је јужном обалом Финске на северу, северном обалом Естоније на југу, те територијама Лењинградске области и Санкт Петербурга у Русији на истоку. Према подацима Међународне хидрографске организације западна граница залива иде до линије која повезује острво Осмусар на југу са полуострвом Ханко на северу.\\nПовршина акваторије Финског залива је приближно око 30.000 km², максимална дужина у смеру исток-запад је до 420 km, а ширина до 130 km. Просечна дубина залива је око 38 метара. Ка заливу гравитира басен површине преко 420.000 km², а најважније притоке су Нева, Нарва, Луга, Сестра. У источном делу Финског залива, који је и најплићи, налазе се Невски, Виборшки, Лушки, Нарвски и Копорски залив. Преко Сајменског канала повезан је са језерским системом Сајма на југу Финске.\\nНа обалама Финског залива налазе се два главна града европских држава, Хелсинки и Талин, историјска престоница Руске Империје и други по величини град данашње Русије, Санкт Петербург, те важне балтичке луке — Виборг, Приморск и Еспо."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%A7%91%E8%8B%B1%E5%B8%83%E6%8B%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Sunset_Light_on_Coimbra_%2810249113315%29.jpg","page_title":"科英布拉","context_page_description":"科英布拉是葡萄牙的一個自治市。2011年人口普查的數據為143,397人，面積為319.40平方公里。它是葡萄牙第四大城市中心，僅次於里斯本、波爾圖和布拉加，也是科英布拉區和中部大區最大的城市。約46萬人住在科英布拉地方，該區域由19個自治市組成，面積為4,336平方公里。\\n科英布拉有許多古代建築可以追溯到羅馬時期，其中就有許多保存完好的輸水道和隱廊。同樣，許多科英布拉成為葡萄牙首都時期的建築仍然被保留了下來。在中世紀後期，隨著其作為葡萄牙王國政治中心的衰落，科英布拉開始演變成一個主要的文化中心。這在很大程度上得益於1290年建立的科英布拉大學，這是葡萄牙語世界最古老的學術機構。除了吸引了許多歐洲和國際學生之外，這所大學的古蹟和歷史也吸引了許多遊客。它的歷史建築在2013年被聯合國教科文組織列為世界遺產:「科英布拉提供了一個整合的大學城的傑出例子，它有特定的城市類型，也有自己的儀式和文化傳統，這些傳統一直保持著。」"},{"page_url":"https://nl.wikipedia.org/wiki/Le_Perchay","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Map_commune_FR_insee_code_95483.png","page_title":"Le Perchay","context_page_description":"Le Perchay is een gemeente in het Franse departement Val-d'Oise en telt 476 inwoners. De plaats maakt deel uit van het arrondissement Pontoise."},{"page_url":"https://de.wikipedia.org/wiki/Schwarzwald-Schw%C3%A4bische-Alb-Allg%C3%A4u-Weg","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/St._Columban_und_St._Gallus-Kapelle_am_Wachb%C3%BChl.jpg","page_title":"Schwarzwald-Schwäbische-Alb-Allgäu-Weg","context_page_description":"Der Schwarzwald-Schwäbische Alb-Allgäu-Weg, auch Hauptwanderweg 5 oder abgekürzt HW 5 genannt, ist ein 311 Kilometer langer Fernwanderweg des Schwäbischen Albvereins. Er führt von Pforzheim bis auf den Schwarzen Grat. Hierbei durchquert er zunächst den Rand des Nordschwarzwaldes, dann den Schönbuch, die Schwäbische Alb und Oberschwaben. Er endet im württembergischen Allgäu."},{"page_url":"https://ko.wikipedia.org/wiki/%EA%B3%A0%EC%BF%A0%EB%9D%BC_%EC%97%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Kyushu_Railway_-_Kokura_Station_-_01.JPG","page_title":"고쿠라 역","context_page_description":"고쿠라 역은 일본 후쿠오카현 기타큐슈시 고쿠라기타 구에 위치한 서일본 여객철도, 규슈 여객철도 소속의 철도역이며, 산요 신칸센, 가고시마 본선의 정차역이자, 닛포 본선의 종착역이다. 또는 북큐슈 모노레일의 종착역이 바로 고쿠라 역이다. JR 스테이션 호텔 고쿠라가 역 내 빌딩에 위치해있고, 인근에 고쿠라 성과 리버워크 기타큐슈, 그리고 NHK 기타큐슈 방송국이 자리잡고\\n있다. 또한 서일본 국제전시장과 기타큐슈 국제회의장등이 인근해 위치해 있으며, 북큐슈 권역내 교통의 요충지 역할을 톡톡히 하고 있다."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Apfelsorten/M","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Moulin_%C3%A0_vent%2C_Mons-Boubert%2C_29_oct._2017.jpg","page_title":"Liste von Apfelsorten/M","context_page_description":"Erläuterungen und Quellen: Siehe Hauptartikel!"},{"page_url":"https://cy.wikipedia.org/wiki/Wayland,_Massachusetts","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Nordiske_Mediedager_2017_%2833746304154%29_%28cropped%29.jpg","page_title":"Wayland, Massachusetts","context_page_description":"Tref yn Middlesex County, yn nhalaith Massachusetts, Unol Daleithiau America yw Wayland, Massachusetts. ac fe'i sefydlwyd ym 1638."},{"page_url":"https://tg.wikipedia.org/wiki/%D0%A4%D1%83%D1%80%D1%83%D0%B4%D0%B3%D0%BE%D2%B3%D0%B8_%D1%81%D0%B0%D2%B3%D1%80%D0%BE_%D0%BB%D1%8E%D0%BE%D1%80%D0%B4_%D0%BF%D1%83%D0%B8%D0%BD%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/US_Navy_100506-N-8241M-317_An_aerial_view_of_the_Leeward_Airfield_at_Naval_Station_Guantanamo_Bay%2C_Cuba.jpg","page_title":"Фурудгоҳи саҳро люорд пуинт","context_page_description":"Фурудгоҳи саҳро люорд пуинт — фурудгоҳи низомӣ бо Коди ИОТОи NBW аст, ки як бонди фуруди асфалт дорад. Ин фурудгоҳ дар кишвари Кубо қарор дорад."},{"page_url":"https://pt.wikipedia.org/wiki/Gigondas_(Vaucluse)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8a/Gigondas_by_JM_Rosier.jpg","page_title":"Gigondas (Vaucluse)","context_page_description":"Gigondas é uma comuna francesa na região administrativa da Provença-Alpes-Costa Azul, no departamento de Vaucluse. Estende-se por uma área de 27,14 km². Em 2010 a comuna tinha 556 habitantes."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8E%9F%E5%AD%90%E5%BD%88%E7%88%86%E7%82%B8%E9%81%BA%E5%9D%80%E5%89%8D%E5%81%9C%E7%95%99%E5%A0%B4","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7b/Hiroden_Line_2.png","page_title":"原子彈爆炸遺址前停留場","context_page_description":"原子彈爆炸遺址前停留場是一由廣島電鐵所經營的電車站，位於日本廣島縣廣島市中區，是廣島電鐵本線沿線的電車站牌之一。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%99%AE%E5%AE%89%E5%B8%82%E7%A4%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Khu_c%C3%B4ng_nghi%E1%BB%87p_Y%C3%AAn_B%C3%ACnh.jpg","page_title":"普安市社","context_page_description":"普安市社是越南太原省下轄的一個市社。"},{"page_url":"https://en.wikipedia.org/wiki/Fluntern","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/ZooZ%C3%BCrich_Eingang.jpg","page_title":"Fluntern","context_page_description":"Fluntern is a quarter in the district 7 in Zürich, Switzerland. It was formerly a municipality of its own, having been incorporated into Zürich in 1893. The quarter has a population of 7,325 distributed on an area of 2.84 km²."},{"page_url":"https://it.wikipedia.org/wiki/Tiphaine_Samoyault","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Tiphaine_Samoyault_%282015%29.jpg","page_title":"Tiphaine Samoyault","context_page_description":"Tiphaine Samoyault è una scrittrice francese.\\nSpecialista di letteratura contemporanea, è docente all'université Paris VIII, romanziera e traduttrice, tra l'altro, della nuova edizione dell'Ulisse di James Joyce.\\nConsigliera editoriale delle Éditions du Seuil, collabora anche a France culture e a La Quinzaine littéraire."},{"page_url":"https://fi.wikipedia.org/wiki/Nokip%C3%A4%C3%A4skyt","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Black_Saw-wing.jpg","page_title":"Nokipääskyt","context_page_description":"Nokipääskyt ovat pääskyjen heimoon kuuluva varpuslintusuku. Nokipääskyjen sukuun kuuluu BirdLifen mukaan viisi lajia."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%83%D8%A7%D8%B1%D8%B3%D8%AA%D9%8A%D9%86_%D8%A8%D9%8A%D9%87%D8%B1%D9%8A%D9%86%D8%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Carsten_Byhring.jpg","page_title":"كارستين بيهرينج","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nكارستين بيهرينج كان كاتب من النرويج."},{"page_url":"https://nl.wikipedia.org/wiki/Orsja","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Karatkievich.Orsha.jpg","page_title":"Orsja","context_page_description":"Orsja of Vorsja is een Wit-Russische stad met 116.000 inwoners en ligt in de oblast Vitebsk. Het ligt in het noordoosten van het land, aan de rivier de Dnjepr."},{"page_url":"https://vi.wikipedia.org/wiki/Georgy_Chicherin","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Bundesarchiv_Bild_102-12859A%2C_Georgi_Wassiljewitsch_Tschitscherin.jpg","page_title":"Georgy Chicherin","context_page_description":"Georgy Vasilyevich Chicherin, cũng đánh vần Tchitcherin, là một nhà cách mạng Marxist và một chính khách Liên Xô. Ông từng là Chính ủy Nhân dân đối ngoại trong chính phủ Liên Xô từ tháng 3 năm 1918 đến 1930."},{"page_url":"https://fr.wikipedia.org/wiki/Joseph_Patrick_Kennedy","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/TheKennedyFamily1.jpg","page_title":"Joseph Patrick Kennedy","context_page_description":"Joseph Patrick Kennedy, Sr., dit Joe Kennedy, né le 6 septembre 1888 à Boston et mort le 18 novembre 1969 à Hyannis, est un homme politique et diplomate américain, père du président John Fitzgerald Kennedy et patriarche de la famille Kennedy. Proche de Franklin Delano Roosevelt, il est notamment président de la nouvellement établie Securities and Exchange Commission de 1934 à 1935 et 44ᵉ ambassadeur des États-Unis au Royaume-Uni de 1938 à 1940."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%AE%89%E5%BA%86%E9%95%BF%E6%B1%9F%E9%93%81%E8%B7%AF%E5%A4%A7%E6%A1%A5","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e7/Anqing_Yangtze_River_Railway_Bridge.JPG","page_title":"安庆长江铁路大桥","context_page_description":"安慶長江鐵路大橋是一座連接中國安慶市至長江對岸的跨江大橋，是寧安城際鐵路的組成部分，2009年動工，2012年12月19日合攏，2015年12月6日正式建成通車。"},{"page_url":"https://no.wikipedia.org/wiki/Laksefamilien","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Trout.jpg","page_title":"Laksefamilien","context_page_description":"Laksefamilien eller laksefisker er en gruppe strålefinnede fisker. Artene i gruppen er utbredt i kalde ormåder på den nordlige halvkule. Noen arter er rene ferskvannsfisker, mens andre vandrer mellom ferskvann og saltvann i løpet av livet. Enkelte arter, som atlanterhavslaks, kan returnere til havet etter gyting. Andre arter, som stillehavslaksene, har kun en gytevandring og dør etter denne.\\nArtene kjennetegnes ved en langstrakt kropp som er litt sammentrykt fra sidene. De har en sentralt plassert ryggfinne og en stråleløs fettfinne.\\nEn fellesnevner for alle artene er at de trenger rent, kaldt vann og et sunt habitat for å leve. Derfor er tilførte arter i fiskenes biom en trussel for deres videre eksistens."},{"page_url":"https://en.wikipedia.org/wiki/Elias_Gottlob_Haussmann","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Johann_Sebastian_Bach.jpg","page_title":"Elias Gottlob Haussmann","context_page_description":"Elias Gottlob Haussmann was a German painter in the late Baroque era. Haussmann served as court painter at Dresden, and from 1720 as the official portraitist at Leipzig. He is mostly known for his portrait of Johann Sebastian Bach which was painted in 1746."},{"page_url":"https://vi.wikipedia.org/wiki/Tuy%E1%BB%87t_ch%E1%BB%A7ng_trong_t%E1%BB%B1_nhi%C3%AAn","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Scimitar_oryx1.jpg","page_title":"Tuyệt chủng trong tự nhiên","context_page_description":"Tuyệt chủng trong tự nhiên hoặc tuyệt chủng ngoài thiên nhiên, tuyệt chủng trong môi trường hoang dã là một trạng thái bảo tồn của sinh vật được quy định trong Sách đỏ IUCN. Một loài hoặc dưới loài bị coi là tuyệt chủng trong tự nhiên khi không ghi nhận được cá thể nào qua các cuộc khảo sát kỹ lưỡng ở sinh cảnh đã biết và hoặc sinh cảnh dự đoán, vào những thời gian thích hợp xuyên suốt vùng phân bố lịch sử của loài. Các khảo sát nên vượt khung thời gian thích hợp cho vòng sống và dạng sống của đơn vị phân loại đó. Các cá thể của loài này có thể chỉ còn được tìm thấy với số lượng rất ít trong sinh cảnh nhân tạo và phụ thuộc hoàn toàn vào chăm sóc của con người.\\nCác loài đã tuyệt chủng trong tự nhiên có thể kể đến: bạch dương szaferi của Ba Lan, côca echinodendron của Cuba, đại kích mayurnathanii ở Ấn Độ, xoài casturi và xoài rubropetala ở Indonesia, bàng acuminata ở Brasil, cá Stenodus leucichthys..."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BF%D0%B0%D0%BB%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Barrio_582_viviendas_en_Zapala.JPG","page_title":"Сапала","context_page_description":"Сапа́ла — город на севере аргентинской Патагонии, в географическом центре провинции Неукен, в 182 км к западу от столицы провинции и 115 км от аргентино-чилийской границы. Административный центр одноимённого департамента. Расположен на высоте 1012 м над уровнем моря.\\nДатой основания населённого пункта считается 12 июля 1913 года — день открытия в Сапале конечной станции железной дороги Ferrocarril General Roca; статус города получил в 1948 г. В наши дни является важным экономическим, транспортным и культурным центром провинции. Именно отсюда начинаются многие туристические маршруты аргентинской Патагонии. Через город проходят национальные автомагистрали № 22 и 40, сюда же сходятся шоссе провинциального значения № 13, 14, 16 и 46.\\nОсновные промышленные отрасли — горнодобывающая, производство цемента и негашёной извести.\\nВ городе расположен престижный Музей минералогии им. профессора Олсахера."},{"page_url":"https://es.wikipedia.org/wiki/Tarraconense","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Terra_Sigillata.jpg","page_title":"Tarraconense","context_page_description":"La Tarraconense fue una provincia romana y después visigoda de Hispania. Su capital fue la Colonia Iulia Urbs Triumphalis Tarraco, ​​ la actual Tarragona, de la cual tomaba su nombre.\\nFue una de las provincias más grandes del Imperio romano hasta finales del siglo III cuando la reorganización de Diocleciano desgajó la Cartaginensis y la Gallaecia de ella. A pesar de su gran tamaño, salvo las zonas de la costa mediterránea, estaba bastante despoblada y tenía un grado de urbanización menor que el resto de territorios hispanos."},{"page_url":"https://lt.wikipedia.org/wiki/Infliacija_(astronomija)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/WMAP_2008.png","page_title":"Infliacija (astronomija)","context_page_description":"Infliacija astronomijoje, fizikinėje kosmologijoje yra vadinamas hipotetinis reiškinys, kai Visatos pradinėse vystymosi stadijose vyko eksponentinis greitėjantis plėtimasis. Vėliau jis sulėtėjo iki dabartinio 72 km/s/Mpc greičio. Infliacijos hipotezė paaiškina, kodėl visomis kryptimis stebima visata yra tokia homogeniška, kodėl erdvė yra euklidinė ir kodėl nėra stebima magnetinių monopolių.\\nInfliacijos hipotezę ir terminą pasiūlė 1980 m. amerikiečių fizikas Alan Guth.\\nWMAP dangolapio, o vėliau ir Planko orbitinės observatorijos duomenys rodo, kad Visata yra 13,7 milijardų metų senumo, sudaryta iš 68,3 % tamsiosios energijos, 26,8 % šaltos tamsios medžiagos ir vos 4,9 % įprastinės medžiagos. Taip pat stebimas greitėjantis plėtimasis, tiesa jau ne toks spartus, kaip infliacijos stadijoje."},{"page_url":"https://fr.wikipedia.org/wiki/Ba%C3%A2lons","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Ba%C3%A2lons_%28Ardennes%29_%C3%A9glise%2C_fa%C3%A7ade.JPG","page_title":"Baâlons","context_page_description":"Baâlons est une commune française, située dans le département des Ardennes en région Grand Est."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_T%C3%A1bo%C5%99e","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/T%C3%A1bor_v_Jiho%C4%8Desk%C3%A9m_kraji._%284%29.jpg","page_title":"Seznam kulturních památek v Táboře","context_page_description":"Tento seznam nemovitých kulturních památek ve městě Tábor v okrese Tábor vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%A3%AF%E7%9B%9B%E6%8C%BA%E9%80%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Cover_doctral_thesis_Teizo_Ihmori.jpg","page_title":"飯盛挺造","context_page_description":"飯盛 挺造 は明治時代初期の日本の物理学者。1884年33歳のときドイツのフライブルク大学に留学し、エミール・ワールブルク教授の指導のもとで反射光を利用する真空式微量天秤を考案し、ガラスその他の物質に吸着される水分の量を測定する研究をおこなった。その研究論文によりドクトル・フィロソフィーの称号を与えられた。また、その功績により「微量天秤の先駆者」と呼ばれている。帰朝後は物理学の教育に尽力をした。日本の放射化学の先達・飯盛里安の養父であり岳父でもある。日東十客の一人である。"},{"page_url":"https://cs.wikipedia.org/wiki/Nasav%C5%A1t%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Arms_Nassau.png","page_title":"Nasavští","context_page_description":"Dynastie Nasavských nebo jen Nasavští je dynastie, která v průběhu staletí vládla v Nasavsku, v knížectví Orange v jižní Francii, Nizozemsku a Lucembursku.\\nV letech 1815–1890 byli nizozemští králové z Oranžsko-nasavské dynastie i lucemburskými velkovévody; Nizozemsko a Lucembursko byly tehdy spojeny personální unií. Od roku 1890 vládne Lucembursku vedlejší linie rodu, a to konkrétně větev Nasavsko-Weilburská. Tento rod je původem z německého Nasavska a města Weilburg, podle kterého nese druhou část jména. V Nasavsku nejprve vládli příslušníci původního rodu Nasavských jako hrabata, později jako vévodové. Rod se rozdělil syny nasavského hraběte Jindřicha II. na Walramskou a Ottonskou linii, z nichž později vznikly větve jako Nassau-Weilburg, Nassau-Dillenburg, Nassau-Siegen a další. Historicky nejvýznamnější a jedna ze dvou dosud existujících větví rodu je dnešní nizozemská dynastie Oranje-Nassau, která se nazývá podle bývalého knížectví Orange v jižní Francii. Původní dynastie Orange-Nassau však po meči vymřela.\\nNejslavnější členové rodu jsou vůdce holandského povstání za nezávislost proti španělským Habsburkům Vilém I. Oranžský, jeho pravnuk Vilém III."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Hamburg-Eimsb%C3%BCttel","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Stolperstein_Fruchtallee_107_%28Marion_Birmann%29_in_Hamburg-Eimsb%C3%BCttel.JPG","page_title":"Liste der Stolpersteine in Hamburg-Eimsbüttel","context_page_description":"Die Liste der Stolpersteine in Hamburg-Eimsbüttel enthält alle Stolpersteine, die im Rahmen des gleichnamigen Kunstprojekts von Gunter Demnig in Hamburg-Eimsbüttel verlegt wurden. Mit ihnen soll Opfern des Nationalsozialismus gedacht werden, die in Hamburg-Eimsbüttel lebten und wirkten.\\nDiese Seite ist Teil der Liste der Stolpersteine in Hamburg, da diese mit insgesamt 5897 Steinen zu groß würde und deshalb je Stadtteil, in dem Steine verlegt wurden, eine eigene Seite angelegt wurde."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%9A%A9%EC%82%B0%EA%B8%B0%EC%A7%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/BrianAllgoodArmyCommunityHospital.JPG","page_title":"용산기지","context_page_description":"용산 기지, 용산 미국 육군 기지는 대한민국 서울특별시 용산구에 있는 주한 미군 육군의 주둔지이다. 주로 《용산 미군 기지》로도 부른다."},{"page_url":"https://de.wikipedia.org/wiki/Paris%E2%80%93Roubaix_1982","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Tour_de_France_1978%2C_proloog_in_Leiden_Jan_Raas_in_actie%2C_Bestanddeelnr_929-7996.jpg","page_title":"Paris–Roubaix 1982","context_page_description":"Das Eintagesrennen Paris–Roubaix 1982 war die 80. Austragung des Radsportklassikers und fand am Sonntag, den 18. April 1982, statt.\\nDas Rennen führte von Compiègne, rund 80 Kilometer nördlich von Paris, nach Roubaix, wo es im Vélodrome André-Pétrieux endete. Die gesamte Strecke war 270,5 Kilometer lang. Es starteten 174 Fahrer, von denen sich 57 platzieren konnten. Der Sieger Jan Raas absolvierte das Rennen mit einer Durchschnittsgeschwindigkeit von 36,733 km/h.\\n20 Kilometer vor dem Ziel führte eine Gruppe von neun Fahrern, darunter Jan Raas, sein Teamkollege Ludo Peeters, Bernard Hinault und Roger De Vlaeminck, dem es allerdings an Form fehlte. Peeters wurde nach vorne geschickt, was Hinault dazu zwang, die anderen zur Verfolgung zu drängen. Peeters wurde eingeholt, und Raas attackierte umgehend. Keiner der anderen Fahrer hatte die Kraft ihm zu folgen, so dass Raas allein in der Radrennbahn ankam und das Rennen bei seiner siebten Teilnahme gewann."},{"page_url":"https://en.wikipedia.org/wiki/Ninurta","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Shamash.jpg","page_title":"Ninurta","context_page_description":"Ninurta, also known as Ninĝirsu, is an ancient Mesopotamian god associated with farming, healing, hunting, law, scribes, and war who was first worshipped in early Sumer. In the earliest records, he is a god of agriculture and healing, who releases humans from sickness and the power of demons. In later times, as Mesopotamia grew more militarized, he became a warrior deity, though he retained many of his earlier agricultural attributes. He was regarded as the son of the chief god Enlil and his main cult center in Sumer was the Eshumesha temple in Nippur. Ninĝirsu was honored by King Gudea of Lagash, who rebuilt Ninĝirsu's temple in Lagash.\\nLater, Ninurta became beloved by the Assyrians as a formidable warrior. The Assyrian king Ashurnasirpal II built a massive temple for him at Kalhu, which became his most important cult center from then on. After the fall of the Assyrian Empire, Ninurta's statues were torn down and his temples abandoned because he had become too closely associated with the Assyrian regime, which many conquered peoples saw as tyrannical and oppressive."},{"page_url":"https://nl.wikipedia.org/wiki/Tyrone_Spong","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Paul-blank.jpg","page_title":"Tyrone Spong","context_page_description":"Tyrone Clinton Spong is een Surinaams-Nederlands bokser en kickbokser. Hij trainde van jongs af aan bij de sportschool van Lucien Carbin. Op vijfjarige leeftijd emigreerde Spong met zijn familie vanuit Suriname naar Nederland. Hij komt in de ring uit voor Suriname."},{"page_url":"https://fi.wikipedia.org/wiki/William_Lyon_Mackenzie_King","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bc/Statue_Mackenzie_King_2.jpg","page_title":"William Lyon Mackenzie King","context_page_description":"William Lyon Mackenzie King, PC, OM, CMG oli kanadalainen poliitikko, Kanadan liberaalipuolueen pitkäaikainen puheenjohtaja sekä kolme kertaa maansa pääministeri. 21 pääministerivuodellaan King on pisimpään palvellut Kansainyhteisömaan hallituksen johtaja. Kingin mukaan ollaan nimetty Kanadaan kuuluva Mackenzie Kingin saari.\\nMackenzie King opiskeli Toronton, Chicagon ja Harvardin yliopistoissa. Tehdessään sosiaalityötä Chicagossa hän sai ajatuksen paljastaa vaarallisia ja epäreiluja työskentelyolosuhteita Torontossa. Hän vaikutti Kanadan työvoimaministeriön perustamiseen ja toimi myöhemmin maan työvoimaministerinä.\\nVuonna 1919 Mackenzie King valittiin liberaalipuolueen johtoon, ja puolue voitti vuoden 1921 vaalit hänestä tuli ensi kertaa pääministeri. Mackenzie King vaikutti Kanadan sosiaaliturvajärjestelmien, kuten eläkejärjestelmän kehittämiseen. Hänet tunnettiin sovinnollisena maan kielikysymyksessä, koska hän kohteli niin englannin- kuin ranskankielisiä samanarvoisesti."},{"page_url":"https://ja.wikipedia.org/wiki/VIERA","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/%E3%82%89%E3%81%8F%E3%82%89%E3%81%8F%E3%83%AA%E3%83%A2%E3%82%B3%E3%83%B3.JPG","page_title":"VIERA","context_page_description":"VIERAとはパナソニック製のプラズマテレビ/液晶テレビ/ポータブルテレビ、及びパナソニック モバイルコミュニケーションズ製の一部のワンセグ携帯電話ブランド名でパナソニックの登録商標である。テレビは2003年9月に、携帯電話は2007年11月に発売された。2009年3月, パナソニックには, 「VIERANIA」 という所有者のコミュニティがあります。"},{"page_url":"https://gl.wikipedia.org/wiki/Motu_One,_Illas_da_Sociedade","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Societe_isl_MotuOne.PNG","page_title":"Motu One, Illas da Sociedade","context_page_description":"Motu One, coñecido tamén como Bellinghausen, é o atol máis setentrional do grupo de illas de Sotavento das illas da Sociedade, na Polinesia Francesa. Administrativamente depende directamente do goberno territorial. Está situado a 550 km ao noroeste de Tahití e 72 km ao nordeste de Manuae, o seu veciño máis próximo.\\nO atol consiste en seis illotes e unha lagoa sen ningún paso navegable. Todos os seus lados están cubertos con illas arenosas baixas e boscosas, agás polo seu lado sur. É un importante lugar para a reprodución das tartarugas verdes que acoden a aniñar no outono. A superficie total é de 2´8 km² e non ten unha poboación permanente."},{"page_url":"https://gl.wikipedia.org/wiki/B%C3%B3veda_de_crucer%C3%ADa","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5b/Sixpartite_rib_vault-scheme.png","page_title":"Bóveda de crucería","context_page_description":"A bóveda de cruzaría ou bóveda de crucería, tamén chamada bóveda nervada, é un tipo de bóveda característica da arquitectura gótica que recibe este nome porque está conformada polo cruzamento, ou intersección, de dúas bóvedas de canón apuntado. A diferenza da bóveda de aresta, a de cruzaría caracterízase por estar reforzada por dúas ou máis nervios diagonais que se cruzan na clave, xeralmente. A bóveda de cruzaría considérase un dos tres elementos distintivos da arquitectura gótica, xunto co arco apuntado e o arcobotante.\\nA bóveda de cruzaría consta de dous elementos: os arcos que constitúen o seu armazón, ou esqueleto, e os panos ou plementos que cobren os espazos intermedios entre os arcos. Primeiro érguense os arcos, creando unha estrutura esvelta, resistente e lixeira, e posteriormente énchense os panos intermedios conformando as bóvedas, ficando enmarcadas transversalmente polos arcos perpiaños, tamén chamados arcos faixóns, e lonxitudinalmente polos arcos formeiros, paralelos ao eixo da nave que delimitan os tramos da bóveda."},{"page_url":"https://sv.wikipedia.org/wiki/Philonthus","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Philonthus_spinipes_Sharp%2C_1874_%283950313531%29.jpg","page_title":"Philonthus","context_page_description":"Philonthus är ett släkte av skalbaggar som beskrevs av Curtis 1829. Philonthus ingår i familjen kortvingar.\\nKladogram enligt Catalogue of Life och Dyntaxa:"},{"page_url":"https://ro.wikipedia.org/wiki/Provincia_Kunduz","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Kunduz_in_Afghanistan.svg","page_title":"Provincia Kunduz","context_page_description":"Provincia Kunduz este una dintre provinciile Afganistanului. Este localizată în partea nordică, la frontiera cu statul Tadjikistan."},{"page_url":"https://af.wikipedia.org/wiki/Frank_Brownlee_(akteur)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Shore_Acres_%281920%29_-_Ad_2.jpg","page_title":"Frank Brownlee (akteur)","context_page_description":"Frank Brownlee was 'n Amerikaanse akteur en skrywer. Hy was bekend vir sy rolle in die rolprente The Return of Mary, Girl from Nowhere, King of the Pack, en The Vanishing Legion."},{"page_url":"https://es.wikipedia.org/wiki/Aleksandr_Gradski","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Vladimir_Putin_28_April_2000-3.jpg","page_title":"Aleksandr Gradski","context_page_description":"Aleksandr Borísovich Gradski es un cantante, bardo, multi-instrumentista y compositor ruso, reconocido por ser uno de los primeros intérpretes de música rock en Rusia. Su diverso repertorio incluye géneros como el rock 'n' roll, canciones folclóricas tradicionales y arias operísticas. Ha compuesto dos óperas rock y numerosas canciones, incluyendo las bandas sonoras de varias películas. Su colaboración con el cantautor estadounidense John Denver​​ y su constante participación como miembro del jurado del concurso The Voice en su versión rusa, ​​ le han valido el reconocimiento internacional."},{"page_url":"https://gl.wikipedia.org/wiki/Ram%C3%B3n_Franco","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/PlusUltra.JPG","page_title":"Ramón Franco","context_page_description":"Ramón Franco Bahamonde, nado en Ferrol o 2 de febreiro de 1896 e finado en Mallorca en outubro de 1938, foi un político, militar e aviador galego. Pasou á historia pola fazaña do voo do Plus Ultra, feito que o converteu nun heroe da súa época."},{"page_url":"https://en.wikipedia.org/wiki/Jasmyne_Spencer","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Camila_Jasmyne_Spencer.jpg","page_title":"Jasmyne Spencer","context_page_description":"Jasmyne Spencer is an American soccer player who plays as a forward for OL Reign in the National Women's Soccer League. She previously played for Orlando Pride, Western New York Flash and Washington Spirit in the NWSL, Sydney FC, Canberra United and Melbourne City in the Australian W-League, Cypriot side Apollon Limassol in the 2013–14 UEFA Women's Champions League, and Danish side Brøndby IF in the 2012–13 UEFA Women's Champions League."},{"page_url":"https://fi.wikipedia.org/wiki/J%C3%A4%C3%A4kiekon_alle_18-vuotiaiden_maailmanmestaruuskilpailut_2009","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Urban_Plains_Center_IIHF_U18_2009.jpg","page_title":"Jääkiekon alle 18-vuotiaiden maailmanmestaruuskilpailut 2009","context_page_description":"Jääkiekon alle 18-vuotiaiden maailmanmestaruuskilpailut 2009 pelattiin Yhdysvalloissa 9. - 19. huhtikuuta 2009. Mestaruuden voitti isäntämaa Yhdysvallat, joka kaatoi finaalissa Venäjän maalein 5–0. Suomi sai pronssia lyömällä Kanadan tiukassa pronssiottelussa lukemin 5–4 rangaistuslaukauskilpailun päätteeksi."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D0%B8%D0%BC%D0%B5%D0%BB%D1%96%D1%8F-%D0%BA%D1%83%D1%86%D0%BE%D1%85%D0%B2%D1%96%D1%81%D1%82_%D0%BD%D0%B5%D0%BF%D0%B0%D0%BB%D1%8C%D1%81%D1%8C%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Pnoepyga_immaculata.jpg","page_title":"Тимелія-куцохвіст непальська","context_page_description":"Тимелія-куцохвіст непальська — вид горобцеподібних птахів родини Pnoepygidae."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D1%83%D1%80%D0%B0%D0%BA%D0%BE_%D0%B1%D0%BB%D0%B0%D0%BA%D0%B8%D1%82%D0%BD%D0%B8%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Great_Blue_Turaco_SMTC.jpg","page_title":"Турако блакитний","context_page_description":"Турако блакитний — вид птахів родини туракових."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A9%E3%83%A2%E3%83%8A%E3%83%BB%E3%82%A8%E3%83%AB%E3%82%BC%E3%83%8A%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/European_2011_Ramona_ELSENER_Florian_ROOST.jpg","page_title":"ラモナ・エルゼナー","context_page_description":"ラモナ・エルゼナーは、スイス出身の女性フィギュアスケート選手。パートナーはフロリアン・ロースト。\\nスイスフィギュアスケート選手権優勝5回。"},{"page_url":"https://el.wikipedia.org/wiki/%CE%9A%CF%8C%CE%BC%CE%B7%CF%82_%CF%84%CE%BF%CF%85_%CE%86%CE%BB%CF%83%CF%84%CE%B5%CF%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Arms_of_Mortimer-de_Burgh.svg","page_title":"Κόμης του Άλστερ","context_page_description":"Ο τίτλος Κόμης του Άλστερ δημιουργήθηκε έξι φορές στην Ιρλανδία και δυο φορές στην Αγγλία, το 1928 ο τίτλος μετέβη στον δούκα του Άλστερ που τον παραχώρησε στον μεγαλύτερο γιο του, ο σημερινός είναι ο Αλεξάντερ Ουίνδσορ, κόμης του Άλστερ. Η Άλστερ είναι μια από τις τέσσερις παραδοσιακές επαρχίες της Ιρλανδίας, βρίσκεται στα σημερινά σύνορα της βόρειας Ιρλανδίας. Ο Ερρίκος Β΄ της Αγγλίας δημιούργησε τρία Παλατινάτα στην Ιρλανδία στην διάρκεια της Νορμανδικής επίθεσης στο νησί και τα παραχώρησε σε Νορμανδούς ευγενείς. Ο Νορμανδό-Ουαλός ευγενής Ρίτσαρντ ντε Κλερ, κόμης του Στριγκουίλ γνωστός σαν \\"Στρόνγκμποου\\" πήρε πρώτος την κομητεία του Λένστερ. Ο Άγγλο-Νορμανδός ευγενής Σερ Ούγος ντε Λάσι πήρε την κομητεία του Μιθ. Ο Ερρίκος Β΄ δημιούργησε από έμπνευση την τρίτη κομητεία του Παλατινάτου του Άλστερ που την έδωσε στον ευγενή Τζον ντι Κόρσι, αργότερα δημιούργησε την ηγεμονία του Κόνοτ που έγινε σύντομα αντίπαλος των ντε Λάσι. Δεν υπάρχουν πηγές της εποχής για την δημιουργία της κομητείας του Άλστερ αλλά τα ιστορικά αρχεία της οικογένειας Κόρσι όπως αναλύθηκαν τον 19ο αιώνα οδηγούν σε αυτό το συμπέρασμα."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89thyl%C3%A8ne","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/57/EtheneEmissions_%C3%A9thyl%C3%A8neTexasNOAA.jpg","page_title":"Éthylène","context_page_description":"L'éthylène, ou, selon la nomenclature de l'IUPAC, éthène, est un hydrocarbure insaturé. On peut aussi le trouver sous l'appellation R1150."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%B3%E3%83%86%E3%82%A3%E3%83%AB%E8%AB%B8%E5%B3%B6","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bd/Caribbean_-_Lesser_Antilles.PNG","page_title":"アンティル諸島","context_page_description":"アンティル諸島は、中央アメリカに位置し、西インド諸島の主要部を構成する諸島。フロリダ南方から南米大陸近海まで3200キロメートルにわたり伸び、カリブ海を大西洋・メキシコ湾から分けている。"},{"page_url":"https://en.wikipedia.org/wiki/Handicraft","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/WPA_Crafts_Class.gif","page_title":"Handicraft","context_page_description":"A handicraft, sometimes more precisely expressed as artisanal handicraft or handmade, is any of a wide variety of types of work where useful and decorative objects are made completely by hand or by using only simple tools. It is a traditional main sector of craft and applies to a wide range of creative and design activities that are related to making things with one's hands and skill, including work with textiles, moldable and rigid materials, paper, plant fibers, etc. One of the world's oldest handicraft is Dhokra; this is a sort of metal casting that has been used in India for over 4,000 years and is still used. In Iranian Baluchistan, women still make red ware hand made pottery with dotted ornaments much similar to the 5000 year old pottery tradition of Kalpurgan, an archaeological site near the village. Usually, the term is applied to traditional techniques of creating items that are both practical and aesthetic. Handicraft industries are those that produce things with hands to meet the needs of the people in their locality. Machines are not used.\\nCollective terms for handicrafts include artisanry, handicrafting, crafting, handicraftsmanship and handcrafting."},{"page_url":"https://de.wikipedia.org/wiki/Willy_Bogner_junior","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Willy_Bogner_0650.jpg","page_title":"Willy Bogner junior","context_page_description":"Wilhelm Hermann Björn Bogner junior ist ein ehemaliger deutscher Skirennfahrer, Filmemacher, Designer, Inhaber der Bekleidungsfirma Willy Bogner GmbH & Co. KGaA und der Sohn von Willy Bogner senior."},{"page_url":"https://en.wikipedia.org/wiki/List_of_National_Treasures_of_Japan_(temples)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Kakogawa_Kakurinji14nt3200.jpg","page_title":"List of National Treasures of Japan (temples)","context_page_description":"The term \\"National Treasure\\" has been used in Japan to denote cultural properties since 1897.\\nThe definition and the criteria have changed since the inception of the term. The temple structures in this list were designated national treasures when the Law for the Protection of Cultural Properties was implemented on June 9, 1951. The items are selected by the Ministry of Education, Culture, Sports, Science and Technology based on their \\"especially high historical or artistic value\\". This list presents 157 entries of national treasure temple structures from the late 7th-century Classical Asuka period to the early modern 19th-century Edo period. The number of structures listed is more than 157, because in some cases groups of related structures are combined to form a single entry. The structures include main halls such as kon-dō, hon-dō, Butsuden; pagodas, gates, belfries, corridors, other halls and structures that are part of a Buddhist temple."},{"page_url":"https://fr.wikipedia.org/wiki/Imbert_d%27Eygui%C3%A8res","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Celestin_III.jpg","page_title":"Imbert d'Eyguières","context_page_description":"Imbert d’Eyguières, dit également Imbert d’Aiguières, fut chanoine, puis sacristain d’Arles et devint archevêque d’Arles du 9 octobre 1191 à sa mort."},{"page_url":"https://tr.wikipedia.org/wiki/Nairi","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Near_East_1400_BCE.png","page_title":"Nairi","context_page_description":"Nairi, Ermenice - Նաիրի MÖ 14 ve 10. yüzyıllar arasında Ermeni Yayları olarak adlandırılan bölgede veya bölgelerinde yaşamış, farklı kimlik ve dillere sahip kabile ve aşiret topluluklarından oluşan, bir konfederasyon ve bölgenin adıdır, daha sonraki Asur metinlerinde Van Gölü' için “Nairi ülkesi denizi” (tâmtu ša mât Nairi) denir."},{"page_url":"https://sk.wikipedia.org/wiki/Opio","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Opio.jpg","page_title":"Opio","context_page_description":"Opio je francúzska obec, ktorá sa nachádza v departemente Alpes-Maritimes, v regióne Provence-Alpes-Côte d’Azur."},{"page_url":"https://nl.wikipedia.org/wiki/Hadsund_Syd","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/HadsundSydStationS.jpg","page_title":"Hadsund Syd","context_page_description":"Hadsund Syd is een buitenwijk van Hadsund in de gemeente Mariagerfjord. Het dorp ligt aan de zuidzijde van het fjord. Tot 1904 was er een veerverbinding naar de overkant, sindsdien ligt er een brug. Het station was tot de opening van de brug eindpunt van de spoorlijn Randers - Hadsund."},{"page_url":"https://simple.wikipedia.org/wiki/Chespirito_(TV_series)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/LogoCH93.PNG","page_title":"Chespirito (TV series)","context_page_description":"Chespirito, also known as Los Supergenios de la Mesa Cuadrada from 1968–1970 and Chespirito y la Mesa Cuadrada from 1970-1971, is a Mexican sketch comedy show. It aired in Mexico for two periods, 1968–1973 and 1980-1995. The program aired various sketches of characters created by Roberto Gómez Bolaños."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AD%E3%83%A3%E3%83%B3%E3%83%94%E3%83%B3%E3%82%B0%E3%83%BB%E3%83%AF%E3%83%BC%E3%83%AB%E3%83%89%E3%83%BB%E3%82%B9%E3%82%BF%E3%82%B8%E3%82%A2%E3%83%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Citrus_Bowl_Orlando_City.jpg","page_title":"キャンピング・ワールド・スタジアム","context_page_description":"キャンピング・ワールド・スタジアムはフロリダ州オーランドにある球技場。シトラスボウル、チャンプススポーツボウル、モンスタージャム、フロリダ農工大学とビーサン・クックマン大学の間で行われるフロリダ・クラシックなどが毎年開催されている。1979年から2006年までUCFナイツの本拠地であった。"},{"page_url":"https://en.wikipedia.org/wiki/Anthony_Ervin","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Kazan_2015_-_50m_freestyle_swim-off_-_Anthony_Ervin_%28cropped%29.jpg","page_title":"Anthony Ervin","context_page_description":"Anthony Lee Ervin is an American competition swimmer who has won four Olympic medals and two World Championship golds. At the 2000 Summer Olympics, he won a gold medal in the men's 50-meter freestyle, and earned a silver medal as a member of the second-place United States relay team in the 4×100-meter freestyle event. He was the second swimmer of African descent after Anthony Nesty of Suriname to win an individual gold medal in Olympic swimming. He is the first United States citizen of African descent to medal gold in an individual Olympic swimming event.\\nErvin stopped swimming competitively at the age of 22 in 2003 and auctioned off his 2000 Olympic gold medal on eBay to aid survivors of the 2004 tsunami, but he began to train again in 2011.\\nErvin competed in the 50-meter freestyle event at the 2012 Summer Olympics where he placed fifth. In the spring of 2016, Akashic Books released Ervin's memoir, Chasing Water, co-authored by Ervin and Constantine Markides. At the 2016 Summer Olympics, 16 years after his first Olympic gold medal, he won the event for the second time, at the age of 35, becoming the oldest individual Olympic gold medal winner in swimming."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B2%D5%A5%D5%AC%D5%A3%D5%B8%D6%80%D5%B8%D5%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Gerb_orla_1988.jpg","page_title":"Բելգորոդ","context_page_description":"Բելգորոդ, քաղաք Ռուսաստանի եվրոպական մասի հարավային հատվածում։ Բելգորոդի մարզի վարչական կենտրոնն է։ Գտնվում է Արևելաեվրոպական հարթավայրի հարավային ծայրամասում, Սևերսկի Դոնեց գետի աջ ափին, 700 կմ հարավ է Մոսկվայից, 40 կմ հեռու է Ուկրաինայից: Քաղաքի բնակչությունը կազմում է 379.508 մարդ ։ Բելգորոդի շուրջ ձևավորված ագլոմերացիան քաղաքի հետ միասին ունեն ավելի քան կես միլիոն բնակչություն։ Առաջին քաղաքն է Ռուսաստանում, որը ստացել է «Զինվորական փառքի քաղաք» կոչումը:"},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A7%D8%B3%DA%A9%D9%88%D9%BE%DB%8C%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/%D0%9C%D0%BE%D0%BD%D1%83%D0%BC%D0%B5%D0%BD%D1%82_%D0%B2_%D1%87%D0%B5%D1%81%D1%82%D1%8C_%D0%BE%D0%B1%D0%BE%D1%80%D0%BE%D0%BD%D1%8B_%D0%B3.%D0%A1%D0%BA%D0%BE%D0%BF%D0%B8%D0%BD%D0%B0.JPG","page_title":"اسکوپین","context_page_description":"اسکوپین روسیه اؤلکه‌سینده یئر آلان بیر شهردیر و ریازان اوبلاستینده یئرلشیب. ۲۰۱۰-جی ایلین نۆفوس ساییمی اساسیندا ۳۰۳۷۶ نفر دیر."},{"page_url":"https://en.wikipedia.org/wiki/Elroy_Chester","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/ElroyChester.jpg","page_title":"Elroy Chester","context_page_description":"Elroy Chester was an inmate on Texas death row who was executed at the Huntsville Unit, Huntsville, Texas, two days before his 44th birthday. He was convicted in 1998 of fatally shooting Willie Ryman III, a firefighter in Port Arthur, Texas. He did so after raping Ryman's two nieces. He had confessed to four other killings, and his DNA was linked to three rapes, including that of a ten-year-old girl. After his arrest, he said that he had committed these offenses because he was out of his mind \\"with hate for white people\\" due to lingering resentment over an altercation that he had once gotten into with a white employee of the Texas Department of Criminal Justice. During his trial, Chester made multiple outbursts, threatened the lives of police officers, prison guards, and the families of jurors, and at one point declared, \\"If I hadn't shot my brother-in-law, I'd still be out there shooting white folks.\\" He was originally scheduled for execution on April 24, but, due to an error in the execution warrant, the date was pushed back."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%95%E0%B1%81%E0%B0%AE%E0%B1%8D%E0%B0%AE%E0%B0%B0%E0%B0%BF_%E0%B0%AA%E0%B1%81%E0%B0%B0%E0%B1%81%E0%B0%97%E0%B1%81","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cf/Bee_September_2007-6.jpg","page_title":"కుమ్మరి పురుగు","context_page_description":"భ్రమరము ఒక రకమైన ఈగ. ఇవి జైలొకోపినే ఉపకుటుంబంలోని జైలొకోపా ప్రజాతికి చెందిన పెద్ద ఈగలు. ఇవి ప్రపంచవ్యాప్తంగా విస్తరించాయి. వీనిలో సుమారు 500 జాతులున్నవి. వీటన్నింటి యొక్క ప్రధానమైన లక్షణము కలప, వెదురు మొదలైన వాటికి బొరియలు చేసి అందులో గూడు కట్టుకొని నివసించడం."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_windmolens_in_Nederland","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Nispen_-_Molen_Van_Aerden.jpg","page_title":"Lijst van windmolens in Nederland","context_page_description":"In Nederland staan circa 1170 windmolens, waarvan er vele maalvaardig zijn. De beroemdste molenlocatie is Kinderdijk, waar de meeste windmolens in een klein gebied te vinden zijn; dit zijn poldermolens. Ook de Zaanse Schans heeft diverse molens, evenals de gemeente Alblasserwaard en het gebied tussen Alphen aan den Rijn en Leiden. In Leiden zelf zijn negen molens. De Schiedamse molens behoren tot de hoogste ter wereld.\\nWindmolens waarop de blauwe wimpel wappert, zijn op dat moment in ieder geval te bezoeken. Vaak kunnen ook draaiende molens zonder blauwe wimpel bezocht worden."},{"page_url":"https://nl.wikipedia.org/wiki/Jerry_Jeff_Walker","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Jerry_Jeff_Walker.jpg","page_title":"Jerry Jeff Walker","context_page_description":"Jerry Jeff Walker, geboren als Ronald Clyde Crosby, is een Amerikaanse countryzanger en songwriter."},{"page_url":"https://en.wikipedia.org/wiki/Martti_Pokela","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/MarjattaAndMarttiPokela.jpg","page_title":"Martti Pokela","context_page_description":"Martti Eliel Pokela was a Finnish folk musician and composer. Pokela was an expert with the kantele, Finland's national musical instrument."},{"page_url":"https://en.wikipedia.org/wiki/African_crake","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/CrakeAfrican2%28byMarkTittley%29_cropped_and_mirrored.jpg","page_title":"African crake","context_page_description":"The African crake is a small to medium-size ground-living bird in the rail family, found in most of central to southern Africa. It is seasonally common in most of its range other than the rainforests and areas that have low annual rainfall. This crake is a partial migrant, moving away from the equator as soon as the rains provide sufficient grass cover to allow it to breed elsewhere. There have been a few records of vagrant birds reaching Atlantic islands. This species nests in a wide variety of grassland types, and agricultural land with tall crops may also be used.\\nA smallish crake, the African crake has brown-streaked blackish upperparts, bluish-grey underparts and black-and-white barring on the flanks and belly. It has a stubby red bill, red eyes, and a white line from the bill to above the eye. It is smaller than its closest relative, the corn crake; that species is also lighter-plumaged, and has an eye stripe. The African crake has a range of calls, the most characteristic being a series of rapid grating krrr notes."},{"page_url":"https://fr.wikipedia.org/wiki/Termez","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Termez_Sultan-Saodat.jpg","page_title":"Termez","context_page_description":"Termez est une ville historique de la province de Sourkhan-Daria, en Ouzbékistan. Ville la plus méridionale du pays, elle est située à 487 km au sud-ouest de Tachkent, à la frontière de l'Afghanistan. Sa population s'élevait à 140 000 habitants en 2005."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Pers%C3%B6nlichkeiten_der_Stadt_Odessa","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Maryna_Zanevska_1%2C_2015_Wimbledon_Qualifying_-_Diliff.jpg","page_title":"Liste von Persönlichkeiten der Stadt Odessa","context_page_description":"Die folgende Liste enthält Persönlichkeiten, die in Odessa geboren wurden sowie solche, die zeitweise dort gelebt und gewirkt haben. Die Liste erhebt keinen Anspruch auf Vollständigkeit."},{"page_url":"https://bs.wikipedia.org/wiki/Korijen_(biljka)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Visible_roots.jpg","page_title":"Korijen (biljka)","context_page_description":"Korijen je vegetativni biljni organ koji se nalazi nasuprot izdanku. Njegova pojava tokom evolucije je posljedica prelaska na život na kopnu, odnosno potrebe upijanja vode sa hranljivim tvarima iz tla. Potreban je i za učvršćivanje biljki za podlogu, a kod nekih ima i ulogu spremača određenih supstanci."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%BE%D1%82%D0%BE%D0%BD%D0%B4%D0%B0_%D0%A1%D0%B2%D1%8F%D1%82%D0%BE%D0%B3%D0%BE_%D0%93%D0%B5%D0%BE%D1%80%D0%B3%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Church_of_St._George%2C_Sofia_E4.jpg","page_title":"Ротонда Святого Георгия","context_page_description":"Ротонда Святого Георгия — раннехристианская церковь в городе София. Является самой старой церковью города, была построена в IV веке на территории античной Сердики в центре «Константинова квартала» — резиденции императора Константина Великого.\\nЦерковь построена в форме ротонды и изначально использовалась как баптистерий. Здание выполнено из кирпича, имеет узкие высокие окна и шесть полукруглых пристроек. Высота купола 13,7 м.\\nС конца X до середины XII века в церкви хранились мощи Иоанна Рыльского. В XVI веке, после завоевания Болгарии турками, церковь была обращена в мечеть и оставалась ею до 1878 года. При реставрации церкви в XX веке в ней были обнаружены три слоя фресок, закрашенных в период турецкого владычества, самые ранние из которых относятся к X веку. В настоящее время церковь является музеем, но несмотря на это Болгарская православная церковь проводит в ней регулярные богослужения."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B2%D0%BE%D1%80%D0%BD%D0%B5%D0%BA%D0%BE%D0%B2%D0%B8%D1%87,_%D0%9C%D0%B0%D1%82%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Matija_Dvornekovi%C4%87_2011.jpg","page_title":"Дворнекович, Матия","context_page_description":"Матия Дворнекович — хорватский футболист, полузащитник клуба «Горица».\\nНачинал играть в клубе «Радник» Велика Горица, потом перешёл в «Славен Белупо». Играл в аренде в клубах третьего дивизиона Хорватии «Копривница» и «Крижевцы». В 2010 году перешёл в ФК «Горица» из второй лиги Хорватии.\\nВ 2011 году Матия Дворнекович перешёл в российский клуб «Нижний Новгород», выступавший в ФНЛ. С 2012 года, после объединения ФК «Нижний Новгород» с «Волгой», он играет за другой нижегородский клуб, «Волга». 22 июля 2012 года он дебютировал в Премьер-лиге России."},{"page_url":"https://pnb.wikipedia.org/wiki/%DA%86%DB%8C%D9%86%DB%8C_%D9%85%D9%B9%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Moon_flasks._Famille_rose._Qing_1723-35._Sir_Percival_David_Collection%2C_British_Museum.jpg","page_title":"چینی مٹی","context_page_description":"چینی مٹی اک پانڈے بنان والی مٹی اے جیڑی صاف مادے نوں تیز اگ تے گرم کر کے بندی اے۔ چینی مٹی سخت، ٹٹن والی تے صاف ہوندی اے۔ اینوں چینی مٹی ایس لئ کیندے نے کیوں کے ایس دے بنے پانڈے سب توں پہلے چین توں آ‎ۓ سن تے اے پہلے اوتھے بنائ گئ سی۔"},{"page_url":"https://simple.wikipedia.org/wiki/Quim_Torra","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Quim_Torra_a_la_Assemblea_General_d%27%C3%92mnium_Cultural_%282015%29.jpg","page_title":"Quim Torra","context_page_description":"Joaquim Torra i Pla is a Catalan nationalist politician, lawyer and editor. Torra was a member of the Parliament of Catalonia from 2018 to 2020 and is the 131st President of Catalonia since May 2018.\\nTorra was elected to the Parliament of Catalonia at the 2017 regional election as an independent candidate for the pro-independence Junts per Catalunya electoral alliance. In May 2018 he was elected 131ˢᵗ President of Catalonia after the Spanish courts blocked three other candidates.\\nIn March 2020, Torra tested positive for COVID-19 during the 2020 coronavirus pandemic."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%84%D9%88%D8%A6%D8%B3%D8%AA%D8%A7%D9%81%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Lowestoft_beach_and_outer_harbour.jpg","page_title":"لوئستافت","context_page_description":"لوئستافت شهری در منطقهٔ لندن کشور انگلستان است که این کشور خود بخشی از بریتانیا محسوب می‌شود. این شهر در سال ۱۹۹۱ میلادی ۶۲٫۹۰۷ نفر جمعیت داشته و در سرشماری سال ۲۰۰۱ جمعیت آن به ۶۸٫۳۴۰ نفر رسیده‌است. میزان رشد سالانهٔ جمعیت لوئستافت ‎۱٫۲۲ درصد می‌باشد و جمعیت این شهر در سال ۲۰۱۲ به ۷۸٫۱۲۸ نفر تغییر یافت."},{"page_url":"https://ast.wikipedia.org/wiki/Teledeteici%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Death-valley-sar.jpg","page_title":"Teledeteición","context_page_description":"La teledetección o detección remota ye l'alquisición d'información a pequeña o gran escala d'un oxetu o fenómenu, yá sía usando preseos de grabación o preseos d'escanio en tiempu real inalámbricos o que nun tán en contautu direutu col oxetu. Na práutica, la teledetección consiste en recoyer información al traviés de distintos dispositivos d'un oxetu concretu o una área. Por casu, la observación terrestre o los satélites meteorolóxicos, les boyes oceánicu y atmosféricu, les imáxenes por resonancia magnética, la tomografía per emisión de positrones, los rayos-X y les sondes espaciales son toos exemplos de teledetección. Anguaño, el términu referir de manera xeneral al usu de teunoloxíes de sensores p'alquisición d'imáxenes, incluyendo: preseos a bordu de satélites o aerotresportaos, usos en electrofisioloxía, y difier n'otros campos rellacionaos con imáxenes como por casu n'imaxe médica.\\nHai dos clases de teledetección principalmente: teledetección pasiva y teledetección activa:\\nLos teledetectores pasivos detecten radiación natural emitida o reflexada pol oxetu o área circundante que ta siendo reparada."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%A8%E0%B4%BE%E0%B4%AF%E0%B5%8D%E0%B4%95%E0%B5%8D%E0%B4%95%E0%B4%B3%E0%B5%81%E0%B4%9F%E0%B5%86_%E0%B4%AA%E0%B4%9F%E0%B5%8D%E0%B4%9F%E0%B4%BF%E0%B4%95","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1b/Steirische_Rauhhaarbracke.jpg","page_title":"നായ്ക്കളുടെ പട്ടിക","context_page_description":"dog ]"},{"page_url":"https://es.wikipedia.org/wiki/Persona_(pel%C3%ADcula)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Richard_Mansfield_Jekyll.png","page_title":"Persona (película)","context_page_description":"Persona es una película sueca de 1966 escrita, dirigida y producida por Ingmar Bergman, y con actuación principal de Bibi Andersson y Liv Ullmann. La historia gira en torno a una joven enfermera llamada Alma y su paciente, la conocida actriz de teatro Elisabet Vogler, quien, sin motivo aparente, ha dejado de hablar. Ambas se trasladan temporalmente a una cabaña, donde Alma se dedica al cuidado de Elisabet, y comienza a sentirse identificada con su paciente.\\nCon elementos de terror psicológico, Persona ha sido objeto de considerables análisis, interpretaciones y debates. La película, que aborda temas como la dualidad, la locura y la identidad personal, ha sido interpretada como una representación de la teoría junguiana de la persona y explora el cine, la mitología vampírica, el lesbianismo, la maternidad, o el aborto, entre otros. El estilo experimental de su prólogo y su narración también han sido objeto de discusión. La enigmática película ha sido llamada el Monte Everest del análisis cinematográfico; según el historiador de Peter Cowie, \\"Todo lo que uno dice sobre Persona puede ser contradicho; lo contrario también será cierto.\\"​"},{"page_url":"https://pt.wikipedia.org/wiki/Auchenorrhyncha","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Cigarrinha_scan_byKoehne.jpg","page_title":"Auchenorrhyncha","context_page_description":"Auchenorrhyncha é uma subordem de insetos da ordem Hemiptera que contém as cigarras e famílias próximas. São fitófagos com desenvolvimento pós-embrionário por hemimetabolia e são capazes de emitir sons como forma de comunicação, em frequências audíveis e infrassónicas. Existe incerteza sobre a natureza monofilética do agrupamento, mas dados recentes parecem confirmar a validade do taxon."},{"page_url":"https://fi.wikipedia.org/wiki/Hevonpalot","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/35/Hippocrepis_emerus.jpg","page_title":"Hevonpalot","context_page_description":"Hevonpalot on suku hernekasvien heimossa. Siihen kuuluu 32 lajia."},{"page_url":"https://hu.wikipedia.org/wiki/CFR_060_DA_sorozat","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e9/60-1228-0-Oradea-001.jpg","page_title":"CFR 060 DA sorozat","context_page_description":"Az CFR 060 DA egy Co'Co' tengelyelrendezésű román dízelmozdony-sorozat. 1959 és 1993 között gyártotta a SLM, a Sulzer, a BBC és a Electroputere Craiova. Összesen 2496 készült a sorozatból."},{"page_url":"https://es.wikipedia.org/wiki/Provincia_de_Carelia","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Svpmap_karelia.png","page_title":"Provincia de Carelia","context_page_description":"Carelia es una provincia histórica de Finlandia la cual se cedió en parte a Rusia después de la Guerra de Invierno de 1939-1940. Los carelianos finlandeses incluyen a los habitantes actuales de Carelia del Norte y del Sur y los evacuados que aún sobreviven de los territorios cedidos. La actual Carelia finlandesa tiene 315,000 habitantes. Los más de 400,000 evacuados de los territorios cedidos se reasentaron en varias partes de Finlandia.\\nLa Carelia finlandesa estuvo históricamente bajo influencia occidental, religiosa y políticamente, y estaba separada de Carelia oriental, que estuvo dominada por Nóvgorod y sus estados sucesores desde la Edad Media en adelante."},{"page_url":"https://no.wikipedia.org/wiki/Leroy_Chiao","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Sts-65_crew.jpg","page_title":"Leroy Chiao","context_page_description":"Leroy Chiao er en tidligere amerikansk NASA-astronaut med fem romferder bak seg både med romfergen og i en Sojuz. Han har også et langvarig opphold på Den internasjonale romstasjonen under ISS Ekspedisjon 10 bak seg. Han har logget over 229 dager i verdensrommet totalt, og har gjennomført 6 romvandringer. Han pensjonerte seg som astronaut i 2001."},{"page_url":"https://de.wikipedia.org/wiki/Manuel_Pablo","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Manuel_Pablo.jpg","page_title":"Manuel Pablo","context_page_description":"Manuel Pablo García Díaz, kurz Manuel Pablo, ist ein ehemaliger spanischer Fußballspieler."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D8%A7%D8%B4%DB%8C%D9%88%D8%A7%D9%85%D9%88%DA%86%DB%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1c/Kashiwa_mochi.jpg","page_title":"کاشیواموچی","context_page_description":"کاشیواموچی نام یک نوع شیرینی سنتی ژاپن است. این شیرینی و نوع دیگری از شیرینی‌های سنتی ژاپن به نام چیماکی در روز پنجم ماه می مصرف می‌شوند. برای درست کردن کاشیوامچی خمیر برنج را که مواد دیگری نیز به آن افزوده شده‌است، در برگ درخت کاشیوا یا بلوط می‌پیچند. معمولاً برگ‌های کهنهٔ درخت بلوط تا روئیدن برگ‌های تازه در روی شاخه‌ها باقی می‌ماند به همین دلیل بعضی از مردم ژاپن معتقدند که خانواده‌ها با خوردن این شیرینی تندرست زندگی می‌کنند و نسلشان قطع نمی‌شود."},{"page_url":"https://en.wikipedia.org/wiki/Mochovce_Nuclear_Power_Plant","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Mochovce_2005-01-19_1.jpg","page_title":"Mochovce Nuclear Power Plant","context_page_description":"The Mochovce Nuclear Power Plant is a nuclear power plant located between the towns of Nitra and Levice, on the site of the former village of Mochovce, Slovakia. Two up-rated 470 MW reactors are presently in operation, with two further reactors of the same type under construction. Generating almost 7,000 GWh of electricity a year, the power plant currently serves approximately 20% of Slovakia's electricity needs."},{"page_url":"https://no.wikipedia.org/wiki/Den_argoliske_bukt","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Argolic_Gulf.jpg","page_title":"Den argoliske bukt","context_page_description":"Den argoliske bukt, også kjent som Argolikosbukten, Argolisbukten eller Nafpliobukten, er en bukt i Egeerhavet utenfor østkysten av Peloponnes i Hellas. Den er om lag 50 km lang og 30 km bred. Den viktigste havnebyen langs kysten er Nafplio, som ligger i den nordvestlige enden av bukten. Ved innløpet til bukten ligger Spetses, som er den største øya i hele området.\\nDenne bukten blir av og til omtalt i lag med Saroniabukta som Den argosaroniske bukt, mens øyene i de to buktene blir kalt De argosaroniske øyene eller oftere bare De saroniske øyer. Rundt bukten ligger prefekturene Arkadia og Argolida. Elven Inachos munner ut i Den argoliske bukt i nærheten av landsbyen Nea Kios.\\nEi annen øy i bukten er Bourtzi, ei liten øy like utenfor Nafplio, med en borg som tidligere utgjorde byens forsvarslinje mot sjøangrep og i dag er et monument. Andre øyer i bukten er Platia og Psilí, som ligger nær kysten av Argolida. De omkringliggende fjellene gjør at bukten ligger i ly for den sterke sommervinden kalt Meltemi.\\nDet går fergeruter over bukten mellom Nafplio, Spetses, Hydra, Tyros og Leonidio."},{"page_url":"https://en.wikipedia.org/wiki/University_of_Rio_Grande","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/RioGrandeUnivEntrance.JPG","page_title":"University of Rio Grande","context_page_description":"The University of Rio Grande and Rio Grande Community College are twin colleges in Rio Grande, Ohio, United States. The University of Rio Grande is regionally accredited by the Higher Learning Commission.\\nThe University of Rio Grande offers a range of courses and majors and is known in the region for its Fine Arts, Education and Nursing programs. Additionally, its graduate program in teacher education was one of the few national programs structured around Howard Gardner's Theory of multiple intelligences. The university's Greer Museum hosts 5–6 visiting artists each year, and houses the Brooks Jones Art Collection, including works by Goya, Renoir, and Jasper Johns. The university Sculpture Garden contains 15 large-scale outdoor works by contemporary artists, including Fletcher Benton. The university's Grande Chorale jazz vocal group performs 12-15 recitals each year.\\nRio Grande is notable for being the alma mater of Bevo Francis, who set the college record for points scored in a basketball game, and for its close connection with Bob Evans Farms, whose original location is adjacent to the university."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%83%D1%8D%D1%80_(%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D1%81%D0%BA%D0%BE%D0%B9_%D0%BE%D0%BA%D1%80%D1%83%D0%B3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Location_of_Pu%27er_Prefecture_within_Yunnan_%28China%29.png","page_title":"Пуэр (городской округ)","context_page_description":"Пуэр — городской округ в провинции Юньнань."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Berlin-Baumschulenweg","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2f/Stolperstein_Rodelbergweg_12_%28Baums%29_Anna_Sophie_Jacobi.jpg","page_title":"Liste der Stolpersteine in Berlin-Baumschulenweg","context_page_description":"Die Liste der Stolpersteine in Berlin-Baumschulenweg enthält die Stolpersteine im Berliner Ortsteil Baumschulenweg im Bezirk Treptow-Köpenick, die an das Schicksal der Menschen erinnern, die im Nationalsozialismus ermordet, deportiert, vertrieben oder in den Suizid getrieben wurden. Die Spalten der Tabelle sind selbsterklärend. Die Tabelle erfasst insgesamt 18 Stolpersteine und ist teilweise sortierbar; die Grundsortierung erfolgt alphabetisch nach dem Familiennamen."},{"page_url":"https://es.wikipedia.org/wiki/Mammillaria_spinosissima","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f4/Mammillaria_spinosissima_BlKakteenT71.jpg","page_title":"Mammillaria spinosissima","context_page_description":"Mammillaria spinosissima es una especie perteneciente a la familia Cactaceae, endémico de Guerrero y Morelos en México. Su hábitat natural son los áridos desiertos. Se ha extendido por el mundo como planta ornamental."},{"page_url":"https://pl.wikipedia.org/wiki/Paragraf_175","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Neuengamme_pink_triangle.JPG","page_title":"Paragraf 175","context_page_description":"Paragraf 175 – przepis niemieckiego kodeksu karnego z 1871 r., który określał homoseksualizm jako przeciwny naturze nierząd. Stał się on podstawą do prześladowań i eksterminacji osób homoseksualnych przez nazistów w III Rzeszy.\\nParagraf 175 obowiązywał w niezmienionej wersji w NRD do 1967 r., a w RFN do 1969 r. W 1969 w RFN złagodzono nazistowską wersję paragrafu, zaś ostatecznie usunięto go dopiero w latach 90."},{"page_url":"https://pl.wikipedia.org/wiki/Bzenec","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Bzenec.JPG","page_title":"Bzenec","context_page_description":"Bzenec − miasto w Czechach, w kraju południowomorawskim. Według danych z 31 grudnia 2003 powierzchnia miasta wynosiła 4 034 ha, a liczba jego mieszkańców 4 315 osób."},{"page_url":"https://es.wikipedia.org/wiki/Mata_Hari","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Mata_Hari_on_the_day_of_her_arrest_13-2-1917.jpg","page_title":"Mata Hari","context_page_description":"Margaretha Geertruida Zelle, más conocida como Mata Hari, ​ fue una famosa bailarina, cortesana y espía neerlandesa. Con las danzas brahmánicas y orientales triunfó en Europa. Durante la Primera Guerra Mundial realizó labores de espionaje a favor de Alemania, por lo que fue detenida por las fuerzas francesas, declarada culpable de espionaje y traición, condenada a muerte y ejecutada por fusilamiento el 15 de octubre de 1917 en la Fortaleza de Vincennes. La palabra matahari proviene del idioma malayo y significa “Sol”, y literalmente “Ojo del día”.​"},{"page_url":"https://de.wikipedia.org/wiki/Sacav%C3%A9m","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e2/LocalLrs-Sacavem.png","page_title":"Sacavém","context_page_description":"Sacavém ist eine portugiesische Stadt und ehemalige Gemeinde im Kreis Loures, nur wenige Kilometer nordöstlich von Portugals Hauptstadt Lissabon. Die Gemeinde hatte ein Territorium von 3,8 km² mit einer Bevölkerung von 18.538 Personen."},{"page_url":"https://es.wikipedia.org/wiki/Capelle-l%C3%A8s-Hesdin","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Capelle-l%C3%A8s-Hesdin_-_Mairie.JPG","page_title":"Capelle-lès-Hesdin","context_page_description":"Capelle-lès-Hesdin es una población y comuna francesa, situada en la región de Norte-Paso de Calais, departamento de Paso de Calais, en el distrito de Montreuil y cantón de Hesdin."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B0%B8%E4%BA%95%E9%BE%8D%E7%94%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Nagai_Tatsuo.JPG","page_title":"永井龍男","context_page_description":"永井 龍男は、日本の小説家、随筆家、編集者、文化勲章受章者。俳名、東門居。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BB%D0%B0%D1%86%D0%BE%D0%B2%D0%BE-%D0%BF%D0%B0%D1%80%D0%BA%D0%BE%D0%B2%D1%96_%D0%B0%D0%BD%D1%81%D0%B0%D0%BC%D0%B1%D0%BB%D1%96_%D0%BF%D0%B5%D1%80%D0%B5%D0%B4%D0%BC%D1%96%D1%81%D1%82%D1%8C_%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Peterhof_front_20021011.jpg","page_title":"Палацово-паркові ансамблі передмість Санкт-Петербурга","context_page_description":"Палацово-паркові ансамблі передмість Санкт-Петербурга - перелік головних палацово-паркових ансамблів, розташованих у передмістях Санкт-Петербурга та включених до Всесвітнього надбання ЮНЕСКО разом з історичним центром Санкт-Петербурга."},{"page_url":"https://en.wikipedia.org/wiki/Swedish_Pomerania","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Pomerania_1653.PNG","page_title":"Swedish Pomerania","context_page_description":"Swedish Pomerania was a Dominion under the Swedish Crown from 1630 to 1815, situated on what is now the Baltic coast of Germany and Poland. Following the Polish War and the Thirty Years' War, Sweden held extensive control over the lands on the southern Baltic coast, including Pomerania and parts of Livonia and Prussia.\\nSweden, present in Pomerania with a garrison at Stralsund since 1628, had gained effective control of the Duchy of Pomerania with the Treaty of Stettin in 1630. At the Peace of Westphalia in 1648 and the Treaty of Stettin in 1653, Sweden received Western Pomerania, with the islands of Rügen, Usedom, and Wolin, and a strip of Farther Pomerania. The peace treaties were negotiated while the Swedish queen Christina was a minor, and the Swedish Empire was governed by members of the high aristocracy. As a consequence, Pomerania was not annexed to Sweden like the French war gains, which would have meant abolition of serfdom, since the Pomeranian peasant laws of 1616 was practised there in its most severe form."},{"page_url":"https://sv.wikipedia.org/wiki/Pegasus-klass","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/USS_Hercules_%28PHM-2%29_1990.jpg","page_title":"Pegasus-klass","context_page_description":"Pegasus-klass är en klass bärplansburna robotbåtar byggda för USA:s flotta på 1970-talet. De var de sista bärplansbåtarna i USA:s flotta och under den tid de var aktiva var de också de snabbaste fartygen i USA:s flotta."},{"page_url":"https://sl.wikipedia.org/wiki/AvtoVAZ","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Lada_Vesta_%28cropped%29.jpg","page_title":"AvtoVAZ","context_page_description":"AvtoVAZ je ruski proizvajalec avtomobilov. Prej je imel ime VAZ. Bolj je poznan po tržnem imenu Lada. Podjetje je bilo ustanovljeno v poznih 1960ih v sodelovanju z italijanskim Fiatom. AvtoVAZ je ena izmed največjih tovarn v vzhodni Evropi. Francoski Renault ima 25% lastniški delež.\\nNa leto proizvede skoraj milijon avtomobilov, med njimi Kalina, Lada 110 in terenca Niva. Verjetno najbolj znano vozilo je VAZ-2101 na bazi Fiat 124. V preteklosti so bili najbolj znani Lada Nova in Lada Samara.\\nVAZ tovarna je ena izmed največjih na svetu. Posebnost je, da večino komponent izdelajo v tej tovarni.\\nLada je bilo \\"ljudsko vozilo\\" za stranke v Vzhodnem bloku. Ni bilo tako luksuzno kot zahodna vozila. Avtomobile so prodajali tudi na zahodu v Kanadi, Združenem kraljestvu, Franciji, Belgiji, Luksemburgu in Nizozemsku, v ZDA pa ne zaradi sankcij. V Italiji niso smeli prodajati zaradi pogodbe s Fiatom, ki ni hotel deliti trga.\\nTovarno so ustanovili skupaj z Italijani na bregovih reke Volga v kraju, ki so ga poimenovali Toljati. Lada naj bi bilo poceni ljudsko vozilo kot Citroën 2CV inVW Hrošč."},{"page_url":"https://en.wikipedia.org/wiki/Montopolis_Bridge","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Montopolis_Bridge_May_2020.jpg","page_title":"Montopolis Bridge","context_page_description":"The Montopolis Bridge is a historic Parker through truss bridge in Austin, Texas. It is located in the Montopolis neighborhood where a bicycle and pedestrian walkway crosses the Colorado River in southeastern Travis County. The bridge consists of five 200-foot Parker through truss spans and four 52-foot steel I-beam approach spans resting on reinforced concrete abutments. It was added to the National Register of Historic Places on October 10, 1996."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%BE%B0%E5%B7%B3%E7%AC%AC%E4%BA%8C%E3%83%91%E3%83%BC%E3%82%AD%E3%83%B3%E3%82%B0%E3%82%A8%E3%83%AA%E3%82%A2","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e4/Shutoko_tatsumi2PA.jpg","page_title":"辰巳第二パーキングエリア","context_page_description":"辰巳第二パーキングエリアは、東京都江東区の首都高速道路9号深川線上にあるパーキングエリア\\nである。\\n1991年10月22日供用開始。辰巳ジャンクション内に位置しており、首都高速湾岸線葛西方面から9号深川線上り線に向かう車両のみ利用できる。"},{"page_url":"https://vi.wikipedia.org/wiki/Zero_no_Tsukaima","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Runic_letter_uruz.png","page_title":"Zero no Tsukaima","context_page_description":"Zero no Tsukaima là một series light novel của Noboru Yamaguchi, sau này được chuyển thể thành anime, voisau đó là manga, và visual novel cho máy PS2. Tháng 4 năm 2007, hãng Geneon đã đăng ký bản quyền phần một của anime với tựa đề \\"The Familiar of Zero\\" ở Mỹ. Anime Zero no Tsukaima đã trình chiếu 4 phần, phần 2 có tựa đề phụ là Futatsuki no Kishi, phần 3 có tựa đề phụ là Princesse no Rondo, và phần cuối cùng có tựa đề là Zero no Tsukaima F. Truyện thuộc thể loại tình cảm, phiêu lưu, có xem lẫn nhiều tình tiết hài hước, và các nhân vật nhìn chung rất đáng yêu."},{"page_url":"https://es.wikipedia.org/wiki/Marino_Faliero","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Marino_Faliero_%28detalle_2%29.jpg","page_title":"Marino Faliero","context_page_description":"Marino Faliero fue dux de Venecia desde su proclamación el 11 de septiembre de 1354 hasta su muerte. En el idioma véneto es denominado Marin Falier, en vez de la versión italianizada de su nombre."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_catholicos_de_l%27%C3%89glise_apostolique_arm%C3%A9nienne","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Garegin_II.jpg","page_title":"Liste des catholicos de l'Église apostolique arménienne","context_page_description":"La liste des catholicos de l'Église apostolique arménienne reprend l'ensemble des catholicos de l'Église apostolique arménienne, des apôtres fondateurs du siège au catholicos actuel. Il s'agit de la liste traditionnelle de ces catholicos, le cas échéant complétée des coadjuteurs, anti-patriarches, etc."},{"page_url":"https://it.wikipedia.org/wiki/Tantalo","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Tableaux_du_temple_des_muses_-_tirez_du_cabinet_de_feu_Mr._Fauereau%2C_conseiller_du_roy_en_sa_Cour_des_aydes%2C_and_grauez_en_tailles-douces_par_les_meilleurs_maistres_de_son_temps%2C_pour_representer_les_%2814770308481%29.jpg","page_title":"Tantalo","context_page_description":"Tàntalo è un personaggio della mitologia greca. Fu un re di Lidia che per i suoi numerosi peccati fu punito dagli dei e gettato in un supplizio nel Tartaro.\\nNello specifico della sua punizione e come figura retorica oggi si definisce Tantalo una persona che desidera qualcosa che non può raggiungere."},{"page_url":"https://en.wikipedia.org/wiki/Fred_Moosally","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Moosally_Plaque_Ceremony.jpg","page_title":"Fred Moosally","context_page_description":"Fred P. Moosally is a former captain in the United States Navy. During his naval career, Moosally served in many different assignments, including commander of a destroyer and the battleship USS Iowa. Moosally was captain of the Iowa when the center gun of one of the ship's main gun turrets exploded on April 19, 1989, killing 47 crewmen.\\nDuring the investigation into the cause of the explosion, Moosally testified that the Navy had assigned personnel of inferior quality to the Iowa. The investigation found that Iowa had been operating with severe deficiencies in safety and training procedures, for which Moosally was disciplined. The Navy stated that the deficiencies were unrelated to the turret explosion.\\nIn December 1989 in testimony before the United States Senate Armed Services Committee, Moosally declined to fully support the Navy's conclusion that the explosion had been intentionally caused by Clayton Hartwig, one of the turret's crewmen. Moosally's testimony was widely reported in the media. Moosally retired from the Navy soon after in May 1990.\\nIn 1999, Moosally began working for Lockheed Martin. In 2002 he was appointed president of the company's MS2 division."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%BA%8C%E9%9A%8E%E5%A0%82%E3%83%88%E3%82%AF%E3%83%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Professor_Nagai_Domei.jpg","page_title":"二階堂トクヨ","context_page_description":"二階堂 トクヨは、宮城県大崎市出身の体育指導者・教育者。日本女子体育大学の創設者にあたり、「女子体育の母」と称される。日本初の女子オリンピック選手である人見絹枝のほか、8名のオリンピック選手を育てた。\\nイギリス留学で学んだスポーツの普及に努め、女子のスポーツとしてクリケットとホッケーを日本に初めて紹介した。"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B1%D9%88%D8%AF%D9%88%D9%84%D9%81_%D9%85%D8%A7%D8%B1%D9%83%D9%88%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Prof._Dr._Rudolph_A._Marcus.jpg","page_title":"رودولف ماركوس","context_page_description":"رودولف ماركوس ‏ هو كيميائي أمريكي من أصل كندي ولد في 21 يوليو 1923 بمونتريال بكويبيك.\\nتحصل على بكالوريوس سنة 1943 ومن ثم دكتوراه سنة 1946 من جامعة ماك جيل. في سنة 1958 تحصل على الجنسية الأمريكية،يدرس حاليا في معهد كاليفورنيا للتكنولوجيا تحصل في سنة 1992 على جائزة نوبل في الكيمياء لمساهماته في نظرية التفاعلات لتقل الإلكترونات في الأنظمة الكيميائية."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%B0%D1%82%D1%83%D1%88%D0%BD%D0%B0%D1%8F_%D0%B1%D0%B0%D1%88%D0%BD%D1%8F_(%D0%9C%D1%8E%D0%BD%D1%81%D1%82%D0%B5%D1%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/NRW%2C_Munster%2C_Altstadt_-_Stadthausturm_03.jpg","page_title":"Ратушная башня (Мюнстер)","context_page_description":"Ратушная башня — городская башня, расположенная в южной части улицы Принципальмаркт в городе Мюнстере. Несмотря на то, что сама Мюнстерская ратуша 28 октября 1944 года во время бомбардировок союзнической авиации в ходе второй мировой войны практически полностью была уничтожена, ратушная башня практически не пострадала и дошла до нас почти в первозданном виде.\\nВ отличие от ратуши, башня не является средневековым строением, а была создана в начале XX века. Строительство башни осуществлялось в 1902—1907 годах под руководством архитектора Альфреда Хензена. Ранее на этом месте располагались аптека и склады, которые ради строительства башни были снесены. Первоначально в подвале башни располагалась механическая телефонная станция.\\nВ 2001 году на средства сберегательной кассы Мюнстера, Мюнстерского городского союза и семейства Нонхофф на башне была смонтирована автоматическая система колокольного звона. Теперь колокольный звон воспроизводится трижды в сутки — в 11:00, 15:00 и 19:00.\\nСейчас в башне находится детская благотворительная организация «Maxi Turm»."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%B6%AD%E5%A1%94%E6%B6%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Pogled_s_%C5%A0tajnhofa.JPG","page_title":"維塔涅","context_page_description":"维塔涅是斯洛文尼亚的城镇，位于该国东北部，面积59.4平方公里，2002年人口2317。人口密度约39人/km²。"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A8%D8%A7%D9%84%DA%AF%D8%B1%D8%AF_%D9%85%D8%B1%DB%8C%D8%AE%DB%8C_%D9%86%D8%A8%D9%88%D8%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Anatomy_of_the_Mars_Helicopter.png","page_title":"بالگرد مریخی نبوغ","context_page_description":"بالگرد مریخی نبوغ یک بالگرد رباتیک است که برای آزمایش این فناوری جهت ردیابی اهداف مورد نظر در مریخ مورد استفاده قرار خواهد گرفت. این بالگرد به برنامه ریزی بهترین مسیر برای حرکت مریخ‌نوردهای آینده کمک می‌کند. این بالگرد بدون سرنشین کوچک برای رهاسازی در سال ۲۰۲۱ از مریخ نورد استقامت به عنوان بخشی از مأموریت مریخ ۲۰۲۰ ناسا برنامه ریزی شده‌است."},{"page_url":"https://de.wikipedia.org/wiki/St._Anna_(H%C3%BCngersdorf)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/H%C3%BCngersdorf%2C_Kapellenplatz_1%2C_kath._Kapelle_St._Anna%2C_Bild_2.jpg","page_title":"St. Anna (Hüngersdorf)","context_page_description":"St. Anna ist eine römisch-katholische Filialkirche im Blankenheimer Ortsteil Hüngersdorf im Kreis Euskirchen in Nordrhein-Westfalen. Das Kirchengebäude gehört zur Pfarre St. Johann Baptist, Ripsdorf.\\nDie Kirche ist der hl. Mutter Anna geweiht und als Baudenkmal unter Nummer 94 in die Liste der Baudenkmäler in Blankenheim eingetragen."},{"page_url":"https://tl.wikipedia.org/wiki/Altavas","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Ph_locator_aklan_altavas.png","page_title":"Altavas","context_page_description":"Ang Bayan ng Altavas ay isang Ika-4 na klaseng bayan sa lalawigan ng Aklan, Pilipinas. Ayon sa 2015 senso, ito ay may populasyon na 24,619 sa may 5,950 na kabahayan."},{"page_url":"https://ru.wikipedia.org/wiki/Mk_41_(%D0%BF%D1%83%D1%81%D0%BA%D0%BE%D0%B2%D0%B0%D1%8F_%D1%83%D1%81%D1%82%D0%B0%D0%BD%D0%BE%D0%B2%D0%BA%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/HMAS_Sydney_VLS.jpg","page_title":"Mk 41 (пусковая установка)","context_page_description":"Mk 41 — унифицированная корабельная американская установка вертикального пуска для управляемых ракет. Применяется на кораблях ВМС США и других стран для запуска ракет «Стандарт» SM-2, SM-3 и SM-6, ASROC, «Си Спарроу», ESSM и «Томагавк»."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_de_Lun%C3%A9ville","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Le_ch%C3%A2teau_de_Lun%C3%A9ville%2C_vue_du_Rocher.jpg","page_title":"Château de Lunéville","context_page_description":"Le château de Lunéville, possession des ducs de Lorraine depuis le XIIIᵉ siècle, a été construit pour le compte du duc Léopold Iᵉʳ entre 1703 et 1720 sur des plans de Pierre Bourdict, Nicolas Dorbay et Germain Boffrand.\\nLéopold Iᵉʳ, né en exil pendant l'occupation française, ne prit possession de ses duchés qu'avec la signature du traité de Ryswick.\\nIl découvrit alors Nancy, sa capitale et son palais datant du Moyen Âge, en piteux état, et dont la rénovation dépassait de beaucoup ses capacités financières.\\nDe plus, il ne fallut que quelques années pour que la guerre enflamme de nouveau l'Europe entraînant une énième occupation militaire des duchés par l'armée française. Fièrement et non sans panache, le duc se retira à Lunéville dont il fit entièrement reconstruire le château tout en s'inspirant comme le voulait la mode de l'époque du château de Versailles. Il en fit sa résidence principale et y mourut en 1729.\\nSon fils, le duc François III, fut bientôt contraint de céder à titre viager ses possessions au roi de Pologne, roi en exil mais qui avait l'avantage d'être le beau-père du roi de France."},{"page_url":"https://zh.wikipedia.org/zh-my/%E5%B0%87%E8%BB%8D%E6%BE%B3%E5%8D%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Tseung_Kwan_O_Waterfront_Promenade_Pet_Garden_2014.jpg","page_title":"將軍澳南","context_page_description":"将军澳南，简称“将南”或“澳南”，是属于香港新界将军澳市中心的一部分，位置在其南部，同时也是将军澳新市镇的南部，是新市镇最新的发展区。目前有部分土地正兴建豪华私人住宅。"},{"page_url":"https://fr.wikipedia.org/wiki/Art_mosan","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/MRAH_Aquamanile_Aristote_et_Phyllis_261211.jpg","page_title":"Art mosan","context_page_description":"L’art mosan est un art roman d'influence carolingienne et ottonienne de la vallée de la Meuse, actif du XIᵉ au XIIIᵉ siècles. La région mosane correspond aux frontières de l'ancien diocèse de Liège qui s'étendait principalement dans le territoire de l'actuelle Belgique, mais également sur une partie de la France, des Pays-Bas et de l'Allemagne."},{"page_url":"https://it.wikipedia.org/wiki/Micronesia","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Micronesia-large.png","page_title":"Micronesia","context_page_description":"La Micronesia è una delle macroregioni in cui tradizionalmente viene divisa l'Oceania. A questa ripartizione tradizionale dell'Oceania utilizzata anche dalle Nazioni Unite per dividere il mondo in macroregioni, i ricercatori preferiscono la moderna divisione in due sole regioni: l'Oceania vicina e l'Oceania lontana di cui la Micronesia fa parte."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D0%B0%D1%88%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Tashky_gerb.png","page_title":"Ташки","context_page_description":"Та́шки, Ташків — село в Україні, у Славутському районі Хмельницької області. Населення становить 231 осіб. Орган місцевого самоврядування — Цвітоська сільська рада."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A8%D8%A7%D8%A8%D9%84%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Pablo_Nascimento_Castro_%28cropped%29.jpg","page_title":"بابلو","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nبابلو لاعب كورة قدم من برازيل."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Rozavlea","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/RozaliaFotoThalerTamasDSC07009.JPG","page_title":"Rozavlea","context_page_description":"Rozavlea sī Romania Maramureş Koān ê chi̍t ê chū-tī-thé."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%B6%AD%E6%9B%BC%E9%BB%98%E5%AE%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Vimanmek_Mansion.JPG","page_title":"維曼默宮","context_page_description":"维曼默宫，又名泰王五世行宫，是泰国先王拉玛五世、拉玛六世的王宫，现址在曼谷的律实县，旧址则在春武里府的西昌岛之上。\\n整个王宫以金桃花木作为主要材料，有许多精雕细刻之处，虽夏仍凉。\\n在1893年的河口纷争事件中，法军一度为封锁泰国的出海口，占据了西昌岛。事件平息之后，法军撤离，泰王复归，然而好景已不再，所以此后甚少回来。1925年拉玛六世驾崩，此宫逐渐荒废。\\n到了1982年，诗丽吉王后看到这个古建筑的历史价值，命令依照原样重建于曼谷的律实县，一年后即重见天日。直到今天，她每年接待数以千计的各国游人。\\n凭曼谷大王宫门票，可以参观泰王五世行宫。"},{"page_url":"https://en.wikipedia.org/wiki/Fontane_di_Piazza_Farnese","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Thermae_of_Caracalla_Pool_at_Piazza_Farnese.jpg","page_title":"Fontane di Piazza Farnese","context_page_description":"The Fontane della Piazza Farnese are two identical decorative fountains located in the Piazza Farnese, in front of the Palazzo Farnese in Rome, Italy. They were placed in the Piazza in the 16th century.\\nThe granite stone basins of the fountains are believed to come from the ancient Roman Baths of Caracalla. The emblems on the upper part of the fountain are those of the Farnese family, and the builder of the Palazzo, Cardinal Alessandro Farnese, later Pope Paul III."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Lenoir_County,_North_Carolina","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Hotel_Kinston.JPG","page_title":"National Register of Historic Places listings in Lenoir County, North Carolina","context_page_description":"This list includes properties and districts listed on the National Register of Historic Places in Lenoir County, North Carolina. Click the \\"Map of all coordinates\\" link to the right to view an online map of all properties and districts with latitude and longitude coordinates in the table below."},{"page_url":"https://hr.wikipedia.org/wiki/Danje_paun%C4%8De","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Chenille_2-052006.JPG","page_title":"Danje paunče","context_page_description":"Danje paunče je leptir iz porodice šarenaca, rasprostranjen po gotovo cijeloj Europi, preko Grčke do Azije i Japana. Može ih se sresti sve do visina od 2 500 m u vrlo različitim staništima, od prozračnih šuma, do parkova i vrtova."},{"page_url":"https://de.wikipedia.org/wiki/INF-Vertrag","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0f/INF-FacilitiesUSSR.jpg","page_title":"INF-Vertrag","context_page_description":"Der INF-Vertrag oder Mittelstrecken-Nuklearstreitkräfte-Vertrag oder Washingtoner Vertrag über nukleare Mittelstreckensysteme bezeichnet ein Bündel bilateraler Verträge und Vereinbarungen zwischen den USA und der UdSSR / Russland über die Vernichtung aller boden-/landgestützten Flugkörper mit mittlerer und kürzerer Reichweite.\\nDer Vertrag wurde am 8. Dezember 1987 anlässlich des Gipfeltreffens von Washington unterzeichnet und nach Ratifizierung am 1. Juni 1988 während des Gipfeltreffens in Moskau in Kraft gesetzt.\\nEr wurde auf unbeschränkte Dauer geschlossen, ist jedoch seit dem 2. August 2019 außer Kraft gesetzt."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8B%E3%83%83%E3%82%B5%E3%83%B3%E3%83%BB%E3%83%A2%E3%83%BC%E3%82%BF%E3%83%BC%E3%82%B9%E3%83%9D%E3%83%BC%E3%83%84%E3%83%BB%E3%82%A4%E3%83%B3%E3%82%BF%E3%83%BC%E3%83%8A%E3%82%B7%E3%83%A7%E3%83%8A%E3%83%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Nissan_FAIRLADY_Z_NISMO_%28CBA-Z34%29_front.JPG","page_title":"ニッサン・モータースポーツ・インターナショナル","context_page_description":"ニッサン・モータースポーツ・インターナショナル株式会社は、日産自動車の連結子会社でモータースポーツ向け自動車部品の設計・製造・販売、レースへの参画などを行う会社。通称・愛称はニスモ 。主に日産車をベースに改造を施し販売を行うほか、独自のオーダーにも対処してくれる。1984年に日産のワークス・チームの一つである大森ワークスを母体に設立された。2013年1月をもって本社を東京都品川区から神奈川県横浜市鶴見区に移転した。"},{"page_url":"https://es.wikipedia.org/wiki/Catedral","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Museo_de_la_Catedral_Metropolitana%2C_Badajoz_%28ES%29_-_panoramio.jpg","page_title":"Catedral","context_page_description":"Una catedral es un templo cristiano, donde tiene sede o cátedra el obispo, siendo así la iglesia principal de cada diócesis o Iglesia particular. La sede o cátedra episcopal es el lugar desde donde cada obispo preside la comunidad cristiana, enseñando la vida de fe y la doctrina de la Iglesia.\\nLa iglesia cristiana ortodoxa se refiere a sus catedrales como gran iglesia, aunque suele traducirse como catedral."},{"page_url":"https://de.wikipedia.org/wiki/Herzogtum_Siewierz","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Ksi%C4%99stwo_siewierskie_COA.svg","page_title":"Herzogtum Siewierz","context_page_description":"Das Herzogtum Siewierz entstand 1330 durch Teilung des schlesischen Herzogtums Beuthen, das von den Schlesischen Piasten regiert wurde. Residenz der Herzöge war die Stadt Siewierz. Sie lag zwischen der Brynica im Westen und der oberen Warthe und der Schwarzen Przemsa im Osten und hatte eine Fläche von 679 km², 1/3 größer als Andorra, mit dem es manchmal in der Literatur verglichen wurde."},{"page_url":"https://nl.wikipedia.org/wiki/Taifa_Ronda","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Taifas2.gif","page_title":"Taifa Ronda","context_page_description":"De taifa Ronda was een emiraat in de regio Andalusië in het zuiden van Spanje. De stad Ronda was de hoofdplaats van de taifa. De taifa kende een onafhankelijke periode van 1039 tot 1065, na de val van het kalifaat Córdoba. Het was ontstaan uit de kurah Takoronna.\\nDe taifa werd door de familie Banu Ifran van de Berberstam Zenata gesticht. Deze familie kwam van oorsprong uit de omgeving van Tlemcen, Algerije."},{"page_url":"https://es.wikipedia.org/wiki/Citizens_Bank_Park","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b9/Ct900.jpg","page_title":"Citizens Bank Park","context_page_description":"Citizens Bank Park es un parque de béisbol con sede en Filadelfia, dentro del South Philadelphia Sports Complex. Es el hogar de los Philadelphia Phillies, una franquicia de la Major League Baseball. Es comúnmente conocido por los lugareños simplemente como \\"The Bank\\" o \\"CBP\\". Abrió sus puertas el 3 de abril de 2004, y llevó a cabo su primer juego de béisbol de la temporada regular el 12 de abril del mismo año, con una derrota de los Phillies ante los Cincinnati Reds, 4-1.\\nEl estadio fue construido para reemplazar al ahora demolido Veterans Stadium, y cuenta con césped natural y campo de tierra de juego, también cuenta con una serie de puestos de comida al estilo Filadelfia, incluyendo varios que sirven Cheesesteak, hoagies, y otras especialidades regionales. El estadio se encuentra en la esquina noreste del complejo deportivo, que incluye el Lincoln Financial Field, Wells Fargo Center y XFINITY Live!. La capacidad del estadio es de 43.651 asientos."},{"page_url":"https://de.wikipedia.org/wiki/Weliko_Tarnowo","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Morning_view_of_Tsarevets.jpg","page_title":"Weliko Tarnowo","context_page_description":"Weliko Tarnowo oder Tarnowo, seltener auch Tirnovo ist eine Stadt in Bulgarien mit etwa 68.000 Einwohnern. Sie ist Verwaltungssitz der gleichnamigen Oblast sowie der Gemeinde Weliko Tarnowo. Das Oberzentrum liegt im nördlichen Teil des Balkangebirges an der Jantra. Weliko Tarnowo war Hauptstadt des Zweiten Bulgarischen Reiches. Die Stadt ist ein wichtiger Verkehrsknoten an der bulgarischen Nord-Süd-Route; sie verfügt über den Flughafen Gorna Orjachowiza; sie trägt Züge einer Industriestadt, ist aber auch ein kulturelles Zentrum mit Hochschulen, Theater, Gemäldegalerie und Museen."},{"page_url":"https://cs.wikipedia.org/wiki/Mnichov","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Allianz_arena_golden_hour_Richard_Bartz.jpg","page_title":"Mnichov","context_page_description":"Mnichov je hlavní město Bavorska, které leží v podhůří Alp na řece Isar a s 1,4 miliony obyvatel je to třetí největší město v Německu.\\nVýznamná průmyslová, dopravní, finanční i kulturní aglomerace s mnoha vysokými školami i kostely, je sídlem arcibiskupa a řady muzeí a galerií. Patří k nejbohatším a nejrychleji se rozvíjejícím městům v Německu.\\nVe městě sídlí jeden z nejlepších fotbalových klubů Bayern Mnichov."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Paris_M%C3%A9tro_stations","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Metro-Paris-Ligne-1-station_Argentine_01.jpg","page_title":"List of Paris Métro stations","context_page_description":"The following is a list of all stations of the Paris Métro, sorted by lines."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A8%E3%83%8F%E3%83%B3%E3%83%BB%E3%82%A2%E3%83%B3%E3%83%96%E3%83%AD%E3%82%B8%E3%82%A6%E3%82%B9%E3%83%BB%E3%83%90%E3%83%83%E3%83%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Johann_Ambrosius_Bach.jpg","page_title":"ヨハン・アンブロジウス・バッハ","context_page_description":"ヨハン・アンブロジウス・バッハ は、ドイツの音楽家。\\nクリストフ・バッハ の息子としてドイツのエアフルトに生まれた。双子の兄弟にヨハン・クリストフ・バッハ がいる。アンブロジウスはエアフルトでヴァイオリン奏者として働いた後、1671年よりテューリンゲン州アイゼナハで地元の町楽師兼宮廷音楽家を務め、更にラッパ手となって町の笛吹きと呼ばれた。1668年4月1日に、エアフルトの毛皮加工職人の娘であるマリア・エリーザベト・レンマーヒルトと結婚し彼女との間には8人の子供が生まれたが、その中の4人が後に音楽家となった。その一人に大バッハとして有名なヨハン・ゼバスティアン・バッハがいる。 1695年2月20日にアイゼナハで他界した。\\nアンブロジウスは音楽家としてはそれほど名を残していないが、J.S.バッハの父親であることと、当時のドイツで著名を博していた作曲家・オルガニストのヨハン・パッヘルベルと親交があったことで知られている。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D1%83%D1%86%D1%8C%D0%BA%D0%B0_%D0%B1%D1%80%D0%B0%D0%BC%D0%B0_(%D0%94%D1%83%D0%B1%D0%BD%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/%D0%9B%D1%83%D1%86%D1%8C%D0%BA%D0%B0_%D0%B1%D1%80%D0%B0%D0%BC%D0%B0._%D0%94%D1%83%D0%B1%D0%BD%D0%BE.jpg","page_title":"Луцька брама (Дубно)","context_page_description":"Луцька брама — пам'ятка оборонної архітектури в місті Дубно по вулиці Данила Галицького 32. Зведена при старому гостинці на Луцьк, відігравала роль центральної ланки в оборонній системі міста.\\nРідкісний зразок оборонної споруди — барбакана, що ніде в Україні, крім Волині, не зустрічається. Схожа до інших робіт архітектора Якуба Мадлайна — Луцької і Татарської брам у Острозі."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Radebeul-Niederl%C3%B6%C3%9Fnitz_(A%E2%80%93L)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Radebeul_Badhotel.jpg","page_title":"Liste der Kulturdenkmale in Radebeul-Niederlößnitz (A–L)","context_page_description":"Die Liste der Kulturdenkmale in Radebeul-Niederlößnitz (A–L) gibt eine Übersicht über die Kulturdenkmale im Stadtteil Niederlößnitz der sächsischen Stadt Radebeul anhand des Stands der Denkmalliste vom 24. Mai 2012. Aufgrund der Größe der Liste wurden die Straßen auf zwei Teile verteilt.\\nEine weitere Liste zeigt ehemalige Bau- / Kulturdenkmale dieses Stadtteils.\\nEinen Überblick über die Radebeuler Kulturdenkmale gibt die Liste der Kulturdenkmale in Radebeul, eine Zusammenfassung aller Adressen mit Kulturdenkmalen gibt die Liste der Kulturdenkmaladressen in Radebeul. Die Zuordnung der Straßen zum Stadtteil findet sich in der Liste der Straßen und Plätze in Radebeul-Niederlößnitz.\\nGrundlage der Auflistung sind die angegebenen Quellen. Diese Angaben ersetzen nicht die rechtsverbindliche Auskunft der zuständigen Denkmalschutzbehörde."},{"page_url":"https://en.wikipedia.org/wiki/Terminator_(solar)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Keeler_crater_AS13-60-8635.jpg","page_title":"Terminator (solar)","context_page_description":"A terminator or twilight zone is a moving line that divides the daylit side and the dark night side of a planetary body. A terminator is defined as the locus of points on a planet or moon where the line through its parent star is tangent. An observer on the terminator of such an orbiting body with an atmosphere would experience twilight due to light scattering by particles in the gaseous layer."},{"page_url":"https://pt.wikipedia.org/wiki/Aquecimento_global","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/NWS-NOAA_Europe_Extreme_maximum_temperature_2015_Sum.png","page_title":"Aquecimento global","context_page_description":"Aquecimento global é o processo de aumento da temperatura média dos oceanos e da atmosfera da Terra causado por massivas emissões de gases que intensificam o efeito estufa, originados de uma série de atividades humanas, especialmente a queima de combustíveis fósseis e mudanças no uso da terra, como o desmatamento, bem como de várias outras fontes secundárias. Essas causas são um produto direto da explosão populacional, do crescimento econômico, do uso de tecnologias e fontes de energia poluidoras e de um estilo de vida insustentável, em que a natureza é vista como matéria-prima para exploração. Os principais gases do efeito estufa emitidos pelo homem são o dióxido de carbono e o metano. Esses e outros gases atuam obstruindo a dissipação do calor terrestre para o espaço. O aumento de temperatura vem ocorrendo desde meados do século XIX e deverá continuar enquanto as emissões continuarem elevadas.\\nO aumento nas temperaturas globais e a nova composição da atmosfera desencadeiam alterações importantes em virtualmente todos os sistemas e ciclos naturais da Terra."},{"page_url":"https://sv.wikipedia.org/wiki/Heda_kyrka","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Heda_kyrka_statue01.jpg","page_title":"Heda kyrka","context_page_description":"Heda kyrka är en kyrkobyggnad i Heda socken i Ödeshögs kommun, Östergötland. Den ligger 8 km norr om Ödeshög. Heda kyrka ligger i en jordbruksbygd söder om Tåkern med rikligt med fornlämningar. Kyrkan är i romansk stil med massiva murar, små rundbågade fönster och trubbigt torn. Av den ursprungliga romanska kyrkan återstår delar av södra långhusmuren och västtornets nedre våningar."},{"page_url":"https://de.wikipedia.org/wiki/L%C3%BCbtheen","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/L%C3%BCbtheen_Denkmal_1914-18.jpg","page_title":"Lübtheen","context_page_description":"Lübtheen ist eine Landstadt im Landkreis Ludwigslust-Parchim in Mecklenburg-Vorpommern. Sie liegt in der Metropolregion Hamburg und erfüllt für ihre Umgebung die Funktionen eines Grundzentrums. Sie trägt den Beinamen „Lindenstadt“."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_Lib%C4%9B%C5%A1ic%C3%ADch_(okres_Louny)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Z%C3%A1mek_L%C3%AD%C4%8Dkov.JPG","page_title":"Seznam kulturních památek v Liběšicích (okres Louny)","context_page_description":"Tento seznam nemovitých kulturních památek v obci Liběšice v okrese Louny vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu."},{"page_url":"https://fi.wikipedia.org/wiki/F%C3%A4rsaarten_historia","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Faroe_map_1673_by_lucas_debes.png","page_title":"Färsaarten historia","context_page_description":"Färsaarten historian on oletettu alkaneen viikinkien asuttamisesta, mutta vuonna 2013 julkaistujen tutkimustulosten mukaan Färsaaret asutettiin todennäköisesti jo 300–500 vuotta aikaisemmin, 300–500-luvuilla. Norjalaiset saapuivat Färsaarille 800-luvulla, mutta esimerkiksi Pyhän Brendanin väitetään käyneen saarilla vuosien 560–567 aikana. Ensimmäiset norjalaiset olivat uutta maata etsimässä olleita tai sortoa paenneita maanviljelijöitä ja talonpoikia. Färsaarille kotiutui nopeasti norjalainen hallintojärjestelmä, ja saarista tuli vuonna 1035 virallisesti osa Norjan kuningaskuntaa.\\nTanska ja Norja yhdistyivät 1380, jolloin saarille levisi tanskalainen oikeuskäytäntö ja paikallisen tingin merkitys väheni. Färsaarten taloutta hallitsivat pitkään ulkomaalaiset kauppiaat, joille Tanska antoi saarten kauppamonopolin. Harvinainen poikkeus oli färsaarelainen Magnus Heinason, joka hallitsi saarten taloutta 1500-luvun lopulla. Tanskan kruunu otti monopolin haltuunsa vuonna 1707. Saaret säilyivät Tanskalla vuoden 1814 jälkeen, vaikka Ruotsi-Norjan unioni korvasi Tanskan ja Norjan liiton."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A5%D0%B8%D0%BC%D0%B0%D0%BB%D0%B0%D1%98%D1%81%D0%BA%D0%B8_%D0%B1%D0%BE%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Pinus_wallichiana_01.jpg","page_title":"Хималајски бор","context_page_description":"Хималајски бор је високи зимзелени четинар из рода борова. У литератури се још може срести и под називима бутански бор, плави бор или хималајски бели бор."},{"page_url":"https://de.wikipedia.org/wiki/Victor_Klemperer","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Gedenktafel_Weimarische_Str_6a_Vicktor_Klemperer.JPG","page_title":"Victor Klemperer","context_page_description":"Victor Klemperer war ein deutscher Literaturwissenschaftler, Romanist und Politiker. Zu seiner Bekanntheit über die Fachgrenzen hinaus trugen neben seiner Abhandlung LTI – Notizbuch eines Philologen vor allem seine ab 1995 unter dem Titel Ich will Zeugnis ablegen bis zum letzten herausgegebenen Tagebücher bei, in denen er akribisch seine Alltagserfahrungen im Zeichen der Ausgrenzung als intellektueller protestantischer Konvertit jüdischer Herkunft aus der deutschen Gesellschaft in der Zeit des Nationalsozialismus dokumentierte. Darüber hinaus vermitteln die Bände Curriculum Vitae, Leben sammeln, nicht fragen wozu und warum und So sitze ich denn zwischen allen Stühlen ein intensives Bild von Klemperers Blick auf die Zeit des Deutschen Kaiserreichs, der Weimarer Republik sowie der Deutschen Demokratischen Republik. Klemperer kann damit als einer der wichtigsten Chronisten des Lebens eines Überlebenden des Holocaust durch die deutschen Nationalsozialisten gelten; daneben aber auch als Zeitzeuge der Jahre vor und nach der Zeit des Nationalsozialismus. Im Jahr 1950 wurde er als Vertreter des Kulturbundes Abgeordneter der Volkskammer der DDR."},{"page_url":"https://de.wikipedia.org/wiki/Altona_(Victoria)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/Altona_VIC_mural-historical2006.JPG","page_title":"Altona (Victoria)","context_page_description":"Altona ist ein Vorort von Melbourne in Australien, ca. 13 km südwestlich des Stadtzentrums von Melbourne. Ihre Local Government Area ist die Stadt Hobsons Bay. Bei der Volkszählung 2011 wurde eine Bevölkerung von 9.918 festgestellt.\\nAltona ist ein großer Vorort mit lockerer Wohnbebauung im Südosten und einem Industriegebiet im Nordwesten. Eine herausragende Einrichtung ist Altona Beach am Ufer der Port-Phillip-Bucht, einer von nur zwei Stränden für Schwimmer in den westlichen Vororten Melbournes.\\nAltona erhielt seinen Namen von der damals noch selbständigen deutschen Stadt Altona, heute ein Stadtbezirk von Hamburg."},{"page_url":"https://fr.wikipedia.org/wiki/Judith_Bunting","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Judith_Bunting.png","page_title":"Judith Bunting","context_page_description":"Judith Bunting, née le 27 novembre 1960, est une femme politique et productrice de télévision britannique.\\nEn 2019, elle est élue députée européenne du parti des Libéraux-démocrates."},{"page_url":"https://fi.wikipedia.org/wiki/Harmony","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Harmony_node_in_Space_Shuttle_Discovery%27s_payload_bay.jpg","page_title":"Harmony","context_page_description":"Harmony on Kansainvälisen avaruusaseman seitsemäs kiertoradalle viety moduuli. Se on toinen kaikkiaan kolmesta yhdysmoduulista."},{"page_url":"https://ast.wikipedia.org/wiki/Amberd","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/DSCF2563-2.jpg","page_title":"Amberd","context_page_description":"Amberd ye'l nome dau a una fortaleza armenia del sieglu VII allugada a 2300 metros sobre'l nivel de la mar, nes fasteres del Monte Aragats na confluyencia de los ríos Arkashen y Amberd de la provincia d'Aragatsotn, n'Armenia."},{"page_url":"https://vi.wikipedia.org/wiki/Teucrium_gnaphalodes","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Teucrium_polium_ssp_gnaphalodes_2.JPG","page_title":"Teucrium gnaphalodes","context_page_description":"Teucrium gnaphalodes là một loài thực vật có hoa trong họ Hoa môi. Loài này được L'Hér. miêu tả khoa học đầu tiên năm 1788."},{"page_url":"https://it.wikipedia.org/wiki/Genio_militare_(storia_romana)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/95/Saalburg_-_Haupteingang_2009.jpg","page_title":"Genio militare (storia romana)","context_page_description":"Il Genio militare in epoca romana, fu un corpo formato da ingegneri, architetti, geometri, falegnami, fabbri, la cui funzione era di dare un supporto tecnico alle armate repubblicane e imperiali romane, nel dirigere i lavori durante la costruzione di opere di ingegneria militare. I semplici soldati costituivano invece la manovalanza necessaria per la realizzazione delle costruzioni.\\nIl compito principale del genio era, pertanto, quello di fornire un adeguato supporto tecnico alle unità combattenti negli spostamenti, nelle operazioni d'assedio di città nemiche, nella realizzazione di opere a protezione dei confini provinciali, fino alla costruzione di opere civili in tempo di pace."},{"page_url":"https://it.wikipedia.org/wiki/Quartieri_di_Matera","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Spine_Bianche_Matera.jpg","page_title":"Quartieri di Matera","context_page_description":"I quartieri di Matera sono le suddivisioni della città lucana.\\nOltre al centro storico, comprendono i rioni sorti nella città lucana, in seguito alla Legge n. 619 del 17 maggio 1952 e altre leggi successive, con le quali veniva disposto lo sfollamento dei Sassi di Matera e la costruzione di nuovi rioni nella cosiddetta città del piano dove furono inizialmente trasferiti gli abitanti dei Sassi, e dove in seguito ha avuto luogo l'espansione demografica della città."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D1%83%D0%BA%D1%83%D0%B2%D0%B8%D1%98%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Ceylon_Bay_Owl_Abhilash_Arjunan.jpg","page_title":"Кукувије","context_page_description":"Кукувије једна су од две породице птица из реда сова, при чему је друга праве сове. Разликују се од осталих сова по томе што имају фацијални диск срцастог облика, за разлику од округлог фацијалног диска типичних сова. Оне имају дуге, јаке ноге са моћним канџама. Оне се разликују од породице Strigidae по структурним детаљима, посебно у погледу грудне кости и стопала.\\nКукувије су породица широког опсега, мада нису присутне у Северној Америци, Сахарској Африци, и великим деловима Азије. Оне живе у широком опсегу хабитата од пустиња до шума, и од умерених латитуда до тропа. Већина од двадесет постојећих врста кукувија је мало позната. Неке, као што је мадагаскарска кукувија, једва да су виђене или проучаване од њиховог открића, за разлику од уобичајене кукувије, која је једна од најбоље познатих врста на свету. Међутим, могуће је да неке подврсте обичне кукувије заслужују да буду одвојене врсте, али су веома мало о њима зна.\\nПет врста кукувије је угрожено, и неке од острвских врста су изумрле током холоцена или раније. Кукувије су углавном ноћне животиње, и генерално нису миграторне. Оне живе у паровима или појединачно."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B8%8C%E6%96%AF%E7%BE%85%E6%A9%9F%E5%A0%B45%E8%99%9F%E8%88%AA%E7%AB%99%E6%A8%93%E7%AB%99","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/75/Heathrow_Terminal_5_express_sign.JPG","page_title":"希斯羅機場5號航站樓站","context_page_description":"希斯洛機場第五航廈站是一個位於希斯洛機場的機場鐵路車站，此站於2008年3月27日投入服務。\\n跟第四航廈站及第二、三航廈站不同的是，此站是由希斯洛機場快線的職員負責。此站位於倫敦第6收費區，是倫敦界限中最西端的地下車站。\\n此站的部分屋頂採用了透明的氟塑膜積層板，因此即使此站設於地下，六個月台的兩邊末端還是會有陽光進入。\\n第五航廈站的服務路線如下:\\n皮卡迪利線：希斯洛支線的一半列車會以此站作為終點站，途經赫頓十字和第二、三航廈。另外一半則途經赫頓十字、第四航廈、第二、三航廈，然後返回赫頓十字。該批列車不停靠此站。\\n希斯洛機場快線：終點站。此服務取代了原來經過第四航廈的機場快線服務，而第四航廈則成為希斯洛列車的終點站。"},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A3%E0%B8%B2%E0%B8%A2%E0%B8%81%E0%B8%B2%E0%B8%A3%E0%B8%AA%E0%B8%B8%E0%B8%A3%E0%B8%B4%E0%B8%A2%E0%B8%B8%E0%B8%9B%E0%B8%A3%E0%B8%B2%E0%B8%84%E0%B8%B2%E0%B8%97%E0%B8%B5%E0%B9%88%E0%B8%A1%E0%B8%AD%E0%B8%87%E0%B9%80%E0%B8%AB%E0%B9%87%E0%B8%99%E0%B9%84%E0%B8%94%E0%B9%89%E0%B8%88%E0%B8%B2%E0%B8%81%E0%B8%9B%E0%B8%A3%E0%B8%B0%E0%B9%80%E0%B8%97%E0%B8%A8%E0%B9%84%E0%B8%97%E0%B8%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/SE1934Feb14T.png","page_title":"รายการสุริยุปราคาที่มองเห็นได้จากประเทศไทย","context_page_description":"นี่คือรายการสุริยุปราคาที่มองเห็นได้จากประเทศไทย โดยอ้างอิงขอบเขตตามอาณาเขตของประเทศไทยในปัจจุบัน ตั้งแต่ปี พ.ศ. 2300 จนถึงปี พ.ศ. 2700\\nสุริยุปราคาคือเหตุการณ์ที่เกิดขึ้นเมื่อดวงอาทิตย์ ดวงจันทร์ และโลกโคจรมาอยู่ในแนวเดียวกันพอดี ทำให้เงาของดวงจันทร์ทอดลงมาบนพื้นผิวโลก เป็นเงามืดและเงามัว เงามืดคือบริเวณแคบ ๆ ของเงาที่ทอดผ่านไปบนผิวโลก ภายในเงามืด ดวงจันทร์จะปรากฏทับซ้อนกับดวงอาทิตย์พอดี ทำให้ผู้ที่สังเกตการณ์อยู่ในบริเวณนี้จะสังเกตเห็นสุริยุปราคาเต็มดวง สุริยุปราคาวงแหวน หรือสุริยุปราคาผสม ส่วนเงามัวจะทอดตัวล้อมรอบเงามืด และทอดตัวยาวนับพันกิโลเมตร ผู้ที่สังเกตการณ์อยู่ในบริเวณเงามัวจะสังเกตเห็นเป็นสุริยุปราคาบางส่วน"},{"page_url":"https://de.wikipedia.org/wiki/Ersen_Martin","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Ersen_Martin.jpg","page_title":"Ersen Martin","context_page_description":"Ersen Martin ist ein ehemaliger deutsch-türkischer Fußballspieler. Durch seine dreijährige Tätigkeit für Denizlispor wird er häufig mit diesem Verein assoziiert. Mit über 100 Einsätzen und wichtigen Toren für Denizlispor gehört er zu der Liste mit den meisten Einsätzen der Vereinsgeschichte. Auf Fan- und Vereinsseiten wird er als einer der bedeutendsten Spieler der Vereinsgeschichte aufgefasst."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%99%BD%E9%BC%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Mustela_erminea_upright.jpg","page_title":"白鼬","context_page_description":"白鼬為鼬科鼬屬的動物。"},{"page_url":"https://qu.wikipedia.org/wiki/Rimaq_distritu","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0a/District_sign_Peru_Lima_R%C3%ADmac.jpg","page_title":"Rimaq distritu","context_page_description":"Rimaq distritu nisqaqa huk distritum Lima pruwinsyapi, Piruw mama llaqtapi."},{"page_url":"https://en.wikipedia.org/wiki/Radial_Road_8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Quezon_Boulevard_-_near_Plaza_Miranda_%28Quiapo%2C_Manila%3B_2016-12-31%29.jpg","page_title":"Radial Road 8","context_page_description":"Radial Road 8, more commonly referred to as R-8, is a network of roads and bridges that altogether form the eighth radial road of Manila in the Philippines. It runs north-south through northern Metro Manila linking the City of Manila with Quezon City, Caloocan, and Valenzuela into the northern provinces of Bulacan, Pampanga, Tarlac, Pangasinan, and La Union. The portion of R-8 between Guiguinto and Balintawak is also designated a component of the Pan-Philippine Highway network. It also has a spur segment in Quirino Highway from NLEX to its junction with R-7 at Commonwealth Avenue, both in Quezon City."},{"page_url":"https://en.wikipedia.org/wiki/Arachnographa_micrastrella","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Arachnographa_micrastrella1.jpg","page_title":"Arachnographa micrastrella","context_page_description":"Arachnographa micrastrella is a moth of the family Oecophoridae. It is known from New South Wales, Queensland and Victoria.\\nAdults have rusty brown forewings with a central white dot and a thin gray diagonal stripe across the margin.\\nThe larvae feed on the green leaves or branchlets of Exocarpos cupressiformis, Hakea species and introduced Juniperus species and Pinus species. They tie green branchlets or leaves with silk."},{"page_url":"https://en.wikipedia.org/wiki/Castrillo_de_Riopisuerga","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Church_of_Saint_Bartholomew_%28Castrillo_de_Riopisuerga%29_010.jpg","page_title":"Castrillo de Riopisuerga","context_page_description":"Castrillo de Riopisuerga is a municipality located in the province of Burgos, Castile and León, Spain. According to the 2004 census, the municipality has a population of 87 inhabitants. Sites of interest include Lock 10 of the Canal de Castilla and the Church of St. Bartholomew."},{"page_url":"https://pl.wikipedia.org/wiki/Las_Bemowski","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Kocanki_piaskowe_kwiatostan_wsr_Las_Bemowski.jpg","page_title":"Las Bemowski","context_page_description":"Las Bemowski – las leżący w zachodniej części Bemowa oraz w gminie Stare Babice, częściowo podmokły, odwadniany przez przeważnie uregulowane drobne cieki wodne oraz kanały. Na jego terenie zlokalizowane są dwa rezerwaty: Łosiowe Błota i Kalinowa Łąka oraz plac zabaw, ścieżka zdrowia i „ścieżka łosia”. Znajdują się tu także miejsca do rozpalania ognia i liczne wiaty turystyczne. Niektóre drogi i ścieżki leśne zalewane są w okresie wiosennym przez wodę."},{"page_url":"https://sv.wikipedia.org/wiki/Rufus_Sewell","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Saeulen_der_Erde-Premierenfoto.jpg","page_title":"Rufus Sewell","context_page_description":"Rufus Sewell, född 29 oktober 1967 i Twickenham i sydvästra London, är en brittisk skådespelare. Sewell har medverkat i filmer som Hamlet, The Woodlanders, En kvinnas öde, Dark City, En riddares historia, Den oemotståndliga Martha, Tristan & Isolde och Illusionisten. Han har spelat huvudroller i tv-serier som Middlemarch, Eleventh Hour, The Pillars of the Earth, Charles II: The Power and The Passion och The Man in the High Castle.\\nRufus Sewell har varit gift två gånger och har en son, född 2002."},{"page_url":"https://af.wikipedia.org/wiki/Shirley_Mills","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Shirley_Mills.jpg","page_title":"Shirley Mills","context_page_description":"Shirley Mills was 'n Amerikaanse aktrise. Sy was bekend vir haar rolle in die rolprente Child Bride, The Under-Pup, The Grapes of Wrath, en Betty Co-Ed."},{"page_url":"https://fr.wikipedia.org/wiki/Clermont-Pouyguill%C3%A8s","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Clermont-Pouyguill%C3%A8s_-_Entr%C3%A9e_nord.jpg","page_title":"Clermont-Pouyguillès","context_page_description":"Clermont-Pouyguillès est une commune française située dans le département du Gers en région Occitanie.\\nSes habitants sont appelés les Clermontois."},{"page_url":"https://tr.wikipedia.org/wiki/Leo_Hendrik_Baekeland","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Leo_Hendrik_Baekeland%2C_1916.jpg","page_title":"Leo Hendrik Baekeland","context_page_description":"Leo Hendrik Baekeland, Belçika asıllı Amerikalı kimyacı. 1907'de Bakalit adını verdiği ısıdan etkilenmeyen plastik türünü buldu. Bu madde, daha önce benzeri görülmemiş özelliklere sahip yeni bir madde idi. Fiziksel, kimyasal, elektriksel özellikler açısından avantajlı bir madde idi.\\nLeo Hendrik Baekeland, 1916'da Perkin madalyası, 1940'ta Franklin madalyası ile ödüllendirildi. 1904'te New York'taki Kimaygerler Klubü'nün, 1912'de AIChE'nin ve 1924'te American Chemical Society'nin başkanı idi. Time dergisine kapak oldu. ABD patent ofisi 55 patentini onayladı."},{"page_url":"https://en.wikipedia.org/wiki/Kim_Soo-hyun","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Kim_Soo-hyun_2014_PaekSang_Arts_Awards32_%28cropped%29.jpg","page_title":"Kim Soo-hyun","context_page_description":"Kim Soo-hyun is a South Korean actor best known for his roles in the television dramas Dream High, Moon Embracing the Sun, My Love from the Star, The Producers, It's Okay to Not Be Okay, as well as the films The Thieves, Secretly, Greatly and Real.\\nKim was Gallup Korea's Actor of the Year in 2014. He was first included in the Forbes Korea Power Celebrity list in 2013 placing fourth, and subsequently ranking second in 2015, and fifth in 2016. The business magazine's Asia edition also listed him in its 30 under 30 in 2016. The success of his television dramas throughout Asia established him as a top Hallyu star."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B0%D0%BA%D1%80%D0%BE%D0%BF%D0%BE%D0%B4_%D0%B7%D0%B2%D0%B8%D1%87%D0%B0%D0%B9%D0%BD%D0%B8%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Spawn_hatched_with_malefish.JPG","page_title":"Макропод звичайний","context_page_description":"Макропо́д звича́йний — тропічний прісноводний вид риб з підродини макроподових, родини осфронемових, підряду лабіринтових. В акваріумах відомий також під назвою ра́йська ри́бка.\\nВид був описаний Карлом Ліннеєм ще 1758 року в десятому виданні його знаменитої «Systema Naturae» під назвою Labrus opercularis. Він є першим відомим представником роду макропод. Видова назва opercularis має латинське походження й стосується темної, у світлій облямівці плями на зябрових кришках, присутньої у цього виду."},{"page_url":"https://en.wikipedia.org/wiki/Association_of_African_Air_Forces","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/150915-F-IM453-183.jpg","page_title":"Association of African Air Forces","context_page_description":"The Association of African Air Forces is a voluntary and non-political organization; membership is open to Air Forces or their equivalent within the continent of Africa and the United States of America. The Association is operated with support from the United States Air Forces in Europe - Air Forces Africa; a United States Air Force major command and a component command of both United States European Command and United States Africa Command.\\nAAAF exists as a collaborative, decision-making organization to promote African-led air power initiatives that address trans-national threats, and efficient use of air resources to improve air operations across Africa. During the 5th annual African Air Chief Symposium, AAAF proceedings established that all signatory members \\"have an equal voice within the association, and will be recognized as the air forces or the equivalent service of every other signing country.\\""},{"page_url":"https://en.wikipedia.org/wiki/List_of_oldest_buildings_in_Scotland","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Adam_%26_Eve.JPG","page_title":"List of oldest buildings in Scotland","context_page_description":"In order to qualify for the list a structure must:\\nbe a recognisable building;\\nincorporate features of building work from the claimed date to at least 1.5 metres in height and/or be a listed building.\\nThis consciously excludes ruins of limited height, roads and statues. Bridges may be included if they otherwise fulfill the above criteria. Dates for many of the oldest structures have been arrived at by radiocarbon dating and should be considered approximate.\\nThe main chronological list includes buildings that date from no later than 1199 AD. Although the oldest building on the list is the Neolithic farmhouse at Knap of Howar, the earliest period is dominated by chambered cairns, numerous examples of which can be found from the 4th millennium BC through to the early Bronze Age.\\nEstimates of the number of broch sites throughout the country, which date from the Iron Age, range from just over 100 to over 500. However, only a small percentage are sufficiently well preserved for them to be included here and some of those that could be remain undated."},{"page_url":"https://fr.wikipedia.org/wiki/Femmes_au_Japon","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Kimono_backshot_by_sth.jpg","page_title":"Femmes au Japon","context_page_description":"Les femmes au Japon acquièrent l'égalité après la Seconde Guerre mondiale grâce à la Constitution de 1947 et obtiennent également le droit de vote. Mais elles ne bénéficient toujours pas de l'égalité dans l'éducation et sur le marché du travail. Toutefois, au XXIᵉ siècle, elles rejoignent la population active en nombre croissant et bénéficient de plus d'expériences et de possibilités d'éducation. Pourtant, les Japonaises font toujours face à une culture d'entreprise largement dominée par les hommes."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%A7%DB%8C%DA%88%D9%88%D8%B1%DA%88_%D8%B4%DB%81%DB%8C%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Edward_the_Martyr_-_MS_Royal_14_B_VI.jpg","page_title":"ایڈورڈ شہید","context_page_description":"ایڈورڈ شہید ایڈگر پرامن کا بیٹا اور 975ء سے 978ء میں قتل ہونے تک شاہ انگلستان تھا۔"},{"page_url":"https://hu.wikipedia.org/wiki/T%C3%B6r%C3%B6k_l%C3%ADra","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c4/100_Old_TL_reverse.jpg","page_title":"Török líra","context_page_description":"A líra Törökország, Észak-Ciprus hivatalos fizetőeszköze 2009. január 1. óta. Az új lírát 2009. december 31-én vonták ki. 2009-ben, egy évig a régi és az új török líra együtt volt használatban."},{"page_url":"https://en.wikipedia.org/wiki/Ume%C3%A5_Central_Station","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/81/Ume%C3%A5_Central_Station_tracks.jpg","page_title":"Umeå Central Station","context_page_description":"Umeå Central Station is a railway station in Umeå, Sweden.\\nThe station was the sole station serving Umeå until the opening of Umeå East Station in 2010. Renovation of Central station was completed the following year."},{"page_url":"https://cs.wikipedia.org/wiki/Sokol_Svinov","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/HazenaSvinov_Logo2019x250.png","page_title":"Sokol Svinov","context_page_description":"Sokol Svinov vzniknul v roce 1910. V roce 1922 zde byl založen oddíl národní házené. Dnešní název klubu je TJ Sokol Svinov, předchozí názvy oddílu byly Lokomotiva Svinov, TJ Svinov, Sokol Svinov, TJ Sokol Svinov. Součástí TJ Sokol Svinov je dnes oddíl volejbalu a národní házené. Oddíl TJ Sokol Svinov spadá do moravskoslezské župy spolku Sokol."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AB%E3%83%AB%E3%83%AD%E3%82%B9%E3%83%BB%E3%83%AD%E3%83%9A%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Carlos_Lopes.jpg","page_title":"カルロス・ロペス","context_page_description":"カルロス・アルベルト・デ・ソウザ・ロペスはポルトガルの陸上競技長距離選手である。"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%92%8C%E6%B0%A3%E9%83%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Map_Wake_en%2C.png","page_title":"和氣郡","context_page_description":"和氣郡是位於日本岡山縣東部的一郡。\\n現僅轄有以下1町：\\n和氣町\\n過去的範圍還包括現在的備前市大部分地區、赤磐市南部地區、岡山市東區東部地區以及兵庫縣赤穗市西部地區。"},{"page_url":"https://it.wikipedia.org/wiki/Aeronautica_militare_del_Marocco","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Moroccan_Mirage_F1CH_7.jpg","page_title":"Aeronautica militare del Marocco","context_page_description":"Le Forces royales air, ossia \\"Regie forze aeree\\", spesso abbreviate con la sigla FRA, sono l'aeronautica militare del Marocco e parte integrante delle Regie forze armate."},{"page_url":"https://da.wikipedia.org/wiki/Oplysningstiden","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Gotthold_Ephraim_Lessing.jpg","page_title":"Oplysningstiden","context_page_description":"Oplysningstiden var en periode i Europas historie fra ca. 1690 til ca. 1800. Begrebet \\"oplysning\\" hentyder til, at filosofien og naturvidenskaben udvidede menneskets viden om verden og brugte resultatet til at sætte spørgsmålstegn ved autoriteter som kongemagt og kirke. Begrebet oplysning har siden oldtiden betydet både religiøst og filosofisk klarsyn. \\"Oplysningstid\\" stammer fra Immanuel Kants værk Beantwortung der Frage: Was Ist Aufklärung? fra 1784: \\"Hvis nogen spørger, lever vi i en oplyst tid? ville svaret være Nej vi lever i Oplysningstiden.\\""},{"page_url":"https://fr.wikipedia.org/wiki/Pan%C4%8Devo","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Pancsova_15kreuzer.jpg","page_title":"Pančevo","context_page_description":"Pančevo est une ville de Serbie située dans la province autonome de Voïvodine. Au recensement de 2011, la ville intra muros comptait 76 203 habitants et son territoire métropolitain, appelé Ville de Pančevo, 123 414.\\nLa ville de Pančevo est le centre administratif du district du Banat méridional. Elle est également la capitale économique et culturelle de ce district."},{"page_url":"https://it.wikipedia.org/wiki/Natale_in_Australia","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Sydney_Town_Hall_Christmas_Projections_%2811516686783%29.jpg","page_title":"Natale in Australia","context_page_description":"Questa voce illustra le principali tradizioni natalizie dell'Australia, oltre agli aspetti storici e socio-economici della festa in questo Paese."},{"page_url":"https://en.wikipedia.org/wiki/South_African_locomotive_history","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Class_21E_21-010.jpg","page_title":"South African locomotive history","context_page_description":"In South Africa, as elsewhere in the world, the railways played a huge part in development and growth on nearly all terrains in the country. Conversely, events in South Africa and its neighbours over the years had a huge influence on the development of railways.\\nWhen the articles on the locomotives of South Africa are read sequentially in the order of their years of entering railway service, much of the history of the country becomes apparent between the lines. At the same time, the development of steam locomotives can be followed from the basic 0-4-0 to the mighty 4-8-4 wheel arrangements, and articulated steam locomotives from the Fairlies and the Kitson-Meyer to the Mallets and ultimately to the Garratts. Likewise with the development of modern traction such as electric, gas-electric, diesel-hydraulic, electro-diesel and diesel-electric locomotives.\\nIn addition, the opening dates of new railway lines are shown."},{"page_url":"https://en.wikipedia.org/wiki/Borislav_Kyosev","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Borislav_kiosev.jpg","page_title":"Borislav Kyosev","context_page_description":"Borislav Kyosev is a Bulgarian volleyball player. He competed in the men's tournament at the 1988 Summer Olympics."},{"page_url":"https://fr.wikipedia.org/wiki/Vall%C3%A9e_du_Rh%C3%B4ne_(France)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Iron_Age_Village_-_geograph.org.uk_-_1346279.jpg","page_title":"Vallée du Rhône (France)","context_page_description":"En France, on désigne par vallée du Rhône la région située de part et d'autre du Rhône, en aval de Lyon, dans le sud-est de la France. C'est une région agricole française selon le classement de l'Insee. Elle se subdivise en plaine irriguée de la Crau, plaine maraîchère du Comtat Venaissin, coteaux viticoles produisant des vins AOC de renommée mondiale sur les rives droite et gauche du fleuve, polyculture de la Drôme provençale, grandes cultures de la plaine valentinoise, vergers de l’Isère, prairies des vallées de la Galaure et de l’Herbasse."},{"page_url":"https://es.wikipedia.org/wiki/A_Diogneto","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Marmoutier.jpg","page_title":"A Diogneto","context_page_description":"La epístola o discurso A Diogneto es una obra de la apologética cristiana, escrita, quizás, en las postrimerías del siglo II. Esta pequeña obra, ​​ de apenas doce capítulos, es una pieza singular de la literatura cristiana.​ Es singular por su catalogación, por su origen incierto, por su chocante descubrimiento, por la fatídica destrucción​ del único códice que la contenía.​ Es singular también por su autoría, por los enigmas que plantea, por la originalidad de las teorías de que es objeto. Sobre todo es singular por su belleza​​​ y elegancia, ​ que discurre lejos de la crudeza​ de Taciano, la franqueza​ de Justino, los escarnios de Hermias, ​ la simplicidad​ de Arístides, ​ el fideísmo​ de Teófilo o las filosóficas legaciones de Atenágoras.​ Por su estilo, aunque no tanto por su contenido, A Diogneto se eleva muy por encima de otros escritos de la apologética cristiana.​\\nLo más incomprensible de esta obra es que nadie la conociese antes de su descubrimiento en el siglo XV.​ No existe mención alguna, explícita o implícita, que permita suponer que alguno de los Padres de la Iglesia la leyera, siquiera que tuviese noticia de su existencia.​"},{"page_url":"https://en.wikipedia.org/wiki/Esophageal_cancer","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/UpperGIEsophagealCAMark.png","page_title":"Esophageal cancer","context_page_description":"Esophageal cancer is cancer arising from the esophagus—the food pipe that runs between the throat and the stomach. Symptoms often include difficulty in swallowing and weight loss. Other symptoms may include pain when swallowing, a hoarse voice, enlarged lymph nodes around the collarbone, a dry cough, and possibly coughing up or vomiting blood.\\nThe two main sub-types of the disease are esophageal squamous-cell carcinoma, which is more common in the developing world, and esophageal adenocarcinoma, which is more common in the developed world. A number of less common types also occur. Squamous-cell carcinoma arises from the epithelial cells that line the esophagus. Adenocarcinoma arises from glandular cells present in the lower third of the esophagus, often where they have already transformed to intestinal cell type. Causes of the squamous-cell type include tobacco, alcohol, very hot drinks, poor diet, and chewing betel nut. The most common causes of the adenocarcinoma type are smoking tobacco, obesity, and acid reflux.\\nThe disease is diagnosed by biopsy done by an endoscope. Prevention includes stopping smoking and eating a healthy diet."},{"page_url":"https://it.wikipedia.org/wiki/Governatorati_della_Siria","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a8/Syria-blank-governorates.png","page_title":"Governatorati della Siria","context_page_description":"I governatorati della Siria sono la suddivisione territoriale di primo livello del Paese e sono pari a 14. Ciascuno di essi si suddivide ulteriormente in distretti."},{"page_url":"https://es.wikipedia.org/wiki/Acueducto_de_Slateford","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Slateford_aqueduct2.jpg","page_title":"Acueducto de Slateford","context_page_description":"El Acueducto de Slateford​ es un acueducto navegable en Slateford, en la ciudad de Edimburgo, Escocia. Fue construido por Hugh Baird y se terminó en 1822 con la asesoría de Thomas Telford.\\nCuenta con ocho arcos, posee unos 600 pies de largo y 60 pies de alto, y lleva el canal de la unión a través de Inglis Green Road y el Agua de Leith en Longstone en el suroeste de Edimburgo. El canal corre sobre una curva de nivel de 73 m y es muy popular entre los ciclistas y paseadores."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%B8%8B%E7%94%B0%E5%B8%82%E7%AB%8B%E5%9B%B3%E6%9B%B8%E9%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Shimoda_City_Library_01.jpg","page_title":"下田市立図書館","context_page_description":"下田市立図書館は、静岡県下田市にある公立図書館である。"},{"page_url":"https://sv.wikipedia.org/wiki/Ergotamin","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/94/Ergotamine3.png","page_title":"Ergotamin","context_page_description":"Ergotamin är den mest kända av en serie alkaloider som utvinns ur mjöldryga. Medicinskt används drogen dels vid behandling av migrän, dels inom förlossningsvården och då för att livmodern snabbt ska dra sig samman efter barnets födelse. Ergotamin är en prekursor till LSD.\\nErgotamin gör att blodkärlen drar ihop sig.\\nDet marknadsfördes första gången år 1921 under namnet Gynergen. Idag heter det Ergomar på marknaden."},{"page_url":"https://sv.wikipedia.org/wiki/Onoclea_sensibilis","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Onoclea_sensibilis_02.JPG","page_title":"Onoclea sensibilis","context_page_description":"Onoclea sensibilis är en pärlbräkenväxtart som beskrevs av Carl von Linné.\\nOnoclea sensibilis ingår i släktet Onoclea och familjen Onocleaceae. Utöver nominatformen finns också underarten Onoclea sensibilis interrupta."},{"page_url":"https://de.wikipedia.org/wiki/Baker_River_(Skagit_River)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/BakerRiverMap.jpg","page_title":"Baker River (Skagit River)","context_page_description":"Der Baker River ist ein ca. 48 km langer, südwärts fließender Zuflüss des Skagit River im US-Bundesstaat Washington. Er entspringt im nördlichen Kaskadengebirge, nördlich von Seattle und östlich von Mount Baker. Mit einem Einzugsgebiet von ca. 700 km² in einem breiten und tiefen Tal, teilweise im North Cascades National Park, ist er der letzte große Zufluss des Skagit River, bevor er in die Skagit Bay mündet. Der Fluss fließt in der Nähe seiner Mündung durch Concrete und hat zwei Wasserkraftwerke, welche Puget Sound Energy gehören."},{"page_url":"https://da.wikipedia.org/wiki/Paver%C3%A6kken","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/8-St.Telesphrous.jpg","page_title":"Paverækken","context_page_description":"Dette er en liste over paver, den romersk-katolske kirkes overhoved. Paverækken strækker sig tilbage til apostlen Peter."},{"page_url":"https://en.wikipedia.org/wiki/Festuca_ovina","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/ba/Ruig_schapengras_aartjes_%28Festuca_ovina_subsp._hirtula%29.jpg","page_title":"Festuca ovina","context_page_description":"Festuca ovina, sheep's fescue or sheep fescue, is a species of grass. It is sometimes confused with hard fescue."},{"page_url":"https://de.wikipedia.org/wiki/A_Filetta","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Sidi_Larbi_Cherkaoui_et_A_Filetta.JPG","page_title":"A Filetta","context_page_description":"A Filetta ist eine korsische Vokalgruppe, die 1978 gegründet wurde.\\nMitglieder der Gruppe sind:\\nJean-Claude Acquaviva, François Aragni, Petru Antò Casta, Paul Giansily, Stéphane Serra, Maxime Vuillamier\\nSie zählen neben I Muvrini zu den bekanntesten Vertretern der korsischen Polyphonie, einer Tradition von mehrstimmigen Gesängen, die fast in Vergessenheit geraten war. A Filetta leisteten einen maßgeblichen Beitrag zur Wiederbelebung des korsischen Kulturerbes und sind heute an genreübergreifenden Projekten in den Bereichen Film, Theater, Oper und Tanz beteiligt. Hierbei können die Künstler internationale Auftritte vorweisen.\\nDie Gruppe ist Mitveranstalter der seit 1989 jährlich in Calvi stattfindenden Rencontres de Chants Polyphoniques, einem Treffen von Vokalkünstlern verschiedener Stilrichtungen.\\nSie arbeiten unter anderem mit Bruno Coulais bei Filmmusiken, Sidi Larbi Cherkaoui und Paolo Fresu und Daniele di Bonaventura zusammen."},{"page_url":"https://de.wikipedia.org/wiki/Bezirk_St._P%C3%B6lten-Land","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/AUT_St%C3%B6ssing_COA.png","page_title":"Bezirk St. Pölten-Land","context_page_description":"Der Bezirk St. Pölten, bzw. in älterer Form St. Pölten-Land ist ein Verwaltungsbezirk des Landes Niederösterreich."},{"page_url":"https://nl.wikipedia.org/wiki/Emil_Forsberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Emil_Forsberg_-_der_Aufstiegsfeier_RB_Leipzig_2016.JPG","page_title":"Emil Forsberg","context_page_description":"Emil Forsberg is een Zweeds voetballer die doorgaans dienstdoet als buitenspeler. Hij verruilde Malmö FF in januari 2015 voor RB Leipzig. Forsberg debuteerde in 2014 in het Zweeds voetbalelftal."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D0%BE%D0%B7%D0%B8_(%D0%97%D0%B1%D0%B0%D1%80%D0%B0%D0%B7%D1%8C%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/uk/c/cc/Kharchuk_lozy.jpg","page_title":"Лози (Збаразький район)","context_page_description":"Ло́зи — село в Україні, у Збаразькому районі Тернопільської області. Розташоване на річці Горинь, на півночі району.\\nЦентр сільради, якій підпорядковане село Кривчики. До Лозів приєднано село Суха Лоза, хутори Звіринець і Калантир.\\nНаселення — 594 особи."},{"page_url":"https://nl.wikipedia.org/wiki/Dom_van_Utrecht","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Graftombe_Van_Gendt.JPG","page_title":"Dom van Utrecht","context_page_description":"De Dom van Utrecht is een markante gotische kerk in het midden van de Nederlandse stad Utrecht. De kerk werd vanaf 1254 gebouwd als voortzetting van de romaanse kathedraal van het rooms-katholieke bisdom Utrecht en was gewijd aan Sint-Maarten. Sinds 1580 is de kerk protestants. De 112,32 meter hoge Domtoren is de hoogste kerktoren van Nederland en het hoogste gebouw van Utrecht."},{"page_url":"https://sq.wikipedia.org/wiki/Talini","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Raekoja_plats_%28Tallinn%29.jpg","page_title":"Talini","context_page_description":"Talini është kryeqyteti dhe qyteti më i madh i Estonisë me sipërfaqe prej 159.2 km² dhe popullsi prej 444 085 banorësh. Gjendjet në pjesën veriperëndimore të Estonisë, 80 km më në jug se Helsinki. Qyteti i vjetër i Talinit është një ndër qytetet e vjetra më të ruajtura në Evropë, dhe vizitohet nga më shumë se 1,5 milion turistë çdo vit."},{"page_url":"https://sv.wikipedia.org/wiki/Ashoka","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Maurya_empire_in_265_BCE.jpg","page_title":"Ashoka","context_page_description":"Ashoka, född 304 f.Kr., död 232 f.Kr., tredje monark av Mauryadynastin, sonson till Chandragupta Maurya, son till Bindusara, och Indiens förste kejsare, av Mauryadynastin, 273–232 f.Kr. Det rike som Ashoka styrde över omfattade Indien förutom den sydligaste delen och Sri Lanka. Centrum i riket var Magadha i de nordliga delarna. Ashoka har kommit att ses som en av mest exemplariska regenterna i världshistorien. Symbolen i mitten av Indiens flagga är Ashokas chakra, en speciellt utformad chakra."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D8%A7%D9%84%D9%85%D9%84%D9%88%D9%83_%D8%A7%D9%84%D8%B1%D9%88%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Izbornik.jpg","page_title":"قائمة الملوك الروس","context_page_description":"تضم القائمة التالية كافة حكام روسيا على مدار التاريخ؛ متضمنة كل من حملوا ألقاب أمير نوفغورود، وأمير كێڤ االمعظّم، وأمير ڤلاديمرْ المغظّم، وقيصر كل الروس وإمبراطور عموم روسيا، بداية من الأمير روريك، أمير نوڤگورود، الذي جعل منه التاريخ الروسي شخصية شبه أسطورية أواسط القرن التاسع الميلادي، نهاية بالإمبراطور نيكولاي الثاني، الذي أطاح به البلاشفة في أعقاب ثورة أكتوبر عام 1917.\\nعُرفت الأراضي الشاسعة المعروفة باسم روسيا اليوم بالعديد من الأسماء خلال العصور الغابرة، منها؛ رُسْ ورُسْ كێڤ بالإضافة إلى دوقية موسكو الكبرى، وروسيا القيصرية، والإمبراطورية الروسية، كما استخدم حكام هذه الممالك العديد من الألقاب للإشارة إليهم على مدار التاريخ، ولعل أول تلك الألقاب كانا لقبي نێاز، وڤيليكيێ نێاز، ويعنيان الأمير والأمير الأكبر على الترتيب، وإن تم الاستعاضة عن المُسميات الروسية وإطلاق ألقاب الدوق والدوق الأكبر على حكام هذه المناطق خاصة من جانب الغرب، ثم لقب تزار، وتعني القيصر بالروسية، وهو لقب مساو للقب الملك أو الإمبراطور، حتى أعتُمد لقب الإمبراطور لقبًا رسميًا لحاكم البلاد، في القوت الذي حددت فيه المادة 59 من الدستور الروسي لعام 1906 اللقب الكامل لحاكم البلاد كالتالي:"},{"page_url":"https://ko.wikipedia.org/wiki/%EB%8B%B9%EC%A0%95%EC%97%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Q137229_Dangjeong_A01.jpg","page_title":"당정역","context_page_description":"당정역은 경기도 군포시 당정동에 있는 경부선의 역이다. 부기 역명은 한세대다."},{"page_url":"https://de.wikipedia.org/wiki/Allegorie_der_Liebe","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Angelo_Bronzino_003.jpg","page_title":"Allegorie der Liebe","context_page_description":"Allegorie der Liebe ist ein allegorisches Gemälde des italienischen Malers Agnolo Bronzino.\\nDas Bild hat das Format 146 cm × 116 cm und befindet sich seit 1860 in der National Gallery in London."},{"page_url":"https://hr.wikipedia.org/wiki/Muzej_ruske_fotografije","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Museum_of_the_Russian_Photo_%285%29.jpg","page_title":"Muzej ruske fotografije","context_page_description":"Muzej ruske fotografije – muzej čija je djelatnost usmjerena na rusku fotografiju, a nalazi se u Kolomni. Muzej je utemeljen na inicijativu fotografa Mihaila Golosovskog, Galine Lukjanove i Irine Alikine, te se nalazi u sastavu Muzeja organske kulture. Njihove kolekcije čine osnovni fond muzeja."},{"page_url":"https://cs.wikipedia.org/wiki/Terach","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Terah.jpg","page_title":"Terach","context_page_description":"Terach je biblická postava Starého zákona.\\nJeho otcem je podle bible Náchor. Terach se Náchorovi narodil, když mu bylo 29 let. Terachovým dědečkem byl Serúg.\\nTerach měl tři syny Abrama, Náchora a Hárana.\\nOtec Abrahama Abraham, osmá generace od Sema.\\nProstřednictvím svých synů Abrahama, Nachora a Charana se Terach stal předkem početných kmenů.\\nTerach měl děti teprve od svých 70 let. Abraham je sice uváděn jako první, ale zdá se, že to není proto, že by byl prvorozený, ale proto, že byl z Terachových synů nejproslulejší. Když Terach ve 205 letech zemřel, bylo Abrahamovi teprve 75 let, takže Terachovi muselo být 130 let, když se Abraham narodil. Židovská tradice však dovozuje, že Terach zplodil Abrahama ve svých 70 letech.\\nPodle některých výkladů byla Terachovou dcerou také Sára, Abrahamova manželka.\\nTerachův prvorozený syn byl s největší pravděpodobností Charan, jehož dcera byla v takovém věku, že se mohla provdat za jiného Terachova syna, totiž Nachora.\\nTerach žil v Uru Chaldejců a tam vyrostly jeho děti.\\nZe slov u Jozua 24:2 je patrné, že Terach kdysi neuctíval Jehovu, ale uctíval jiné bohy, možná měsíčního boha Sina, božstvo, jehož uctívání bylo v Uru velmi rozšířeno."},{"page_url":"https://en.wikipedia.org/wiki/Lomatia_myricoides","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Lomatia_myricoides_JBNR2.JPG","page_title":"Lomatia myricoides","context_page_description":"Lomatia myricoides, commonly known as the river lomatia, is a shrub native to New South Wales and Victoria in southeastern Australia."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Jablonec_nad_Nisou","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Lidick%C3%A1_15%2C_Jablonec_nad_Nisou.JPG","page_title":"Liste der denkmalgeschützten Objekte in Jablonec nad Nisou","context_page_description":"Grundlage dieser Liste der denkmalgeschützten Objekte in Jablonec nad Nisou ist die ÚSKP-Liste, die von der tschechischen Denkmalschutzbehörde NPÚ seit 1987 geführt wird und an die seit dem Jahre 1850 geschaffenen Listen anschließt."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E9%A6%99%E6%B8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/St._John%27s_Cathedral%2C_HK_bell_tower.JPG","page_title":"香港","context_page_description":"香港位于南海北岸、珠江口东侧，西隔珠江与澳门及广东省珠海市相望，北接广东省深圳市，南与南海邻接，是中华人民共和国的特别行政区。全境由香港岛、九龙和新界组成；地理环境上则由九龙半岛等大陆土地，以及263个岛屿构成。截至2020年，香港人口约750万人。\\n香港是世界上相当重要的国际金融、工商服务业及航运中心，传统基金会连续二十五年评选香港为全球最自由经济体，但亦止步于此，2020年时仅次于新加坡而得第二。凭治安优良、社会廉洁、税制简单和法律制度健全闻名于世，有“东方之珠”的美誉。在2018年GaWC公布的世界全球都市列表中，香港仅次于伦敦、纽约位列第三。“香港品牌”是一项香港特别行政区政府重点宣传计划，推广香港为“亚洲国际都会”。香港同时为全球首屈一指的安全、经济发达、生活富足、具竞争力、适宜居住以及人均寿命最长的国际大都会。“双普选”、去工业化后的高科技工业转型及贫富悬殊等则为该地主要的社会议题。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A0%E3%83%BC%E3%83%93%E3%83%BC43","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Halle_Berry_11_AA.jpg","page_title":"ムービー43","context_page_description":"『ムービー43』は、2013年にアメリカ合衆国で公開されたインディペンデント系のコメディ・アンソロジー映画。ピーター・ファレリーが共同監督と製作を担当し、ロッキー・ルッソやジェレミー・ソセンコらが脚本を担当した。\\n本作は14篇の異なる物語によって構成され、異なる監督がそれぞれのスケッチのメガホンをとっている。本作でメガホンをとった監督は、エリザベス・バンクス、スティーヴン・ブリル、スティーヴ・カー、ラスティ・カンデッフ、ジェームズ・ダフィ、グリフィン・ダン、パトリック・フォーシュベリ、ジェームズ・ガン、ボブ・オデンカーク、ブレット・ラトナー、ウィル・グラハム、ジョナサン・ヴァン・タルケンである。本作には、ハル・ベリー、ジェラルド・バトラー、アンナ・ファリス、ヒュー・ジャックマン、ジョニー・ノックスヴィル、クリストファー・ミンツ＝プラッセ、ショーン・ウィリアム・スコット、エマ・ストーン、クリスティン・ベル、ケイト・ウィンスレットなどといった多数のスター俳優が出演している。\\n本作の脚本はほとんどのスタジオによってあからさまに拒絶されたため、完成までに丸10年の期間を要した。キャスティングもプロデューサーに対する挑戦とでも呼ぶべきもので、多数のスター俳優が出演していることから撮影には数年を要した。俳優の中にはジョージ・クルーニーのように出演を拒否した者もいたほか、リチャード・ギアのように途中でプロジェクトから去ろうとした者もいた。\\n2013年1月25日にアメリカ合衆国の劇場で公開されると、本作は批評家によって広く酷評された。『シカゴ・サンタイムズ』のリチャード・ローパーは本作を「『市民ケーン』をひどくしたもの」と呼んだ。\\n日本では2013年8月10日にR-15指定で公開され、2014年1月10日にDVD・Blu-rayソフトが発売された。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A7%D0%B5%D0%BC%D0%B1%D0%B0%D0%BB%D0%BE_(%D1%84%D0%BE%D1%80%D1%82%D0%B5%D1%86%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Balaklava_Cembalo_fortress1.JPG","page_title":"Чембало (фортеця)","context_page_description":"Че́мбало — генуезька, пізніше османська фортеця в Криму, пам'ятка архітектури, зараз знаходиться на території міста Балаклави, яке адміністративно є передмістям Севастополя. Ансамбль фортечних споруд розташований на вершині та схилах гори Фортечної. Нині напівзруйнована. Фортеця Чембало — головна історична пам'ятка міста Балаклава."},{"page_url":"https://en.wikipedia.org/wiki/Nipsey_Hussle","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Nipsey_Hussle_%26_Michael_in_the_studio_.jpg","page_title":"Nipsey Hussle","context_page_description":"Ermias Joseph Asghedom, known professionally as Nipsey Hussle, was an American rapper, activist, and entrepreneur. Emerging from the West Coast hip hop scene in the mid-2000s, Hussle independently released his first mixtape, Slauson Boy Volume 1, to moderate local success, which led to him being signed to Cinematic Music Group and Epic Records.\\nHussle became known for his numerous mixtapes, including his Bullets Ain't Got No Name series, The Marathon, The Marathon Continues, and Crenshaw, the last of which rapper Jay-Z bought 100 copies for $100 each. After much delay, his debut studio album Victory Lap was released in 2018 to critical acclaim and commercial success, and was nominated for the Best Rap Album at the 61st Grammy Awards in 2019. Two posthumous Grammy Awards for the songs \\"Racks in the Middle\\" and \\"Higher\\" were awarded to Hussle in the Best Rap Performance and Best Rap/Sung Performance categories, respectively, the next year at the 62nd Grammy Awards."},{"page_url":"https://ceb.wikipedia.org/wiki/Monte_Camino_(bukid_sa_Italya,_Piemonte)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a7/La_vetta_del_monte_Camino.JPG","page_title":"Monte Camino (bukid sa Italya, Piemonte)","context_page_description":"Bukid ang Monte Camino sa Italya. Nahimutang ni sa lalawigan sa Provincia di Biella ug rehiyon sa Piemonte, sa amihanan-kasadpang bahin sa nasod, 500 km sa amihanan-kasadpan sa Rome ang ulohan sa nasod. 2,388 metros ibabaw sa dagat kahaboga ang nahimutangan sa Monte Camino, o 168 ka metros sa ibabaw sa naglibot nga tereyn. Mga 2.7 ka kilometro ang gilapdon sa tiilan niini.\\nAng yuta palibot sa Monte Camino kay kasagaran kabukiran, apan sa habagatang-kasadpan nga kini mao ang kabungtoran. Kinahabogang dapit sa palibot ang Monte Mars, 2,600 ka metros ni kahaboga ibabaw sa dagat, 2.6 km sa habagatan-kasadpan sa Monte Camino. Dunay mga 83 ka tawo kada kilometro kwadrado sa palibot sa Monte Camino medyo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Biella, 12.6 km sa habagatan-sidlakan sa Monte Camino. Hapit nalukop sa kaumahan ang palibot sa Monte Camino. Sa rehiyon palibot sa Monte Camino, kabukiran talagsaon komon.\\nAng klima hemiboreal. Ang kasarangang giiniton 9 °C. Ang kinainitan nga bulan Hulyo, sa 19 °C, ug ang kinabugnawan Disyembre, sa -1 °C. Ang kasarangang pag-ulan 1,358 milimetro matag tuig."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%82%AE%E3%83%8D%E3%82%B9%E3%83%BB%E3%83%87%E3%82%A3%E3%83%BC%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Agyness_Deyn_in_Anna_Sui_Feb_2008%2C_Photographed_by_Ed_Kavishe_for_Fashion_Wire_Press.jpg","page_title":"アギネス・ディーン","context_page_description":"アギネス・ディーンは、イギリスのファッションモデル。次世代のスーパーモデルとして認められており、フランス版『ヴォーグ』から“2000年代のトップモデル30名のうちの1人”の認定を受けている。出生名は“ローラ・ホリンズ”。“アギー”の愛称がある。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AA%E3%83%BC%E3%83%AB_(%E3%83%99%E3%83%AB%E3%82%AE%E3%83%BC)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Lier%2C_Belgium_%3B_Ferraris_Map.jpg","page_title":"リール (ベルギー)","context_page_description":"リールは、ベルギー、アントウェルペン州にある都市及び基礎自治体で、州都アントウェルペンの南東10kmの場所に位置する。ネーテ川が街を流れている。基礎自治体の人口は33,500人である。"},{"page_url":"https://pt.wikipedia.org/wiki/Belo%C5%A1evac","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Selo_Belo%C5%A1evac_-_op%C5%A1tina_Valjevo_-_zapadna_Srbija_-_Pogled_prema_dolini_reke_Kolubare_3.jpg","page_title":"Beloševac","context_page_description":"Beloševac é uma vila da Sérvia localizada no município de Valjevo, pertencente ao distrito de Kolubara. A sua população era de 940 habitantes segundo o censo de 2011."},{"page_url":"https://en.wikipedia.org/wiki/Mule","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Frecklesmule.jpg","page_title":"Mule","context_page_description":"A mule is the offspring of a male donkey and a female horse. Horses and donkeys are different species, with different numbers of chromosomes. Of the two first generation hybrids between these two species, a mule is easier to obtain than a hinny, which is the offspring of a female donkey and a male horse.\\nThe size of a mule and work to which it is put depend largely on the breeding of the mule's female parent. Mules can be lightweight, medium weight or when produced from draft horse mares, of moderately heavy weight. Mules are reputed to be more patient, hardy and long-lived than horses and are described as less obstinate and more intelligent than donkeys."},{"page_url":"https://id.wikipedia.org/wiki/Jan_Fischer","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7d/Jan_Fischer_KVIFF-2.jpg","page_title":"Jan Fischer","context_page_description":"Jan Fischer adalah Perdana Menteri dari pemerintahan sementara Republik Ceko sejak 8 Mei 2009 hingga 13 Juli 2010. Sebagai ahli statistik, dia sebelumnya menjabat sebagai presiden Kantor Statistika Ceko sejak April 2003 sampai Juli 2010."},{"page_url":"https://sv.wikipedia.org/wiki/Svarte_Orm","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Rowan_Atkinson_in_2009.jpg","page_title":"Svarte Orm","context_page_description":"Svarte Orm, även kallad Svarta Ormen, är en komediserie från BBC med historiskt tema samt ett antal specialavsnitt.\\nI samtliga avsnitt medverkar Rowan Atkinson som anti-hjälten Blackadder, tillsammans med sin kompanjon och medhjälpare Baldrick spelad av Tony Robinson. Alla säsonger utspelar sig i olika historiska perioder, och bortsett från Blackadder och Baldrick, innehåller varje serie olika huvudpersoner.\\nDen första serien var skriven av Richard Curtis och Rowan Atkinson. Övriga serier skrevs av Curtis och Ben Elton. Serien var producerad av John Lloyd.\\nUnder 2000-talet blev den fjärde serien Blackadder Goes Forth utsedd till den sextonde bästa tv-serien av British Film Institute i tävlingen \\"100 Greatest British Television Programmes\\". I tv-opinionsundersökningen \\"Britain's Best Sitcom\\", som utfördes år 2004, blev Blackadder utsedd till den näst bästa komediserien någonsin i Storbritannien. Av Empire Magazine blev den rankad som den 20:e bästa tv-serien någonsin."},{"page_url":"https://sv.wikipedia.org/wiki/Wikstroemia","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Wikstroemia_phillyreifolia_%285179227365%29.jpg","page_title":"Wikstroemia","context_page_description":"Wikstroemia är ett släkte av tibastväxter. Wikstroemia ingår i familjen tibastväxter."},{"page_url":"https://es.wikipedia.org/wiki/Knov%C3%ADz","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/93/Knoviz_CZ_from_S116.jpg","page_title":"Knovíz","context_page_description":"Knovíz es una localidad del distrito de Kladno en la región de Bohemia Central, República Checa, con una población estimada a principio del año 2018 de 561 habitantes.\\nSe encuentra ubicada al noroeste de la región y de Praga, a poca distancia al norte del río Berounka —un afluente izquierdo del río Moldava—, y cerca de la frontera con la región de Ústí nad Labem.​"},{"page_url":"https://de.wikipedia.org/wiki/Potter_County_(Pennsylvania)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Coudersport%2C_Pennsylvania_%288480053571%29.jpg","page_title":"Potter County (Pennsylvania)","context_page_description":"Potter County ist ein County im Bundesstaat Pennsylvania in den Vereinigten Staaten. Bei der Volkszählung im Jahr 2000 hatte das County 18.080 Einwohner und eine Bevölkerungsdichte von 6 Einwohnern pro Quadratkilometer. Der Verwaltungssitz ist Coudersport. Potter County wurde nach James Potter benannt, einem General in der Kontinentalarmee während des Amerikanischen Unabhängigkeitskrieges gegen England."},{"page_url":"https://it.wikipedia.org/wiki/Purani","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Purani_jud_Teleorman.png","page_title":"Purani","context_page_description":"Purani è un comune della Romania di 1.716 abitanti, ubicato nel distretto di Teleorman, nella regione storica della Muntenia.\\nIl comune è formato dall'unione di 2 villaggi: Purani e Puranii de Sus.\\nPurani è divenuto comune autonomo nel 2004, staccandosi dal comune di Siliștea."},{"page_url":"https://it.wikipedia.org/wiki/Sacra_Spina","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/3920VicenzaSCoronaInside.JPG","page_title":"Sacra Spina","context_page_description":"Con il termine Sacra Spina si intende ogni frammento ligneo venerato come reliquia perché ritenuto parte della cosiddetta corona di spine che secondo la tradizione evangelica è stata portata da Gesù."},{"page_url":"https://fr.wikipedia.org/wiki/Nocellas","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Nocelles.jpg","page_title":"Nocellas","context_page_description":"Nocellas est un village de la province de Huesca, situé dans la Ribagorce, sur la commune d'Isábena. Il a compté jusqu'à 64 habitants en 1930 mais est inhabité depuis la fin des années 1970. L'église Sainte-Marie, qui remonte au début du XIᵉ siècle, est en ruines."},{"page_url":"https://en.wikipedia.org/wiki/Malda_Town_High_School","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/MTHSmalda.jpg","page_title":"Malda Town High School","context_page_description":"Malda Town High School is a higher secondary school situated at English Bazar of Malda district, in the state of West Bengal, India."},{"page_url":"https://nl.wikipedia.org/wiki/Ruigeweide","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Tussen_Oudewater_en_Reeuwijkse_Plassen_foto2_2014-03-09_10.36.jpg","page_title":"Ruigeweide","context_page_description":"Ruigeweide is een buurtschap behorende tot de gemeente Oudewater in de provincie Utrecht. Het ligt 3 kilometer ten westen van Oudewater. Tot 1964 vormde Ruigeweide samen met de buurtschap Langeweide de gemeente Lange Ruige Weide."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%BE%D1%80%D1%84%D1%8F%D0%BD%D0%B0%D1%8F_%D0%BF%D1%80%D0%BE%D0%BC%D1%8B%D1%88%D0%BB%D0%B5%D0%BD%D0%BD%D0%BE%D1%81%D1%82%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Schwarztorfverladung.jpg","page_title":"Торфяная промышленность","context_page_description":"Торфяная промышленность — отрасль топливной промышленности, предприятия которой осваивают торфяные месторождения, добывают и перерабатывают торф. На нынешний момент основная часть торфа, который добывается в России, используется для потребностей сельского хозяйства, как сырьё для некоторых химических предприятий и как топливо на некоторых электростанциях."},{"page_url":"https://en.wikipedia.org/wiki/Trawscoed_railway_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Remains_of_railway_bridge_near_Trawscoed_-_geograph.org.uk_-_1771723.jpg","page_title":"Trawscoed railway station","context_page_description":"Trawscoed railway station was located on the Carmarthen to Aberystwyth Line. The station had a signal box on the single platform, a weighing machine, several sidings, and a corrugated iron waiting room and ticket office combined. The estate of Trawsgoed is located nearby."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9A%D0%B0%D0%B2%D0%B0%D0%B4%D0%B0%D1%80%D1%86%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Map_of_Kavadarci.png","page_title":"Кавадарци","context_page_description":"Кава̀дарци е град в Северна Македония, разположен на река Луда Мара в Повардарието, един от центровете на областта Тиквеш. Кавадарци има около 30 000 души население и е център на едноименната община Кавадарци."},{"page_url":"https://pl.wikipedia.org/wiki/Maszyna_do_ksi%C4%99gowania","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Klawiatura_maszyny_do_ksiegowania.jpg","page_title":"Maszyna do księgowania","context_page_description":"Maszyna do księgowania – połączenie maszyny do pisania i sumatora umożliwiające sumowanie i odejmowanie liczb w wierszach i kolumnach. Podstawowym jej zastosowaniem było księgowanie, a sterowanie realizowano całkowicie ręcznie lub automatycznie programem w tablicy programowej. Niektóre z tych maszyn miały możliwość podłączenia dziurkarki. Z biegiem czasu zastąpiona została przez automat obrachunkowy, a następnie komputer."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BC%D1%96%D0%BB%D1%8C_%D0%9C%D1%96%D1%82%D0%BE%D0%BD%D1%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/53/Kamil_Mito%C5%84_2013.jpg","page_title":"Каміль Мітонь","context_page_description":"Каміль Мітонь – польський шахіст, гросмейстер від 2002 року."},{"page_url":"https://mn.wikipedia.org/wiki/%D0%9C%D0%BE%D0%BD%D0%B3%D0%BE%D0%BB_%D1%83%D0%BB%D1%81%D1%8B%D0%BD_%D0%B0%D0%B9%D0%BC%D0%B3%D1%83%D1%83%D0%B4%D1%8B%D0%BD_%D1%81%D2%AF%D0%BB%D0%B4,_%D0%B4%D0%B0%D0%BB%D0%B1%D0%B0%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d6/Map_mn_uvurkhangai_aimag.png","page_title":"Монгол улсын аймгуудын сүлд, далбаа","context_page_description":"Дараах жагсаалтанд Монгол улсын аймгуудын далбаа ба сүлдийг жагсаан оруулав."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A6%D0%B8%D0%BA%D0%BE%D1%80%D0%B8%D1%98%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Chicor%C3%A9e_Fabrik_in_Gelsdorf_04.jpg","page_title":"Цикорија","context_page_description":"Цикорија, позната самоникла лековита и јестива биљка, најраспрострањенија је врста истоименог рода. То је коровска биљка, вероватно пореклом из Јужне Европе, данас распрострањена широм Европе и Азије, на различитим стаништима. Најчешће се сакупља на природним стаништима, али се последњих година све чешће и гаји, ради корена, листова и расцветалих цвасти.\\nУ неким изворима име рода изводи се из грчке речи kichora, kichoria, kichorion или kichoreia, што је настало од речи kio=ићи и chorion=пољана, а односи се на место где се биљка може срести. Име врсте настало је од латинског назива за ову биљку intybus.\\nДруги домаћи називи који се могу срести су и: водопија, плава водопија, радич, модрица, жућеница, коњогриз, водоплав, женетрга, цигура, змијина трава, голица, гологуза, гологуза лоћика, кажипут, коњска трава, подрожник и друга."},{"page_url":"https://en.wikipedia.org/wiki/Br%C3%A9tigny_(Paris_RER)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/00/Gare_de_Br%C3%A9tigny_01.jpg","page_title":"Brétigny (Paris RER)","context_page_description":"Brétigny is a railway station in Brétigny-sur-Orge, Essonne, Paris, France. The station was opened in 1865 and is located on the Paris–Bordeaux railway and Paris–Tours railway. The station is served by Paris' express suburban rail system, the RER. The train services are operated by SNCF.\\nIt is 20 kilometres south of the centre of Paris."},{"page_url":"https://ceb.wikipedia.org/wiki/Haabneeme","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Viimsi_school%2C_2009.jpg","page_title":"Haabneeme","context_page_description":"Lungsod ang Haabneeme sa Estoniya. Nahimutang ni sa munisipyo sa Viimsi vald ug lalawigan sa Harjumaa, sa amihanan-kasadpang bahin sa nasod, 9 km sa amihanan sa Tallinn ang ulohan sa nasod. 13 metros ibabaw sa dagat kahaboga ang nahimutangan sa Haabneeme, ug adunay 2,077 ka molupyo.\\nAng yuta palibot sa Haabneeme kay patag. Sa kasadpan, dagat ang pinakaduol sa Haabneeme. Ang kinahabogang dapit sa palibot dunay gihabogon nga 56 ka metro ug 1.0 km sa sidlakan sa Haabneeme. Dunay mga 2,345 ka tawo kada kilometro kwadrado sa palibot sa Haabneeme may kaayo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Tallinn, 9.1 km sa habagatan sa Haabneeme. Sa rehiyon palibot sa Haabneeme, mga lawis, mga luuk, kapuloan, ug salog sa dagat talagsaon komon.\\nAng klima klima sa kontinente. Ang kasarangang giiniton 4 °C. Ang kinainitan nga bulan Hulyo, sa 19 °C, ug ang kinabugnawan Enero, sa -10 °C."},{"page_url":"https://tr.wikipedia.org/wiki/Tan_Son_Nhat_Uluslararas%C4%B1_Havaliman%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/TanSonNhatInternational.JPG","page_title":"Tan Son Nhat Uluslararası Havalimanı","context_page_description":"Tan Son Nhat Uluslararası Havalimanı Vietnam'nin başkenti Ho Şi Min Kenti'da bulunan uluslararası havalimanıdır. Havalimanı ismini 1932 yılında yapılan Fransa'da şehit düşen Tan Son Nhat'ın soyadından almıştır.Otoparkı ücretsizdir.\\nBu Vietnam en büyük havaalanı. 2008 yılında, bu 13 milyon yolcu görev yaptı. Long Thanh Uluslararası Havalimanı Tan Son Nhat Uluslararası Havalimanı yerine, Long Thanh bu şehri 40 km inşa edilecektir."},{"page_url":"https://ca.wikipedia.org/wiki/Dicrostonyx","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Reise_in_den_%C3%A4ussersten_Norden_und_Osten_Sibiriens_w%C3%A4hrend_der_Jahre_1843_und_1844_mit_Allerh%C3%B6chster_Genehmigung_auf_Veranstaltung_der_Kaiserlichen_Akademie_der_Wissenschaften_zu_St._Petersburg_%28Taf._IV%29_%286760292351%29.jpg","page_title":"Dicrostonyx","context_page_description":"Dicrostonyx és un gènere de rosegadors de la família dels cricètids. Les espècies d'aquest grup es troben a la regió àrtica. Si bé aquests animals s'assemblen al lèmming comú en molts aspectes, el gènere Dicrostonyx ja no es classifica en la tribu dels lemminis, car les dades indiquen que els lemminis i les espècies de Dicrostonyx tenen orígens diferents i que les seves similituds són degudes a la convergència evolutiva. El nom genèric Dicrostonyx significa 'urpa forcada' en llatí."},{"page_url":"https://de.wikipedia.org/wiki/Wurfsportart","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Bundesarchiv_Bild_183-48084-0034%2C_Leipzig%2C_Turn-_und_Sporttreffen%2C_Speerwurf.jpg","page_title":"Wurfsportart","context_page_description":"Eine Wurfsportart wird in mehrere Kategorien unterteilt. Grundsätzlich geht es darum ein Objekt zu werfen. Der entscheidende Unterschied ist das Sportgerät. Ob der Treffpunkt eines Zielobjektes maßgebend ist oder die Flugweite gemessen wird, variiert ebenfalls unter den Sportarten.\\nMan kann die Wurfsportarten wie folgt unterscheiden."},{"page_url":"https://pl.wikipedia.org/wiki/Bazylia_ameryka%C5%84ska","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Ocimum_americanum_002.JPG","page_title":"Bazylia amerykańska","context_page_description":"Bazylia amerykańska − gatunek rośliny z rodziny jasnotowatych charakteryzujący się cytrynowym zapachem i smakiem. Wbrew nazwie, pochodzi ze Starego Świata."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%BE%D0%BA%D0%B0%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/%D0%A1%D1%82%D0%B0%D0%B2_%D0%BD%D0%B0_%D1%80%D1%96%D1%87%D1%86%D1%96_%D0%A0%D0%BE%D0%BA%D0%B0%D1%87_%D0%B2_%D0%9C%D0%B8%D1%80%D0%BE%D1%86%D1%8C%D0%BA%D0%BE%D0%BC%D1%83.JPG","page_title":"Рокач","context_page_description":"Рокач — річка в Україні, в межах Бородянського та Києво-Святошинського районів Київської області. Ліва притока Ірпеня.\\nДовжина річки 17 км, площа басейну 160 км².\\nНазва походить ввід слова «рокотати» — в минулому це була доволі глибока річка, середня глибина якої становила 2 метри. Навіть була судноплавною — нею плавали великі човни завдовжки до 8 метрів. Інший варіант назви — Ракач, можливо нагадує про велику кількість раків, що колись водилися у річці.\\nБере початок в лісі за 1 км на північ від села Микуличі. Далі протікає поблизу села Мироцьке, де річку загачено греблею та влаштовано ставок, потім тече між містом Буча та селищем Гостомель, далі — територією Гостомеля. За 1 км від Гостомеля впадає у річку Ірпінь.\\nВід греблі у Мироцькому й до Гостомеля русло річки розбивається на низку меліоративних каналів. У минулому в заплаві річки вівся видобуток торфу.\\nПритока: Топірець."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%B5%D0%B3%D1%96%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D0%B8%D0%B9_%D0%BB%D0%B0%D0%BD%D0%B4%D1%88%D0%B0%D1%84%D1%82%D0%BD%D0%B8%D0%B9_%D0%BF%D0%B0%D1%80%D0%BA_%C2%AB%D0%9F%D0%BE%D0%BB%D0%BE%D0%B2%D0%B5%D1%86%D1%8C%D0%BA%D0%B8%D0%B9_%D1%81%D1%82%D0%B5%D0%BF%C2%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/%D0%9D%D0%9F%D0%9F_%22_%D0%9C%D0%B5%D0%BE%D1%82%D0%B8%D0%B4%D0%B0%22%2C_%D0%B2%D1%96%D0%B4%D0%B4%D1%96%D0%BB%D0%B5%D0%BD%D0%BD%D1%8F_%22%D0%9F%D0%BE%D0%BB%D0%BE%D0%B2%D0%B5%D1%86%D1%8C%D0%BA%D0%B8%D0%B9_%D1%81%D1%82%D0%B5%D0%BF%22_%2814%29.jpg","page_title":"Регіональний ландшафтний парк «Половецький степ»","context_page_description":"«Полове́цький степ» — регіональний ландшафтний парк, що функціонував раніше на території Донецької області.\\nПарк створений Рішенням Донецької обласної ради від 29.02.2000 р. № 23/11-253 на площі 1335 га, в межах Нікольського і Мангушського районів.\\nНа території «Половецького степу» збереглися ділянки цілинних типчаково-ковильних і петрофітних степів, типових для Північного Приазов'я. Мальовничі ландшафти і сприятливі умови для полювання та інших видів організованого відпочинку надають території регіонального ландшафтного парку значну рекреаційну цінність.\\nПарк розташований в басейні річки Берда та її притоці р. Темрюк.\\nЗ 2004 року він увійшов до складу регіонального ландшафтного парку «Меотида».\\nТериторія постраждала під час військових навчань. Додатково з цього питання інформація міститься у статті про екологічні наслідки війни на сході України"},{"page_url":"https://no.wikipedia.org/wiki/Fylkesvei_1922","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/FV242_%C3%98gardsh%C3%B8gda.jpg","page_title":"Fylkesvei 1922","context_page_description":"Fylkesvei 1922 går mellom Amundrud og Hekneby i Stange kommune. Veien er 4,7 km lang.\\nFør 1. januar 2010 hadde veien betegnelsen fylkesvei 222.\\nFrem til 2019 hadde veien betegnelsen fylkesvei 242."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%99%E3%83%AB%E3%82%AE%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Roger_de_Vlaeminck.jpg","page_title":"ベルギー","context_page_description":"ベルギー王国、通称ベルギーは、西ヨーロッパに位置する連邦立憲君主制国家。隣国のオランダ、ルクセンブルクと合わせてベネルクスと呼ばれる。\\n首都ブリュッセルは欧州連合の主要機関の多くが置かれているため「EUの首都」とも言われており、その通信・金融網はヨーロッパを越えて地球規模である。憲法上の首都は、19の基礎自治体からなるブリュッセル首都圏の自治体のひとつ、ブリュッセル市である。\\n19世紀にネーデルラント連合王国から独立した国家で、オランダ語の一種であるフラマン語が公用語の北部フランデレン地域と、フランス語が公用語の南部ワロン地域とにほぼ二分される。建国以来、単一国家であったが、オランダ語系住民とフランス語系住民の対立が続いたため、1993年にフランデレン地域とワロン地域とブリュッセル首都圏の区分を主とする連邦制に移行した。ルワンダ虐殺の原因である差別感情を植え付け、ジェノサイドを引き起こした国でもある。"},{"page_url":"https://en.wikipedia.org/wiki/Snow_White_(Disney_character)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Snow_White_in_Disneyland.jpg","page_title":"Snow White (Disney character)","context_page_description":"Snow White is a fictional character and a main character from Walt Disney Productions' first animated feature film Snow White and the Seven Dwarfs. The character of Snow White was derived from a fairy tale known from many countries in Europe, the best-known version being the Bavarian one collected by the Brothers Grimm.\\nSnow White is the first Disney Princess and the first fictional female character with a star on the Hollywood Walk of Fame. Originally voiced by Adriana Caselotti, she has also been voiced by Jane Powell, Ilene Woods, Dorothy Warenskjold, June Foray, Mary Kay Bergman, Carolyn Gardner, Melissa Disney, Katie Von Til, and Pamela Ribon, and portrayed live by Stephanie Bennett."},{"page_url":"https://en.wikipedia.org/wiki/Ma%C5%82a_Panew","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6e/POL_Ma%C5%82a_Panew_River_Jedlice.JPG","page_title":"Mała Panew","context_page_description":"The Mała Panew is a river in south-western Poland, Silesian and Opole Voivodeships. It is a right tributary of the Oder, merging with the Oder near the village of Czarnowąsy near Opole.\\nThe length of the Mała Panew is 132 km; the area of the watershed is 2132 km²."},{"page_url":"https://en.wikipedia.org/wiki/List_of_defunct_airlines_of_Brazil","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Digex_Aero_Cargo_McDonnell_Douglas_DC-8-62%28F%29_PP-DGP_%2823502298343%29.jpg","page_title":"List of defunct airlines of Brazil","context_page_description":"List of airlines of Brazil\\nList of airports in Brazil"},{"page_url":"https://vi.wikipedia.org/wiki/KLM_Cityhopper","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Klm_cityhopper_fokker100_ph-kle_arp.jpg","page_title":"KLM Cityhopper","context_page_description":"KLM Cityhopper là hãng hàng không phụ thuộc của hãng KLM, trụ sở ở Amsterdam, Hà Lan. Hãng có các tuyến đường quốc tế trong châu Âu. Căn cứ chính của hãng ở Sân bay Amsterdam Schiphol, Amsterdam."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A7%D0%B5%D1%80%D0%BD%D0%B8%D1%86%D0%B0,_%D0%98%D0%B2%D0%B0%D0%BD_%D0%9A%D0%BE%D1%80%D0%BD%D0%B5%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Ivan_chenitsa.jpg","page_title":"Черница, Иван Корнеевич","context_page_description":"Ива́н Корне́евич Черни́ца — советский хозяйственный, государственный и политический деятель, Глава Одесского городского совета. Депутат Верховного Совета СССР 1-го созыва."},{"page_url":"https://nn.wikipedia.org/wiki/Albert_Kj%C3%A6r","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Albert_Kj%C3%A6r.jpg","page_title":"Albert Kjær","context_page_description":"Albert Kjær var ein norsk filolog, bibliotekar og stadnamngranskar.\\nKjær vart cand.mag. i 1875, og arbeidde frå 1876 på Universitetsbiblioteket i Oslo, frå 1918 som førstebibliotekar. Han arbeidde 1880-83 også ved Deichmanske bibliotek. Kjær skreiv nokre enkle historiebøker som En liden lærebog i historie: for folkeskoler paa landet, men den største innsatsen som publist gjorde han som redaktør av fleire band av Oluf Ryghs Norske Gaardnavne, og P.A. Munchs Norrøne gude- og heltesagn.\\nKjær vart som pensjonist utnemnd til statsstipendiat i 1922. Han vart heidra med Festskrift tilegnet førstebibliotekar A. Kjær av venner 26. sept. 1924."},{"page_url":"https://nl.wikipedia.org/wiki/Cairnpapple_Hill","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Cairnpapple_Hill_20100921_cist.jpg","page_title":"Cairnpapple Hill","context_page_description":"Cairnpapple Hill is een archeologische opgraving en heuvel gelegen in de Bathgate Hills in de Schotse regio West Lothian. De heuvel werd gebruikt voor ceremoniële doeleinden vanaf het neolithicum en als begraafplaats vanaf de bronstijd."},{"page_url":"https://es.wikipedia.org/wiki/Vega_Alta_(Puerto_Rico)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Vega_Alta_Flag.svg","page_title":"Vega Alta (Puerto Rico)","context_page_description":"Vega Alta es un municipio localizado en la costa norte del estado libre asociado de Puerto Rico, Limita con el Océano Atlántico por el Norte, con Morovis y Corozal por el Sur; con Vega Baja por el Oeste; y con Dorado por el Este, con un área de 72 km².\\nVega Alta está lejos de San Juan, ciudad capital de Puerto Rico. Es el hogar del Hyatt Regency Cerromar, aunque muchos lo consideren parte de la ciudad vecina de Dorado. También es la ciudad natal del pelotero de todas-estrellas de los New York Yankees Bernie Williams. Vega Alta es también conocido por el hermoso Balneario Público de Cerro Gordo, una de las playas más visitadas en Puerto Rico. Otro lugar de interés es su iglesia católica, mejor conocida como la Inmaculada Concepción, fundada en el 1813. Para los naturalistas y los caminantes, el Bosque Estatal de Vega ofrece varias oportunidades para estirar sus piernas. De hecho, el Bosque de Vega es la primera reserva de bosque que usted encontrará mientras viaje hacia el oeste de San Juan.\\nDurante la primera semana de diciembre, Vega Alta celebra su patrón, La Inmaculada Concepción."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%97%A5%E5%BE%B7%E5%85%B0%E6%B5%B7%E6%88%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/HMS_Queen_Mary_Jutland.jpg","page_title":"日德兰海战","context_page_description":"日德蘭海戰是英國皇家海軍與德意志帝國海軍在距離丹麥日德蘭半島西海岸約80英里的北海海域爆發的一場海戰。這是第一次世界大戰中最大規模，以及史上參戰戰艦數量最龐大的海戰，也是這場戰爭中交戰雙方唯一一次全面出動的艦隊主力決戰。\\n德國計劃以弗朗茨·馮·希佩爾海軍中將率領的5艘戰鬥巡洋艦為主力的戰隊，引誘戴維·貝蒂海軍中將率領以6艘戰列巡洋艦及4艘無畏艦為主力的英國戰隊進入公海艦隊所設的陷阱。但該作戰計劃由於德國海軍密碼被英方破譯，英國本土艦隊同時出動。\\n希佩爾海軍中將與貝蒂海軍中將交鋒的結果以希佩爾海軍中將統帥的艦隊擊沉2艘英軍戰鬥巡洋艦及主動撤離而結束第一回合。舍爾海軍上將與希佩爾海軍中將匯合後，貝蒂海軍中將主動撤離並成功將公海艦隊引向由傑利科海軍上將指揮的英國本土艦隊，雙方合共超過250艘軍艦在北海激戰至日落。英國本土艦隊希望在另一日早上繼續戰鬥，但公海艦隊最後選擇避戰。\\n這場戰役的結果比較特別：一方面，舍爾海軍上將率領的德國公海艦隊以相對較少噸位的艦隻損失擊沉了相對較多噸位的英國艦隻，從而取得了戰術上的勝利；另一方面，傑利科海軍上將指揮的皇家海軍本土艦隊成功守住了北海的大部分制海權，使得德國海軍在一戰餘下的日子無法再突襲英國東部海岸，成功地捍衛了自身的國土安全，也使得德國海軍突破北海封鎖的戰略企圖以失敗告終，因此英國取得戰略上的勝利。"},{"page_url":"https://ca.wikipedia.org/wiki/R%C3%B2capina","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/90/Map_commune_FR_insee_code_32350.png","page_title":"Ròcapina","context_page_description":"Ròcapina és un municipi francès, situat al departament del Gers i a la regió d'Occitània."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%97%D0%B0%D0%BC%D0%BE%D0%BA_%D0%9A%D0%BB%D0%BE%D1%83%D1%82%D0%B5%D1%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1c/November_2003LoughOughter_080.jpg","page_title":"Замок Клоутер","context_page_description":"Замок Клоутер – один із замків Ірландії, розташований в графстві Каван. Нині замок в руїнах. Руїни розташовані на острові озера Лох-Отер, в 2,5 милях на схід від міста Кіллешандра."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%98%D8%B1%D9%88%D9%85_%D9%BE%DB%8C%D9%86%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Pineau_TDF_2010_Cambrai.JPG","page_title":"ژروم پینو","context_page_description":"ژروم پینو دوچرخه‌سوار اهل فرانسه است.\\nاز باشگاه‌هایی که در آن رکاب زده‌است می‌توان به تیم دوچرخه‌سواری دیرکت انرژی، تیم کوئیک‌استپ فلورز، و آی‌ای‌ام سایکلینگ اشاره کرد."},{"page_url":"https://eu.wikipedia.org/wiki/Plac%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Plac%C3%A9_%2853%29_%C3%89glise_01.JPG","page_title":"Placé","context_page_description":"Placé Frantziako udalerria da, Mayenne departamenduan dagoena, Pays de la Loire eskualdean. 2013an 310 biztanle zituen."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%9D%B4%ED%86%A0%EC%95%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Itoya.jpg","page_title":"이토야","context_page_description":"이토야는 도쿄 주오구 긴자에 본점을 두고 있는 일본의 문방구 및 미술 재료 용품 전문 업체이다. 긴자 본점의 간판 위에 있는 '레드'는 이토야의 상징으로 유명하다."},{"page_url":"https://en.wikipedia.org/wiki/Western_skink","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Plestiodon_skiltonianus_distribution.png","page_title":"Western skink","context_page_description":"The western skink is a species of small, smooth-scaled lizard with relatively small limbs. It measures about 100 to 210 mm in total length. It is one of five species of lizards in Canada. They spend much of their day basking in the sun. Their diet ranges widely, including spiders and beetles. Western skinks will bite if grasped and will flee if they feel threatened.\\nIt is a common but secretive species whose range extends from southern British Columbia and throughout Washington, Oregon, Nevada, Utah, Idaho, and Wyoming and into western Montana and northern Arizona and Missouri. They can also live in some areas of Texas It is widespread in northern California but primarily restricted to the coast in central and southern California. Found in a variety of habitats, this lizard is most common in early successional stages or open areas of late successional stages. Heavy brush and densely forested areas are generally avoided. Western skinks are found from sea level to at least 2,130 m. This diurnal reptile is active during the warm seasons."},{"page_url":"https://en.wikipedia.org/wiki/List_of_historic_sites_of_The_Church_of_Jesus_Christ_of_Latter-day_Saints","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Orig_ldsconferencecenter_organ.JPG","page_title":"List of historic sites of The Church of Jesus Christ of Latter-day Saints","context_page_description":"The Church of Jesus Christ of Latter-day Saints holds a number of sites as historically significant. This list is intended as a quick reference for these sites. The sites may or may not be owned by the church.\\nIn addition, independent historic registries have recognized a number of current or formerly church-associated properties, such as the L.D.S. Ward Building in Lava Hot Springs, Idaho, listed on the U.S. National Register of Historic Places."},{"page_url":"https://az.wikipedia.org/wiki/And_q%C4%B1z%C4%B1lqaz%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Two_andeanflamingo_june2003_arp.jpg","page_title":"And qızılqazı","context_page_description":"And qızılqazı — Qızılqazkimilər dəstəsinə aid quş növü."},{"page_url":"https://es.wikipedia.org/wiki/Zangeres_Zonder_Naam","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Zangeres_zonder_Naam_%28Mary_Servaes%29%2C_Bestanddeelnr_934-1074.jpg","page_title":"Zangeres Zonder Naam","context_page_description":"Maria Servaes-Beij fue una cantante neerlandesa de levenslied. Actuaba bajo el seudónimo Zangeres Zonder Naam. Grabó casi 600 canciones a lo largo de su carrera.​​\\nServaes-Beij se preocupaba por los pobres y desfavorecidos, y a menudo actuaba en prisiones y hospitales. Regularmente estaba en contacto directo con su público y recibía muchas cartas.​ Zangeres Zonder Naam fue una de las artistas que actuó en el concierto Miami Nightmare holandés. Esa noche estuvo dedicada en contra de Anita Bryant y su campaña homófoba Save Our Children, en la que Zangeres Zonder Naam cantó una canción compuesta por ella misma, Luister Anita, en el que comparaba a Bryant con Hitler.​"},{"page_url":"https://pl.wikipedia.org/wiki/Prescott_(Arizona)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Prescott_PO.jpg","page_title":"Prescott (Arizona)","context_page_description":"Prescott – miasto w Stanach Zjednoczonych, w stanie Arizona, stolica hrabstwa Yavapai. W 2008 liczyło 42 659 mieszkańców. W latach 1864–1867 i 1877–1889 było stolicą Terytorium Arizony."},{"page_url":"https://en.wikipedia.org/wiki/La_Vendetta_(novel)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/BalzacVendetta.jpg","page_title":"La Vendetta (novel)","context_page_description":"La Vendetta is a novel by the French writer Honoré de Balzac. It is the eighth of the Scènes de la vie privée in La Comédie humaine. The novel was first published in 1830 by Mame et Delaunay-Vallée. In 1842 it appeared in the first Furne edition of La Comédie humaine. La Vendetta was the fourth work in Volume 1, making it the fourth of the Scènes de la vie privée.\\nBalzac may have been inspired to write La Vendetta by Prosper Mérimée, whose novel Mateo Falcone, which was serialized by the Revue de Paris in 1829, also deals with the subject of Corsican vengeance and family honour."},{"page_url":"https://pl.wikipedia.org/wiki/John_Frusciante","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Techmanagerfruscianteguitar.jpg","page_title":"John Frusciante","context_page_description":"John Anthony Frusciante – amerykański muzyk, gitarzysta, wokalista, autor tekstów i producent muzyczny. Najdłużej związany z Red Hot Chili Peppers, z którym nagrał i wydał pięć albumów studyjnych. W 1994 roku Frusciante rozpoczął karierę solową – pod własnym nazwiskiem wydał dziewięć albumów oraz dwa wraz z Joshem Klinghofferem i Joe Lally w ramach formacji Ataxia. Jego solowe nagrania są różnorodne gatunkowo – w jego albumach przewijają się style od rocka awangardowego przez ambient i muzykę z nurtami nowej fali po muzykę elektroniczną uzupełnianą o riffy gitarowe. Czerpiąc inspiracje od gitarzystów z różnych stylów muzycznych, Frusciante w swojej karierze położył nacisk na melodię i emocje. Muzyk preferuje nieskomplikowanie skonstruowane gitary i analogowe nagrywanie utworów, co prowadzi do zmniejszenia wyraźności nagrań i trudności w odsłuchu. Nagrywa we własnym studiu mieszczącym się w jego domu w Kalifornii.\\nFrusciante dołączył do Red Hot Chili Peppers w 1988 roku, w wieku 18 lat. Po roku wydał wraz z zespołem pierwszy album, Mother’s Milk. Następny album grupy – Blood Sugar Sex Magik stał się ważnym momentem w historii zespołu i dużym sukcesem komercyjnym."},{"page_url":"https://en.wikipedia.org/wiki/Ellen_Jaffee","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Ellen_Jaffee_2012.jpg","page_title":"Ellen Jaffee","context_page_description":"Ellen C. Jaffee is an American politician and a Democratic member of the New York State Assembly, representing the 97th Assembly District in Rockland County.\\nA native of Brooklyn, Jaffee earned her B.A. in Education from Brooklyn College and her M.S. in Special Education from Fordham University. She was previously a teacher at Pomona Middle School before becoming an elected official of the Rockland County Legislature in 1998.\\nJaffee was first elected to the State Assembly in 2006 for a two-year term. She ran uncontested in the 2008 general election and won the 2010 general election with 61 percent of the vote.\\nShe co-sponsored the bill in the New York State Assembly which increased the New York State tax on cigarettes in June 2008.\\nSince 1978, Jaffee and her husband Steve have lived in Suffern, where they raised two children, Marc and Allison. Steve, who was also the Chairman of the Suffern Democratic Committee, died on January 19, 2016."},{"page_url":"https://fr.wikipedia.org/wiki/Silvio_Cesare_Bonicelli","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Bishop.silvio.cesare.bonicelli.JPG","page_title":"Silvio Cesare Bonicelli","context_page_description":"Silvio Cesare Bonicelli est un évêque catholique italien, évêque de Parme de 1996 à 2008."},{"page_url":"https://en.wikipedia.org/wiki/Texarkana_Gazette","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Texarkana_Gazette%2C_Texarkana%2C_TX_IMG_6405.jpg","page_title":"Texarkana Gazette","context_page_description":"The Texarkana Gazette is a daily newspaper founded in 1875 and currently owned by WEHCO Media, Inc. It serves a nine-county area surrounding Texarkana."},{"page_url":"https://en.wikipedia.org/wiki/Worcester,_Massachusetts","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d1/Worcesteracademy3.jpg","page_title":"Worcester, Massachusetts","context_page_description":"Worcester is a city, and county seat of, Worcester County, Massachusetts, United States. Named after Worcester, Worcestershire, England, as of the 2010 Census the city's population was 181,045, making it the second-most populous city in New England after Boston. Worcester is approximately 40 miles west of Boston, 50 miles east of Springfield and 40 miles north of Providence. Due to its location in Central Massachusetts, Worcester is known as the \\"Heart of the Commonwealth\\", thus, a heart is the official symbol of the city. However, the heart symbol may also have its provenance in lore that the Valentine's Day card, although not invented in the city, was first mass-produced and popularized by Worcester resident Esther Howland.\\nWorcester was considered its own distinct region apart from Boston until the 1970s. Since then, Boston's suburbs have been extending further westward, especially after the construction of Interstate 495 and Interstate 290. The Worcester region now marks the western periphery of the Boston-Worcester-Providence U.S. Census Combined Statistical Area, or Greater Boston. The city features many examples of Victorian-era mill architecture."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_diplomatischen_Vertretungen_in_Bonn","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Bad_Godesberg%2C_Rheinallee_23.jpg","page_title":"Liste der diplomatischen Vertretungen in Bonn","context_page_description":"Die Liste der diplomatischen Vertretungen in Bonn stellt dar, welche Gebäude in der Bundesstadt Bonn, die von 1949 bis 1999 Regierungssitz der Bundesrepublik Deutschland war, und ihrer Umgebung von den Botschaften und weiteren diplomatischen Vertretungen genutzt wurden bzw. werden; wie sie entstanden sind, welche Veränderungen sie erfahren haben und wie sie heute genutzt werden. Ein geringer Teil der diplomatischen Vertretungen befand sich bis zuletzt außerhalb des Stadtgebiets von Bonn im Rhein-Sieg-Kreis, in Köln und im rheinland-pfälzischen Landkreis Ahrweiler."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D0%B0%D0%BD%D0%BD%D0%B0_%D0%93%D1%80%D0%BE%D0%BD%D0%BA%D0%B5%D0%B2%D0%B8%D1%87-%D0%92%D0%B0%D0%BB%D1%8C%D1%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fd/Hanna_Gronkiewicz-Waltz_Parada_Schumana.jpg","page_title":"Ганна Гронкевич-Вальц","context_page_description":"Ганна Беата Гронкевич-Вальц — польська політична діячка, юристка, докторка юридичних наук, фахівчиня в галузі банківського права. Голова Національного банку Польщі. Президентка Варшави."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%A1%D0%B5%D0%BD%D1%82-%D0%90%D0%BC%D0%B1%D1%80%D1%83%D0%B0_(%D0%A8%D0%B5%D1%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Saint_Ambroix_eglise2.JPG","page_title":"Сент-Амбруа (Шер)","context_page_description":"Сент-Амбруа — Францин гӀала-коммуна, лаьтта Центр — Луаран атагӀа регионехь. Коммунан департамент — Шер. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%A4%A7%E5%9B%BD%E6%B0%91%E8%AE%AE%E4%BC%9A_(%E5%9C%9F%E8%80%B3%E5%85%B6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Building_of_the_Grand_National_Assembly_of_Turkey.jpg","page_title":"大国民议会 (土耳其)","context_page_description":"土耳其大國民議會是土耳其最高立法機構，於1920年4月23日成立於安卡拉，其歷史比土耳其共和國還久。在議會成立至國家成立期間，大國民議會一度是土耳其的最高權力及行政機關。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D1%81%D0%B5%D0%BC%D0%B8%D1%80%D0%BD%D1%8B%D0%B9_%D1%82%D0%BE%D1%80%D0%B3%D0%BE%D0%B2%D1%8B%D0%B9_%D1%86%D0%B5%D0%BD%D1%82%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/World_Trade_Center%2C_New_York_City_-_aerial_view_%28March_2001%29.jpg","page_title":"Всемирный торговый центр","context_page_description":"Всеми́рный торго́вый центр — комплекс из семи зданий в Финансовом квартале Манхэттена в Нью-Йорке, спроектированный Минору Ямасаки и официально открытый 4 апреля 1973 года. Архитектурной доминантой комплекса были две башни, каждая по 110 этажей — Северная и Южная. 11 сентября 2001 года комплекс ВТЦ был разрушен в результате террористической атаки. Некоторое время после окончания строительства башни были высочайшими небоскрёбами в мире."},{"page_url":"https://et.wikipedia.org/wiki/WilliamsF1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Eliseo_Salazar_Silverstone_1980.jpg","page_title":"WilliamsF1","context_page_description":"WilliamsF1 on Vormel 1 meeskond.\\nWilliamsi peakorter asub Suurbritannias Oxfordshire'is Grove'is.\\nMeeskonna direktorid on Frank Williams ja Patrick Head ning tehnikadirektor on Sam Michael."},{"page_url":"https://vi.wikipedia.org/wiki/Ostholstein","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/21/Uebersicht-OH.png","page_title":"Ostholstein","context_page_description":"Ostholstein là một huyện ở Schleswig-Holstein, Đức. Các huyện giáp ranh là: Stormarn, Segeberg và Plön, biển Baltic and thành phố Lübeck.\\nHuyện được lập năm 1970 thông qua việc sáp nhập các huyện Eutin và Oldenburg.\\nHuyện này gồm bán đảo Wagrien giữa vịnh Lübeck và vịnh Kiel, đảo Fehmarn, phía đông khu vực \\"Holsteinische Schweiz\\" và ngoại ô phía nam của Lübeck. Đỉnh cao nhất là núi Bungs cao 168 m. Đảo Fehmarn là đảo lớn thứ 3 ở Đức."},{"page_url":"https://es.wikipedia.org/wiki/Improperios_(liturgia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Giovanni_Pierluigi_da_Palestrina-edit.jpg","page_title":"Improperios (liturgia)","context_page_description":"Los Improperios, en latín Improperia, son los versículos que se cantan en el oficio de la tarde del Viernes Santo en la Iglesia católica, durante la ceremonia llamada Adoración de la Cruz.​​ La palabra latina improperium significa « reproche ».​ Los Improperios son, de hecho, los reproches de Cristo a su pueblo que lo ha rechazado.​ Puesto que a cambio de todos los favores concedidas por Dios, y en particular de haberlo librado de la servidumbre en Egipto y haberlo conducido sano y salvo a la Tierra Prometida, le ha infligido las ignominias de la Pasión. Esta temática ha sido mucho tiempo ligada a la del « pueblo deicida ». Se puede ver en ella la influencia de Méliton de Sardes y de su Homélie de Pâques.​\\nEs durante La Adoración de la cruz, ​ después de las diecisiete oraciones, que estos improperios se decían por el coro en el rito romano. A cada favor de Dios en el libro del Éxodo se oponía un episodio de la Pasión de Cristo. El coro repetía como estribillo la aclamación griega Hagios o Theós, ​ de forma más precisa alternando el griego y el latín, en doble coro.​"},{"page_url":"https://no.wikipedia.org/wiki/Louis-Ernest_Dubois","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Louis-Ernest_Dubois-1920.jpg","page_title":"Louis-Ernest Dubois","context_page_description":"Louis-Ernest Dubois var en av Den katolske kirkes kardinaler, og erkebiskop av Rouen 1909–1920 og Paris 1920–1929. Han ble kreert til kardinal i 1916 av pave Benedikt XV, med Santa Maria in Aquiro som tittelkirke, og deltok på konklavet 1922 som valgte pave Pius XI."},{"page_url":"https://en.wikipedia.org/wiki/Austro-Hungarian_krone","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/CZE-2-Republika_Ceskoslovenska-20_Korun_%281919%2C_Provisional_issue%29.jpg","page_title":"Austro-Hungarian krone","context_page_description":"The Krone or korona was the official currency of the Austro-Hungarian Empire from 1892 until the dissolution of the empire in 1918. The subunit was one hundredth of the main unit, and was called a Heller in the Austrian and a fillér in the Hungarian part of the Empire."},{"page_url":"https://ceb.wikipedia.org/wiki/Sasia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/BirdsAsiaJohnGoVIGoul_0172.jpg","page_title":"Sasia","context_page_description":"Henero sa mga langgam ang Sasia. Ang Sasia sakop sa kabanay nga Picidae.\\nMao ni ang iyang kladogram matod sa Catalogue of Life:"},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_monuments_del_districte_de_Carcassona","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Citou_Ch%C3%A2teau_%28ruines%29.jpg","page_title":"Llista de monuments del districte de Carcassona","context_page_description":"Llista de monuments del districte de Carcassona registrats com a monuments històrics, bé catalogats d'interès nacional o bé inventariats d'interès regional.\\nPer al mateix municipi de Carcassona vegeu la llista de monuments de Carcassona."},{"page_url":"https://es.wikipedia.org/wiki/Arquitectura_monol%C3%ADtica","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Bet_Giyorgis_church_Lalibela_01.jpg","page_title":"Arquitectura monolítica","context_page_description":"La Arquitectura monolítica es el tipo de construcción en el cual el edificio es esculpido o excavado en un único bloque de material pétreo.\\nEjemplos de edificaciones monolíticas son las iglesias talladas en la roca de Lalibela, Etiopía, o el Pancha Rathas en India."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D8%AF%D9%84%D8%B3%D9%87%D8%A7%DB%8C%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Medelsheim_wappen.png","page_title":"مدلسهایم","context_page_description":"مدلسهایم یک منطقهٔ مسکونی در آلمان است که در گرسهایم واقع شده‌است. مدلسهایم ۴۸۷ نفر جمعیت دارد."},{"page_url":"https://sl.wikipedia.org/wiki/Maserati_250F","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Maserati_250_F_red_v_TCE.jpg","page_title":"Maserati 250F","context_page_description":"Maserati 250F je Maseratijev dirkalnik Formule 1, ki je bil v uporabi med sezonama 1954 in 1960, ko so z njim dirkali tudi Juan Manuel Fangio, Stirling Moss, Alberto Ascari, Louis Chiron in mnogi drugi dirkači, kajti na posamezni dirki je takrat sodelovalo tudi po devet ali več dirkačev z dirkalnikom 250F. Z njim je Fangio osvojil dirkaška naslova v sezonah 1954 in 1957, konstruktorske naslove pa so začeli podeljevati pele v sezoni 1958, ko pa je bil 250F že nekoliko zastarel dirkalnik, čeprav so ga dirkači uporabljali vse do sezone 1960, v kateri pa dirkalnik ni več osvojil prvenstvenih točk.\\nMaserati 250F je debitiral na prvi dirki sezone 1954 za Veliko nagrado Argentine, kjer je nastopilo kar devet dirkačev s tem dirkalnikom, kateremu prvo zmago je na tisti dirki prinesel Juan Manuel Fangio. V tej sezoni je Fangio dobil še dirko za Veliko nagrado Belgije, kar je skupno zadostovalo za dirkaški naslov prvaka. Po sezoni 1955 brez zmag, je v naslednji sezoni 1956 Stirling Moss zmagal na Velikih nagradah Monaka in Italije."},{"page_url":"https://de.wikipedia.org/wiki/Kabinett_David_Ben-Gurion_V","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Zerach_Warhaftig.jpg","page_title":"Kabinett David Ben-Gurion V","context_page_description":"Das Kabinett David Ben-Gurion V ist die siebte Koalitionsregierung Israels seit der Gründung des Staates. Das Kabinett wurde unter der Leitung von David Ben-Gurion, nach den Wahlen am 26. Juli 1955, am 3. November 1955 gebildet und löste die bis dahin geschäftsführend im Amt gebliebene Regierung ab.\\nDie Regierung wurde von den in der Knessetfraktionen Mifleget Poalei Erez Jisrael, Nationalreligiösen Partei, Achdut haAwoda, Mapam und den drei die arabischen Israelis vertretenden Parteien: Reshima Demokratit LeAravei Yisrael, Kidma VeAvoda und Hakla'ut VePituah getragen.\\nAm 17. Dezember 1957 beschuldigte David Ben-Gurion die Minister der Achdut haAwoda, Informationen über den Generalstab Mosche Dajans bei seiner Reise in die Bundesrepublik Deutschland an die Presse weitergegeben zu haben und erzwang ihren Rücktritt.\\nDie Regierung zerbrach hierüber am 31. Dezember 1957 und eine Woche später wurde die achte Regierung unter Leitung von David Ben-Gurion gebildet."},{"page_url":"https://lv.wikipedia.org/wiki/It%C4%81lijas_kara%C4%BCu_uzskait%C4%ABjums","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Louis_II_of_Italy.png","page_title":"Itālijas karaļu uzskaitījums","context_page_description":"Šajā uzskaitījumā apkopoti Itālijas karaļi. Itālijas karalis bija Itālijas karalistes valdnieku tituls gandrīz 1500 gadus. Pirmais Itālijas karalis bija Odoakrs, kurš izbeidza Rietumromas impērijas pastāvēšanu. Itālijas sadrumstalotības gadsimtos tituls piederēja Svētās Romas impērijas imperatoriem. Pēc Itālijas Karalistes pastāvēšanas beigām 1946. gadā, tituls vairs netiek piešķirts."},{"page_url":"https://hu.wikipedia.org/wiki/P%C3%A1pua_%C3%9Aj-Guinea","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Apostichopus_californicus.001_-_Aquarium_Finisterrae.jpg","page_title":"Pápua Új-Guinea","context_page_description":"Pápua Új-Guinea Óceánia egyik állama, mely a Föld második legnagyobb szigetének, Új-Guinea szigetének keleti részét és számtalan kisebb szigetet foglal magában. Fővárosa és a néhány nagyvárosának egyike Port Moresby, ami a sziget keleti csücskének déli partvonalán fekszik. 850-féle bennszülött nyelv és legalább ennyi hagyományos népcsoport létezik a hétmilliónál valamivel nagyobb létszámú országban. Az egyik leginkább vidékies jellegű ország is, csupán a népesség 18%-a él városokban. Az ország egyike a legkevésbé felfedezetteknek kulturális és földrajzi értelemben is, és vélhetően számos felfedezetlen növény- és állatfaj él Pápua Új-Guinea belsejében."},{"page_url":"https://nl.wikipedia.org/wiki/Rutger_Hauer","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Grijpstra_en_de_Gier_%281979%29.jpg","page_title":"Rutger Hauer","context_page_description":"Rutger Oelsen Hauer was een Nederlands acteur die sinds de jaren tachtig voornamelijk in de Verenigde Staten werkte. Tot de filmprijzen die hij won behoren een Golden Globe, twee Gouden Kalveren en een Rembrandt Award."},{"page_url":"https://en.wikipedia.org/wiki/Koehler_Depressing_Carriage","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/34/Koehler%27s_Depressing_Carriage.jpg","page_title":"Koehler Depressing Carriage","context_page_description":"The Koehler Depressing Carriage was a novel type of gun carriage invented in 1782 by Lt George Frederick Koehler of the Royal Artillery. It was devised to enable cannons to be fired at a steeply downward-facing angle and was made necessary by the peculiar circumstances that the British Army faced during the Great Siege of Gibraltar between 1779–83. The carriage saw active service during the siege, when it was used to support the British counter-bombardment of Spanish and French artillery batteries during the successful defence of Gibraltar. Its success made Koehler famous and has been commemorated in a number of different forms over the last 230 years."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B9%E3%83%BC%E3%83%91%E3%83%BC%E3%82%B0%E3%83%83%E3%83%94%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/B-377.svg","page_title":"スーパーグッピー","context_page_description":"スーパーグッピー とは大型ロケットエンジンや旅客機の主翼や胴体などのように特大サイズの貨物を空輸するために製造された広胴貨物輸送機である。製造当時は世界最大の容積を持つ飛行機であった。"},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A7%88%EC%9D%B4%ED%81%B4_%EC%BD%9C%EB%A6%B0%EC%8A%A4_(%EC%A0%95%EC%B9%98%EC%9D%B8)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Young_Michael_Collins_Portrait.jpg","page_title":"마이클 콜린스 (정치인)","context_page_description":"마이클 존 콜린스는 아일랜드의 혁명지도자, 정치인이다. 재정성 장관, 내무성 장관을 역임했으며 1919년 제1달에서 코크 남부를 지역구로 타흐터 달러를 지냈다. 원조 아일랜드 공화국군에서 부관감, 방첩대장, 군사조직 및 무기조달 담당자 등의 중책을 맡았고, 1920년부터 죽을 때까지 아일랜드 공화주의 형제단 단장이었다. 영국-아일랜드 조약 당시 조약 찬성파에 섰으며, 임시정부 주석이자 아일랜드 국군 총사령관이 되었다. 아일랜드 내전 와중인 1922년 8월 아일랜드 공화국군 조약 반대파에게 습격당해 사살당했다."},{"page_url":"https://fr.wikipedia.org/wiki/Palais_Kheireddine_(Tunis)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Kheirredinetn1.JPG","page_title":"Palais Kheireddine (Tunis)","context_page_description":"Le palais Kheireddine est un ancien palais de la médina de Tunis situé non loin du quartier de la Hafsia, sur la place du Tribunal. Il abrite actuellement le musée de la ville de Tunis."},{"page_url":"https://ro.wikipedia.org/wiki/Secolul_al_XIV-lea_%C3%AE.Hr.","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Liebieghaus-sekhmet-ffm-003.jpg","page_title":"Secolul al XIV-lea î.Hr.","context_page_description":null},{"page_url":"https://lt.wikipedia.org/wiki/Va%C5%A1ingtono_nacionalin%C4%97_dail%C4%97s_galerija","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/National_Gallery_Washington_03.jpg","page_title":"Vašingtono nacionalinė dailės galerija","context_page_description":"Vašingtono nacionalinė dailės galerija – meno muziejus JAV sostinėje Vašingtone. Galerijoje saugoma plati Europos ir Amerikos paveikslų, skulptūros, dekoratyviosios dailės ir grafikos kūrinių kolekcija. Ypač turtingi italų renesanso, olandų ir ispanų baroko, prancūzų rokoko rinkiniai. Galerijoje vyksta meno parodos, ji įsikūrusi Vašingtono Nacionalinės alėjos rytiniame pakraštyje, kartu jai priklauso šalia esantis Nacionalinės dailės galerijos skulptūrų sodas.\\nGalerijoje saugomi apie 141 000 objektų, jos lankymas nemokamas. 2013 m. Vašingtono nacionalinė dailės galerija, su daugiau nei 4 mln. lankytojų per metus, buvo 8-as lankomiausias pasaulio meno muziejus."},{"page_url":"https://de.wikipedia.org/wiki/S%C3%BCdwind_Verein","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/S%C3%BCdwind_Organigramm.jpg","page_title":"Südwind Verein","context_page_description":"Der Südwind Verein für Entwicklungspolitik und globale Gerechtigkeit mit Sitz in Wien ist eine entwicklungspolitische Nichtregierungsorganisation in Österreich, die sich für eine nachhaltige Entwicklung, Menschenrechte und faire Arbeitsbedingungen weltweit einsetzt. Der Verein hat Büros in Dornbirn, Innsbruck, Salzburg, Linz, Wiener Neustadt, Graz und Wien. Finanziert wird Südwind durch Projekte, Mitgliedsbeiträge und Spenden."},{"page_url":"https://pl.wikipedia.org/wiki/Piestowo","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5c/Flag_of_Pestovo_%28Novgorod_oblast%29.png","page_title":"Piestowo","context_page_description":"Piestowo - miasto w Rosji, w obwodzie nowogrodzkim, 310 km na wschód od Nowogrodu Wielkiego. W 2007 liczyło 15 725 mieszkańców."},{"page_url":"https://br.wikipedia.org/wiki/Chloephaga_picta","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Upland_Goose_in_Tierra_del_Fuego_National_Park_%285536598972%29.jpg","page_title":"Chloephaga picta","context_page_description":"Chloephaga picta zo anv skiantel ur spesad evned eus ar c'herentiad Anatidae."},{"page_url":"https://hu.wikipedia.org/wiki/Fluorenon","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Fluorenone_molecule_ball.png","page_title":"Fluorenon","context_page_description":"A fluorenon aromás szerves vegyület, képlete C₁₃H₈O. Fényes, fluoreszkáló sárga színű, szobahőmérsékleten szilárd anyag. Előállítható fluorénból jégecet és nátrium-hipoklorit oldat hozzáadásával, melynek hatására oxidáció játszódik le. Maláriaellenes gyógyszerek gyártásához használják."},{"page_url":"https://tr.wikipedia.org/wiki/NGC_3116","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/NGC3116_-_SDSS_DR14.jpg","page_title":"NGC 3116","context_page_description":"NGC 3116, Yeni Genel Katalog'da yer alan bir galaksidir. Gökyüzünde Terazi takımyıldızı yönünde bulunur. E0 tipi bir merceksi, eliptik galaksidir. Avusturyalı astronom Johann Palisa tarafından 1886 yılında 30,48 cm çaplı mercekli tip bir teleskopla keşfedilmiştir."},{"page_url":"https://hu.wikipedia.org/wiki/Spanyol%E2%80%93amerikai_h%C3%A1bor%C3%BA","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9d/USSMaine.jpg","page_title":"Spanyol–amerikai háború","context_page_description":"A spanyol–amerikai háború 1898-ban zajlott le Spanyolország és az Amerikai Egyesült Államok között, miután utóbbi beavatkozott a kubai függetlenségi háborúba. A háború eredményeképpen Spanyolország elvesztette utolsó jelentős tengerentúli gyarmatait, Kubát, a Fülöp-szigeteket, Puerto Ricót és Guam szigetét, az USA pedig imperialista gyarmattartó hatalommá vált, bár Kuba formális függetlenséget kapott – amerikai gyámság alatt. A rövid harc révén az Egyesült Államok elérte régi céljait: amint azt John Quincy Adams 1823-ban még külügyminiszterként megjósolta, Kuba érett gyümölcsként hullott az ölükbe. A Fülöp-szigetek és Guam pedig Hawaii után újabb ugródeszkát jelentettek Kína felé, az ottani amerikai befolyás elősegítésére.\\nA spanyol uralom ellen évek óta folyt a függetlenségi harc Kubában, az USA pedig korábban is összeütközésbe került Spanyolországgal, például 1873-ban a Virginius incidens okán, amikor a felkelők által bérelt amerikai hajó, a Virginius legénységének 58 tagját, köztük több amerikai állampolgárt is kivégeztek a spanyolok."},{"page_url":"https://uk.wikipedia.org/wiki/RUNX1T1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/PBB_GE_RUNX1T1_205528_s_at_fs.png","page_title":"RUNX1T1","context_page_description":"RUNX1T1 – білок, який кодується однойменним геном, розташованим у людей на короткому плечі 8-ї хромосоми. Довжина поліпептидного ланцюга білка становить 604 амінокислот, а молекулярна маса — 67 566.\\nКодований геном білок за функціями належить до репресорів, фосфопротеїнів.\\nЗадіяний у таких біологічних процесах, як транскрипція, регуляція транскрипції, альтернативний сплайсинг.\\nБілок має сайт для зв'язування з іонами металів, іоном цинку, ДНК.\\nЛокалізований у ядрі."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D9%83%D9%88%D8%A7%D8%B1%D9%8A%D9%88%D9%85_%D8%A3%D9%86%D8%B7%D8%A7%D9%84%D9%8A%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Antalya_Aquarium.jpg","page_title":"أكواريوم أنطاليا","context_page_description":"أنطاليا أكواريوم هو مركز ترفيهي يتكون من أكواريم عام ومناطق مغلقة من عالم الثلج أنشأته بلدية أنطاليا وفقا لنموذج التشييد والتشغيل ونقل الملكية في منطقة كونيالتي في مقاطعة أنطاليا بتركيا. صُنف المركز من بين المراتب الخمس الأولى بين الأماكن الأكثر زيارة في تركيا."},{"page_url":"https://de.wikipedia.org/wiki/Schall-Riaucour","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Wappen_Graf_Schall_Riaucour.jpg","page_title":"Schall-Riaucour","context_page_description":"Schall-Riaucour ist der Name einer gräflichen Familie aus dem Rheinland, einem Kölner Uradelsgeschlecht, das sich ursprünglich Schall, dann Schall von Horbell bzw. Schall von Bell nannte. Im 18. Jahrhundert erbten die Schall umfangreichen Besitz des Grafen von Riaucour in der Oberlausitz."},{"page_url":"https://de.wikipedia.org/wiki/Burg_Stre%C4%8Dno","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Strecno_copperplate.jpg","page_title":"Burg Strečno","context_page_description":"Die Burg Strečno liegt in der nördlichen Slowakei etwa acht Kilometer östlich der Stadt Žilina auf der Straße nach Martin in der Kleinen Fatra, auf einem hohen Felsen oberhalb des Flusses Waag. Zusammen mit der Burg Starý hrad ein paar Kilometer flussaufwärts schützte Burg Strečno den Weg durch den Engpass Domašínsky meander."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A6%D7%91_%D7%9E%D7%A0%D7%95%D7%A7%D7%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Spotted_Turtle_%28Clemmys_guttata%29_%28captive_specimen%29_%2836331198042%29.jpg","page_title":"צב מנוקד","context_page_description":"צב מנוקד הוא מין של צב ממשפחת הצבים הביצתיים. הוא מצוי בטבע במזרח אמריקה הצפונית בארצות הברית ובקנדה. מין זה הוא היחידי בסוגו.\\nמין צב זה קטן מאוד ומגיע לאורך 8–12 ס\\"מ בממוצע. צבע שריון הצב כחול-כהה עד שחור והוא מנוקד בנקודות צהובות לאורכו. הגוף מכוסה בקשקשים חומים ומעט אדמוניים והראש שחור כמו השריון אך בעל כתמים רחבים בצבע כתום. הבטן בהירה יותר וצבעה צהוב-כתום. השריון נמוך ומותאם לתנועה מהירה במים. הרגליים רחבות ובעלות קרומי שחיה והראש קטן ופונה מעט מעלה. הלסתות בולטות מעלה וצבעם כתום עד צהוב. ההבדלים העיקריים בין הזכרים לנקבות הם הסנטר הרחב והכהה יותר של הזכר, צבע עיניו החומות והזנב הארוך יותר שלו בעוד הנקבה בעלת סנטר צהוב, עיניים כתומות וזנבה קצר יותר. בנוסף הנקבות גדולות מעט יותר מהזכרים, בעלות מעט יותר נקודות על שריונם ובעלות חלק שריון תחתון קמור או שטוח בעוד הזכרים בעלי מבנה קעור מעט.\\nצבים אלה נפוצים ממיין, קוויבק ואונטריו שבקנדה ודרומה למזרח ארצות הברית עד לפלורידה, אינדיאנה ומזרח אוהיו והוא מגיע מערבה עד למישיגן. הצבים מותאמים לשחייה בנהרות איטיים, ביצות, שלוליות ועוד אזורים לחים לרבות ביערות ואף בפארקים. האזור המתאים לצב זה הוא נהרות רדודים מוקפים בצמחי מים וגם בבוץ ולעיתים מצוי לצד מינים אחרים של צבי מים מקומיים."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9A%CE%B1%CF%84%CE%AC%CE%BB%CE%BF%CE%B3%CE%BF%CF%82_%CE%AD%CF%81%CE%B3%CF%89%CE%BD_%CF%84%CE%BF%CF%85_%CE%A0%CE%B5%CF%81%CE%BF%CF%85%CF%84%CE%B6%CE%AF%CE%BD%CE%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Pietro_Perugino_cat41b.jpg","page_title":"Κατάλογος έργων του Περουτζίνο","context_page_description":"Το λήμμα αυτό περιλαμβάνει κατάλογο των σημαντικότερων έργων του Περουτζίνο.\\nΗ ενότητα αυτή είναι κενή, ανεπαρκώς ανεπτυγμένη ή ανολοκλήρωτη. Η βοήθειά σας είναι καλοδεχούμενη!"},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A7%E0%B8%B1%E0%B8%94%E0%B9%80%E0%B8%8A%E0%B8%95%E0%B8%A7%E0%B8%B1%E0%B8%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Pool_in_Jetavana_Mahavihar.jpg","page_title":"วัดเชตวัน","context_page_description":"วัดเชตวันมหาวิหาร หรือ วัดพระเชตวัน อารามของอนาถบิณฑิกเศรษฐี เป็นอาราม ที่สร้างโดยท่านอนาถบิณฑิกเศรษฐี มหาเศรษฐีแห่งเมืองสาวัตถี บนที่ตั้งของเชตวัน หรือสวนเจ้าเชต นอกเมืองสาวัตถี ซึ่งอนาถบิณฑิกเศรษฐีซื้อมาด้วยเงินมากถึง 18 โกฏิ วัดแห่งนี้นับว่าเป็นวัดและที่มั่นสำคัญในการเผยแพร่พระพุทธศาสนาในสมัยพุทธกาล และเป็นวัดที่พระพุทธเจ้าประทับจำพรรษามากที่สุดถึง 19 พรรษา วัดเชตวันมหาวิหารเป็นสถานที่เกิดเรื่องราวต่าง ๆ ในคัมภีร์ทางพระพุทธศาสนามากมาย\\nปัจจุบันวัดเชตวันมหาวิหารเหลือเพียงซากโบราณสถาน ได้รับการบูรณะจากทางราชการอินเดียเป็นอย่างดี ตั้งอยู่ทางใต้ของแม่น้ำราปติ หรือแม่น้ำอจิรวดีในสมัยพุทธกาล นอกกำแพงเมืองสาวัตถีไปทางทิศใต้ประมาณ 1 กิโลเมตร ที่ ตำบลสะเหต รัฐอุตตรประเทศ ประเทศอินเดีย"},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A9%B8%EC%B9%98%EA%B3%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Anchovy_closeup.jpg","page_title":"멸치과","context_page_description":"멸치과는 청어목의 한 과이다. 태평양, 대서양, 인도양에 걸쳐 16속, 140여종이 존재한다. 본문에서는 편의상 '멸치류'로 지칭하겠다."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Stuttgart-Ost","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/26/Stuttgart-Stuttgardia.jpg","page_title":"Liste der Kulturdenkmale in Stuttgart-Ost","context_page_description":"In der Liste der Kulturdenkmale in Stuttgart-Ost sind alle unbeweglichen Bau- und Kunstdenkmale in Stuttgart-Ost aufgelistet, die in der Liste der Kulturdenkmale. Unbewegliche Bau- und Kunstdenkmale der Unteren Denkmalschutzbehörde für diesen Stadtbezirk Stuttgarts verzeichnet sind. Stand dieser Liste ist der 25. April 2008.\\nDiese Liste ist nicht rechtsverbindlich. Eine rechtsverbindliche Auskunft ist lediglich auf Anfrage bei der Unteren Denkmalschutzbehörde der Stadt Stuttgart erhältlich."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%9F%A2%E5%90%B9%E7%9C%81%E4%B8%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Shozo_yabuki.jpg","page_title":"矢吹省三","context_page_description":"矢吹 省三は、日本の実業家、政治家、華族。貴族院男爵議員。"},{"page_url":"https://af.wikipedia.org/wiki/Koning_Willem_II-stadion","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Willem_II_stadion.jpg","page_title":"Koning Willem II-stadion","context_page_description":"Die Koning Willem II-stadion is aan die Goirleseweg in Tilburg, Nederland geleë. Dit is die tuisveld van die sokkerklub Willem II. Die stadion kan 14 750 toeskouers hanteer. Op 30 Januarie 2009 is 'Koning' by die naam van die stadion gevoeg, as verwysing na Koning Willem II van Nederland.\\nDie stadion het 'n A-B-C-D-E-F-G-H vak en 'n ere tribune noord en suid."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AF%D9%8A%D9%83_%D8%AC%D9%8A%D8%A8%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Lieutenant_Richard_Horace_Maconochie_Gibbs_%281893-1917.JPG","page_title":"ديك جيبس","context_page_description":"ديك جيبس ‏ هو لاعب كرة قدم أسترالية أسترالي، ولد في 4 فبراير 1893 في كولاك في أستراليا، وتوفي في 19 يوليو 1916 في فلوبايكس في فرنسا."},{"page_url":"https://de.wikipedia.org/wiki/Erfurter_Dom","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Erfurt_Dom_St._Marien_23.jpg","page_title":"Erfurter Dom","context_page_description":"Der Erfurter Dom ist der wichtigste und älteste Kirchenbau in Erfurt. Er ist 81,26 m hoch und besitzt mit der Gloriosa die größte freischwingende, aus dem Mittelalter stammende Glocke der Welt. Der Dom diente nur kurze Zeit in der Mitte des 8. Jahrhunderts als Bischofssitz und war das gesamte Mittelalter über bis in das frühe 19. Jahrhundert hinein Sitz des Kollegiatstifts St. Marien. Seit 1994 ist er wieder Kathedrale des neugeschaffenen Bistums Erfurt und Sitz des Domkapitels."},{"page_url":"https://eu.wikipedia.org/wiki/Portets","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Portets_Mairie.jpg","page_title":"Portets","context_page_description":"Portets Okzitaniako udalerri bat da. Administratiboki Frantziako Gironda departamenduan dago, Akitania Berria eskualdean. 2013an 2195 biztanle zituen."},{"page_url":"https://bar.wikipedia.org/wiki/1512","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/I.SelimC%C3%BClus.jpg","page_title":"1512","context_page_description":"Des is a Iwablick iwas Joar 1512."},{"page_url":"https://fr.wikipedia.org/wiki/Morrie_Ryskind","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/My_Man_Godfrey_promo_still.JPG","page_title":"Morrie Ryskind","context_page_description":"Morris « Morrie » Ryskind, né le 20 octobre 1895 à Brooklyn et mort le 24 août 1985 est un auteur dramatique, parolier et producteur de théâtre et de cinéma américain. Il est aussi connu comme militant conservateur."},{"page_url":"https://it.wikipedia.org/wiki/Presidenza_di_Andrew_Jackson","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/TrailofTearsMemorial-3.jpg","page_title":"Presidenza di Andrew Jackson","context_page_description":"La presidenza di Andrew Jackson ebbe inizio il 4 marzo del 1829 con la cerimonia d'inaugurazione e relativo insediamento del presidente degli Stati Uniti d'America e terminò il 4 marzo del 1837. Jackson, il 7º presidente degli Stati Uniti d'America, si insediò dopo aver sconfitto il presidente incumbent John Quincy Adams nelle elezioni presidenziali del 1828, duramente contestato da una larga maggioranza.\\nIn coalizione con altri oppositori di Adams, Jackson mobilitò il proprio apparato di sostegno a favore dell'elettorato occidentale e fondò una nuova forza politica che divenne il Partito Democratico.\\nRiuscirà così in tal modo ad ottenere un 2º mandato alle elezioni presidenziali del 1832, surclassando con estrema facilità l'avversario del \\"National Republican Party\\" Henry Clay. Gli succedette il Vicepresidente in carica Martin Van Buren.\\nLa sua presidenza vide e attuò diversi sviluppi nell'ambito degli affari interni."},{"page_url":"https://ca.wikipedia.org/wiki/Tensi%C3%B3_de_c%C3%A8rcol","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/P_vessel.svg","page_title":"Tensió de cèrcol","context_page_description":"L'esforç o tensió de cèrcol és un cas particular de tensió que pateixen les superfícies cilíndriques. En mecànica, una tensió cilíndrica és una distribució dels esforços en sòlids amb simetria rotacional; és a dir, sòlids que romanen amb la mateixa forma geomètrica si se'ls fa rodar respecte un eix fix. La mateixa invariabilitat ocorre amb els esforços de tipus cilíndric."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%86%D0%B1%D1%80%D0%B0%D0%B3%D1%96%D0%BC_%D0%9C%D0%BE%D1%85%D0%B0%D0%BC%D0%B5%D0%B4_%D0%A1%D0%BE%D0%BB%D1%96%D1%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Ibrahim_Mohamed_Solih_-_Maldives_%28cropped%29.jpg","page_title":"Ібрагім Мохамед Соліх","context_page_description":"Ібрагім Мохамед Соліх — державний і політичний діяч Мальдів, з 17 листопада 2018 року обіймає посаду президента країни.\\nВ 1994 році вперше був обраний депутатом до парламенту країни від атола Фаадхіпполху і з 2003 по 2008 рік відігравав провідну роль у формуванні Мальдівської демократичної партії і Мальдівського руху за політичні реформи — це сприяло тому, що Мальдіви вперше в своїй історії утвердили нову сучасну конституцію і перейшли до багатопартійної демократії. 23 вересня 2018 року після підбиття підсумків президентських виборів Ібрагім Мохамед Соліх був обраний президентом країни."},{"page_url":"https://ms.wikipedia.org/wiki/13_Ogos","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/01/Zatvor-c2.JPG","page_title":"13 Ogos","context_page_description":"13 Ogos merupakan hari ke-225 dalam kalendar Gregory. Tinggal 140 hari sebelum memasuki tahun selepasnya.\\nHari ini juga merupakan Hari Kemerdekaan untuk Republik Afrika Tengah."},{"page_url":"https://en.wikipedia.org/wiki/History_of_the_World_Wide_Web","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/First_Web_Server.jpg","page_title":"History of the World Wide Web","context_page_description":"The World Wide Web is a global information medium which users can access via computers connected to the Internet. The term is often mistakenly used as a synonym for the Internet itself and often called \\"the Internet\\", but the Web is a service that operates over the Internet, just as email and Usenet also do. The history of the Internet dates back significantly further than that of the World Wide Web."},{"page_url":"https://de.wikipedia.org/wiki/Erdnuss","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Arachis_hypogaea_003.JPG","page_title":"Erdnuss","context_page_description":"Die Erdnuss ist eine Pflanzenart in der Unterfamilie der Schmetterlingsblütler innerhalb der Familie der Hülsenfrüchtler. Die Frucht der Erdnuss ist botanisch gesehen eine Hülsenfrucht, die sich entwicklungsgeschichtlich zur Nuss gewandelt hat. Die Erdnuss gehört zur selben Unterfamilie wie beispielsweise die Erbse und die Bohnen-Arten. Der englische Trivialname der Erdnuss, peanut, weist auf die botanische Zugehörigkeit zur Familie der Hülsenfrüchtler hin.\\nDie Ähnlichkeit zu botanischen Nüssen ergibt sich durch die Beschaffenheit der Samen: die Konsistenz, den hohen Fettgehalt und den vergleichsweise niedrigen Anteil an Stärke. Im Vergleich zu echten Nüssen ist der Anteil an Omega-3-Fettsäuren gering. Im Gegensatz zu den meisten anderen Hülsenfrüchten sind Erdnüsse allerdings roh genießbar. Das allergene Potential ist im Vergleich zu anderen Lebensmitteln relativ hoch."},{"page_url":"https://no.wikipedia.org/wiki/Palazzo_Doria-Pamphili","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Pigna_-_palazzo_Doria_cortile_1080162.JPG","page_title":"Palazzo Doria-Pamphili","context_page_description":"Palazzo Doria Pamphili er et palass i Roma som ligger mellom Via del Corso, Piazza del Collegio Romano, Via della Gatta og Via del Plebiscito. I palasset huses blant annet Galleria Doria-Pamphili, en av Romas fremste kunstsamlinger.\\nPalassets eldste kjerne stammer fra 1435. Til denne tilkom et gårdsrom og en kolonnade i to etasjer. I begynnelsen av 1600-tallet gav kardinal Pietro Aldobrandini i oppdrag til Carlo Maderno å utvide palasset. Fasadelengden mot Piazza del Collegio Romano ble oppførts 1659–1663 av Antonio del Grande. Portalen åpner opp mot en monumentaltrapp som leder opp til piano nobile."},{"page_url":"https://nl.wikipedia.org/wiki/Jan_Palfijn","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Kopieverlostangpalfijn_26-04-2009_9-25-53.JPG","page_title":"Jan Palfijn","context_page_description":"Jan Palfijn was een Vlaams verloskundige. Zijn naam is nauw verbonden aan de door hem ontworpen verlostang die hij in 1723 in de openbaarheid brengt."},{"page_url":"https://pl.wikipedia.org/wiki/Zbo%C5%BCenna","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Dw%C3%B3r_Zbo%C5%BCenna_z_XVIII_w%2C_widok_od_strony_ogrodu.jpg","page_title":"Zbożenna","context_page_description":"Zbożenna – wieś w Polsce położona w województwie mazowieckim, w powiecie przysuskim, w gminie Przysucha. Zbożenna położona jest 37 km na zachód od Radomia przy drodze krajowej nr 12.\\nPrywatna wieś szlachecka Zborzona, położona była w drugiej połowie XVI wieku w powiecie radomskim województwa sandomierskiego.\\nW latach 1975–1998 miejscowość administracyjnie należała do województwa radomskiego.\\nWierni kościoła rzymskokatolickiego należą do parafii św. Wojciecha w Skrzyńsku lub\\nparafii św. Szczepana w Skrzynnie."},{"page_url":"https://hu.wikipedia.org/wiki/Francesco_Angelo_Rottonara","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Francesco_Angelo_Rottonara_arck%C3%A9pe.jpg","page_title":"Francesco Angelo Rottonara","context_page_description":"Franz Angelo Rottonara ladin nemzetiségű festőművész a dél-tiroli Gader-völgyből, aki az 1900-as években Bécsben színpadi festőként szerzett hírnevet."},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_Helsingin_julkisista_taideteoksista_ja_muistomerkeist%C3%A4","image_url":"https://upload.wikimedia.org/wikipedia/fi/d/df/Edward_von_Longus_Ats_Pets_2017.JPG","page_title":"Luettelo Helsingin julkisista taideteoksista ja muistomerkeistä","context_page_description":"Luettelo Helsingin julkisista taideteoksista ja muistomerkeistä sisältää Helsingin puistoissa, kaduilla ja aukioilla olevat pysyvät taideteokset ja muistomerkit. Ne kuuluvat joko Helsingin taidemuseon kokoelmiin, tai ovat julkisilla paikoilla olevia liikelaitosten, yritysten, valtion ja yksityisten tonteilla sijaitsevia ja näiden omistamia teoksia. Rakennusten sisällä olevia julkisia teoksia ei mainita. Luettelossa on myös hautausmailla olevia yleisiä muistomerkkejä ja patsaita, mutta ei yksittäisten hautojen veistoksia.\\nHelsinkiin on liitetty Haagan kauppala sekä Huopalahden, Kulosaaren ja Oulunkylän kunnat vuoden 1946 suuressa alueliitoksessa.\\nMuistolaatat ovat omassa luettelossaan."},{"page_url":"https://nn.wikipedia.org/wiki/Mari_Boine","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Mari_Boine2_Warszawa_Sep2007b.jpg","page_title":"Mari Boine","context_page_description":"Mari Boine, tidlegare Mari Boine Persen, er ein samisk songartist. Mari Boine er sannsynlegvis den internasjonalt mest kjende representanten for det samiske folket. Ho syng tradisjonell joik, men har også fornya den med element frå jazz, rock og folkemusikk frå mange ulika kulturar.\\nTil Vinter-OL på Lillehammer i 1994 takka ho nei til å opptre, fordi ho såg invitasjonen som eit forsøk på å få henne til å tene som kulturelt alibi for det norske storsamfunnet."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_D%C3%B6rzbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Schlo%C3%9F_Me%C3%9Fbach_20130501.jpg","page_title":"Liste der Kulturdenkmale in Dörzbach","context_page_description":"In der Liste der Kulturdenkmale in Dörzbach sind unbewegliche Bau- und Kunstdenkmale aller Ortsteile von Dörzbach aufgeführt. Die Gemeinde Dörzbach besteht aus dem Hauptort Dörzbach und den Ortsteilen Hohebach, Laibach und Meßbach. Grundlage für diese Liste ist die vom Regierungspräsidium Stuttgart herausgegebene Liste der Bau- und Kunstdenkmale.\\nDiese Liste ist nicht rechtsverbindlich. Eine rechtsverbindliche Auskunft ist lediglich auf Anfrage bei der Unteren Denkmalschutzbehörde der Gemeinde Dörzbach erhältlich."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kamen%C5%AF_zmizel%C3%BDch_v_Josefov%C4%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Stolperstein_f%C3%BCr_Hermina_B%C3%B6hmova.jpg","page_title":"Seznam kamenů zmizelých v Josefově","context_page_description":"Seznam kamenů zmizelých v Josefově obsahuje pamětní kameny obětem nacismu v Josefově. Jsou součástí celoevropského projektu Stolpersteine německého umělce Guntera Demniga. Kameny zmizelých jsou věnovány osudu těch, kteří byli nacisty deportováni, vyhnáni, zavražděni nebo spáchali sebevraždu.\\nKameny zmizelých se zpravidla nacházejí před posledním místem pobytu obětí. První instalace v Praze se uskutečnila 8. října 2008.\\nNe všechny kameny zmizelých jsou pod patronací Guntera Demniga."},{"page_url":"https://ru.wikipedia.org/wiki/Onlyoffice","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Logo_light_tl.png","page_title":"Onlyoffice","context_page_description":"ONLYOFFICE — офисный пакет с открытым исходным кодом, разработанный компанией Ascensio System SIA с головным офисом в Риге. Решение включает в себя систему для управления документами, проектами, взаимоотношениями с клиентами и электронной почтой.\\nДоступны облачная версия и версия для развертывания в локальной сети. Кроме того, редакторы ONLYOFFICE интегрируются с популярными платформами для совместной работы, включая ownCloud, Nextcloud, SharePoint и другими. ONLYOFFICE является официальным технологическим партнером Nextcloud, ownCloud, SeaFile, Pydio, eXo Platform и XWiki."},{"page_url":"https://fy.wikipedia.org/wiki/D%C3%BAtske_mark","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/2DM-Planck_2.jpg","page_title":"Dútske mark","context_page_description":"De Dútske mark, formeel ôfkoarte ta DM mar ek faak D-Mark neamd, wie de offisjele muntienheid fan it weriene Dútslân fan 1990 oant 2002, en dêrfoar fan West-Dútslân fan 1948 oant 1990. Dizze munt waard ynfierd ûnder de Alliëarde besetting fan Dútslân nei de Twadde Wrâldoarloch, en kaam doe yn it plak fan 'e ryksmark. De Dútske mark ûntjoech him fan likernôch 1960 ôf ta ien fan 'e sterkste en stabylste muntienheden fan 'e wrâld, en it wie by banksaken nei de Amerikaanske dollar de meast brûkte ynternasjonale reservemunt. Yn 2002 waard de Dútske mark ferfongen troch de euro. De Dútske mark waard útjûn troch de Deutsche Bundesbank en wie ferdield yn hûndert pfennige oftewol peinjes."},{"page_url":"https://it.wikipedia.org/wiki/Deola","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Deolawiki.JPG","page_title":"Deola","context_page_description":"Eliton Deola è un calciatore brasiliano, portiere della Juventus."},{"page_url":"https://eu.wikipedia.org/wiki/Hegoaldeko_suge_leun","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Coronella_girondica_Geres_2.JPG","page_title":"Hegoaldeko suge leun","context_page_description":"Hegoaldeko suge leuna hegoaldeko Europa eta iparraldeko Afrikako baso epeletan bizi den Colubridae familiako sugea da.\\nHegoaldeko suge leunaren latinezko izena Coronella girondica da. Coronella hitzak 'koro txikia' esan nahi du latinez eta suge honi atxikitu zaio buruan aurkezten duen orbanagatik. Luzera txikiko sugea da eta hegoaldeko Europan eta iparraldeko Afrikan bizi da. Euskal Herrian Gipuzkoan eta batez ere Araba eta Nafarroan suge arrunta da."},{"page_url":"https://en.wikipedia.org/wiki/Josef_Hofmann","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Metropolitan_Opera_House%2C_a_concert_by_pianist_Josef_Hofmann_-_NARA_541890_-_Edit.jpg","page_title":"Josef Hofmann","context_page_description":"Josef Casimir Hofmann was a Polish American pianist, composer, music teacher, and inventor."},{"page_url":"https://de.wikipedia.org/wiki/Kloster_Himmelkron","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/K%C3%BCnsberg_Kreuzgang.JPG","page_title":"Kloster Himmelkron","context_page_description":"Das Kloster Himmelkron war vom 13. bis zum 16. Jahrhundert eine Zisterzienserinnen-Abtei in Himmelkron in Oberfranken in der Diözese Bamberg. Danach diente es den Bayreuther Markgrafen bis zum 19. Jahrhundert als Sommerresidenz und Jagdschloss. Heute ist es Wohnheim und Tagesstätte für Menschen mit geistiger Behinderung.\\nDie ursprünglich gotische Klosterkirche wurde im 17. und 18. Jahrhundert barockisiert. Heute ist die Stiftskirche St. Maria eine evangelisch-lutherische Pfarrkirche. Von den übrigen Gebäuden des Klosters ist nur noch ein Flügel des gotischen Kreuzgangs erhalten, die heutigen Gebäude stammen überwiegend aus dem 16. bis 18. Jahrhundert. Der gesamte Gebäudekomplex ist sowohl als Baudenkmal als auch als Bodendenkmal in die Bayerische Denkmalliste eingetragen."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%97%E3%82%A8%E3%83%AB%E3%83%88%E3%83%AA%E3%82%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/La_Concha.JPG","page_title":"プエルトリコ","context_page_description":"プエルトリコ自治連邦区、通称プエルトリコは、カリブ海北東に位置するアメリカ合衆国の自治的・未編入領域であり、コモンウェルスという政治的地位にある。プエルトリコ本島、ビエケス島、クレブラ島、ドミニカ共和国との間のモナ海峡にあるモナ島などから構成される。ヴァージン海峡を隔てて東にヴァージン諸島が、モナ海峡を隔てて西にドミニカ共和国が存在する。主都はサン・フアン。"},{"page_url":"https://it.wikipedia.org/wiki/Maria_de%27_Medici","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Peter_Paul_Rubens_095b.jpg","page_title":"Maria de' Medici","context_page_description":"Maria de' Medici è stata regina consorte di Francia e Navarra come seconda moglie di Enrico IV di Francia dal 1600 al 1610."},{"page_url":"https://eu.wikipedia.org/wiki/Iran","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Ali_Khamenei_receives_Xi_Jinping_in_his_house_%287%29.jpg","page_title":"Iran","context_page_description":"Iran, ofizialki Irango Islamiar Errepublika, Hego-mendebaldeko Asiako estatua da, 1935 arte Persia izena zuena. Iparraldean Armenia, Azerbaijan eta Turkmenistanekin du muga, Pakistan eta Afganistanekin ekialdean, eta Turkia eta Irakekin mendebaldean. 1.648.195 kilometro koadroko eremua dauka, eta 2016an 82,8 milioi biztanle zituen. Hiriburua Teheran da.\\nIrango Barne produktu gordina 412,3 mila milioi dolarrekoa izan zen 2015ean, munduko 29.a, eta per capita errenta 17.600 dolarrekoa. Munduko zazpigarren petrolio ekoizlea da eta 16. esportatzailea. Munduko bigarren gas erreserba handienak dauzka, Errusiaren ondotik, eta hirugarren ekoizlea da."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D1%80%D1%83%D0%BC%D1%8A%D0%BD%D0%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0f/Macedonian_Vlah_Family_IWW.jpg","page_title":"Арумъни","context_page_description":"Арумъни са народ, населяващ южните части на Балканския полуостров: Северна Гърция, части от Албания, Северна Македония и България."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B5%D6%80%D6%87%D5%A1%D5%B6%D5%B5%D5%A1%D5%B6_%D5%BB%D5%B8%D5%AF%D5%A1%D5%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Ivanlazarev.jpeg","page_title":"Երևանյան ջոկատ","context_page_description":"Երևանյան ջոկատ, ռուսական բանակի զորամիավորում գեներալ-լեյտենանտ Տեր Ղուկասովի հրամանատարությամբ։ Կազմավորվել է 1877 թվականի ապրիլի սկզբին և կազմել է Կովկասյան ռազմաճակատում գործող ձախ թևը գեներալ Լոռիս-Մելիքովի ընդհանուր հրամանատարության ներքո 1877-1878 թվականների ռուս-թուրքական պատերազմի ժամանակ:"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A7%D0%B5%D1%85%D0%BE%D0%B2,_%D0%90%D0%BD%D1%82%D0%BE%D0%BD_%D0%9F%D0%B0%D0%B2%D0%BB%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Chekhov_1898_by_Osip_Braz.jpg","page_title":"Чехов, Антон Павлович","context_page_description":"Анто́н Па́влович Че́хов — русский писатель, прозаик, драматург, врач.\\nКлассик мировой литературы. По профессии врач. Почётный академик Императорской Академии наук по разряду изящной словесности. Один из самых известных драматургов мира. Его произведения переведены более чем на сто языков. Его пьесы, в особенности «Чайка», «Три сестры» и «Вишнёвый сад», на протяжении более ста лет ставятся во многих театрах мира.\\nЗа 25 лет творчества Чехов создал более пятисот различных произведений, многие из которых стали классикой мировой литературы. Особенное внимание обратили на себя «Степь», «Скучная история», «Дуэль», «Палата № 6», «Дом с мезонином», «Душечка», «Попрыгунья», «Рассказ неизвестного человека», «Мужики», «Человек в футляре», «В овраге», «Детвора», «Драма на охоте»; из пьес: «Иванов», «Чайка», «Дядя Ваня», «Три сестры», «Вишнёвый сад»."},{"page_url":"https://hu.wikipedia.org/wiki/Massoins","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a0/Massoins.jpg","page_title":"Massoins","context_page_description":"Massoins település Franciaországban, Alpes-Maritimes megyében. Lakosainak száma 107 fő. Massoins Bairols, Malaussène, Tournefort és Villars-sur-Var községekkel határos."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D9%87%D8%B1%D8%B3%D8%AA_%D8%AF%D8%B3%D8%B1%D9%87%D8%A7_%D9%88_%D8%B4%DB%8C%D8%B1%DB%8C%D9%86%DB%8C%E2%80%8C%D9%87%D8%A7%DB%8C_%DA%98%D8%A7%D9%BE%D9%86%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Namagashi.jpg","page_title":"فهرست دسرها و شیرینی‌های ژاپنی","context_page_description":"فهرست دسرها و شیرینی‌های ژاپنی در آشپزی ژاپنی، شیرینی‌های سنتی ژاپنی به عنوان واگاشی شناخته می‌شوند. مواد تشکیل دهنده مانند آن و موچی در واگاشی کاربرد دارند. به غیر از آن بسیاری از شیرینی‌ها و دسرهای مدرن نیز در ژاپن وجود دارد."},{"page_url":"https://uk.wikipedia.org/wiki/Pereskia_aculeata","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Pereskia_aculeata_4.jpg","page_title":"Pereskia aculeata","context_page_description":"Пейрескія колючкувата — вид рослин родини Кактусові."},{"page_url":"https://nl.wikipedia.org/wiki/Denver_Pyle","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Keir_Dullea_Denver_Pyle_1962.JPG","page_title":"Denver Pyle","context_page_description":"Denver Dell Pyle was een Amerikaans acteur. Hij is met name bekend geworden als Uncle Jesse in de televisieserie The Dukes of Hazzard.\\nGedurende zijn lange carrière, die eind jaren '40 al begon, speelde hij vooral in westernfilms. Ook was hij te zien in Bonnie and Clyde, The Man Who Shot Liberty Valance en Maverick.\\nIn 1952 speelde Pyle voor het eerst in een televisieserie. Vanaf 1979 was hij te zien in de serie The Dukes of Hazzard, en hij speelde ook nog in de eerste The Dukes of Hazzard-film mee.\\nPyle overleed op 77-jarige leeftijd aan longkanker. Twee weken voor zijn dood ontving hij een ster op de Hollywood Walk of Fame. Ondanks zijn vergevorderde ziekte, was hij in staat om de ceremonie bij te wonen."},{"page_url":"https://sv.wikipedia.org/wiki/Milit%C3%A4ra_grader_i_sydstatsarm%C3%A9n_under_det_amerikanska_inb%C3%B6rdeskriget","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Confederate_States_of_America_First_Sergeant-Marines.png","page_title":"Militära grader i sydstatsarmén under det amerikanska inbördeskriget","context_page_description":"Militära grader i sydstatsarmén under det amerikanska inbördeskriget visar den hierarkiska ordningen i Amerikas konfedererade staters armé, flotta och marinkår under det amerikanska inbördeskriget 1861-1865."},{"page_url":"https://en.wikipedia.org/wiki/Vermont_Catamounts_men%27s_ice_hockey","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/John_LeClair_%281%29.jpg","page_title":"Vermont Catamounts men's ice hockey","context_page_description":"The Vermont Catamounts men's ice hockey team is a National Collegiate Athletic Association Division I college ice hockey program that represents the University of Vermont. The Catamounts are a member of Hockey East, joining in 2005 after competing in ECAC Hockey from 1974-2005. They play home games at Gutterson Fieldhouse in Burlington, Vermont. Vermont has appeared in the NCAA Men's Hockey Championship five times since making the move to Division I in 1974-75 including trips to the Frozen Four in 1996 and 2009.\\nPrior to moving to Division I, UVM competed in ECAC Division II, where it won back-to-back ECAC Division II titles in 1972-73 and 1973-74.\\nSince 1990, the Catamounts have hosted what is now known as the Catamount Cup tournament, winning the title five times."},{"page_url":"https://pl.wikipedia.org/wiki/Mertesheim","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/03/Mertesheim_Katholische_Kirche_2.JPG","page_title":"Mertesheim","context_page_description":"Mertesheim – miejscowość i gmina w Niemczech, w kraju związkowym Nadrenia-Palatynat, w powiecie Bad Dürkheim, wchodzi w skład gminy związkowej Leiningerland. Do 31 grudnia 2017 należała do gminy związkowej Grünstadt-Land."},{"page_url":"https://sk.wikipedia.org/wiki/Padoux","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Padoux_mairie_%C3%A9glise_%C3%A9coles_01.JPG","page_title":"Padoux","context_page_description":"Padoux je francúzska obec, ktorá sa nachádza v departemente Vosges, v regióne Lotrinsko."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%BB%D0%B5%D0%BD%D1%8C%D0%B5_%D0%BE%D0%B7%D0%B5%D1%80%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Canada.A2002236.1810.721.250m_NASA.jpg","page_title":"Оленье озеро","context_page_description":"Оле́нье о́зеро — озеро в центральной части Канады, на границе провинций Саскачеван и Манитоба, бо́льшая часть озера находится на территории Саскачевана. Озеро имеет ледниковое происхождение. Площадь водосбора 60 000 км². Площадь водной поверхности озера — 5650 квадратных километров, общая площадь — 6650 квадратных километров. С ноября по июнь покрыто льдом. Объём воды — 95,25 км³. Высота над уровнем моря — 337 м.\\nСкорее всего, название озера является переводом его алгонкинского названия. Это второе по величине озеро в провинции Саскачеван и девятое в Канаде. Береговая линия сильно изрезана, более 5500 мелких островов. На восточном берегу расположен посёлок Кинусао, на северном — Броше, на южном — Саутхенд. Сток воды в южной части озера, через Оленью реку и плотину в реку Черчилл и далее на восток в Гудзонов залив. Рыболовство, спортивная рыбалка, специализация — северная щука, судак, арктический хариус, также ловится озёрная форель.\\nВ южной оконечности Оленьего озера находится Глубокая бухта, ширина около 5 км, глубина до 220 м, она образовалась в результате падения метеорита около 100 млн лет назад."},{"page_url":"https://ur.wikipedia.org/wiki/%D9%BE%D8%AA%DA%BE%D8%B1_%DA%AF%DA%BE%D8%A7%D9%B9%D8%A7_%D8%B0%DB%8C%D9%84%DB%8C_%D8%B6%D9%84%D8%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/%E0%A6%AC%E0%A6%A8_%E0%A6%89%E0%A6%9C%E0%A6%BE%E0%A6%A1%E0%A6%BC_%E0%A6%95%E0%A6%B0%E0%A7%87_%E0%A6%97%E0%A6%A1%E0%A6%BC%E0%A7%87_%E0%A6%93%E0%A6%A0%E0%A6%BE_%E0%A6%86%E0%A6%AC%E0%A6%BE%E0%A6%A6%E0%A6%BF_%E0%A6%9C%E0%A6%AE%E0%A6%BF.jpg","page_title":"پتھر گھاٹا ذیلی ضلع","context_page_description":"پتھر گھاٹا ذیلی ضلع بنگلہ دیش کا ایک بنگلا دیش کے ذیلی اضلاع جو برگونا ضلع میں واقع ہے۔"},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A7%E0%B8%B1%E0%B8%94%E0%B8%81%E0%B8%B9%E0%B9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/%E0%B8%A7%E0%B8%B1%E0%B8%94%E0%B8%81%E0%B8%B9%E0%B9%89_%E0%B8%AD.%E0%B8%9B%E0%B8%B2%E0%B8%81%E0%B9%80%E0%B8%81%E0%B8%A3%E0%B9%87%E0%B8%94_%E0%B8%88.%E0%B8%99%E0%B8%99%E0%B8%97%E0%B8%9A%E0%B8%B8%E0%B8%A3%E0%B8%B5_%2834%29.jpg","page_title":"วัดกู้","context_page_description":"วัดกู้ เป็นวัดในจังหวัดนนทบุรี เป็นที่รู้จักจากเหตุการณ์เรือพระประเทียบล่มในแม่น้ำเจ้าพระยาบริเวณใกล้กับวัด อันนำมาสู่การสวรรคตของสมเด็จพระนางเจ้าสุนันทากุมารีรัตน์ พระบรมราชเทวี พระอัครมเหสีในพระบาทสมเด็จพระจุลจอมเกล้าเจ้าอยู่หัว ขณะตามเสด็จฯ แปรพระราชฐานไปยังพระราชวังบางปะอิน พระองค์สิ้นพระชนม์พร้อมด้วยสมเด็จพระเจ้าบรมวงศ์เธอ เจ้าฟ้ากรรณาภรณ์เพ็ชรรัตน์ โสภางคทัศนิยลักษณ์ อรรควรราชกุมารี พระราชธิดา และพระราชบุตรในพระครรภ์ซึ่งยังไม่ทราบว่าเป็นพระราชโอรสหรือพระราชธิดา"},{"page_url":"https://en.wikipedia.org/wiki/Muckross_Lake","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Muckross_Lake%2C_Killarney_National_Park_-_geograph.org.uk_-_449931.jpg","page_title":"Muckross Lake","context_page_description":"Muckross Lake, also called Middle Lake or The Torc, is a lake in Killarney National Park, County Kerry, Ireland. It is one of the three famous Lakes of Killarney, along with Lough Leane and Upper Lake. It is Ireland's deepest lake, reaching to 75 metres in parts."},{"page_url":"https://sv.wikipedia.org/wiki/B%C3%A4ckah%C3%A4sten_(restaurang)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Hamngatan_2%2C_tidigare_restaurang_B%C3%A4ckah%C3%A4sten%2C_sept_2019.jpg","page_title":"Bäckahästen (restaurang)","context_page_description":"Restaurang Bäckahästen låg på Hamngatan 2 på Norrmalm i Stockholm. Stället öppnade i mitten av 1920-talet och stängde i början av 2000-talet. På platsen finns idag nattklubben och nattbistron FOU."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%86%AC%E5%AD%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Akebrett.JPG","page_title":"冬季","context_page_description":"冬季是部分地區一年四季中的第四季，由於天氣轉冷，在很多地區都意味著沉寂和冷清。生物在寒冷來襲的時候會減少生命活動，很多植物會落葉，動物會休眠，有的稱作冬眠。候鳥會飛到較為溫暖的地方過冬。以北半球為例，除了赤道一帶其他地方都有冬季：曼谷冬季約兩個月、北極冬季約七個月。用來形容冬天的成語：天寒地凍、冰天雪地。而有趣的是，有些地區的冬季氣溫平均並沒有非常低，但體感溫度卻低於實際溫度，這是因為這些地方空氣濕度較高。"},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%AA%E0%B4%BE%E0%B4%AF%E0%B4%BF%E0%B4%AA%E0%B5%8D%E0%B4%B0_%E0%B4%B0%E0%B4%BE%E0%B4%A7%E0%B4%BE%E0%B4%95%E0%B5%83%E0%B4%B7%E0%B5%8D%E0%B4%A3%E0%B5%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/PAIPRA.jpg","page_title":"പായിപ്ര രാധാകൃഷ്ണൻ","context_page_description":"മലയാള എഴുത്തുകാരൻ, കോളമിസ്റ്റ്, പത്രാധിപർ, സാംസ്കാരിക നിരീക്ഷകൻ എന്നീ നിലകളിൽ ശ്രദ്ധേയനാണ് പായിപ്ര രാധാകൃഷ്ണൻ. 1991-1995 കാലഘട്ടത്തിൽ കേരള സാഹിത്യ അക്കാദമിയുടെ സെക്രട്ടറിയായിരുന്നു. അക്ഷയ പുസ്തകനിധിയുടെ പ്രസിഡന്റും ആർഷവിദ്യാപീഠത്തിന്റെ ഡയറക്ടറുമാണ്. കലാകൗമുദി പ്രതിവാരത്തിൽ ആഴ്ചവെട്ടം എന്ന സാംസ്കാരിക വിമർശക കോളം എഴുതുന്നു. ചെറുകഥകൾ, ഉപന്യാസങ്ങൾ, കുട്ടികളുടെ സാഹിത്യം എന്നീ മേഖലകളിൽ അനേകം പുസ്തകങ്ങൾ രചിച്ചിട്ടുണ്ട്. നിരവധി അന്താരാഷ്ട്ര, ദേശീയ സാഹിത്യ പരിപാടികളിലും പുസ്തകമേളകളിലും അദ്ദേഹം കേരളത്തെ പ്രതിനിധീകരിച്ചു."},{"page_url":"https://fr.wikipedia.org/wiki/North_Providence","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ec/Allendale_Mill.jpg","page_title":"North Providence","context_page_description":"North Providence est une ville située dans l'État américain de Rhode Island."},{"page_url":"https://de.wikipedia.org/wiki/Dekanat_Neu-Ulm","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/14/V%C3%B6hringen%2C_Katholische_Pfarrkirche_St._Michael%2C_002.jpg","page_title":"Dekanat Neu-Ulm","context_page_description":"Das Dekanat Neu-Ulm mit Sitz in Neu-Ulm ist eines von 23 Dekanaten des römisch-katholischen Bistums Augsburg.\\nDas Dekanat entstand im Zuge der Bistumsreform vom 1. Dezember 2012 durch die Zusammenlegung der früheren Dekanate Neu-Ulm und Illertissen."},{"page_url":"https://nl.wikipedia.org/wiki/Uitgeverij_Zwijsen","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Uitgeverij_Zwijsen_Tilburg_DSCF9460.jpg","page_title":"Uitgeverij Zwijsen","context_page_description":"Uitgeverij Zwijsen is een Nederlandse uitgeverij van educatieve boeken voor peuters, kleuters en basisschoolleerlingen. Monseigneur Joannes Zwijsen stond aan de basis van het bedrijf, door in 1846 de Drukkerij van het R.K. Jongensweeshuis op te richten in Tilburg. Uitgeverij Zwijsen is een uitgever in het basisonderwijs en het VVE. Lesmethoden zoals Schatkist, Veilig leren lezen, Estafette, Pennenstreken en De Zaken van Zwijsen vallen onder de uitgeverij."},{"page_url":"https://en.wikipedia.org/wiki/Virginia%27s_26th_Senate_district","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Virginia_Senate_District_26_%282011%29.png","page_title":"Virginia's 26th Senate district","context_page_description":"Virginia's 26th Senate district is one of 40 districts in the Senate of Virginia. It has been represented by Republican Senator Mark Obenshain since 2004, succeeding fellow Republican Kevin Miller."},{"page_url":"https://es.wikipedia.org/wiki/Pipa","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Pipe_Fleur.jpg","page_title":"Pipa","context_page_description":"Una pipa o cachimba es un objeto utilizado para fumar tabaco. Consiste típicamente en una pequeña cámara para la combustión y un tubo que termina en la boquilla, donde se descarga el humo procedente de la combustión. Las pipas se fabrican de diversos tamaños y con una gran variedad de materiales, siendo los más comunes: brezo, maíz, espuma de mar, arcilla, cerezo, vidrio, porcelana, ebonita, metacrilato y otros materiales menos usuales."},{"page_url":"https://nl.wikipedia.org/wiki/Thomas_Atkins","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Up_to_Him_-_Lute_Pease.jpg","page_title":"Thomas Atkins","context_page_description":"Thomas Atkins was een Engels soldaat, die sneuvelde in de Slag om Boxtel.\\nDeze veldslag werd geleverd tegen de Franse troepen welke deze slag wonnen.\\nDe Hertog van Wellington was aanwezig bij de stervende soldaat toen die zijn laatste woorden sprak: It's allright sir, it's all in a days work.\\nDe hertog was hier zeer van onder de indruk en vijftig jaar nadien herinnerde hij zich de naam van deze soldaat nog: Tommy. Zo werd de naam Tommy overgedragen op een Engels soldaat in het algemeen, en met name tijdens de Eerste Wereldoorlog en de Tweede Wereldoorlog.\\nMogelijk dat Thomas te Boxtel is begraven: op 25 september 1794 staat in het begraafboek vermeld: Een soldaat."},{"page_url":"https://en.wikipedia.org/wiki/North_Ostrobothnia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/View_from_Iivaara_%28170375758%29.jpg","page_title":"North Ostrobothnia","context_page_description":"North Ostrobothnia is a region of Finland. It borders the Finnish regions of Lapland, Kainuu, North Savo, Central Finland and Central Ostrobothnia, as well as the Russian Republic of Karelia."},{"page_url":"https://el.wikipedia.org/wiki/%CE%8A%CE%B3%CE%BA%CE%BF%CF%81_%CE%A3%CE%BF%CF%85%CE%B2%CE%AC%CE%BB%CE%BF%CF%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Igor_Shuvalov_-_World_Economic_Forum_Annual_Meeting_2011_Cropped.JPG","page_title":"Ίγκορ Σουβάλοφ","context_page_description":"O Ίγκορ Ιβάνοβιτς Σουβάλοφ είναι Ρώσος δικηγόρος και πολιτικός. Από τον Μάιο του 2012 υπηρετεί ως πρώτος Αναπληρωτής Πρωθυπουργός της Ρωσίας, στην σημερινή κυβέρνηση του Προέδρου Πούτιν. Στην προηγούμενη κυβέρνηση του τότε Προέδρου Ντιμιτρι Μεντβεντεφ υπηρέτησε στην ίδια θέση. Ως πρώτος αναπληρωτής πρωθυπουργός είναι το πιο υψηλόβαθμο στέλεχος του υπουργικού συμβουλίου μετά τον πρωθυπουργό, καθώς και υπεύθυνος για τον ομοσπονδιακό προϋπολογισμό και την οικονομική πολιτική."},{"page_url":"https://ast.wikipedia.org/wiki/Gentiana_pneumonanthe","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Gentiana_pneumonanthe_130805b.jpg","page_title":"Gentiana pneumonanthe","context_page_description":"La genciana de turbera ye una especie de genciana."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B1%E3%82%B9%E3%82%B1%E3%83%9F%E3%83%88%E3%83%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Swinging_figurines_%28Frida27Ponce%29.jpg","page_title":"ケスケミトル","context_page_description":"ケスケミトルとは、メキシコ先住民の女性用の貫頭衣の一種。ケシュケミトル、ケチケミトルとも呼ばれる。\\n先コロンブス期から存在した簡単な外套で、ポンチョと似るが丈が短く、肩から胸を覆う。先コロンブス期には女神と貴族の女性のみが着用するものだったが、スペイン人による征服の後に規制が緩み、先住民の女性によって広く着用されるようになった。\\nカミサ、ファルダの上に着つける。昔は上半身は素肌にケスケミトルだけをつけて外出することもあった。\\n長方形の布を二枚縫い合わせて仕立てたものが多い。ポンチョが体の前後に対辺が来るように身につけるのに対して、体の前後に対角が来るように身につけることが多い。\\nケスケミトルの使用は主に中央メキシコの先住民に多く、ナヤリット州、ハリスコ州、ケレタロ州、メキシコ州、イダルゴ州、プエブラ州、ベラクルス州などに居住するワステカ族、ナワ族、テペワ族、オトミ族、マサワ族、パメ族、ウィチョール族の女性の衣装に見られる。また、ミチョアカン州ウルアパン付近やモレロス州、ゲレーロ州、オアハカ州の一部でも見られる。部族によってデザインの違いは大きい。"},{"page_url":"https://gl.wikipedia.org/wiki/Turbidita","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Turbidite_2.JPG","page_title":"Turbidita","context_page_description":"Unha turbidita é o depósito xeolóxico producido por unha corrente de turbidez, que consiste nun tipo de fluxo gravitatorio de sedimentos responsable de distribuír unha vasta cantidade de sedimentos clásticos no océano profundo."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B5%A6%E5%92%8C%E6%98%8E%E3%81%AE%E6%98%9F%E5%A5%B3%E5%AD%90%E4%B8%AD%E5%AD%A6%E6%A0%A1%E3%83%BB%E9%AB%98%E7%AD%89%E5%AD%A6%E6%A0%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/%E6%B5%A6%E5%92%8C%E6%98%8E%E3%81%AE%E6%98%9F%E3%82%AB%E3%83%95%E3%82%A7%E3%83%86%E3%83%AA%E3%82%A2.jpg","page_title":"浦和明の星女子中学校・高等学校","context_page_description":"浦和明の星女子中学・高等学校は、学校法人明の星学園が運営し、埼玉県さいたま市緑区に所在する女子中学校・高等学校。完全中高一貫校。カトリックミッションスクールである。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9E%D0%B1%27%D1%94%D0%BA%D1%82_199","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/%D0%91%D0%9C%D0%9F%D0%A2_%D0%A0%D0%B0%D0%BC%D0%BA%D0%B0_%281%29.JPG","page_title":"Об'єкт 199","context_page_description":"Об'єкт 199 «Рамка» — російська бойова машина вогневої підтримки: бойова машина, призначена для дії у складі танкових формувань з ціллю ураження танконебезпечних засобів супротивника — для ефективного знищення живої сили, яка має гранатомети, протитанкові комплекси, стрілецьку зброю; є можливість уражати на ходу і з місця танки, БМП, доти, дзоти та інші високозахищені цілі."},{"page_url":"https://be.wikipedia.org/wiki/%D0%93%D0%B5%D0%BE%D1%80%D0%B3%D1%96%D0%B9_%D0%90%D1%84%D0%BE%D0%BD%D1%81%D0%BA%D1%96","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/Sabinin._St_George_the_Hagiorite.jpg","page_title":"Георгій Афонскі","context_page_description":"Георгій Афонскі — грузінскі царкоўны пісьменнік, перакладчык, каліграф. Быў настаяцелем манастыра івераў на Афоне. Узначаліў пры Баграце IV правядзенне рэформаў царкоўна-палітычнага жыцця Грузіі. Перакладаў на грузінскую мову грэчаскія кнігі, аднавіў правільныя тэксты шматлікіх кніг. Асноўныя творы Георгія Афонскага — «Жыціе заснавальнікаў Афона-Іверскай Лаўры Іаана і сына яго Яўхіма»."},{"page_url":"https://cs.wikipedia.org/wiki/Otrokovice","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Batovy_domky_1.jpg","page_title":"Otrokovice","context_page_description":"Otrokovice jsou druhé největší město v okrese Zlín ve Zlínskem kraji, leží 10 km jihozápadně od Zlína na soutoku Moravy a Dřevnice. Místní části, někdejší samostatné vesnice, jsou Otrokovice a Kvítkovice. Žije zde přibližně 18 tisíc obyvatel.\\nLeží na rozhraní tří moravských národopisných regionů – Slovácka, Valašska a Hané. Střídavě bývá řazeno ke všem uvedeným regionům. Jeho přiřazení k Hané je dáno tím, že původní obce, z nichž město vyrostlo, byly hanácké. Ovšem podle převládajícího slováckého nářečí je možno město řadit též ke Slovácku. Od roku 1933 se pro celé město začalo neoficiálně používat pojmenování Baťov. K právnímu zakotvení tohoto názvu došlo však až v červnu 1939. Název Baťov byl odebrán v roce 1946."},{"page_url":"https://en.wikipedia.org/wiki/Andrej_Kibrik","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/AAK.jpg","page_title":"Andrej Kibrik","context_page_description":"Andrej Kibrik is a Russian linguist, the director of the Institute of Linguistics of the Russian Academy of Sciences, and professor at the Philological Faculty of the Moscow State University. Member of the Academia Europaea since 2013.\\nKibrik's main research interests lie in the fields of cognitive linguistics, discourse analysis, semantics, grammar, functional linguistics, linguistic typology, areal linguistics, language documentation. he has worked on Athabaskan languages, Caucasian languages, and Turkic languages, among others."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B0%D1%80%D1%96_(%D0%9F%D1%80%D0%B8%D0%BC%D0%BE%D1%80%D1%81%D1%8C%D0%BA%D1%96_%D0%90%D0%BB%D1%8C%D0%BF%D0%B8)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e6/Village-Marie.JPG","page_title":"Марі (Приморські Альпи)","context_page_description":"Марі́ — муніципалітет у Франції, у регіоні Прованс-Альпи-Лазурний берег, департамент Приморські Альпи. Населення — 83 осіб.\\nМуніципалітет розташований на відстані близько 650 км на південний схід від Парижа, 165 км на північний схід від Марселя, 39 км на північ від Ніцци."},{"page_url":"https://pt.wikipedia.org/wiki/Ilha_Aiktak","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Aiktak_beach.jpg","page_title":"Ilha Aiktak","context_page_description":"A Ilha Aiktak ou Ashmiak é uma ilha do arquipélago Fox nas Ilhas Aleutas, no estado do Alasca. Atualmente se encontra despovoada."},{"page_url":"https://sl.wikipedia.org/wiki/%C5%BDelezni%C5%A1ka_postaja_Tr%C5%BEi%C5%A1%C4%8De","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/65/Trzisce-train_station.jpg","page_title":"Železniška postaja Tržišče","context_page_description":"Železniška postaja Tržišče je ena izmed železniških postaj v Sloveniji, ki oskrbuje bližnje naselje Tržišče.\\nOb izgradnji je Tržišče bilo ena izmed postaj na progi med Trebnjim in Krmeljem. Železniško križišče je postala leta 1938, ko je bil zgrajen odsek do Sevnice. 15. januarja, nekaj let po zaprtju krmeljskega premogovnika, so odsek do Krmelja ukinili in je nekaj časa služil kot industrijski tir. Dokončno so ga demontirali 15. januarja 1996."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%B3%B6%E6%B3%8A%E6%BC%81%E6%B8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Shimadomari-Fishing_port_%E5%B3%B6%E6%B3%8A%E6%BC%81%E6%B8%AF7030107.jpg","page_title":"島泊漁港","context_page_description":"島泊漁港は、余市郡余市町潮見町にある第1種漁港。"},{"page_url":"https://eo.wikipedia.org/wiki/Hinda_azadira%C4%A5to","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Bark_of_Azadirechta_indica.jpg","page_title":"Hinda azadiraĥto","context_page_description":"La hinda azadiraĥto aŭ nimo\\nestas arbo el la familio de meliacoj. Ĝiaj fruktoj kaj semoj estas la fonto de hind-azadiraĥta oleo. Ĝi ofte konfuziĝas kun la bida melio, kvankam kaj la foliostrukturo kaj la floroj malsamas. Ĉe la hinda azadiraĥto tiuj ĉi blankas, sed violkoloras ĉe bida melio."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A2%D1%8C%D0%BE%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Mongolia_Tov_sum_map.png","page_title":"Тьов","context_page_description":"Тьов е един от 21 аймаци в Монголия. Административният център на аймака е град Зунмод. На север Тьов граничи с аймака Селенге, на юг - с Дунд Гови и Гови Сумбер, на северозапад - с Булган, на югозапад - с Йовьорхангай, а на изток - с Хентий. Столицата на страната Улан Батор е разположена на територията на Тьов, но не е чат от провинцията, а самостоятелна административна единица, която е на пряко държавно управление."},{"page_url":"https://en.wikipedia.org/wiki/Air_marshal","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/15-Namibia_Air_Force-AIRMSHL.svg","page_title":"Air marshal","context_page_description":"Air marshal is a three-star air-officer rank which originated and it is used by the Royal Air Force. The rank is also used by the air forces of many countries which have historical British influence, including the Commonwealth, and it is sometimes used as the English translation of an equivalent rank in countries which have a non-English air force-specific rank structure.\\nAir marshal is a three-star rank and has a NATO ranking code of OF-8, equivalent to a vice-admiral in the Royal Navy or a lieutenant-general in the British Army or the Royal Marines. In other NATO forces, such as the United States Armed Forces and the Canadian Armed Forces, the equivalent three-star rank is lieutenant general.\\nThe rank of air marshal is immediately senior to the rank of air vice-marshal and immediately subordinate to the rank of air chief marshal.\\nOfficers in the rank of air marshal typically hold very senior appointments such as commander-in-chief of an air force or a large air force formation. Officers in the ranks of air chief marshal and air vice-marshal are also referred to generically as air marshals. Occasionally, air force officers of marshal rank are considered to be air marshals."},{"page_url":"https://it.wikipedia.org/wiki/Linea_Ina","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Newshuttle1052new-wiki.jpg","page_title":"Linea Ina","context_page_description":"La linea Ina, chiamata anche New Shuttle è un people mover automatico in servizio fra Ōmiya e Uchijuku a Saitama, in Giappone, che corre parallelo per la sua lunghezza alla linea Jōetsu Shinkansen. È a doppio binario tra Ōmiya e Maruyama mentre a singolo tra Maruyama e Uchijuku.\\nLa linea è operata e gestita dal Nuovo trasporto di Saitama, una ATI di imprese formata da JR East, Ferrovie Tōbu, la prefettura di Saitama e i comuni interessati."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B2%D1%96%D1%82_%D0%BC%D0%B8%D1%81%D1%82%D0%B5%D1%86%D1%82%D0%B2%D0%B0_(%D1%82%D0%BE%D0%B2%D0%B0%D1%80%D0%B8%D1%81%D1%82%D0%B2%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Artemis_troublee_by_L._Bakst_01.jpg","page_title":"Світ мистецтва (товариство)","context_page_description":"Світ мистецтва (товариство) — художнє об'єднання, створене в Петербурзі наприкінці 1890-х."},{"page_url":"https://de.wikipedia.org/wiki/Sean_S._Cunningham","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Sean_Cunningham_01_%2815111642666%29.jpg","page_title":"Sean S. Cunningham","context_page_description":"Sean Sexton Cunningham ist ein Regisseur und Filmproduzent."},{"page_url":"https://sv.wikipedia.org/wiki/Knappelsk%C3%A4r","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7c/Knappelsk%C3%A4r.jpg","page_title":"Knappelskär","context_page_description":"Knappelskär är en udde belägen i närheten av Nynäshamn i södra delen av Stockholms skärgård. Det är en populär utflyktsplats, har barnvänliga stränder och utsikt över Östersjön."},{"page_url":"https://fr.wikipedia.org/wiki/Gu%C3%A8ze","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Ethiopic_genesis_%28ch._29%2C_v._11-16%29%2C_15th_century_%28The_S.S._Teacher%27s_Edition-The_Holy_Bible_-_Plate_XII%2C_1%29.jpg","page_title":"Guèze","context_page_description":"Le guèze ou ge'ez, parfois appelé éthiopien ancien ou classique, est une ancienne langue chamito-sémitique de la famille des langues sémitiques parlée jusqu'au IVᵉ siècle dans la Corne de l'Afrique et originaire des régions du sud de l'Érythrée et du nord de Éthiopie. Le guèze était la langue officielle du royaume d'Aksoum puis de l'empire d'Éthiopie. Selon des analyses anciennes, il serait pour plusieurs langues de la région ce que le latin est au français, mais il semble aujourd'hui que ce sont en fait des langues sœurs qui ont évolué parallèlement. Il s'écrit à l'aide de l'alphasyllabaire éponyme.\\nAujourd'hui, le guèze est la langue principale utilisée dans la liturgie de l'Église éthiopienne orthodoxe et de l'Église érythréenne orthodoxe, ainsi que de la communauté juive Beta Israel. Cependant, en Éthiopie, l'amharique et en Érythrée et dans la région du Tigray en Éthiopie, le tigrinya ainsi que d'autres langues peuvent être utilisés pour des sermons.\\nLe tigrigna et le tigré semblent étroitement liés au guèze, avec au moins quatre configurations différentes proposées."},{"page_url":"https://zh.wikipedia.org/wiki/1974%E5%B9%B4%E9%93%9D%E5%88%B61%E7%BE%8E%E5%88%86%E7%A1%AC%E5%B8%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/1974Aluminumback.jpg","page_title":"1974年铝制1美分硬币","context_page_description":"1974年铝制一美分是美国铸币局1973年提倡的一种1美分硬币。这是一种由铝合金和微量金属铸造的硬币。由于使用传统铜合金的铸造成本的增加，它计划被用来替换铜锌合金的硬币。 1,571,167枚硬币被提前铸造，但没有一枚进入流通。样币被送到美国国会，希望能够获得议员对于更换合金这一计划的青睐。当铝制硬币提议被否决时，铸币局召回并销毁了样币。据信仍有极少量的铝制硬币没有被铸币局回收，其中一个例子就是捐赠给了史密森学会，另有一枚据称从一名美国国会警察那里发现。但自从美国特勤局被派给扣压全部样币的的任务后，这些硬币的合法性受到怀疑。"},{"page_url":"https://cv.wikipedia.org/wiki/%D0%9A%C4%83%D0%B2%D0%B0%D0%BA_%D0%BA%D3%B3%D0%BB%C4%95_(%D0%A1%D0%B0%D1%80%C4%83%D1%82%D1%83_%D0%BE%D0%B1%D0%BB%D0%B0%C3%A7%C4%95)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Goluboe_Lake.jpg","page_title":"Кăвак кӳлĕ (Сарăту облаçĕ)","context_page_description":"Кăвак кӳлĕ — Раççей территоринчи кӳлĕ. Сарăту облаçĕнче вырнаçнă. юханшыв юхса кĕрет, юхса тухать. Кӳлĕ лаптăкĕ км²."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AD%D0%BC_(%D1%80%D0%B5%D0%BA%D0%B0)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1c/Eem_near_Eembrugge.jpg","page_title":"Эм (река)","context_page_description":"Эм — река в Нидерландах.\\nДлина реки — 18 км. Эм начинается у Амерсфорта, протекает по равнине провинции Утрехт, впадая в озеро Эммер.\\nНаселённые пункты на реке — Амерсфорт, Барн, Эмбрюгге и Эмдейк. Эм — часть системы Валлей-канала.\\nРанее река называлась Амер и дала название поселению Амерсфорт.\\nБлиз реки Эм в 1874 году Питером Хартингом впервые были обнаружены морские межледниковые глины, относящиеся к межледниковью в позднем плейстоцене в Европе, которому Питер Хартинг придумал название «эемский» и которое соответствует микулинскому межледниковью на Восточно-Европейской равнине и казанцевскому межледниковью в Сибири. В предложенной в начале XX века Альбрехтом Пенком и Эдуардом Брикнером для Альп схеме ледниковых и межледниковых эпох этому межледниковью соответствует рисс-вюрм."},{"page_url":"https://ko.wikipedia.org/wiki/%EA%B4%B4%ED%8C%85%EA%B2%90_%EB%8C%80%ED%95%99%EA%B5%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Auditorium_G%C3%B6ttingen.jpg","page_title":"괴팅겐 대학교","context_page_description":"게오르크 아우구스트 괴팅겐 대학교는 독일 니더작센주 괴팅겐에 있는 대학교이다. 1734년에 영국의 군주이자 하노버 선제후인 조지 2세에 의해서 설립되어 1737년에 문을 열었다. 대학교는 빠르게 발전하였고, 18세기 말에는 거의 천 명의 학생들이 등록하여 당시 유럽에서 큰 규모의 대학교에 속했다. 현재 약 2만 4400명의 학생이 등록하여 니더작센주에서는 가장 크고, 현존하는 가장 오래된 대학교이다.\\n2003년 1월 1일부로 독일에서는 처음으로 공법상 재단이 소유권을 가지는 대학교 가운데 하나가 되었다. 대학교의 총장은 2011년부터 생화학자 울리케 바이지겔이 맡게 되었다. 2007년 10월 19일부터 우수대학육성정책과 관련하여 미래대학 육성사업 계획이 지원되고 있다. 영국의 교육전문 주간지 타임즈 하이어 에듀케이션의 2010/2011 세계대학순위에서 게오르크 아우구스트 대학교는 전 세계에서 43위에 올라 독일에서 최고의 자리를 차지했다.\\n괴팅겐 니더작센 주립 대학도서관은 약 600만권의 자료를 소장하고 있어 독일에서 가장 큰 도서관 가운데 하나이다. 이 도서관은 해외에서 출판된 수많은 분야의 학술서와, 독일의 “분리된 국립도서관”인 독일 출판물 수집연구회를 통해 수집된 18세기 독일 출판물을 소장하고 있다."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/S%C3%A9nac","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/72/Map_commune_FR_insee_code_65418.png","page_title":"Sénac","context_page_description":"Sénac sī ūi-tī Hoat-kok Midi-Pyrénées toā-khu Hautes-Pyrénées koān ê chi̍t ê commune."},{"page_url":"https://it.wikipedia.org/wiki/Fu%C3%9Fball-Club_Bayern_M%C3%BCnchen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Logo_Bayern_Munchen%281965-1970%29.gif","page_title":"Fußball-Club Bayern München","context_page_description":"Il Fußball-Club Bayern München AG, noto internazionalmente come Bayern München e in lingua italiana come Bayern Monaco, è una società polisportiva tedesca avente sede a Monaco di Baviera, celebre per la propria sezione calcistica, che milita nella Bundesliga, la massima divisione del campionato tedesco di calcio. Fondata nel 1900 da alcuni membri del MTV 1879 München, la polisportiva comprende sezioni di scacchi, pallavolo, pallacanestro, ginnastica, pallamano, bowling, tennis tavolo e squadre di calcio.\\nLa sezione calcistica della polisportiva bavarese è la più titolata di Germania, avendo vinto 30 campionati, 20 coppe nazionali, 7 Supercoppe di Germania e 6 Coppe di Lega tedesche, nonché una tra le più vittoriose del mondo, potendo vantare 6 Coppe dei Campioni/Champions League, una Coppa UEFA, una Coppa delle Coppe, una Supercoppa europea, 2 Coppe Intercontinentali e un mondiale per club FIFA.\\nInsieme con la Juventus, l'Ajax, il Chelsea e il Manchester United, il Bayern Monaco è una delle cinque squadre di calcio ad aver vinto le tre principali competizioni UEFA per club e tutte le competizioni UEFA a cui ha partecipato."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%81%D9%84%D9%88%D8%B1%D9%8A%D9%86%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Sakoulevas.jpg","page_title":"فلورينا","context_page_description":"أَخْرَلِين:، مدينة يونانية تقع في شمال البلاد ضمن منطقة مقذونية الغربية الإدارية، وهي مركز إحدى مقاطعاتها والتي تحمل نفس اسم المدينة."},{"page_url":"https://en.wikipedia.org/wiki/Industrial_melanism","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3b/Coccinella_bipunctata_detail_cropped.jpg","page_title":"Industrial melanism","context_page_description":"Industrial melanism is an evolutionary effect prominent in several arthropods, where dark pigmentation has evolved in an environment affected by industrial pollution, including sulphur dioxide gas and dark soot deposits. Sulphur dioxide kills lichens, leaving tree bark bare where in clean areas it is boldly patterned, while soot darkens bark and other surfaces. Darker pigmented individuals have a higher fitness in those areas as their camouflage matches the polluted background better; they are thus favoured by natural selection. This change, extensively studied by Bernard Kettlewell, is a popular teaching example in Darwinian evolution, providing evidence for natural selection. Kettlewell's results have been challenged by zoologists, creationists and the journalist Judith Hooper, but later researchers have upheld Kettlewell's findings.\\nIndustrial melanism is widespread in the Lepidoptera, involving over 70 species such as Odontopera bidentata and Lymantria monacha, but the most studied is the evolution of the peppered moth, Biston betularia."},{"page_url":"https://fr.wikipedia.org/wiki/Krasnogorsk_(cam%C3%A9ra)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Kinokamera_Krasnogorsk-2.jpg","page_title":"Krasnogorsk (caméra)","context_page_description":"Krasnogorsk est une marque de caméra soviétique. Son modèle le plus connu est la Krasnogorsk-3."},{"page_url":"https://en.wikipedia.org/wiki/Japanese_art","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Muchaku_%28detail%2C_2%29.jpg","page_title":"Japanese art","context_page_description":"Japanese art covers a wide range of art styles and media, including ancient pottery, sculpture, ink painting and calligraphy on silk and paper, ukiyo-e paintings and woodblock prints, ceramics, origami, and more recently manga which is modern Japanese cartoons and comics along with a myriad of other types. It has a long history, ranging from the beginnings of human habitation in Japan, sometime in the 10th millennium BC, to the present-day country.\\nJapan has been subject to sudden invasions of new ideas followed by long periods of minimal contact with the outside world. Over time the Japanese developed the ability to absorb, imitate, and finally assimilate those elements of foreign culture that complemented their aesthetic preferences. The earliest complex art in Japan was produced in the 7th and 8th centuries in connection with Buddhism. In the 9th century, as the Japanese began to turn away from China and develop indigenous forms of expression, the secular arts became increasingly important; until the late 15th century, both religious and secular arts flourished."},{"page_url":"https://sh.wikipedia.org/wiki/Alincourt_(Ardeni)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Alincourt_%2808_Ardennes%29_-_l%E2%80%99_%C3%89glise_Saint-Hilaire_-_Photo_Francis_Neuvens_lesardennesvuesdusol.fotoloft.fr.JPG","page_title":"Alincourt (Ardeni)","context_page_description":"Alenkur je naselje i opština u severoistočnoj Francuskoj u regionu Šampanja-Ardeni, u departmanu Ardeni koja pripada prefekturi Retel.\\nPo podacima iz 1999. godine u opštini je živelo 78 stanovnika, a gustina naseljenosti je iznosila 9 stanovnika/km². Opština se prostire na površini od 8,62 km². Nalazi se na srednjoj nadmorskoj visini od 102 metara."},{"page_url":"https://de.wikipedia.org/wiki/Ka%C5%BEnjeni%C4%8Dka_bojna","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Operacija_Lipanjske_zore.png","page_title":"Kažnjenička bojna","context_page_description":"Das Kažnjenička bojna, kurz KB, war eine militärische Spezialeinheit des Kroatischen Verteidigungsrats während des Bosnienkriegs. Das Hauptquartier lag in der Tabakfabrik von Široki Brijeg.\\nDer Name wurde gewählt, da die Einheit von Personen aufgestellt wurde, die im kommunistischen Jugoslawien politisch verfolgt und inhaftiert worden waren. Auch sollte der Name den Feind abschrecken, der sich tatsächlichen oder vermeintlichen „Sträflingen“ gegenübersah.\\nDie Angehörigen des KB waren Freiwillige und in der Regel ethnische Kroaten, selten auch muslimische Bosniaken. Auch US-Amerikaner, Engländer, Dänen und Deutsche dienten in der Einheit."},{"page_url":"https://id.wikipedia.org/wiki/Daftar_Bupati_Kerinci","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Adirozal_2014.png","page_title":"Daftar Bupati Kerinci","context_page_description":"Semenjak pertama kali dimekarkan pada tanggal 10 November 1958, Kabupaten Kerinci, hingga saat ini telah dipimpin oleh 19 orang bupati, baik secara definitif maupun pelaksana tugas. Berikut adalah nama-nama Bupati Kerinci pertama hingga saat ini."},{"page_url":"https://cs.wikipedia.org/wiki/Rudolf_N%C4%9Bmec_(mal%C3%AD%C5%99)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Rudolf_N%C4%9Bmec%2C_Zamy%C5%A1len%C3%A1_%281985%29%2C_akryl%2C_email%2C_olej%2C_pl%C3%A1tno.jpg","page_title":"Rudolf Němec (malíř)","context_page_description":"Rudolf Němec byl český malíř, grafik, básník a sochař. Patřil k předním představitelům Nové figurace v Československu."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A5%D0%BB%D0%BE%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Chlor_1a.jpg","page_title":"Хлор","context_page_description":"Хлор — елемент 7-ї групи періодичної таблиці хімічних елементів з атомним номером 17."},{"page_url":"https://it.wikipedia.org/wiki/Mayta_Capac","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/Inca_mayta_capac.jpg","page_title":"Mayta Capac","context_page_description":"Mayta Capac è stato un sovrano dell'epoca protostorica della etnia degli Inca. I dati riguardanti la sua vita sono desunti dalle leggende raccolte dai conquistadores spagnoli dopo la conquista dell'impero andino e conservate dai suoi discendenti.\\nSi tratta del quarto sovrano della dinastia inca, il successore di Lloque Yupanqui. Appartiene alla casata degli Hurin-Cuzco."},{"page_url":"https://en.wikipedia.org/wiki/De_Beauvoir_Town","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/De-beauvour-new2.jpg","page_title":"De Beauvoir Town","context_page_description":"De Beauvoir Town is a district in east London and is in the London Borough of Hackney, 2 miles north of the City of London. The area was a part of the Hackney; the Ancient Parish and subsequent Metropolitan Borough that was incorporated into the larger modern borough.\\nThe name is pronounced variously; notably and, with some who use the former applying the nickname Beavertown.\\nThe area was developed in the mid-19th century, much of it as a carefully planned new town designed to attract prosperous residents, although it does include a range of other housing and land use types.\\nThe new town was based around De Beauvoir Square and primarily built in the Jacobethan style. The special character of the neighbourhood has been retained and is recognised by the designation of the De Beauvoir and Kingsland Road Conservation Areas which include many listed and other notable buildings."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B3%D6%80%D5%A1%D5%B6%D5%A4_%D5%80%D5%B8%D5%A9%D5%A5%D5%AC_%D4%B5%D5%BE%D6%80%D5%B8%D5%BA%D5%A1_(%D5%8D%D5%A1%D5%B6%D5%AF%D5%BF_%D5%8A%D5%A5%D5%BF%D5%A5%D6%80%D5%A2%D5%B8%D6%82%D6%80%D5%A3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Grand_Hotel_Europe_2.jpg","page_title":"Գրանդ Հոթել Եվրոպա (Սանկտ Պետերբուրգ)","context_page_description":"Գրանդ Հոթել Եվրոպա, հինգ աստղանի հյուրանոց Սանկտ Պետերբուրգում, Միխայլովսկի փողոցի վրա, զբաղեցնում է փողոցի ամբողջ ձախ մասը ։ Հյուրանոցը պատկանում է Բելմոնդ ընկերությանը։"},{"page_url":"https://hr.wikipedia.org/wiki/Golovik","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Golovik_HR.jpg","page_title":"Golovik","context_page_description":"Golovik je naselje u Hrvatskoj u sastavu općine Mošćeničke Drage. Nalazi se u Primorsko-goranskoj županiji."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%88%DB%8C%D9%86%D8%AF%D8%B2%D8%A8%D8%A7%D8%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Kolbenstra%C3%9Fe_8_Pfarrhaus.jpg","page_title":"ویندزباخ","context_page_description":"ویندزباخ آلمانین بایرن ایالتینده یئر آلان بیر شهردیر و ۳۸۳ متر دنیز سوییه‌سیندن اۇجالیقی وار. بۇ شهرین ۶۸٫۱۷ کیلومتر موربّع ساحه‌سی وار."},{"page_url":"https://nl.wikipedia.org/wiki/Cerithium_traillii","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Naturalis_Biodiversity_Center_-_RMNH.MOL.173704_-_Cerithium_traillii_Sowerby%2C_1855_-_Cerithiidae_-_Mollusc_shell.jpeg","page_title":"Cerithium traillii","context_page_description":"Cerithium traillii is een slakkensoort uit de familie van de Cerithiidae. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1855 door G.B. Sowerby II."},{"page_url":"https://es.wikipedia.org/wiki/Telescopio_refractor","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/01/Yerkes_40_inch_Refractor_Telescope-2006.jpg","page_title":"Telescopio refractor","context_page_description":"Un telescopio refractor es un sistema óptico centrado, que capta imágenes de objetos lejanos utilizando un conjunto de lentes en las que la luz se refracta. La refracción de la luz en la lente del objetivo hace que los rayos paralelos, procedentes de un objeto muy alejado, converjan sobre un punto del plano focal. Esto permite mostrar los objetos lejanos mayores y más brillantes.\\nEste tipo de telescopios son muy comunes en la astronomía para aficionados y en algunos telescopios solares, y durante casi 300 años se convirtieron en el principal tipo de instrumento de trabajo de los más destacados observatorios del mundo. Sin embargo, existen importantes dificultades técnicas que impiden realizar telescopios refractores de amplias dimensiones y de gran apertura, ya que resulta difícil elaborar lentes útiles de gran tamaño y suficientemente ligeras para ser utilizadas como objetivos. Por otro lado, existen problemas de calidad de la imagen debido a pequeñas burbujas de aire atrapadas en el cristal de la lente principal, y además, el material de la lente resulta opaco a determinadas longitudes de onda, por lo que se pierde sensibilidad en algunas partes del espectro lumínico."},{"page_url":"https://pt.wikipedia.org/wiki/Villetaneuse","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Carte_des_chasses_Villetaneuse.JPG","page_title":"Villetaneuse","context_page_description":"Villetaneuse é uma comuna francesa localizada no departamento de Seine-Saint-Denis, região da Ilha de França."},{"page_url":"https://lb.wikipedia.org/wiki/F%C3%ABnsterschlass","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Aldringer-Bains_Luxembourg_City_2012-04.JPG","page_title":"Fënsterschlass","context_page_description":"D'Fënsterschlass war e fréiert Wunn- a Geschäftshaus an der Uewerstad vun der Stad Lëtzebuerg. Et läit um Eck vun der Aldrengerstrooss mat der Biedergaass."},{"page_url":"https://en.wikipedia.org/wiki/North_High_School_(Torrance,_California)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/North_High_Front.jpg","page_title":"North High School (Torrance, California)","context_page_description":"North Torrance High School is a four-year public high school located at 3620 W. 182nd St. in Torrance, California. Of the four public high schools in the Torrance Unified School District, North High is the second oldest. The school's mascot is the Saxon and the school colors are blue and white. North High is accredited by WASC."},{"page_url":"https://la.wikipedia.org/wiki/Eris_(planetula)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/TheTransneptunians_Size_Albedo_Color.svg","page_title":"Eris (planetula)","context_page_description":"Eris est planetula, cuius diametrus est circiter 2325 km. Inde magnitudine aequat Plutoni, sed pondere maius obiectum zonae Kuiperi videtur. Diametrum satis compertum habemus, postquam Eris ante stellam remotam migrans eius lucem obscuravit. Eris inventa est mense Octobri 2003, sed e photographemate data tunc incerta erant. Mense autem Decembri 2004 nova data inventionem certam fecere. Magnitudine Eridis astronomi coacti sunt, ut definitionem planetarum denuo cogitarent et novum genus planetularum instituerent. Inde Eris in numero planetularum habetur sicut Pluto.\\nMense Septembri 2005 parva satelles inventa est quae circum Eridem orbita 14 dierum revolvitur et Dysnomia appellatur."},{"page_url":"https://nds.wikipedia.org/wiki/F%C3%A4r%C3%B6er","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Faroese_girls_in_costume.jpg","page_title":"Färöer","context_page_description":"Färöer [[ˈfɛːʁøɐ]] – ok Färöers, Faröers oder Faröer nömmt sünd en Inselgrupp in den Noordatlantik twuschen de Brittschen Eilannen, Norwegen un Iesland. Funnen un besiedelt wurrn sünd se eerst in dat Middeloller. Mol afsehn vun Lítla Dímun, wat de lüttjeste vun all 18 Inseln is, wahnt up all Eilannen over dat ganze Johr hen Lüde. De Hööftstadt is Tórshavn.\\nDe um un bi 49.000 Inwahners weert Färingers oder ok „Färöers“ nömmt. Se snackt de Färöösche Spraak, de sik ut dat Ooldwestnoordsche utspunnen hett un verwandt is mit Ieslannsch un Norweegsch. De Färingers seht sik nich as Dänen, man as en egen Volk, wat vun de Wikingers afstammen deit.\\nAs ok Gröönland sünd de Färöer en „Natschoon mit lieke Rechten“ binnen dat Königriek vun Däänmark. Al vun 1948 af an sünd se wiethen autonom. Mit dat Løgting gifft dat dor een vun de öllsten Parlamente vun de Welt. Twee Afordente weert jummers na dat däänsche Folketing henstüert, bovenhen sünd se mit twee Lüde in den Noordschen Raat mit bi.\\nAnners, as Däänmark höört de Färöer nich to de Europääsche Union mit to un na Artikel 3, Afsatz 1 vun den Tollkodex höört se nich to dat Tollrebeet vun de Meenschop. Vun den 1."},{"page_url":"https://vi.wikipedia.org/wiki/Susan_Sarandon","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Susan_Sarandon_by_David_Shankbone.jpg","page_title":"Susan Sarandon","context_page_description":"Susan Sarandon là một nữ diễn viên người Mỹ. Bà hoạt động trong ngành điện ảnh và truyền hình từ năm 1970, và đã đoạt giải Oscar cho nữ diễn viên chính xuất sắc nhất cho vai diễn trong phim Dead Man Walking năm 1995. Bà cũng nổi tiếng về hoạt động chính trị, xã hội vì sự nghiệp tự do hiện đại ở Hoa Kỳ."},{"page_url":"https://en.wikipedia.org/wiki/COVID-19_pandemic_in_Columbus,_Ohio","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Columbus%2C_OH_-_COVID_01.jpg","page_title":"COVID-19 pandemic in Columbus, Ohio","context_page_description":"The COVID-19 pandemic is an ongoing viral pandemic of coronavirus disease 2019, a novel infectious disease caused by severe acute respiratory syndrome coronavirus 2. The pandemic has affected the city of Columbus, Ohio, as Ohio's stay-at-home order shuttered all nonessential businesses, and is causing event cancellations as well as protests at the Ohio Statehouse, the state capitol building."},{"page_url":"https://en.wikipedia.org/wiki/Poulx","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e0/Lancashireh%C3%A4rd.jpg","page_title":"Poulx","context_page_description":"Poulx is a commune in the Gard department in southern France. Between the years of 1943 and 1945, it served as a secret meeting place for French resistance fighters."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D8%AE%D8%B1_%D8%A3%D9%8A%D8%A7%D9%85_%D8%A8%D9%88%D9%85%D8%A8%D9%8A_(%D9%81%D9%8A%D9%84%D9%85_1935)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Pompeii_Last_Days.jpg","page_title":"أخر أيام بومبي (فيلم 1935)","context_page_description":"أخر أيام بومبي ‏ فيلم مقتبس عن رواية تحمل ذات الاسم، وتعتبر من أشهر روائع الأدب العالمي، وهي تصور للناشئ حياة سكان مدينة بومبي الإيطالية في صيف عام 79 للميلاد وقبل أن يلفظ بركان فيزوف حممه الرهيبة ويدمرها في لحظة سجل التاريخ أهوالها ونتائجها."},{"page_url":"https://de.wikipedia.org/wiki/Bundeskanzler_(Deutschland)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Besuch_Bundeskanzlerin_Angela_Merkel_im_Rathaus_K%C3%B6ln-09916.jpg","page_title":"Bundeskanzler (Deutschland)","context_page_description":"Der Bundeskanzler ist der Regierungschef der Bundesrepublik Deutschland. Bundeskanzler und Bundesminister bilden zusammen die deutsche Bundesregierung. Der Regierungschef bestimmt laut Verfassung die Richtlinien der Politik. In der Praxis muss ein Bundeskanzler allerdings die Vorstellungen seiner eigenen Partei und seiner Koalitionspartner berücksichtigen.\\nDer Bundeskanzler wird auf Vorschlag des Bundespräsidenten vom Bundestag gewählt. Der Bundeskanzler schlägt dem Bundespräsidenten die Bundesminister vor; ohne diesen Vorschlag kann der Bundespräsident niemanden zum Bundesminister ernennen. Ohne Mitwirkung des Bundespräsidenten ernennt der Bundeskanzler einen der Bundesminister zum verfassungsmäßigen Stellvertreter, welcher auch als Vizekanzler bezeichnet wird, wobei diese Bezeichnung offiziell nicht existent ist.\\nVor Ablauf der Legislaturperiode kann ein Bundeskanzler nur durch ein konstruktives Misstrauensvotum abgelöst werden: Dazu muss der Bundestag mit absoluter Mehrheit einen Nachfolger wählen. Für den Fall, dass ein Bundeskanzler stirbt oder zurücktritt, gibt es keine Regelung; mit dem Ende der Kanzlerschaft endet auch die Bundesregierung."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%A8%D7%A5_%D7%A2%D7%95%D7%A5_%D7%94%D7%9E%D7%95%D7%A4%D7%9C%D7%90%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Marvelous_land_of_oz.jpg","page_title":"ארץ עוץ המופלאה","context_page_description":"ארץ עוץ המופלאה הוא ספר ההמשך לספר הילדים הנודע \\"הקוסם מארץ עוץ\\", שנכתב על ידי ליימן פרנק באום, והשני בסדרת ספרי עוץ.\\nהספר מספר הרפתקאות נוספות בחייהם של הדחליל ואיש הפח לאחר המאורעות בספר הקודם. דורותי אינה שבה לעלילות ספר זה."},{"page_url":"https://pl.wikipedia.org/wiki/Coca-Cola_Cherry","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Coca-Cola_Cherry_Poland.png","page_title":"Coca-Cola Cherry","context_page_description":"Coca-Cola Cherry – napój gazowany, produkowany i rozprowadzany przez The Coca-Cola Company. Cherry Coke to Coca-Cola o smaku wiśniowym.\\nNapój został wprowadzony do próbnej degustacji w 1982 roku podczas Targów Światowych – World’s Fair w Knoxville w USA. Wszedł do głównej produkcji w roku 1985. Była to trzecia odmiana Coca-Coli w tamtym czasie – Coca-Cola, Coca-Cola Light oraz pierwsza cola z dodatkiem – wiśniowym.\\nNapój ten dostępny jest w wielu krajach świata. W Polsce od 1996 roku. W 2018 roku napój słodzony cukrem został wymieniony na wersję bez cukrową. Jednak pod koniec sierpnia 2018 zdecydowano się przywrócić wersję z cukrem.\\nOd listopada 2006 produkt dostępny również w Japonii, gdzie jest znany jako Cherry Coke. Sprzedawany w srebrnej butelce i puszce z etykietą nazwy w stylu retro z lat 80."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Kungshamn","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/76/Kungshamn_1.JPG","page_title":"Kungshamn","context_page_description":"Kungshamn sī Sūi-tián Västra Götaland Koān Sotenäs Chū-tī-chhī ê chi̍t-ê tē-hng siâⁿ-chhī. Kun-kù Sūi-tián koaⁿ-hong tī 2010 nî ê jîn-kháu phó͘-cha, Kungshamn ū 2814-ūi ki-bîn."},{"page_url":"https://en.wikipedia.org/wiki/Hamilton_O._Smith","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Hamilton_Smith.jpg","page_title":"Hamilton O. Smith","context_page_description":"Hamilton Othanel Smith is an American microbiologist and Nobel laureate.\\nSmith was born on August 23, 1931, and graduated from University Laboratory High School of Urbana, Illinois. He attended the University of Illinois at Urbana-Champaign, but in 1950 transferred to the University of California, Berkeley, where he earned his B.A. in Mathematics in 1952. He received his medical degree from Johns Hopkins University in 1956. Between 1956 and 1957 Smith worked for the Washington University in St. Louis Medical Service. In 1975, he was awarded a Guggenheim Fellowship he spent at the University of Zurich.\\nIn 1970, Smith and Kent W. Wilcox discovered the first type II restriction enzyme, that is now called as HindII. Smith went on to discover DNA methylases that constitute the other half of the bacterial host restriction and modification systems, as hypothesized by Werner Arber of Switzerland.\\nHe was awarded the Nobel Prize in Physiology or Medicine in 1978 for discovering type II restriction enzymes with Werner Arber and Daniel Nathans as co-recipients."},{"page_url":"https://ro.wikipedia.org/wiki/Biserica_de_lemn_din_S%C3%A2ngeorz_B%C4%83i","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/RO_BN_Manastirea_Cormaia_%2831%29.jpg","page_title":"Biserica de lemn din Sângeorz Băi","context_page_description":"Biserica de lemn „Buna Vestire\\" din Sângeorz-Băi, județul Bistrița-Năsăud datează din secolul XVIII. Este monument istoric, cod LMI BN-II-m-A-01637."},{"page_url":"https://fr.wikipedia.org/wiki/Lyc%C3%A9e_d%27Arsonval","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Lyc%C3%A9e_d%27arsonval.jpg","page_title":"Lycée d'Arsonval","context_page_description":"Le lycée d’Arsonval est un lycée d’enseignement général et technologique fondé le 1ᵉʳ octobre 1918, situé à l’ouest de la commune de Saint-Maur-des-Fossés, non loin de la gare de Saint-Maur - Créteil."},{"page_url":"https://pl.wikipedia.org/wiki/Lista_okr%C4%99t%C3%B3w_United_States_Navy_w_czynnej_s%C5%82u%C5%BCbie","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/US_Navy_080202-N-8421M-036_The_guided-missile_cruiser_USS_Princeton_%28CG_59%29_breaks_away_from_the_aircraft_carrier_USS_Nimitz_%28CVN_68%29.jpg","page_title":"Lista okrętów United States Navy w czynnej służbie","context_page_description":"Lista aktywnych okrętów United States Navy"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%BE%D1%82%D0%B0%D0%BD%D1%96%D1%87%D0%BD%D0%B8%D0%B9_%D1%81%D0%B0%D0%B4_%D0%9E%D0%BB%D0%B1%D0%B5%D1%80%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Albury_botanical_gardens_2.JPG","page_title":"Ботанічний сад Олбері","context_page_description":"Ботанічний сад Олбері — ботанічний сад у місті Олбері. Ботанічний сад є членом Міжнародної ради ботанічних садів з охорони рослин і має код ALBUR.\\nВхід до ботанічного саду вільний.\\nБотанічний сад був заснований 1877 року і є зразком реалізації основних ідей в галузі садівництва XIX і XX століть. Сад займає площу в 4 гектари і спеціалізується на рослинах австралійських вологих тропічних лісів."},{"page_url":"https://nl.wikipedia.org/wiki/Pentidotea_wosnesenskii","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Pentidotea_wosnesenskii.jpg","page_title":"Pentidotea wosnesenskii","context_page_description":"Pentidotea wosnesenskii is een pissebed uit de familie Idoteidae. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1851 door Brandt."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Apfelsorten/T","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Tietjenapfel.jpg","page_title":"Liste von Apfelsorten/T","context_page_description":"Erläuterungen und Quellen: Siehe Hauptartikel!"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_St._Johann_im_Walde","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Unterleibnig_-_Kapelle.jpg","page_title":"Liste der denkmalgeschützten Objekte in St. Johann im Walde","context_page_description":"Die Liste der denkmalgeschützten Objekte in St. Johann im Walde enthält die 7 denkmalgeschützten, unbeweglichen Objekte der Osttiroler Gemeinde St. Johann im Walde."},{"page_url":"https://pl.wikipedia.org/wiki/Okr%C4%99g_pomorsko-wielkopolski_Ko%C5%9Bcio%C5%82a_Chrze%C5%9Bcijan_Baptyst%C3%B3w_w_RP","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Kaplica_baptyst%C3%B3w_Pozna%C5%84_RB1.JPG","page_title":"Okręg pomorsko-wielkopolski Kościoła Chrześcijan Baptystów w RP","context_page_description":"Okręg pomorsko-wielkopolski – jeden z dziewięciu okręgów Kościoła Chrześcijan Baptystów w RP liczący 14 zborów i 3 placówki. Przedstawicielem okręgu jest Sławomir Zientarski.\\nW roku 2013 okręg liczył 894 członków."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D8%B1%D8%AC_%D8%AA%D8%A7%D9%85%D9%86%D8%AA%D9%81%D9%88%D8%B3%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Plan_de_Rusguniae_Chardon.png","page_title":"برج تامنتفوست","context_page_description":"برج تامنتفوست هو حصن يقع في منطقة تامنتفوست ما بين بلديتي المرسى وبرج البحري التابعتين لولاية الجزائر ويعود تاريخ بنائه إلى فترة إيالة الجزائر."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9B%D7%95%D7%97_%D7%94%D7%94%D7%92%D7%A0%D7%94_%D7%94%D7%A2%D7%A6%D7%9E%D7%99%D7%AA_%D7%94%D7%90%D7%95%D7%95%D7%99%D7%A8%D7%99_%D7%A9%D7%9C_%D7%99%D7%A4%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Kawasaki_T-4%2C_Japan_-_Air_Force_AN2240189.jpg","page_title":"כוח ההגנה העצמית האווירי של יפן","context_page_description":"חיל האוויר של יפן הוא הזרוע האווירית של כוחות ההגנה של יפן אשר מופקדים על הגנת המרחב האווירי של יפן וכן למשימות אחרות בתחומי התעופה והחלל.\\nחיל האוויר מקיים סיורים חמושים קבועים בשמי יפן וכן מתחזק מערך מכ\\"מים להתרעה מוקדמת מפני איומים. לחיל האוויר גם ענף אווירובטיקה המכונה \\"דחף כחול\\" או \\"טייסת 11\\" ולאחרונה היה מעורב גם בהטסות של כוחות במשימות או\\"ם המוגדרות \\"שמירת שלום\\".\\nבשנת 2013 הוערך גודל החיל ב-50,324 חיילים ו-777 כלי טיס, מתוכם 373 מטוסי קרב."},{"page_url":"https://es.wikipedia.org/wiki/Tratado_Mont%C3%BAfar-Correoso","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Book_Nicaraguan_Antiquities_scan_page_145.png","page_title":"Tratado Montúfar-Correoso","context_page_description":"El Tratado Montúfar-Correoso fue un acuerdo limítrofe firmado en abril de 1873 en la ciudad de San José entre los plenipotenciarios Lorenzo Montúfar y Rivera y Buenaventura Correoso, representantes de la República de Costa Rica y de los Estados Unidos de Colombia, respectivamente, con el fin de dirimir la indefinición de la línea fronteriza entre ambos países.​​\\nTras varias actuaciones de autoridades colombianas ocurridas en mayo de 1870 en la región del golfo Dulce y los ríos Sixaola y Changuinola, zonas que Costa Rica consideraba como parte de su territorio, el entonces Ministro de Relaciones Exteriores de dicho país, Lorenzo Montúfar y Rivera, envío una nota de protesta al presidente del Estado Soberano de Panamá, Buenaventura Correoso pidiendo el retiro de las autoridades puesto que esto violaba el statu quo mantenido hasta el momento. Este contestó que no estaba dentro de su potestad realizar tal acción, y que eran las autoridades costarricenses las que estaban invadiendo territorio colombiano.​"},{"page_url":"https://my.wikipedia.org/wiki/%E1%80%A1%E1%80%85%E1%80%B9%E1%80%85%E1%80%9C%E1%80%AC%E1%80%99%E1%80%B7%E1%80%BA%E1%80%97%E1%80%AD%E1%80%9E%E1%80%AF%E1%80%80%E1%80%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Dayr-e_Gachin_%DA%A9%D8%A7%D8%B1%D9%88%D8%A7%D9%86%D8%B3%D8%B1%D8%A7%DB%8C_%D8%AF%DB%8C%D8%B1_%DA%AF%DA%86%DB%8C%D9%86_06.jpg","page_title":"အစ္စလာမ့်ဗိသုကာ","context_page_description":"ဗိသုကာအစြန္း အကြီးမြတ်ဆုံးသောအရုပ်များပေါ်ပေါက်လာ၏အနုပညာအတွက်ပိန္ပိန္ပစ္စည်းစဉ်းစားသည်။ ဝေါဟာရများအတွက်သမိုင်းဝင်ဗိသုကာ၊အနုပညာအဖွဲ့အစည်းက၎င်းတို့၏ကိုယ်ပိုင်သဘောတရားများအစ္စလာမ့်သဟဇာတ)။ ကိုယ်၏အမြတ္စကြိုဆို။ အစ္စလာမ့်ဗိသုကာတစ်ဦးအဖြစ်အများဆုံးအောင်မြင်သောနည်းလမ်းများ၏ ဗိသုကာ၊ ဗိသုသမိုင်းကမ္ဘာ့အသိအမှတ်ပြု။ တစ်ချက်မှာ၊လွှမ်းခြုံနိုင် پیوستاری တန်ဖိုးရှိသောနှင့်တက်ကြွအတွက်အထိမ်းအမှတ်အစ္စလာမ့်အသိအမှတ်ပြုသောအစပျိုးအားလုံးသည်ထိုသူတို့၏အမျိုးအစားယူနစ်ခေါင်းစဉ်အစ္စလာမ့်ဗိသုလာမယ့်အသီးအသီးအခြားလဲ။"},{"page_url":"https://ca.wikipedia.org/wiki/Resoluci%C3%B3_1939_del_Consell_de_Seguretat_de_les_Nacions_Unides","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Communist_posters_Nepal.jpg","page_title":"Resolució 1939 del Consell de Seguretat de les Nacions Unides","context_page_description":"La Resolució 1939 del Consell de Seguretat de les Nacions Unides fou adoptada per unanimitat el 15 de setembre de 2010. Després de recordar les resolucions anteriors sobre la situació al Nepal, inclosa la Resolució 1922, el Consell va ampliar el mandat de la Missió de les Nacions Unides al Nepal fins al 15 de gener de 2011 enmig de la preocupació per l'augment de les tensions polítiques al país.\\nL'extensió de la UNMIN seria la setena i última. En el seu informe, el secretari general Ban Ki-moon va dir que no estava a favor de les extensions repetides de la missió a causa de \\"crítiques persistents i sense fonament\\" que deterioraven la seva capacitat de dur a terme el seu mandat, d'acord amb la Resolució 1740."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_oorlogsmonumenten_in_Leiden","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Truus_Menger-Overstegen_-_Leidse_vrouwen_uit_het_verzet_-_1985.JPG","page_title":"Lijst van oorlogsmonumenten in Leiden","context_page_description":"De Nederlandse gemeente Leiden heeft 29 oorlogsmonumenten. Hieronder een overzicht."},{"page_url":"https://cs.wikipedia.org/wiki/Alex_Higgins","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Alexhiggins1968.jpg","page_title":"Alex Higgins","context_page_description":"Alexander \\"Alex\\" Gordon Higgins, znám také jako Hurikán Higgins, byl severoirský profesionální hráč kulečníku, který se stal 2 x mistrem světa a 2 x vicemistrem světa. Svoji přezdívku Hurikán získal kvůli své rychlosti při hře.\\nPrávě jemu je často připisováno přiblížení kulečníku širšímu publiku a jeho popularizaci v osmdesátých letech 20. století.\\nMěl pověst nepředvídatelného a složitého charakteru. Byl náruživý kuřák, alkoholik a karbaník, který přiznal užívání kokainu a marihuany. V roce 1998 mu byla diagnostikována rakovina hrtanu, s níž svůj boj dne 24. července 2010 prohrál."},{"page_url":"https://ceb.wikipedia.org/wiki/Barup%C4%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Barupe003.JPG","page_title":"Barupė","context_page_description":"Suba ang Barupė sa Lyetuwanya. Nahimutang ni sa sentro nga bahin sa nasod, 100 km sa amihanan-kasadpan sa Vilnius ang ulohan sa nasod. Ang Barupė mao ang bahin sa tubig-saluran sa Nemunas."},{"page_url":"https://fi.wikipedia.org/wiki/Karl_Mannheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Karl_Mannheim_1893-1947.png","page_title":"Karl Mannheim","context_page_description":"Karl Mannheim oli unkarilaissyntyinen 1900-luvun alkupuolen sosiologi ja yksi tiedonsosiologian tieteenalan perustajista. Hänen nimensä alkuperäinen muoto oli Károly Mannheim.\\nMannheim väitteli filosofian tohtoriksi Budapestin yliopistossa 1918. Vuodesta 1922 hän työskenteli Saksassa Heidelbergin yliopistossa ja sai professorin viran Frankfurtin yliopistosta 1930. Vuonna 1933 hän pakeni juutalaisvainoja Britanniaan ja toimi aluksi lehtorina London School of Economicsissa. Vuonna 1946 hän sai professorin viran University College London -yliopiston kasvatustieteen tiedekunnasta. Mannheimin ura jakautuukin unkarilaiseen, saksalaiseen ja brittiläiseen jaksoon.\\nTieteilijänä Mannheim pyrki yhdistämään elementtejä preussilaisesta historismista, marxismista, fenomenologiasta, sosiologiasta ja pragmatismista. Pääteoksessaan Ideologie und Utopie hän käsitteli yhteiskuntaluokkia ja niiden ideologioita. Hänestä ihmisten jakautuminen eri luokkiin on väistämätöntä, ja yksilön pitäisi oppia käsittelemään tietoa luokkansa mukaisesta näkökulmasta."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%AE%E0%AE%A4%E0%AF%81%E0%AE%B0%E0%AF%88_%E0%AE%AA%E0%AE%A9%E0%AF%8D%E0%AE%A9%E0%AE%BE%E0%AE%9F%E0%AF%8D%E0%AE%9F%E0%AF%81_%E0%AE%B5%E0%AE%BE%E0%AE%A9%E0%AF%82%E0%AE%B0%E0%AF%8D%E0%AE%A4%E0%AE%BF_%E0%AE%A8%E0%AE%BF%E0%AE%B2%E0%AF%88%E0%AE%AF%E0%AE%AE%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/MaduraiAirport.JPG","page_title":"மதுரை பன்னாட்டு வானூர்தி நிலையம்","context_page_description":"மதுரை பன்னாட்டு வானூர்தி நிலையம் தமிழ்நாட்டில் உள்ள சுங்கத்தீர்வு மற்றும் பன்னாட்டு நிலை பெற்ற வானூர்தி நிலையம் ஆகும். தமிழ்நாட்டில் சென்னை, கோயம்புத்தூர், திருச்சிராப்பள்ளிக்கு அடுத்த நான்காவது பெரிய விமான நிலையம் ஆகும். இது மதுரை மற்றும் தென் தமிழ்நாட்டிற்குத் தனது சேவையை வழங்குகிறது. இந்த வானூர்தி நிலையம் மதுரை தொடருந்து நிலையத்தில் இருந்து சுமார் 12 km தொலைவில் நகருக்குத் தெற்கே அமைந்துள்ளது. இந்த வானூர்தி நிலையம் 1957 ஆம் ஆண்டு நிறுவப்பட்டது. 28 மார்ச் 2014, அன்று மதுரை பன்னாட்டு வானூர்தி நிலையத்துக்கு 9001:2015 தரம் சான்றிதழ் வழங்கப்பட்டது."},{"page_url":"https://en.wikipedia.org/wiki/Mikhail_Mishustin%27s_Cabinet","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Vladimir_Putin_with_Mikhail_Mishustin_%282020-01-15%29_01.jpg","page_title":"Mikhail Mishustin's Cabinet","context_page_description":"The Mikhail Mishustin Cabinet is the current federal government of Russia, led by Prime Minister Mikhail Mishustin. It formed from 16 to 21 January 2020.\\nThis Cabinet was the last formed before the constitutional reform, which in particular significantly changed the order of formation of the government.\\nOn 30 April 2020 Mishustin tested positive for COVID-19. Mishustin confirmed his test results in a video conference with President Vladimir Putin, and nominated his deputy to take over for him as acting Prime Minister. Putin signed a decree appointing Andrey Belousov to the role on an acting basis, following Mishustin's recommendation. In May, three more ministers also tested positive for coronavirus and were temporarily replaced by their deputies."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%B9%8C%E5%85%B9%E5%88%AB%E5%85%8B%E6%96%AF%E5%9D%A6%E7%B4%A2%E5%A7%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/UzbekistanP80-200sum-1997-donatedoy_b.jpg","page_title":"乌兹别克斯坦索姆","context_page_description":"索姆，是烏茲別克斯坦共和國的法定貨幣。1索姆可分為100泰因。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%97%D7%99%D7%9C_%D7%94%D7%90%D7%95%D7%95%D7%99%D7%A8_%D7%94%D7%99%D7%A9%D7%A8%D7%90%D7%9C%D7%99_%D7%91%D7%9E%D7%9C%D7%97%D7%9E%D7%AA_%D7%99%D7%95%D7%9D_%D7%94%D7%9B%D7%99%D7%A4%D7%95%D7%A8%D7%99%D7%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Tail_of_an_Egyptian_Air_Force_Sukhoi_Su-7_%28469012599%29.jpg","page_title":"חיל האוויר הישראלי במלחמת יום הכיפורים","context_page_description":"ביום שבת, 6 באוקטובר 1973, הוא יום הכיפורים, הפתיעו מצרים וסוריה את מדינת ישראל ופתחו בהתקפה רחבה ביבשה ובאוויר ובכך פתחו במלחמה כוללת הידועה בישראל כמלחמת יום הכיפורים.\\nהמתקפה הערבית כללה מכה מקדימה על מטרות איכות צבאיות בהשתתפות רוב מטוסי הקרב של חיל האוויר הסורי וחיל האוויר המצרי.\\nבימי הלחימה הראשונים ספג חיל האוויר הישראלי אבדות כבדות שהביאו לשחיקה בעוצמתו. שחיקה זו באה לידי ביטוי בהמשך הפעלת החיל לאורך כל ימי המלחמה. השחיקה נבעה מהסיבות הבאות:\\nהמתקפות האוויריות בתחילת המלחמה הפתיעו את חיל האוויר שמטוסיו לא היו ערוכים לבלימתן. כתוצאה מכך הוזנקו כל מטוסי הקרב ללא הכוונה של הבקרה האווירית, השיגו תוצאות מועטות ומנעו את הפעלתו למשימות נחוצות אחרות.\\nכוחות השריון שהתקשו לבלום את הדיוויזיות הסוריות והמצריות העבירו לחיל האוויר בקשות סיוע נואשות, שהביאו את חיל האוויר לזנוח את משימותיו המתוכננות לתקיפת מערך הטילים ושדות התעופה, בניגוד לתורת הלחימה. כתוצאה מכך פעל חיל האוויר באזורים מוגני טילים תוך ספיגת אבדות כבדות.\\nחיל האוויר נדרש על ידי המטה הכללי לרכז מאמץ לסירוגין בין שתי החזיתות באופן שהקשה עליו בהכנות המוקדמות הנדרשות למבצעים השונים."},{"page_url":"https://fi.wikipedia.org/wiki/Kaarlo_Kangasniemi","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Kaarlo-Kangasniemi-1968.jpg","page_title":"Kaarlo Kangasniemi","context_page_description":"Kaarlo Olavi Kangasniemi on entinen suomalainen painonnostaja ja olympiavoittaja."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1945","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Leden_van_Nederlandse_Tour_de_France_ploeg_van_Goudsmit_en_Hoff_Wim_Prinsen%2C_Bestanddeelnr_925-7200.jpg","page_title":"Lijst van personen geboren in 1945","context_page_description":"Dit is een lijst van personen die geboren zijn in 1945.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://pt.wikipedia.org/wiki/Compressor","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Single_Stage_Portable_Air_Compressor.jpg","page_title":"Compressor","context_page_description":"O compressor é um equipamento industrial concebido para aumentar a pressão de um fluido em estado gasoso ar, vapor de água, hidrogênio, etc.. Normalmente, conforme a equação de Clapeyron, a compressão de um gás também provoca o aumento de sua temperatura."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Mitglieder_der_Deutschen_Akademie_der_Naturforscher_Leopoldina/1932","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/F._S._Bodenheimer_1935.jpg","page_title":"Liste der Mitglieder der Deutschen Akademie der Naturforscher Leopoldina/1932","context_page_description":"Die Liste der Mitglieder der Deutschen Akademie der Naturforscher Leopoldina für 1932 listet alle Personen, die im Jahr 1932 zum Mitglied berufen wurden. Insgesamt gab es 217 neu gewählte Mitglieder."},{"page_url":"https://eu.wikipedia.org/wiki/Minbera_(landarea)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Mimosa_Pudica.gif","page_title":"Minbera (landarea)","context_page_description":"Minbera, Fabaceae familiako landare-espeziea.\\nLandare honen bereizgarria da ukituz gero hostoak uzkurtu egiten direla, itxi egingo balira bezala, eta zurtoin txikiak beherantz erortzen direla. Landare-mugimendu azkarra deritzo gaitasun horri: denbora gutxian, segundo batean normalean, landare-egiturak mugitzeko gaitasuna, alegia. Hori egiteko gauza dira, halaber, Desmodium motorium eta Dionaea muscipula edo Venus eulijalea ere.\\nDefentsa gisa, harrapariek jan ez dezaten erabiltzen du espezie honek taktika hori. Izan ere, bere baitan biltzen denean, landarea ihartua edo zimeldua dagoela dirudi. Horrez gain, bero-orduetan ur gehiegi ez galtzeko eta azalera txikituta bere burua haizeaz babesteko ere balio du. Hostoak uzkurtuta egoten dira gau osoan.\\nLatinezko pudica hitzak «lotsatia» esan nahi du, eta antzeko izenak ditu landareak hainbat hizkuntzatan. Gaztelaniazko sensitiva eta dormidera, frantsesezko honteuse, alemanezko schamhaft, ingelesezko sensitive plant edo the touch-me-not eta beste hitz asko azaltzen dira landarearen izen arruntetan, eta kasu guztietan esan nahi du sentikor edo lotsati. Euskarazko izena ere adierazgarria da: minbera."},{"page_url":"https://fr.wikipedia.org/wiki/A%C3%A9roport_de_Lausanne-Bl%C3%A9cherette","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Morane-Saulnier_MS-317_img_0518.jpg","page_title":"Aéroport de Lausanne-Blécherette","context_page_description":"L'aéroport de Lausanne-Blécherette est un aéroport régional situé au nord de Lausanne dans le canton de Vaud en Suisse. Il enregistre plus de 35 000 mouvements par an dont 10 % de l’activité est due aux vols d’affaires."},{"page_url":"https://de.wikipedia.org/wiki/Kettfaden","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Kette_und_Schu%C3%9F_num_col.png","page_title":"Kettfaden","context_page_description":"Die Kettfäden sind die Fäden, die in der Weberei in einem Webstuhl in Längsrichtung aufgespannt werden. Im fertigen Gewebe liegen sie parallel zur Webkante, während die Schussfäden quer dazu verlaufen.\\nKettfäden werden in der Vorbereitung des eigentlichen Webvorgangs entweder\\ngeschärt, d. h. in einzelnen Bändern, Faden-„Schar“ auf einem Schärgestell, -rahmen oder einer Schärmaschine aufgewickelt und dann aufgebäumt, d. h. auf den sogenannten Kettbaum, eine Walze im Webstuhl, aufgewickelt\\noder gezettelt, d. h. in kleine Teilbäume aufgewickelt, geschlichtet und anschließend mehrere Zettelpartien auf einen Kettbaum zusammenfassend „aufgebäumt“.\\nJeder einzelne Kettfaden muss durch eine Litze und durch das Webblatt geführt werden, bevor er an dem sogenannten Warenbaum des Webstuhls angeknüpft werden kann. Beim Weben wächst durch den Eintrag von Schussfäden im rechten Winkel zu den Kettfäden das Gewebe, das auf den walzenförmigen Warenbaum aufgewickelt wird.\\nDie Art und Weise, wie die Kettfäden durch die Litzen auf verschiedenen Schäften oder in Jacquardlitzen angeordnet werden, bestimmt die Bindung und damit auch Musterung des Gewebes."},{"page_url":"https://es.wikipedia.org/wiki/Hermandad_de_la_Quinta_Angustia_(Sevilla)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8c/Detalle_paso_quinta_angustia.jpg","page_title":"Hermandad de la Quinta Angustia (Sevilla)","context_page_description":"La Hermandad de la Quinta Angustia es una cofradía católica de Sevilla, Andalucía, España. Tiene su sede en la capilla del Dulce Nombre, que se encuentra en el interior de la iglesia parroquial de Santa María Magadalena.​\\nSu nombre completo es Pontificia, Real Hermandad y Archicofradía de Nazarenos del Dulce Nombre de Jesús, Sagrado Descendimiento de Nuestro Señor Jesucristo y Quinta Angustia de María Santísima Nuestra Señora."},{"page_url":"https://en.wikipedia.org/wiki/Pilgrimage","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Jerusalem_Holy_Sepulchre_BW_19.JPG","page_title":"Pilgrimage","context_page_description":"A pilgrimage is a journey, often into an unknown or foreign place, where a person goes in search of new or expanded meaning about their self, others, nature, or a higher good, through the experience. It can lead to a personal transformation, after which the pilgrim returns to their daily life."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%A6%D0%B8%D1%86%D0%B5%D1%80%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Zizers.jpg","page_title":"Цицерс","context_page_description":"Цицерс — Швейцарияның Граубюнден кантонында орналасқан коммуна. Ландкварт округінің құрамына кіреді.\\n2006 жылғы мәліметтер бойынша тұрғындарының саны 3152 адамды құрайды. Алып жатқан жер аумағы 11.01 км² шамасында. Ресми идентификациялық коды — 3947, пошта индексі — 7205."},{"page_url":"https://nl.wikipedia.org/wiki/CargoNet","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/CN_Skd_226_10-Trondheim.JPG","page_title":"CargoNet","context_page_description":"CargoNet AS is de belangrijkste exploitant van goederentreinen op het Noorse spoorwegnet. Het werd gevormd als NSB Gods nadat NSB werd gesplitst in een personen- en een vrachtbedrijf. NSB Gods veranderde haar naam in CargoNet in het begin van 2002. Het is eigendom van NSB en het Zweedse vrachtbedrijf Green Cargo. Het Noorse CargoNet heeft als dochteronderneming in Zweden CargoNet AB dat was aangekocht als RailCombi AB.\\nDrieëntwintig terminals worden door CargoNet bediend, voornamelijk in Noorwegen en Zweden. Het vervoer bestaat uit zowel containertreinen als bulkcargotreinen."},{"page_url":"https://da.wikipedia.org/wiki/Statsoverhoved","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Sauli_Niinist%C3%B6_-_171106-D-GY869-041_%2837501659204%29_%28cropped%29.jpg","page_title":"Statsoverhoved","context_page_description":"Et statsoverhoved er den øverste, formelle leder af en stat. Alle FN's medlemslande har et statsoverhoved, enten i form af et individ eller et kollektivt organ.\\nStatsoverhovedet kan have mange forskellige funktioner og være forskelligt betitlet afhængig af styreformen i landet. Dog er udenlandske diplomater næsten altid akkrediteret statsoverhovedet."},{"page_url":"https://pl.wikipedia.org/wiki/Vic-sur-Aisne","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Vic-sur-Aisne_rue_de_Fontenoy_d%C3%A9bouchant_sur_donjon_1a.jpg","page_title":"Vic-sur-Aisne","context_page_description":"Vic-sur-Aisne – miejscowość i gmina we Francji, w regionie Hauts-de-France, w departamencie Aisne.\\nWedług danych na styczeń 2014 roku gminę zamieszkiwało 1779 osób, a gęstość zaludnienia wynosiła 339,5 osób/km²."},{"page_url":"https://nl.wikipedia.org/wiki/Chavannes-des-Bois","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Karte_Gemeinde_Chavannes-des-Bois.png","page_title":"Chavannes-des-Bois","context_page_description":"Chavannes-des-Bois is een gemeente en plaats in het Zwitserse kanton Vaud, en maakt deel uit van het district Nyon. Chavannes-des-Bois telt 392 inwoners."},{"page_url":"https://en.wikipedia.org/wiki/Motorola_68451","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/MC68451_p1160081.jpg","page_title":"Motorola 68451","context_page_description":"The MC68451 was a Motorola Memory Management Unit, which was primarily used in conjunction with the Motorola MC68010 microprocessor.\\nThe MC68451 supported a 16MB address space and provided a MC68000 or a MC68010 with support for memory management and protection of memory against unauthorized access. The block size was variable, so it was usually used for segment-based memory management. It supported the mapping of up to 96 memory segments or pages of a variable size from logical to physical addresses. To allow more segments or pages, the simultaneous use of up 3 MC68451 MMUs was officially supported.\\nIn combination with a MC68010 the MC68451 permitted the realization of virtual memory. With the earlier MC68000, this was not possible due to a design error in the way the MC68000 treated memory access errors, i.e. processor state could not always be properly restored after a page fault. The limitation to 96 segment table entries made systems based on a MC68010 and a MC68451 slow, as they often had to modify the segment table due to its small size. Some companies therefore used 12 MC68451 MMUs together, others used their own proprietary MMUs instead of the MC68451."},{"page_url":"https://ca.wikipedia.org/wiki/El_Pou_de_la_Gallina","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Pou_de_la_gallina.JPG","page_title":"El Pou de la Gallina","context_page_description":"El Pou de la Gallina és una revista manresana d'informació i opinió de periodicitat mensual, publicada per l’Associació Cultural El Pou de la gallina, amb la finalitat de dinamitzar la vida cultural a la ciutat de Manresa.\\nEl 2015 tenia una tirada de 1.200 exemplars i una audiència d'uns quatre mil lectors. El seu professionalisme la distingeix de moltes revistes localistes.\\nL’associació també ha editat el col·leccionable històric “Les persones i els fets”, amb 66 episodis ciutadans, la revista literària “El Pou de Lletres” —una revista dedicada a la literatura i el pensament—, l’àlbum il·lustrat “Oleguer Bisbal” basat en el còmic del ninotaire i fundador de la revista Manel Fontdevila i el suplement “El Pou jove” escrit i dirigit a les noves generacions de lectors."},{"page_url":"https://en.wikipedia.org/wiki/Bridlington","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Bridlington_Leisure_Centre.jpg","page_title":"Bridlington","context_page_description":"Bridlington, a coastal town and civil parish on the Holderness Coast of the North Sea, sometimes dubbed the \\"Lobster Capital of Europe\\", belongs to the unitary authority and ceremonial county of the East Riding of Yorkshire. It is about 28 miles north of Hull and 34 miles east of York. The Gypsey Race enters the North Sea at its harbour. The 2011 Census gave a parish population of 35,369. As a minor sea-fishing port, it is known for shellfish. Alongside small manufacturing, retail and service firms, its main trade is summer tourism. It is twinned with Millau, France, and Bad Salzuflen, Germany. It holds one of the UK's coastal weather stations. The Priory Church of St Mary and associated Bayle Gate are Grade I listed buildings on the site of an Augustinian Priory."},{"page_url":"https://en.wikipedia.org/wiki/Wiesbaden_City_Palace","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Stadtschloss_Wiesbaden_Kabinettzimmer.jpg","page_title":"Wiesbaden City Palace","context_page_description":"Wiesbaden City Palace is a neo-classical building in the center of Wiesbaden, Germany. It was completed in 1841 as the principal city residence of the Dukes of Nassau. The palace has several wings, 145 rooms, and is architecturally integrated with a group of ancillary buildings constructed both before and after it was built. With ornate towers, gables and a slate roof laid in herringbone patterns, the three-story complex lends charm and its name to the central square of Wiesbaden: Palace Square.\\nThe Palace has had a turbulent history. After withstanding the Revolutions of 1848 and annexation by Prussia in 1866, it has served variously as a second home of the German Emperors, a gathering place for soldiers and workers during the German Revolution of 1918–1919, a museum, and a military headquarters for both the Wehrmacht and Allied occupation forces. Damaged during World War II, the Palace has since been restored and portions modernized. Since 1946 it has been the seat of the State Parliament of Hesse. A new Parliamentary Chamber was added to the complex in 2008."},{"page_url":"https://en.wikipedia.org/wiki/J._Playfair_McMurrich","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/J._Playfair_McMurrich.png","page_title":"J. Playfair McMurrich","context_page_description":"James Playfair McMurrich, FRSC was a Canadian zoologist and academic.\\nBorn in Toronto, the son of John McMurrich, McMurrich received a M.A. from the University of Toronto in 1881 and a Ph.D. from Johns Hopkins University in 1885.\\nFrom 1881 to 1884, he was a Professor of biology and horticulture at Ontario Agricultural College in the University of Guelph. From 1892 to 1894, he taught at the University of Cincinnati. He was a Professor of Anatomy in homoeopathic department of the University of Michigan. From 1907 to 1930, he was Professor of anatomy at the University of Toronto.\\nFrom 1922 to 1923, he was the president of the Royal Society of Canada. In 1922, he was the president of the American Association for the Advancement of Science. In 1933, he was the president of the History of Science Society. In 1939, he was awarded the Royal Society of Canada's Flavelle Medal.\\nIn 1882, he married Katie Moodie Vickers."},{"page_url":"https://en.wikipedia.org/wiki/Chronos","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Romanelli_Chronos_and_his_child.jpg","page_title":"Chronos","context_page_description":"Chronos, also spelled Khronos or Chronus, is the personification of time in pre-Socratic philosophy and later literature.\\nChronos already was confused with, or perhaps consciously identified with, the Titan Cronus in antiquity due to the similarity in names. The identification became more widespread during the Renaissance, giving rise to the allegory of \\"Father Time\\" wielding the harvesting scythe.\\nHe was depicted in Greco-Roman mosaics as a man turning the Zodiac Wheel. Chronos might also be contrasted with the deity Aion as cyclical Time. Chronos is usually portrayed as an old, wise man with a long, grey beard, similar to Father Time. In some Greek sources, Kairos is mentioned as a brother of Chronos. However, other sources point out that it is his son."},{"page_url":"https://pt.wikipedia.org/wiki/%C3%96resund","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/%C3%98resund-Peberholm.jpg","page_title":"Öresund","context_page_description":"Öresund ou Øresund é um estreito entre a Dinamarca e a Suécia, mais precisamente entre a ilha dinamarquesa da Zelândia e a província sueca da Escânia. É um dos três estreitos dinamarqueses."},{"page_url":"https://de.wikipedia.org/wiki/Westfalen","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Bergerdenkmal_Witten_Aussicht.jpg","page_title":"Westfalen","context_page_description":"Westfalen ist eine Region in Nordwestdeutschland. Als Westfalen wird heute meist der Nordostteil des Landes Nordrhein-Westfalen bestehend aus den Regierungsbezirken Münster, Arnsberg und Detmold, aber meist abzüglich des Kreises Lippe, verstanden. Dieses Gebiet entspricht im Wesentlichen der von 1815 bis 1946 bestehenden preußischen Provinz Westfalen. Je nach den gewählten Abgrenzungskriterien können Randgebiete davon ausgeschlossen sein oder auch außerhalb liegende Landstriche mit einbezogen werden. Die Region hat rund acht Millionen Einwohner."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E4%B8%83%E8%BE%B9%E5%BD%A2","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/12/Heptagon_construction_1.svg","page_title":"七边形","context_page_description":"在几何学中，七边形是指有七条边和七个顶点的多边形，其内角和为900度。七边形有很多种，其中对称性最高的是正七边形。其他的七边形依照其类角的性质可以分成凸七边形和非凸七边形，其中凸七边形代表所有内角角度皆小于180度。非凸七边形可以在近一步分成凹七边形和星形七边形，其中星形七边形表示边自我相交的七边形。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Bad_Windsheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Bad_Windsheim%2C_Dr.-Martin-Luther-Platz_3-20160821-001.jpg","page_title":"Liste der Baudenkmäler in Bad Windsheim","context_page_description":"Auf dieser Seite sind die Baudenkmäler der mittelfränkischen Stadt Bad Windsheim zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 11. Januar 2015 wieder und enthält 295 Baudenkmäler."},{"page_url":"https://lv.wikipedia.org/wiki/Tirdzniec%C4%ABbas_centrs","image_url":"https://upload.wikimedia.org/wikipedia/lv/0/0c/TC_Mols_2.JPG","page_title":"Tirdzniecības centrs","context_page_description":"Tirdzniecības centrs ir centralizēti vadīts mazumtirdzniecības objekts. Lai gan šis termins bieži tiek attiecināts uz jebkuru plašāku mazumtirdzniecības vietu, precīzāk tirdzniecības centrs tiek definēts kā speciāli projektēts un būvēts mazumtirdzniecības objekts ar kopējo platību vismaz 5000 m², kurā ir vairāk par 10 nomniekiem un viens nomnieks neaizņem vairāk par 70% no nomas platības. Tirdzniecības centri apvieno pārtikas lielveikalus, specializētus veikalus un pakalpojumu uzņēmumus, kuri savā starpā savienoti ar gaiteņiem. Mūsdienās tirdzniecības centros bieži ir atrodami ne tikai veikali, bet arī restorāni, kinoteātri un dažādas citas izklaides iespējas.\\nPar pirmo moderno tirdzniecības centru Latvijā uzskata tirdzniecības centru \\"Dole\\" Rīgā, kas pēc rekonstrukcijas tika atvērts 1997. gadā. Kopš tā brīža Rīgā un citās Latvijas pilsētās sākās plaša tirdzniecības centru būvniecība, kas turpinās arī mūsdienās."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Handwaffen_der_Bundeswehr","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/HK69_Granatpistole_40mm_noBG.png","page_title":"Liste der Handwaffen der Bundeswehr","context_page_description":"Diese Liste stellt die aktuellen und abgeschafften Handwaffen der Bundeswehr vor. Bei einigen Einheiten der Bundeswehr – wie beispielsweise dem Kommando Spezialkräfte – sind in geringen Stückzahlen weitere Handwaffen in Gebrauch, die hier nicht aufgeführt werden."},{"page_url":"https://de.wikipedia.org/wiki/Lesumbr%C3%BCcke","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Lesumbruecke_7267.jpg","page_title":"Lesumbrücke","context_page_description":"Die Lesumbrücke ist eine Straßenbrücke über die Lesum im heutigen Bremer Stadtteil Burglesum. Sie verbindet die beiden Ufer seit über 600 Jahren."},{"page_url":"https://en.wikipedia.org/wiki/List_of_cities_in_Peru","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/97/Panoramica_Tacna_Cercado.jpg","page_title":"List of cities in Peru","context_page_description":"This is a list of cities in Peru by population. A city is displayed in bold if it is a capital city of a region."},{"page_url":"https://sk.wikipedia.org/wiki/Walt_Disney_Concert_Hall","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/LA_Disney_Concert_Hall_entrance_1.jpg","page_title":"Walt Disney Concert Hall","context_page_description":"Walt Disney Concert Hall na 111 South Grand Avenue v Downtown Los Angeles, Kalifornia, je štvrtá sála Los Angeles Music Center. Ohraničená je ulicami Hope Street, Grand Avenue, 1st Street a 2nd Street, pojme 2265 ľudí a slúži ako domov Los Angeleského filharmonického orchestra a Los Angeleského chorálu.\\nLillian Disney dala počiatočný príspevok obyvateľom Los Angeles v roku 1987 na vybudovanie miesta na hudobné vystúpenia ako hold Walt Disneyho oddanosti umeniu a mestu. Budova navrhnutá Frankom Gehrym bola otvorená dňa 23. októbra 2003. Architektúra Franka Gehryho, ako aj akustika v koncertnej sále boli chválené na rozdiel od svojho predchodcu, Dorothy Chandler Pavilion."},{"page_url":"https://es.wikipedia.org/wiki/Castelltersol","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Escut_de_Castellter%C3%A7ol.svg","page_title":"Castelltersol","context_page_description":"Castelltersol​​ es un municipio de Cataluña, España. Se encuentra en la provincia de Barcelona, en la comarca del Moyanés. Hasta 2015 perteneció al Vallés Oriental. Su partido judicial es Granollers."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%B0%E0%B5%BA%E0%B4%A5%E0%B4%82%E0%B4%AD%E0%B5%8B%E0%B5%BC_%E0%B4%95%E0%B5%8B%E0%B4%9F%E0%B5%8D%E0%B4%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/RNP-10.JPG","page_title":"രൺഥംഭോർ കോട്ട","context_page_description":"രാജസ്ഥാനിലെ സവായ് മധേപൂർ ജില്ലയിലെ രൺഥംഭോർ ദേശീയോദ്യാനത്തിനകത്ത് സ്ഥിതിചെയ്യുന്ന ഒരു കോട്ടയാണ് രൺഥംഭോർ കോട്ട"},{"page_url":"https://it.wikipedia.org/wiki/Darko_Peri%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Darko_Peric_BW.jpg","page_title":"Darko Perić","context_page_description":"Darko Perić è un attore serbo noto principalmente per il ruolo di Helsinki nella serie televisiva La casa di carta."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D1%83%D0%B3%D0%BB%D0%B0%D1%81_%D0%9C%D0%BE%D1%83%D1%81%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Douglas_Mawson_resting.jpg","page_title":"Дуглас Моусон","context_page_description":"Сер Дуглас Моусон — австралійський геолог і полярний дослідник. Автор праць по геології і гляціології. Учасник трьох антарктичних експедицій."},{"page_url":"https://it.wikipedia.org/wiki/Crisi_buddhista_del_Vietnam","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Flag_of_Buddhism.svg","page_title":"Crisi buddhista del Vietnam","context_page_description":"La crisi buddhista del Vietnam fu un periodo di tensione politica e religiosa in Vietnam del Sud tra maggio e novembre 1963 e nel 1966, caratterizzato da una serie di atti di repressione da parte del governo sudvietnamita e una campagna di resistenza civile, nonviolenta, guidata principalmente da monaci buddhisti, guidati dal monaco Thich Tri Quang. Le amministrazioni americane di Kennedy, nel 1963 e di Johnson, nel 1966, erano contrarie a un impegno di forze militari, per reprimere le rivolte, perché ciò influiva e bloccava la guerra del Vietnam in corso.\\nLa crisi precipitò nella città di Hué, sede dell'arcivescovato, l'8 maggio 1963: una sparatoria della polizia uccise nove civili inermi, che protestavano contro il divieto di esporre la bandiera buddhista. La crisi si aggravò per responsabilità del presidente sudvietnamita Ngô Đình Diệm che non volle sospendere le aggressioni ai buddhisti, malgrado i molteplici avvisi di John Fitzgerald Kennedy, che gli consigliava di rappacificarsi e di convivere civilmente, altrimenti avrebbe ritirato il suo appoggio alla dittatura del presidente Diem."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%AF%B8%EA%B5%AD%EC%9D%98_%EA%B5%B0_%EB%AA%A9%EB%A1%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Usa_counties_large.svg","page_title":"미국의 군 목록","context_page_description":"다음은 미국의 군 목록이다. 여기서 설명되는 '군'은 영어로 카운티, 버러, 패리시라고 부른다. 대체적으로 군은 '카운티'로 불리지만, 루이지애나주의 경우 '패리시', 알래스카주의 경우 '버러'라는 용어가 주로 사용된다."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A8%D8%AD%D9%8A%D8%B1%D9%87_%D8%AC%D8%B1%D9%88%D8%B3%D9%8A%D8%B1_%D9%88%D8%B3%D8%AA%D9%8A%DA%A4%D9%8A%D8%AA%D8%B2%D9%8A%D8%B1_%D8%AA%D9%8A%D8%AA%D8%B4","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/76/2015_Faehrhafen_Sassnitz_und_Wostevitzer_Teiche.JPG","page_title":"بحيره جروسير وستيڤيتزير تيتش","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nجروسير وستيڤيتزير تيتش بحيره فى المانيا."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9C%CF%80%CE%B9%CF%81%CF%84%CE%B2%CE%AF%CF%83%CE%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Birtvisi_%28Photo_A._Muhranoff%2C_2011%29-6.jpg","page_title":"Μπιρτβίσι","context_page_description":"Το Μπιρτβίσι είναι ένα ερειπωμένο μεσαιωνικό φρούριο που χτίστηκε μεταξύ των ασβεστολιθικών βράχων στο φαράγγι του ποταμού Αλγκέτι. Υπάγεται στο Δήμο Τετριτσκάρο, στο μχάρε Κβέμο Κάρτλι της Γεωργίας. Βρίσκεται δίπλα στον Εθνικό Δρυμό του Αλγκέτι, νοτιοδυτικά της Τιφλίδας."},{"page_url":"https://sv.wikipedia.org/wiki/Boeing_C-17_Globemaster_III","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Keiko-airplane.jpg","page_title":"Boeing C-17 Globemaster III","context_page_description":"Boeing C-17 Globemaster III, fyrmotorigt militärt transportflygplan som flög för första gången 1991. Namnet Globemaster III är en uppföljning av tidigare fyrmotoriga militära transportflygplan från tillverkaren Douglas; C-74 Globemaster och C-124 Globemaster II."},{"page_url":"https://es.wikipedia.org/wiki/Rusia_en_el_Festival_de_la_Canci%C3%B3n_de_Eurovisi%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Russia_in_the_2008_Eurovision_Song_Contest.jpg","page_title":"Rusia en el Festival de la Canción de Eurovisión","context_page_description":"Rusia hizo su debut en el Festival de la Canción de Eurovisión en 1994. Ha participado en un total de 20 ocasiones, ganando una vez: en 2008, con Dima Bilán y su tema «Believe». Como consecuencia, organizó el Festival de Eurovisión de 2009.\\nAdemás, Rusia ha quedado en segundo lugar en cuatro ocasiones, en tercera posición en tres ocasiones, y obtuvo un quinto puesto en 2013.\\nRusia ha llevado al festival a algunos de sus artistas más célebres, entre ellos Ala Pugachova, Alsou, Serebro, t.A.T.u., Mumiy Troll, Dima Bilán o Serguéi Lázarev.\\nEn 2017 Yulia Samoylova fue elegida como la representante de Rusia en el Festival de la Canción de Eurovisión 2017 con su canción \\"Flame Is Burning\\", aunque su actuación en el país ucraniano no estaba garantizada. El gobierno de Ucrania le impuso un veto de tres años por haber actuado en Crimea tras su anexión a Rusia. Finalmente, Rusia no pudo participar en la edición de 2017 de Eurovisión y no se emitió el concurso en el país.\\nEn un total de 12 veces, ha estado este país dentro del TOP-10 en una gran final. En 2018, por primera vez desde la introducción de las semifinales, Rusia no pasó a la final."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B2%D8%AA%D8%B1%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Zethrene.svg","page_title":"زترن","context_page_description":"زترن بیر شیمیایی ماده."},{"page_url":"https://sv.wikipedia.org/wiki/Lyngsj%C3%B6_station","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/Lyngsj%C3%B6_stn.jpg","page_title":"Lyngsjö station","context_page_description":"Lyngsjö station på Gärds Härads järnväg låg en bra bit från Lyngsjö kyrkby. Den var en typisk ångspårvägsstation för linjen Skepparslöv - Tollarp - Everöd - Degeberga, med gaveln mot banan. Linjen Tollarp - Everöd - Åhus nedlades redan 1936.\\nStationen hette Hommentorp till 1883.\\nI Sveriges Järnvägar från 1921 omnämns enbart namnet Lyngsjö. Stationen lades ner 1923.\\nStationen ligger mitt på linjen mellan Tollarp - Everöd, 4 km från både Tollarp och Everöd, se ÖSJs linjenät."},{"page_url":"https://tg.wikipedia.org/wiki/Raj_Hamsa_X-Air","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Ran_Kar_X-AIR_602T_C-IGMQ_02A.jpg","page_title":"Raj Hamsa X-Air","context_page_description":"Raj Hamsa X-Air — як ҳавогарди сохтаи Raj Hamsa Ultralights дар кишвари هند аст ки дар соли 1993 сохта шуд."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D1%80%D0%B4%D0%B6%D0%B5%D0%BD%D1%82%D0%B5%D1%80%D0%B0_(%D0%B2%D1%80%D1%8A%D1%85)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Massiccio_Argentera_dal_Remondino.jpg","page_title":"Арджентера (връх)","context_page_description":"Арджентера е планински масив и връх в Приморските Алпи в северозападна Италия, провинция Пиемонт, и югоизточна Франция, департамент Алп Маритим. Със своите 3297 м надморска височина той е първенец на този дял на Алпите. Масивът се простира от север на юг, между реките Гесо и Везуби и има обща дължина 20 км. Съставен е главно от кристализирали метаморфни скали - гнайс. Арджентера е оформен от ледникова дейност и има скалист алпийски вид с много стръмни, често отвесни склонове. От западната страна се спуска 800-метрова стена, често посещавана от алпинисти, а от север скалите се синеят, заради наличието на лазуритни елементи.\\nХребетът има четири върха, от които най-висок е южният. От него на север те са: Сима юг - 3297 м, Сима север - 3286 м, Пунта Гелас - 3261 м, Стела - 3262 м. На билото има поне още 5 точки с височина над 3000 м., но те не се считат за част от Арджентера. Известен със своите възможности за планинско катерене е връх Корно Стела в северната част. Панорамата, която се разкрива от върха е прекрасна. В ясен и сух ден тя позволява да се види голяма част от Паданската низина, близките части от Апенините и Прованс, както и голяма част от алпийската дъга чак до Матерхорн."},{"page_url":"https://lt.wikipedia.org/wiki/Romainiai","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/1._Romainiai._Pradin%C4%97_mokykla.JPG","page_title":"Romainiai","context_page_description":"Romainiai – Kauno miesto dalis šiaurės vakarinėje miesto dalyje, į šiaurę nuo Lampėdžių.\\nYra Romainių tuberkuliozės ligoninė, sanatorija, kapinės, koplyčia. Romainiuose daug miškų: rytinėje dalyje – Linkuvos miškas, vakarinėje – Šilainių miškas. Miškuose peri 32 paukščių rūšys, kurios įtrauktos į Europoje globaliai nykstančių sparnuočių sąrašą, veši įvairūs saugotini augalai. Romainiams priklauso taip pat Aukštutiniai Kaniūkai ir Vijūkai. Šiaurinė dalis Romainių likusi Kauno rajone.\\nRomainiai yra Kauno miesto dalis, priklausanti Šilainių seniūnijai. Šiai seniūnijai taip pat priklauso Smėliai, Milikoniai, Linkuva, Sargėnai.\\nGatvės Romainiuose: Agluonos g., Aitvarų g., Alko g., Archeologų g., Audenio g., Aukštutinių Kaniūkų g., Babtų g., V. Bacevičiaus g., S. Banaičio g., Berlainių g., Beržų g., Bivylių g., Brūžės g., Chodkevičių g., Dumburio g., Gailios g., Ganyklų g., Girios g., Gyrio g., Horizonto g., Kaimelės g., Kampinė g., Karalgirio g., Kaulenių takas, Kraigo g., Kruosto g., Krivių g., Kudrėnų g., Laumių g., Liedos g., Liepynės g., Liepžiedžių g., Liucijanavos g., Lubinų g., Lukštinės g., Medekšinės g., K. Meko g., Meldų g., Melsvių g., V. Nagevičiaus g., J."},{"page_url":"https://no.wikipedia.org/wiki/Jordal_Idrettspark","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Jordal_Idrettspark_1965.jpg","page_title":"Jordal Idrettspark","context_page_description":"Jordal Idrettspark er en idrettspark på Jordal i Oslo, som består av flere idrettsanlegg; to ishaller, én idrettshall, én idrettsplass med kunstgressbane og ett rullebrettanlegg. I forbindelse med rivingen av Gamle Jordal Amfi og bygging av ny ishall, skal også utearealene oppgraderes."},{"page_url":"https://en.wikipedia.org/wiki/Giorgos_Masouras","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Giorgos_Masouras.jpg","page_title":"Giorgos Masouras","context_page_description":"Giorgos Masouras is a Greek professional footballer who plays as a winger for Olympiacos and the Greece national team."},{"page_url":"https://pl.wikipedia.org/wiki/Boles%C5%82aw_I_Wysoki","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/AGAD_Fundacja_cysters%C3%B3w_w_Lubi%C4%85%C5%BCu.png","page_title":"Bolesław I Wysoki","context_page_description":"Bolesław I Wysoki – książę śląski w latach 1163–1201; w latach 1146–1163, 1172–1173, 1177 na wygnaniu."},{"page_url":"https://pt.wikipedia.org/wiki/Ofensiva_de_Erzurum","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Captured_flags_in_Erzurum.jpg","page_title":"Ofensiva de Erzurum","context_page_description":"A Ofensiva de Erzurum ou Batalha de Erzurum foi uma grande ofensiva de inverno do Exército Imperial Russo na Campanha do Cáucaso, durante a Primeira Guerra Mundial. que levou a captura da cidade estratégica de Erzurum. As forças otomanas, nos bairros de inverno, sofreram uma série de reveses inesperados que levaram a uma vitória russa."},{"page_url":"https://bar.wikipedia.org/wiki/Wei%C3%9Fes_Rauschn","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/72/Pink.noise.png","page_title":"Weißes Rauschn","context_page_description":"Weißes Rauschn san Rauschprozesse mit ana konstauntn spektroin Rauschleistungsdichtn, wia's weiße Liacht, des olle sichtboan Spektren mit da gleichn Leistung umafosst.\\nIn da Realität kenntats des ned ge'm, wäu sunst dedats a unendliche Leistung transportian miassn. Owa es gibt physikalische Rauschprozesse, de wos in an bstimmtn Frequenzbandl a konstaunte physikalische spektrale Rauschleistungsdichtn aufweisn, z. B. Thermisches Rauschn und Schrotstromrauschn."},{"page_url":"https://fr.wikipedia.org/wiki/Traverse","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Stahl-_Holz-_und_Betonschwelle.jpg","page_title":"Traverse","context_page_description":"Une traverse est un élément fondamental de la voie ferrée. C'est une pièce posée en travers de la voie, sous les rails, pour en maintenir l'écartement et l'inclinaison, et transmettre au ballast les charges des véhicules circulant sur les rails. On utilise principalement des traverses en bois ou en béton.\\nLe travelage, c'est-à-dire le nombre de traverses au kilomètre, est variable. En France, sur SNCF Réseau, il est généralement de 1 666 traverses/km."},{"page_url":"https://pl.wikipedia.org/wiki/Setra","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/06/Setra_S_415_GT-HD_in_Krakow.jpg","page_title":"Setra","context_page_description":"Setra – niemiecka marka autobusów i autokarów należąca od 1995 r. do grupy Daimler AG i działająca w ramach spółki EvoBus GmbH. Przedsiębiorstwo zostało założone w 1893 r. w Ulm przez Karla Käßbohrera jako Wagenfabrik Kässbohrer. Początkowo zajmowało się produkcją powozów konnych, później także omnibusów, samochodów ciężarowych i osobowych. W 1951 r. zaprezentowano model Setra S 8 – pierwszy autobus z nadwoziem samonośnym. Nazwa marki pochodziła od niemieckiego słowa Selbsttragend. Od tego czasu przedsiębiorstwo stało się jednym z największych producentów autobusów i autokarów w Europie, a także jednym z największych na rynku polskim. W ofercie producenta znajdują się trzy klasy autobusów: TopClass, w której skład wchodzą autokary wysokopokładowe podwyższone i dwupokładowe o wysokim standardzie wyposażenia; ComfortClass obejmującą autokary wysoko- i średniopokładowe oraz MultiClass, na którą składają się modele przeznaczone do obsługi ruchu podmiejskiego, regionalnego i krótkodystansowego ruchu turystycznego."},{"page_url":"https://tr.wikipedia.org/wiki/Basit_makine","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Polea-simple-movil2.jpg","page_title":"Basit makine","context_page_description":"Basit makineler: insanların, işlerini kolaylaştırmak için geliştirildiği araçlardır. Basit makineler, kuvvetten kazanç sağlamak, yoldan kazanç sağlamak, kuvvetin yönünü değiştirmek, işin yapılma hızını değiştirmek ya da bir enerji türünü başka bir enerji türüne dönüştürmek amaçlarıyla kullanılabilir."},{"page_url":"https://sk.wikipedia.org/wiki/Berville_(Val-d%E2%80%99Oise)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Map_commune_FR_insee_code_95059.png","page_title":"Berville (Val-d’Oise)","context_page_description":"Berville je francúzska obec, ktorá sa nachádza v departemente Val-d’Oise, v regióne Île-de-France."},{"page_url":"https://no.wikipedia.org/wiki/Sven_Lundquist","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Sven_Lundquist_SOK.jpg","page_title":"Sven Lundquist","context_page_description":"Sven Anders Viktor Lundquist var en svensk pistolskytter som deltok i de olympiske leker 1948 i London.\\nLundquist vant en olympisk bronsemedalje i skyting under Sommer-OL 1948 i London. Han kom på tredjeplass i skytekonkurransen 25 meter silhuettpistol med 569 poeng, bak Károly Takács fra Ungarn 580 poeng og Carlos Sáenz Diaz fra Argentina med 571 poeng."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8D%97%E3%83%AD%E3%82%B7%E3%82%A2%E8%BB%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Russian_civil_war_West_1918-20.png","page_title":"南ロシア軍","context_page_description":"南ロシア軍は、戦術的・戦略的な白軍の合同軍組織。ロシア南部において1919年から1920年の間存続し、ロシア内戦に参加した。\\n1919年10月の時点で最大兵力27万に達し、火砲600、戦車38、航空機72、艦船120を保有した。"},{"page_url":"https://en.wikipedia.org/wiki/Grade_II*_listed_buildings_in_Conwy_County_Borough","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Villa_Marina_Llandudno.jpg","page_title":"Grade II* listed buildings in Conwy County Borough","context_page_description":"In the United Kingdom, the term listed building refers to a building or other structure officially designated as being of special architectural, historical, or cultural significance; Grade II* structures are those considered to be \\"particularly important buildings of more than special interest\\". Listing was begun by a provision in the Town and Country Planning Act 1947. Once listed, strict limitations are imposed on the modifications allowed to a building's structure or fittings. In Wales, the authority for listing under the Planning Act 1990 rests with Cadw."},{"page_url":"https://gl.wikipedia.org/wiki/Lar_(editorial)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/12_A_Dona_das_Torres._%C3%81ngel_del_Castillo._Lar._1925.jpg","page_title":"Lar (editorial)","context_page_description":"Lar foi unha editorial da Coruña, continuadora da Editorial Céltiga, que publicou con periodicidade irregular, de 1924 a 1928, unha colección de novelas curtas. Estaba dirixida por Leandro Carré Alvarellos e administrada por Ánxel Casal. Os cinco primeiros números editáronse na imprenta Moret. A capa da colección estaba deseñada por Camilo Díaz Baliño.\\nCesou en 1928, dando paso á Editorial Nós."},{"page_url":"https://ro.wikipedia.org/wiki/Rezerva%C8%9Bia_peisagistic%C4%83_Saharna","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Pe_deal0023.JPG","page_title":"Rezervația peisagistică Saharna","context_page_description":"Rezervația peisagistică Saharna este o arie protejată, situată la vest de satul omonim din raionul Rezina, Republica Moldova. Are o suprafață de 674 ha. Obiectul este administrat de Gospodăria Silvică de Stat Orhei.\\nRezervația cuprinde un defileu stâncos cu peșteri, râul Saharna și cascade. Unele peșteri au fost locuite de oamenii primitivi. Pe versanți crește o pădure de stejar pufos."},{"page_url":"https://en.wikipedia.org/wiki/Ullet_Road_Unitarian_Church","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/William_Rathbone_VI_memorial%2C_Ullet_Road_church.jpg","page_title":"Ullet Road Unitarian Church","context_page_description":"Ullet Road Church is a Unitarian church at 57 Ullet Road, Sefton Park, Liverpool. Both the church and its attached hall are separately recorded in the National Heritage List for England as designated Grade I listed buildings. It was the first place of worship in the United Kingdom to register a civil partnership for a same-sex couple. It is a member of the General Assembly of Unitarian and Free Christian Churches, the umbrella organisation for British Unitarians."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E7%AC%AC39%E5%B1%86%E9%87%91%E9%85%B8%E8%8E%93%E7%8D%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Kellyanne_Conway_by_Gage_Skidmore_3.jpg","page_title":"第39屆金酸莓獎","context_page_description":"第39届金酸莓奖是于2018年颁发给表现最差的电影工作者。入围名单于2019年1月21日公布，获奖者于同年2月23日公布。"},{"page_url":"https://fi.wikipedia.org/wiki/Arthur_Gardiner_Butler","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/94/Arthur_Gardiner_Butler.jpg","page_title":"Arthur Gardiner Butler","context_page_description":"Arthur Gardiner Butler oli englantilainen eläintieteilijä.\\nButler työskenteli British Museumissa, missä hän luokitteli lintuja, hyönteisiä ja hämähäkkejä. Butler julkaisi useita teoksia ja lajiluetteloita."},{"page_url":"https://pt.wikipedia.org/wiki/Ru%C3%ADnas_lusitano-romanas_da_Boca_do_Rio","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Planta_das_ruinas_romanas_da_Boca_do_Rio_-_Archeologo_Portugues_XV_1910.png","page_title":"Ruínas lusitano-romanas da Boca do Rio","context_page_description":"O conjunto das Ruínas lusitano-romanas da Boca do Rio, também conhecido como Villa Romana da Boca do Rio, é um monumento no concelho de Vila do Bispo, no Distrito de Faro, em Portugal. Consiste num complexo de origem romana que incluía um edifício residencial, um conjunto industrial para a produção de derivados de peixe, e uma zona portuária com um grande pontão. O conjunto foi originalmente ocupado entre os Séculos II e V d.C., tendo posteriormente sido construído no mesmo local um armazém da Companhia de Pescas do Algarve. O sítio foi estudado pela primeira vez em 1878 pelo arqueólogo Estácio da Veiga. Foi classificado como Imóvel de Interesse Público em 1977."},{"page_url":"https://it.wikipedia.org/wiki/Oria","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Paolo_Monti_-_Servizio_fotografico_%28Oria%2C_1970%29_-_BEIC_6332742.jpg","page_title":"Oria","context_page_description":"Oria è un comune italiano di 14 951 abitanti della provincia di Brindisi in Puglia.\\nSituata in territorio collinare nel Salento settentrionale, presenta insediamenti umani già nel Neolitico come testimoniano i rinvenimenti rupestri presso la grotta di Sant'Anna. Secondo Erodoto fu fondata dai Cretesi con il nome di Hyria, fu secondo Strabone sede del basileum e quindi capitale politica dei Messapi. Nel I sec. a. C. divenne municipium romanum battente moneta propria. La città è nota per la sua ricchezza archeologica, per il suo centro storico di impronta medioevale ricco di viuzzole e scalini, per il Castello Svevo di Federico II a forma di vascello, per la fiorente comunità ebraica attiva per tutto il I sec. d.C. Dalla fine del XVI secolo è sede dell'omonima diocesi."},{"page_url":"https://de.wikipedia.org/wiki/Jacob_Zuma","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/President_Jacob_Zuma%27s_Nkandla_homestead.jpg","page_title":"Jacob Zuma","context_page_description":"Jacob Gedleyihlekisa Zuma ist ein südafrikanischer Politiker des African National Congress. Von 2009 bis 2018 war er Präsident von Südafrika. Bereits von 1999 bis 2005 war er Vizepräsident Südafrikas sowie von 2007 bis 2017 Vorsitzender des ANC. Seine Regierungsführung wird gelegentlich mit dem Schlagwort „Kleptokratie“ bezeichnet."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%84%A1%E6%A0%B8%E6%AD%A6%E5%9C%B0%E5%B8%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/North_Atlantic_Treaty_Organization_%28orthographic_projection%29.svg","page_title":"無核武地帶","context_page_description":"无核武地带，是指由联合国确认的根据各国自愿订立条约而明令禁止使用、研发和部署核武器的特定区域，联合国大会决议采取一系列监督和控制手段以保障有关条约的施行。无核武地带与不扩散核武器条约比较接近但又有一定的区别。与此类似的还有无核地带，这一概念指的是禁止使用、研发和部署核武器及核电站的特定区域，某些情况下该区域还会禁止安置或处理核废料、禁止使用或研发核动力装置；与无核武地带不同，无核地带所依据的并不是由联合国确认的国际条约。"},{"page_url":"https://ceb.wikipedia.org/wiki/Malvinas_Argentinas_(lungsod_sa_Argentina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Municipalidad_de_Malvinas_Argentinas_%282%29.jpg","page_title":"Malvinas Argentinas (lungsod sa Argentina)","context_page_description":"Lungsod ang Malvinas Argentinas sa Argentina. Nahimutang ni sa lalawigan sa Provincia de Córdoba, sa sentro nga bahin sa nasod, 600 km sa amihanan-kasadpan sa Buenos Aires ang ulohan sa nasod. 397 metros ibabaw sa dagat kahaboga ang nahimutangan sa Malvinas Argentinas, ug adunay 8,628 ka molupyo.\\nAng yuta palibot sa Malvinas Argentinas kay patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 418 ka metro ug 2.6 km sa kasadpan sa Malvinas Argentinas. Dunay mga 1,361 ka tawo kada kilometro kwadrado sa palibot sa Malvinas Argentinas may kaayo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Córdoba, 11.3 km sa kasadpan sa Malvinas Argentinas.\\nHapit nalukop sa kaumahan ang palibot sa Malvinas Argentinas. Ang klima umogon ug subtropikal. Ang kasarangang giiniton 18 °C. Ang kinainitan nga bulan Nobiyembre, sa 26 °C, ug ang kinabugnawan Hulyo, sa 9 °C. Ang kasarangang pag-ulan 891 milimetro matag tuig. Ang kinabasaan nga bulan Pebrero, sa 190 milimetro nga ulan, ug ang kinaugahan Hulyo, sa 4 milimetro."},{"page_url":"https://fr.wikipedia.org/wiki/Saison_NBA_2010-2011","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Mike_Brown_NBA_cropped.jpg","page_title":"Saison NBA 2010-2011","context_page_description":"La saison NBA 2010-2011 est la 62ᵉ saison de la NBA.\\nLa saison régulière se dispute du 26 octobre 2010 au 13 avril 2011. Elle comprend 1230 matchs, chaque franchise en disputant 82.\\nLe NBA All-Star Game 2011 a eu lieu le 20 février 2011 au Staples Center de Los Angeles, le parquet des Lakers et des Clippers. Les Mavericks de Dallas sont champions de NBA en 2011, ils battent le Heat de Miami lors des finales."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%9C%A7%E5%B3%B0%E5%8D%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Taiwan_Agricultural_Research_Institute.jpg","page_title":"霧峰區","context_page_description":"霧峰區，為中華民國臺中市最南端的市轄區，面積約98平方公里，為臺中市面積第四大區，區內擁有完整公路系統，為臺中市南端交通樞紐，亦為南投縣與臺中市之間重要的交通孔道。霧峰區因前臺灣民意最高機關臺灣省議會的設置為台灣民主化的發源地之一；亦為臺灣中部較早開發區域，區內富有眾多文史藝文設施，素有文化小城美名，因而近年積極發展博物館文化。"},{"page_url":"https://nl.wikipedia.org/wiki/Erpe-Mere","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Autosnelwegbrug_Mere.jpg","page_title":"Erpe-Mere","context_page_description":"Erpe-Mere is een gemeente in de Belgische provincie Oost-Vlaanderen. De gemeente telt 19.811 inwoners, die Erpe-Merenaars worden genoemd. Erpe-Mere heeft acht deelgemeenten, namelijk Aaigem, Bambrugge, Burst, Erondegem, Erpe, Mere, Ottergem en Vlekkem. In Bambrugge bevindt er zich ook nog een gehucht: Egem, een ander gehucht Edixvelde bevindt zich op de grens van Erpe, Mere en de Aalsterse deelgemeente Nieuwerkerken."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B5%D0%BB%D1%8F%D0%B5%D0%B2,_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D1%8C%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Vladimir_Vas._Belyaev.jpeg","page_title":"Беляев, Владимир Васильевич","context_page_description":"Влади́мир Васи́льевич Беля́ев — генерал-лейтенант, военный писатель, главный редактор журнала «Военный сборник» и газеты «Русский инвалид» в 1910—1914 гг."},{"page_url":"https://sco.wikipedia.org/wiki/Salman_Khan","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Salman_Khan_2015.jpg","page_title":"Salman Khan","context_page_description":"Abdul Rashid Salim Salman Khan, creditit as Salman Khan, is an Indian film actor, producer an televeesion personality."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D8%A7%D9%84%D9%85%D8%AF%D9%86_%D9%88%D8%A7%D9%84%D8%A8%D9%84%D8%AF%D8%A7%D8%AA_%D9%81%D9%8A_%D8%A8%D9%84%D8%BA%D8%A7%D8%B1%D9%8A%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Bojurishte_Culture_Home.JPG","page_title":"قائمة المدن والبلدات في بلغاريا","context_page_description":"هذه قائمة كاملة لجميع المدن والبلدات في بلغاريا مرتبة تنازليًا حسب التعداد السكاني. العواصم تظهر بالخط الغليط. المصادر الأولية هي المعهد الوطني للإحصاء وأكاديمية العلوم البلغارية.\\nأكبر مدينة هي صوفيا بحوالي 1.2 مليون نسمة وأصغر مدينة هي ملنيك بحوالي 300. أصغر المدن ليست بالضرورة أكبر من جميع القرى فالعديد من القرى أكثر سكانا من المدن، أكبر قرية مع حوالي 5000 نسمة."},{"page_url":"https://fy.wikipedia.org/wiki/Skermjen_op_de_Olympyske_Simmerspullen_2008","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6d/2008_Fencing_Hall_of_the_National_Convention_Center.JPG","page_title":"Skermjen op de Olympyske Simmerspullen 2008","context_page_description":"De Olympyske Spullen fan de XXIXe Olympiade waarden fan 8 oant en mei 24 augustus 2008 hâlden yn Peking, de haadstêd fan Sina. It Skermjen hie plak yn it Olympic Green Convention Center."},{"page_url":"https://it.wikipedia.org/wiki/Llangadwaladr","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Cadfan.JPG","page_title":"Llangadwaladr","context_page_description":"Llangadwaladr è una comunità del Galles e una località balneare sul Mare d'Irlanda dell'isola di Anglesey, nel nord-ovest del Galles, situata lungo il percorso del sentiero Anglesey."},{"page_url":"https://de.wikipedia.org/wiki/Life_Cycle_Costing","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c3/LCC_1.png","page_title":"Life Cycle Costing","context_page_description":"Life-Cycle-Costing bzw. Lebenszykluskostenrechnung ist eine Kostenmanagement-Methode, die die Entwicklung eines Produktes von der Produktidee bis zur Rücknahme vom Markt betrachtet, also „von der Wiege bis ins Grab“. Dabei sind nur die negativen Zahlungsströme von Interesse, die Erlöse werden vernachlässigt."},{"page_url":"https://en.wikipedia.org/wiki/Dabajian_Mountain","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/DabajianMountain.jpg","page_title":"Dabajian Mountain","context_page_description":"Dabajian Mountain is located in the northern section of the Shei-Pa National Park in Hsinchu County, Taiwan. It is surrounded by numerous other peaks, the most predominant including Mount Nanhuda, Mount Yize, Central Range Point, Mt. Pintian, and Mt. Mutule. It is also near the Madala River."},{"page_url":"https://it.wikipedia.org/wiki/Grattacieli_di_New_York","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e5/WTM3_NYU_FC_2_0073.jpg","page_title":"Grattacieli di New York","context_page_description":"New York, città degli Stati Uniti, vanta la presenza di 6.472 grattacieli, più alti di 100 metri, 92 dei quali sono più alti di 183 metri. L'edificio più alto della città è il One World Trade Center, terminato nel 2014, che raggiunge l'altezza di 541 metri\\nAl secondo posto c'è il 432 Park Avenue, un lussuoso edificio residenziale situato appunto al numero 432 della Park Avenue, a sud est del Central Park, la cui altezza è di 426 metri. Segue poi il 30 Hudson Yards, inaugurato il 15 marzo 2019, alto 386 metri e facente parte del nuovo complesso di Hudson Yards. L'Empire State Building, con i suoi 381 metri è al quarto posto ma è stato l'edificio più alto del mondo dall'anno del suo completamento, il 1931, fino al 1972, quando furono eretti i 110 piani della Torre nord del World Trade Center. Con i loro 417 metri, le torri gemelle furono i grattacieli più alti del globo fino al completamento nel 1974 dei 108 piani della Sears Tower a Chicago.\\nQuando nel 2001 i due grattacieli del World Trade Center sono stati distrutti dagli attacchi terroristici dell'11 settembre, l'Empire State Building ha riconquistato il titolo di edificio più alto della città."},{"page_url":"https://es.wikipedia.org/wiki/Esteatita","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Mineraly.sk_-_mastenec.jpg","page_title":"Esteatita","context_page_description":"La esteatita, también conocida como piedra o roca de jabón, es una roca metamórfica muy blanda, de tipo predominantemente ultramáfico compuesto en gran parte por mineral de talco, por lo que es rica en magnesio, y con pequeñas cantidades de clorita, anfíboles, piroxenos, óxidos, carbonatos, olivino, serpentina y micas negras.​ Se produce por metamorfismo dinamotérmico y metasomatismo en las zonas donde las placas tectónicas están subducidas, cambiando las rocas por calor y presión, con afluencia de fluidos, pero sin fusión.\\nDesde un punto de vista físico, tienen características particulares, ya que son a la vez resistentes y blandas y, por lo tanto, relativamente fáciles de manejar con herramientas simples y ha sido un material usado para el tallado durante miles de años. Además, estas rocas tienen una alta capacidad calorífica —por ello usadas en hornos y estufas— y son un buen un aislante eléctrico."},{"page_url":"https://pl.wikipedia.org/wiki/Notus_(Idaho)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/US_Post_office_notus_idaho_2012-10-01.jpg","page_title":"Notus (Idaho)","context_page_description":"Notus – miasto w Stanach Zjednoczonych, w stanie Idaho, w hrabstwie Canyon."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%8D%83%E5%8E%9F%E5%8F%B0%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Chiharadai_platform_2011.jpg","page_title":"千原台站","context_page_description":"千原台站是一个位于千叶县市原市千原台西一丁目，属于京成电铁千原线的铁路车站。千原线的终点站。车站编号是KS65。\\n此站是京成电铁在市原市内唯一的车站，车站往北侧步行约200米即为千叶市绿区。临时站名是以汉字而非平假名表记的“千原台”。"},{"page_url":"https://en.wikipedia.org/wiki/1-Heptacosanol","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Heptacosanol.png","page_title":"1-Heptacosanol","context_page_description":"1-Heptacosanol is a fatty alcohol."},{"page_url":"https://fr.wikipedia.org/wiki/Adam_Venceslas_de_Cieszyn","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Podpis_Adama_Wac%C5%82awa_Cieszy%C5%84skiego_z_1613_roku.png","page_title":"Adam Venceslas de Cieszyn","context_page_description":"Adam Venceslas de Cieszyn est un prince de la dynastie Piast né le 12 décembre 1574 et mort le 13 juillet 1617. Il règne sur le duché de Cieszyn de 1579 jusqu'à sa mort."},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_Libyas_fugler","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Gallinago_media.jpg","page_title":"Liste over Libyas fugler","context_page_description":"Denne listen over Libyas fugler inkluderer 354 arter. Inkludert er 1 introdusert art.\\nRekkefølge er etter Clements-lista versjon v2015.\\nDe norske navn følger Norske navn på verdens fugler.\\nStatus på lista:\\nFA - Fremmed art. En art som forekommer utenfor sitt naturlige utbredelsesområde. Arten har blitt frakta dit av mennesker.\\nS - Lybisk sjeldenhet eller tilfeldig.\\nX - Lokalt utryddet\\nEX - Utryddet etter IUCNs rødliste\\nNT - Nær truet etter IUCNs rødliste\\nVU - Sårbar etter IUCNs rødliste\\nEN - Sterkt truet etter IUCNs rødliste\\nCR - Kritisk truet etter IUCNs rødliste"},{"page_url":"https://zh.wikipedia.org/zh-mo/%E6%9D%BF%E9%96%93%E6%88%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/HK_Mei_Ho_House_exhibition_2013_-_Hong_Kong_residential_building_history_%E9%96%93%E6%9D%BF%E6%88%BF_room_interior_%E6%9D%BF%E9%96%93%E6%88%BF_partition.jpg","page_title":"板間房","context_page_description":"間板房，又名板間房，是建築物結構的建築空間，是房的一類，物料用「木板」間出的房間。間板房在1950年代以後的香港流行，因為當時的舊唐樓長寬高都很寬大，興起一屋多人「包租」，二房東俗稱「包租公」，為了分租給三房客，改建風格平正，所以出現間板。間板房較利用磚頭和石屎來的不堅固，又若談話大聲點，毗鄰另一租客也可以聽到。"},{"page_url":"https://en.wikipedia.org/wiki/Hadzilia_Folklore_and_Ethnological_Museum","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Macedonian_Museums-24-Laografiko_Xatziilia-118.jpg","page_title":"Hadzilia Folklore and Ethnological Museum","context_page_description":"The Hadzilia Folklore and Ethnological Museum is a private museum in the northern Greek city of Serres, a collection built up over twenty years, which opened in June 1998. Housed on the ground floor of a building in Serres town centre, its purpose is to give the local people and visitors to the town an opportunity to learn something about folk culture.\\nThe museum has six sections: musical instruments, jewellery, weapons and uniforms, sacred vessels, traditional dress, and reconstructions of folk life.\\nThe first section has a large number of old string, wind, and percussion instruments. The oldest, two Thracian lyres, date to the seventeenth century. Other noteworthy exhibits are a bellows organ, bagpipes, old gramophones, and a reconstruction of an ancient lyre. The most notable feature of section two is the 200 buckles of all types – priests’ buckles large and small, Sarakatsani buckles, Thracian buckles, and buckles from Orini. There are also collars, earrings, necklaces, watches, bracelets, crowns, and crosses, all dating to the nineteenth and twentieth centuries."},{"page_url":"https://nn.wikipedia.org/wiki/Plog","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Brockhaus_and_Efron_Encyclopedic_Dictionary_b35_155-1.jpg","page_title":"Plog","context_page_description":"Plog er ein jordbruksmaskin som vert nytta for å snu torva, før det vert sådd eller planta. Føremålet med dette er å skjera av ugrasrøter og grava ned gamle planterestar for å unngå overføring av sjukdom til nye planter. Delvis nedbrotne planterestar frå tidlegare avlingar vert ført til overflata, der dei vert vidare brotne ned slik at næringsstoffa vert frigjorde og kan takast opp av nye planter. Bruk av tunge maskinar fører til at jorda vert pakka saman. Når torva vert snudd vert jorda løyst opp att og det kjem luft til, slik at bakteriane som bryt ned gamle planterestar får betre vilkår. Når torva vert snudd vert ho liggande i 45° vinkel og at det vert ope rom under. Dette fører til at vatnet i staden for å renna av, sig ned i grunnen når det regnar. Dette gjer at jordsmonet syg til seg meir vatn, som røtene på plantene så kan suga til seg. Om ein spreier gjødsel før ein pløyer får ein molda ned gjødsla i same operasjonen.\\nTidlegare vart plogar dregne av eit trekkdyr, som ofte var ein hest. I industrialiserte land vert det i dag berre nytta traktorplogar, men i mange utviklingsland vert det framleis nytta trekkdyr for pløying."},{"page_url":"https://de.wikipedia.org/wiki/Eight_Inc.","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Edgewood.jpg","page_title":"Eight Inc.","context_page_description":"Eight Inc. ist ein multidisziplinäres Design- und Innovationsstudio mit Standorten in New York City, San Francisco, Honolulu, Tokio, Peking und London. Gegründet 1989 von Tim Kobe, entwirft Eight Inc. Wohn- und Gewerbeobjekte, Produkte und Kommunikationskonzepte."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Monschau","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Monschau_Laufenstra%C3%9Fe_54.jpg","page_title":"Liste der Baudenkmäler in Monschau","context_page_description":"Die Liste der Baudenkmäler in Monschau enthält die denkmalgeschützten Bauwerke auf dem Gebiet der Stadt Monschau im Städteregion Aachen in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Monschau eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://sv.wikipedia.org/wiki/Marielundskyrkan","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Marielundskyrkan.JPG","page_title":"Marielundskyrkan","context_page_description":"Marielundskyrkan kapell är en kyrka i Östersunds församling i Härnösands stift. Kyrkan är belägen i centrala Östersund södra utkant. Marielundskyrkan är en treskeppig basilika, byggd i trä. Kyrkorummet är likaledes treskeppigt med valv och väggar klädda med blålaserad furupanel.\\nKyrkans altarsilver och dopfunt är tillverkade av silversmed Kerstin Öhlin Lejonklou. Planeringen av den nya kyrkan i stadsdelen Marielund inleddes 1964. Året därpå inköptes tomtmark för ändamålet. Kyrkan uppfördes efter ritningar av arkitekt Tore Virke och stod klar 1969. Arkitektens strävan var att ge träkyrkan en enkel och vardaglig karaktär som kan stå i kontrast till modernismen ”radikala formspråk”."},{"page_url":"https://sv.wikipedia.org/wiki/Ilex_ciliospinosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Ilex-ciliospinosa-flower.JPG","page_title":"Ilex ciliospinosa","context_page_description":"Ilex ciliospinosa är en järneksväxtart som beskrevs av Ludwig Eduard Loesener. Ilex ciliospinosa ingår i släktet järnekar, och familjen järneksväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://cy.wikipedia.org/wiki/Pila_prysgoed_pen_gwyrddrhesog","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Green-striped_Brush-Finch_-_Sinaloa_-_Mexico_S4E1249_%2823283475432%29.jpg","page_title":"Pila prysgoed pen gwyrddrhesog","context_page_description":"Aderyn a rhywogaeth o adar yw Pila prysgoed pen gwyrddrhesog a adnabyddir hefyd gyda'i enw gwyddonol Atlapetes virenticeps; yr enw Saesneg arno yw Green-striped brush finch. Mae'n perthyn i deulu'r Breision sydd yn urdd y Passeriformes.\\nTalfyrir yr enw Lladin yn aml yn A. virenticeps, sef enw'r rhywogaeth. Mae'r rhywogaeth hon i'w chanfod yng Ngogledd America."},{"page_url":"https://en.wikipedia.org/wiki/Don_Dunstan","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/YoungDunstan.JPG","page_title":"Don Dunstan","context_page_description":"Donald Allan Dunstan, AC, QC, usually known as Don Dunstan, was a South Australian politician. He entered politics as the Member for Norwood in 1953 at age 26, became leader of the South Australian Branch of the Australian Labor Party in 1967, and was Premier of South Australia between June 1967 and April 1968, and again between June 1970 and February 1979.\\nIn the late 1950s, Dunstan became well known for his campaign against the death penalty being imposed on Max Stuart, who was convicted of rape and murder of a small girl. He harried Premier Thomas Playford IV aggressively over the matter, creating an uproar over what he saw as an unfair process. Playford eventually relented, and appeared shaken thereafter; the event was seen as a turning point in the Liberal and Country League's decline, and Labor gained momentum. During Labor's time in opposition, Dunstan was prominent in securing some reforms in Aboriginal rights, and was at the forefront of Labor abandoning the White Australia Policy."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BE%D1%84%D1%96%D0%B9%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B5%D1%82%D1%80%D0%BE%D0%BF%D0%BE%D0%BB%D1%96%D1%82%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/%D0%96.%D0%BA._%D0%94%D0%B8%D0%B0%D0%BD%D0%B0%D0%B1%D0%B0%D0%B4%2C_1172_%D0%A1%D0%BE%D1%84%D0%B8%D1%8F%2C_Bulgaria_-_panoramio.jpg","page_title":"Софійський метрополітен","context_page_description":"Софі́йський метрополіте́н, Софійське Метро — система ліній метрополітену в Софії, столиці Болгарії, є єдиним метрополітеном держави.\\nВведено в дію 28 січня 1998 р. Станом на 08 березня 2015, Софійський метрополітен має дві з'єднані між собою лінії — 35 станцій, довжина маршрутів 40 км Метро з'єднує густонаселені райони Люлін - Младост і Надєжда - Лозенець. Крім того, з 2 квітня 2015, лінія 1 обслуговує аеропорт Софія\\nКошти на будівництво Софійського метро отримує від Уряду Республіки Болгарія та Європейського Банку. Метро будує японська фірма."},{"page_url":"https://ca.wikipedia.org/wiki/Messini","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Local_train_at_Messini.jpg","page_title":"Messini","context_page_description":"Messini perifereia) del Peloponès, una de les 13 regions administratives en què està dividida Grècia.\\nA uns 15 km al nord de la ciutat de Messini estan les ruïnes de l'antiga Messene, amb la qual no s'ha de confondre, ja que no es va formar pel trasllat d'habitants d'aquella antiga ciutat. En el passat Messini es deia Nisi i va canviar de nom a Messini a finals del segle xix."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89criture_maya","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/CH%27A.jpg","page_title":"Écriture maya","context_page_description":"L’écriture maya est un système d'écriture logosyllabique, c'est-à-dire à la fois logographique et syllabographique, servant à retranscrire l'ensemble des langues mayas. L'écriture était l'apanage d'une caste de scribes « Ah Tz'iib » faisant partie de la haute société. Seules deux autres castes dirigeantes y avaient accès « les prêtres » et « les chefs ». Elle était inaccessible au reste de la population.\\nLa singularité de cette écriture s'appuyant sur deux modes de retranscription distincts jamais mélangés dans les autres écritures mondiales, a considérablement retardé son déchiffrement. Les caractères ou glyphes correspondant à des notions décrivent le plus souvent des éléments qui étaient universellement partagés par les mayas comme : les mois du calendrier annuel, ou les jours du calendrier rituel, ou les astres, ou les villes, ou les états, ou les dieux ou des animaux ou des plantes. Les autres glyphes correspondaient à des syllabes. Mais eux-mêmes pouvaient exister sous trois formes distinctes. Une forme relativement carrée et centrale, ou une représentation en bandeau vertical ou horizontal selon que la syllabe est un préfixe ou un suffixe du glyphe central."},{"page_url":"https://de.wikipedia.org/wiki/Villa_Bertram","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Bertramka_vila.jpg","page_title":"Villa Bertram","context_page_description":"Die Villa Bertram ist eine Villa im Prager Stadtteil Smíchov. Heute dient sie als Museum zum Gedenken an Wolfgang Amadeus Mozart."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_mammif%C3%A8res_au_Qu%C3%A9bec","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Least_chipmunk_%28Tamias_minimus%29%2C_Coulter_Bay%2C_Grand_Teton_NP_%2819434750979%29.jpg","page_title":"Liste des mammifères au Québec","context_page_description":"Cette liste des mammifères au Québec est basée sur la « Liste de la faune vertébrée du Québec ». Elle comprend les espèces disparues dans l'histoire récente et les espèces introduites. Elle compte 97 espèces en neuf ordres : une espèce de didelphimorphes, dix espèces d'insectivores, huit espèces de chiroptères, trois espèces de lagomorphes, 25 espèces de rongeurs, 21 espèces de fissipèdes, cinq espèces d'artiodactyles, sept espèces de pinnipèdes et 17 espèces de cétacés."},{"page_url":"https://it.wikipedia.org/wiki/Piliocolobus_kirkii","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Red_Colobus_monkey.jpeg","page_title":"Piliocolobus kirkii","context_page_description":"Il còlobo rosso di Zanzibar è una specie di colobo rosso endemica di Unguja, l'isola principale dell'arcipelago di Zanzibar, al largo delle coste della Tanzania. È noto anche come colobo rosso di Kirk in onore di Sir John Kirk, il Residente Britannico di Zanzibar che lo rese noto per la prima volta alla comunità zoologica. Attualmente è considerato una specie minacciata e a metà degli anni '90 è stato adottato come specie bandiera dai conservazionisti di Zanzibar. Questa specie è stata riclassificata due volte: in precedenza è appartenuta al genere Colobus e più recentemente a quello Procolobus.\\nIl nome locale del P. kirkii in swahili è kima puju, letteralmente \\"scimmia velenosa\\". Secondo la tradizione popolare, infatti, la presenza del colobo in un'area causa la morte della vegetazione; si dice anche che un cane che mangi un colobo rosso perda il pelo."},{"page_url":"https://sv.wikipedia.org/wiki/Harvey_Milk","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Harvey_Milk_with_Audrey_Milk_1973.jpg","page_title":"Harvey Milk","context_page_description":"Harvey Bernard Milk, född 22 maj 1930 i Woodmere, Nassau County, New York, död 27 november 1978 i San Francisco, Kalifornien, var en amerikansk politiker och den första öppet homosexuella mannen som valdes till ett politiskt ämbete i Kalifornien. I sitt tidiga liv var han inte intresserad av politik och aktivism för homosexuellas rättigheter. Han var inte öppen med sin sexualitet eller politiskt aktiv förrän han var omkring 40 år. Milk lämnade New York City för att bosätta sig i San Francisco under en migration av homosexuella män som flyttade till Castro-området på 1970-talet. Områdets växande politiska och ekonomiska makt främjade Milks intressen. Han kandiderade till politiska ämbeten tre gånger utan framgång. Teatraliska kampanjer ökade Harvey Milks popularitet och 1977 valdes han in i San Franciscos stadsfullmäktige, ett resultat av de bredare sociala förändringar som staden genomlevde.\\nHarvey Milk innehade sitt ämbete i 11 månader och var ansvarig för att ta fram en kommunal stadga för homosexuellas rättigheter."},{"page_url":"https://fr.wikipedia.org/wiki/Alexandre_Mouton","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b5/Alexandre_Mouton_%C3%A2g%C3%A9.jpg","page_title":"Alexandre Mouton","context_page_description":"Alexandre Mouton, né le 19 novembre 1804 et mort le 12 février 1885, est un sénateur des États-Unis d'origine cadienne et le onzième gouverneur de la Louisiane."},{"page_url":"https://en.wikipedia.org/wiki/Radio_City_1386AM","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/RadioCityStudio2.JPG","page_title":"Radio City 1386AM","context_page_description":"Radio City 1386AM - The Swansea Bay University Health Board's Radio Service is the Hospital Radio service based in Singleton Hospital, Swansea."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D1%80%D0%B3%D0%BE%D0%B9%D1%82%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/%D0%9B%D0%B0%D0%B3%D0%B5%D1%80%D1%8C_%D0%B0%D1%80%D1%85%D0%B5%D0%BE%D0%BB%D0%BE%D0%B3%D0%BE%D0%B2.jpg","page_title":"Оргойтон","context_page_description":"Орго́йтон — местность, расположенная в горах в 4 км к югу от села Зарубино Джидинского района в Бурятии, в 2 км от бывшего бурятского улуса Били, в 6 км от бывшего хутора Дюрбенского, в 8 км от села Усть-Кяхта."},{"page_url":"https://en.wikipedia.org/wiki/Bubble_gum","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Bubble_gum_at_the_Haribo_factory.jpg","page_title":"Bubble gum","context_page_description":"Bubble gum is a type of chewing gum, designed to be inflated out of the mouth as a bubble."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_im_K%C3%B6lner_Stadtteil_Altstadt-Nord","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Stolpersteine_K%C3%B6ln_Gereonsdriesch_27.jpg","page_title":"Liste der Stolpersteine im Kölner Stadtteil Altstadt-Nord","context_page_description":"Die Liste der Stolpersteine im Kölner Stadtteil Altstadt-Nord führt die vom Künstler Gunter Demnig verlegten Stolpersteine im Kölner Stadtteil Altstadt-Nord auf.\\nDie Liste der Stolpersteine beruht auf den Daten und Recherchen des NS-Dokumentationszentrums der Stadt Köln, zum Teil ergänzt um Informationen und Anmerkungen aus Wikipedia-Artikeln und externen Quellen. Ziel des Kunstprojektes ist es, biografische Details zu den Personen, die ihren freiwillig gewählten Wohnsitz in Köln hatten, zu dokumentieren, um damit ihr Andenken zu bewahren.\\nAnmerkung: Vielfach ist es jedoch nicht mehr möglich, eine lückenlose Darstellung ihres Lebens und ihres Leidensweges nachzuvollziehen. Insbesondere die Umstände ihres Todes können vielfach nicht mehr recherchiert werden. Offizielle Todesfallanzeigen aus den Ghettos, Haft-, Krankenanstalten sowie den Konzentrationslagern können oft Angaben enthalten, die die wahren Umstände des Todes verschleiern, werden aber unter der Beachtung dieses Umstandes mitdokumentiert."},{"page_url":"https://nl.wikipedia.org/wiki/Overleg_van_Poissy","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Croix_huguenote.png","page_title":"Overleg van Poissy","context_page_description":"Het Overleg van Poissy vond plaats in Poissy, Frankrijk, tussen katholieken en hugenoten in de 16e eeuw. De Franse naam is Colloque de Poissy. Het was het overleg van de laatste kans. Aangezien dit overleg mislukte, stond niets meer het bloedvergieten in de weg tijdens de Hugenotenoorlogen."},{"page_url":"https://en.wikipedia.org/wiki/Idoa,_Nigeria","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Idoa_Community_Age_group_naming_ceremony39.jpg","page_title":"Idoa, Nigeria","context_page_description":"Idoa is an Esan community in Edo, Nigeria. The city, an Esan tribe, stretches through the highlands and plains of central Edo State. It is 120 kilometres north of Benin City, the capital of Edo State, having boundaries with Ekpoma in the west, Ukhun in the south, Ewu in the east and Agbede in the north. Residents are mainly farmers and grow crops, including yams, rice, cassava, taro and cocoa. The city of Idoa is currently made up of the following five clans: Afuku-N'Edo, Afokolo, Atologua, Ubi and Ofie."},{"page_url":"https://it.wikipedia.org/wiki/Texas_Rangers_(baseball)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Rangersballparkinarlington.jpg","page_title":"Texas Rangers (baseball)","context_page_description":"I Texas Rangers sono una delle squadre professionistiche di baseball della Major League Baseball, con sede ad Arlington, Texas. Sono membri della West Division della American League. Il nome della squadra è tratto dall'omonima forza di polizia americana.\\nLa squadra venne fondata nel 1961 con il nome di Washington Senators. La squadra inizialmente venne assegnata alla città di Washington, poiché i Senators originali si erano trasferiti a Minneapolis, diventando gli attuali Minnesota Twins. Tuttavia dopo 10 anni, nel 1971, si trasferirono nella città di Arlington nello stato del Texas, assumendo, dalla stagione seguente, l'attuale nome di Texas Rangers.\\nComplessivamente, dal 1972 i Texas Rangers hanno collezionato sette apparizioni nella Post-season, nel 1996, nel 1998, nel 2002, nel 2010, nel 2011, nel 2015 e nel 2016 e come wild-car nel 2012.\\nNella stagione 2010 conquistano l'American League battendo, nella gara 6, i New York Yankees, accedendo così per la prima volta nella loro storia alle World Series, venendo poi sconfitti dai San Francisco Giants."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%BE%D0%B4%D0%B8%D0%BD%D0%B0_-_%D0%95%D0%B2%D1%80%D0%B0%D0%B7%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D0%A1%D0%BE%D1%8E%D0%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/%D0%94%D0%B2%D0%B8%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_%22%D0%A0%D0%BE%D0%B4%D0%B8%D0%BD%D0%B0_-_%D0%95%D0%B2%D1%80%D0%B0%D0%B7%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D0%A1%D0%BE%D1%8E%D0%B7%22_%D1%80%D0%B0%D1%81%D1%82%D1%8F%D0%BD%D1%83%D0%BB%D0%BE_%D0%B3%D0%B5%D0%BE%D1%80%D0%B3%D0%B8%D0%B5%D0%B2%D1%81%D0%BA%D1%83%D1%8E_%D0%BB%D0%B5%D0%BD%D1%82%D1%83_%D0%B2_%D0%9C%D0%BE%D0%BB%D0%B4%D0%B0%D0%B2%D0%B8%D0%B8.jpg","page_title":"Родина - Евразийский Союз","context_page_description":"\\"Родина – Евразийский Союз\\" - это общественное движение в Республике Молдова, объединяющее граждан и неправительственные общественные и этнокультурные организации республики, которые выступают за развитие страны в евразийском направлении с последующим вступлением РМ в Таможенный и Евразийский Союзы."},{"page_url":"https://zh.wikipedia.org/zh-my/%E4%B8%AD%E5%8D%97%E7%BE%8E%E7%99%BD%E5%B0%8D%E8%9D%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Litopenaeus_vannamei_specimen.jpg","page_title":"中南美白對蝦","context_page_description":"中南美白对虾，俗称白虾、白对虾、白脚虾或太平洋白虾，是一种生活于太平洋东岸的对虾科滨对虾属物种。本物种自1990年代初期已引进台湾的养殖场饲养，以供食用。"},{"page_url":"https://vi.wikipedia.org/wiki/J%C3%B3zef_M%C4%99cina-Krzesz","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/M%C4%99cina-Krzesz-Selfportrait2.jpg","page_title":"Józef Męcina-Krzesz","context_page_description":"Józef Feliks Męcina-Krzesz là một họa sĩ người Ba Lan, nổi tiếng với các bức tranh bối cảnh lịch sử, nghệ thuật tôn giáo và chân dung."},{"page_url":"https://de.wikipedia.org/wiki/K%C3%B6nigliches_Zinshaus","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Budapest_-_Kir%C3%A1lyi_b%C3%A9rh%C3%A1z_%2837578077405%29.jpg","page_title":"Königliches Zinshaus","context_page_description":"Das Königliche Zinshaus ist ein am Budapester Franziskanerplatz liegendes monumentales Wohn- und Geschäftshaus im V. Bezirk. Das stadtbildprägende Haus wurde von 1899 bis 1902 in einem eklektischen Stil erbaut mit einer Mischung von Bauformen des Neuklassizismus und des Jugendstils."},{"page_url":"https://hu.wikipedia.org/wiki/Streymin-h%C3%ADd","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Sundini_at_Nor%C3%B0sk%C3%A1li%2C_Faroe_Islands.JPG","page_title":"Streymin-híd","context_page_description":"A Streymin-híd egy híd Feröeren, amely a Sundini fölött ível át, és két szigetet, Streymoyt és Eysturoyt köti össze. Nevét a Streyminről, a Sundini legszűkebb részéről kapta, amely a torlóár miatt erős áramlásnak van kitéve.\\nA hidat tréfásan az Atlanti-óceán fölötti hídnak szokták nevezni."},{"page_url":"https://sq.wikipedia.org/wiki/Sergio_Ramos","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Sergio_Ramos_entrenando.jpg","page_title":"Sergio Ramos","context_page_description":"Sergio Ramos García është një futbollist profesionist spanjoll i cili luan si mbrojtës dhe është kapiten i klubit spanjoll Real Madrid dhe Kombëtares spanjolle. Ai luan zakonisht si qëndër mbrojtës, por ai mund të luaj edhe si mbrojtës i dhjathtë. Ramos konsiderohet gjërësisht si një nga mbrojtësit më të mirë të gjeneratës së tij, si dhe është vlersuar për aftësitë e shënimit të golave dhe pasimet.\\nPasi doli nga akademia e të rinjëve të Seviljes dhe shpenzoi dy sezone me ekipin e parë, Ramos u transferua te Real Madridi në verën e vitit 2005. Që nga ajo kohë, ai është bërë një nga lojtarët më të rëndësishëm të klubit, duke fituar 21 trofe madhor, përfshirë katër tituj të La Ligas dhe të Ligës së Kampioneve, duke u bërë një nga golashënuesit më të mirë të La Ligas nga mbrojtja. Ramos luajti një rol vendimtar në të katërta fushatat ku Reali fitoi Ligën e Kampioneve, duke u emëruar në ekipin më të mirë të kompeticionit në të gjitha rastet. Ai gjithashtu ka shënuar gol në dy finale të ndryshme, përfshirë edhe golin e barazimit të përkohshëm në minutën e 93të në finalen e vitit 2014."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%95%E3%83%A9%E3%83%B3%E3%82%B9%E7%A4%BE%E4%BC%9A%E4%B8%BB%E7%BE%A9%E5%8A%B4%E5%83%8D%E8%80%85%E9%80%A3%E7%9B%9F","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c6/Paul_Brousse.png","page_title":"フランス社会主義労働者連盟","context_page_description":"フランス社会主義労働者連盟は、1882年に結成され1902年まで存続したフランスの社会主義政党。略称は「FTSF」。"},{"page_url":"https://es.wikipedia.org/wiki/M%C3%A1s_m%C3%A9dicos","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Mais_Medicos_Padilha.jpg","page_title":"Más médicos","context_page_description":"Más médicos es un programa lanzado en 8 de julio de 2013 por el gobierno de Dilma Rousseff, cuyo objetivo es suplir la carencia de médicos en los municipios del interior y en las periferias de las grandes ciudades de Brasil. El programa pretendía llevar 15 mil médicos para las áreas donde faltan estos profesionales de la salud.​ El formato de la \\"importación\\" de médicos de otros países fue blanco de duras críticas de asociaciones representantes de los médicos, de la sociedad civil, de estudiantes del área de la salud e inclusive del Ministerio Público del Trabajo. ​"},{"page_url":"https://en.wikipedia.org/wiki/History_of_Mauritius","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Combat_de_Grand_Port_mg_9425.jpg","page_title":"History of Mauritius","context_page_description":"The known history of Mauritius begins with its discovery by Arabs, followed by Europeans and its appearance on maps in the early 16th century. Mauritius was successively colonized by the Netherlands, France and Great Britain, and became independent in 1968."},{"page_url":"https://pl.wikipedia.org/wiki/Parafia_Tr%C3%B3jcy_Przenaj%C5%9Bwi%C4%99tszej_w_Przemy%C5%9Blu","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8e/Opactwo_Benedyktynek_i_Kosciol_sw_Trojcy2.jpg","page_title":"Parafia Trójcy Przenajświętszej w Przemyślu","context_page_description":"Parafia Trójcy Przenajświętszej w Przemyślu – parafia rzymskokatolicka pod wezwaniem Trójcy Przenajświętszej w Przemyślu, należąca do dekanatu Przemyśl II w archidiecezji przemyskiej. Mieści się przy Placu Konstytucji 3 Maja, przy moście na brzegu Sanu."},{"page_url":"https://fr.wikipedia.org/wiki/Fronti%C3%A8re_entre_l%27Espagne_et_la_France","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e1/163.Abizanda.jpg","page_title":"Frontière entre l'Espagne et la France","context_page_description":"La frontière entre l'Espagne et la France est la frontière internationale terrestre et maritime séparant les deux pays, de l'Atlantique à la Méditerranée. Courant sur 623 kilomètres le long des Pyrénées, et interrompue par la principauté d'Andorre, c'est la plus longue frontière terrestre de la France métropolitaine.\\nElle n’acquiert son acception de limite entre États qu’au XVIᵉ siècle, à compter de l’avènement et de l’affrontement des monarchies des deux pays, c’est-à-dire sous les règnes de François Iᵉʳ et de Charles Quint. Avant cette période, les Pyrénées ont vu passer les Celtes, les Carthaginois, les Romains, les Vandales, les Suèves, les Wisigoths, les Maures, les Francs et les Anglais, sans qu’une frontière militaire ou politique soit établie entre États.\\nLe premier acte mentionnant une frontière entre les deux royaumes date de 1659. Il est signé sur l’île des Faisans par le cardinal Mazarin et don Luis de Haro, au nom de leurs souverains respectifs ; plusieurs territoires sont alors échangés."},{"page_url":"https://pl.wikipedia.org/wiki/Aminek_egipski","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Ammi_visnaga_umbela.jpg","page_title":"Aminek egipski","context_page_description":"Aminek egipski, kela egipska, aminek zębodłubka Lam. – gatunek rośliny zielnej. Rośnie dziko w Azji Zachodniej, Afryce Północnej, na Maderze, Wyspach Kanaryjskich oraz w Europie Południowej. Łacińska nazwa Ammi pochodzi od greckiego ammos – piasek, prawdopodobnie ze względu na małe wymagania siedliskowe lub małe nasiona. Z wyglądu podobna do kopru włoskiego. Aminek egipski to roślina jednoroczna lub dwuletnia."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A8%D8%AD%D9%8A%D8%B1%D9%87_%D8%A7%D9%86%D8%AF%D8%B3%DA%86%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/%C3%84ndsj%C3%B6n_vass.jpg","page_title":"بحيره اندسچون","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nاندسچون بحيره فى السويد."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B5%D1%85%D1%82,_%D0%A4%D1%80%D0%B8%D0%B4%D1%80%D0%B8%D1%85_%D0%9A%D0%B0%D1%80%D0%BB%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Obshchestvo_pooshchreniya_khudozhestv_S.-Petersburg_1912.jpg","page_title":"Лехт, Фридрих Карлович","context_page_description":"Фри́дрих Ка́рлович Лехт — российский и советский живописец немецкого происхождения, график, скульптор, общественный деятель, педагог, один из учредителей Ассоциации художников революционной России. Заслуженный деятель искусств Эстонской ССР."},{"page_url":"https://fr.wikipedia.org/wiki/Assembl%C3%A9e_nationale_constituante_tunisienne_de_1956","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Sadok_Boussofara%28cropped%29.jpg","page_title":"Assemblée nationale constituante tunisienne de 1956","context_page_description":"L'Assemblée nationale constituante tunisienne de 1956 est une assemblée constituante de 98 membres élue le 25 mars 1956, cinq jours après la proclamation de l'indépendance de la Tunisie. Elle fait aussi office de parlement monocaméral.\\nUne deuxième assemblée constituante est élue en 2011, à la suite de la révolution qui a causé la chute du régime du président Zine el-Abidine Ben Ali."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1978","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Faris_Al-Sultan_Ironman_70.3_Austria_2012.jpg","page_title":"Lijst van personen geboren in 1978","context_page_description":"Dit is een lijst van personen die geboren zijn in 1978.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://et.wikipedia.org/wiki/Mary,_kuninglik_printsess","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Mary%2C_Princess_Royal_and_Countess_of_Harewood.jpg","page_title":"Mary, kuninglik printsess","context_page_description":"Printsess Mary, kuninglik printsess ja Harewoodi krahvinna oli Briti kuningliku perekonna liige ning tiitli kuninglik printsess kuues valdaja."},{"page_url":"https://sl.wikipedia.org/wiki/Ope%C4%8Dna_gotika","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/05/Formstein_glasiert.JPG","page_title":"Opečna gotika","context_page_description":"Opečna gotika je poseben slog gotske arhitekture, ki je običajna v severozahodni in srednji Evropi, zlasti v regijah ob Baltskem morju in okoli njega, ki nimajo virov naravnega kamna, v mnogih krajih je veliko ledeniških balvanov. Objekti so v bistvu zgrajeni iz opeke. Stavbe, razvrščene kot opečna gotika, najdemo tudi v Belgiji, na Nizozemskem, v Nemčiji, na Poljskem, v Litvi, v Latviji, Estoniji, Kaliningradu, na Švedskem in Finskem.\\nKer je v 12. stoletju v severozahodni in srednji Evropi prišla uporaba pečena rdeča opeka, so najstarejše takšne zgradbe klasificirane kot opečna romanika. V 16. stoletju je opečno gotiko nadomestila opečna renesančna arhitektura.\\nZa opečno gotiko je značilno pomanjkanje figuralnega arhitekturnega okrasja, razširjenega v drugih slogih gotske arhitekture. Tipično za regijo ob Baltskem morju je kreativna razdelitev in strukturiranje sten, z uporabo zgrajenih ornamentov in barvnega kontrasta med rdečimi opekami, glaziranimi opekami in belim apnom. Kljub temu pa te značilnosti niso niti vsesplošne niti izključne."},{"page_url":"https://de.wikipedia.org/wiki/Pulverdingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Kiesersche_Forstkarte_Nr._158_Entzweyhingen_%28Enzweihingen%29.jpg","page_title":"Pulverdingen","context_page_description":"Pulverdingen, auch Pulverdinger Hof genannt, ist der Name eines Weilers zwischen Markgröningen und der B 10, der nach einer Wüstung um eine ehemalige Domäne der württembergischen Herzöge neu entstanden ist. Politisch gehört Pulverdingen heute zum Stadtteil Enzweihingen von Vaihingen an der Enz im Landkreis Ludwigsburg."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AD%D9%85%D8%A7%D9%85%D9%8A%D8%A7%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Rock_dove_-_natures_pics.jpg","page_title":"حماميات","context_page_description":"الحماميات هي فصيلة من فصائل الطيور وجمع الحمامة حمام وحمائم وحمامات وقد قام الإنسان بتدجينها، ويوجد منها العديد من الأنواع البرية.\\nيوجد من الحمام أنواع كثيرة منها للأكل ومنها للزينة وأخرى للطيران والهواية ومن أنواع الحمام المستخدم في الطيران بالنسبة للهواة ا أنواع الغزار والشامي والرميات ومن الرميات الكرزلي والرمية والمراسلات والزاجل والزاز والبدرنك والارفلي والزنكي ومن الغزار الرحاني والقطقاطي والعنبري كشك ومن الشوام العبسي والكركندي والشقلباظ وكل نوع من هؤلاء يتفرع منة أنواع أخرى كثيرة.\\nالحمام الريحاني هو أحد أشهر أنواع الحمام ومعروف عالمياً باسم الايجيبشان سويفت.\\nاللون أسود حالك والرقبة إلى الصدر ذهبية اللون وفي الأنواع الفاخرة منه فضية مشوبة بالصفرة وله خط أسود مخضر يفصل الرقبة عن الرأس. الرأس مستدير المنقار معصفر. أي يشبه منقار العصفور. الأنف صغير. العيون واسعة ولونهما ياقوتي فاتح والضريبة لارنجي والجفن أبيض. الأرجل والأصابع صغيرة والأظافر سوداء. عدد ريش الذيل 12. وطول الجناح أطول قليلاً من الذيل أثناء وقوف الفرد..\\nحمام العقعق الإنجليزي يتميز بالنحافة وجسده مسطح للغاية وتحمل نفسها هذه الطيور بمنتهى العمودية في أسلوب طيرانها، ويتناسل هذا النوع بطريقة جيدة وكذلك يعتنون جيداً بصغارهم بعكس الحمام الغزار المصري أو الحمام الآخر الذي له منقار قصير لا يقوى به أن يطعم صغاره جيداً."},{"page_url":"https://nds.wikipedia.org/wiki/Belize_River","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e0/BelizeRiverShot.JPG","page_title":"Belize River","context_page_description":"De Belize River is en 228 Kilometer langen Stroom in dat Land Belize, de dör de Distrikte Cayo un Belize löppt un in de Karibische See münnt.\\nDe Stroom billt sik twüschen San Ignacio/Santa Elena un Santa Familia dör dat Toohopfleten von Mopan River un Macal River.\\nDe Mopan River is mit över 200 Kilometer de längere Arm. He hett sien Born in dat Municipio Dolores, Departamento Petén, Guatemala. De Macal is üm un bi 112 Kilometer lang un hett sien Born in en unbewahnten Deel von de Maya-Bargen von Belize.\\nMopan un Belize River tohooprekent billt en över 400 Kilometer langen Stroom."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%AC%D9%88%D9%88%D8%B1%D9%86%DB%8C%DA%A9_(%DB%81%D9%88%D8%AF%D9%88%DA%BA_%DB%8C%D9%86_%D8%B6%D9%84%D8%B9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Evangelicka_fara_Javornik_nad_Velickou.jpg","page_title":"جوورنیک (ہودوں ین ضلع)","context_page_description":"جوورنیک (ہودوں ین ضلع) چیک جمہوریہ کا ایک بلدیہ جو ہودونین ضلع میں واقع ہے۔"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D1%83%D0%B1%D0%B5%D0%BD_(%D1%81%D1%8D%D0%BD%D0%B4%D0%B2%D0%B8%D1%87)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Katz%27s_Deli_-_Lunch.jpg","page_title":"Рубен (сэндвич)","context_page_description":"Сэндвич «Рубен» — американский гриль-сэндвич, состоящий из солонины, швейцарского сыра, квашеной капусты, русского соуса и кусочков ржаного хлеба. После сборки готовится на сковороде или в ростере. Часто ассоциируется с кошерной едой, но не является ею, потому что объединяет в себе мясо и сыр."},{"page_url":"https://en.wikipedia.org/wiki/Rockland_Industries","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Roc-lon_logo.gif","page_title":"Rockland Industries","context_page_description":"Rockland Industries, Inc. is a textile manufacturing company and the inventor of coated blackout curtain and drapery linings. The company is headquartered in Baltimore, Maryland and has manufacturing facilities in Bamberg, South Carolina. Rockland Industries has sales in the United States and in more than 90 countries worldwide."},{"page_url":"https://no.wikipedia.org/wiki/Hilde_Hagerup","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ce/Hilde_Hagerup3.JPG","page_title":"Hilde Hagerup","context_page_description":"Hilde Børresen Hagerup er en norsk forfatter. Hun har hovedsakelig skrevet ungdomsbøker, men høsten 2005 ga hun ut sin første voksenroman, Lysthuset.\\nFamilien flyttet tidlig fra Tromsø til Viker utenfor Fredrikstad. Hun begynte tidlig å skrive, og fikk utgitt sin første novelle bare 14 år gammel. Da hun var 17, flyttet hun til Wales for å gå på Atlantic College, og deretter studerte hun verdenshistorie ved University of London."},{"page_url":"https://nl.wikipedia.org/wiki/M-84","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Tenk_Trpinjska_cesta_Vukovar.JPG","page_title":"M-84","context_page_description":"De M-84 is een gevechtstank die in voormalig Joegoslavië werd ontwikkeld en in 1984 in dienst kwam bij het Joegoslavisch Volksleger. Vandaag de dag is de tank, en doorontwikkelde varianten ervan, in gebruik bij de legers van Bosnië en Herzegovina, Koeweit, Kroatië, Servië en Slovenië."},{"page_url":"https://sv.wikipedia.org/wiki/Lachenalia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Lachenalia_moniliformis1.jpg","page_title":"Lachenalia","context_page_description":"Lachenalia eller Papegojhyacintsläktet är ett släkte av sparrisväxter med omkring 65 arter. Lachenalia ingår i familjen sparrisväxter. De flesta växer naturligt i södra Afrika. Några få odlas som krukväxter i Sverige."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_gouverneurs_de_Californie","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/JamesRolphJrCalifGov.jpg","page_title":"Liste des gouverneurs de Californie","context_page_description":"Ceci est la liste des gouverneurs de Californie depuis qu'elle est devenue un État des États-Unis d'Amérique en 1850."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%B5%D1%81_%D1%81%D0%B2%D1%96%D0%B9%D1%81%D1%8C%D0%BA%D0%B8%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Komondor_delvin.jpg","page_title":"Пес свійський","context_page_description":"Пес сві́йський або соба́ка сві́йський — культигенна тварина. Термін застосовують як для домашніх, так і для бездомних тварин. Свійський пес був одним з найбільш широко застосовуваних службових та компанійських тварин протягом всієї історії людства.\\nЗа різними оцінками, одомашнення вовка відбулося від 100 000 до 15 000 років тому. Дослідження мітохондріальної ДНК показує, що розділення еволюційних ліній собак і вовків відбулося близько 100 000 років тому. Собака швидко став незамінним у всіх світових культурах та був дуже цінним у ранніх людських поселеннях. Зокрема вважають, що успішна еміграція через Берингову протоку могла б бути неможливою без їздових собак. Собаки виконують багато видів робіт для людей, таких як полювання, охорона, служба в поліції та військах, а також собаки допомагають пасти стада худоби, допомагають інвалідам та служать компанійськими сімейними собаками. Ця універсальність, більша ніж практично в будь-якої іншої відомої людству тварини, дала собаці прізвисько «найкращий друг людини». За підрахунками, на планеті на 2015 рік проживало близько 525 мільйонів собак."},{"page_url":"https://en.wikipedia.org/wiki/List_of_the_prehistoric_life_of_Nevada","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/KimmswickOzoraMidOrdReceptaculitid.jpg","page_title":"List of the prehistoric life of Nevada","context_page_description":"This list of the prehistoric life of Nevada contains the various prehistoric life-forms whose fossilized remains have been reported from within the US state of Nevada."},{"page_url":"https://fi.wikipedia.org/wiki/Vakionopeudens%C3%A4%C3%A4din","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Cruise_Control.svg","page_title":"Vakionopeudensäädin","context_page_description":"Vakionopeudensäädin on ajoneuvon varuste, joka automaattisesti ylläpitää kuljettajan säätämää ajonopeutta. Perinteistä vakionopeudensäädintä käytetään siten, että kuljettaja kiihdyttää ajoneuvon haluttuun nopeuteen ja aktivoi sitten vakionopeudensäätimen. Tämän jälkeen automatiikka pyrkii pitämään ajoneuvon nopeuden tasaisena ohjaamalla polttoaineen syöttöä moottorille. Kuljettajan painaessa jarrua tai kytkintä vakionopeudensäädin kytkeytyy pois päältä. Kiihdyttäminen ja hidastaminen on yleensä mahdollista omilla painikkeillaan.\\nUudemmissa autoissa on yleistynyt täysin digitaalisesti ohjattava vakionopeudensäädin, johon on yhdistetty myös nopeudenrajoitin. Tällöin vakionopeudensäädintilassa kuljettaja valitsee +- ja −-näppäimillä halutun ajonopeuden. Nopeudenrajoitintilassa kuljettaja valitsee suurimman nopeuden, jota hän ei vahingossa halua ylittää. Tarvittaessa painamalla kaasun pohjaan tai painamalla ”0”-näppäintä rajoittimen saa pois päältä. Muuten nopeudenrajoitin pysyy aktiivisena koko ajan, myös jarrutettaessa ja vaihdettaessa vaihdetta. Kiihdyttäminen ja hidastaminen on mahdollista +- ja −-näppäimillä nopeudenrajoitintilassa samalla tavalla kuin nopeudensäädintilassa."},{"page_url":"https://pl.wikipedia.org/wiki/Dolina_Starole%C5%9Bna","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/20/Dlh%C3%A9_pleso%2C_poh%C4%BEad_zo_Zbojn%C3%ADckej_chaty.JPG","page_title":"Dolina Staroleśna","context_page_description":"Dolina Staroleśna – jedna z największych dolin tatrzańskich położonych na terenie Słowacji w Tatrach Wysokich. Otwarta w kierunku południowo-wschodnim łączy się z Doliną Małej Zimnej Wody, tworząc Dolinę Zimnej Wody. System Doliny Zimnej Wody i jej dwóch gałęzi tworzy dolinę walną."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AD%E3%82%B8%E3%83%A3%E3%83%BC%E3%82%BA%E3%83%BB%E3%83%AC%E3%83%B3%E3%82%B8%E3%83%A3%E3%83%BC%E3%82%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Old_robertrogers.jpg","page_title":"ロジャーズ・レンジャーズ","context_page_description":"ロジャーズ・レンジャーズは、フレンチ・インディアン戦争中の、イギリス軍直属のアメリカ植民地民兵による独立部隊である。この軍の訓練は、非公式に少佐のロバート・ロジャーズにゆだねられ、運動能力に優れた軽歩兵隊として、偵察と、距離のある相手を標的にした。ロジャーズ・レンジャーズの戦術は大胆かつ効果的なもので、1750年代の終わりには、イギリス本国軍の主たる偵察用部隊となった。敵の諜報収集に重用され、後に、この部隊の何人かの兵はアメリカ独立戦争に大きな影響を与える指導者となった。有名な隊員の中には、レキシントン・コンコードの戦いでパトリオットの民兵として参戦した者もいる。"},{"page_url":"https://ast.wikipedia.org/wiki/Real_Xard%C3%ADn_Bot%C3%A1nicu_de_Madrid","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/RealJardinBotanico_Madrid.svg","page_title":"Real Xardín Botánicu de Madrid","context_page_description":"El Real Xardín Botánicu de Madrid ye un centru d'investigación del Conseyu Cimeru d'Investigaciones Científiques. Fundáu por Real Orde de 17 d'ochobre de 1755 pol rei Fernandu VI nel Sotu de Migues Calientes, cerca del ríu Manzanares, Carlos III ordenó'l treslláu a la so situación actual en 1781, al Paséu del Prado, xuntu al Muséu de Ciencies Naturales que se taba construyendo, en Madrid, España. Esti xardín botánicu alluga en tres terraces gradiaes, plantes d'América y del Pacíficu, amás de plantes europees."},{"page_url":"https://ca.wikipedia.org/wiki/Morten_Lauridsen","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Morten_Lauridsen_George_W_Bush.jpg","page_title":"Morten Lauridsen","context_page_description":"Morten Johannes Lauridsen és un compositor nord-americà d'ascendència danesa. Va rebre el 2007 la National Medal of Arts. Fou compositor resident de Los Angeles Master Chorale i professor de composició a la Thornton School of Music de la Universitat de Carolina del Sud durant més de 40 anys."},{"page_url":"https://eu.wikipedia.org/wiki/Anglo-Vasco-Navarro_trenbidea","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Anglo-Vasco-Navarro_trenaren_Anto%C3%B1anako_geltokia.jpg","page_title":"Anglo-Vasco-Navarro trenbidea","context_page_description":"Anglo-Vasco-Navarro trenbidea —laburturik, Vasco-Navarro trenbidea, Anglo-Vasco trenbidea eta Angloa izenez ere ezaguna— Bergara eta Lizarra, Gasteiztik zehar lotzen zituen trenbide estuko burdinbidea zen, The Anglo-Vasco-Navarro Railway Company Limited konpainiak 1887. urtean eraikitzen hasia. 143 km-ko luzera zuen, eta Debagoiena Gipuzkoan, Lautada eta Mendialdea Araban eta Estellerria Nafarroan gurutzatzen zituen. 1889tik 1967ko abenduaren 31 arte jardun zuen. Bere osoan, ordea, 1927tik izan zen indarrean, orduan ireki baitzen Gasteiz eta Lizarra arteko ibiltartea."},{"page_url":"https://en.wikipedia.org/wiki/7th_Street/Metro_Center_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/7th-Metro_Center_platform_2016.jpg","page_title":"7th Street/Metro Center station","context_page_description":"7th Street/Metro Center is a subway station in the Los Angeles Metro Rail system. It is located in the Financial District of Downtown Los Angeles at the intersection of 7th Street and Flower Street.\\nThe station is served by the light rail A Line and E Line, heavy rail B Line and D Line, and by the bus rapid transit J Line. The A Line and E Line currently have their downtown terminus at this station. Many bus routes also serve the station.\\nThis is one of only two stations in the entire system that has underground side platforms, the other being the Wilshire/Vermont station."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%9D%B1%E4%BA%AC%E8%87%A8%E6%B5%B7%E5%89%AF%E9%83%BD%E5%BF%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Telecom_Center.jpg","page_title":"東京臨海副都心","context_page_description":"東京臨海副都心は、東京都が策定した7番目の副都心であり、複数の特別区に跨がる442ヘクタールのエリアである。\\n東京港埋立地10号地に属する江東区有明と、同埋立地13号地に属する港区台場・江東区青海・品川区東八潮からなる。全域が埋立地であり、東京都都市整備局と東京都港湾局が主に計画管理している。\\n公式愛称は「レインボータウン」であるが、かつて都知事だった石原慎太郎が臨海副都心全体を指して「お台場」と呼んだことから、マスコミや官公庁がそれにならうことがある。都市景観100選受賞地区。"},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%A6%E0%A6%BF%E0%A6%B2%E0%A7%8D%E0%A6%B2%E0%A7%80-%E0%A6%B2%E0%A6%BE%E0%A6%B9%E0%A7%8B%E0%A6%B0_%E0%A6%B7%E0%A6%A1%E0%A6%BC%E0%A6%AF%E0%A6%A8%E0%A7%8D%E0%A6%A4%E0%A7%8D%E0%A6%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/An_assassination_attempt_on_Lord_Charles_Hardinge.jpg","page_title":"দিল্লী-লাহোর ষড়যন্ত্র","context_page_description":"দিল্লী ষড়যন্ত্র মামলা যা দিল্লী-লাহোর ষড়যন্ত্র হিসেবে ও পরিচিত, যা ১৯১২ সালে ব্রিটিশ ভারতের রাজধানী কলকাতা থেকে নয়া দিল্লীতে স্থানান্তর করার অনুষ্ঠানে ভারতের ভাইসরয় লর্ড হার্ডিঞ্জকে হত্যা করার ষড়যন্ত্র করা হয়েছিল।"},{"page_url":"https://tt.wikipedia.org/wiki/Xan_%C5%9E%C3%A4yh%C3%BCn_%C5%9F%C3%A4h%C3%A4ren%C3%A4_ximik_h%C3%B6c%C3%BCm","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/USS_Ross_2017_Shayrat_strike_170407-N-FQ994-031.jpg","page_title":"Xan Şäyhün şähärenä ximik höcüm","context_page_description":"Xan Şäyhün şähärenä ximik höcüm - 2017 yılnıñ 4 aprelendä Süriäneñ İdlib wiläyäte Xan Şäyhün şähärendä ximik ağulı mätdälär belän küp keşelärne ütereş. Ağulı gaz 89 keşen ütergän, 556 keşe yaralanğan.\\nAQŞ qaraşı buyınça älege ximik höcümne Bäşär Äsäd citäklägän xökümät oyıştırğan, bu qaraşqa tayanıp, 2017 yılnıñ 7 aprelendä BMO röxsäten almıyça, AQŞ xärbi-diñgez köçläre Süriäneñ Äş Şäyrät hawa alanına tomahawk raketaları belän höcüm itte."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A1%E3%83%B3%E3%83%95%E3%82%AF%E3%83%AD%E3%82%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Owlets.jpg","page_title":"メンフクロウ","context_page_description":"メンフクロウ は、フクロウ目メンフクロウ科に分類される鳥類の一種。"},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%A1%D6%80%D5%BF%D5%AB%D5%B6_%D5%8A%D5%A1%D5%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/50/%27Martin_Paz%27_by_Jules_F%C3%A9rat_11.jpg","page_title":"Մարտին Պաս","context_page_description":"Մարտին Պաս, ֆրանսիացի գրող Ժյուլ Վեռնի արկածային վեպը, որը մտնում է «Անսովոր ճանապարհորդություններ» շարքի մեջ։ Վեպը գրվել է 1851 թվականին։ Առաջին հրատարակությունը կայացել է « Musee Des Familles» հրատարակությունում 1852 թվականի հուլիսի 10-ից մինչև օգոստոսի 11-ը՝ «Հարավային Ամերիկա։ Պերուի ավանդույթները։ Մարտին Պաս, պատմական վեպ» անվանումով։ Վեպի նկարազարդումները կատարվել են Ժյուլ Եվֆրատ Դեկարտի կողմից։ Այնուհետև այն հրատարակվել է Պիեռ Ժյուլ Էտցելի կողմից 1875 թվականի փետրվարի 1-ին Փարիզում՝ որպես «Կանցլեր» վեպի ներդիր։"},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%92%D7%95%D7%93%D7%AA_%D7%94%D7%90%D7%A8%D7%A5_%D7%94%D7%A9%D7%98%D7%95%D7%97%D7%94","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/66/Flat_Earth.png","page_title":"אגודת הארץ השטוחה","context_page_description":"אגודת הארץ השטוחה היא אגודה אשר מטרתה לקדם את האמונה כי כדור הארץ שטוח ולא כדורי, זאת בניגוד לאמת האמפירית. האגודה המודרנית נוסדה בשנת 1956 על ידי האנגלי סמואל שנטון. מקום מושבה הוא בלנקסטר שבקליפורניה. נשיאה הנוכחי הוא דניאל שנטון."},{"page_url":"https://vi.wikipedia.org/wiki/Nai_s%E1%BB%ABng_x%C3%A1m","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Rocky_Mountain_Bull_Elk.jpg","page_title":"Nai sừng xám","context_page_description":"Nai sừng xám hay còn gọi là Nai sừng xám Bắc Mỹ là một trong những loài lớn nhất thuộc họ Hươu nai trên thế giới và là một trong những lớp thú lớn nhất ở Bắc Mỹ và Đông Á. Loài này được tin rằng thuộc phân loài của hươu đỏ châu Âu, nhưng các bằng chứng từ một nghiên cứu năm 2004 cho thấy ti thể DNA của loài này khác hẳn hươu đỏ châu Âu. Ngoài nai sừng tấm, thành viên khác duy nhất của họ Hươu có thể cạnh tranh với nai sừng tấm về mặt kích thước là loài nai Nam Á. Khu vực sinh sống của hươu Bắc Mỹ là ở trong rừng và môi trường sống ở bìa rừng. Chúng ăn cỏ, cây bụi, lá cây và vỏ cây. Thiên địch của loài nai này chính là sói xám."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%8A%D0%B0%D1%81%D0%B2%D0%B8%D0%B6","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ce/Nesvizh_Slucka_Brama.JPG","page_title":"Њасвиж","context_page_description":"Њасвиж или Њесвиж је град у централном делу Републике Белорусије и део је Минске области. Административни је центар Њасвишког рејона.\\nПрема процени из 2012. у граду је живело 14.434 становника.\\nГрад је познат по бројним културно-историјским споменицима од којих су свакако најзначајнији Њасвишки замак која се налази на Унесковој листи светске баштине, градска већница и језуитска жупна црква из XVI века."},{"page_url":"https://et.wikipedia.org/wiki/Taani_rahvuspargid","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Tved_Klitplantage.JPG","page_title":"Taani rahvuspargid","context_page_description":"Taanis on 3 rahvusparki kogupindalaga 1890 km². Lisaks nendele asub üks, kuid see-eest maailma suurim rahvuspark Taani autonoomsel alal Gröönimaal.\\nTaani rahvuspargiprogramm on veel suhteliselt noor, esimene rahvuspark moodustati 2008. aastal. Taani rahvusparkide iseärasuseks on lai demokraatlik osalusprotsess ja teiste riikidega võrreldes vabamad reeglid majandustegevuse osas. Gröönimaal on rahvuspark olemas juba 1974. aastast."},{"page_url":"https://fr.wikipedia.org/wiki/Osmanville","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Monument_aux_morts_d%27Osmanville.jpg","page_title":"Osmanville","context_page_description":"Osmanville est une commune française, située dans le département du Calvados en région Normandie, peuplée de 533 habitants."},{"page_url":"https://fr.wikipedia.org/wiki/Calmar","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Brachioteuthis_riisei.jpg","page_title":"Calmar","context_page_description":"Les calmars, aussi appelés calamars, ou teuthides constituent un groupe morphologique, apparu au début du Jurassique, de céphalopodes décapodes marins regroupant près de 300 espèces. La plupart des espèces n'ont pas de nom vernaculaire spécifique et sont donc désignées en français sous le nom générique de « calmar ». Il en est de même pour le terme encornet, autre nom vernaculaire plus particulièrement utilisé lorsque ces animaux sont considérés en tant que comestibles ou appâts de pêche. L'ordre des Teuthida, qui regroupait tous les calmars, est désormais considéré comme obsolète parce que paraphylétique. Il est maintenant séparé en Myopsida et Oegopsida.\\nCe sont des espèces pélagiques vivant parfois de façon isolée mais plus souvent en banc. Comme les autres céphalopodes, les calmars ont une tête distincte, une symétrie bilatérale, un manteau, une couronne péribuccale de bras musclés et protractiles munis de ventouses et/ou de crochets. Leur taille varie de quelques centimètres à une dizaine de mètres."},{"page_url":"https://nl.wikipedia.org/wiki/GLOW_Festival","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/11/Glow2007_Catharinakerk.jpg","page_title":"GLOW Festival","context_page_description":"GLOW Eindhoven is een gratis lichtkunstfestival waarop kunstenaars en ontwerpers uit binnen- en buitenland lichtkunst- en designtoepassingen tonen die tot stand zijn gekomen door het gebruik van nieuwe mediatechnologieën, zoals computers, sensoren, animaties, maar ook bekendere projectietechnieken. In november 2006 werd het voor het eerst gehouden. In 2010 vond het festival plaats van 6 tot en met 13 november. Spectaculair was de verlichting van de Demer, waar het Italiaanse bedrijf Luminarie De Cagna een kathedraal van licht had aangelegd.\\nHet festival is een openluchttentoonstelling waarbij kenmerkende gebouwen en locaties met kunstlicht worden belicht. Tijdens het eerste festival waren in de stad en op de oevers van de Dommel kunstwerken te zien.\\nDoor de productie van lucifers en later de gloeilamp door Philips in Eindhoven heeft de stad altijd al iets met licht gehad. Eindhoven staat daarom ook wel bekend als lichtstad. Tegenwoordig is het de led-verlichting die in toenemende mate de aandacht trekt."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%BD%D0%B0%D0%BA%D0%B8_%D0%BF%D0%BE%D1%87%D1%82%D0%BE%D0%B2%D0%BE%D0%B9_%D0%BE%D0%BF%D0%BB%D0%B0%D1%82%D1%8B_%D0%A1%D0%A1%D0%A1%D0%A0_(1991)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Stamp_Soviet_Union_1991_CPA180KcOM.jpg","page_title":"Знаки почтовой оплаты СССР (1991)","context_page_description":"Зна́ки почто́вой опла́ты СССР (1991) — перечень знаков почтовой оплаты, введённых в обращение дирекцией по изданию и экспедированию знаков почтовой оплаты Министерства связи СССР в 1991 году.\\nС 4 января по 12 декабря 1991 года было выпущено 87 почтовых марок, в том числе 80 памятных, три стандартные двенадцатого выпуска и четыре стандартные тринадцатого выпуска. Тематика коммеморативных марок охватывала юбилеи государственных деятелей, выдающихся деятелей науки и культуры, представителей фауны и флоры страны, знаменательные даты и другие события. В обращение были введены марки номиналом от 0,05 до 1,00 рубля. Последние четыре коммеморативные марки СССР выпущены 12 декабря 1991 года и были представлены серией миниатюр, объединённой единой темой «Отечественные историки»: В. Н. Татищев, Н. М. Карамзин, С. М. Соловьёв и В. О. Ключевский. Поступило в обращение 14 видов односторонних почтовых карточек с оригинальной маркой и 14 конвертов с оригинальной маркой. Знаки почтовой оплаты печатались на предприятиях Гознака Министерства финансов СССР."},{"page_url":"https://eo.wikipedia.org/wiki/Armena_kuirarto","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Armenian_Cheese.JPG","page_title":"Armena kuirarto","context_page_description":"La armena kuirarto baziĝas sur la pladoj kaj kuirarta tradicio de la armena popolo, inkluzive de la armena diasporo. La historio de Armenio rakontas ke post la detruado de la Seleŭka imperio naskiĝis la unua armena sendependa ŝtato, fondita en 190 a.K de la Artaksia Dinastio kaj poste en la 20-a jarcento membro de Sovetio, lasta okazaĵo kiu markis kelkajn kuirartajn tradiciojn en tiu ĉi lando kaj fiksis ŝanĝon en la tradicioj de multaj jarcentoj. La armena kuirarto estas en la mezo de la mediteranea kuirarto kaj la kaŭkaza, do, ĝi estas aro da ellaboraĵoj de nomada loĝantaro kiu loĝas en malvarma regiono. Kun granda influo de la mezorienta kuirarto, rusa kaj balkana.\\nArmena kuirarto inkluzivas manĝaĵojn kaj kuirajn teknikojn de la armena popolo kaj tradiciaj armenaj manĝaĵoj kaj pladoj. La kuirarto reflektas la historion kaj geografion, kie armenoj vivis, kaj ankaŭ kundividas eksterajn influojn de eŭropaj kaj orientaj kuirartoj. La kuirarto ankaŭ reflektas la tradiciajn kulturojn kaj bestojn breditajn en armenaj loĝataj areoj.\\nLa preparado de pladoj el viando, fiŝaĵoj kaj legomoj en armena kuirarto ofte inkluzivas farĉaĵojn, ŝaŭmadon kaj purigadon."},{"page_url":"https://fr.wikipedia.org/wiki/L%C3%BCftlmalerei","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Oberammergau_Buildings_%287%29.JPG","page_title":"Lüftlmalerei","context_page_description":"Le Lüftlmalerei désigne en Haute-Bavière, surtout dans la région de Werdenfelser Land située autour de Garmisch-Partenkirchen ainsi qu’au Tyrol, une expression artistique de peintures sur les murs extérieurs des maisons.\\nCes peintures sont réalisées selon la technique de la fresque sur le crépi calcaire frais de sorte que les couleurs peuvent pénétrer profondément dans le mortier encore humide leur permettant de durer plus longtemps.\\nL'origine du terme est contesté, mais il s'agit probablement du nom de la maison natale du peintre Franz Seraph Zwinck à Oberammergau, Zum Lüftl.\\nLe Lüftlmalerei est une variante populaire du trompe-l'œil."},{"page_url":"https://no.wikipedia.org/wiki/Kjell_Arne_Totland","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Kjell_Arne_Totland.jpg","page_title":"Kjell Arne Totland","context_page_description":"Kjell Arne Totland var en norsk hoffreporter og kongehusekspert. Han var ofte benyttet som kommentator og ekspert på kongesaker både i norske og utenlandske medier. Totland hadde eksklusiv kontrakt med TV 2 som kanalens egen kongehusekspert og kommenterte jevnlig aktuelle kongesaker på alle kanalens plattformer og programflater. Totland hadde også blogg på tv2.no."},{"page_url":"https://fr.wikipedia.org/wiki/Oblast_de_Primori%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Coat_of_Arms_of_Primorye_oblast_%28Russian_empire%29.png","page_title":"Oblast de Primorié","context_page_description":"L’oblast de Primorié est un oblast de l'Empire russe créé en 1856 en Extrême-Orient avec pour capitale Nikolaïevsk-sur-l'Amour, Khabarovsk puis Vladivostok."},{"page_url":"https://sv.wikipedia.org/wiki/L%27Hospitalet","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Map_commune_FR_insee_code_04095.png","page_title":"L'Hospitalet","context_page_description":"L'Hospitalet är en kommun i departementet Alpes-de-Haute-Provence i regionen Provence-Alpes-Côte d'Azur i sydöstra Frankrike. Kommunen ligger i kantonen Banon som ligger i arrondissementet Forcalquier. År 2009 hade L'Hospitalet 89 invånare."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Mitglieder_der_Deutschen_Akademie_der_Naturforscher_Leopoldina/1890","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Hermann_Eichhorst.jpg","page_title":"Liste der Mitglieder der Deutschen Akademie der Naturforscher Leopoldina/1890","context_page_description":"Die Liste der Mitglieder der Deutschen Akademie der Naturforscher Leopoldina für 1890 enthält alle Personen, die im Jahr 1890 zum Mitglied ernannt wurden. Insgesamt gab es 39 neu gewählte Mitglieder."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%BF%D0%B5%D1%80%D0%B0_%D0%BA%D0%BE%D0%BC%D0%B8%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Andre_Gretry_-_statue_in_Liege.jpg","page_title":"Опера комик","context_page_description":"Опера́ коми́к — жанр французского музыкального театра XVIII—XIX веков, основанный на сочетании музыкальных номеров и разговорных диалогов. Сложился в своей классической форме и долгое время практиковался в одноимённом парижском театре. В XIX веке развивался в направлении драмы и оперетты.\\nФранцузская комическая опера середины XVIII века отразила пресыщение третьего сословия классицизированными героико-мифологическими операми Люлли и Рамо, которые традиционно ставились при версальском дворе в соответствии со вкусами придворной аристократии. Изгнанный из сферы «высокого искусства» заряд сатиры и комедии впитали в себя представления ярмарочных театров Парижа и театра итальянской комедии.\\nВ 1752 году гастроли в Париже итальянской труппы, представившей публике, среди прочего, оперу-буффа Дж. Б. Перголези «Служанка-госпожа», породили войну памфлетов между сторонниками старого и нового искусства. Итальянских комедиантов поддержали такие крупные фигуры Просвещения, как Д. Дидро, М. Гримм, Ж. Ж. Руссо. Последний в пылу полемики даже написал пастораль из жизни заурядных современников под названием «Деревенский колдун»."},{"page_url":"https://nl.wikipedia.org/wiki/Klooster_van_de_heilige_koninklijke_lijdendulders","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/10/Ganina_Jama_2.jpg","page_title":"Klooster van de heilige koninklijke lijdendulders","context_page_description":"Het Klooster van de heilige koninklijke lijdendulders of kortweg het Ganina Jama-klooster is een Russisch-orthodox klooster, dat werd gebouwd op de plek waar de vermoorde tsaar Nicolaas II en zijn familie werden gedumpt in een oude mijnschacht genaamd Ganina Jama in de bossen ten zuiden van het dorpje Koptjaki, zo'n 15 kilometer ten noordwesten van Jekaterinenburg."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D1%96%D0%BB%D1%8C%D0%B3%D0%B5%D0%BB%D1%8C%D0%BC_%D0%91%D1%83%D1%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Max_und_Moritz.JPG","page_title":"Вільгельм Буш","context_page_description":"Га́йнріх Крістіан Вільгельм Буш був одним з найбільш впливових та визначних поетів-гумористів та художників-карикатуристів Німеччини.\\nВже в останні роки свого життя Вільгельма Буша було визнано «класиком німецького гумору», який своїми сатиричними ілюстрованими історіями досяг великої популярності в народі. Сьогодні вважається одним з піонерів коміксів. До його найвідоміших творів належать «Ілюстрювані історії про Макса і Моріца», «Благочестива Хелена», «Пліш та Плюм», «Невдаха Ганс Гукебайн», та трилогія «Кноппи», яка складається з трьох частин — «Пригоди незаміжньої дівчини», «Пан та Пані Кнопп» та «Юльхен»."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Neustadt-Neusch%C3%B6nefeld","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Lilienstra%C3%9Fe_Leipzig_2016_024.jpg","page_title":"Liste der Kulturdenkmale in Neustadt-Neuschönefeld","context_page_description":"Die Liste der Kulturdenkmale in Neustadt-Neuschönefeld enthält die Kulturdenkmale des Leipziger Ortsteils Neustadt-Neuschönefeld, die in der Denkmalliste vom Landesamt für Denkmalpflege Sachsen mit Stand 2017 erfasst wurden."},{"page_url":"https://en.wikipedia.org/wiki/History_of_Austria","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/MariaTheresiaFranzStephan.jpg","page_title":"History of Austria","context_page_description":"The history of Austria covers the history of Austria and its predecessor states, from the early Stone Age to the present state. The name Ostarrîchi has been in use since 996 AD when it was a margravate of the Duchy of Bavaria and from 1156 an independent duchy of the Holy Roman Empire of the German Nation.\\nAustria was dominated by the House of Habsburg and House of Habsburg-Lorraine from 1273 to 1918. In 1808, when Emperor Francis II of Austria dissolved the Holy Roman Empire, Austria became the Austrian Empire, and was also part of the German Confederation until the Austro-Prussian War of 1866. In 1867, Austria formed a dual monarchy with Hungary: the Austro-Hungarian Empire. When this empire collapsed after the end of World War I in 1918, Austria was reduced to the main, mostly German-speaking areas of the empire, and adopted the name The Republic of German-Austria. However, union with Germany and the chosen country name were forbidden by the Allies at the Treaty of Versailles. This led to the creation of the First Austrian Republic.\\nFollowing the First Republic, Austrofascism tried to keep Austria independent from the German Reich."},{"page_url":"https://fr.wikipedia.org/wiki/Landivisiau","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/291_Landivisiau.jpg","page_title":"Landivisiau","context_page_description":"Landivisiau [lɑ̃divizjo] est une commune du département du Finistère, dans la région Bretagne, en France.\\nSituée dans le nord du département, la ville est la capitale historique du cheval breton."},{"page_url":"https://fr.wikipedia.org/wiki/Connectique","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/French-power-socket.jpg","page_title":"Connectique","context_page_description":"La connectique désigne l’ensemble des procédés et techniques qui permettent d'établir une connexion fiable entre des systèmes électriques ou électroniques distincts. Elle est à la fois utile à la transmission de l'énergie et à celle des données.\\nReprésentée par des connecteurs, ensembles parfois appelés fiches et prises, la connectique est omniprésente dans notre vie. La connectique permet par exemple de relier nos appareils ménagers au réseau électrique ou de faire communiquer les divers éléments de nos systèmes informatiques, audio ou vidéo.\\nLe défi des manufacturiers de connectique est de maximiser la standardisation des connexions afin d'en faciliter l'usage mais celle-ci ne doit pas se faire au détriment de la puissance ou de la fonctionnalité des appareils. Il est aussi important de limiter le risque d'erreurs de branchements pouvant mener à des courts-circuits en y intégrant des systèmes de détrompage.\\nLes connecteurs se trouvent typiquement placés en embout des câbles ou bien directement sur des cartes électroniques."},{"page_url":"https://simple.wikipedia.org/wiki/United_States_Cabinet","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Robert_E._Lighthizer_official_portrait.jpg","page_title":"United States Cabinet","context_page_description":"The United States Cabinet is composed of the most senior appointed officers of the executive branch of the federal government of the United States, and its existence dates back to the first American President, who appointed a Cabinet of four people to advise and assist him in his duties.\\nCabinet officers are nominated by the President and then presented to the United States Senate for confirmation or rejection by a simple majority. If approved, they are sworn in and begin their duties. Aside from the Attorney General, and previously, the Postmaster General, they all receive the title Secretary."},{"page_url":"https://en.wikipedia.org/wiki/Acacia_kempeana","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Acacia_kempeana_shrub.jpg","page_title":"Acacia kempeana","context_page_description":"Acacia kempeana, commonly known as wanderrie wattle, witchetty bush or granite wattle, is a shrub in subfamily Mimosoideae of family Fabaceae that is endemic to arid parts of central and western Australia."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%A1%D0%BE%D0%BC%D1%8E%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Panorama_of_Saumur.JPG","page_title":"Сомюр","context_page_description":"Сомюр — Францин гӀала-коммуна, лаьтта Луаран латтанаш регионехь. Коммунан департамент — Мен а, Луара а. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://ca.wikipedia.org/wiki/Funmilayo_Ransome-Kuti","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/70_year_old_Funmilayo_Ransome-Kuti_on_her_birthday.png","page_title":"Funmilayo Ransome-Kuti","context_page_description":"Funmilayo Ransome-Kuti va ser una destacada activista feminista i va lluitar pel dret de vot de les dones en el marc de les lluites per la independència. També va ser una de les líders que va emprendre moltes batalles contra el govern colonial i les seves imposicions de contribucions opressives per a les dones. Una de les conseqüències d'aquestes batalles va culminar amb l'abdicació del rei d'Abeokuta, el 1948.\\nBesnéta d'una dona raptada com a esclava, va estudiar a Anglaterra i, quan va tornar-ne, va treballar com a mestra de primària, fent un èmfasi especial en el dret a l'educació de les nenes. A casa seva, va educar els seus fills i filles en la igualtat; ensenyava les tasques domèstiques tant a les nenes com als nens, i aquests van aprendre a cuinar i netejar la casa. A la dècada del 1950, va fundar la Unió de Dones Nigerianes. L'any 1974, un dels seus fills va convertir l'antiga casa familiar en el centre musical i artístic més representatiu del moviment contestatari nigerià, i li va donar el nom de \\"República de Kalakuta\\".\\nEl 18 de febrer del 1977, l'exèrcit nigerià va irrompre a casa seva de manera violenta; acusà la família de ser un focus de subversió."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9E%D0%B2%D0%BE%D1%88%D1%82%D0%B0%D1%80%D0%BD%D0%B8%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/%D0%9B%D0%B5%D1%81%D0%BA%D0%BE%D0%B2%D0%B8_%D0%BD%D0%B0%D1%81%D0%B0%D0%B4%D0%B8_%28%D0%A1%D0%B8%D1%80%D0%BA%D0%BE%D0%B2%D0%BE%29_01.jpg","page_title":"Овоштарник","context_page_description":"Овоштарник — место засадено со овошни дрва, односно тоа е замјоделска површина каде постои намерно садење дрвја или грмушки, кои се одгледуваат за производство на храна. Овоштарниците содржат дрвја за производство на овошје или јаткасти плодови, кои генерално се одгледуваат за комерцијално производство. Овоштарниците понекогаш се појавуваат и во големите градини, каде што служат естетска, покрај производствената цел. Овошната градина обично е синоним за овоштарник, иако е поставена на помало некомерцијално ниво и може да има поголема застапеност на грмушки на бобинки во однос на овошните дрвја. Овоштарниците во умерените климатски зони се уредени во дрворедна мрежа, со косена трева или со гола обработена почва што го олеснува собирањето зрелите плодови на овошјето. Обработката на овоштарниците подразбира орање, кастрење, заштита на дрвјата од инсекти и болести, берба, а посебен метод за размножување и модифицирање на овошните дрва во овоштарството е калемењето."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D1%83%D0%B4%D0%BE%D0%B6%D0%B5%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D0%BC%D1%83%D0%B7%D0%B5%D0%B9_%D0%A2%D1%80%D0%BE%D0%BD%D1%85%D0%B5%D0%B9%D0%BC%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Trondheim_Kunstmuseum_1.jpg","page_title":"Художественный музей Тронхейма","context_page_description":"Художественный музей Тронхейма — государственная художественная галерея в норвежском городе Тронхейм, основанная в 1864 году как «Det faste galleri»; современный музей был организован в 1997 году, разместившись в здании, построенном в 1930; управляет третьей по величине публичной художественной коллекцией в стране, специализирующейся на норвежском искусстве — начиная с середины XIX века и до сегодняшнего дня; представляет временные выставки международного и регионального искусства — как классического модернизма, так и современного искусства."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%86%D8%A7%D8%B1%DB%8C%D9%86%D8%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Citrus_aurantium.jpg","page_title":"نارینج","context_page_description":"نارینج بیر نؤع بیتکی."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%AC%D8%A7%D9%86_%D8%A7%D8%B3%DA%A9%D8%A7%D8%AA_(%D8%AA%D9%88%D9%92%D9%BE%D9%84%D9%88%D9%85%E2%80%8C%D8%A8%DB%8C%D9%84%DB%8C%D9%85%D8%AC%DB%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/John_Scott_%28Sociologist%29.jpeg","page_title":"جان اسکات (توْپلوم‌بیلیمجی)","context_page_description":"جان اسکات (توْپلوم‌بیلیمجی) بیلیم اینسان. ۸ آوریل ۱۹۴۹ تاریخینده دۆنیایا گؤز آچیب. جان اسکات (توْپلوم‌بیلیمجی) استرثکلاید بیلیم‌یوردو و کینقستون بیلیم‌یوردودا درس اوْخویوب. چالیشدیغی یئرلریندن بیری اسکس بیلیم‌یوردو, اکستر بیلیم‌یوردو, کوپنهاق بیلیم‌یوردو, ‌دیر."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%95%B7%E6%B8%85%E5%8C%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Jinan_2009_1471.jpg","page_title":"長清区","context_page_description":"長清区は中華人民共和国山東省済南市に位置する市轄区。黄河の東側、済南市区から22kmの距離に位置する。"},{"page_url":"https://es.wikipedia.org/wiki/Federalismo_europeo","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Sir_Winston_S_Churchill.jpg","page_title":"Federalismo europeo","context_page_description":"El federalismo europeo es un movimiento político y social que aboga por una estrecha coordinación entre los países europeos compartiendo sus soberanías nacionales y persiguiendo la creación de un Estado europeo de modelo federal.​ El federalismo europeo, en su forma moderna, empezó a gestarse a finales del siglo XIX, tomando fuerza hasta los años 1920, y después tuvo un período de decadencia."},{"page_url":"https://de.wikipedia.org/wiki/Solomon_Busendich","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Solomon_bushendich_amsterdam2006.jpg","page_title":"Solomon Busendich","context_page_description":"Solomon Busendich ist ein kenianischer Langstreckenläufer, der sich auf Straßenläufe spezialisiert hat.\\n2001 wurde er afrikanischer Juniorenmeister im 10.000-Meter-Lauf. 2003 stellte er seine Bestzeiten über 3000 m, 5000 m und 10.000 m auf.\\nIm Jahr darauf gab er sein Debüt auf der Halbmarathon-Strecke und wurde beim Berliner Halbmarathon Zweiter in 1:00:42 h. 2005 startete er erstmals bei einem Marathon, erreichte jedoch nicht das Ziel des New-York-City-Marathons. 2006 verbesserte er sich als Dritter des Rotterdam-Halbmarathons auf 1:00:14 h und siegte beim Amsterdam-Marathon in 2:08:52 h mit zwei Sekunden Vorsprung auf Bernard Barmasai. 2007 wurde er wie im Vorjahr Zweiter beim Halbmarathon City–Pier–City Loop und steigerte seine Zeit über diese Distanz auf 1:00:13."},{"page_url":"https://en.wikipedia.org/wiki/Logistic_map","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/LogisticCobwebChaos.gif","page_title":"Logistic map","context_page_description":"The logistic map is a polynomial mapping of degree 2, often cited as an archetypal example of how complex, chaotic behaviour can arise from very simple non-linear dynamical equations. The map was popularized in a 1976 paper by the biologist Robert May, in part as a discrete-time demographic model analogous to the logistic equation first created by Pierre François Verhulst.\\nMathematically, the logistic map is written\\nwhere xₙ is a number between zero and one that represents the ratio of existing population to the maximum possible population. The values of interest for the parameter r are those in the interval [0,4].\\nThis nonlinear difference equation is intended to capture two effects:\\nreproduction where the population will increase at a rate proportional to the current population when the population size is small.\\nstarvation where the growth rate will decrease at a rate proportional to the value obtained by taking the theoretical \\"carrying capacity\\" of the environment less the current population.\\nHowever, as a demographic model the logistic map has the pathological problem that some initial conditions and parameter values lead to negative population sizes."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BB%D1%83%D0%B1%D0%BD%D1%8B%D0%B9_%D1%87%D0%B5%D0%BC%D0%BF%D0%B8%D0%BE%D0%BD%D0%B0%D1%82_%D0%BC%D0%B8%D1%80%D0%B0_%D0%BF%D0%BE_%D1%84%D1%83%D1%82%D0%B1%D0%BE%D0%BB%D1%83_2017","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Abu_Dhabi_Zayed_Sports_City_Stadium_2.jpg","page_title":"Клубный чемпионат мира по футболу 2017","context_page_description":"Клубный чемпионат мира по футболу 2017 — футбольный турнир, который проходил с 6 по 16 декабря 2017 года в ОАЭ. Он стал 14-м розыгрышем Клубного чемпионата мира по футболу, турниром, организуемым ФИФА между победителями клубных турниров каждой из 6 конфедераций."},{"page_url":"https://de.wikipedia.org/wiki/Zempin","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Zempin-Promenadenplatz-130421-029.JPG","page_title":"Zempin","context_page_description":"Seebad Zempin ist eine Gemeinde auf der Insel Usedom direkt am Ufer der Ostsee und des Achterwassers gelegen. Die Gemeinde wird vom Amt Usedom-Süd mit Sitz in der Stadt Usedom verwaltet. Bis 2005 war die Gemeinde Teil des Amtes Usedom-Mitte.\\nDazu hat Zempin auch noch schöne Sehenswürdigkeiten wie eine alte Schule die jetzt ein Museum ist, oder die Promenade."},{"page_url":"https://en.wikipedia.org/wiki/Men%27s_Association_Opposed_to_Woman_Suffrage","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Manifesto.png","page_title":"Men's Association Opposed to Woman Suffrage","context_page_description":"The Men's Association Opposed to Woman Suffrage was an American organization active in the 1910s that was opposed to legal voting by women and open exclusively to men. It was made up of loosely affiliated state and local chapters which typically existed for less than a year, the duration of a campaign against a state referendum proposing women's suffrage.\\nThe Association argued that voting should be restricted to white men of high social class. These arguments relied upon traditional gender roles presenting women as naturally unsuited to leadership.\\nState chapters were well financed and run by prominent men, including wealthy bankers and members of Congress. For example, the Massachusetts chapter was headed by Representative Charles L. Underhill, the New York chapter by lawyer Everett P. Wheeler, and the Nebraska chapter by Senator Joseph Millard, namesake of Millard, Nebraska. Chapters often functioned as men's auxiliaries to women's anti-suffrage organizations, though the relationship with women's organizations was marked by conflict."},{"page_url":"https://lv.wikipedia.org/wiki/Biezlapju_dzimta","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Echeveria_Pumila.JPG","page_title":"Biezlapju dzimta","context_page_description":"Biezlapju dzimta ir augu dzimta akmeņlauzīšu rindā, kurā ietilpst aptuveni 35 ģintis un 1400 sugas. Biezlapju dzimtas augi ir pārsvarā lakstaugi, bet dzimtā ir iekļauti arī koki un ūdensaugi. Šīs dzimtas augus var sastapt gandrīz visur pasaulē, bet pārsvarā tie aug Ziemeļu puslodē un Dienvidāfrikā, pārsvarā sausā un/vai aukstā vidē, kur ūdens ir grūti pieejams.\\nŠajā dzimtā daudzas sugas ir populāras dārzkopībā to neparastā izskata un vieglās audzēšanas dēļ."},{"page_url":"https://en.wikipedia.org/wiki/Tigerland_India_Film_Festival","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/BS_Memento.jpg","page_title":"Tigerland India Film Festival","context_page_description":"Tigerland India Film Festival is an environmental and wildlife film festival based in India. It is organized by a non-profit organization 'Society for Tigerland Conservation' and the aim of the festival is to spread awareness on wildlife conservation through visual media."},{"page_url":"https://it.wikipedia.org/wiki/Pe%C3%B1arrubia_(Abra)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/83/Ph_locator_abra_penarrubia.png","page_title":"Peñarrubia (Abra)","context_page_description":"Peñarrubia è una municipalità di Quinta classe delle Filippine, situata nella Provincia di Abra nella Regione Amministrativa Cordillera.\\nPeñarrubia è formata da 9 baranggay:\\nDumayco\\nLusuac\\nMalamsit\\nNamarabar\\nPatiao\\nPoblacion\\nRiang\\nSanta Rosa\\nTattawa"},{"page_url":"https://it.wikipedia.org/wiki/Melbourne_Rebels","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e1/AAMIPARK.JPG","page_title":"Melbourne Rebels","context_page_description":"I Melbourne Rebels sono un club australiano di rugby a 15; fondato nel 2007 e ammesso al campionato SANZAR del Super Rugby dall'edizione 2011, rappresentano lo Stato del Victoria e, a differenza delle altre quattro squadre australiane già presenti nel torneo, essi non sono una squadra gestita dalle varie propaggini statali della federazione rugbistica australiana, ma un club la cui proprietà è esterna alla Federazione.\\nDisputa le gare interne all'AAMI Park di Melbourne, inaugurato il 7 maggio 2010.\\nLa squadra prende il nome dall'omonimo club che nel 2007 partecipò all'Australian Rugby Championship, competizione nazionale professionistica intermedia tra il campionato provinciale e il Super Rugby, e che nell'unica edizione tenutasi di tale torneo giunse fino alla finale; nonostante lo stesso nome, il club attuale non ha alcun rapporto con quello esistente all'epoca."},{"page_url":"https://es.wikipedia.org/wiki/B%C3%A9nam%C3%A9nil","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3d/Map_commune_FR_insee_code_54061.png","page_title":"Bénaménil","context_page_description":"Bénaménil es una población y comuna francesa, en la región de Lorena, departamento de Meurthe y Mosela, en el distrito de Lunéville y cantón de Lunéville-Sud."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%88%98%E5%BF%A0_(%E4%B8%AD%E5%B0%86)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Liuzhong.jpg","page_title":"刘忠 (中将)","context_page_description":"劉忠，原名劉永燦，中國人民解放軍中將。1955年獲二級八一勳章，一級獨立自由勳章，一級解放勳章，1988年獲一級紅星功勳榮譽章。"},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%91%E1%83%94%E1%83%A0%E1%83%AB%E1%83%9C%E1%83%A3%E1%83%9A-%E1%83%A0%E1%83%9D%E1%83%9B%E1%83%90%E1%83%A3%E1%83%9A%E1%83%98_%E1%83%AD%E1%83%98%E1%83%93%E1%83%90%E1%83%9D%E1%83%91%E1%83%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/DF-SD-06-11222.jpg","page_title":"ბერძნულ-რომაული ჭიდაობა","context_page_description":"ბერძნულ-რომაული ორთაბრძოლა — სპორტული ორთაბრძოლის სახეობა, რომლის ილეთები ეყრდნობა ხელებისა და ბეჭების მოქმედებებს. ამ ჭიდაობის თანამედროვე ფორმით ჩამოყალიბდა საფრანგეთში XIX საუკუნის პირველ ნახევარში.\\n1896 წლიდან შეტანილია ოლიმპიური თამაშების პროგრამაში, 1904 წლიდან მსოფლიოს, ხოლო 1898 წლიდან კი ევროპის ჩემპიონატებში. ჭიდაობის საერთაშორისო ფედერაცია დაარსდა 1912 წელს და მასში 120 ქვეყანაა გაერთიანებული.\\nსაქართველოს ამ სახის ჭიდაობაში მრავალი მსოფლიო და ოლიმპიური ჩემპიონი ჰყავს. ყველაზე ბოლო ოლიმპიურ თამაშებში, პეკინში, მანუჩარ კვირკველიამ მიიღო ოქროს მედალი 74 კგ წონით კატეგორიაში."},{"page_url":"https://fy.wikipedia.org/wiki/Ridderhofst%C3%AAd_Oudaen","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b8/Wapen-Oudaan.jpg","page_title":"Ridderhofstêd Oudaen","context_page_description":"Oudaen wie in ridderhofstêd yn de provinsje Utert yn de gemeente Stichtske Fecht, lizzend oan de Fecht. It is sûnt 2000 yn besit fan de famylje Brenninkmejer."},{"page_url":"https://cy.wikipedia.org/wiki/Hijaz","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Hijaz.png","page_title":"Hijaz","context_page_description":"Rhanbarth yng ngorllewin Arabia yw'r Hijaz neu'r Hejaz. Mae'n ffinio â'r Môr Coch i'r gorllewin, ac yn estyn o Haql ar Wlff Aqaba i Jizan. Mae'n cynnwys dinasoedd Jeddah, Mecca, a Medina, a chadwyn yr Hijaz.\\nGan fod Mecca a Medina yn ddinasoedd pwysicaf Islam, mae'r Hijaz wastad wedi bod yn ardal bwysig i'r grefydd honno. Roedd yn rhan o'r Galiffiaeth ac Ymerodraeth yr Otomaniaid, ac ym 1916 datganodd y Sharif Hussein bin Ali ei hunan yn Frenin Teyrnas Hijaz. Unodd Ibn Saud yr Hijaz a'r Najd gan ffurfio Sawdi Arabia."},{"page_url":"https://cs.wikipedia.org/wiki/Stropn%C3%AD_panc%C3%A9%C5%99ov%C3%A9_prvky_v_%C4%8Deskoslovensk%C3%A9m_opevn%C4%9Bn%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Kr%C3%A1l%C3%ADky%2C_Prost%C5%99edn%C3%AD_Lipka%2C_K-S_12_%28rok_2006%3B_01%29.jpg","page_title":"Stropní pancéřové prvky v československém opevnění","context_page_description":"Stropní pancéřové prvky v československém opevnění jsou ocelolitinové prvky československého opevnění zabudované ve stropech těžkých objektů. Většina z nich byla obsluhována osádkou daného objektu a sloužila pro boj či pozorování, jedinou výjimkou jsou malé ventilační zvony. Podle účelu je lze rozdělit na pěchotní zvony, kopule, dělostřelecké zvony, ventilační zvony a pohyblivé věže."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A7%D7%95%D7%A8%D7%A0%D7%99%D7%AA_(%D7%99%D7%99%D7%A9%D7%95%D7%91)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/KoranitParkGadi.jpg","page_title":"קורנית (יישוב)","context_page_description":"קוֹרָנִית הוא יישוב קהילתי בגליל בתחומי המועצה האזורית משגב."},{"page_url":"https://br.wikipedia.org/wiki/Rannvro_Araucan%C3%ADa","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Araucania_in_Chile_%28equirectangular_projection%29_%28zoom%29.svg","page_title":"Rannvro Araucanía","context_page_description":"Rannvro Araucanía eo an navet eus pemzek rannvro Chile, diwar anv ar bobl amerindian Araokaned. Temuco eo ar gêr-benn."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Burgen_und_Schl%C3%B6ssern_in_Th%C3%BCringen","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Schloss_Brandenstein_II.jpg","page_title":"Liste von Burgen und Schlössern in Thüringen","context_page_description":"Auf dem Gebiet des deutschen Bundeslandes Thüringen befindet sich eine Vielzahl von Burgen und Schlössern. Diese zum Teil auf eine 1000-jährige Geschichte zurückblickenden Bauten waren Schauplatz historischer Ereignisse, Wirkungsstätte bekannter Persönlichkeiten und sind häufig noch heute imposante Gebäude. Nicht aufgeführt sind Zier- und Nachbauten, die nie als Wohngebäude oder zur Verteidigung genutzt wurden."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_beelden_in_Den_Haag-West","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Denhaag_kunstwerk_groep_objecten.jpg","page_title":"Lijst van beelden in Den Haag-West","context_page_description":"Dit is een chronologische lijst van beelden in Den Haag-West. Onder een beeld wordt hier verstaan elk driedimensionaal kunstwerk in de openbare ruimte van de Nederlandse gemeente Den Haag, waarbij beeld wordt gebruikt als verzamelbegrip voor sculpturen, standbeelden, installaties, gedenktekens en overige beeldhouwwerken.\\nIn deze lijst zijn niet de beelden opgenomen van de Beeldengalerij P. Struycken, de beeldenroute in het centrum van Den Haag. Verder wordt jaarlijks door Den Haag Sculptuur een beeldententoonstelling op het Lange Voorhout georganiseerd, ook deze tentoonstelling is niet opgenomen in deze lijst.\\nDen Haag-West bestaat uit de stadsdelen Loosduinen en Segbroek. Het wordt begrensd door de Noordzee in het noorden, de Nieboerweg, Houtrustweg en Waldeck Pyrmontkade in het oosten, de Loosduinse weg en Meppelweg in het zuiden en de stadsgrenzen van Den Haag in het westen.\\nVoor een volledig overzicht van de beschikbare afbeeldingen zie: Beelden in Den Haag-West op Wikimedia Commons."},{"page_url":"https://fa.wikipedia.org/wiki/%DB%B3_%D9%81%D9%88%D8%B1%DB%8C%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Sima_Samar_of_Afghanistan_in_2011.jpg","page_title":"۳ فوریه","context_page_description":"۳ فوریه در تقویم گرگوری، سی و چهارمین روز سال است. ۳۳۱ روز تا پایان سال باقی است."},{"page_url":"https://nl.wikipedia.org/wiki/Chinese_Consolidated_Benevolent_Association","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Officiers_of_the_Six_Companies_b.jpg","page_title":"Chinese Consolidated Benevolent Association","context_page_description":"Chinese Consolidated Benevolent Association is een Chinees-Amerikaanse vereniging die vertegenwoordigd is in verschillende delen van de Verenigde Staten en Canada. Het staat in Seattle ook wel bekend onder de naam Chong Wa Benevolent Association, in Hawaï onder de naam United Chinese Society in Honolulu en de naam Chinese Six Companies verwijst naar de Chinese Consolidated Benevolent Association in San Francisco, Californië."},{"page_url":"https://en.wikipedia.org/wiki/Future_of_the_Royal_Air_Force","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/TaranisModel.JPG","page_title":"Future of the Royal Air Force","context_page_description":"The planning for the future of the Royal Air Force involves supporting ongoing British military operations, the introduction of new aircraft types, greater focus on network enabled capability and increasing interoperability with members of NATO."},{"page_url":"https://nl.wikipedia.org/wiki/Louka_(okres_Hodon%C3%ADn)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Louka_HO_CZ_CoA.jpg","page_title":"Louka (okres Hodonín)","context_page_description":"Louka is een Tsjechische gemeente in de regio Zuid-Moravië, en maakt deel uit van het district Hodonín.\\nLouka telt 1027 inwoners."},{"page_url":"https://nl.wikipedia.org/wiki/Hore_Abdij","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Hoare-Abbey-From-Rock-Of-Cashel-2012.JPG","page_title":"Hore Abdij","context_page_description":"De Hore Abdij is een voormalig cisterciënzersklooster nabij de Rock of Cashel, County Tipperary, Ierland. Het is tegenwoordig een ruïne.\\nDe naam 'Hore' betekent vrij vertaald taxusboom. De eerste orde van de abdij waren de Benedictijnen die er rond 1270 leefde. Daarna verkocht aartsbisschop David MacCearbhaill de abdij Hore aan de cisterciënzersorde in Mellifont, later betrok deze aartsbisschop ook zelf dit klooster. Hij schonk de abdij veel land, molens en andere belangrijke gronden die eerste aan de plaats Cashel behoorde.\\nEen veel verteld verhaal is dat de aartsbisschop een droom zou hebben gehad waarin de benedictijnen terugkwamen om hem te vermoorden, maar dit is onwaarschijnlijk. Vermoedelijk heeft dit verhaal zijn oorsprong in de plaatselijke folkloristische wraakgevoelens van de bewoners van Cashel, omdat de aartsbisschop misbruik maakte van de plaatselijk commercie.\\nIn de 16e eeuw verlieten de cisterciënzers het complex en in 1540 kwam het vervallen gebouw toe aan James Butler, 9e graaf van Ormond. Monniken uit de omgeving gebruikten het klooster nog om hun diensten te houden."},{"page_url":"https://simple.wikipedia.org/wiki/F%C3%BCrth","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Fuerth_Suedstadt_Zirndorf_Bridge_from_Alte_Veste_f_sw.jpg","page_title":"Fürth","context_page_description":"Fürth is a city in the German state Bavaria, next to Nuremberg.\\nIt has about 118,000 inhabitants. The first German railway connection was between Nürnberg and Fürth."},{"page_url":"https://fr.wikipedia.org/wiki/Suleyman_Sani_Akhundov","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Ssakhundov.jpg","page_title":"Suleyman Sani Akhundov","context_page_description":"Suleyman Sani Akhoundov, né le 3 octobre 1875 à Choucha et mort le 29 mars 1939 à Bakou, est un dramaturge et pédagogue azerbaïdjanais. Afin de différencier en littérature son nom à celui de Mirza Fatali Akhundov, il a utilisé le surnom Sani qui signifie deuxième en arabe."},{"page_url":"https://he.wikipedia.org/wiki/%D7%92%D7%90%D7%95%D7%9C%D7%95%D7%92%D7%99%D7%94_%D7%A9%D7%9C_%D7%94%D7%A8%D7%99_%D7%94%D7%99%D7%95%D7%A8%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Chapeau_de_gendarme_wide.JPG","page_title":"גאולוגיה של הרי היורה","context_page_description":"הרי היורה הם רכס הרים המצוי צפונית-מערבית להרי האלפים בשטחן של צרפת ושווייץ. הרכס נוצר לפני כ-35 מיליון שנים בעקבות דחיקה של האלפים לכיוון מערב. היורה הוא רכס מקומט וסלעיו נוצרו במהלך עידן המזוזואיקון, לפני 65–250 מיליון שנים. סחיפה עזה שנגרמה בעקבות המסה של אבן גיר גילתה מחשופים מתקופה זו, ומסבירה את היעדרם של סלעים מהשלישון ומהרביעון, המצויים בעיקר באגנים הגובלים ברכס. הגאולוגיה של הרי היורה מורכבת מאוד בגלל ריבוי השכבות המרכיבות אותם. 95% מסלעי היורה הם אבן גיר וחוואר.\\nהמבנה העמוק של היורה מוכר כתוצאה מקידוחים רבים, וכן ממידע סייסמי שהופק במחצית השנייה של המאה ה-20 ומשמש למחקרי חיפוש נפט ופחם בהרים ובאגן מולאס הסמוך, השוכן בינו לבין הרי האלפים. תוצאות מחקרים אלה סופקו על ידי חברות הנפט לבקשת גאולוגים שווייצריים בשנות ה-90 של המאה ה-20, וסיפקו הסבר לשאלות רבות הנוגעות לקימוט היורה ולגאומטריה של שכבות המשקעים והתשתית הקדומה של הרכס ושל אגן מולאס.\\nרכס היורה היה מוקד למחקר ענף שנערך במאות ה-18 וה-19. חוקר הטבע הגרמני אלכסנדר פון הומבולדט, שחקר את תצורות אבן הגיר העשירות במאובנים, כינה אותן בשנת 1799 \\"גיר היורה\\". כינוי זה היווה בסיס לשמו של תור היורה בעידן המזוזואיקון בו נוצרו אותם סלעים, תור אותו הגדיר המדען הצרפתי אלכסנדר ברוניאר בשנת 1829."},{"page_url":"https://nl.wikipedia.org/wiki/Walter_S%C3%BCskind","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Westerbork_deportation.jpg","page_title":"Walter Süskind","context_page_description":"Walter Süskind was een Joodse Duitser van deels Nederlandse afkomst die als medewerker van de Hollandse Schouwburg ongeveer 600 Joodse kinderen aan de Jodenvervolging heeft helpen ontsnappen."},{"page_url":"https://en.wikipedia.org/wiki/Syringa_villosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Syringa_bretschneideri_136-8292.jpg","page_title":"Syringa villosa","context_page_description":"Syringa villosa, the villous lilac, is a shrub native to Korea, the southern part of the Russian Far East and northern China. There are two subspecies currently recognized; these are regarded as separate species in Flora of China. Combining the ranges for the two taxa yields a range within China of Hebei, Shanxi, Heilongjiang, Jilin, and Liaoning.\\nSyringa villosa is a shrub up to 4 m tall, with red, white, pink or purple flowers."},{"page_url":"https://cs.wikipedia.org/wiki/Jasuhiro_Jama%C5%A1ita","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Yasuhiro_Yamashita_2.jpg","page_title":"Jasuhiro Jamašita","context_page_description":"Jasuhiro Jamašita je bývalý japonský zápasník–judista, všeobecně považovaný za největšího japonského judistu všech dob. Je devítinásobným mistrem Japonska v kategorii bez rozdílu vah, olympijský vítěz a trojnásobný mistr světa v těžké váze."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%97%D0%B0%D0%BF%D0%B8%D1%81_%D0%9C%D0%BB%D0%B0%D0%B4%D0%B5%D0%BD%D0%BE%D0%B2%D0%B8%D1%9B%D0%B0_%D0%BE%D0%B1%D1%80%D0%BE%D0%BA_%D0%92%D0%B8%D1%88%D1%9A%D0%B8%D1%86%D0%B0_(%D0%A2%D0%B5%D0%BC%D1%81%D0%BA%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Zapis-0828-Temska-obrok-Visnjica_20160808_8701.jpg","page_title":"Запис Младеновића оброк Вишњица (Темска)","context_page_description":"Запис Младеновића оброк Вишњица (Темска) се налази на парцели чији је власник Младеновић Будимка."},{"page_url":"https://pl.wikipedia.org/wiki/Izbi%C4%8Dno","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1d/Crkva_Izbi%C4%8Dno_Ivanjdan.jpg","page_title":"Izbično","context_page_description":"Izbično – wieś w Bośni i Hercegowinie, w Federacji Bośni i Hercegowiny, w kantonie zachodniohercegowińskim, w mieście Široki Brijeg. W 2013 roku liczyła 196 mieszkańców, z czego większość stanowili Chorwaci."},{"page_url":"https://it.wikipedia.org/wiki/Cronologia","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e4/Joseph_Justus_Scaliger_-_Imagines_philologorum.jpg","page_title":"Cronologia","context_page_description":"La cronologia, nel suo senso più generale, è un sistema di organizzazione e classificazione degli eventi in base alla loro successione nel tempo, secondo una suddivisione regolare dello stesso. L'Homo sapiens da millenni si serve di cronologie, originariamente non per scopi storiografici, ma giuridici e amministrativi: la conservazione di atti giuridici e documenti amministrativi, con i loro effetti sul presente, ha da sempre implicato il tentativo di collocarli cronologicamente.\\nUna cronologia è detta \\"assoluta\\", quando si basa su una datazione certa legata ad un evento preciso e ben conosciuto, o \\"relativa\\", quando individua relazioni e contemporaneità fra eventi di cui però non è nota esattamente la data in cui sono avvenuti."},{"page_url":"https://lv.wikipedia.org/wiki/Atmi%C5%86u_klade","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Rachel_McAdams_3.jpg","page_title":"Atmiņu klade","context_page_description":"\\"Atmiņu klade\\" ir 2004. gada izdota amerikāņu drāma, kuras režisors ir Niks Kassavetis. Filma tika uzņemta pēc Nikolasa Čārlza Sparksa biogrāfiskā romāna The Notebook. Galvenajās lomās ir kanādiešu aktrise Reičela Makadamsa un kanādiešu aktieris Raiens Goslings Filmas pirmizrāde notika 2004. gadā 20. maijā un jau pirmajā nedēļā kļuva par bestseleri. Filma ir guvusi pozitīvo kritiķu atsauksmes."},{"page_url":"https://de.wikipedia.org/wiki/R%C3%BCsselh%C3%BCndchen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/B%C3%A9rcoun_skvrnit%C3%BD_8927.jpg","page_title":"Rüsselhündchen","context_page_description":"Die Rüsselhündchen sind eine Säugetiergattung aus der Familie der Rüsselspringer. Die fünf Arten der Gattung sind im östlichen und zentralen Afrika beheimatet. Dort bewohnen sie waldreiches Gelände mit geschlossenen Baumkronen und dichtem Laubwerk am Boden. Sie stellen die größten Vertreter der Rüsselspringer dar und haben wie die anderen auch als besonderes Merkmal eine rüsselartig verlängerte Nase. Zudem sind die Vorderbeine gegenüber den langen Hinterbeinen auffallend kürzer, das Merkmal ist aber nicht ganz so deutlich ausgeprägt wie bei den übrigen Rüsselspringern. Die Lebensweise der Rüsselhündchen ist nur teilweise gut untersucht. Sie sind territorial und leben in monogamen Paarbeziehungen, die über das gesamte Leben halten. Die Nahrung besteht aus einer Vielzahl an Wirbellosen und wird am Boden gesucht, manchmal auch ausgegraben. Charakteristisch sind die aus Pflanzenteilen gebauten Nester, die den Tieren als Unterschlupf dienen. Die Fortpflanzung erfolgt ganzjährig, ein Wurf besteht aus einem bis drei Jungtieren. Muttertiere besuchen ihren Nachwuchs nur kurzzeitig am Tag zum Säugen, eine Beteiligung des Vatertiers an der Aufzucht findet nicht statt."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%98%D0%BE%D0%BD_%D0%B4%D0%B8%D2%A3%D0%B3%D0%B5%D2%99%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Ionian_Sea_map.png","page_title":"Ион диңгеҙе","context_page_description":"Ион диңгеҙе — Балҡан менән Апеннин ярымутрауҙары һәм Крит менән Сицилия утрауҙары араһындағы Урта диңгеҙҙең өлөшө. Отранто боғаҙы аша Адриатик диңгеҙ, ә Мессина боғаҙы аша Тиррен диңгеҙе менән тоташа. Көньяҡ Италия, Албания һәм Греция яр буйҙарын йыуа."},{"page_url":"https://cs.wikipedia.org/wiki/Franti%C5%A1ek_Mare%C5%A1_(pedagog)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Franti%C5%A1ek_Mare%C5%A1%2C_pam%C4%9Btn%C3%AD_deska.jpg","page_title":"František Mareš (pedagog)","context_page_description":"František Mareš byl český pedagog.\\nRoku 1880 odmaturoval na německé reálce v Brně. Z důvodů úmrtí otce bylo zapotřebí živit rodinu, proto vstoupil do čtvrtého ročníku učitelského ústavu v Brně, kde složil zkoušky způsobnosti. První učitelské kroky učinil jako podučitel v Drnovicích na blanensku. Ve školním roce 1884/1885 působil jako suplující učitel na ženském učitelském ústavu v Brně. Od roku 1888 působil jako ředitel Pokračovací školy pro dívky, která spadala pod Dívčí vzdělávací jednotu Vesna. Postupem času pokračoval ve svém vzdělávání na německé a následně i české technice, kde složil aprobaci pro střední školy z chemie, matematiky a fyziky. Roku 1919 odešel do penze. Na čas odešel na Slovensko. V roce 1939 se však vrací a opět začíná pracovat pro Vesnu, tentokrát jako školní rada. V roce 1941 zemřel na mrtvici.\\nV rodném Křetíně byla na zámku umístěna v roce 1947 pamětní deska, připomínající místního rodáka."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A6%D1%80%D0%BA%D0%B2%D0%B0_%E2%80%9E%D0%A1%D0%B2._%D0%9F%D0%B5%D1%82%D0%BA%D0%B0_%D0%B8_%D0%A1%D0%B2._%D0%9D%D0%B5%D0%B4%D0%B5%D0%BB%D0%B0%E2%80%9C_-_%D0%A2%D0%B5%D1%82%D0%BE%D0%B2%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Sv._Petka_i_Sv._Nedela_TE_%2814%29.JPG","page_title":"Црква „Св. Петка и Св. Недела“ - Тетово","context_page_description":"„Света Петка и Света Недела“ — црква во стариот дел на Тетово, во населбата Колтук. Црквата се наоѓа во дворот на храмот „Св. Никола“ веднаш до Споменикот на стреланите тетовци од 1944 година. Изградена е со средства на православни верници, пред сè, од стариот дел на Тетово, но и од целиот град. На 26 ноември 2000 година се положил и осветил камен темелник на празникот \\"Свети Јован Златоуст\\". При ископот на темелите биле пронајдени остатоци со димензии 3х2 на постара црква која потекнувала од 14 век. Точниот податок за постоењето и градбата на таа капела се сврзува со изградбата на помала црква посветена на Света Богородица, која се наоѓала преку реката Пена. Црква е посветена на две светици, бидејќи во Тетово немало црква посветена на св. Недела, а стариот храм бил посветен на св. Петка. Поради воените дејства во Тетово во 2001, изградбата била стопирана, но во 2007 година комплетно е завршена и осветена."},{"page_url":"https://pl.wikipedia.org/wiki/Walter_Gropius","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/60/Drawsko_Pomorskie_park_Chopina_willa_%283%29.jpg","page_title":"Walter Gropius","context_page_description":"Walter Adolf Georg Gropius – architekt modernistyczny, jeden z głównych przedstawicieli stylu międzynarodowego, założyciel Bauhausu."},{"page_url":"https://it.wikipedia.org/wiki/Armoriale_delle_famiglie_italiane_(Sab-Sal)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Coa_fam_ITA_salaris.jpg","page_title":"Armoriale delle famiglie italiane (Sab-Sal)","context_page_description":"Questo è l'armoriale delle famiglie italiane il cui cognome inizia con le lettere che vanno da Sab a Sal."},{"page_url":"https://en.wikipedia.org/wiki/Lupita_Tovar","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Lupita_Tovar_Argentinean_Magazine_AD_3.jpg","page_title":"Lupita Tovar","context_page_description":"Guadalupe Natalia Tovar professionally known as Lupita Tovar, was a Mexican-American actress and centenarian best known for her starring role in the 1931 Spanish-language version of Drácula, filmed in Los Angeles by Universal Pictures at night using the same sets as the Bela Lugosi version, but with a different cast and director. She also starred in the 1932 film Santa, one of the first Mexican sound films, and one of the first commercial Spanish-language sound films."},{"page_url":"https://fr.wikipedia.org/wiki/Universit%C3%A9_Paris-Diderot","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Place_Jussieu.JPG","page_title":"Université Paris-Diderot","context_page_description":"L'université Paris Diderot était une université pluridisciplinaire située à Paris, et faisait partie des sept universités de l'académie de Paris. Elle a été créée en 1971 à la suite de la scission de l'université de Paris. Depuis son déménagement en 2007 du campus de Jussieu, elle s'est principalement implantée dans le quartier de Paris Rive Gauche. L'université a été membre du PRES Sorbonne Paris Cité depuis le 31 mars 2010.\\nElle fusionne avec l'université Paris Descartes et l'institut de physique du globe de Paris en 2019 pour devenir l'université de Paris, à qui elle cède pleinement ses droits au 1ᵉʳ janvier 2020.\\nElle est spécialisée dans le domaine des sciences, des formations du domaine de la santé, des sciences humaines et sociales, ainsi que des arts, lettres et langues. Ses activités de recherche se concentrent autour de 102 équipes et regroupent près de 2 300 doctorants et 2 000 enseignants-chercheurs. Elle forme près de 26 000 étudiants.\\nParmi les personnalités liées à l'université, deux enseignants ont obtenu un prix Nobel, et deux autres ont exercé la fonction de ministre de l'Éducation nationale en France."},{"page_url":"https://hu.wikipedia.org/wiki/Frank_Moss_(szen%C3%A1tor)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/72/Frank_Moss.jpg","page_title":"Frank Moss (szenátor)","context_page_description":"Frank Moss az Amerikai Egyesült Államok szenátora."},{"page_url":"https://da.wikipedia.org/wiki/Klosterhede_Plantage","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Klosterheden_-_panoramio.jpg","page_title":"Klosterhede Plantage","context_page_description":"Klosterhede Plantage er sammen med den mod vest liggende Kronhede Plantage, et af Danmarks største skovområder med et samlet areal på 6.400 ha. Det er gør det til det tredjestørste skovområde i Danmark efter Silkeborgskovene og Rold Skov. Plantagerne ligger i trekanten mellem Lemvig, Struer og Holstebro, med hovedparten i Lemvig Kommune, og administreres af Naturstyrelsen, Vestjylland. De to plantager adskilles af Flynder Å hvor man første gang udsatte bævere i Danmark i 1999. Bestanden der nu har spredt sig i området. Der blev udsat 18 bævere i 1999, og i 2013 var bestanden vokset til 185 individer.\\nHeden og plantagerne er også hjemsted for en af Danmarks største bestande af kronvildt, godt 400 dyr."},{"page_url":"https://nn.wikipedia.org/wiki/Flekkbrystjuvel","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Lampornis_sybillae_%28female%29.jpg","page_title":"Flekkbrystjuvel","context_page_description":"Flekkbrystjuvel er ein fugl i kolibrifamilien og er endemisk til området Sentral-Amerika med utbreiing i både Honduras og Nicaragua."},{"page_url":"https://de.wikipedia.org/wiki/Halswirbels%C3%A4ule","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/HWS_seitlich_Annotation.jpg","page_title":"Halswirbelsäule","context_page_description":"Die Halswirbelsäule bezeichnet die Gesamtheit der Wirbel zwischen Kopf und Brustwirbelsäule bei Menschen und den anderen Wirbeltieren.\\nDie Halswirbelsäule ist in der Regel der beweglichste Wirbelsäulenabschnitt. Die beiden dem Schädel am nächsten liegenden Wirbel haben Eigennamen: Atlas und der Axis, bedingt durch ihre vom üblichen Aufbau eines Wirbels abweichende Bauform. Dieser obere Teil der Halswirbelsäule samt der Schädelbasis bildet die Kopfgelenke. Es folgen fünf weitere Halswirbel. Die Halswirbelsäule weist beim gesunden Menschen einen Bogen nach vorn auf, was als physiologische Lordose bezeichnet wird."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Filipino_generals_in_the_Philippine_Revolution_and_the_Philippine%E2%80%93American_War","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Ramon_Avancena.jpg","page_title":"List of Filipino generals in the Philippine Revolution and the Philippine–American War","context_page_description":"This is a compendium of the Filipino generals, commanders and who fought during the Philippine Revolution, Filipino-American War and the Post-war insurgencies against US occupation of the Philippines."},{"page_url":"https://es.wikipedia.org/wiki/Alcoentre","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/AZB-alcoentre.png","page_title":"Alcoentre","context_page_description":"Alcoentre es una freguesia portuguesa del concelho de Azambuja, con 47,00 km² de superficie y 3.535 habitantes. Su densidad de población es de 75,2 hab/km²."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A4%D0%BB%D1%83%D0%BE%D1%80%D0%B5%D1%81%D1%86%D0%B5%D0%BD%D1%86%D1%96%D1%8F_%D0%B2_%D0%B1%D1%96%D0%BE%D0%BB%D0%BE%D0%B3%D1%96%D1%87%D0%BD%D0%B8%D1%85_%D0%B4%D0%BE%D1%81%D0%BB%D1%96%D0%B4%D0%B6%D0%B5%D0%BD%D0%BD%D1%8F%D1%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Dividing_Cell_Fluorescence-uk.jpg","page_title":"Флуоресценція в біологічних дослідженнях","context_page_description":"Флуоресценція знайшла широке застосування у різноманітних прикладних біологічних та біомедичних дослідженнях. Це фізичне явище, суть якого полягає в короткочасному поглинанні кванта світла флуорофором із наступною швидкою емісією іншого кванту, що має властивості, відмінні від вихідного. Багато напрямків у біофізиці, молекулярній та клітинній біології виникли та розвиваються саме завдяки впровадженню нових методів, що базуються на флуоресценції. Варто навести декілька прикладів.\\nДля біофізиків флуоресценція стала швидким та чутливим методом дослідження структури, динаміки та функцій біологічних макромолекул — нуклеїнових кислот та білків.\\nМетод секвенування ДНК за Сангером був значно вдосконалений у другій половині 1980-х років саме завдяки впровадженню флуоресцентної детекції. Важливим наслідком цього стала вища швидкість та надійність секвенування. Окрім цього метод було автоматизовано. Це відкрило технічну можливість проведення широкомасштабного секвенування та дозволило розпочати проект «Геном людини» на початку 1990-х років. Крім прямого секвенсування, флуоресценція продовжує використовуватись у методах секвенування ДНК наступних поколінь."},{"page_url":"https://de.wikipedia.org/wiki/Geschichte_der_Stadt_Z%C3%BCrich","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Ansicht_Zuerich_Herrliberge.jpg","page_title":"Geschichte der Stadt Zürich","context_page_description":"Die Stadt Zürich bestand als Turicum schon zu römischer Zeit, stieg aber erst im Mittelalter in die Reihe der grösseren Schweizer Städte auf. Die Herrscher des Heiligen Römischen Reiches erwählten die Stadt an der Limmat als Standort für zwei bedeutende geistliche Stiftungen um die Kultstätten der Stadtpatrone Felix und Regula, die Zürich prägten: Das Grossmünster- und das Fraumünsterstift.\\n1262 sicherte das Privileg der Reichsunmittelbarkeit die nicht fühlbare Herrschaft eines fernen deutschen Königs. Zürichs Beitritt in verschiedenste Bünde – unter anderem in die entstehende Eidgenossenschaft 1351 und den Konstanzer Bund 1385 – schützte die Stadt längerfristig vor den Expansionsgelüsten lokaler Adelsgeschlechter, allen voran der Habsburger. Zusammen mit Bern bestimmte Zürich zeitweise als Vorort die Politik des aufstrebenden Staatenbundes der Eidgenossenschaft.\\nSeit der Reformation Ulrich Zwinglis gehört Zürich zu den geistigen Zentren des reformierten Bekenntnisses. Dem Status des «Rom an der Limmat» kam es zu, dass sich Zürich seit 1648 im gleichen Rang wie Venedig als souveräne Stadtrepublik betrachtete. Im 18."},{"page_url":"https://hu.wikipedia.org/wiki/Saskatoon","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0b/Saskatoon_via_rail_station.JPG","page_title":"Saskatoon","context_page_description":"Saskatoon a kanadai Saskatchewan tartomány legnagyobb városa. A Saskatchewan folyó déli szakaszának kanyarában és a Transz-Kanadai Főút Yellowhead Highway nevű útjánál fekszik. A régió gazdasági központjaként szolgált 1882-es megalapítása óta. A 2016-os Kanadai Népszámlálás szerinti 246 376 lakosa a legnépesebb várossá teszi a tartományban, eszerint 295 095 agglomerációs lakossal a 17. legnépesebb agglomeráció Kanadában.\\nSaskatoon ad otthont a Saskatchewani Egyetemnek, a Meewasin Völgyi Autoritásnak, amely megőrzi a Dél Saskatchewani Folyót és vízgyüjtő területét, valamint a Wanuskewin Emlékparknak, amely bemutatja az első Saskatooni nemzetek mintegy 6000 éves kultúráját.\\nSaskatoon nevét az azonos nevű Saskatoon bogyóról kapta, mely őshonos ezen a területen. A bogyó Cree misâskwatômina szóról kapta a nevét. A városnak jelentős bennszülött populációja és számos városi rezervátuma van. Jól ismert sokszínű és vibráló kultúrájáról és nyolc darab hídjáról, melyekről \\"A Préri Párizs\\" és a \\"Hídi Város\\" nevet kapta.\\nTörténelmi szomszédai Nutana és Riversdale, melyek külön települések voltak 1906-os összeolvadásuk előtt."},{"page_url":"https://cs.wikipedia.org/wiki/Oh!_Susanna","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4b/Oh%21_Susanna_2.jpg","page_title":"Oh! Susanna","context_page_description":"„Oh! Susanna“ je zlidovělá americká píseň, původně šířená minstrelovými kabaretními soubory. Jejím autorem je Stephen Collins Foster a poprvé byla zveřejněna v roce 1848. Pojednává o jižanském kovbojovi, který se svým banjem cestuje z Alabamy do Louisiany, a řadí se mezi nejoblíbenější americké písně vůbec."},{"page_url":"https://sv.wikipedia.org/wiki/Calochortus_flexuosus","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Calochortus_flexuosus_16.jpg","page_title":"Calochortus flexuosus","context_page_description":"Calochortus flexuosus är en liljeväxtart som beskrevs av Sereno Watson. Calochortus flexuosus ingår i släktet Calochortus och familjen liljeväxter. Inga underarter finns listade."},{"page_url":"https://it.wikipedia.org/wiki/Atlant_Moskovskaja_Oblast%27","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/FigureSkating_2007_ArenaMytischi.jpg","page_title":"Atlant Moskovskaja Oblast'","context_page_description":"L'Atlant Moskovskaja Oblast' è una squadra di hockey su ghiaccio russa di Mytišči che gioca nel massimo campionato europeo, la KHL."},{"page_url":"https://en.wikipedia.org/wiki/Deroplatys_lobata","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/69/Deroplatys_fg05.jpg","page_title":"Deroplatys lobata","context_page_description":"Deroplatys lobata, common name Southeast Asian dead leaf mantis or dead leaf mantis, is a species of praying mantis that inhabits Thailand, Java, Borneo, Indonesia, Sumatra and the Malay Peninsula."},{"page_url":"https://en.wikipedia.org/wiki/Roman_surface","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/RomanSurfaceTopView.PNG","page_title":"Roman surface","context_page_description":"The Roman surface or Steiner surface is a self-intersecting mapping of the real projective plane into three-dimensional space, with an unusually high degree of symmetry. This mapping is not an immersion of the projective plane; however, the figure resulting from removing six singular points is one. Its name arises because it was discovered by Jakob Steiner when he was in Rome in 1844.\\nThe simplest construction is as the image of a sphere centered at the origin under the map f =. This gives an implicit formula of\\nAlso, taking a parametrization of the sphere in terms of longitude and latitude, gives parametric equations for the Roman surface as follows:\\nThe origin is a triple point, and each of the xy-, yz-, and xz-planes are tangential to the surface there. The other places of self-intersection are double points, defining segments along each coordinate axis which terminate in six pinch points. The entire surface has tetrahedral symmetry. It is a particular type of Steiner surface, that is, a 3-dimensional linear projection of the Veronese surface."},{"page_url":"https://en.wikipedia.org/wiki/Maribyrnong_Plate","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Racehorse_%27Aboukir%27_Trainer_Frank_Dalton%27s_%27Monte_Carlo%27_Stables_37_Darley_Road_Randwick_Sydney_N.S.W.jpg","page_title":"Maribyrnong Plate","context_page_description":"The Maribyrnong Plate is a Victoria Racing Club Group 3 Thoroughbred horse race for two-year-olds, at set weights, over a distance of 1000 metres, at Flemington Racecourse, Melbourne, Australia on the Oaks day of the VRC Spring Carnival in November. Total prize money for the race is A$200,000."},{"page_url":"https://nl.wikipedia.org/wiki/Campeonato_Goiano_Segunda_Divis%C3%A3o_1966","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Bandeira_de_Buriti_Alegre.jpg","page_title":"Campeonato Goiano Segunda Divisão 1966","context_page_description":"In 1966 werd het vijfde Campeonato Goiano Segunda Divisão gespeeld voor clubs uit de Braziliaanse staat Goiás. De competitie werd georganiseerd door de FGF en werd gespeeld van 3 juli tot 11 september. Ceres werd kampioen."},{"page_url":"https://en.wikipedia.org/wiki/Mangum_Fire","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Mangum_Fire_in_Jacob_Lake_02.jpg","page_title":"Mangum Fire","context_page_description":"The Mangum Fire is a wildfire burning in Kaibab National Forest in Arizona in the United States. The fire, which started on June 8, 2020 approximately 16 miles north of the North Rim of Grand Canyon National Park, burned a total of 71,450 acres. The fire threatened the community of Jacob Lake, Arizona, resulting in its evacuation. Select highways were closed, including Highway 67, which resulted in closure of the North Rim of the Grand Canyon. Additionally, areas of the Paria Canyon-Vermilion Cliffs Wilderness were inaccessible due to closures. Four buildings were destroyed, including two historic cabins. The exact cause of the fire remains under investigation, however, fire officials have confirmed it was human caused."},{"page_url":"https://id.wikipedia.org/wiki/Kawasaki_Ki-64","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Kawasaki_Ki-64_on_ground.jpg","page_title":"Kawasaki Ki-64","context_page_description":"Kawasaki Ki-64 adalah prototipe eksperimental berat, kursi tunggal, tempur. Dua fitur desain yang tidak biasa. pertama; itu memiliki dua mesin bersama-sama Kawasaki Ha-40; satu di hidung pesawat, yang lain di belakang kokpit, baik yang terhubung dengan drive shaft. Kombinasi ini melaju dua, tiga-berbilah, kontra-rotating propellors. Fitur kedua adalah penggunaan permukaan sayap sebagai radiator untuk mesin berpendingin air. Pesawat terbang pertama kali pada bulan Desember 1943 Selama penerbangan kelima, mesin belakang terbakar. dan sementara pesawat melakukan pendaratan darurat, rusak. Pesawat itu kemudian ditinggalkan pada pertengahan 1944 dalam mendukung proyek-proyek yang lebih menjanjikan. Badan pesawat selamat dari perang, dan bagian dari sistem pendingin yang unik dikirim ke Wright Field untuk pemeriksaan."},{"page_url":"https://cs.wikipedia.org/wiki/V%C4%9Bkov%C3%A1_pyramida","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Population_pyramid_CZE_1999rel.png","page_title":"Věková pyramida","context_page_description":"Věková pyramida představuje grafické znázornění věkové struktury obyvatelstva daného regionu. Název je odvozen od trojúhelníkové podoby grafu, ze kterého lze věkovou strukturu obyvatelstva vyčíst. Znázorňuje počet mužů a žen v daném věku, v daném okamžiku a na vymezeném území."},{"page_url":"https://ro.wikipedia.org/wiki/Madou_(sta%C8%9Bie_de_metrou_din_Bruxelles)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/STIB-MIVB_Madou.jpg","page_title":"Madou (stație de metrou din Bruxelles)","context_page_description":"Madou este o stație de metrou poziționată la limita administrativă a comunelor Bruxelles și Saint-Josse-ten-Noode, în Regiunea Capitalei Bruxelles din Belgia. Situată pe liniile de metrou 2 și 6, stația poartă numele pieței de la suprafață, denumită în onoarea pictorului local Jean-Baptiste Madou."},{"page_url":"https://es.wikipedia.org/wiki/Boeing_727","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Lineas_Aereas_Suramericanas_Boeing_727-2X3%28F%29%3B_HK-4354%40UIO%3B22.06.2008_514bn_%284276333230%29.jpg","page_title":"Boeing 727","context_page_description":"El Boeing 727 es un avión comercial trimotor a reacción de fuselaje estrecho de tamaño medio, construido y desarrollado por la compañía estadounidense Boeing Commercial Airplanes. El primer Boeing 727 salió de la fábrica el 27 de noviembre de 1962. Tiene el mismo ancho del fuselaje del Boeing 707/720, lo cual redujo los costos de utillaje de Boeing y los costos de mantenimiento de las aerolíneas. Es el modelo más vendido hasta principios de la década de 1980, con un total de 1831 aviones entregados, época en que fue sustituido por el Boeing 737. A finales de abril de 2017, permanecían en servicio activo cuatro Boeing 727-100 y 83 Boeing 727-200."},{"page_url":"https://hr.wikipedia.org/wiki/Metiljeva_trava","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/20180604Lysimachia_nummularia3.jpg","page_title":"Metiljeva trava","context_page_description":"Metiljeva trava, puzava trajnica iz porodice jaglačevki, raširena po gotovo cijeloj Europi i zapadnoj Aziji. Udomaćena je i u Sjevernoj Americi gdje je smatraju invazivnim korovom.\\nIme vrste “nummmularia”, dolazi od nummus, kovanica, a odnosi se na okruglaste listove nalik kovanicama, pa otuda i domaći nazivi novčić i novčac\\nStabljika je polegnuta, do 50 cm dužine, gola ili vrlo malo obrasla sitnim dlačicama. Jestivi su mladi listovi i cvjetovi.\\nKoristi se i kao ljekovita biljka."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%A4%A9%E4%B8%BB%E6%95%99%E8%80%95%E8%8E%98%E9%86%AB%E7%99%82%E8%B2%A1%E5%9C%98%E6%B3%95%E4%BA%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Cardinal_Tien_Hospital_370-BS_20170815.jpg","page_title":"天主教耕莘醫療財團法人","context_page_description":"天主教耕莘医疗财团法人，系由财团法人天主教会台北教区捐助设立的公益法人，设立时名为财团法人天主教耕莘医院，2013年12月31日更名为天主教耕莘医疗财团法人。其最先设立的医疗机构，系由枢机主教田耕莘于中华民国台北县新店筹建的耕莘医院。此外于永和区设有永和耕莘医院。"},{"page_url":"https://no.wikipedia.org/wiki/Parantirrhoea_marshalli","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/ParantirrhoeaMarshalli132_3.jpg","page_title":"Parantirrhoea marshalli","context_page_description":"Parantirrhoea marshalli er en sommerfugl som tilhører gruppen Melanitini i underfamilien ringvinger i den artsrike familien flikvinger."},{"page_url":"https://vec.wikipedia.org/wiki/Saint-Christophe-Dodinicourt","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Saint-Christophe-Dodinicourt_%2811%29.jpg","page_title":"Saint-Christophe-Dodinicourt","context_page_description":"Saint-Christophe-Dodinicourt el xé on comun de 34 abitanti del departemento de Aube che el fa parte del rejon Grand Est in Fransa."},{"page_url":"https://ast.wikipedia.org/wiki/Epimachus_fastosus","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Epimachus_fastuosus_by_Bowdler_Sharpe.jpg","page_title":"Epimachus fastosus","context_page_description":"Epimachus fastosus ye una especie d'ave paseriforme de la familia Paradisaeidae nativa de Nueva Guinea. El machu de la especie ye polígamu y lleva a cabu una exhibición del cortexu p'atraer a les femes. La so dieta consiste principalmente en frutes y artrópodos.\\nPor cuenta de la perda continua d'hábitat, el pequeñu tamañu de la población y a la caza en delles zones p'alimentación y poles plumes de la cola, ta clasificáu como vulnerable na Llista Colorada d'Especies Amenazaes de la UICN. Tamién ta llistáu nel Apéndiz II de la CITES."},{"page_url":"https://fr.wikipedia.org/wiki/Sogdiane","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/BezeklikSogdianMerchants.jpg","page_title":"Sogdiane","context_page_description":"La Sogdiane ou Sogdie est une région historique recouvrant en partie l'Ouzbékistan, le Tadjikistan et l'Afghanistan et englobant les villes historiques de Samarcande et Boukhara et la vallée irriguée de Zeravchan. Elle se situe au nord de la Bactriane, à l'est de Khwarezm et au sud-est de Kangju entre l'Oxus et le Jaxartes.\\nLa Sogdiane fut la 18ᵉ province de l'Empire perse achéménide, selon l'Inscription de Behistun de Darius Iᵉʳ. Les historiens pensent également qu'il s'agit de la seconde des « bonnes terres et pays » formés par Ahura Mazda. Enfin, cette province est mentionnée dans le livre zoroastrien Vendidad.\\nL'Avesta, le texte sacré du zoroastrisme, religion des Perses préislamiques, cite Sughda-, « les Sogdiens, la Sogdiane », mais il est très difficile à dater. Il remonte en tout cas à une haute Antiquité. Les Sogdiens semblent avoir été des Scythes, appelés aussi \\"Sakas\\" par les Persans, sédentarisés. Les Sogdiens, de langue scythique, appartenant au groupe des langues est-iranienne, ont joué dans l'Antiquité et au Moyen Âge un important rôle d'intermédiaire commercial en Asie centrale et notamment le long de la Route de la soie."},{"page_url":"https://en.wikipedia.org/wiki/Man's_Way_with_Women","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Mans_way_with_women_poster.jpg","page_title":"Man's Way with Women","context_page_description":"Man's Way with Women is a 1934 Swedish romance and drama film directed by Per-Axel Branner. It is based on the Finnish novel The Song of the Blood-Red Flower by Johannes Linnankoski.\\nThe interior shots of the film were shot in Råsunda's Filmstaden studios and the exterior scenes in Uppland, Ramsele and Långsele. The film premiered at the Röda Kvarn theatre in Stockholm on November 12, 1934. The film US release was in 1937."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%80%E3%83%8B%E3%82%A8%E3%83%AB%E3%83%BB%E3%83%91%E3%83%81%E3%82%A7%E3%82%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Daniel_Pacheco_%28cropped%29.jpg","page_title":"ダニエル・パチェコ","context_page_description":"ダニエル・\\"ダニ\\"・パチェコ・ロバトは、スペイン王国マラガ県ピサーラ出身のサッカー選手、ポジションはフォワード、ミッドフィールダー。マラガCF所属。\\n小柄な体型であるが、ボールコントロールに長け、得点能力にも優れている。"},{"page_url":"https://pt.wikipedia.org/wiki/China","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Shangai_at_night.png","page_title":"China","context_page_description":"República Popular da China, também conhecida simplesmente como China, é o maior país da Ásia Oriental e o mais populoso do mundo, com mais de 1,38 bilhão de habitantes, quase um quinto da população da Terra. É uma república socialista, governada pelo Partido Comunista da China sob um sistema unipartidário e que tem jurisdição sobre vinte e duas províncias, cinco regiões autônomas, quatro municípios e duas Regiões Administrativas Especiais com grande autonomia. A capital da RPC é Pequim.\\nCom aproximadamente 9,6 milhões de quilômetros quadrados, a República Popular da China é o terceiro maior país do mundo em área total e o terceiro maior em área terrestre. Sua paisagem é variada, com florestas de estepes e desertos no norte seco e frio, próximo da Mongólia e da Sibéria, e florestas subtropicais no sul úmido e quente, próximo ao Vietnã, Laos e Mianmar. O terreno do país, a oeste, é de alta altitude, com o Himalaia e as montanhas Tian Shan formando fronteiras naturais entre a China, a Índia e a Ásia Central."},{"page_url":"https://fr.wikipedia.org/wiki/Ernest_Renan","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Panorama_Le_Tout-Paris_%287%29.jpg","page_title":"Ernest Renan","context_page_description":"Ernest Renan, né le 28 février 1823 à Tréguier et mort le 2 octobre 1892 à Paris, est un écrivain, philologue, philosophe et historien français.\\nCurieux de science, Ernest Renan est immédiatement convaincu par les hypothèses de Darwin sur l'évolution des espèces. Il établit un rapport étroit entre les religions et leurs racines ethnico-géographiques. Une part essentielle de son œuvre est d'ailleurs consacrée aux religions avec par exemple son Histoire des origines du christianisme dont le premier tome est consacré à la Vie de Jésus. Ce livre qui marque les milieux intellectuels de son vivant contient la thèse, alors controversée, selon laquelle la biographie de Jésus doit être comprise comme celle de n'importe quel autre homme, et la Bible comme devant être soumise à un examen critique comme n'importe quel autre document historique. Ceci déclenche des débats passionnés et la colère de l'Église catholique.\\nErnest Renan est considéré aujourd'hui comme un intellectuel de référence avec des textes comme Prière sur l'Acropole ou Qu'est-ce qu'une nation ?."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%AD%E0%B9%80%E0%B8%A5%E0%B9%87%E0%B8%81%E0%B8%8B%E0%B8%B2%E0%B8%99%E0%B9%80%E0%B8%94%E0%B8%AD%E0%B8%A3%E0%B9%8C_%E0%B9%80%E0%B8%AE%E0%B8%A5%E0%B9%87%E0%B8%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Alexander_Hleb_press.jpeg","page_title":"อเล็กซานเดอร์ เฮล็บ","context_page_description":"อะเลียคซันดาร์ เปาลาวิช เฮล็บ, หรือโดยทั่วไปเรียกเป็นภาษาอังกฤษว่า อเล็กซานเดอร์ เฮล็บ เป็นอดีตนักฟุตบอลอาขีพชาวเบลารุส ในช่วงปี ค.ศ. 1998–2019 ในตำแหน่งกองกลางตัวรุกหรือปีก เขาเป็นที่รู้จักในเรื่องความว่องไวและความสามารถในการเลี้ยงบอล\\nเฮล็บ ลงเล่นให้กับ 13 สโมสรตลอดอาชีพการค้าแข้งใน 6 ประเทศโดยเขาลงเล่นให้กับ เฟาเอ็ฟเบ ชตุทท์การ์ท ในเยอรมนี มากที่สุดด้วยจำนวนนัด 211 นัดในช่วงปี ค.ศ. 2000–2005 และ 2009–2010 เขายังเคยคว้าแชมป์ยูฟ่าแชมเปียนส์ลีก กับบาร์เซโลนา ในฤดูกาล 2008–09 อีกทั้งเขายังเคยลงเล่นให้กับทีมชาติเบลารุสชุดใหญ่ มาตั้งแต่ปี ค.ศ. 2001 โดยเขาได้ลงเล่น 80 นัดและทำได้ 6 ประตู โดย เฮล็บ ได้ประกาศเลิกเล่นฟุตบอลอาชีพอย่างเป็นทางการในเดือนมีนาคม ค.ศ. 2020 ในวัย 38 ปี"},{"page_url":"https://zh.wikipedia.org/wiki/%E6%96%B0%E5%8A%A0%E5%9D%A1%EF%BC%8D%E5%BE%B7%E5%9C%8B%E9%97%9C%E4%BF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Botschaft-singapur-vom-leipziger-platz.JPG","page_title":"新加坡－德國關係","context_page_description":"新加坡－德國關係，是指歷史上的新加坡和德國，以至現在新加坡共和國和德意志聯邦共和國的雙邊關係。新加坡在東協的建設角色、政治穩定和地區影響力令德國外交部視新加坡為德國外交的重要夥伴。"},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B4%D6%80%D5%A1%D5%B4%D5%A1_%D5%84%D5%A5%D6%84%D5%BD%D5%AB%D5%AF%D5%A1%D5%B5%D5%B8%D6%82%D5%B4","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5e/Drama_in_Mexico_03.jpg","page_title":"Դրամա Մեքսիկայում","context_page_description":"«Դրամա Մեքսիկայում», ֆրանսիացի գրող Ժյուլ Վեռնի առաջին հրատարակված պատմական նովելը։ Առաջին անգամ հրատարակվել է 1851 թվականին՝ «Մեքսիկական նավատորմի առաջին նավերը» անվանումով։ Իր նամակում Վեռնը նշում է, որ «սա միայն հասարակ արկածային պատմություն է Կուպերի ոճով»։"},{"page_url":"https://nl.wikipedia.org/wiki/Sant%27Angelo_d%27Alife","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/15/S._Angelo_d%27Alife_-_Panorama_centro_storico.JPG","page_title":"Sant'Angelo d'Alife","context_page_description":"Sant'Angelo d'Alife is een gemeente in de Italiaanse provincie Caserta en telt 2389 inwoners. De oppervlakte bedraagt 33,9 km², de bevolkingsdichtheid is 73 inwoners per km²."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%BC%E3%83%86%E3%82%A3%E3%83%AC%E3%83%AA%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Artillery_Rockharz_2015_03.jpg","page_title":"アーティレリー","context_page_description":"アーティレリーは、デンマーク出身のスラッシュメタル・バンド。\\nデンマーク産スラッシュの先駆者であり、母国を代表する古参のヘヴィメタル・グループとして知られる。"},{"page_url":"https://ro.wikipedia.org/wiki/Cetatea_Diyarbak%C4%B1r","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Sur%2C_Diyarbak%C4%B1r.svg","page_title":"Cetatea Diyarbakır","context_page_description":"Castelul Diyarbakır sau Cetatea din Diyarbakır este o fortăreață istorică în Sur, Diyarbakır, estul Turciei. Este formată dintr-o fortăreață interioară și o cetate exterioară.\\nPorțile principale ale cetății sunt: Poarta Dağ, Poarta Urfa, Poarta Mardin și Poarta Yeni. Zidurile provin din vechiul oraș roman Amida și au fost construite în forma lor actuală la mijlocul secolului al IV-lea d.Hr. de către împăratul Constanțiu al II-lea. Aceștia sunt cele mai lungi și cele mai largi ziduri de apărare din lume după Marele Zid Chinezesc.\\nUNESCO a adăugat cetatea din Diyarbakır pe lista experimentală din 2000 și l-a catalogat ca un loc din Patrimoniul Mondial UNESCO în 2015 împreună cu Grădinile Hevsel."},{"page_url":"https://en.wikipedia.org/wiki/Rochester,_New_York","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6e/Memorial_Art_Gallery_main_gallery_west_side.JPG","page_title":"Rochester, New York","context_page_description":"Rochester is a city in the U.S. state of New York, the seat of Monroe County and the third-most populous after New York City and Buffalo with an estimated population of 205,695 in 2019. The city of Rochester forms the core of a much larger suburban, and rural area. Rochester has a greater metro population of around 1 million people, across six counties.\\nRochester was one of the United States' first boomtowns, initially due to the fertile Genesee River Valley, which gave rise to numerous flour mills, and then as a manufacturing center which spurred further rapid population growth. The city rose to prominence as the birthplace and home of some of America's most iconic companies, in particular Eastman Kodak, Xerox and Bausch & Lomb which saw the region become a global center for science, technology, research and development. This status has been aided by the presence of several internationally renowned universities and their research programs; these schools along with many other smaller colleges have played an increasingly large role in Greater Rochester's economy."},{"page_url":"https://sv.wikipedia.org/wiki/Norman_Wells_Airport","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Norman_Wells_Airport_01.jpg","page_title":"Norman Wells Airport","context_page_description":"Norman Wells Airport är en flygplats i Kanada. Den ligger i den centrala delen av landet, 3 800 km nordväst om huvudstaden Ottawa. Norman Wells Airport ligger 72 meter över havet. Den ligger vid sjön Sherwood Lake.\\nTerrängen runt Norman Wells Airport är platt åt sydväst, men åt nordost är den kuperad. Den högsta punkten i närheten är 760 meter över havet, 8,1 km nordost om Norman Wells Airport. Runt Norman Wells Airport är det mycket glesbefolkat, med 7 invånare per kvadratkilometer. Närmaste större samhälle är Norman Wells, 1,6 km väster om Norman Wells Airport.\\nTrakten ingår i den boreala klimatzonen. Årsmedeltemperaturen i trakten är -7 °C. Den varmaste månaden är juli, då medeltemperaturen är 16 °C, och den kallaste är januari, med -25 °C."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%93%D0%BE%D0%BB%D0%B5%D0%BC%D0%BE_%D0%98%D0%BB%D0%B8%D0%BD%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/%D0%92%D0%B8%D0%BA%D0%B8%D0%B5%D0%BA%D1%81%D0%BF%D0%B5%D0%B4%D0%B8%D1%86%D0%B8%D1%98%D0%B0_%D0%96%D0%B5%D0%BB%D0%B5%D0%B7%D0%BD%D0%B8%D0%BA_28.jpg","page_title":"Големо Илино","context_page_description":"Големо Илино е село в община Демир Хисар, Северна Македония."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%A4%A7%E9%98%AA%E5%B8%82%E7%AB%8B%E7%9F%A2%E7%94%B0%E6%9D%B1%E5%B0%8F%E5%AD%A6%E6%A0%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Osaka_City_Yata_Higashi_elementary_school.jpg","page_title":"大阪市立矢田東小学校","context_page_description":"大阪市立矢田東小学校は、大阪府大阪市東住吉区にある公立小学校。\\n1966年に大阪市立矢田小学校の分校として開設され、その後1970年に独立開校した。学校敷地は、池を埋め立てて造成した。"},{"page_url":"https://sv.wikipedia.org/wiki/BYD_Company","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/70/BYD_02.JPG","page_title":"BYD Company","context_page_description":"BYD Company Limited är en privatägd kinesisk tillverkare av bilar och batterier, baserad i Shenzhen, Guangdongprovinsen. Företaget bildades 1995 och är noterat på Hongkongbörsen sedan 2002.\\n2008 lanserade dotterbolaget BYD Auto världens första serietillverkade laddhybridbil, kallad BYD F3DM. Bilen visades upp på Internationella bilsalongen i Genève 2010, och företaget planerar en lansering i bland annat Europa. BYD har även samarbetsavtal med Daimler AG för utveckling och tillverkning av elbilar för den kinesiska och europeiska marknaden.\\nBYD tillverkar även bussar, bland annat batteribussen BYD K9 som finns tillgänglig på den europeiska marknaden och som under det sena 2010-talet börjat säljas även i Sverige. Främsta konkurrenten är Volvo 7900 Electric."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8D%A1%E7%90%B3%C2%B7%E5%8D%9A%E8%80%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Karin_Boye%2C_1940s.gif","page_title":"卡琳·博耶","context_page_description":"卡琳·博耶是一位瑞典诗人和小说家。"},{"page_url":"https://it.wikipedia.org/wiki/Separazione_ATC","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Aircraft_crossing_paths.jpg","page_title":"Separazione ATC","context_page_description":"La separazione ATC è una procedura del controllo del traffico aereo applicata da personale controllore per prevenire le collisioni tra aeromobili che operano in particolari condizioni o all'interno di specifici spazi aerei."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%87%8C%E9%9C%84%E9%96%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/ThePeakTower_20041223.jpg","page_title":"凌霄閣","context_page_description":"凌霄阁是香港一座特色建筑，位于香港岛扯旗山与歌赋山之间的炉峰峡上，亦是山顶缆车的终点站，地址为山顶道128号。它座落于海拔396米高之处而非山顶最高处，设计突出却不破坏山脊线。凌霄阁最高处达海拔428米，能俯览维多利亚港两岸景致，是香港主要旅游景点之一。\\n2003－2009年发行的香港流通货币中，香港上海汇丰银行及中银香港发行之20港元纸币背面皆印有凌霄阁外貌。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_H%C3%B6rstel","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Riesenbeck_Doppelbildstock_Oberdorf_04.jpg","page_title":"Liste der Baudenkmäler in Hörstel","context_page_description":"Die Liste der Baudenkmäler in Hörstel enthält die denkmalgeschützten Bauwerke auf dem Gebiet der Stadt Hörstel im Kreis Steinfurt in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Hörstel eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://hu.wikipedia.org/wiki/Mlini","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Port_of_Mlini.jpg","page_title":"Mlini","context_page_description":"Mlini falu Horvátországban, Dubrovnik-Neretva megyében. Közigazgatásilag Župa dubrovačka községhez tartozik."},{"page_url":"https://fr.wikipedia.org/wiki/The_Masked_Singer_(%C3%89tats-Unis)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Ken_Jeong_March_2015.jpg","page_title":"The Masked Singer (États-Unis)","context_page_description":"The Masked Singer est une émission de télévision dédiée à la compétition de chant type télé crochet. La série a été diffusée pour la première fois sur la Fox le 2 janvier 2019. Elle est basée sur le format sud-coréen King of Mask Singer.\\nL'émission est animée par Nick Cannon et présente des célébrités chantant dans un costume et un masque facial qui dissimule leur identité aux autres concurrents, aux panélistes et au public.\\nLe 30 janvier 2019 la FOX annonce renouveler l'émission pour une deuxième saison."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%80%D5%B8%D5%BE%D5%A1%D5%A6%D5%B6%D5%A5%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Tigon4.jpg","page_title":"Հովազներ","context_page_description":"Հովազներ կամ Պանտերա, կատվազգիների ընտանիքի խոշոր կենդանիների տեսակ, կազմված է ներկայումս գոյություն ունեցող հինգ տեսակներից՝ Վագր, Առյուծ, Ընձառյուծ և Յագուար, Լեռնային Ձյունաընձառյուծ կամ Ձյունահովազ Իրբրս ինչպես նաև մի շարք բրածո տաքսոններից:\\nՈւնեն կոկորդի հատուկ կառուցվածք, ինչը թույլ է տալիս մռնչալ: Ի տարբերություն այլ կատվազգիների, այս տեսակի ներկայացուցիչների ենթալեզվային ապարատն ամբողջովին ոսկրացած չէ, ոսկորներից մեկի փոխարեն ճկուն ջիլ է, ինչը թույլ է տալիս կոկորդին ուռչել: Բացի դրանից նրանց ձայնալարերն անջատ չեն և ձևավորում են խողովակային կառուցվածք, որը գործում է որպես շատ արդյունավետ ձայնային հարմարանք:"},{"page_url":"https://en.wikipedia.org/wiki/Catherine_Anna_McKenna","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Catherine_Anna_McKenna.png","page_title":"Catherine Anna McKenna","context_page_description":"Catherine Anna McKenna was a US lawyer. In 1912, she was the first woman to be admitted to practice law in California since the passage of the suffrage amendment. She also served on the Supreme Court of California, Supreme Court of Wyoming, and the District Court of the United States."},{"page_url":"https://fr.wikipedia.org/wiki/Neomura","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Phylogenetic_Tree_of_Life.png","page_title":"Neomura","context_page_description":"Le concept de clade neomura a été proposé pour regrouper deux groupes frères présumés : les domaines Eukaryota et Archaea.\\nLe groupe a été proposé pour la première fois par Thomas Cavalier-Smith et son nom signifie « nouveaux murs », reflétant l'hypothèse d'avoir évolué par rapport aux eubactéries : un des principaux changements aurait été le remplacement de parois cellulaires constituées de peptidoglycane en d'autres glycoprotéines. Aujourd'hui, on considère bactéries et néomurains comme les deux premières lignées de l'arbre de la vie actuelle.\\nLa forme adjectivale est néomurain, et les éléments du groupe sont appelés des néomurains."},{"page_url":"https://de.wikipedia.org/wiki/Benedictus_Gotthelf_Teubner","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Teubner01.jpg","page_title":"Benedictus Gotthelf Teubner","context_page_description":"Benedictus Gotthelf Teubner war ein deutscher Buchhändler und Verlagsgründer."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BD%D0%B3_%D0%99%D0%BE%D0%BD%D0%B3_%D0%A2%D0%B8%D0%B2%D0%BE%D0%BB%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Tivoli_hostess.JPG","page_title":"Санг Йонг Тиволи","context_page_description":"Tivoli е автомобил от клас мини SUV, произведен от южнокорейския SUV специалист SsangYong Motor Company. Моделът носи името на романтичния италиански курортен град Тиволи, провинция Лацио, а слоганът ILOVIT, с който се рекламира, е находчива анаграма на името на модела, чиято оригиналност се състои в „огледалния прочит“ на TIVOLI.\\nРазработката и предпроизводствените изпитания на Tivoli продължават три години преди моделът да бъде официално обявен като прототип с кодовото име X100. Стиловият концепт е дело на италианското дизайнерско бюро IDEA Institute. Серийно моделът е пуснат първо в родната си Корея през януари 2015 г., но първоначално с ограничен набор от оборудване – само с бензинов двигател, механична скоростна кутия и предно задвижване. В рамките на 2015 г. Tivoli получава европейска хомологация, нов дизелов двигател с максимален въртящ момент от 300 Нм/1500 – 2500 об./мин., автоматична скоростна кутия и пълноприводна трансмисия. За 2016 година е предвидена и удължена версия на Тиволи с кодово име XLV, която се очаква да излезе на пазара през май 2016 г."},{"page_url":"https://no.wikipedia.org/wiki/Gresk-baktriske_konged%C3%B8mme","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/BhalkCapital.jpg","page_title":"Gresk-baktriske kongedømme","context_page_description":"Gresk-baktriske kongedømme var et oldtidsrike i den mest østlige delen av den hellenistiske verden, og dekket Baktria og Sogdiana i Sentral-Asia fra 250 f.Kr. til 125 f.Kr. Fra 180 f.Kr. utvidet det hellenistiske riket seg inn i nordlige India og etablerte det indo-greske kongedømmet som varte fram til 10 e.Kr."},{"page_url":"https://en.wikipedia.org/wiki/Jason_Bowld","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/2018_RiP_-_Bullet_for_My_Valentine_-_by_2eight_-_DSC4173.jpg","page_title":"Jason Bowld","context_page_description":"Jason Bowld is a British drummer currently playing with Bullet for My Valentine, formerly of Pitchshifter, This Is Menace and AxeWound. He was approached by Ghost at one point but turned it down.\\nBowld's first show with Bullet For My Valentine was at Wembley Arena in 2010, their original drummer Michael Thomas wasn't able to play. Jason said Matt Tuck rang him and gave him the setlist with no rehearsals, he had two days to learn the set."},{"page_url":"https://tr.wikipedia.org/wiki/Gose_(bira)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/BKL16_Bier_033.JPG","page_title":"Gose (bira)","context_page_description":"Gose, kökeni Almanya'nın Goslar kentine dayanan, minimum %50 oranında buğday maltı içeren ekşimsi ve tuzlu bir bira türüdür."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A9%D7%90%D7%9C%D7%AA_%D7%96%D7%94%D7%95%D7%AA%D7%95_%D7%A9%D7%9C_%D7%9E%D7%97%D7%91%D7%A8_%D7%9E%D7%97%D7%96%D7%95%D7%AA_%D7%A9%D7%99%D7%99%D7%A7%D7%A1%D7%A4%D7%99%D7%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Edward-de-Vere-1575.jpg","page_title":"שאלת זהותו של מחבר מחזות שייקספיר","context_page_description":"זהותו של כותב המחזות הידועים כ\\"כתבי שייקספיר\\" נחשבת לידועה, אך כבר בתקופתו של שייקספיר עלו טענות שהוא לא הסופר של היצירות שהתפרסמו בשמו, כדוגמת גינויו של בן התקופה, המחזאי רוברט גרין שכינהו \\"עורב זה מקרוב בא, המתהדר בנוצות לא לו\\". בעת החדשה צצו גם מומחים, בדעת מיעוט, שטענו כי מעולם לא היה אדם בשם ויליאם שייקספיר."},{"page_url":"https://es.wikipedia.org/wiki/Civilizaci%C3%B3n_incaica","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/KonTikiInMuseum.jpg","page_title":"Civilización incaica","context_page_description":"La civilización incaica, también llamada civilización inca o civilización quechua, fue la última de las grandes civilizaciones precolombinas que conservó su Estado independiente durante la conquista de América. Con la extensión del imperio, esta fue absorbiendo nuevas expresiones culturales de los pueblos incorporados, y se ubicó en los actuales territorios del Perú, Bolivia, Ecuador, Chile, Argentina y Colombia.\\nDesde la ciudad sagrada del Cuzco, los quechuas consolidaron un Estado que logró sintetizar los conocimientos artísticos, científicos y tecnológicos de sus antecesores. Basados en un concepto de expansión del Estado, el Tahuantinsuyo recogió aquellos conocimientos y los potenció. En la actualidad, algunas costumbres y tradiciones de la desaparecida civilización inca prevalecen aún en los países que formaron parte del Imperio inca. Bolivia, Chile, Ecuador, Perú y norte de Argentina.\\nLa conquista del Tahuantinsuyo, realizada entre 1530 y 1540 por los españoles, encabezados por Francisco Pizarro, puso fin al imperio y el nacimiento del Virreinato del Perú. Sin embargo, focos de resistencia de los llamados Incas de Vilcabamba se mantuvieron hasta 1572."},{"page_url":"https://es.wikipedia.org/wiki/Avenida_de_la_Libert%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Aerial_View_Luxembourg_City_-_Gare_%282014%29_2a_%28cropped%29.JPG","page_title":"Avenida de la Liberté","context_page_description":"La Avenida de la Liberté​ es una calle en la ciudad de Luxemburgo, en el sur del país europeo de Luxemburgo. La avenida es una arteria vial de sentido único, con cuatro carriles de transporte de tráfico desde el norte del barrio Gare, al sur de ese sector, en la estación de tren de Luxemburgo.\\nEn su extremo norte, la Avenida de la Libertad se encuentra con el Puente Adolphe, que toma el tráfico a través del valle del Pétrusse uniéndose al Bulevar Royal en el centro de la ciudad, en la Ville Haute. Una cuarta parte del camino de la carretera, pasa a lo largo del lado este de la Plaza de los Mártires, frente a lo que es la sede de ArcelorMittal, el mayor fabricante de acero del mundo. En el sur, la calle llega a la estación central de la ciudad, por lo cual se convierte en la Place de la Gare, parte de la N3."},{"page_url":"https://es.wikipedia.org/wiki/Matt_Lucas_(rugbista)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Matt_Lucas_July_2017.jpg","page_title":"Matt Lucas (rugbista)","context_page_description":"Matthew Lucas es un jugador australiano de rugby que se desempeña como medio scrum y juega en los Brumbies del Super Rugby.​ Es hermano menor del también jugador de rugby Ben Lucas."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B2%D5%A1%D6%80%D5%A1%D6%84_%D5%95%D5%A2%D5%A1%D5%B4%D5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Barack_Obama_Iraq_2006.jpg","page_title":"Բարաք Օբամա","context_page_description":"Բարաք Հուսեյն Օբամա II, Ամերիկայի Միացյալ Նահանգների 44-րդ նախագահ ։ Օբաման առաջին սևամորթ ամերիկացին է, որն առաջադրվել է որպես ԱՄՆ նախագահի թեկնածու որևէ ամերիկյան կուսակցությունից։\\nԿոլումբիայի համալսարանի և Հարվարդի օրենսգիտության դպրոցի շրջանավարտ, ուր նա եղել է առաջին սևամորթ անձը, որ նախագահել է «Harvard Law Review»-ին։ Օբաման ընտրվել է որպես համայնքի կազմակերպիչ և որպես քաղաքացիական իրավունքների դատախազ Իլինոյսի սենատում երեք ժամկետների համար՝ 1997-2004 թթ։ Եվ միաժամանակ, 1992-2004 թթ Օբաման դասավանդել է սահմանադրական իրավունք Չիկագոյի համալսարանում։ 2000 թ.-ին ձախողվեց ԱՄՆ Ներկայացուցիչների պալատի անդամ դառնալու նրա առաջին փորձը։ Այս դեպքից հետո, 2003 թվականի հունվարին Օբաման դրեց իր թեկնածությունը ԱՄՆ սենատի անդամ ընտրվելու համար և 2004 թ. նոյեմբերին ընտրվեց սենատում՝ շահելով քվեների 70 %։\\nՕբաման 2005 թվականի հունվարից 2008 թվականի նոյեմբերը Միացյալ Նահանգների կրտսեր սենատորն էր Իլինոյսից, որից հրաժարվել է նախագահ ընտրվելու կապակցությամբ։\\nՕբաման Խաղաղության Նոբելյան մրցանակի դափնեկիր է։"},{"page_url":"https://es.wikipedia.org/wiki/Stagonopleura_guttata","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Stagonopleura_guttata_3.jpg","page_title":"Stagonopleura guttata","context_page_description":"El diamante moteado ​ es una especie de ave paseriforme de la familia Estrildidae endémica del sudeste de Australia."},{"page_url":"https://fr.wikipedia.org/wiki/Rub%C3%A9n_Ochandiano","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Premios_Goya_2020_-_Ruben_Ochandiano.jpg","page_title":"Rubén Ochandiano","context_page_description":"Rubén Ochandiano est un acteur espagnol."},{"page_url":"https://en.wikipedia.org/wiki/B%C3%ACnh_Tri%E1%BB%87u_Bridge","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/C%E1%BA%A7u_B%C3%ACnh_Tri%E1%BB%87u_2.JPG","page_title":"Bình Triệu Bridge","context_page_description":"The Bình Triệu Bridge is a road bridge that crosses the Saigon River in Ho Chi Minh City. The road on the bridge heads out to Thủ Dầu Một."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Eintr%C3%A4ge_im_National_Register_of_Historic_Places_in_Quincy_(Massachusetts)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Wollaston_theater.jpg","page_title":"Liste der Einträge im National Register of Historic Places in Quincy (Massachusetts)","context_page_description":"Die Liste der Einträge im National Register of Historic Places in Quincy in Massachusetts führt alle Bauwerke, National Historic Landmarks und Historic Districts in Quincy auf, die in das National Register of Historic Places aufgenommen wurden.\\nDie vorliegende Liste wurde aufgrund der Vielzahl an Einträgen in Quincy ausgelagert und ist integraler Bestandteil der Liste der Einträge im National Register of Historic Places im Norfolk County."},{"page_url":"https://io.wikipedia.org/wiki/Judicii_di_N%C3%BCrnberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Nuremberg_Trials_retouched.jpg","page_title":"Judicii di Nürnberg","context_page_description":"La judicii di Nürnberg esis serio di militarala tribunali instalita pos la duesma mondomilito da vinkinta nacioni en Germana urbo Nürnberg por judiciar importanta chefi di nacional-socialista Germania, akuzita pro militala krimini, e krimini kontre la homaro. La judicii komencis ye la 20ma di novembro 1945 e finis ye la 1ma di oktobro 1946.\\nMalgre la maxim importanta figuri de la Triesma Reich - Adolf Hitler, Joseph Goebbels e Heinrich Himmler - suocidabis ante esar arestita, 24 importanta militala kriminozi judiciesis. Martin Bormann, sekretario di nacional-socialista partiso, judiciesis in absentia.\\nL'akuzi kontre la 24 esis:\\npartoprenar en komuna plano o konspiro por efektigar krimini kontre la paco\\nplanigar e komencar militi di atako, ed altra krimini kontre la paco\\nmilito-krimini\\nkrimini kontre la homaro\\nJudiciisti de Usa, Unionita Rejio, Francia e Sovietia judiciis la kriminozi. La judiciisti esis:\\nde Usa: Francis Biddle, John Parker\\nde Francia: profesoro Henri Donnedieu de Vabres, Robert Falco\\nde l'Unionita Rejio: Justice Lawrence e Normann Birkett\\nde Sovietia: mayoro-generalo Iona T. Nikitchenko, lietnanto-kolonelo A. F. Volchov."},{"page_url":"https://en.wikipedia.org/wiki/Montm%C3%A9rac","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Montchaude_16_Mairie_2013.jpg","page_title":"Montmérac","context_page_description":"Montmérac is a commune in the Charente department of southwestern France. The municipality was established on 1 January 2016 and consists of the former communes of Montchaude and Lamérac."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%84%B8%EA%B3%84_%EA%B8%B0%EC%95%84_%EC%A7%80%EC%88%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/%EB%AF%B8%EC%96%80%EB%A7%88_GHI_%EC%B6%94%EC%9D%B4_%281990~2016%29.png","page_title":"세계 기아 지수","context_page_description":"세계기아지수 줄여서 GHI는 기아의 정도를 세계적, 지역적, 그리고 국가별로 종합적으로 측정하고 추적하기 위해 설계된 지수이다. 아일랜드의 NGO인 컨선월드와이드, 독일의 NGO인 세계기아원조 그리고 미국의 연구기관인 국제식량정책연구소가 협력하여 전 세계 나라들을 대상으로 기아지수를 측정하며 매년 업데이트가 된다. 2006년 10월에 처음으로 정식발표를 한 뒤, 매년 10월 세계식량의 날 전에 발표를 해오고 있다. 한국에서는 컨선월드와이드의 주도로 2015년부터 발표되고 있다.\\n매년 발표하는 수치에는 각각의 소주제가 같이 제시되는데 이러한 소주제를 통해서 세계기아지수에 한 해 동안 가장 중요한 이슈가 무엇이었는지를 알 수 있다.\\n이렇게 발표된 세계기아지수는 UN 등 국제기구의 보고서나 한국 언론의 기사에 인용됨으로써 전 세계 각국의 기아 상태를 파악하는데 유용하게 쓰이고 있다."},{"page_url":"https://it.wikipedia.org/wiki/Magyarcsan%C3%A1d","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bf/HUN_Magyarcsan%C3%A1d_COA.jpg","page_title":"Magyarcsanád","context_page_description":"Magyarcsanád è un comune dell'Ungheria di 1.629 abitanti. È situato nella provincia di Csongrád."},{"page_url":"https://en.wikipedia.org/wiki/S%C4%93ja_Municipality","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/S%C4%93jas_novads_COA.png","page_title":"Sēja Municipality","context_page_description":"Sēja Municipality is a municipality in Vidzeme, Latvia. The municipality was formed in 2006 by reorganization of Sēja Parish; the administrative centre being Loja."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E6%A3%95%E8%89%B2_(%E9%A6%AC)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Bosanski_brdski_konj.JPG","page_title":"棕色 (馬)","context_page_description":"棕色是馬的其中一種毛色，與其他毛色棗色、栗色或白色為主要的馬匹毛色。"},{"page_url":"https://arz.wikipedia.org/wiki/%D9%84%D9%8A%D9%86%D8%AF%D8%A7_%D9%84%D8%A7%D8%B1%D9%83%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Linda_Larkin_2015.jpg","page_title":"ليندا لاركن","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nليندا لاركن ممثله من امريكا."},{"page_url":"https://it.wikipedia.org/wiki/Uccelli_della_Nuova_Zelanda","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Himantopus-novaezelandiae.jpg","page_title":"Uccelli della Nuova Zelanda","context_page_description":"Uccelli della Nuova Zelanda\\nQuesta lista si basa sulla checklist redatta dalla Ornithological Society of New Zealand ed è aggiornata in base alla classificazione tassonomica e alla nomenclatura attualmente accettate dal Congresso ornitologico internazionale.\\nPer ogni specie sono fornite informazioni sulla presenza seguendo la seguente terminologia:\\nAccidentale - specie riscontrata solo occasionalmente in un determinato territorio; in genere si tratta di individui singoli o in numero limitato, spesso sospinti fuori dalle abituali rotte migratorie da particolari situazioni meteorologiche.\\nEstiva - specie o popolazione migratrice e nidificante in un determinato territorio, nel quale non viene abitualmente effettuato lo svernamento.\\nEstivante - specie o popolazione migratrice che si trattiene in un determinato territorio durante il periodo estivo, senza nidificare.\\nIntrodotta - specie introdotta in un determinato territorio dall'uomo\\nMigratrice - una specie è considerata migratrice per un determinato territorio quando vi transita senza nidificare o svernare\\nNidificante - specie o popolazione che porta regolarmente a termine il ciclo riproduttivo in un determinato territorio."},{"page_url":"https://hu.wikipedia.org/wiki/King_Kong_vs._Godzilla","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/KK_v_G_trailer_%281962%29.png","page_title":"King Kong vs. Godzilla","context_page_description":"A King Kong vs. Godzilla a japán Tóhó stúdió 1962-es tudományos-fantasztikus kaidzsú filmje. Rendezője Honda Isiró, producere Tanaka Tomojuki, a speciális effektusok rendezője Cuburaja Eidzsi, zenéjét Ifukube Akira szerezte. Ez a Godzilla franchise harmadik része, egyben a Godzillát és King Kongot szerepeltető első színes, szélesvásznú film.\\nA mű az 1960-as évek elüzletiesedett japán kultúrájának szatírája, és eddig a franchise egyetlen tagja, mely vígjátéknak készült. A Tóhó fennállásának 30. évfordulóját ünnepelte vele, ezért széles, családi nézőközönségnek szólt. Pénzügyileg óriási siker volt, nézettségi adatai máig rekordtartók nemcsak a Godzilla széria japán filmjei, hanem az összes élőszereplős japán fantasztikus film között, továbbá az egyik leghíresebb kultikus szörnyfilmnek számít. Kritikai megítélése viszont kétes, ami főleg a King Kong megjelenítésére használt jelmezekre és a film amerikai változatára vezethető vissza. A John Beck által felügyelt amerikai kiadást, mely jelentősen átszerkesztette az alapfilmet, a Universal Pictures adta ki 1963-ban."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Monuments_of_National_Importance_in_Bangalore_circle","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/PANORAMA_Chikkajala_20120908_092025.jpg","page_title":"List of Monuments of National Importance in Bangalore circle","context_page_description":"This is a list of Monuments of National Importance as officially recognized by and available through the website of the Archaeological Survey of India in the Indian state Karnataka. 207 Monuments of National Importance have been recognized by the ASI in Bengaluru circle of Karnataka."},{"page_url":"https://no.wikipedia.org/wiki/AGA_AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/AGA_Furuset_2010-03-30.JPG","page_title":"AGA AB","context_page_description":"AGA AB er et svensk aksjeselskap etablert i 1904 av Aron Andersson og Axel R. Nordvall. De startet med en fabrikk i Saltsjö-Järla i Nacka, og tok samtidig over virksomheten til Svenska Carbid & Acetylén AB, som Nordvall hadde grunnlagt i 1899. AGA endret senere navn til AGA AB, og ble et multinasjonalt selskap med datterselskaper i flere verdensdeler. Selskapet er Nord-Europas største selskap innen industrigass med aktivitet i Norden og Baltikum. I tillegg til utvikling og markedsføring av industri- og spesialgass utvikler AGA også nye bruksområdet for gass. Selskapet er også ledende på LPG.\\nSiden begynnelsen av 2000-tallet er AGA AB eid av det tyske konsernet Linde AG med mer enn 50 000 ansatte fordelt på virksomhet i over 100 land. Hovedkontoret til Linde ligger i München."},{"page_url":"https://fi.wikipedia.org/wiki/Yksi_silta_liikaa","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/V.l.n.r._regisseur_Richard_Attenborough%2C_scenarioschrijver_William_Goldman_en_pr%2C_Bestanddeelnr_928-0660.jpg","page_title":"Yksi silta liikaa","context_page_description":"Yksi silta liikaa on vuonna 1977 ensi-iltansa saanut brittiläinen sotaelokuva, joka perustuu Cornelius Ryanin samannimiseen romaaniin. Elokuvan on ohjannut Richard Attenborough ja käsikirjoittanut William Goldman."},{"page_url":"https://bs.wikipedia.org/wiki/Spisak_autopisti_i_autov%C3%ADa_u_%C5%A0paniji","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/R-5Spain.png","page_title":"Spisak autopisti i autovía u Španiji","context_page_description":"Mreža autoputeva u Španiji je podijeljenja na autopiste i autovíe. 31. decembra 2005. godine mreža se sastojala od 13.156 km autoputa."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AA%D9%8A%D8%A7%D9%86%D8%A7_%D9%87%D9%88%D9%83%D9%8A%D9%86%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Tianna_Hawkins-20170914.jpg","page_title":"تيانا هوكينز","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nتيانا هوكينز لاعبه كرة سله من امريكا."},{"page_url":"https://de.wikipedia.org/wiki/Deutz_D-06","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Torpedo_tractor%2C_Vliegfeld_Weelde%2C_2009.jpg","page_title":"Deutz D-06","context_page_description":"Die Deutz D-06-Reihe als Bestandteil der Marke Deutz-Fahr gehörte zu den erfolgreichsten Baureihen des Traktorenherstellers Klöckner-Humboldt-Deutz AG aus Köln. Die Baureihe wurde erstmals im Frühjahr 1968 in Köln-Deutz der Deutz Händlerschaft vorgestellt. Später im Jahr 1968 wurde die Serie 06 der Allgemeinheit auf der DLG-Ausstellung in München präsentiert. Sie löste die vorhergehende Baureihe Deutz D-05 ab."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A6%CE%BF%CF%8D%CF%81%CE%BA%CE%B1_%CE%99%CF%89%CE%B1%CE%BD%CE%BD%CE%AF%CE%BD%CF%89%CE%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Fourka_441_00%2C_Greece_-_panoramio.jpg","page_title":"Φούρκα Ιωαννίνων","context_page_description":"Η Φούρκα είναι ορεινός οικισμός στον δήμο Κόνιτσας του νομού Ιωαννίνων. Σύμφωνα με τα στοιχεία της απογραφής του 2011, ο πληθυσμός της ανέρχεται στους 90 κατοίκους."},{"page_url":"https://cs.wikipedia.org/wiki/Bo%C5%BEena_(kn%C4%9B%C5%BEna)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/98/Peruc_Oldrichuv_dub.JPG","page_title":"Božena (kněžna)","context_page_description":"Božena byla druhá manželka Oldřicha a česká kněžna, matka knížete Břetislava I. Tato kněžna byla jedinou neurozenou panovnicí na českém trůně, neboť to byla žena z lidu. Kronikáři ji však považovali za skutečnou českou kněžnu, ne za pouhou milenku Oldřicha."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%B0%D1%83%D0%BC%D0%B0%D0%BD%D0%BD%D1%96%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Ag2Sestructure.png","page_title":"Науманніт","context_page_description":"Науманніт –\\n1 Мінерал, селенід срібла каркасної будови. Хімічна формула: Ag₂Se. Містить: Ag — 73,15; Se — 26,85. Сингонія ромбічна або псевдоромбічна. При температурі вище 130 °С переходить у кубічну модифікацію. Утворює кубічні кристали і зернисті агрегати. Спайність досконала. Густина 7,8– 8,0. Твердість 3,0. Колір чорний. Риса чорна. Блиск металічний. Непрозорий. Анізотропний. Зустрічається в кварцово-карбонатних жилах разом з клаусталітом та ін. селенідами. Рідкісний. Знайдений у родов. Сан-Андреасберґ, Тількероде, Серра-де-Качеута, Пакаяк, на Чукотці. За прізв. нім. мінералога К. Ф. Науманна, W.K.Haidinger, 1845.\\n2 Зайва назва ільменорутилу. М. І. Кокшаров, 1856.\\nСиноніми: срібло селенисте, блиск селено-срібний."},{"page_url":"https://pt.wikipedia.org/wiki/Leonor_Teles","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/D._Leonor_Telles_de_Menezes.jpg","page_title":"Leonor Teles","context_page_description":"Leonor Teles, cognominada a Aleivosa foi rainha de Portugal entre 1371 e 1383, pelo seu casamento com Fernando I de Portugal. Foi regente de Portugal de 1383 a 1384."},{"page_url":"https://de.wikipedia.org/wiki/Landschaftsschutzgebiet_Z%C3%A1horie","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Morava_small_lake.jpg","page_title":"Landschaftsschutzgebiet Záhorie","context_page_description":"Das Landschaftsschutzgebiet Záhorie ist ein Landschaftsschutzgebiet im äußersten Westen der Slowakei, in der traditionellen, nichtadministrativen Landschaft Záhorie. Es ist das erste große weiträumige Naturschutzgebiet in einem Tiefland der Slowakei. Das 275,22 km² große Gebiet liegt in den politischen Bezirken Bratislavský kraj und Trnavský kraj und besteht aus zwei recht unterschiedlichen Teilen: einem entlang des Grenzflusses March und einem im Tiefland Borská nížina.\\nDer Sitz der Verwaltung befindet sich in Malacky."},{"page_url":"https://lt.wikipedia.org/wiki/Li%C5%ABtbe%C5%BEd%C5%BEion%C4%97s","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Tamarin.monkey.500pix.jpg","page_title":"Liūtbeždžionės","context_page_description":"Liūtbeždžionės – kabiauodegių šeimos beždžionių gentis. Turi ilgus plaukus, kurie krinta ant pečių tarsi liūto karčiai. Gyvena tik pietryčių Brazilijoje. Sparčiai nyksta dėl miškų kirtimo ir prekybos šiomis beždžionėmis.\\nGentyje 4 rūšys:\\nAuksaspalvė liūtbeždžionė. Veidas tamsiai pilkas, o plaštakos ir rankų pirštai ilgi ir ploni, kad galėtų iš žievės ir plyšių iškrapštyti vabzdžių lervas. Tačiau apie keturis penktadalius maisto sudaro vaisiai, kuriuos papildo sakai ir nektaras. Maitinasi dieną, o naktį miega sąžalynuose arba dažniau medžio drevėje. Pav.\\nAuksagalvė liūtbeždžionė\\nJuodoji liūtbeždžionė\\nJuodaveidė liūtbeždžionė"},{"page_url":"https://en.wikipedia.org/wiki/Alter_do_Ch%C3%A3o","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Castelo_de_Alter_do_Ch%C3%A3o_II.JPG","page_title":"Alter do Chão","context_page_description":"Alter do Chão is a municipality in the District of Portalegre in Portugal. The population in 2011 was 3,562, in an area of 362.07 km².\\nThe present Mayor is Francisco Reis, elected by the Socialist Party. The municipal holiday is Ascension Day. The municipality is famous for its horsebreeding and high school of horseriding."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D1%80%D1%81%D0%BA%D0%BE%D0%B5_%D0%BA%D0%BB%D0%B0%D0%B4%D0%B1%D0%B8%D1%89%D0%B5_(%D0%A1%D0%B5%D1%81%D1%82%D1%80%D0%BE%D1%80%D0%B5%D1%86%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/%D0%93%D0%BE%D1%80%D1%81%D0%BA%D0%BE%D0%B5_%D0%A7%D0%B0%D0%BD%D0%B4%D1%8B%D0%BB%D0%BE%D0%B2%D0%B0.JPG","page_title":"Горское кладбище (Сестрорецк)","context_page_description":"Го́рское кла́дбище — кладбище, расположенное в Сестрорецке по адресу Большая Горская ул.,82.\\nРядом платформа Горская Сестрорецко-Белоостровской ж.д.\\nНа кладбище расположены памятники культурно-исторического наследия регионального уровня охраны на основании:\\nРешение Исполкома Ленгорсовета от 03.05.1976 г. № 328\\nОхране подлежат четыре объекта:\\nбратская могила советских воинов, погибших в Великую Отечественную войну, в которой похоронены: сержант Л. С. Филиппович, капитан К. М. Купчин. У входа в 15 метрах за сторожкой.\\nбратская могила советских воинов, погибших в Великую Отечественную войну. У Центральной площадки.\\nбратские и одиночные могилы советских воинов, погибших в Великую Отечественную войну. Центральная площадка.\\nбратская могила советских воинов, погибших в Великую Отечественную войну. У Центральной площадки."},{"page_url":"https://bs.wikipedia.org/wiki/IC_3491","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/IC3491_-_SDSS_DR14.jpg","page_title":"IC 3491","context_page_description":"IC 3491 je spiralna galaksija koja je udaljena oko 462 miliona sg od Zemlje i nalazi se u sazviježđu Berenikina kosa. Najveći prečnik je 0,90 a najmanji 0,3 uglovnih minuta. Prvo otkriće je napravio Charles Joseph Etienne Wolf 23. marta 1903. godine."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%A0%D1%8D%D1%84%D0%B0%D1%80%D0%BC%D0%B0%D1%86%D1%8B%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Diet_of_Worms.jpg","page_title":"Рэфармацыя","context_page_description":"Рэфарма́цыя — рэлігійны й грамадзкі рух у XV і XVI стагодзьдзях, які меў за мэту рэформу хрысьціянства. Пачаткам Рэфармацыі лічыцца выступленьне Мартына Лютэра ў 1517 годзе, а некаторымі — дзейнасьць Яна Гуса на сто гадоў раней. Галоўная мэта — гэта вяртаньне да першакрыніцы, Бібліі, вяртаньне да Боскага погляду на Царкву, на грамадзтва, на чалавека.\\nЕйным пачаткам прынята лічыць выступленьне доктара багаслоўя Вітэнбэргскага ўнівэрсытэту Мартына Лютэра, якое адбылося 31 кастрычніка 1517 году, калі ён прыбіў да дзьвярэй вітэнбэрскае Замкавае царквы свае «95 тэзісаў», у якіх выступаў супраць існуючых злоўжываньняў каталіцкай царквы, у прыватнасьці супраць продажу індульгенцыяў. Канцом Рэфармацыі можна лічыць падпісаньне вэстфальскіх дамоваў у 1648 годзе, паводле вынікаў якіх рэлігійны фактар перастаў адыгрываць істотную ролю ў эўрапейскай палітыцы."},{"page_url":"https://fr.wikipedia.org/wiki/Canon","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Doryphoros.jpg","page_title":"Canon","context_page_description":"Le mot canon, de la famille du grec κανων dont le premier sens est « tige de roseau », peut désigner plusieurs choses. Étymologiquement, ce terme émane de l'arabe, langue sémitique, Kanna \\"baguette de jonc\\" ; cf. l'arabe qanun ou kanun."},{"page_url":"https://en.wikipedia.org/wiki/Michael_Morrison_(footballer)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Michael_Morrison_2016_%282%29.jpg","page_title":"Michael Morrison (footballer)","context_page_description":"Michael Brian Morrison is an English professional footballer who plays for Championship club Reading. He plays primarily as a centre back.\\nMorrison began his senior career in the Conference National with Cambridge United. After three years as a first-team player, he moved on to Leicester City, contributing to their promotion to the Championship in 2009. He spent the second half of the 2010–11 season with Sheffield Wednesday of League One before moving to another League One club, Charlton Athletic. He helped Charlton gain promotion to the Championship in his first season, was appointed vice-captain, and played regularly until 2014, when he joined another Championship club, Birmingham City, initially on loan.\\nWhile a Cambridge United player, he represented England at semi-professional level."},{"page_url":"https://ja.wikipedia.org/wiki/2004%E5%B9%B4%E3%81%AE%E5%8F%B0%E9%A2%A8%E9%9B%86%E4%B8%AD%E4%B8%8A%E9%99%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Sudal_2004_track.png","page_title":"2004年の台風集中上陸","context_page_description":"2004年の台風集中上陸では、2004年に台風が前例のないほど相次いで日本に接近・上陸した現象について述べる。"},{"page_url":"https://en.wikipedia.org/wiki/Interpretatio_graeca","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Roman_-_Deity_or_Genius_of_the_Eastern_Provinces_-_Walters_541330.jpg","page_title":"Interpretatio graeca","context_page_description":"Interpretatio graeca or \\"interpretation by means of Greek [models]\\" is a discourse used to interpret or attempt to understand the mythology and religion of other cultures; a comparative methodology using ancient Greek religious concepts and practices, deities, and myths, equivalencies, and shared characteristics.\\nThe phrase may describe Greek efforts to explain others' beliefs and myths, as when Herodotus describes Egyptian religion in terms of perceived Greek analogues, or when Dionysius of Halicarnassus and Plutarch document Roman cults, temples, and practices under the names of equivalent Greek deities. Interpretatio graeca may also describe non-Greeks' interpretation of their own belief systems by comparison or assimilation with Greek models, as when Romans adapt Greek myths and iconography under the names of their own gods.\\nInterpretatio romana is comparative discourse in reference to ancient Roman religion and myth, as in the formation of a distinctive Gallo-Roman religion. Both the Romans and the Gauls reinterpreted Gallic religious traditions in relation to Roman models, particularly Imperial cult."},{"page_url":"https://en.wikipedia.org/wiki/Lorin_Morgan-Richards","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Lorin_Morgan-Richards_speaking_at_Bringing_the_Circle_Together.jpg","page_title":"Lorin Morgan-Richards","context_page_description":"Lorin Morgan-Richards is an American author, illustrator, and songwriter, primarily known for his young adult fiction and Weird West series The Goodbye Family.\\nIn the past, Richards served as the publisher of Celtic Family Magazine, the most widely distributed print publication based in the United States about Celtic cultures and interests, and was the founder of the Los Angeles St. David's Day Festival, one of the largest Welsh festivals of its kind in the United States.\\nMorgan-Richards was born in Beebetown, Ohio and is of Welsh, Swiss and Native American descent."},{"page_url":"https://lv.wikipedia.org/wiki/Seroton%C4%ABns","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Serotonin-Spartan-HF-based-on-xtal-3D-sf-web.png","page_title":"Serotonīns","context_page_description":"Serotonīns jeb 5-hidroksitriptamīns ir monoamīna neiromediators. Tas ir aminoskābes L-triptofāna atvasinājums, kas ir sastopams dzīvnieku, ieskaitot cilvēka, gastrointestinālajā traktā, trombocītos un centrālajā nervu sistēmā. Serotonīns ir zināms kā viela, kas ir atbildīga par laimes izjūtas un labsajūtas ierosināšanu.\\nKā melatonīna \\"priekštecis\\" serotonīns palīdz regulēt miega ciklus un iekšējo pulksteni. Serotonīnam ir nozīme ēstgribas un emocionālajos procesos, kā arī ķermeņa motorajās, kognitīvajās un autonomajās funkcijās. Zems serotonīna līmenis organismā ietekmē atmiņas un garastāvokļa pasliktināšanos, kas var izraisīt tādus simptomus kā apgrūtināta aizmigšana, zems pašnovērtējums, uztraukums, agresija un pastiprināta tieksme pēc saldumiem."},{"page_url":"https://hu.wikipedia.org/wiki/H%C3%A1romsz%C3%B6g%C5%B1_pajzs","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Blason_Vide_3D.svg","page_title":"Háromszögű pajzs","context_page_description":"A háromszögű pajzs az élő heraldika korának legkorábbi pajzsformája. A 12. század végén, a 13. század elején alakult ki. Később voltak jobban lekerekített oldalú változatai is. A csatában ténylegesen is használt hadi és heraldikai pajzs. Németalföld kivételével a leggyakrabban használt nyugat-európai pajzs. A korai időkben általában csak az ősi nemesi családok címerein fordul elő. Később más nemesi családok és esetenként a polgárok is használták.\\nA legrégibb heraldikai pajzsforma a kerek pajzs volt. Ezt követi a mandorla alakú pajzs, mely 1200 és 1300 között előfordul az Arnsberg grófok pecsétjein, de főleg főpapi és egyházi pecséteknél használták 1140 és 1300 között, valamint az előkelő hölgyek pecsétjein is megtalálható ugyanebben az időben.\\nA 12. században két fő pajzstípus létezett: a mandulaformájú pajzs és a szív alakú vagy csigaház-pajzs. A 12. század végén ezekből lett Franciaországban a lekerekített sarkú nagyméretű háromszögű pajzs. A mandulaformájú normann pajzs részben még a preheraldikus korhoz tartozik. Ilyen pajzsot használt pl. III. Henrik, Brabant grófja, I."},{"page_url":"https://nl.wikipedia.org/wiki/Paracorixa","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Paracorixa_concinna_%28Corixidae%29_-_%28imago%29%2C_Arnhem%2C_the_Netherlands_-_3.jpg","page_title":"Paracorixa","context_page_description":"Paracorixa is een geslacht van wantsen uit de familie duikerwantsen. Het geslacht werd voor het eerst wetenschappelijk beschreven door Poisson in 1957."},{"page_url":"https://pl.wikipedia.org/wiki/Canterbury","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Canterbury_Cathedral_-_Portal_Nave_Cross-spire.jpeg","page_title":"Canterbury","context_page_description":"Canterbury – miasto o statusie city w Anglii, w hrabstwie Kent, w dystrykcie Canterbury, położone nad rzeką Stour. Siedziba arcybiskupstwa Canterbury, centralnego dla anglikańskiego Kościoła Anglii. Liczba mieszkańców wynosi 42 258, a powierzchnia 23,54 km²."},{"page_url":"https://en.wikipedia.org/wiki/Nandihizana","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Nandihizana.jpg","page_title":"Nandihizana","context_page_description":"Nandihizana is a town and commune in Madagascar. Its previous name was Carion; It belongs to the district of Manjakandriana, which is a part of Analamanga Region. The population of the commune was estimated to be approximately 5,000 in 2001 commune census.\\nCarion is a famous train station of the line TCE. The city became famous with its train station in the seventies due to the trees and wood business organised by Farariana natives businessmen. Primary and junior level secondary education are available in town. The majority 96% of the population of the commune are farmers. The most important crop is rice, while other important products are fruits, beans and cassava. Industry and services provide employment for 1% and 3% of the population, respectively."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Burgen_und_Schl%C3%B6ssern_in_Schlesien","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Chud%C3%B3w_castle_in_March.JPG","page_title":"Liste von Burgen und Schlössern in Schlesien","context_page_description":"Die Liste von Burgen und Schlössern in Schlesien enthält Schlösser, Burgen und Ruinen in der historischen Region Schlesien.\\nErläuterung:\\nWoiwodschaft NS = Niederschlesien, OP = Oppeln, OS = Oberschlesien, LB = Lebus"},{"page_url":"https://it.wikipedia.org/wiki/Lauterach_(Germania)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Wolfstal.jpg","page_title":"Lauterach (Germania)","context_page_description":"Lauterach è un comune tedesco di 604 abitanti, situato nel land del Baden-Württemberg."},{"page_url":"https://nn.wikipedia.org/wiki/Gabbro","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Lyngengabro.JPG","page_title":"Gabbro","context_page_description":"Gabbro er ein magmatisk bergart, ein djupbergart, også kalla intrusiv storkingsbergart, danna av høgt trykk og høg temperatur. Steinen er sett saman av jarn, plagioklas, mørk pyroksen, amfibol og olivin. Gabbro er ein basisk bergart.\\nGabbro vert og kalla «svart granitt» somme tider, men dette er eit geologisk ukorrekt namn. Den mørke fargen kjem av eit stort innhald av jarn saman med det mørke pyroksenet. Gabbro er kvit og svartspetta, og ofte med noko brunt eller grønt. Steinen er massiv og ganske grovt korna. Nokre gongar har gabbro ei lagdeling, gjerne med koronastruktur.\\nGabbro kan vere svakt metamorf, da har berget tydelegare lyse og mørke band, eller meir grøne fargar. Dette kjem av at plagioklasen endrar seg til klinozoisitt, albitt og kalsitt. Klinopyroksen endrar seg til kloritt.\\nGabbro vert brukt til bygningsstein, golv, trapper, fasadar og liknande. Sjeldnare som gravstein.\\nGabbro er vanleg mange stadar i Noreg, men finst sjeldan i store førekomstar. Fleire stader har det vore, eller er, verksemd med steinbrot.\\nKobbvågen, Bø kommune i Nordland, er det brotverksemd."},{"page_url":"https://ro.wikipedia.org/wiki/Casa_Corpului_Didactic_din_Ia%C8%99i","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Casa_Corpului_Didactic_3.JPG","page_title":"Casa Corpului Didactic din Iași","context_page_description":"Casa Corpului Didactic este un monument istoric situat în municipiul Iași, județul Iași. Este situată pe Str. Botez Octav 2-A. Clădirea a fost construită la începutul sec. al XX-lea. Figurează pe noua listă a monumentelor istorice sub codul LMI: IS-II-m-B-03749."},{"page_url":"https://de.wikipedia.org/wiki/Ulrich_von_Schwerin","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Spantekow_Torhaus.jpg","page_title":"Ulrich von Schwerin","context_page_description":"Ulrich von Schwerin, auch Huldrich von Schwerin oder Huldricus Schwerinus war Großhofmeister im Herzogtum Pommern-Wolgast und dort einer der einflussreichsten Männer seiner Zeit. Er entstammte der aus Mecklenburg stammenden Familie von Schwerin."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89trigny","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/PLACE_DE_LA_BASCULE.JPG","page_title":"Étrigny","context_page_description":"Étrigny est une commune française située dans le département de Saône-et-Loire en région Bourgogne-Franche-Comté."},{"page_url":"https://en.wikipedia.org/wiki/List_of_North_American_chicken_breeds","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/American_Game_hen.jpg","page_title":"List of North American chicken breeds","context_page_description":"This is a list of chicken breeds usually considered to originate in Canada and the United States. Some may have complex or obscure histories, so inclusion here does not necessarily imply that a breed is predominantly or exclusively from those countries."},{"page_url":"https://lt.wikipedia.org/wiki/Manicheizmas","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Painting_of_Mani%E2%80%99s_Birth.jpg","page_title":"Manicheizmas","context_page_description":"Manicheizmas – griežtai dualistinis religinis judėjimas, gyvavęs III–XIII a. ir savyje jungęs krikščionybės, gnosticizmo, budizmo, zoroastrizmo ir kitų religijų bruožus."},{"page_url":"https://en.wikipedia.org/wiki/Tay_Bridge_disaster","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Catastrophe_du_pont_sur_le_Tay_-_1879_-_Illustration.jpg","page_title":"Tay Bridge disaster","context_page_description":"The Tay Bridge Disaster occurred during a violent storm on Sunday 28 December 1879, when the first Tay Rail Bridge collapsed as a train from Burntisland to Dundee passed over it, killing all aboard. The bridge—designed by Sir Thomas Bouch—used lattice girders supported by iron piers, with cast iron columns and wrought iron cross-bracing. The piers were narrower and their cross-bracing was less extensive and robust than on previous similar designs by Bouch.\\nBouch had sought expert advice on wind loading when designing a proposed rail bridge over the Firth of Forth; as a result of that advice he had made no explicit allowance for wind loading in the design of the Tay Bridge. There were other flaws in detailed design, in maintenance, and in quality control of castings, all of which were, at least in part, Bouch's responsibility.\\nBouch died within the year, his reputation ruined. Future British bridge designs had to allow for wind loadings of up to 56 pounds per square foot. Bouch's design for the Forth Bridge was not used."},{"page_url":"https://no.wikipedia.org/wiki/MONUSCO","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Roger_Meece_leaving_as_head_of_MONUSCO.jpg","page_title":"MONUSCO","context_page_description":"Mission de l'Organisation des Nations unies pour la stabilisation en République démocratique du Congo er en fredsbevarende FN-styrke opprettet 28. mai 2010 av FNs sikkerhetsråd ved resolusjon 1925 hvorved det ble bestemt at den eksisterende operasjonen MONUC i Den demokratiske republikken Kongo ble videreført under nytt navn fra 1. juli 2010."},{"page_url":"https://fi.wikipedia.org/wiki/Hauzenberg","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/36/Hauzenberg_-_Rathaus.JPG","page_title":"Hauzenberg","context_page_description":"Hauzenberg on kaupunki Passaun piirikunnassa, Ala-Baijerissa Saksassa. Se sijaitsee 15 kilometriä Passausta koilliseen. Hauzenbergin pinta-ala on 82,82 km² ja asukasluku oli vuoden 2011 lopussa 12 025 henkeä. Kaupungin pormestarina toimii Josef Federhofer.\\nHauzenbergin asukasluku on kehittynyt seuraavasti:\\n1970: 11 319 asukasta\\n1987: 11 857 asukasta\\n2000: 12 432 asukasta\\n2009: 12 054 asukasta"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Zittau_Zentrum_(A%E2%80%93J)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/ZittauBrunnenstr13P.JPG","page_title":"Liste der Kulturdenkmale in Zittau Zentrum (A–J)","context_page_description":"In der Liste der Kulturdenkmale in Zittau Zentrum (A–J) sind die Kulturdenkmale des Zittauer Zentrums verzeichnet, die bis April 2019 vom Landesamt für Denkmalpflege Sachsen erfasst wurden und deren Straßenname mit den entsprechenden Anfangsbuchstaben beginnt. Die Anmerkungen sind zu beachten."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%A1%D0%A1%D0%A1%D0%A0_%D0%BC%D0%B8%D2%99%D0%B0%D0%BB%D0%B4%D0%B0%D1%80%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/TOt00752.jpg","page_title":"СССР миҙалдары","context_page_description":"СССР миҙалдары — Советтар Союзының коммунизм төҙөүҙә, социалистик Ватанды яҡлауҙа айырыуса ҡаҙаныштары, шулай уҡ дәүләт һәм йәмғиәт алдындағы башҡа айырыуса ҡаҙаныштары өсөн дәртләндереүгә йүнәтелгән дәүләт наградалары. СССР дәүләт наградалары үҙ эсенә юғары дәрәжә отличиеларын алған— Советтар Союзы Геройы, Социалистик Хеҙмәт Геройы, «Герой-ҡала», «Герой-ҡәлғә», «Герой Әсә», 20 орден, 55 миҙал, 19 СССР-ҙың маҡтаулы исемдәре. Дәүләт наградаларынан тыш, ведомство миҙалы ла булдырыла — өс дәрәжәле «Маҡтауға лайыҡ хеҙмәте өсөн» миҙалы."},{"page_url":"https://hr.wikipedia.org/wiki/Silvestrovo","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Silvester_Frankfurt.jpg","page_title":"Silvestrovo","context_page_description":"Silvestrovo ili Stara godina je posljednji dan u godini, 31. prosinca, i noć uoči Nove godine. Silvestarska noć obilježava se proslavama dočeka Nove godine.\\nSilvestrovo je dobilo naziv po papi svetom Silvestru I., koji ima spomendan toga dana."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D0%B8%D1%82%D0%B0%D0%BD%D1%96%D0%BA_(%D1%84%D1%96%D0%BB%D1%8C%D0%BC,_1997)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Leonardo_DiCaprio.jpeg","page_title":"Титанік (фільм, 1997)","context_page_description":"«Тита́нік» — художній фільм-катастрофа 1997 року, режисера, сценариста, співпродюсера та співмонтажника Джеймса Камерона. У фільмі знято загибель лайнера Титанік. Головні ролі зіграли Кейт Вінслет та Леонардо ДіКапріо. Герої фільму, з різних соціальних верств, закохалися одне в одного на борту зловісного корабля, який здійснює свій рейс через північну Атлантику в 1912 році.\\nПрем'єра фільму в США відбулася 19 грудня 1997 року. Дистриб'ютором фільму в Північній Америці була компанія Paramount Pictures, а в решті світу — 20th Century Fox. Бюджет становив 200 мільйонів доларів США, рекордний для свого часу. Титанік встановив рекорд найкасовішого фільму за всю історію кінематографу, зібравши в прокаті в усьому світі понад 1,8 мільярда доларів, і утримував його протягом 12 років, поки цей рекорд не було перевищено фантастичним фільмом Аватар, який також зняв Камерон. Крім цього фільм очолював американський бокс-офіс 15 тижнів поспіль, що зробило його другим фільмом після картини Іншопланетянин, що перебував на цій позиції найдовше за всіх. В Україні стрічку вперше було показано у лютому 1998 року."},{"page_url":"https://en.wikipedia.org/wiki/Vasudhaiva_Kutumbakam","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Sansad_Bhavan%2C_Delhi%2C_BNK.jpg","page_title":"Vasudhaiva Kutumbakam","context_page_description":"Vasudhaiva Kutumbakam is a Sanskrit phrase found in Hindu texts such as the Maha Upanishad, which means The World is One Family."},{"page_url":"https://ca.wikipedia.org/wiki/Pla%C3%A7a_de_les_Gl%C3%B2ries_Catalanes","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/DHUB_0874.JPG","page_title":"Plaça de les Glòries Catalanes","context_page_description":"La plaça de les Glòries Catalanes, anomenada sovint plaça de les Glòries o simplement Glòries, és una plaça de Barcelona. Es troba als districtes barcelonins de l'Eixample i Sant Martí, i en ella conflueixen tres dels eixos més importants de la ciutat: l'Avinguda Diagonal, la Gran Via de les Corts Catalanes i l'Avinguda Meridiana."},{"page_url":"https://en.wikipedia.org/wiki/New_Zealand_Music_Hall_of_Fame","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Richard_Nunns%2C_2011.jpg","page_title":"New Zealand Music Hall of Fame","context_page_description":"The New Zealand Music Hall of Fame is a figurative hall of fame dedicated to noteworthy New Zealand musicians.\\nThe hall was created in 2007 by Recorded Music NZ and the Australasian Performing Right Association. Two inductions are made into the hall each year, one at the APRA Silver Scroll Awards, decided by APRA, and the other is the winner of the Legacy Award at the New Zealand Music Awards, picked by Recorded Music NZ. The Hall of Fame has plans to hold a gala dinner to induct larger numbers of artists.\\nAs of October 2018, 24 inductions have been made into the hall, seven of which include women. The Exponents frontman Jordan Luck has been inducted twice, first as the inaugural inductee at the 2007 APRA Silver Scroll Awards and again with his band The Exponents at the 2015 New Zealand Music Awards. The most recent Recorded Music NZ inductee was Upper Hutt Posse, who was inducted at the 2018 New Zealand Music Awards, while most recent APRA inductee was singer-songwriter Jenny Morris who was inducted at the 2018 APRA Silver Scroll Awards."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Leonberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Otto_Baum%2C_14.jpg","page_title":"Liste der Kulturdenkmale in Leonberg","context_page_description":"In der Liste der Kulturdenkmale in Leonberg sind unbewegliche Bau- und Kunstdenkmale aller Stadtteile von Leonberg aufgeführt. Grundlage für diese Liste ist die vom Regierungspräsidium Stuttgart herausgegebene Liste der Bau- und Kunstdenkmale.\\nDiese Liste ist nicht rechtsverbindlich. Eine rechtsverbindliche Auskunft ist lediglich auf Anfrage bei der Unteren Denkmalschutzbehörde der Stadt Leonberg erhältlich."},{"page_url":"https://ast.wikipedia.org/wiki/Muelle_de_Puerto_Colombia","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6f/Inicio_muelle_Puerto_Colombia.jpg","page_title":"Muelle de Puerto Colombia","context_page_description":"El muelle de Puerto Colombia ye una estructura allugada nel conceyu de Puerto Colombia, Atlánticu, Colombia. Ente 1893 y 1936 funcionó como terminal marítimu de Barranquilla pal embarque y desembarque de mercancíes y persones, y dempués de la separación de Panamá hasta los años 1920 foi consideráu'l más importante puertu marítimu de Colombia."},{"page_url":"https://en.wikipedia.org/wiki/Neoliberalism","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Graph_charting_income_per_capita_throughout_the_Great_Depression.svg","page_title":"Neoliberalism","context_page_description":"Neoliberalism or neo-liberalism is the 20th-century resurgence of 19th-century ideas associated with economic liberalism and free-market capitalism. It is generally associated with policies of economic liberalization, including privatization, deregulation, globalization, free trade, austerity, and reductions in government spending in order to increase the role of the private sector in the economy and society; however, the defining features of neoliberalism in both thought and practice have been the subject of substantial scholarly debate. Neoliberalism constituted a paradigm shift away from the post-war Keynesian consensus which had lasted from 1945 to 1980.\\nEnglish-speakers have used the term neoliberalism since the start of the 20th century with different meanings, but it became more prevalent in its current meaning in the 1970s and 1980s, used by scholars in a wide variety of social sciences as well as by critics. The term is rarely used by proponents of free-market policies. Some scholars have described the term as meaning different things to different people as neoliberalism has \\"mutated\\" into geopolitically distinct hybrids as it travelled around the world."},{"page_url":"https://oc.wikipedia.org/wiki/Cin%C3%A8ma_azerbaitjan%C3%A9s","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/The_first_film_studio_in_Baku.jpg","page_title":"Cinèma azerbaitjanés","context_page_description":"Lo cinèma azerbaitjanés o cinèma azèri' es l'activitat cinematografica produsida en Azerbaitjan. L'indústria cinematografica a l'Azerbaitjan s'inicièt dempuèi los ans 1890, quand la cort pòrta un cinematograf de França. Una produccion especifica d'Azerbaitjan s'inicièt dempuèi los ans 1910 e se desvolòpa al cors del sègle XX e lo cinèma azèri es una part importanta de la cultura d'Azerbaitjan."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%B1%89%E6%96%AF%C2%B7%E6%9C%97%E6%96%AF%E5%A4%9A%E5%A4%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Hanslangsdorff.jpg","page_title":"汉斯·朗斯多夫","context_page_description":"漢斯·威廉·朗斯多夫，德意志帝國海軍、威瑪國家海軍和納粹德國海軍軍官。他最著名的經歷是在拉普拉塔河口海戰中指揮德國級裝甲艦施佩伯爵將軍號。"},{"page_url":"https://da.wikipedia.org/wiki/Salomons_kapel","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Salomons_Kapel.jpg","page_title":"Salomons kapel","context_page_description":"Salomons kapel er et middelalderligt kapel beliggende på Bornholms Hammerknuden på kyststrækningen mod nordvest.\\nIfølge oplysningsskiltet er den fra 1300-tallet. Lige nordvest for kapellet er der en kilde som i middelalderen blev betragtet som værende hellig. Pilgrimme søgte hertil for at drikke det helbredende vand og for gennem bønner og gaver at opnå helbredelse. Denne praksis holdt dog op omkring Reformationen og kapellets vigtighed sluttede sammen med ophøret af sildeeventyret."},{"page_url":"https://es.wikipedia.org/wiki/Carlos_Alsina_%C3%81lvarez","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Carlos_Alsina_%282009%29.jpg","page_title":"Carlos Alsina Álvarez","context_page_description":"Carlos María Alsina Álvarez es un periodista y locutor de radio español."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D1%83%D1%80%D0%B8%D1%81%D1%82%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D1%88%D0%BB%D1%8F%D1%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/YMR-2015-08-29_157.jpg","page_title":"Туристський шлях","context_page_description":"Туристський шлях — дороги, стежки, водойми тощо, які використовують для туристичних мандрівок за певним маршрутом. Вони можуть бути сухопутними, водними, повітряними.\\nТуристські шляхи прокладають територіями, що мають привабливі з погляду природної, історичної, культурної, етнографічної, соціальної цінності туристичні об'єкти та сприятливі екологічні і санітарно-епідеміологічні умови.\\nЗ метою забезпечення безпеки туристів під час здійснення ними туристичних походів проводять маркування туристських шляхів, призначених для здійснення подорожей з активним способом пересування: пішим, велосипедним, лижним, кінним та водним з застосуванням малих плавзасобів"},{"page_url":"https://de.wikipedia.org/wiki/Kreis_Storojine%C8%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/1938_map_of_interwar_county_Storojinet.jpg","page_title":"Kreis Storojineț","context_page_description":"Der Kreis Storojineț war eine rumänische Verwaltungseinheit im Norden der Bukowina.\\nBenannt war der 2.653 km² große Landkreis nach seinem administrativen Zentrum, der heute ukrainischen Stadt Storoschynez."},{"page_url":"https://nl.wikipedia.org/wiki/Atjeh","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Gapang_Beach%2C_Sabang%2C_Aceh.jpg","page_title":"Atjeh","context_page_description":"Atjeh is een provincie van het huidige Indonesië, gesitueerd in het uiterste noorden van het eiland Sumatra. Het omvat het gebied dat van de 16e tot de 19e eeuw onderdeel vormde van het sultanaat Atjeh. Atjeh heeft verschillende officiële namen gehad: Daerah Istimewa Aceh en Nanggroë Aceh Darussalam."},{"page_url":"https://ckb.wikipedia.org/wiki/%D9%88%D8%A7%D8%B1%D8%B3%D8%A7%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Widok_na_krakowskie_przedmiescie_po_remoncie.jpg","page_title":"وارساو","context_page_description":"وارشۆ شاری وارشۆ پایتەختی وڵاتی پۆڵەندا یە، کە یەکێکە لە بەناوباگترین و گەشتیارترین شارەکانی کیشووەری ئەورووپا."},{"page_url":"https://it.wikipedia.org/wiki/Lago_Sevier","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/SevierDryLake-2009-ByPhilKonstantin.jpg","page_title":"Lago Sevier","context_page_description":"Il lago Sevier è un lago intermittente ed endoreico degli Stati Uniti d'America, che giace nella parte più bassa del Deserto Sevier, Contea di Millard. Come il Gran Lago Salato e il lago Utah, è un relitto del lago Bonneville del Pleistocene. Il lago Sevier è alimentato principalmente dai fiumi Beaver e Sevier, e l'afflusso addizionale proviene dal bacino idrografico dei laghi che fa parte della sottoregione idrologica di Escalante-Sevier. Il lago è stato perlopiù asciutto durante tutta la storia registrata ed è una fonte di polvere soffiata dal vento nelle tempeste di sabbia che frequentemente spazzano il Wasatch Front."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D0%BE%D1%88%D0%B0%D1%80%D0%BA%D0%B0%D1%88%D0%BA%D0%B0_%D1%80%D0%B5%D0%BF%D1%80%D0%B5%D0%B7%D0%B5%D0%BD%D1%82%D0%B0%D1%86%D0%B8%D1%98%D0%B0_%D0%88%D1%83%D0%B3%D0%BE%D1%81%D0%BB%D0%B0%D0%B2%D0%B8%D1%98%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/RIAN_archive_488310_Basketball._Yugoslavia_vs._Italy.jpg","page_title":"Кошаркашка репрезентација Југославије","context_page_description":"Кошаркашка репрезентација Југославије била је национална кошаркашка селекција Југославије. Била је под управом Кошаркашког савеза Југославије.\\nЈугославија се сматрала другом велесилом у међународној кошарци, одмах иза Сједињених Америчких Држава. Пре Југословенских ратова деведесетих, јединствени југословенски тим се сматрао једним од најбољих на свету, увек се такмичећи са Сједињеним Државама и Совјетским Савезом за највишу позицију на подијуму."},{"page_url":"https://fr.wikipedia.org/wiki/Ligne_E_du_RER_d%27%C3%8Ele-de-France","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/RATP_MI_84_Gare_du_Val_d%27Europe_%281%29.jpg","page_title":"Ligne E du RER d'Île-de-France","context_page_description":"La ligne E du RER d'Île-de-France, officiellement dénommée Eole ou plus souvent RER E, est une ligne du réseau express régional d'Île-de-France qui dessert l'est de l'agglomération parisienne selon un axe est-ouest. Elle relie Haussmann - Saint-Lazare, à l'ouest, au cœur de Paris, à Chelles - Gournay et Tournan, à l'est.\\nOuverte par étapes de 1999 à 2003, Eole est aujourd'hui la ligne la plus courte du réseau avec une longueur de 56 kilomètres. Elle est exploitée par la SNCF. À la fin des années 2000, elle transportait près de 312 000 voyageurs chaque jour de la semaine. En 2012, sa fréquentation en semaine se portait à 350 000 voyageurs par jour. Le nombre d'usagers a depuis continué de croître, pour atteindre 372 000 voyageurs chaque jour ouvré en 2016. La totalité de la ligne étant située en Île-de-France, elle est du ressort d'Île-de-France Mobilités. Un projet est en cours afin de la prolonger jusqu'à Nanterre-La Folie en 2022 et à Mantes-la-Jolie en 2024."},{"page_url":"https://en.wikipedia.org/wiki/2005_State_of_Mexico_election","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Yeidckol_Polevnsky.jpg","page_title":"2005 State of Mexico election","context_page_description":"A gubernatorial election was held in the State of México on Sunday, 3 July 2005.\\nVoters in Mexico's most populous state went to the polls to elect a governor to replace former incumbent Arturo Montiel Rojas of the Institutional Revolutionary Party.\\nThe favorite candidate was PAN's Rubén Mendoza. It was thought the first runner-up would be PRD Yeidckol Polevnsky Gurwitz and last place by PRI's Enrique Peña. However, Rubén Mendoza made several mistakes in his campaign, appearing apparently drunk at events, boasting he led a group of supporters to steal campaign gifts from Peña's team and gave them with his own signature. The PRD would have benefited from this, but Polevnksy had no political experience and support from Andrés Manuel López Obrador wasn't enough, specially after her true identity was discovered. So PRI's Peña rose to the first place, the PRD had a distant and low second place and PAN's Rubén Mendoza disappeared from public view.\\nTurnout was an unusually low 48%."},{"page_url":"https://en.wikipedia.org/wiki/Jack_the_Ripper_suspects","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Walter_Sickert_photo_by_George_Charles_Beresford_1911_%281%29.jpg","page_title":"Jack the Ripper suspects","context_page_description":"A series of murders that took place in the East End of London from August to November 1888 was blamed on an unidentified assailant who was nicknamed Jack the Ripper. Since that time, the identity of the killer or killers has been widely debated, and over 100 Jack the Ripper suspects have been named. Though many theories have been advanced, experts find none widely persuasive, and some are hardly taken seriously at all. Due to the passage of time since the murders took place, the killer will likely never be identified despite the killer's identity continuing to be a hot topic of discussion."},{"page_url":"https://pl.wikipedia.org/wiki/Ahrarne","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Ahrarne_KT_Sport_Arena1.jpg","page_title":"Ahrarne","context_page_description":"Ahrarne – osiedle typu miejskiego w rejonie symferopolskim w Republice Autonomicznej Krymu na Ukrainie."},{"page_url":"https://pl.wikipedia.org/wiki/Szwanidzor","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/%D4%B3%D5%B5%D5%B8%D6%82%D5%B2_%D5%87%D5%BE%D5%A1%D5%B6%D5%AB%D5%B1%D5%B8%D6%80.jpg","page_title":"Szwanidzor","context_page_description":"Szwanidzor – wieś w Armenii, w prowincji Sjunik. W 2011 roku liczyła 312 mieszkańców."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Martin_de_Br%C3%A9vands","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Choeur_de_l%27%C3%A9glise_Saint-Martin_de_Br%C3%A9vands.jpg","page_title":"Église Saint-Martin de Brévands","context_page_description":"L'église Saint-Martin est une église catholique située à Carentan-les-Marais, en France."},{"page_url":"https://hu.wikipedia.org/wiki/Celano","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a6/Castello_Piccolomini_e_Borgo_di_Celano.jpg","page_title":"Celano","context_page_description":"Celano község Olaszország Abruzzo régiójában, L’Aquila megyében."},{"page_url":"https://vo.wikipedia.org/wiki/Cove_City","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/NCMap-doton-CoveCity.PNG","page_title":"Cove City","context_page_description":"Cove City binon zif in komot: Craven, in tat: North Carolina, in Lamerikän."},{"page_url":"https://es.wikipedia.org/wiki/Hiram_Ponce","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Hiram_Ponce_Mexico_City_Youth_Award.jpg","page_title":"Hiram Ponce","context_page_description":"Hiram Eredín Ponce Espinosa es ingeniero, profesor, investigador y científico de datos originario de México.​​ Él es director del laboratorio y cofundador, junto con Roberto Ayala, de SOLARIUM Labs, un centro de investigación y desarrollo tecnológico.​ Actualmente, también es profesor-investigador de tiempo completo en la Universidad Panamericana en México.\\nHiram Ponce, junto con Pedro Ponce Cruz, desarrollaron la técnica “redes orgánicas artificiales”, una técnica de inteligencia artificial inspirada en los compuestos químicos orgánicos.​ En conjunto, ellos implementaron este método en un algoritmo de aprendizaje supervisado denominado “redes de hidrocarburos artificiales”.​​ Entre otros, este nuevo método ha sido aplicado satisfactoriamente en problemas de aprendizaje automático, procesamiento digital de señales y sistemas de control.​​​​\\nEn 2014, Hiram Ponce fue galardonado con el Premio de la Juventud Ciudad de México en la categoría de “Actividades Académicas, Profesionales y Científicas”.​ En 2017 se hizo acreedor del Premio Google a la Investigación en América Latina. Además, es miembro actual del Sistema Nacional de Investigadores.​​"},{"page_url":"https://eo.wikipedia.org/wiki/Stanley_Tucci","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Stanley_Tucci_2010.jpg","page_title":"Stanley Tucci","context_page_description":"Stanley TUCCI naskiĝis la 11-an de novembro 1960 estas usona aktoro, verkisto, kinproduktoro kaj reĝisoro.\\nTucci estis nomumita por Akademia premio pro sia laboro en The Lovely Bones. Li gajnis du Premiojn Emmy pro siaj prezentoj en Winchell kaj Monk. Li estis nomumita por Grammy premio por Best Spoken Word Album por Infanoj, por The One and Only Shrek!."},{"page_url":"https://sq.wikipedia.org/wiki/Flota_Luftarako-Detare_(FLD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/U-Boot-Bunker_an_der_Adria_in_Albanien.jpg","page_title":"Flota Luftarako-Detare (FLD)","context_page_description":"Është emri që mbanin forcat detare të Shqipërisë në periudhën 1945-1991 Inicilalet FLD. Strategjia e organizimit dhe e përdorimit luftarak të FLD synonte detyrën e ruajtjes, dhe të mbrojtjes së ujrave territoriale dhe të bregdetit në bashkëveprim me forcat tokësore dhe aviacionin."},{"page_url":"https://be.wikipedia.org/wiki/%D0%90%D0%BA%D0%BD%D1%96%D1%81%D1%82%D1%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Akniste14.JPG","page_title":"Акністэ","context_page_description":"Акністэ — горад у паўднёвай Латвіі на мяжы з Літвой. Горад знаходзіцца ў гістарычным рэгіёне Селонія. Праз горад цячэ рака Дыенвідсусэя. Насельніцтва горада налічвае 1237 чалавек."},{"page_url":"https://en.wikipedia.org/wiki/Trinitat_Nova_(Barcelona_Metro)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Metro_Barcelona_station_Trinitat_Nova_L4_L11.JPG","page_title":"Trinitat Nova (Barcelona Metro)","context_page_description":"Trinitat Nova is a Barcelona Metro station, named after the nearby La Trinitat Nova neighbourhood, in the Nou Barris district of the city of Barcelona. The station is served by lines L3, L4 and L11.\\nLines L4 and L11 share a single island platform, which is located underneath Carrer Aiguablava. Trains on line L4 enter and leave from the south end of the platform and normally terminate on the eastern side of the platform, whilst trains on line L11 enter and leave from the other end and terminate on the other side of the platform. Line L3 uses a separate 100-metre island platform, situated between Carrer Aiguablava and Carrer Chafarinas. The two platforms are linked by underground passageways.\\nThe first section of the station was opened in 1999, with the extension of L4 from what is now Via Júlia station. Line L11 was opened in 2003, as a light rail extension to line L4, towards Can Cuiàs station and sharing line L4's platforms. Line L3 arrived at Trinitat Nova on 4 October 2008, with its own platforms."},{"page_url":"https://en.wikipedia.org/wiki/Kalabhra_dynasty","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Ancient_tamilakam_ports.png","page_title":"Kalabhra dynasty","context_page_description":"The Kalabhra dynasty, also called Kalabra, Kalappirar, Kallupura or Kalvar were rulers of all or parts of Tamil region sometime between the 3rd century and 6th century CE, after ancient dynasties of early Cholas, early Pandyas and Chera. Information about the origin and reign of the Kalabhras is uncertain and scarce. Their proposed roots vary from southeast region of modern Karnataka, Kalappalars of Vellala community, to Kalavar chieftains. The Kalabhra era is sometimes referred to as the \\"dark period\\" of Tamil history, and information about it is generally inferred from any mentions in the literature and inscriptions that are dated many centuries after their era ended.\\nAccording to Encyclopaedia Britannica, the Kalabhras were largely overthrown in the 5th century, as new power centers led by Chalukyas and Pallavas arose. In contrast, Upinder Singh states that Shivaskandavarman rise in the 4th century, as evidenced by inscriptions, show Kalabhras were not in power at that time near rivers Penner and Vellar."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%A2%9D%E6%96%91%E5%89%8D%E5%AD%94%E9%B2%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Cantherhines_fronticinctus.jpg","page_title":"额斑前孔鲀","context_page_description":"纵带刺鼻单棘鲀，又称纵带前孔鲀、斑刺鼻单棘鲀、额斑前孔鲀，为辐鳍鱼纲鲀形目鳞鲀亚目单棘鲀科的其中一种，分布于印度西太平洋区，从东非、南非至马绍尔群岛海域，栖息深度1-43米，体长可达25公分，栖息在临海礁石区，以底栖性无脊椎动物为食，生活习性不明。"},{"page_url":"https://ja.wikipedia.org/wiki/%E7%99%BD%E7%B1%B3%E5%B1%B1%E5%8F%A4%E5%A2%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Shirageyama_Kofun%2C_funkyu.jpg","page_title":"白米山古墳","context_page_description":"白米山古墳は、京都府与謝郡与謝野町後野にある古墳。形状は前方後円墳。国の史跡に指定されている。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9E%E3%82%BF%E3%82%BF%E3%83%93%E5%B1%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Actinidia-kolomikta.JPG","page_title":"マタタビ属","context_page_description":"マタタビ属は、植物の分類群のひとつ。マタタビ科に属する。"},{"page_url":"https://de.wikipedia.org/wiki/Acker-Ziest","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Stachys_arvensis_vallee-de-grace-amiens_05082007_3.jpg","page_title":"Acker-Ziest","context_page_description":"Der Acker-Ziest ist eine Pflanzenart aus der Gattung Zieste in der Familie der Lippenblütler."},{"page_url":"https://zh.wikipedia.org/zh-my/%E5%88%9B%E6%96%B0%E7%A7%91%E6%8A%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f1/Creative_Sound_Blaster_Audigy_SB0090.jpg","page_title":"创新科技","context_page_description":"创新科技有限公司，是新加坡电脑多媒体制造商，1981年7月1日由新加坡企业家沈望傅创立。创新科技在世界其他地区的分部称为Creative Labs, Inc.；在台湾曾用中文译名“创巨科技”，之后改成“创新未来”。创新科技自成立以来陆续并购了Ensoniq、E-MU Systems、Cambridge SoundWorks、Aureal、3DLABS、Ectiva、Share Vision、Digicom与Silicon Engineering等公司。\\n创新科技最为著名的是自1989年推出的Sound Blaster系列声卡，现时主要产品为声卡、电脑用多媒体音箱、耳机及便携蓝牙音箱。\\n创新科技也跟主板制造商和笔记型电脑品牌合作，将Sound Blaster技术内置在它们的产品上。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_fish_in_Ukraine","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Tinca_tinca_Prague_Vltava_3.jpg","page_title":"List of fish in Ukraine","context_page_description":"The list of fish in Ukraine consists of indigenous, and also introduced species.\\nThese tags are used to evaluate the conservation status of species by criteria of IUCN:\\nAll the listed species are classified by their origin as freshwater, brackishwater, marine, anadromous, catadromous, and euryhaline; also classified as native, introduced, invasive, and species with accidental finding."},{"page_url":"https://en.wikipedia.org/wiki/Listed_buildings_in_Claughton,_Merseyside","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/10_%26_12_Forest_Road%2C_Claughton_2.jpg","page_title":"Listed buildings in Claughton, Merseyside","context_page_description":"Claughton is a suburb of Birkenhead, Wirral, Merseyside, England. It contains 25 buildings that are recorded in the National Heritage List for England as designated listed buildings, all of which are listed at Grade II. This grade is the lowest of the three gradings given to listed buildings and is applied to \\"buildings of national importance and special interest\\". The suburb is entirely residential, and was initially laid out for Sir William Jackson by Charles Reed in the 1840s and 1850s. Most of the listed buildings are houses from this development. The other listed buildings include a church, an art gallery and museum, a school, and two pillar boxes."},{"page_url":"https://es.wikipedia.org/wiki/St%C4%9Bbo%C5%99ice","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/St%C4%9Bbo%C5%99ice_CoA.jpg","page_title":"Stěbořice","context_page_description":"Stěbořice es una localidad del distrito de Opava en la región de Moravia-Silesia, República Checa, con una población estimada a principio del año 2018 de 1452 habitantes.\\nSe encuentra ubicada en el centro de la región, en la zona este de los Sudetes orientales, a poca distancia del curso alto del río Óder, y cerca de la frontera con Polonia y la región de Olomouc.​"},{"page_url":"https://ast.wikipedia.org/wiki/Phaethon_aethereus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/PhaethonIndicusSmit.jpg","page_title":"Phaethon aethereus","context_page_description":"Phaethon aethereus ye una especie d'ave fetontiforme, una de les aves marines qu'habiten los mares tropicales."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9C%D0%B0%D1%82%D0%B5%D1%80%D0%B8%D1%86%D0%B0_(%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/North_Macedonia_relief_location_map.jpg","page_title":"Материца (Владимирово)","context_page_description":"Материца — градиште од доцноантичкото време. Се наоѓа на висок рид со доминантна положба над околината, со зарамнето плато на кое се гледаат остатоци од бедемот, а на површината има фрагменти од питоси, покривни ќерамиди и градежен материјал."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A3%D0%BB%D1%80%D0%B8%D0%BA%D0%B5_%D0%94%D1%80%D0%B5%D0%B7%D0%BD%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Draesner_Kugelblitz.jpg","page_title":"Улрике Дрезнер","context_page_description":"Улрике Дрезнер е германска поетеса, белетристка, есеистка, преводачка и автор на радиопиеси. Родена е в Мюнхен в семейството на архитект."},{"page_url":"https://es.wikipedia.org/wiki/Lupanar_(Pompeya)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Pompeya_interior_del_lupanar.jpg","page_title":"Lupanar (Pompeya)","context_page_description":"El Lupanar de Pompeya es el burdel más famoso de la ciudad romana de Pompeya. Es de particular interés por las pinturas eróticas en sus paredes. Lupanar era la palabra latina para \\"burdel\\". El lupanar de Pompeya también se conoce como \\"Lupanar Grande\\"."},{"page_url":"https://en.wikipedia.org/wiki/Rumex_patientia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Rumex_X_patientia_Sturm55.jpg","page_title":"Rumex patientia","context_page_description":"Rumex patientia, known as patience dock, garden patience, herb patience, or monk's rhubarb, is a herbaceous perennial plant species of the genus Rumex, belonging to the family Polygonaceae. In spring it is often consumed as a leaf vegetable in Southern Europe, especially in Bulgaria, North Macedonia and Serbia. It is also used in Romania in spring broths or sarmale."},{"page_url":"https://id.wikipedia.org/wiki/Notting_Hill_Gate_(London_Underground)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/NottingHillGate.jpg","page_title":"Notting Hill Gate (London Underground)","context_page_description":"Notting Hill Gate adalah sebuah stasiun London Underground di jalan Notting Hill Gate. Terletak di Jalur Central, stasiun ini terletak antara Holland Park di sebelah barat dan Queensway di sebelah timur. Di Jalur Distrik dan Jalur Lingkar, stasiun ini terletak antara High Street Kensington dan Bayswater. Notting Hill Gate berada dalam Zona Travelcard 1 dan 2."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Menhire_in_Rheinland-Pfalz","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Menhir_von_Pirmasens.jpg","page_title":"Liste der Menhire in Rheinland-Pfalz","context_page_description":"Die Liste der Menhire in Rheinland-Pfalz umfasst alle bekannten Menhire auf dem Gebiet des heutigen Bundeslandes Rheinland-Pfalz."},{"page_url":"https://es.wikipedia.org/wiki/H._F._Baker","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Henry_Frederick_Baker.jpg","page_title":"H. F. Baker","context_page_description":"Henry Frederick Baker FRS​ FRSE fue un matemático británico que trabajó principalmente en geometría algebraica. También es recordado por sus contribuciones a las ecuaciones en derivadas parciales, y a los grupos de Lie.​"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Montfoort_(plaats)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Montfoort.jpg","page_title":"Lijst van rijksmonumenten in Montfoort (plaats)","context_page_description":"De plaats Montfoort telt 25 inschrijvingen in het rijksmonumentenregister. Hieronder een overzicht."},{"page_url":"https://hy.wikipedia.org/wiki/Theatrum_Pictorium","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Vincenzo_Catena_010.jpg","page_title":"Theatrum Pictorium","context_page_description":"Theatrum Pictorium կամ Նկարի թատրոն, 1660-ական թվականներին Դավիդ Կրտսեր Տենիրսի կողմից էրցհերցոգ Լեոպոլդ Վիլհելմ Ավստրիացու համար հրատարակված գրքի սղագրություն: Այն էրցհերցոգի 1300 նկարներ պարունակող հավաքածուից 243 իտալական նկարներ ներառող կատալոգ է, որն ստեղծվել է Տենիրսի ստեղծած փոքր մոդելներից: Գրքի համարակալված երկրորդ հրատարակչությունը լույս է տեսել 1673 թվականին:\\n1646-1656 թվականներին Լեոպոլդ Վիլհելմը Նիդեռլանդների կառավարիչն էր: Նա ձևավորեց իր ժամանակների լավագույն արվեստի հավաքածուներից մեկը: 1651 թվականին Յան վան դեն Հեսկեի մահից հետո Տենիրսը դարձավ այդ հավաքածուի համադրողը: Լեոպոլդ Վիլհելմի հավաքածուն ներառում էր Հանս Հոլբայն Ավագի, Պիտեր Բրեյգել Ավագի, Յան վան Էյքի, Ռաֆայել Սանտիի, Ջորջոնեի, Պաոլո Վերոնեզեի աշխատանքները, ինչպես նաև Տիցիանի 15 կտավներ: Տենիրսը կազմեց հավաքածուի նկարիչների ցուցակը որպես իր 1673 կատալոգի մաս."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%B8%D6%82%D5%AC%D5%BF%D5%AB%D5%B4%D5%A5%D5%A4%D5%AB%D5%A1_%D5%A1%D6%80%D5%BE%D5%A5%D5%BD%D5%BF%D5%AB_%D5%A9%D5%A1%D5%B6%D5%A3%D5%A1%D6%80%D5%A1%D5%B6_(%D5%84%D5%B8%D5%BD%D5%AF%D5%BE%D5%A1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Moscow%2C_Ostozhenka_16_destroyed_June_2009_01.JPG","page_title":"Մուլտիմեդիա արվեստի թանգարան (Մոսկվա)","context_page_description":"Մոսկվայի Մուլտիմեդիա արվեստի թանգարան, ռուսական պետական թանգարան\` նվիրված նոր մուլտիմեդիա տեխնոլոգիաների հետ կապված ժամանակակից արվեստի ներկայացմանն ու զարգացմանը: Թանգարանը բացվել է 2010 թվականի հոկտեմբերին, Մոսկվայի լուսանկարչական տան հիմքի վրա:"},{"page_url":"https://vi.wikipedia.org/wiki/T%E1%BB%89nh_tr%C6%B0%E1%BB%9Fng_Ch%C3%ADnh_ph%E1%BB%A7_Nh%C3%A2n_d%C3%A2n_t%E1%BB%89nh_S%C6%A1n_%C4%90%C3%B4ng","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/74/Shandong_in_China.svg","page_title":"Tỉnh trưởng Chính phủ Nhân dân tỉnh Sơn Đông","context_page_description":"Tỉnh trưởng Chính phủ Nhân dân tỉnh Sơn Đông được bầu cử bởi Đại hội Đại biểu nhân dân tỉnh Sơn Đông, lãnh đạo bởi thành viên của Đảng Cộng sản Trung Quốc. Cán bộ, công chức lãnh đạo, là Tỉnh trưởng Chính phủ Nhân dân tỉnh Sơn Đông có cấp bậc Bộ trưởng, thường là Ủy viên Ủy ban Trung ương Đảng Cộng sản Trung Quốc các khóa. Tỉnh trưởng Chính phủ Nhân dân là lãnh đạo thứ hai của tỉnh, đứng sau Bí thư Tỉnh ủy. Tỉnh trưởng Chính phủ Nhân dân tỉnh Sơn Đông đồng thời là Phó Bí thư Tỉnh ủy tỉnh Sơn Đông.\\nTrong lịch sử Cộng hòa Nhân dân Trung Hoa, chức vụ Tỉnh trưởng Chính phủ Nhân dân tỉnh Sơn Đông có các tên gọi là Chủ tịch Chính phủ Nhân dân tỉnh Sơn Đông, Tỉnh trưởng Ủy ban Nhân dân tỉnh Sơn Đông, Chủ nhiệm Ủy ban Quân Giải phóng Nhân dân Trung Quốc Kiểm soát tỉnh Sơn Đông, Chủ nhiệm Ủy ban Cách mạng tỉnh Sơn Đông, và Tỉnh trưởng Chính phủ Nhân dân tỉnh Sơn Đông. Tất cả các tên gọi này dù khác nhau nhưng cùng có ý nghĩa là Thủ trưởng Hành chính tỉnh Sơn Đông, tức nghĩa Tỉnh trưởng Chính phủ Nhân dân tỉnh Sơn Đông hiện nay.\\nTỉnh trưởng Chính phủ Nhân dân tỉnh Sơn Đông hiện tại là Lý Cán Kiệt."},{"page_url":"https://gl.wikipedia.org/wiki/Abando","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Abando.svg","page_title":"Abando","context_page_description":"Abando é un distrito da cidade de Bilbao, capital da provincia vasca de Biscaia. Divídese nos barrios de Abando e Indautxu.\\nFoi un antigo elizate e municipio da provincia de Biscaia, tiña o asento e voto 34 nas Xuntas Xerais de Biscaia."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%95%D0%BB%D1%8C%D0%B7%D0%B0_%D0%92%D1%8E%D1%80%D1%82%D0%B5%D0%BC%D0%B1%D0%B5%D1%80%D0%B7%D1%8C%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Alexander_Brullov_07.jpeg","page_title":"Ельза Вюртемберзька","context_page_description":"Ельза Матильда Марія Вюртемберзька, — герцогиня Вюртемберзька з Вюртемберзького дому, донька герцога Вюртемберзького Ойгена та російської великої княжни Віри Костянтинівни, дружина принца Шаумбург-Ліппе Альбрехта."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A1%AF%ED%8F%B0%EA%B8%B0_%ED%9E%90%EC%8A%A4_%EB%AA%A8%EB%A6%AC_%ED%83%80%EC%9B%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/80/Roppongi_Hills_Mori_Tower_from_Tokyo_Tower_Day_cropped.jpg","page_title":"롯폰기 힐스 모리 타워","context_page_description":"롯폰기 힐스 모리 타워는 도쿄도 미나토구에 있는 복합 시설 롯폰기 힐스의 핵심을 담당하는 초고층 빌딩이다. 지상 54층, 238m로 도쿄에서는 미드타운 타워, 도쿄 도청, 선샤인 60 다음으로 높은 빌딩이다."},{"page_url":"https://nl.wikipedia.org/wiki/Porsche","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Porsche_race_car_Kentenich09_amk.jpg","page_title":"Porsche","context_page_description":"Dr. Ing. h.c. F. Porsche AG is een Duits fabrikant van sportauto's, opgericht in 1931 door Ferdinand Porsche, tevens de ontwerper van de eerste Volkswagen. Het bedrijf is gevestigd in Zuffenhausen, onder de rook van Stuttgart. Tegenwoordig is het bedrijf in handen van Volkswagen dat weer grotendeels in handen is van Porsche SE.\\nEr is nog een ander bedrijf genaamd Porsche Consulting GmbH. Dit bedrijf heeft vele jaren zijn diensten aangeboden aan andere autoproducenten. Studebaker, Seat, Lada, Daewoo en Subaru hebben allen gebruikgemaakt van de kennis van Porsche voor het ontwikkelen van hun auto's.\\nHet hoofdkantoor en de fabriek zijn gevestigd in Zuffenhausen, maar voor de Cayenne en Carrera GT is een nieuwe fabriek gebouwd in Leipzig. Een gedeelte van de Boxster productie werd bij Valmet Automotive in Finland gedaan.\\nPorsche verkocht in 2017 246.375 auto's met een gemiddeld winstpercentage van 17,6%."},{"page_url":"https://hu.wikipedia.org/wiki/R%C3%A9stekn%C5%91s","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Malacochersus_tornieri_-_Buffalo_Zoo.jpg","page_title":"Résteknős","context_page_description":"A résteknős a hüllők osztályába és a teknősök rendjébe és a szárazföldi teknősfélék családjába tartozó faj."},{"page_url":"https://it.wikipedia.org/wiki/Corpo_forestale_e_di_vigilanza_ambientale","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Assistente_capo_del_cfs.png","page_title":"Corpo forestale e di vigilanza ambientale","context_page_description":"Il Corpo forestale e di vigilanza ambientale, è un corpo di polizia locale, per la tutela dell'ambiente naturale sia terrestre che marittimo operante nella Regione Sardegna.\\nIstituito con la legge regionale 5 novembre 1985, n.26, è struttura operativa dell'Assessorato della difesa dell'ambiente della Regione Sardegna."},{"page_url":"https://es.wikipedia.org/wiki/Nilgiritragus_hylocrius","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Nilgiri_Tahr.jpg","page_title":"Nilgiritragus hylocrius","context_page_description":"El tahr del Nilgiri es una especie de mamífero artiodáctilo de la subfamilia Caprinae propio de la región suroccidental de la India, principalmente en el Parque Nacional de Eravikulam."},{"page_url":"https://pt.wikipedia.org/wiki/Luciferianismo","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Lucifer_Liege_Luc_Viatour_new.jpg","page_title":"Luciferianismo","context_page_description":"O luciferianismo é uma doutrina esotérica e gnóstica, filosófica no caso de ordens secretas e, em alguns casos, religiosa como em algumas religiões minoritárias da atualidade, baseada na figura de Lúcifer, que por sua vez é considerado como portador da Luz do intelecto. O luciferianismo em geral renega o satanismo e garante que Lúcifer e Satanás não são a mesma entidade, no entanto, algumas organizações satânicas se consideram luciferianas.\\nDivide-se em luciferianismo tradicional ou teísta e luciferianismo simbólico ou agnóstico."},{"page_url":"https://it.wikipedia.org/wiki/Newbury_(Vermont)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Newbury_VT_Town_Office.jpg","page_title":"Newbury (Vermont)","context_page_description":"Newbury è un comune degli Stati Uniti d'America, situato nello Stato del Vermont e in particolare nella contea di Orange."},{"page_url":"https://es.wikipedia.org/wiki/Natalio_Pescia","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Boca_1944_2.jpg","page_title":"Natalio Pescia","context_page_description":"Natalio Agustín Pescia fue un futbolista argentino que se desempeñaba en la posición de mediocampista por izquierda.\\nSurgido de las inferiores de Boca Juniors, desarrolló su carrera como profesional en las décadas de 1940 y de 1950 para el Club Atlético Boca Juniors, el cual fue su único club a lo largo de toda su trayectoria.​\\nAdemás fue internacional con la Selección Argentina en numerosas oportunidades y llegó a consagrarse un total de 3 veces en la Copa América.\\nObtuvo 7 títulos con el equipo «xeneize», entre los cuales se destacan 3 campeonatos de primera división, además de dos copas nacionales, que incluyen una Copa de Competencia Británica y una Copa Carlos Ibarguren, además de 2 Copa de Confraternidad Escobar - Gerona, de carácter internacional y organizadas por la AFA y la AUF.\\nFormó parte de una línea media que quedó en la historia del «xeneize» y del fútbol argentino en general. Dicho mediocampo lo integraba con sus compañeros de equipo Carlos Adolfo Sosa y Ernesto Lazzatti, siendo los tres símbolos de un equipo que desplegó un juego basado en el fútbol elegante que desplegaban y en su coraje a la hora de disputar los partidos."},{"page_url":"https://pl.wikipedia.org/wiki/Marin_Cureau_de_La_Chambre","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/05/Marin_Cureau_de_la_Chambre.jpg","page_title":"Marin Cureau de La Chambre","context_page_description":"Marin Cureau de La Chambre – francuski fizyk oraz filozof."},{"page_url":"https://hu.wikipedia.org/wiki/X_Japan","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/12/X_Japan_20100704_Japan_Expo_32.jpg","page_title":"X Japan","context_page_description":"Az X Japan japán heavy metal együttes, melyet 1982-ben alapított Csiba prefektúrában a dobos Yoshiki és az énekes Toshi. A szimfonikus elemekkel kevert power és speed metal zenét játszó együttes később a progresszív hangzás felé fordult és nagyobb hangsúlyt fektetett a rockballadákra. Az együttes úgy ért el mainstream sikereket, hogy független kiadónál volt, és őket tartják a nyugati glamhez hasonló visual kei műfaj egyik úttörőjének.\\nAz együttes eredeti neve X volt, 1988-ban adták ki első lemezüket, a Vanishing Visiont, a Yoshiki által alapított Extasy Recordsnál, egy évvel azután, hogy véglegessé vált a felállásuk, a basszusgitáros Taiji, és a két gitáros, hide és Pata csatlakozásával. 1989-ben jelent meg második albumuk, első nagykiadós lemezük, a Blue Blood, mely meghozta számukra az áttörést. Az 1991-es Jealousy albumuk megjelenése után Taiji kilépett az együttesből, helyét Heath vette át, az együttes pedig X-ről X Japanre változtatta a nevét. 1993-ban egy 29 perces, egyetlen dalból álló minialbumot adtak ki Art of Life címmel. 1995-ben az együttes imázst váltott, elhagyták a visual keire jellemző harsány külsőt. 1996-ban megjelent a Dahlia című lemezük."},{"page_url":"https://ru.wikipedia.org/wiki/Massey_Ferguson_35","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Three-point_linkage_and_tow_hitch_implement%2C_Ferguson_TEF%2C_Abergavenny.jpg","page_title":"Massey Ferguson 35","context_page_description":"Massey Ferguson 35 — трактор производства Massey Ferguson."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D0%BB%D0%B8_%D0%BF%D0%B0%D1%88%D0%B0_%D0%AF%D0%BD%D0%B8%D0%BD%D1%81%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Ali_Pashas_Grave_%28Medium%29.JPG","page_title":"Али паша Янински","context_page_description":"Али паша Тепелена или Али паша Янински е османски военен и политически деец."},{"page_url":"https://et.wikipedia.org/wiki/Rakvere_muusikakool","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Rakvere_muusikakool.jpg","page_title":"Rakvere muusikakool","context_page_description":"Rakvere muusikakool on muusikakool Lääne-Viru maakonnas Rakveres aadressil Carl Robert Jakobsoni tänav 8.\\nKool asutati 19. märtsil 1945 Rakvere muusikaalgkoolina. 1949 nimetati kool ümber Rakvere lastemuusikakooliks. 1991 nimetati kool ümber Rakvere muusikakooliks.\\nAastast 2002 on kooli direktor Toivo Peäske."},{"page_url":"https://fr.wikipedia.org/wiki/Parc_national_de_Kanger_Ghati","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Kanger_valley3.JPG","page_title":"Parc national de Kanger Ghati","context_page_description":"Le Parc national de Kanger Ghati est situé dans l'État du Chhattisgarh en Inde."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D0%BE%D0%B3%D0%BE%D0%BB%D0%B5%D0%BD%D0%B4%D1%81%D1%8C%D0%BA%D0%B0_%D0%BA%D0%B0%D0%BC%D0%BF%D0%B0%D0%BD%D1%96%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Kamina_Tranmitter.jpg","page_title":"Тоголендська кампанія","context_page_description":"Тоголендська кампанія — короткочасна військова кампанія з вторгнення франко-британських військ на територію німецької африканської колонії Тоголенд, що тривала на заході Африканського континенту за часів Першої світової війни.\\nНімецькі колоніальні війська відступили зі столиці міста Ломе та прибережних провінцій, де стояли гарнізонами, на північ до Каміна. Поблизу цього населеного пункту, центру телеграфного зв'язку між Берліном та німецькою колонією, а також Південною Америкою, розігралися основні події цього конфлікту. Невеликі сутички сталися поблизу Агбелювгое та Чра. Але вже 26 серпня німецькі війська капітулювали союзникам.\\nПісля завершення світового конфлікту, у липні 1922 року, колишня німецька колонія була перетворена на мандат Ліги Націй, та стала Британським та Французьким Того."},{"page_url":"https://en.wikipedia.org/wiki/Charles_Montagu_Doughty","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Charles_Montagu_Doughty.jpg","page_title":"Charles Montagu Doughty","context_page_description":"Charles Montagu Doughty was an English poet, writer, explorer, adventurer and traveller born in Theberton Hall near Saxmundham, Suffolk and educated at private schools in Laleham and Elstree, and at a school for the Royal Navy, Portsmouth. He was a student at King's College London, eventually graduating from Gonville and Caius College, Cambridge in 1864.\\nHe was the father of Freda and Dorothy Doughty.\\nHe is best known for his 1888 travel book Travels in Arabia Deserta, a work in two volumes that, although it had little immediate influence upon its publication, slowly became a kind of touchstone of ambitious travel writing, one valued as much for its language as for its content. T. E. Lawrence rediscovered the book and caused it to be republished in the 1920s, contributing an admiring introduction of his own. Since then, the book has gone in and out of print.\\nThe book is a vast recounting of Doughty's treks through the Arabian deserts, and his discoveries there. It is written in an extravagant and mannered style, largely based on the King James Bible but constantly surprising with verbal turns and odd inventiveness."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Berlin-Mitte/Oranienburger_Vorstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Berlin%2C_Mitte%2C_Gartenstrasse_5%2C_Stadtbad_Mitte.jpg","page_title":"Liste der Kulturdenkmale in Berlin-Mitte/Oranienburger Vorstadt","context_page_description":"Auf dieser Seite sind die Kulturdenkmale im Stadtviertel Oranienburger Vorstadt im Berliner Ortsteil Mitte aufgelistet. Diese Liste ist Teil der Liste der Kulturdenkmale in Berlin-Mitte. Grundlage ist die Denkmalliste des Landes Berlin, die auf Basis des Berliner Denkmalschutzgesetzes erstmals am 28. September 1995 bekannt gemacht wurde und seither durch das Landesdenkmalamt Berlin geführt und aktualisiert wird."},{"page_url":"https://de.wikipedia.org/wiki/Burg_Hauenstein_(Seis_am_Schlern)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Burgruine_Hauenstein_in_Seis_von_Norden.jpg","page_title":"Burg Hauenstein (Seis am Schlern)","context_page_description":"Die Burg Hauenstein ist die Ruine einer im 12. Jahrhundert erstmals erwähnten Höhenburg oberhalb des Dorfes Seis am Schlern, einer Fraktion der Marktgemeinde Kastelruth in Südtirol."},{"page_url":"https://en.wikipedia.org/wiki/Tampa_Bay_Rays","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/TBRays_retired66.png","page_title":"Tampa Bay Rays","context_page_description":"The Tampa Bay Rays are an American professional baseball team based in St. Petersburg, Florida. They compete in Major League Baseball as a member of the American League East division. Since its inception, the team's home venue has been Tropicana Field.\\nFollowing nearly three decades of unsuccessfully trying to gain an expansion franchise or enticing existing teams to relocate to the Tampa Bay Area, an ownership group led by Vince Naimoli was approved on March 9, 1995. The Tampa Bay Devil Rays began play in the 1998 Major League Baseball season.\\nTheir first decade of play, however, was marked by futility; they finished in last place in the AL East in all but the 2004 season, when they finished second to last. Following the 2007 season, Stuart Sternberg, who had purchased controlling interest in the team from Vince Naimoli two years earlier, changed the team's name from \\"Devil Rays\\" to \\"Rays\\", now meant to primarily refer to a burst of sunshine rather than a manta ray, though a manta ray logo remains on the uniform sleeves."},{"page_url":"https://fr.wikipedia.org/wiki/Aluche","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/ParqueAluche.jpg","page_title":"Aluche","context_page_description":"Aluche est un quartier administratif de la ville de Madrid qui appartient au district de Latina. Il tient son nom du ruisseau Luche, dont le cours passait sur son territoire actuel."},{"page_url":"https://en.wikipedia.org/wiki/Atocha_(Madrid)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Arganzuela.jpg","page_title":"Atocha (Madrid)","context_page_description":"Atocha is a central ward of Madrid belonging to the district of Arganzuela."},{"page_url":"https://pl.wikipedia.org/wiki/Centrum_Spotkania_Kultur_w_Lublinie","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Akt_erekcyjny_Teatru_w_Budowie.jpg","page_title":"Centrum Spotkania Kultur w Lublinie","context_page_description":"Centrum Spotkania Kultur – instytucja kultury w Lublinie. Budowa siedziby CSK rozpoczęła się w 1974, a jej uroczyste zakończenie miało miejsce 22 listopada 2015."},{"page_url":"https://en.wikipedia.org/wiki/List_of_places_of_worship_in_Horsham_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Henfield_C_of_E_parish_church.JPG","page_title":"List of places of worship in Horsham District","context_page_description":"There are more than 110 current and former churches and other places of worship in the district of Horsham, one of seven local government districts in the English county of West Sussex. The town of Horsham, the district's administrative centre, has 86 places of worship in use as of 2020, and a further 27 closed churches which, although still standing, are no longer in religious use. The area has a long history of Christian worship, in both the main population centres and the surrounding villages and hamlets. Many Anglican churches are of Anglo-Saxon or Norman architecture. Roman Catholic places of worship include chapels within convents and priories, including England's only Carthusian monastery, as well as modern churches. Protestant Nonconformity has been well established since the 17th century. Plymouth Brethren are well represented in the north of the district; Baptists, Methodists and United Reformed Church worshippers have many churches; William Penn lived and preached in the area, which still has a strong Quaker presence; and one of eight chapels belonging to a now vanished local sect, the Society of Dependants, still stands at Warnham."},{"page_url":"https://es.wikipedia.org/wiki/Ford_Falcon_(Australia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/1980_Ford_Fairmont_%28XD%29_sedan_%282012-02-12%29.jpg","page_title":"Ford Falcon (Australia)","context_page_description":"El Ford Falcon es un automóvil de turismo del segmento E fabricado en varias versiones desde 1960 por Ford Australia en la planta de ensamblaje de Broadmeadows, un suburbio en las afueras del norte de Melbourne, Victoria (Australia).​\\nCada modelo de la serie XA de 1972 en adelante ha sido diseñado, desarrollado y construido en Australia, tras la eliminación gradual del Falcon estadounidense de 1960-71, que había sido re-diseñados a nivel local para las condiciones más duras de Australia. Como resultado de la longevidad de su producción en Australia, el Falcon es uno de los nombres más importantes de venta en el mundo de la historia del automóvil, vendiendo más de 3.000.000 en seis generaciones al año 2003, casi exclusivamente en Australia y Nueva Zelanda. A partir de julio de 2007, Ford vende más de 3.000 unidades por mes.​\\nFord ha fabricado más de tres millones de unidades desde 1960 y ha encabezado las listas de ventas en Australia en muchas ocasiones. Actualmente, la línea Falcon está disponible en el sedán, rural, camioneta, y furgoneta, sin embargo en el pasado se ofreció cupés sin parantes."},{"page_url":"https://pl.wikipedia.org/wiki/Kunaszyr","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Kunashir_topomap.png","page_title":"Kunaszyr","context_page_description":"Kunaszyr – wyspa w archipelagu Kuryli. Cieśnina Kunaszyrska oddziela ją od japońskiej wyspy Hokkaido. Jest to jedna z wysp stanowiących przedmiot sporu między Rosją i Japonią."},{"page_url":"https://tr.wikipedia.org/wiki/Osteoglossiformes","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Arapaima_gigas.jpg","page_title":"Osteoglossiformes","context_page_description":"Osteoglossiformes, \\"kemikli dilliler\\" anlamına gelen bilimsel adının nedeni, bu takıma ait balıkların dillerinin kısmen kemikleşmiş olması ve dillerinde dişler bulunmasından kaynaklanmaktadır.\\nBu takıma ait balıkların bugün Afrika'nın, Güney Amerika'nın ve Avustralya'nın tatlısularında bulunan üyeleri, çok eski zamanlarda dünyaca yaygın olan bir takım olduklarını gösteren kanıtlardır. Tebeşir çağında çok yaygın olmuş oldukları, ve hatta Eozän çağında Avrupa'da bile türleri bulunmuş olduğu bilinir.\\nTakımın en büyük ailesi 200 türü ile fil balıklarıdır. Diğer ailelerin sadece birkaç türleri vardır. Dünyanın en büyük tatlısu balıklarından birisi olan Arapaima gigas'da büyük nil balıkları ailesine aittir.\\nOsteoglossiformes takımina ait balıklar dünyada büyük bir coğrafyaya dağılmışlardır. Ama Kelebek balığı ve fil balıkları sadece Afrika'da ve Notopteridae ailesine ait balıklar sadece Afrika ve Asya'da bulunurlar. Takıma adlarını vermiş olan asıl Kemikli dilliler her kıtada bulunurlar.\\nBu takıma ait balıkların çoğunun yumurtalarına sahip çıkma ve yavrularına bakma alışkanlıkları yoktur."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9E%D1%84%D1%96%D1%86%D1%96%D0%B9%D0%BD%D0%B8%D0%B9_%D0%BF%D0%B5%D1%80%D0%B5%D0%BB%D1%96%D0%BA_%D1%80%D0%B5%D0%B3%D1%96%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE_%D1%80%D1%96%D0%B4%D0%BA%D1%96%D1%81%D0%BD%D0%B8%D1%85_%D1%82%D0%B2%D0%B0%D1%80%D0%B8%D0%BD_%D0%A5%D0%B0%D1%80%D0%BA%D1%96%D0%B2%D1%81%D1%8C%D0%BA%D0%BE%D1%97_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Silpha.tristis.jpg","page_title":"Офіційний перелік регіонально рідкісних тварин Харківської області","context_page_description":"Перший Перелік регіонально рідкісних видів тварин для Харківської області був затверджений рішенням Харківської обласної ради від 25 вересня 2001 р.\\nУ 2012 році за ініціативи вчених Харківського національного університету ім. Каразіна був складений новий «Перелік видів тварин, які підлягають особливій охороні на території Харківської області» з огляду на останнє видання Червоної книги України, міжнародні переліки рідкісних тварин та зміни, що відбулися у фауні регіону. До регіонального «Переліку» були включені ті види тварин, які постійно або тимчасово перебувають у природних умовах на території Харківської області та занесені до Червоної книги України, не занесені до Червоної книги України, але є рідкісними для Харківської області або перебувають під загрозою зникнення, занесені до Червоного списку Міжнародного союзу охорони природи, Європейського червоного списку, а також ті, що підпадають під дію міжнародних конвенцій, ратифікованих Україною. У порівнянні з попередніми подібними переліками, з «Переліку» 2012 року було виведено види, що наразі відсутні на території області або, за даними ретельних обліків, можуть вважатися такими, що не перебувають під загрозою зникнення."},{"page_url":"https://ta.wikipedia.org/wiki/2-%E0%AE%86%E0%AE%AE%E0%AF%8D_%E0%AE%A8%E0%AF%82%E0%AE%B1%E0%AF%8D%E0%AE%B1%E0%AE%BE%E0%AE%A3%E0%AF%8D%E0%AE%9F%E0%AF%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Hadrian%27s_wall_at_Greenhead_Lough.jpg","page_title":"2-ஆம் நூற்றாண்டு","context_page_description":"2ம் நூற்றாண்டு என்ற காலப்பகுதி ஜூலியன் நாட்காட்டியின் படி கிபி 101 தொடக்கம் கிபி 199 வரையான காலப்பகுதியை குறிக்கிறது. இக்காலப் பகுதி தொன்முறை யுகமாகக் கருதப்படுகிறது.\\nஇந்நூற்றாண்டின் ஆரம்பத்தில், ரோமப் பேரரசு அதன் பேரரசன் திராசானின் ஆட்சியின் கீழ் மிகப்பெரும் வளர்ச்சியைக் கண்டிருந்தது. ஆனாலும் திராசானின் மறைவிற்குப் பின்னர் அதன் மிகுதியான வரலாறு வெறுமனே ஆட்சியைக் காப்பாற்றும் வகையிலான நடவடிக்கைகளிலேயே ஈடுபட்டிருந்தது. இக்காலப்பகுதியில் ஏட்ரியன் என்பவனின் ஆட்சியில் ஜெருசலேமில் இருந்து யூதர்கள் வெளியேற்றப்பட்டனர். இரண்டாம் நூற்றாண்டின் கடைசிப் பகுதியில் மார்க்கசு அவுரேலியசு என்ற ரோமப் பேரரசனின் இறப்புக்குப் பின்னர் அமைதி மற்றும் செழுமையான காலப்பகுதி மறைய ஆரம்பித்தது.\\nசீனா கான் வம்சத்தினரின் ஆட்சியின் கீழ் தொடர்ந்து இருந்து வந்தது. இந்நூற்றாண்டின் முதல் அரைப்பகுதியில் நடு ஆசியாவில் சீனா தனது ஆதிக்கத்தைப் பரவலாக்கியது. ஆனாலும் இரண்டாம் அரைப்பகுதியில் ஊழல், மற்றும் கிளர்ச்சி காரணமாக இவ்வாட்சி ஆட்டம் காணத் தொடங்கியது. முடிவில் கிபி 220 ஆம் ஆண்டில் ஹான் ஆட்சி முடிவுக்கு வந்தது."},{"page_url":"https://pt.wikipedia.org/wiki/Acrot%C3%ADri_(Santorini)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Map_Akrotiri_1600_BC-en.png","page_title":"Acrotíri (Santorini)","context_page_description":"Acrotíri é um sítio arqueológico da Idade do Bronze da ilha grega de Santorini, associado com a Civilização Minoica devido a inscrições em Linear A, e semelhanças nos estilos de artefatos e afrescos. Seu nome deriva de uma aldeia moderna de mesmo nome localizada numa colina próxima. Afrescos, cerâmica, móveis, avançados sistemas de drenagem e edifícios de três andares foram descobertos no sítio, cuja escavação foi iniciada em 1967 por Spyridon Marinatos.\\nAcrotíri foi enterrado pela erupção do vulcão Tera durante o milênio II a.C.; como resultado, está muito bem preservado. Alguns historiadores sustentam que o desastre ocorrido com este assentamento tenha sido a inspiração para a história platônica de Atlântida.\\nUm ambicioso telhado moderno, destinado a proteger o local, desabou pouco antes de sua conclusão em 2005, matando um visitante; não foram registrados danos às antiguidades. Como consequência o sítio foi fechado para visitantes; desde abril de 2012 o sítio está novamente aberto ao público."},{"page_url":"https://ro.wikipedia.org/wiki/Biserica_Sf%C3%A2ntul_Gheorghe_din_Dr%C4%83gu%C8%99eni","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Biserica_Sf._Gheorghe_din_Draguseni12.jpg","page_title":"Biserica Sfântul Gheorghe din Drăgușeni","context_page_description":"Biserica Sfântul Gheorghe din Drăgușeni a fost construită în anul 1815 în satul Drăgușeni din comuna omonimă. Ea se află localizată în cimitirul din centrul satului.\\nBiserica \\"Sf. Gheorghe\\" din Drăgușeni a fost inclusă pe Lista monumentelor istorice din județul Iași din anul 2015, având codul de clasificare cod LMI IS-II-m-B-04152."},{"page_url":"https://da.wikipedia.org/wiki/Et%C3%A5rsskud","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Acer_negundo_R0015221.JPG","page_title":"Etårsskud","context_page_description":"Etårsskuddet er den del af en plantes grenvækst, som er dannet i den indeværende vækstperiode eller i den netop afsluttede periode. Etårsskuddet kendes på følgende træk:\\nskuddet bærer knopper direkte\\nskuddet viser ingen årringe, men kun bark, vækstlag og marv\\nskuddet har en bark, som afviger tydeligt fra ældre grenes\\nskuddet bærer en markant, rynket overgangszone mellem et- og toårsskuddet\\nEtårsskuddet bruges meget ofte under identificering af planter, og i tvivlstilfælde koncentrerer man sig om den midterste del af skuddet, som viser de mest karakteristiske træk.\\nSkuddets længde bestemmes af forholdene i den vækstperiode, det er dannet i, mens antallet af knopper bestemmes af forholdene i det år, hvor skuddet blev anlagt. Når man undersøger flere etårsskud, hentet på steder, der er fordelt over hele kronen, kan man sammenligne deres gennemsnitlige længde med den, som er normal for samme art i samme alder. Det giver et ret præcist indblik i plantens livskraft."},{"page_url":"https://en.wikipedia.org/wiki/Wust,_Saxony-Anhalt","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Wappen_Wust.png","page_title":"Wust, Saxony-Anhalt","context_page_description":"Wust is a village and a former municipality in the district of Stendal, in Saxony-Anhalt, Germany. Since the 1st January 2010 it has been part of the municipality Wust-Fischbeck."},{"page_url":"https://eu.wikipedia.org/wiki/Coilia_nasus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/FMIB_47469_Coilia_ectenes.jpeg","page_title":"Coilia nasus","context_page_description":"Coilia nasus Coilia generoko animalia da. Arrainen barruko Engraulidae familian sailkatzen da."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Alpen_(Niederrhein)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Stolperstein_Alpen_Bruckstra%C3%9Fe_20_Erna_Misch.jpg","page_title":"Liste der Stolpersteine in Alpen (Niederrhein)","context_page_description":"Die Liste der Stolpersteine in Alpen (Niederrhein) enthält alle Stolpersteine, die im Rahmen des gleichnamigen Projekts von Gunter Demnig in Alpen (Niederrhein) verlegt wurden. Mit ihnen soll an Opfer des Nationalsozialismus erinnert werden, die in Alpen (Niederrhein) lebten und wirkten."},{"page_url":"https://en.wikipedia.org/wiki/Nudaria_ranruna","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/A41-20170531-247_%2835434788916%29.jpg","page_title":"Nudaria ranruna","context_page_description":"Nudaria ranruna is a moth of the subfamily Arctiinae first described by Shōnen Matsumura in 1927. It is found in Taiwan."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%99%BA%E8%A6%B3%E5%AF%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Chikan-ji.JPG","page_title":"智観寺","context_page_description":"智観寺は、埼玉県飯能市にある真言宗豊山派の寺院である。山号は常寂山。"},{"page_url":"https://en.wikipedia.org/wiki/Chertsey","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Chertsey%2C_St_Anne%27s_Roman_Catholic_Church_-_geograph.org.uk_-_543953.jpg","page_title":"Chertsey","context_page_description":"Chertsey is a town in the Borough of Runnymede in Surrey, England, approximately 29 km southwest of central London. The town grew up around Chertsey Abbey, founded in 666 AD, and was awarded a market charter by Henry I. A bridge across the River Thames was first constructed in the early 15th century. The River Bourne runs through the town to meet the Thames at Weybridge.\\nThe Anglican church has a medieval tower and chancel roof. The 18th-century listed buildings include the current stone Chertsey Bridge and Botleys Mansion. A curfew bell, rung at 8 p.m. on weekdays from Michaelmas to Lady Day, is associated with the romantic local legend of Blanche Heriot, celebrated by a statue of the heroine and the bell at Chertsey Bridge. The green spaces include the Thames Path National Trail, Chertsey Meads and a round knoll with remains of a prehistoric hill fort known as Eldebury Hill. Pyrcroft House dates from the 18th century and Tara from the late 20th.\\nTrain services from Chertsey railway station to and from London Waterloo are operated by South Western Railway. The town is within the M25, which is accessible via junction 11."},{"page_url":"https://pt.wikipedia.org/wiki/Titanic_(filme_de_1997)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Kate_Winslet_C%C3%A9sar_2012_%28cropped%29.jpg","page_title":"Titanic (filme de 1997)","context_page_description":"Titanic é um filme épico de romance e drama norte-americano de 1997, escrito, dirigido, co-produzido e co-editado por James Cameron. É uma história de ficção do naufrágio real do RMS Titanic, estrelando Leonardo DiCaprio como Jack Dawson, e Kate Winslet como Rose DeWitt Bukater, membros de diferentes classes sociais que se apaixonam durante a fatídica viagem inaugural no navio saindo de Southampton para Nova York em 15 de Abril de 1912. Apesar dos personagens principais serem fictícios, alguns personagens são figuras históricas. Gloria Stuart interpreta Rose idosa, que narra o filme; e Billy Zane interpreta Cal Hockley, o noivo rico da jovem Rose. Cameron viu a história de amor como um jeito de cativar o público para o desastre real.\\nA produção começou em 1996, quando Cameron filmou os verdadeiros destroços do RMS Titanic. As cenas modernas foram filmadas no Akademik Mstslav Keldysh, navio de pesquisas russo que Cameron usou como base para filmar os destroços. Uma réplica do Titanic foi construída em Playas de Rosarito, no México; com miniaturas e computação gráfica sendo usadas para recriar o naufrágio. O filme foi financiado pela Paramount Pictures e pela 20th Century Fox."},{"page_url":"https://lmo.wikipedia.org/wiki/Super-c%C3%A8llula","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Supercell.svg","page_title":"Super-cèllula","context_page_description":"Ona super-cèllula a l’è on temporal caratterizzàa de la presenza de on meso-ciclon, o ben ona corrent ascendenta giranta che la po’ vèss larga fin a 32km e che la pò durà fina anca per quatter or.In di particolar condizion tèrmodinamich la corrent ascendenta de on temporal la diventa giranta, iscì el sistèma el se auto-alimenta grazie al girament. La nivola la ghe roeuda intorna a la corrent ascendenta e la corrent discendenta la ven trada dent de noeuv ind quèla ascendenta.\\nOna super-cèllula la nass ‘me cèllula ùnega, cèllula multipla o linea de temporaj, e poeu la diventa ‘na super-cèllula. La corrent ascedenta giranta la pò ingenerà 'na tromba d’aria, tuttamanch domà del 30% o men di super-cèllul a ven foeura ona tromba d’aria. De sorapù ona super-cèllula la produs tanta tempèsta, di vent fòrt e on consistent rebùff discendent."},{"page_url":"https://fr.wikipedia.org/wiki/Fig_(entreprise)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Fig_logo_full_word-400.png","page_title":"Fig (entreprise)","context_page_description":"Fig est une plate-forme de financement participatif fondée par des personnalités de l'industrie des jeux vidéo parmi lesquelles : Aaron Isaksen, Brian Fargo, Feargus Urquhart, Tim Schafer, Alex Rigopulos et Cliff Bleszinski. Elle propose un modèle mixte, alliant crowdfunding traditionnel et possibilité d'investir dans les projets. Elle est lancée le 18 août 2015."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BF%D1%80%D0%B5%D0%B4%D1%81%D1%82%D0%BE%D1%8F%D1%82%D0%B5%D0%BB%D0%B5%D0%B9_%D0%A0%D1%83%D1%81%D1%81%D0%BA%D0%BE%D0%B9_%D0%BF%D1%80%D0%B0%D0%B2%D0%BE%D1%81%D0%BB%D0%B0%D0%B2%D0%BD%D0%BE%D0%B9_%D1%86%D0%B5%D1%80%D0%BA%D0%B2%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/%D0%95%D1%84%D1%80%D0%B5%D0%BC_%D0%9A%D0%B0%D0%B7%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9.jpg","page_title":"Список предстоятелей Русской православной церкви","context_page_description":"Список предстоятелей Русской церкви включает первых по чести епископов Русской православной церкви, начиная со времени её создания, с учётом изменения титулования."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%80%89%E4%B8%BE%E6%88%96%E4%BB%BB%E5%91%BD%E7%9A%84%E5%A5%B3%E6%80%A7%E5%9B%BD%E5%AE%B6%E5%85%83%E9%A6%96%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/SilviaCartwright.jpg","page_title":"选举或任命的女性国家元首列表","context_page_description":"本表列出女性担任选举或者任命的国家元首的情况。始于20世纪中叶，本文不包括女君主，和不担任国家元首的政府首脑，比如总理。"},{"page_url":"https://en.wikipedia.org/wiki/Heilsbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/20170604_Heilsbach_1.jpg","page_title":"Heilsbach","context_page_description":"The Heilsbach is a river of North Rhine-Westphalia, Germany. It flows into the Hardtbach in Bonn-Lessenich."},{"page_url":"https://cs.wikipedia.org/wiki/%C4%8Cerven%C3%BD_%C3%9Ajezd_(Zb%C5%AFch)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Zb%C5%AFch%2C_%C4%8Cerven%C3%BD_%C3%9Ajezd%2C_chapel.jpg","page_title":"Červený Újezd (Zbůch)","context_page_description":"Červený Újezd je malá vesnice, část obce Zbůch v okrese Plzeň-sever. Nachází se 1 km na východ od Zbůchu. Je zde evidováno 38 adres. V roce 2011 zde trvale žilo 82 obyvatel.\\nČervený Újezd leží v katastrálním území Červený Újezd u Zbůchu o rozloze 3,71 km²."},{"page_url":"https://sco.wikipedia.org/wiki/Rectum","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Anatomy_of_human_rectum_and_anus-2.png","page_title":"Rectum","context_page_description":"The rectum, an aw cried the sparrel, is the feenal straicht portion o the lairge intestine in some mammals, an the gut in ithers. The human rectum is aboot 12 centimetres lang,"},{"page_url":"https://en.wikipedia.org/wiki/Shelley,_Idaho","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Shelley_ID_HighSchool_and_BringkmanPark.JPG","page_title":"Shelley, Idaho","context_page_description":"Shelley is a city in Bingham County, Idaho, United States. The population was 4,409 at the 2010 census. The mascot for the city's high school is a russet-burbank potato that wears a crown, robe and scepter.\\nSince 1927 Shelley has been home to the \\"Idaho Annual Spud Day\\", which is celebrated on the 3rd Saturday of September. It typically features a parade, live bands, a Spud Tug, a spud-picking Contest, and free baked potatoes."},{"page_url":"https://en.wikipedia.org/wiki/James_Frawley_(footballer)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/James_Frawley_2018.1.jpg","page_title":"James Frawley (footballer)","context_page_description":"James Frawley is a professional Australian rules footballer, playing with the Hawthorn Football Club in the Australian Football League. He previously played for the Melbourne Football Club from 2007 to 2014."},{"page_url":"https://de.wikipedia.org/wiki/Carl_Jakob_Christian_Wei%C3%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/ES_Ebershaldenfriedhof_Wei%C3%9F.jpg","page_title":"Carl Jakob Christian Weiß","context_page_description":"Carl Jakob Christian Weiß war ein deutscher Önologe und Unternehmer. Er leitete als erstes Mitglied der Familie Weiß die Sektkellerei Kessler. Sie gilt als älteste Sektkellerei Deutschlands und war bis 2004 in den Händen seiner Nachfahren."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AE%D9%88%D8%A7%D9%86_%D8%A8%D8%A7%D9%88%D8%AA%D9%8A%D8%B3%D8%AA%D8%A7_%D8%B3%D9%8A%D8%A8%D8%A7%D9%84%D9%88%D8%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b9/General_Juan_Bautista_Ceballos.jpg","page_title":"خوان باوتيستا سيبالوس","context_page_description":"خوان باوتيستا سيبالوس كان محامى من الميكسيك."},{"page_url":"https://he.wikipedia.org/wiki/%D7%93%D7%90%D7%92%D7%9C%D7%A1_%D7%9E%D7%95%D7%A1%D7%95%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Antarctica_wind_Mawson_Hurley.jpg","page_title":"דאגלס מוסון","context_page_description":"דאגלס מוסון היה גאולוג אוסטרלי, חוקר אנטארקטיקה ואיש האקדמיה. יחד עם רואלד אמונדסן, רוברט פלקון סקוט וארנסט שקלטון, מילא מוסון תפקיד מפתח בהנהגת משלחת מחקר בשנות העידן ההרואי של חקר אנטארקטיקה."},{"page_url":"https://en.wikipedia.org/wiki/Spanish_orthography","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Sv-cursive-small-letter-v.jpg","page_title":"Spanish orthography","context_page_description":"Spanish orthography is the orthography used in the Spanish language. The alphabet uses the Latin script. The spelling is fairly phonemic, especially in comparison to more opaque orthographies like English, having a relatively consistent mapping of graphemes to phonemes; in other words, the pronunciation of a given Spanish-language word can largely be predicted from its spelling and to a slightly lesser extent vice versa. Notable features of Spanish punctuation include the lack of the serial comma and the inverted question and exclamation marks: ⟨¿⟩ ⟨¡⟩.\\nSpanish uses capital letters much less often than English; they are not used on adjectives derived from proper nouns and book titles capitalize only the first word.\\nSpanish uses only the acute accent, over any vowel: ⟨á é í ó ú⟩. This accent is used to mark the tonic syllable, though it may also be used occasionally to distinguish homophones such as si and sí."},{"page_url":"https://sv.wikipedia.org/wiki/Litsea_ovalifolia","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Hakgale_botanical_garden_Litsea_ovalifolia_2017-10-23_%2852%29.jpg","page_title":"Litsea ovalifolia","context_page_description":"Litsea ovalifolia är en lagerväxtart som först beskrevs av Robert Wight, och fick sitt nu gällande namn av Henry Trimen. Litsea ovalifolia ingår i släktet Litsea och familjen lagerväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://en.wikipedia.org/wiki/San_Marco_(Castellabate)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2c/Necropoli_di_s.marco_di_castellabate.JPG","page_title":"San Marco (Castellabate)","context_page_description":"San Marco is a southern Italian village and hamlet of Castellabate, a municipality in the province of Salerno, Campania. As of 2009 its population was of 1,139."},{"page_url":"https://en.wikipedia.org/wiki/Tanta","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e0/TantaBadawiCourt.jpg","page_title":"Tanta","context_page_description":"Tanta is a city in Egypt with the country's fifth largest populated area and 658,798 inhabitants as of 2018. Tanta is located between Cairo and Alexandria: 94 km north of Cairo and 130 km southeast of Alexandria. The capital of Gharbia Governorate, it is a center for the cotton-ginning industry. One of the major railway lines goes through Tanta. Annual festivals are held in Tanta for one week beginning on 11 October celebrating the birthday of Ahmad al-Badawi, a revered Sufi figure of the 13th century, who founded the Badawiyya Tariqa in Egypt and is buried in Ahmad Al-Badawi Mosque, the main mosque of Tanta. Tanta is known for its sweets shops and roasted chickpeas."},{"page_url":"https://en.wikipedia.org/wiki/Causeway_Islands","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Isla_Naos_e_Isla_Perico.jpg","page_title":"Causeway Islands","context_page_description":"The Causeway Islands are four small islands by the Pacific entrance to the Panama Canal. They are linked to the mainland via a causeway, made from rock extracted during the excavations from the Panama Canal. In part the causeway was meant to serve as a breakwater for the entrance.\\nA four-lane road runs along the causeway to each island, and there is a bicycle/jogging path as well.\\nThe islands are as follows:\\nNaos - home to a research lab run by the Smithsonian Tropical Research Institute.\\nCulebra\\nPerico\\nFlamenco\\nDuring World War II, fortifications were constructed on the islands to protect the canal but were never used. They have since been dismantled, but bulwarks and empty gun emplacements still exist.\\nLaunch facilities are used by pilots boarding ships entering the Panama Canal from these islands.\\nManuel Noriega built a private house on one of the islands, which was destroyed and looted during his ouster.\\nSince control of the islands reverted to Panama, there has been considerable development along the causeway and edges of the islands, including port facilities, marinas, shopping, and restaurants."},{"page_url":"https://lt.wikipedia.org/wiki/%C5%A0imla","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Shimla_in_August.jpg","page_title":"Šimla","context_page_description":"Šimla – miestas šiaurės vakarų Indijoje, Himalajų pašlaitėje; Himačal Pradešo valstijos sostinė. Britų Indijos laikais šis miestas buvo kolonijos vasaros sostine. Yra plentas į Čandigarhą, siaurasis geležinkelis į Kalką. Šimla yra vienas svarbiausių turistinių šalies centrų, kalnų slidinėjimo kurortas. Veikia Indijos pažangiųjų studijų institutas, medicinos kolegija.\\nŠimla žymi savo kolonijine architektūra – 1857 m. neogotikinė anglikonų Kristaus bažnyčia, 1888 m. pastatyti vicekaraliaus rūmai, XIX a. rotušė, teatras, prekyvietės. Taip pat yra 1845 m. pastatyta deivės Kali šventykla, 108 m aukščio Hanumano skulptūra, Taros šventykla."},{"page_url":"https://ja.wikipedia.org/wiki/1932%E5%B9%B4%E3%82%A2%E3%83%A1%E3%83%AA%E3%82%AB%E5%90%88%E8%A1%86%E5%9B%BD%E5%A4%A7%E7%B5%B1%E9%A0%98%E9%81%B8%E6%8C%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/John_n_garner.jpg","page_title":"1932年アメリカ合衆国大統領選挙","context_page_description":"1932年アメリカ合衆国大統領選挙は、1929年の株式市場の崩壊と世界恐慌の影響が国中を厳しく覆った中で行われた。現職大統領で共和党のハーバート・フーヴァーの人気は、有権者達がフーヴァーでは経済の崩壊を回復できず、禁酒法もうまく扱えないと感じるにつれて下降していった。民主党のフランクリン・ルーズベルトは、フーヴァーがこれらの問題に処せなかったことが自分の選挙運動のための綱領に利用できると考え、ニューディール政策と呼ばれる改革を公約した。ルーズベルトがどのようにして事態を変えられるかについてははっきりしていなかったが、地滑り的勝利を得た。この「時代を画した選挙」は第四政党制すなわち進歩主義の時代の崩壊を告げた。有権者達は間もなくルーズベルトのニューディール連合に支配される第五政党制に組み込まれることになった。"},{"page_url":"https://de.wikipedia.org/wiki/Stocznia_Gdanska_B501","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fe/Finnhansa_Travem%C3%BCnde_%282008%29.JPG","page_title":"Stocznia Gdanska B501","context_page_description":"Der Stocznia Gdanska B501 ist ein in vier Einheiten gebauter Schiffstyp von RoPax-Fähren der Werft Stocznia Gdanska in Danzig. Die vier ursprünglich im Auftrag von Tochterunternehmen der Finnlines-Gruppe gebauten Schiffe wurden auch als Hansa-Klasse zusammengefasst. Mit der Hansa-Baureihe stieg Finnlines 1994 wieder in das Passagiergeschäft zwischen Deutschland und Finnland ein. In direkter Konkurrenz zur Finnjet bot Finnlines auf den Hansa-Schiffen einer geringen Anzahl von Passagieren eine 36-stündige luxuriöse Überfahrt von Lübeck nach Helsinki an. Im Jahr 2000 wurden die Finnhansa, Finntrader und die Finnpartner für Finnlines OY, Helsinki registriert und wechselten vom Nordlandkai in Lübeck zum Skandinavienkai nach Travemünde. Die Überfahrt verkürzte sich so um zirka zwei Stunden. Ihnen folgte die Transeuropa, die jedoch für Finnlines Deutschland registriert wurde."},{"page_url":"https://fr.wikipedia.org/wiki/Franck_Jedrzejewski","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Jedrzejewski-Franck.jpg","page_title":"Franck Jedrzejewski","context_page_description":"Franck Jedrzejewski est un mathématicien, philosophe et musicologue français. Enseignant-chercheur au Commissariat à l'énergie atomique et aux énergies alternatives depuis 1989, il a été vice-président du Collège international de philosophie et directeur de programmes. Il enseigne à l'université Paris-Saclay."},{"page_url":"https://hu.wikipedia.org/wiki/Cesare_Lombroso","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Signature_of_Cesare_Lombroso.jpg","page_title":"Cesare Lombroso","context_page_description":"Cesare Lombroso, született Ezechia Marco Lombroso olasz kriminológus, orvos, az olasz pozitivista kriminológia megalapítója. Lombroso elutasította a klasszikus iskola tanait, amelyek szerint a bűnözés az emberi természet karakter vonása. Lombroso antropológiai kriminológia elmélete, aminek előzményei a fiziognómia, a korai eugenika, a pszichiátria, és a szociáldarwinizmusban keresendők, azt állította, hogy a kriminalitás öröklött. A „született bűnöző” azonosítható fizikai jelek alapján."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Berlin-Bohnsdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Tuschkastensiedlung_Reihenh%C3%A4user_Gartenstadtweg_Oktober_2012.jpg","page_title":"Liste der Kulturdenkmale in Berlin-Bohnsdorf","context_page_description":"In der Liste der Kulturdenkmale von Bohnsdorf sind die Kulturdenkmale des Berliner Ortsteils Bohnsdorf im Bezirk Treptow-Köpenick aufgeführt."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D8%AA%D8%AD%D9%81_%D8%A7%D9%84%D9%81%D9%86_%D8%A7%D9%84%D8%AD%D8%AF%D9%8A%D8%AB_%D9%84%D8%AC%D9%85%D9%87%D9%88%D8%B1%D9%8A%D9%87_%D8%B5%D8%B1%D8%A8%D8%B3%D9%83%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/%D0%9C%D1%83%D0%B7%D0%B5%D1%98_%D1%81%D0%B0%D0%B2%D1%80%D0%B5%D0%BC%D0%B5%D0%BD%D0%B5_%D1%83%D0%BC%D1%98%D0%B5%D1%82%D0%BD%D0%BE%D1%81%D1%82%D0%B8_%D0%A0%D0%B5%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B5_%D0%A1%D1%80%D0%BF%D1%81%D0%BA%D0%B5.jpg","page_title":"متحف الفن الحديث لجمهوريه صربسكا","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nمتحف الفن الحديث لجمهوريه صربسكا متحف فى البوسنه و الهرسك."},{"page_url":"https://de.wikipedia.org/wiki/Ragi_Ball","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Frau_ragi_ball.jpg","page_title":"Ragi Ball","context_page_description":"Ragi Ball ist ein indisches Hauptgericht aus Fingerhirse. Es ist eine Spezialität des Bundesstaates Karnataka, aber auch teilweise in Andhra Pradesh zu finden."},{"page_url":"https://zh.wikipedia.org/zh-my/%E7%A4%BA%E5%A8%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/29.9.14_Hong_Kong_protest_near_Tamar.jpg","page_title":"示威","context_page_description":"示威活动是一群人共同表达意见的展现，是激进主义的一种类型，通常采取一干人集结在同一地方的形式。因为有一群人为了同一意见而集结，他们所主张的意见也因此显得有重要性。\\n示威可以用来表示对一公共议题的观点，尤其是和社会不公及人民疾苦有关的议题。一场示威活动若参与的人越多，通常被认为是越成功的。示威活动所关注的通常是政治、经济和社会等议题。"},{"page_url":"https://tr.wikipedia.org/wiki/Yeni_medya_sanat%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/A-Soapopera-for-iMacs.jpg","page_title":"Yeni medya sanatı","context_page_description":"Yeni medya sanatı; dijital sanat, bilgisayar grafikleri, yeni medya teknolojileri, bilgisayar animasyonları, sanal sanat, Internet sanatı, interaktif sanat, video oyunları, robotbilimi ve bioteknolojik sanat yöntemlerini kullanarak yapılan sanat eserlerini kapsayan bir sanat türüdür. Bu terim, açığa çıkardığı kültürel obje ve sosyal olaylar ile kendini eski görsel sanatlardan ayırmaktadır. Kullanılan araçlar ile bu mecra, çağdaş sanat için kilit bir rol oynamakta ve doğal olarak günümüzde \\"Yeni Tarzlar\\" veya \\"Yeni Medya\\" konularını okutan saygın üniversite, sanat okulu ve uluslararası lisansüstü programlarının sayısının gün geçtikçe artmasına sebep olmaktadır. Yeni medya sanatı genellikle sanatçı ve izleyici ya da izleyici ve sanat eseri arasında bir etkileşim içerir. Fakat, bazı teorisyenlerin ve küratörlerin belirttiği gibi bu etkileşim, sosyal takas, katılım ve dönüşüm yeni medya sanatının ayırt edici özelliği değil, diğer modern sanat pratikleriyle paylaştıkları ortak zemindir. Bu anlayış aslında, kültürel uygulama biçimleriyle eş zamanlı ortaya çıkan teknolojik platformları ve teknolojik mecraları sorgulamayı vurgular."},{"page_url":"https://ca.wikipedia.org/wiki/Avinguda_de_Roma","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Carrer_d%27Arag%C3%B3_1938.jpg","page_title":"Avinguda de Roma","context_page_description":"L'Avinguda de Roma és un carrer de Barcelona del districte de l'Eixample. Antigament l'avinguda fou anomenada Generalitat i abans Diagonal del Ferrocarril. Per sota del subsòl de l'avinguda hi transcorre el túnel d'Aragó per on passen els trens que vénen de l'estació de Sants cap a Plaça Catalunya o Passeig de Gràcia. A l'inci el ferrocarril hi passava en forma de trinxera cap al carrer d'Aragó per dirigir-se a Passeig de Gràcia, fins que fou soterrat."},{"page_url":"https://de.wikipedia.org/wiki/Katholische_Liga_(1538)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Lucas_Cranach_d.%C3%84._-_Bildnis_des_Herzogs_Georg_von_Sachsen_%28Gem%C3%A4ldegalerie%2C_Berlin%29.jpg","page_title":"Katholische Liga (1538)","context_page_description":"Die Katholische Liga war ein am 10. Juni 1538 in Nürnberg gegründetes Bündnis katholischer Stände im Heiligen Römischen Reich. Sie war das katholische Gegenstück zum protestantischen Schmalkaldischen Bund und sollte der zunehmenden Ausbreitung des Protestantismus im Reich entgegenwirken.\\nDas Bündnis war aufgrund unterschiedlicher Interessenlagen und des gegenseitigen Misstrauens seiner Mitglieder wenig effektiv. Obwohl der Zusammenschluss bis 1549 befristet war, bestand die Liga spätestens seit 1545 de facto nicht mehr und die Mitglieder gingen politisch getrennte Wege."},{"page_url":"https://sq.wikipedia.org/wiki/Alfons_Liguori","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/St_Alphonsus_Liguori.jpg","page_title":"Alfons Liguori","context_page_description":"Shën Alfons Liguori ishte nje jurist, shkrimtar shpirtëror italian, peshkop dhe themelues i urdhërit të Kongregacionit të Shpaguesit Më të Shenjtë."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%AF%D9%86%D8%AF%D9%85%DB%8C%D8%A7%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/78/Grass-plant-structure.png","page_title":"گندمیان","context_page_description":"چمنیان یا گندمیان یا تیره گندم تیره‌ای از گیاهان گلدار می‌باشند، گیاهان این خانواده به نام علف شناخته می‌شوند.\\nتخمین زده می‌شود که علف‌زارها و چمن‌زارها ۲۰ ٪ از پوشش گیاهی زمین را تشکیل می‌دهد.\\nچمنیان به عنوان مهم‌ترین خانواده گیاهی برای اقتصاد در نظر گرفته می‌شود که شامل دانه‌های خوراکی، غلات، چمن و علوفه برای دام‌ها است و همچنین از بامبو برای ساخت و ساز در سراسر شرق آسیا و کشورهای جنوب آفریقا استفاده می‌شود."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89cole_nationale_sup%C3%A9rieure_d%27art_et_de_design_de_Nancy","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Mediatheque_artem.jpg","page_title":"École nationale supérieure d'art et de design de Nancy","context_page_description":"L'École nationale supérieure d'art et de design de Nancy est une école d'art créée à Nancy pendant la seconde moitié du XIXᵉ siècle sous le nom d'École des beaux-arts de Nancy, qui faisait elle-même suite à l'école de peinture et de dessin de Nancy, elle-même héritière de l'Académie de peinture et de sculpture créée en 1702 par le Duc Léopold de Lorraine.\\nElle s'est inscrite dans la continuité du mouvement artistique resté dans la postérité sous le nom d'École de Nancy. Depuis le 1ᵉʳ janvier 2003, l'école a le statut d'établissement public national à caractère administratif placé sous la tutelle du ministère de la Culture et de la Communication. Elle participe du projet Artem."},{"page_url":"https://sv.wikipedia.org/wiki/Trichoglossus_meyeri","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Trichoglossus_flavoviridis_-Loro_Parque-6a-4c.jpg","page_title":"Trichoglossus meyeri","context_page_description":"Trichoglossus meyeri, \\"senapshättad lorikit\\", är en fågelart i familjen östpapegojor inom ordningen papegojfåglar."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Zirkel_von_Studentenverbindungen","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Masovia-Silberzirkel.JPG","page_title":"Liste der Zirkel von Studentenverbindungen","context_page_description":"Die Liste der Zirkel von Studentenverbindungen dient der Übersicht aller unterschiedlichen Zirkel."},{"page_url":"https://de.wikipedia.org/wiki/San_Giuliano_Terme","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Villa_di_corliano_09.1.JPG","page_title":"San Giuliano Terme","context_page_description":"San Giuliano Terme ist eine italienische Gemeinde mit 31.447 Einwohnern in der Provinz Pisa in der Region Toskana."},{"page_url":"https://de.wikipedia.org/wiki/Sergio_Corazzini","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/90/Sergio_Corazzini.jpg","page_title":"Sergio Corazzini","context_page_description":"Sergio Corazzini war ein italienischer Dichter des Crepuscolarismo."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%B0%D1%81%D1%82%D0%BE%D1%8F%D1%89%D0%B8%D0%B9_%D0%B4%D0%B5%D1%82%D0%B5%D0%BA%D1%82%D0%B8%D0%B2_(3-%D0%B9_%D1%81%D0%B5%D0%B7%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Stephen_Dorff_%288084618366%29.jpg","page_title":"Настоящий детектив (3-й сезон)","context_page_description":"Третий сезон «Настоящего детектива», американского криминального/драматического сериала-антологии, созданного Ником Пиццолатто, был подтверждён каналом HBO 31 августа 2017 года, и его премьера состоялась 13 января 2019 года. Действие истории происходит в Озарке в течение трёх различных периодов времени, и партнёры-детективы расследуют жуткое преступление с участием двух пропавших детей. Музыкальная тема сериала — песня «Death Letter» из альбома «New Moon Daughter», написанная Соном Хаусом и исполненная Кассандрой Уилсон. Слоган: \\"Ничто не вечно, кроме правды\\".\\nМахершала Али играет главную роль детектива Уэйна Хэйса, в то время как Стивен Дорфф исполняет роль его партнёра-детектива Роланда Уэста. Этот сезон знаменует режиссёрский дебют Пиццолатто, и при этом он разделил режиссёрские обязанности с Джереми Солнье и Дэниелом Сакхаймом. Пиццолатто также выступает в качестве шоураннера и единственного сценариста сезона, за исключением четвёртого и шестого эпизодов, который он написал в соавторстве с Дэвидом Милчем и Грэмом Горди, соответственно."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%94%D1%8B%D0%B5%D0%B3%D0%B0_%D0%A0%D0%B0%D0%BB%D1%8F%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Rolan_2.jpg","page_title":"Дыега Ралян","context_page_description":"Дые́га Раля́н — уругвайскі футбаліст, нападнік гішпанскага клюбу «Маляга» і нацыянальнай зборнай Уругваю."},{"page_url":"https://ca.wikipedia.org/wiki/Amap%C3%A1_(municipi)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Bandeira_Munic%C3%ADpio_de_Amap%C3%A1.jpg","page_title":"Amapá (municipi)","context_page_description":"Amapá és un municipi de Brasil, en l'est de l'estat d'Amapá. La seva població és de 7.465 habitants i la seva extensió és de 9.169 km², la qual cosa dóna una densitat de població de 0,79 hab/km². Limita al nord i a l'est amb l'oceà Atlàntic, amb els municipis de Macapá i Cutias al sud, Tartarugalzinho i Pracuúba al sud-oest i Calçoene a l'oest i nord-oest."},{"page_url":"https://pt.wikipedia.org/wiki/Kemberg","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7a/Kemberg_town_hall.jpg","page_title":"Kemberg","context_page_description":"Kemberg é uma cidade da Alemanha localizada no distrito de Wittenberg, estado de Saxônia-Anhalt.\\nPertence ao Verwaltungsgemeinschaft de Kemberg."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A8%E3%83%83%E3%82%B7%E3%82%A7%E3%83%AB%E3%83%96%E3%83%AD%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Eschelbronn_in_HD.png","page_title":"エッシェルブロン","context_page_description":"エッシェルブロン は、ドイツ連邦共和国バーデン＝ヴュルテンベルク州ライン＝ネッカー郡に属す町村。この地域は、家具製造や販売の企業が多く、古くから家具職人の町として知られている。"},{"page_url":"https://fr.wikipedia.org/wiki/Cin%C3%A9ma_indon%C3%A9sien","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Lies_Noor_%28c._1956%29%2C_Djakartawood_%28no_name%29.jpg","page_title":"Cinéma indonésien","context_page_description":"Le cinéma indonésien a une longue histoire. Le cinéma est apparu en Indonésie dès 1926, durant l'époque coloniale. Un cinéma national se développe peu après l'indépendance, notamment dans les années 1950 et 1960. Parmi les réalisateurs majeurs de ce nouveau cinéma national, le réalisateur Usmar Ismail fait figure de pionnier.\\nL'industrie cinématographique est actuellement l'industrie culturelle qui connaît la plus forte croissance du pays. Cependant, cette croissance est encore récente et le cinéma indonésien a traversé une longue période de difficultés et demeure aujourd'hui un cinéma émergent sur la scène internationale.\\nLe nombre d'entrées en salles s'éleve à plus de 42 millions en 2017. En 2018, l'Indonésie compte environ 1 700 écrans et devrait en atteindre 3 000 en 2020 selon les prévisions du gouvernement indonésien. Le secteur de l'exploitation est dominé par plusieurs grands groupes, notamment 21 Cineplex, CGV Cinemas et Cinemaxx."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%A2%B1%E9%A2%A8%E8%8F%B2%E7%89%B9_(2013%E5%B9%B4)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/34/Fitow_Oct_06_2013_0255Z.jpg","page_title":"颱風菲特 (2013年)","context_page_description":"中度颱風菲特為2013年太平洋颱風季第二十一個被命名的風暴。「菲特」一名由密克羅尼西亞提供，是一種美麗芬芳的花朵。該颱風對中國造成的經濟損失達623.3億人民幣，僅次於颱風賀伯。由於菲特形成的倒槽降水使浙江全境出現罕見洪澇災害，所以在第46次世界氣象組織颱風委員會年度會議上遭除名，隔年決定由「木恩」取代之，其意為六月。並於2019年首次使用。"},{"page_url":"https://ast.wikipedia.org/wiki/Poospiza_caesar","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/PoospizaCaesarSmit.jpg","page_title":"Poospiza caesar","context_page_description":"Poospiza caesar) ye una especie d'ave de la familia de les Thraupidae, siendo endémica de Perú. Distribuyir en carbes sub tropicales o tropicales d'altitú."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%97%9D%EA%B0%80%EB%A6%AC%EC%9D%98_%EC%9E%AC%EC%99%B8%EA%B3%B5%EA%B4%80_%EB%AA%A9%EB%A1%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Embassy_of_Hungary%2C_Ottawa.jpg","page_title":"헝가리의 재외공관 목록","context_page_description":"헝가리의 재외공관 목록은 헝가리 주재 대사관을 각국에 상주시켜 놓는 것을 의미하며 헝가리의 재외공관을 나열한 목록이다."},{"page_url":"https://it.wikipedia.org/wiki/Glen_Osborne_(Stati_Uniti_d%27America)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Map_of_Osborne%2C_Allegheny_County%2C_Pennsylvania_Highlighted.png","page_title":"Glen Osborne (Stati Uniti d'America)","context_page_description":"Glen Osborne è una borough degli Stati Uniti d'America, nella contea di Allegheny nello Stato della Pennsylvania. Secondo il censimento del 2000 la popolazione è di 566 abitanti. In passato veniva chiamata Osborne."},{"page_url":"https://en.wikipedia.org/wiki/Littlest_Pet_Shop_(2012_TV_series)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/2950hollywoodway.JPG","page_title":"Littlest Pet Shop (2012 TV series)","context_page_description":"Littlest Pet Shop is an American–Canadian children's animated television series produced by DHX Media for The Hub. Based on the Littlest Pet Shop and Blythe toyline by Hasbro, the show centers on Blythe Baxter, a pre-teen girl who, after moving into an apartment in a city, gains the ability to communicate with animals. Located below her apartment is the eponymous pet store where Blythe works and talks to a group of pets who regularly reside at a day care in the shop. Worried that a corrupt rival business will drive their shop out of business, the pets depend on Blythe to drive business into the store with her pet fashion designs.\\nProduced by Hasbro Studios and DHX Media, the series premiered on The Hub on November 10, 2012 and ended on June 4, 2016, totaling four seasons and 104 episodes. Animated using Adobe Flash animation, completion of a single episode took roughly one year with several in production at once. While it mostly received praise from reviewers for its writing and characters, the show was criticized for its embedded marketing. Several crew members have additionally received accolades for their work on the show."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9A%D1%80%D0%B8%D0%B2%D0%B0_%D0%BA%D1%83%D0%BB%D0%B0_%D0%B2%D0%BE_%D0%9F%D0%B8%D0%B7%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Leaning_tower_staircase_8th_floor.JPG","page_title":"Крива кула во Пиза","context_page_description":"Кривата кула во Пиза, или едноставно Кулата во Пиза е канбанарија или самостојна кула со ѕвона на катедралата на италијанскиот град Пиза. Изградена е на Плоштадот на катедралата, во склоп на комплексот кој вклучува и катедрала, крстилница и гробишта. Иако било планирано да стои вертикално, поради лошите темели и слабата почва, кулата се накривила до размери што морала да биде санирана за да не падне. Со својата светски прочуена накривеност, кулата привлекува стотици илјади туристи годишно."},{"page_url":"https://sv.wikipedia.org/wiki/Safiental","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f8/Tenna.jpg","page_title":"Safiental","context_page_description":"Safiental är den östligaste kommunen i regionen Surselva i den schweiziska kantonen Graubünden. Kommunen har 901 invånare och utgörs till största delen av dalen med samma namn, som från söder till norr genomströmmas av ån Rabiusa, ett biflöde till Vorderrhein, och därmed indirekt till Rhen.\\nKommunen bildades 2012 genom sammanslagning av de tidigare kommunerna Safien, Tenna och Versam, som utgör den egentliga dalen, samt Valendas, som ligger utanför dalen men hör ihop med den kulturellt."},{"page_url":"https://en.wikipedia.org/wiki/List_of_equipment_of_the_Ukrainian_Ground_Forces","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/SA-14_missile_and_launch_tube.jpg","page_title":"List of equipment of the Ukrainian Ground Forces","context_page_description":"The list of equipment of the Ukrainian Ground Forces can be subdivided into: infantry weapons, vehicles, aircraft, watercraft, and clothing."},{"page_url":"https://en.wikipedia.org/wiki/Deng_Yanda","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Teng-Jan-dah_-_%28Deng_Yanda_%29_1927.jpg","page_title":"Deng Yanda","context_page_description":"Deng Yanda was a military officer in the Chinese Nationalist Party. He broke with party leaders in 1927, denouncing them as traitors to the party's original principles and in 1930 attempted to form a new party, which he called the Provisional Action Committee of the Chinese Nationalist Party or Third Party. It was later renamed the Chinese Peasants' and Workers' Democratic Party. In 1931 he was convicted of treason by the Nationalist government and secretly executed. Today, Deng is recognized as a revolutionary martyr by the People's Republic of China."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%87%D8%A7%DB%8C%D8%A7%D9%86%DB%8C%D8%B3%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Arevashat_and_Hayanist_from_the_air.jpg","page_title":"هایانیست","context_page_description":"هایانیست یک شهر در ارمنستان است که در استان آرارات واقع شده‌است. در کیلومتری شمال آرتاشات، مرکز استان آرارات واقع شده است."},{"page_url":"https://it.wikipedia.org/wiki/Impero_bizantino","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Justinian555AD.png","page_title":"Impero bizantino","context_page_description":"Impero bizantino è il nome con cui gli studiosi moderni e contemporanei indicano l'Impero romano d'Oriente, di cultura prevalentemente greca, separatosi dalla parte occidentale, di cultura quasi esclusivamente latina, dopo la morte di Teodosio I nel 395.\\nIl termine \\"bizantino\\" è stato introdotto solo a partire dal XVIII secolo dagli Illuministi, quando l'Impero Romano d'Oriente era ormai scomparso da circa tre secoli. Gli stessi abitanti dell'Impero Romano d'Oriente chiamavano sé stessi dal greco Ῥωμαῖοι / Rhōmaîoi oppure Ῥωμιόι / Rōmiói. Come l'Impero bizantino era di fatto Impero romano, così la sua capitale Costantinopoli era la Nuova Roma e così pure il titolo dei suoi sovrani era Basileús kaì Kaìsar ton romaíon, ovvero Sovrano e Cesare dei Romani. La stessa Penisola balcanica veniva chiamata dai Romei, Rumelia, nome di regione che sarà conservato pure dai conquistatori ottomani. Gli stessi ottomani utilizzeranno la parola Rūm, termine storicamente impiegato dai musulmani per indicare i 'Romani d'Oriente' cioè i Bizantini."},{"page_url":"https://de.wikipedia.org/wiki/Scheremetew-Palais","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Spb_Fountain_House_asv2019-09_img01.jpg","page_title":"Scheremetew-Palais","context_page_description":"Der Scheremetew-Palais oder Scheremetew-Palast ist ein Palast in Sankt Petersburg. Der Palast wird auch als \\"Fontänenhaus\\" bezeichnet, weil er früher zahlreiche Brunnen aufwies."},{"page_url":"https://hu.wikipedia.org/wiki/St%C3%A4del_Museum","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Staedel-Garten-2014-Ffm-866-868.jpg","page_title":"Städel Museum","context_page_description":"A frankfurti Städel Museum Németország és a világ egyik legjelentősebb szépművészeti múzeuma, egyben a legrégebbi és legfontosabb német múzeumi alapítvány. Hét évszázad kiemelkedő művészeti alkotásait mutatja be. Gyűjteményében mintegy 4000 festmény található, közülük az állandó kiállítás 1000 darabot mutat be. A grafikai gyűjtemény körülbelül 100 000 rajzból és metszetből áll. A Städel Museum gyűjteményéhez tartozik még mintegy 4000 fotó, 600 szobor és egy 115 000 kötetes könyvtár is.\\nA múzeum létrehozását lehetővé tévő alapítványt Johann Friedrich Städel frankfurti bankár és mecénás hozta létre végrendeletileg 1815-ben. Az örökösödéssel kapcsolatos jogi viták lezárulta után, 1833-ban nyílhatott meg az első kiállítás. A múzeum 1878-ban költözött mai épületébe a Museumsuferen."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9D%CE%B9%CE%BA%CE%BF%CE%BB%CE%AC%CE%B9_%CE%A1%CE%B5%CF%80%CE%BD%CE%AF%CE%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/43/Nikolai_Vasilyevich_Repnin.jpg","page_title":"Νικολάι Ρεπνίν","context_page_description":"Ο Πρίγκιπας Νικολάι Βασίλιεβιτς Ρεπνίν ήταν κρατικός αξιωματούχος και στρατηγός της Ρωσικής Αυτοκρατορίας, καταγόμενος από την πριγκιπική οικογένεια των Ρεπνίν, ο οποίος διαδραμάτισε καθοριστικό ρόλο στην διάλυση της Πολωνικής-Λιθουανικής Κοινοπολιτείας."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Important_Cultural_Properties_of_Japan_(Heian_period:_structures)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Pagoda_in_Joururiji_temple_Kyoto_JPN.jpg","page_title":"List of Important Cultural Properties of Japan (Heian period: structures)","context_page_description":"This list is of Japanese structures dating from the Heian period that have been designated Important Cultural Properties."},{"page_url":"https://hu.wikipedia.org/wiki/N%C3%A9r%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/N%C3%A9r%C3%A9_Mairie_2.JPG","page_title":"Néré","context_page_description":"Néré település Franciaországban, Charente-Maritime megyében. Néré Contré, Les Éduts, Le Gicq, Loiré-sur-Nie, Romazières, Seigné, Villemorin és Vinax községekkel határos."},{"page_url":"https://ko.wikipedia.org/wiki/%EA%B0%9C%EB%9F%AC%EC%8A%A4_%EB%B0%B0%EB%A6%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Gareth_Barry_2015_BAT.jpg","page_title":"개러스 배리","context_page_description":"개러스 로버트 배리는 잉글랜드의 은퇴한 축구 선수이다. 그의 과거 팀 동료였던 개러스 사우스게이트와 그는 클럽에선 2000년에 열린 채러티 실드에서의 마지막 경기를 제외한 모든 경기와 과거 웸블리 스타디움에서 열린 마지막 국제 경기를 유일하게 둘 다 뛴 선수들로, 이 두 경기 모두 1-0 패배를 기록하였다. 그는 또한 EPL에서 21시즌간 뛰면서 EPL 최다 출장 1위기록을 가지고있다."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A2%D0%B5%D1%85%D0%BD%D0%B5%D1%86%D0%B8%D1%83%D0%BC","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a5/Zirconium-tetrachloride-3D-balls-A.png","page_title":"Технециум","context_page_description":"Технециум — хемиски елемент со симбол Tc и атомски број 43. Тоа е најлесниот елемент чии сите изотопи се радиоактивни; никој не е стабилен, со исклучок на целосно јонизираната состојба од ⁹⁷ Tc. Речиси целиот технециум се произведува синтетички, а само околу 18.000 тони можат да се најдат во било кое дадено време во Земјината кора. Технециумот природно се јавува и е спонтан производ на фисија од ураниумска руда и ториумска руда, најчестиот извор, или производот на заробување на неутроните во молибденските руди. Овој сребрено-сив, кристален преоден метал лежи меѓу рениум и манган во групата 7 од периодниот систем, а неговите хемиски својства се средни помеѓу оние од овие два соседни елементи. Најчестиот природен изотоп е ⁹⁹ Tc.\\nМногу од својствата на технециумот биле предвидени од Дмитриј Менделеев пред откривањето на елементот. Менделеев забележал јаз во својата периодичен систем и му дал на неоткриениот елемент привременото име екаманганец. Во 1937 година, технециумот стана првиот доминантно вештачки елемент што требало да се произведе, па оттука и неговото име."},{"page_url":"https://pl.wikipedia.org/wiki/Opium","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/2poppies.jpg","page_title":"Opium","context_page_description":"Opium − substancja otrzymywana przez wysuszenie soku mlecznego z niedojrzałych makówek maku lekarskiego. Zawiera około 20 alkaloidów, które można podzielić na dwa rodzaje:\\npochodne fenantrenu\\npochodne izochinoliny.\\nOpium było w przeszłości używane głównie jako środek przeciwbólowy, uspokajający, środek nasenny i odurzający, głównie w postaci nalewki alkoholowej, zwanej laudanum, lub palone. Szczególnie szeroko opium stosowano w Europie i Stanach Zjednoczonych w XIX wieku. Próby ograniczenia przywozu brytyjskiego opium do Chin doprowadziły do wojen opiumowych. Alkaloidy zawarte w tej substancji, między innymi morfinę, kodeinę, narkotynę, papawerynę, wykorzystuje się w lecznictwie. Również makowiny, czyli suche, dojrzałe i opróżnione z nasion torebki maku oraz wymłócona słoma makowa, są źródłem tych samych alkaloidów. Kodeina stosowana jest jako lek znoszący odruch kaszlu. Przeciwkaszlowe działanie ma także narkotyna, która jednocześnie pobudza ośrodek oddechowy. Papaweryna używana jest przy kolce jelitowej, wątrobowej i innych narządów, gdyż blokuje bodźce nerwowe powodujące skurcz mięśni gładkich układu pokarmowego."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%81%94%E7%9B%9F%E7%B3%BB%E5%88%97%E5%AE%87%E5%AE%99%E9%A3%9E%E8%88%B9%E5%8F%91%E5%B0%84%E4%BB%BB%E5%8A%A1%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Soyuz_TM-17_patch.png","page_title":"联盟系列宇宙飞船发射任务列表","context_page_description":"這是一份關於蘇聯/俄羅斯所研製的聯盟號飛船歷次發射任務的列表。關於蘇聯/俄羅斯使用聯盟系列飛船進行的載人航天工程的更多內容，請參見主題條目：聯盟計劃。\\n使用此表時請注意以下事項：\\n表中所列各飛船順序系依照實際發射順序，而非飛船編號。只列出了部分無人飛船，只有載人飛船標註序號。\\n表中包含了聯盟系列的6種飛船，即聯盟號、聯盟-T、聯盟-TM、聯盟-TMA、聯盟TMA-M和聯盟MS。\\n按照蘇聯的傳統做法，一些執行無人飛行任務的聯盟號飛船經常被冠以宇宙號的名字，塔斯社公開發布消息時也只會發布軌道參數，直到20世紀80年代外界仍只能通過北美防空部門、太空部門和情報部門獲取蘇聯太空活動的消息。"},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B8%8B%E8%B0%B7%E5%8C%BA%E7%AB%8B%E4%BB%A3%E3%80%85%E6%9C%A8%E4%B8%AD%E5%AD%A6%E6%A0%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/%E4%BB%A3%E3%80%85%E6%9C%A8%E4%B8%AD%E5%AD%A6%E6%A0%A1-4.JPG","page_title":"渋谷区立代々木中学校","context_page_description":"渋谷区立代々木中学校は、東京都渋谷区西原にある公立中学校である。西原一丁目の住宅地に所在し、学校の敷地・校舎は緑の多い環境に恵まれた所である。"},{"page_url":"https://pt.wikipedia.org/wiki/%C3%81ustria_no_Festival_Eurovis%C3%A3o_da_Can%C3%A7%C3%A3o","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Eurovision_Song_Contest_1976_rehearsals_-_Austria_-_Waterloo_%26_Robinson_3.png","page_title":"Áustria no Festival Eurovisão da Canção","context_page_description":"A Áustria participou no Festival Eurovisão da Canção 50 vezes desde sua estreia em 1957, tendo estado ausente 11 vezes: em 1969, 1970, 1973, 1974, 1975, 1998, 2001, 2006, 2008, 2009 e em 2010."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D0%BD%D0%B5%D1%82%D0%B0_(%D0%9F%D0%B5%D1%80%D1%83%D1%92%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/FrattaTodinaSpineta2.jpg","page_title":"Спинета (Перуђа)","context_page_description":"Спинета је насеље у Италији у округу Перуђа, региону Умбрија.\\nПрема процени из 2011. у насељу је живело 16 становника. Насеље се налази на надморској висини од 416 м."},{"page_url":"https://pl.wikipedia.org/wiki/J%C3%B3zef_Kopczy%C5%84ski_(rze%C5%BAbiarz)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Torun_pomnik_Helios_500_urodzin_Kopernika_03.jpg","page_title":"Józef Kopczyński (rzeźbiarz)","context_page_description":"Józef Kopczyński – polski artysta rzeźbiarz, profesor ASP w Poznaniu."},{"page_url":"https://en.wikipedia.org/wiki/Jatiya_Press_Club","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Bangladesh_National_Press_Club.jpg","page_title":"Jatiya Press Club","context_page_description":"Jatiya Press Club is the professional club for journalists of Bangladesh located in the capital Dhaka. The current president is Saiful Alam. The general secretary is Farida Yasmin."},{"page_url":"https://sv.wikipedia.org/wiki/Porsche-Museum","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Porsche-Museum_from_West.JPG","page_title":"Porsche-Museum","context_page_description":"Porsche-Museum är ett museum i Stuttgart som visar fordon från Porsche.\\nPorsche-Museum ligger på Porsche-Platz i stadsdelen Zuffenhausen."},{"page_url":"https://sh.wikipedia.org/wiki/Aveize_(Rona)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Aveize.jpg","page_title":"Aveize (Rona)","context_page_description":"Avez je naselje i opština u istočnoj Francuskoj u regionu Rona-Alpi, u departmanu Rona koja pripada prefekturi Lion.\\nPo podacima iz 1999. godine u opštini je živelo 940 stanovnika, a gustina naseljenosti je iznosila 56 stanovnika/km². Opština se prostire na površini od 16,64 km². Nalazi se na srednjoj nadmorskoj visini od 800 metara."},{"page_url":"https://hu.wikipedia.org/wiki/Lehoczky_Tivadar","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6b/Lehoczky_Tivadar.jpg","page_title":"Lehoczky Tivadar","context_page_description":"Lehoczky Tivadar uradalmi főügyész, régész, történész, néprajzkutató, Bereg vármegye történetének kutatója."},{"page_url":"https://sv.wikipedia.org/wiki/Terme_Vigliatore","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Merchesana_beach_in_Terme_Vigliatore%2C_Sicily.JPG","page_title":"Terme Vigliatore","context_page_description":"Terme Vigliatore är en ort och kommun i storstadsregionen Messina, innan 2015 i provinsen Messina, i regionen Sicilien i sydvästra Italien. Kommunen hade 7 359 invånare."},{"page_url":"https://hr.wikipedia.org/wiki/Kuna_gora","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Kostelgrad.JPG","page_title":"Kuna gora","context_page_description":"Kuna gora, Kostelska gora, gora u Hrvatskoj. Mjestimice je zapisana u obliku Kuna-gora ili Kuna gora, a s obzirom na tendenciju u hrvatskom jeziku da se polusloženice i složeni pojmovi gdje je to moguće stapaju u jedinstvenu riječ, složenicu, preporučuje se oblik Kunagora.\\nKorijen oronima je od dviju riječi: kuna i gora. Značenje je \\"gora u kojoj ima kuna\\". Kuna i danas žive na gori, a u stara vremena bilo ih je više i bile su znatno važnije jer se njihovim krznom kunovinom plaćalo.\\nNa Kuni gori odnosno na brdu Kostelju koje se nastavlja na Kuna goru nalazi se Kostelski grad. lovačka čeka kod vrha, lovačka kuća i planinarski dom Kuna gora podignut 1953. na jugoistočnom obronku, kapela, podrum, obnovljeno Prasvetište Gospe Kunagorske s tronom Kunagorske Gospe od Pobjede koji je izgrađen tijekom kolovoza 2006. na temeljima kunagorskog prasvetišta. Gora je šumovita i pokrivena crnogoricom. Oko Kune gore teče rječica Kosteljina."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%BE_%D0%BF%D1%80%D0%B2%D0%B5%D0%BD%D1%81%D1%82%D0%B2%D0%BE_%D1%83_%D0%B0%D1%82%D0%BB%D0%B5%D1%82%D0%B8%D1%86%D0%B8_%D0%BD%D0%B0_%D0%BE%D1%82%D0%B2%D0%BE%D1%80%D0%B5%D0%BD%D0%BE%D0%BC_2019_%E2%80%94_10.000_%D0%BC%D0%B5%D1%82%D0%B0%D1%80%D0%B0_%D0%B7%D0%B0_%D0%B6%D0%B5%D0%BD%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/DOH20250_hassan_10000m.jpg","page_title":"Светско првенство у атлетици на отвореном 2019 — 10.000 метара за жене","context_page_description":"Трка на 10.000 метара у женској конкуренцији на Светском првенству у атлетици 2019. у Дохи Катар одржана је 28. септембра на стадиону Khalifa International Stadium.\\nТитулу светске првакиње из Лондона 2017. није бранила Алмаз Ајана из Етиопије."},{"page_url":"https://en.wikipedia.org/wiki/International_Red_Cross_and_Red_Crescent_Movement","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Original_Geneva_Conventions.jpg","page_title":"International Red Cross and Red Crescent Movement","context_page_description":"The International Red Cross and Red Crescent Movement is an international humanitarian movement with approximately 97 million volunteers, members and staff worldwide which was founded to protect human life and health, to ensure respect for all human beings, and to prevent and alleviate human suffering.\\nThe movement consists of several distinct organizations that are legally independent from each other, but are united within the movement through common basic principles, objectives, symbols, statutes and governing organisations. The movement's parts are:\\nThe International Committee of the Red Cross is a private humanitarian institution founded in 1863 in Geneva, Switzerland, in particular by Henry Dunant and Gustave Moynier. Its 25-member committee has a unique authority under international humanitarian law to protect the life and dignity of the victims of international and internal armed conflicts. The ICRC was awarded the Nobel Peace Prize on three occasions.\\nThe International Federation of Red Cross and Red Crescent Societies was founded in 1919 and today it coordinates activities between the 190 National Red Cross and Red Crescent Societies within the Movement."},{"page_url":"https://eu.wikipedia.org/wiki/Ca%C3%B1izar_del_Olivar","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Ca%C3%B1izar_del_Olivar%2C_Teruel%2C_Espa%C3%B1a%2C_2017-01-04%2C_DD_90.jpg","page_title":"Cañizar del Olivar","context_page_description":"Cañizar del Olivar Teruelgo udalerria da, Cuencas Mineras eskualdean dagoena.\\n2009ko urtarrilaren 1eko erroldaren arabera 117 biztanle zituen."},{"page_url":"https://eu.wikipedia.org/wiki/Vannes","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Porte_Saint-Vincent_%28Vannes%29_%281%29.JPG","page_title":"Vannes","context_page_description":"Vannes Frantziako Bretainia eskualdearen hego-ekialdean dagoen hiria eta Morbihan departamenduko eta Bro Gwened lurralde historikoaren hiriburua da. 2013ko erroldaren arabera 53.032 biztanle ditu. Bretainierazko hiztunek bertako dialektoa hitz egiten dute."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%9C%E5%BC%97%E9%87%8C%E6%96%AF%E5%85%B0%E5%8F%B7%E6%88%98%E5%88%97%E8%88%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Captured_German_ships_off_the_Virginia_Capes_in_July_1921.jpg","page_title":"东弗里斯兰号战列舰","context_page_description":"东弗里斯兰号战列舰是德意志帝国海军黑尔戈兰级战列舰的第二艘舰，以东弗里斯兰地区命名。该舰于1908年10月在威廉港的帝国船厂进行龙骨架设，1909年9月30日下水，并于1911年8月1日投入舰队服役。它在六座双联装炮塔中装备有十二门305毫米50倍径速射炮，最高航速为21.2节。东弗里斯兰号在服役生涯的大部分时间都被编入公海舰队的第一战列分舰队，包括第一次世界大战。\\n连同其姊妹舰黑尔戈兰号、奥尔登堡号和图林根号一起，东弗里斯兰号参加了一战期间于北海针对英国大舰队的主要舰队行动，其中包括1916年5月31日至6月1日爆发的日德兰海战，这是战争中最大规模的海战。该舰同样有在波罗的海展开针对俄国海军的行动，于1915年8月首次入侵里加湾时在场。\\n1918年11月，当德国战败后，公海舰队大部于和平谈判期间都被扣留于英国斯卡帕湾，然而，4艘黑尔戈兰级舰只却被允许留在德国，因而避免了舰队在斯卡帕湾的自沉事件。它们作为战争赔偿交付予协约国；其中东弗里斯兰号被移交至美国海军。该舰最终于1921年7月在弗吉尼亚海岬进行的空中力量演示中用作靶舰被击沉。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_Michigan_State_Historic_Sites_in_Branch_County","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/State_Public_School_at_Coldwater.jpg","page_title":"List of Michigan State Historic Sites in Branch County","context_page_description":"The following is a list of Michigan State Historic Sites in Branch County, Michigan. Sites marked with a dagger are also listed on the National Register of Historic Places in Branch County, Michigan."},{"page_url":"https://en.wikipedia.org/wiki/Aging_in_dogs","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0c/13-year-old_Cairn_Terrier.jpg","page_title":"Aging in dogs","context_page_description":"Aging in dogs varies from breed to breed, and affects the dog's health and physical ability.\\nAs with humans, advanced years often bring changes in a dog's ability to hear, see and move about easily. Skin condition, appetite and energy levels often degrade with geriatric age, and medical conditions such as cancer, kidney failure, arthritis, dementia, and joint conditions, and other signs of old age may appear.\\nThe changes in care often required by an older dog may lead a non-experienced owner to release the animal to a shelter or rescue organization. Non-profit groups have sprung up in response to the growing need for senior dog rescue.\\nThe aging profile of dogs varies according to their adult size: smaller dogs often live over 15–16 years, medium and large size dogs typically 10 to 13 years, and some giant dog breeds such as mastiffs, often only 7 to 8 years. The latter reach maturity at a slightly older age than smaller breeds—giant breeds becoming adult around two years old compared to the norm of around 13–15 months for other breeds."},{"page_url":"https://en.wikipedia.org/wiki/Suha_Mic%C4%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Suha_Mica.JPG","page_title":"Suha Mică","context_page_description":"The Suha Mică is a right tributary of the river Moldova in Romania. It discharges into the Moldova near Mălini. Its length is 26 km and its basin size is about 125 km²."},{"page_url":"https://fr.wikipedia.org/wiki/Manzanares_(Castille-La_Manche)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/Manzanares.png","page_title":"Manzanares (Castille-La Manche)","context_page_description":"Manzanares est une commune d'Espagne de la province de Ciudad Real dans la communauté autonome de Castille-La Manche."},{"page_url":"https://et.wikipedia.org/wiki/Kalakasvatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Aquaculture_in_Lo-nguong.jpg","page_title":"Kalakasvatus","context_page_description":"Kalakasvatus on akvakultuuri ehk vesiviljeluse haru, mis tegeleb kalade kasvatamisega kalakasvandustes peamiselt inimeste toiduks. Kalakasvatus varustab ka looduslikke veekogusid noorkaladega, tugevdamaks olemasolevaid looduslikke või taasloomaks juba hävinud populatsioone. Kuna Eestis kasvatatakse peale kalade vaid väikeses mahus vähki, siis peetakse sageli vesiviljelust ja kalakasvatust sünonüümideks.\\nLevinumad kasvatatavad kalad on lõhe, karpkala, huntahven, tilaapia, säga, arktika paalia jpt.\\nEestis kasvatatakse põhiliselt vikerforelli ja karpkalu."},{"page_url":"https://no.wikipedia.org/wiki/R%C3%B8d%C3%B8ya_(Alstahaug)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Norway_-_R%C3%B8d%C3%B8ya%2C_Alstahaug.png","page_title":"Rødøya (Alstahaug)","context_page_description":"Rødøya er ei øy i Alstahaug kommune, Nordland. Den har et areal på 7,3 km² og 40 innbyggere. Øya ligger helt ytterst i Vefsnfjorden, og mellom Rødøya og fastlandet ligger Tangsundet.\\nØyas høyeste fjell er Rødøyfjellet. Det er bergartene duinitt/serpentinitt som gir øya sin karakteristiske farge."},{"page_url":"https://nl.wikipedia.org/wiki/Boswellia_ameero","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Transactionsofro311888roy_0567.jpg","page_title":"Boswellia ameero","context_page_description":"Boswellia ameero is een soort uit de familie Burseraceae. De soort is endemisch op het eiland Socotra, gelegen in de Indische Oceaan ten zuiden van Yemen. De soort komt daar voor in droge bossen met bladverliezende bomen en groeit voornamelijk op hoogtes tussen de 500 en 750 meter. De populaties van de soort komen verspreid voor op het eiland en zijn enigszins gefragmentariseerd. De soort wordt soms gebruikt voor de hars, maar niet voor commercieel gewin.\\nDe soort staat op de Rode Lijst van de IUCN geklasseerd als 'kwetsbaar'."},{"page_url":"https://pt.wikipedia.org/wiki/Kn%C3%B6del","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Plum_Dumpling.jpg","page_title":"Knödel","context_page_description":"Knödel, Kloß ou Kloss, canedele ou, ainda, Knedlíky é uma bola de massa feita a base de pão, farinha e especiarias, servida como refeição principal ou acompanhamento nas gastronomias da Áustria, Itália, Alemanha, Suíça, Boémia, e nas regiões de colonização tirolesa e alemã do sul do Brasil.\\nNas áreas de colonização alemã no sul do Brasil, o Kloß é considerado um dos pratos tradicionais e um legado culinário do regionalismo germânico.\\nExistem muitos nomes para este prato versátil, dependendo da região. Sua origem parece ser realmente o Tirol, onde é servido tradicionalmente em uma sopa ou como acompanhamento. A especialidade pode ser preparada com farinha de trigo, semolina, batatinha inglesa, pão velho, temperos e linguiça.\\nTécnica básica de preparação: Todo o Knödel deve flutuar na água fervente uma vez pronto para ser servido.\\nVale notar que vários povos europeus possuem suas próprias versões de Knödel. Basicamente, ele difere do Spätzle, também soletrado Spaetzle, por ser bem maior em tamanho.\\nNa cidade catarinense de Treze Tílias, fundada por imigrantes austríacos originários principalmente do Tirol, ocorre todos os anos a Knödelfest, sempre no mês de julho."},{"page_url":"https://it.wikipedia.org/wiki/Pieve_di_San_Giovanni_Evangelista_(Montelupo_Fiorentino)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Visitazione%2C_Pieve_di_San_Giovanni_Evangelista_%28Montelupo_Fiorentino%29.jpg","page_title":"Pieve di San Giovanni Evangelista (Montelupo Fiorentino)","context_page_description":"La pieve di San Giovanni Evangelista si trova a Montelupo Fiorentino, a pochi passi dall'ex-Palazzo Podestarile."},{"page_url":"https://pt.wikipedia.org/wiki/Aeroporto_Internacional_de_Salt_Lake_City","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Slc_domestic_nonstop.png","page_title":"Aeroporto Internacional de Salt Lake City","context_page_description":"O Aeroporto Internacional de Salt Lake City é um aeroporto, localizado na cidade norte-americana de Salt Lake City, em Utah. Está localizado no oeste de Salt Lake City, cerca de 4 km do distrito central de negócios. É atualmente o único aeroporto com serviço de linha aérea comercial no Wasatch Front e seus concelhos circundantes e é o aeroporto comercial mais próximo para mais de 2,5 milhões de pessoas residentes na área.\\nUm total de 20 790 400 passageiros, voou através do Aeroporto Internacional de Salt Lake City em 2008, representando um decréscimo de 5,7% a partir de 2007. O aeroporto está, atualmente, como o vigésimo terceiro aeroporto mais movimentado nos Estados Unidos em termos do total de passageiros. Houve 389.321 operações de aeronaves registradas em 2008, representando aproximadamente 1.063 operações por dia. O aeroporto está atualmente na décima quinta posição entre os aeroportos mais movimentados nos Estados Unidos e vigésima terceira posição mundial com base em operações de aeronaves."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B5%D0%BF%D0%B0%D1%80%D0%B0%D1%82%D0%BE%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Dec_Cen.png","page_title":"Сепаратор","context_page_description":"Сепара́тор — апарат, призначений для розділення певного продукту на фракції з різними фізичними або хімічними характеристиками — за густиною, магнітними, електричними або іншими властивостями."},{"page_url":"https://nn.wikipedia.org/wiki/Urea","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8a/Urea_3D_ball.png","page_title":"Urea","context_page_description":"Urea er eit amid med kjemisk formel CH₄N₂O. Det vil seia ei organisk sambinding som inneheld nitrogen og ei karbonylgruppe. Sambindinga er òg kjend under namna urinstoff og karbamid. Det systematiske namnet er karbonsyrediamid. Reint urea er eit kvitt, krystallinsk, luktfritt stoff."},{"page_url":"https://el.wikipedia.org/wiki/Renault_F1_Team","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/1985_European_GP_Tambay.jpg","page_title":"Renault F1 Team","context_page_description":"Η Ρενώ Σπορ Φόρμουλα 1 είναι ομάδα της Φόρμουλα 1, θυγατρική της αυτοκινητοβιομηχανίας Ρενώ. Αποτελεί συνέχεια της Ρενώ Φόρμουλα 1 και της παλαιάς Ρενώ Σπορ. Με τη σημερινή της μορφή, εισήλθε στη Φόρμουλα 1 το 2016.\\nΕίναι μία από τις λίγες ομάδες που αδιαλείπτως κατασκευάζει η ίδια ολόκληρο το μονοθέσιο. Το αμάξωμα κατασκευάζεται στο Ένστοουν, ένα χωριό της νοτιοανατολικής Αγγλίας κοντά στην Οξφόρδη, όπου τυπικά εδρεύει η ομάδα, και ο κινητήρας σε ένα εργοστάσιο της Ρενώ στο Παρίσι."},{"page_url":"https://de.wikipedia.org/wiki/Greiss_zu_Wald","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Pyhra_Pfarrkirche11.jpg","page_title":"Greiss zu Wald","context_page_description":"Die Greiss zu Wald waren ein altes ursprünglich thüringisches Rittergeschlecht, das um 1500 unter Maximilian I. nach Österreich kam und 1607 in den Freiherrnstand erhoben wurde."},{"page_url":"https://no.wikipedia.org/wiki/Munkedamsveien_(Oslo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/House_of_Oslo_i_Rusel%C3%B8kkveien.jpg","page_title":"Munkedamsveien (Oslo)","context_page_description":"Munkedamsveien er en gate i Oslo som går fra Stortingsgata på nedsiden av rundkjøringen nedenfor Abelhaugen gjennom Vika og til Skillebekk. Gaten ligger i bydelene Oslo sentrum og Frogner.\\nFørste del av gaten, fra Stortingsgata til en rundkjøring nær E18s tunnelåpning ved Filipstad, inngår i Ring 1. Det meste av denne delen går gjennom et område som har endret utseende dramatisk i løpet av veiens historie. Vikaområdet ble sanert på 1950- og 1960-tallet. Piperviken småkirke og den slummen som var i området, er revet og erstattet med kontor- og forretningsbygg. Konserthuset åpnet i 1977, og på 2010-tallet er det byggevirksomhet på sørsiden, der Nasjonalmuseets nybygg blir oppført. På nordsiden i Filipstad-enden er enkelte bygårder fra 1800-tallet.\\nEtter nevnte rundkjøring dreier gaten mot nordvest og endrer karakter. Den krysser en tidligere jernbanebro og er stengt med en bom som bare slipper busser igjennom. Vest for denne delen ligger Filipstad løkke, der nye næringslokaler er under oppføring på 2010-tallet, og nord for jernbanelinjen er løkkens gartnerbolig."},{"page_url":"https://sh.wikipedia.org/wiki/Hohenfels_(Oberpfalz)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/09/Hohenfels_in_NM.svg","page_title":"Hohenfels (Oberpfalz)","context_page_description":"Hoenfels je grad u njemačkoj saveznoj državi Bavarska. Jedno je od 19 opštinskih središta okruga Nojmarkt. Prema procjeni iz 2010. u gradu je živjelo 2.154 stanovnika. Posjeduje regionalnu šifru 9373134."},{"page_url":"https://en.wikipedia.org/wiki/Emmel_Building","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fd/Emmel_Blg_Wells_St.JPG","page_title":"Emmel Building","context_page_description":"The Emmel Building is an historic building located at 1357 North Wells Street in the Near North Side neighborhood of Chicago, Illinois. The building is an example of a store and flat building, with a commercial space on the first floor and residential space on the upper two floors. Peter Emmel, a painter and interior decorator who came to Chicago from Germany in 1854, had the building built for his business and family. The building has an Italianate design with intricate carved stone on the second and third floors of the front facade. A metal cornice with brackets and a gable tops the building. While the building's layout is similar to the store and flat buildings of the commercial district to the south, its architecture is closer to that of the homes in the nearby Gold Coast.\\nThe building was added to the National Register of Historic Places on November 13, 1984."},{"page_url":"https://en.wikipedia.org/wiki/Richard_N%C3%BA%C3%B1ez","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Richard_Nunez.JPG","page_title":"Richard Núñez","context_page_description":"Richard Darío Núñez Pereyra is a retired Uruguayan footballer."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%B8%E0%B1%8D%E0%B0%9F%E0%B0%BE%E0%B0%AA%E0%B1%8D_%E0%B0%AE%E0%B1%8B%E0%B0%B7%E0%B0%A8%E0%B1%8D_%E0%B0%AF%E0%B0%BE%E0%B0%A8%E0%B0%BF%E0%B0%AE%E0%B1%87%E0%B0%B7%E0%B0%A8%E0%B1%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Moving_Penny.gif","page_title":"స్టాప్ మోషన్ యానిమేషన్","context_page_description":"స్టాప్ మోషన్ యానిమేషన్ ఒక్కొక్క కదలికని ఆపుతూ చిత్రీకరణ. ఇది ఒక యానిమేషన్ విధానం. ఒక వస్తువును కొంచెం కదిపి, ఆపి, ఫొటో తీసి, మళ్ళీ కొంచెం కదిపి, ఫొటో తీసి .. ఇలా చేస్తూ సాధించే సాంకేతిక ప్రక్రియే \\"స్టాప్ మోడన్ యానిమేషన్\\". ఇలా చేసిపుడు ఆ వస్తువు నిజంగా కదులుతున్న ఎఫెక్ట్ వస్తుంది. ఈ టెక్నిక్‌ను క్లే యానిమేషన్‌లో సాధారణంగా వాడుతారు. ఎందుకంటే మెత్తని మట్టి బొమ్మల అవయవాలను కొంచెం కొంచెంగా కదపడం సులభం.\\nపిల్లల చిత్రాలు, టెలివిజన్ రూపకాలలో ఇలాంటి టెక్నిక్ సర్వ సాధారణం. \\"గంబీ\\" అనేది ఈ తరహా చిత్రాలలో ప్రసిద్ధిచెందింది. కొన్ని టెక్నిక్‌లలో ఆ మట్టిబొమ్మ షేపు ఒకో ఫ్రేములోను మారుతుంది. దీనిని \\"freeform\\" clay animation అంటారు. మరొక విధానంలో బొమ్మ షేపులు పెద్దగా మారవు. దీనిని \\"character\\" clay animation అంటారు.\\nఉపకరణాలు\\nబంక మట్టి\\nబొమ్మలు\\nవస్తువులు\\nకాగితం\\nపెన్సిల్\\nకలం\\nరంగులు\\nచిత్రీకరణకి కావలసిన బల్ల\\nతుడిపివేతకి కావలసిన రబ్బర్\\nయానిమేషన్ పరిజ్ఞానం, చిత్రీకరణ తెలిసిన నిపుణులు\\nకథ\\nమాటలు\\nపాటలు\\nసంగీతం\\nకూర్పరి\\nదర్శకుడు లేదా దర్శకురాలు\\nకెమేరా\\nవిడుదల చేసే ప్రింట్\\nఇతర ఉపకరణాలు"},{"page_url":"https://zh.wikipedia.org/wiki/%E8%8E%8E%E6%8B%89%E4%B8%BD%C2%B7%E6%A1%91%E6%9D%BE%E5%8D%A1%E5%A7%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Sudket_%26_Saralee.jpg","page_title":"莎拉丽·桑松卡姆","context_page_description":"莎拉麗·桑松卡姆，泰國女子羽球運動員，專長雙打項目。"},{"page_url":"https://hu.wikipedia.org/wiki/Jujuy_tartom%C3%A1ny","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Vicuna_near_Arequipa.jpg","page_title":"Jujuy tartomány","context_page_description":"Jujuy egyike Argentína 23 tartományának."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%80%D0%BE%D1%81%D1%84%D0%BE%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Chinese_Orthodox_communion_bread_seal.jpg","page_title":"Просфора","context_page_description":"Просфора́, устар. просвира́ — богослужебный литургический хлеб, употребляемый в православии для таинства Евхаристии и для поминания во время Проскомидии живых и мёртвых.\\nСвоим происхождением просфора уходит в глубокую древность. В Ветхом Завете упоминается заповедь о принесении хлеба в жертву: «пусть он приносит в приношение своё квасный хлеб, при мирной жертве благодарной». В скинии Моисея находились хлеба предложения, состоящие из двух частей, что символизировало хлеб земной и небесный, то есть два начала, Божественное и человеческое."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%AF%94%E5%88%A9%C2%B7%E5%8C%85%E4%BE%9D%E5%BE%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Billy_Boyd.jpg","page_title":"比利·包依德","context_page_description":"比利·包依德是一位蘇格蘭演員兼歌手。他曾在彼得·傑克森的史詩電影《指環王三部曲》中飾演哈比人皮聘，在《怒海爭鋒：極地征伐》裡飾演Barret Bonden，以及在《鬼娃新娘之鬼娃也有種》裡飾演格倫。"},{"page_url":"https://es.wikipedia.org/wiki/Villacarral%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Ermita_de_Nuestra_Se%C3%B1ora_del_Carmen_de_Villacarral%C3%B3n.jpg","page_title":"Villacarralón","context_page_description":"Villacarralón es un municipio de España, en la provincia de Valladolid, comunidad autónoma de Castilla y León. Tiene una superficie de 17,54 km² con una población de 79 habitantes y una densidad de 4,5 hab/km²."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B0%D1%85%D0%B0%D0%91%D1%80%D0%B0%D1%85%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bc/DakhaBrakha_-_Marko_Halanevych.JPG","page_title":"ДахаБраха","context_page_description":"«ДахаБраха» — украинская группа, играющая в стиле «этно-хаос», связанном с этнической музыкой разных народов. Лауреат премии Сергея Курёхина.\\nОрганизатором, художественным руководителем группы является Владислав Троицкий."},{"page_url":"https://vi.wikipedia.org/wiki/Kameni%C4%8Dn%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/MG_6688_panorama-Kameni%C4%8Dn%C3%A1_1.jpg","page_title":"Kameničná","context_page_description":"Kameničná là một làng thuộc huyện Ústí nad Orlicí, vùng Pardubický, Cộng hòa Séc."},{"page_url":"https://es.wikipedia.org/wiki/Collegio_Romano","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/LoggeCollegioRomano.jpg","page_title":"Collegio Romano","context_page_description":"El Collegio Romano fue creado por San Ignacio de Loyola en 1551, luego de la fundación de la Compañía de Jesús, con el objetivo de cubrir todo el periodo formativo, desde los estudios elementales a los universitarios."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AF%D0%BD%D1%91%D0%B2%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/%D0%A6%D0%B5%D1%80%D0%BA%D0%BE%D0%B2%D1%8C_%D0%9A%D0%B0%D0%B7%D0%B0%D0%BD%D1%81%D0%BA%D0%BE%D0%B9_%D0%B8%D0%BA%D0%BE%D0%BD%D1%8B_%D0%91%D0%BE%D0%B6%D0%B8%D0%B5%D0%B9_%D0%9C%D0%B0%D1%82%D0%B5%D1%80%D0%B8._%D0%AF%D0%BD%D1%91%D0%B2%D0%BE.jpg","page_title":"Янёво","context_page_description":"Янёво — село в Суздальском районе Владимирской области России, входит в состав Селецкого сельского поселения."},{"page_url":"https://nl.wikipedia.org/wiki/Margie_Morris","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/MargieMorrisMerkelbach1917.jpg","page_title":"Margie Morris","context_page_description":"Margaret Sarah Whitefoot was een Engels componiste, actrice, revueartieste, pianiste, muzikante, danseres en zangeres die gedurende de jaren 10 en 20 van de 20e eeuw werkzaam was in Nederland onder de artiestennaam Margie Morris."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%AB%98%E5%B0%BE%E8%92%BC%E9%A6%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/DDT_%E9%AB%98%E5%B0%BE%E8%92%BC%E9%A6%AC%E9%81%B8%E6%89%8B%282020-2%29.jpg","page_title":"高尾蒼馬","context_page_description":"高尾 蒼馬は、DDTプロレスリングに所属する日本のプロレスラー。東京都大田区出身。"},{"page_url":"https://tt.wikipedia.org/wiki/%D0%A0%D1%83%D0%B2%D1%80-%D1%81%D1%83-%D0%9C%D0%B5%D0%B9%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Rouvres-sous-Meilly--mairie%2C_%C3%A9cole_et_%C3%A9glise.JPG","page_title":"Рувр-су-Мейи","context_page_description":"Рувр-су-Мейи — Франциянең Кот-д’Ор департаментына караган коммуна, Пуйи-ан-Осуа кантонына карый."},{"page_url":"https://es.wikipedia.org/wiki/Gobierno_Valls","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Juliette_M%C3%A9adel.jpg","page_title":"Gobierno Valls","context_page_description":"El gobierno Manuel Valls es el 37º gobierno francés de la quinta República Francesa.\\nFue formado el 31 de marzo de 2014, después de la confirmación de la lista, propuesta por el Primer Ministro Manuel Valls al Presidente de la República, François Hollande. Está compuesto por miembros del Partido Socialista, y del Partido Radical de Izquierda.​\\nActualmente está compuesto por 9 mujeres y 9 hombres más el primer ministro."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B5%D1%80%D0%BF%D1%83%D1%85%D0%BE%D0%B2_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D1%96%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Serpukhov_railstation.JPG","page_title":"Серпухов (станція)","context_page_description":"Сéрпухов — вузлова залізнична станція 1-го класу Курського напрямку Московської залізниці у підмосковному місті Серпухов. Станція відноситься до 11-ї тарифної зони і входить до складу Московсько-Курського центру організації роботи залізничних станцій ДЦС-1 Московської дирекції управління рухом.\\nВід залізничної станції Серпухов відгалужуються дві неелектрифіковані залізничні лінії, що обслуговують промислові підприємства — одна на станцію Пост 4 км, інша на станцію ППЗТ. Станція Пост 4-й км є невеликою вузловою станцією, від якої крім відгалужень на промислові підприємства виходять ще дві неелектрифіковані залізничні лінії — одна на станцію Серпухов-2, інша в місто Протвіно. Станції Серпухов-2 і ППЗТ обслуговують тільки промислові підприємства.\\nСтанція Пост 4 км обслуговує ЗАТ «Роллтон», ФГУП «75-й арсенал», ТОВ «Екоресурс». Станція Серпухов-2 обслуговує вугільний склад. Станція ППЗТ обслуговує 250-й завод залізно-бетонних виробів, нафтобази «Ока-Ойл», ЗАТ «Керамзит», ЗАТ Бетонтранссервіс, Підприємства Вторчормета на Борисовському і Окському шосе."},{"page_url":"https://sv.wikipedia.org/wiki/Milit%C3%A4ra_grader_i_La_grande_arm%C3%A9e","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Grande_Arm%C3%A9e_-_1st_Regiment_of_Hussars.jpg","page_title":"Militära grader i La grande armée","context_page_description":"Militära grader och deras gradbeteckningar i Napoleons ”la grande armée” visas nedan. Officerare och högsta underofficersgraden bar gradbeteckningar i form av epåletter, underofficerare och korpraler i form av galoner på ärmarna."},{"page_url":"https://es.wikipedia.org/wiki/Ratha_yatra","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Rathajatrawpuri.jpg","page_title":"Ratha yatra","context_page_description":"El Ratha-iatra es un enorme festival hinduista asociado a la adoración de Yáganat, conmemorado en la ciudad de Puri, en el estado de Orissa, en el este de la India, durante el mes de junio. Es el festival más importante de la ciudad y que incluye la adoración a Yagannātha en los alrededores del templo, lo que constituye parte esencial del folclor del área. El festival celebra la visita de Yagannātha al templo de la reina Gundicha."},{"page_url":"https://pt.wikipedia.org/wiki/Turnu_Ruieni","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Turnu_Ruieni_jud_Caras-Severin.png","page_title":"Turnu Ruieni","context_page_description":"Turnu Ruieni é uma comuna romena localizada no distrito de Caraș-Severin, na região histórica do Banato. A comuna possui uma área de 160.91 km² e sua população era de 3581 habitantes segundo o censo de 2007."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B5%8A%E5%8E%BF%E5%9F%8E%E5%A2%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/City_of_Sheng_County_in_1934.png","page_title":"嵊县城墙","context_page_description":"嵊县城墙为旧嵊县县城城墙，位于今中国浙江省嵊州市剡湖街道，现存原南侧长约1001.2米的墙段，其外侧以条石叠砌，内侧用块石垒筑，中间填土，高约3.30-4.80米，上宽4.90-6.50米。2003年对嵊州文化广场段城墙进行修缮，恢复城堞、城台和南门拱券。\\n嵊县建置源于西汉景帝四年所置剡县，县治本在剡溪东岸，三国东吴时县令贺齐迁县治于今址并始筑城墙，另唐初曾在今址西南建剡州城，后废。元代时已有五门，分别为东门东曦门、南门望仙门、西门西城门、北门通越门以及西门与南门之间的化龙门。明洪武时信国公汤和拆除城墙以筑临山卫城，至嘉靖三十四年为防倭寇侵扰，知县吴三畏按故址重筑城墙。城墙北跨鹿胎山，南临剡溪，其沿江部分兼可防御水患。城周一千三百丈余，厚一丈余，高二丈余，最初设城门四座，均外有瓮城、上有城楼，分别为东门拱明门、凝翠楼；南门应台门、可远楼；西门来白门、长青楼；北门望越门、迥峰楼，设窝铺二十四座，敌台四座。万历十二年知县万民纪重开化龙门。民国二十四年增开襟带门，二十七年拆除北侧沿山城墙，三十五年拆除南门瓮城。1950年增开解放门，1959年拆除自东门经北门至百道岭的城墙，移建为自东门起与东圃堤相接的防洪墙。\\n原城内主要街道有市心街、东前街、东后街、西前街、西后街和司前街等，以连接应台门与县署的市心街为主街。城南西门与南门外分别有跨河桥梁西桥与南桥，分别建于明弘治年间和嘉靖二十六年，民国五年又在东门外建东桥。城内主要建筑有县署、学宫、城隍庙与溪山第一楼、惠安寺及应天塔和剡山书院等。"},{"page_url":"https://en.wikipedia.org/wiki/Network_topology","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Fibreoptic.jpg","page_title":"Network topology","context_page_description":"Network topology is the arrangement of the elements of a communication network. Network topology can be used to define or describe the arrangement of various types of telecommunication networks, including command and control radio networks, industrial fieldbusses and computer networks.\\nNetwork topology is the topological structure of a network and may be depicted physically or logically. It is an application of graph theory wherein communicating devices are modeled as nodes and the connections between the devices are modeled as links or lines between the nodes. Physical topology is the placement of the various components of a network, while logical topology illustrates how data flows within a network. Distances between nodes, physical interconnections, transmission rates, or signal types may differ between two different networks, yet their logical topologies may be identical. A network’s physical topology is a particular concern of the physical layer of the OSI model.\\nExamples of network topologies are found in local area networks, a common computer network installation."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau-Vou%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Ch%C3%A2teau-Vou%C3%A9.jpg","page_title":"Château-Voué","context_page_description":"Château-Voué est une commune française située dans le département de la Moselle, en région Grand Est."},{"page_url":"https://fr.wikipedia.org/wiki/Saint-Jean-d%27Acre","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Israel_Akko2_tango7174.jpg","page_title":"Saint-Jean-d'Acre","context_page_description":"Saint-Jean-d’Acre, appelée Acco ou Ptolémaïs dans l'Antiquité et au Moyen Âge, est le nom donné par les chrétiens à la ville qui deviendra plus tard Acre, située aujourd'hui en Israël. La prise de Saint-Jean-d'Acre en 1291 par les Mamelouk aboutit à la fin du royaume de Jérusalem et clôt la période des croisades médiévales."},{"page_url":"https://es.wikipedia.org/wiki/Fundaci%C3%B3n_Cetreros_de_Venezuela","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/1erEncuentroNacionalCetrerosDeVenezuela.jpg","page_title":"Fundación Cetreros de Venezuela","context_page_description":"Fundación Cetreros de Venezuela es una organización no gubernamental sin fines de lucro​ promovida por practicantes del arte de la cetrería, veterinarios y ecologistas, cuyos objetivos principales son el desarrollo de iniciativas para la consolidación del arte y la ciencia de la cetrería, su promoción y el manejo de aves rapaces con responsabilidad y ética ecológica.​"},{"page_url":"https://he.wikipedia.org/wiki/%D7%A4%D7%A8%D7%A9%D7%AA_%D7%9E%D7%90%D7%99%D7%99%D7%A8%D7%9C%D7%99%D7%A0%D7%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Mayerling_1889.jpg","page_title":"פרשת מאיירלינג","context_page_description":"פרשת מאיירלינג או תקרית מאיירלינג הוא הכינוי שניתן למותם של רודולף, ארכידוכס אוסטריה ואהובתו הברונית מרי וטסרה. רודולף היה בנו היחיד של פרנץ יוזף הראשון, קיסר אוסטריה ואליזבת, נסיכת בוואריה, וככזה היה מיועד לרשת את כתר האימפריה האוסטרו-הונגרית עם מותו של אביו. מרי וטסרה הייתה בתו של הדיפלומט הברון אלבין וטסרה. גופותיהם של רודולף בן ה-30 ומרי בת ה-17 התגלו בבקתת הציד של רודולף בעיירה מאיירלינג, כ-15 ק\\"מ דרומית-מערבית לעיר הבירה וינה, ב-30 בינואר 1889. ככל הנראה הם התאבדו, אם כי יש הגורסים שמדובר ברצח.\\nלמותו של רודולף הייתה השפעה הרסנית על ההיסטוריה של המאה ה-19. המוות קטע את הביטחון הטמון בקו המיידי של ההמשכיות השושלתית ההבסבורגית, וזעזע את האימפריה. מאחר שלרודולף לא היו ילדים, הועברה משרת יורש העצר לבן-דודו פרנץ פרדיננד, ארכידוכס אוסטריה, אשר היה בעל דעות ואישיות שונה לחלוטין. גם פרנץ פרדיננד לא זכה להגיע לשלטון, כיוון שב-1914 נרצח ביריות בסרייבו, רצח אשר הוביל למלחמת העולם הראשונה."},{"page_url":"https://az.wikipedia.org/wiki/Lu%C5%9Fan","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/63/%E8%8A%A6%E6%9E%97%E6%B9%96.JPG","page_title":"Luşan","context_page_description":"Luşan və ya Mount Lu — qədim zamanlarda Kuanglu adı ilə bilinən, Çinin cənub-şərqindəki Szyansi əyalətinin şimal hissəsindəki ən məşhur dağlardan biridir. Oval formalı dağlar təxminən 25 km uzunluğunda və 10 km genişliyindədir. Şimalda Şanxay şəhəri və Yanszı çayı, cənubda Nançanq şəhəri və Poyanq gölü ilə əhatə olunmuşdur. Dağın ən yüksək nöqtəsi Dahanyang təpəsidir və dəniz səviyyəsindən 1474 metr yüksəklikdədir. Mount Lu dağı möhtəşəmliyi, dikliyi və gözəlliyi ilə seçilir və Lushan Milli Parkı 1996-cı ildən bəri YUNESKO-nun Dünya İrsinə daxil edilmişdir və xüsusilə yay aylarında hava soyuduğunda bu yer turistləri özünə cəzb edir. Lushan Çindəki Qərb missionerləri üçün yay kurortu idi. Perl Bakın atası Avessalom Sidenstriker dağda daşınmaz əmlak alan ilk beş missionerdən bir idi."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B8%D0%BC%D0%BE%D0%BD%D0%BD%D0%B0%D1%8F_%D0%BA%D0%B8%D1%81%D0%BB%D0%BE%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Zitronens%C3%A4ure_Kristallzucht.jpg","page_title":"Лимонная кислота","context_page_description":"Лимо́нная кислота́ или — трёхосновная карбоновая кислота.\\nКристаллическое вещество белого цвета, температура плавления 153 °C. Хорошо растворима в воде, растворима в этиловом спирте, малорастворима в диэтиловом эфире. Является слабой кислотой. Соли и сложные эфиры лимонной кислоты называют цитратами."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B8%D0%BD%D0%B5%D0%B3%D0%BE%D1%80%D1%8C%D0%B5_(%D0%9F%D1%80%D0%B8%D0%BC%D0%BE%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D1%80%D0%B0%D0%B9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/%D0%A1%D0%B8%D0%BD%D0%B5%D0%B3%D0%BE%D1%80%D1%8C%D0%B5_%D0%9F%D1%80%D0%B8%D0%BC%D0%BE%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D1%80%D0%B0%D0%B9_%D1%841.JPG","page_title":"Синегорье (Приморский край)","context_page_description":"Синего́рье — село в Кавалеровском районе Приморского края России.\\nСело расположено на левом берегу реки Зеркальная, на автодороге Находка—Кавалерово. До ближайшего посёлка Горнореченский около 2 км, до районного центра Кавалерово около 7 км.\\nСело связано автобусным сообщением с райцентром, на трассе останавливаются междугородние автобусы, следующие в пос. Ольга.\\nОснова экономики — сельское хозяйство мясо-молочного направления, сбор дикоросов, лесоперерабатывающее производсьво.\\nЖители на работу ездят в Кавалерово или трудятся здесь же на пилорамах. Детей на учёбу возят в с. Устиновка.\\nВ селе мирно живут представители разных национальностей. Русские, украинцы, татары и др."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Hundsbach_(Haut-Rhin)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7f/Map_commune_FR_insee_code_68148.png","page_title":"Hundsbach (Haut-Rhin)","context_page_description":"Hundsbach sī ūi-tī Hoat-kok Alsace toā-khu Haut-Rhin koān ê chi̍t ê commune."},{"page_url":"https://fi.wikipedia.org/wiki/Hans_Rudi_Erdt","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Hans_Rudi_Erdt_%281883-1918%29_-_Opel.jpg","page_title":"Hans Rudi Erdt","context_page_description":"Hans Rudi Erdt oli saksalainen graafikko. Hän opiskeli Münchenin taideteollisessa oppilaitoksessa ja muutti Berliiniin vuonna 1905, missä hänestä tuli mainosgraafikko. Erdt sai töihinsä vaikutteita Ludwig Hohlweinilta ja Lucian Bernhardilta. Ensimmäisen maailmansodan aikana Erdt suunnitteli julisteita Saksan valtiolle."},{"page_url":"https://pl.wikipedia.org/wiki/Bansuri","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Dia5261_Hariprasad_Chaurasia.jpg","page_title":"Bansuri","context_page_description":"Bansuri – pochodzący z północnych Indii instrument z grupy aerofonów wargowych. Rodzaj fletu poprzecznego z otworem zadęciowym i sześcioma bądź siedmioma otworami palcowymi. Wykonany jest z jednego kawałka bambusa obwiązanego na końcach pierścieniami z mocnych nici, co zapobiega rozsychaniu drewna i wzmacnia konstrukcję. Nazwa instrumentu jest zbitką słów – „bans”, czyli bambus i „swar” – nuta. „Bansuri” jest nazwą najbardziej rozpowszechnioną na świecie, chociaż w rodzimych Indiach instrument ten jest znany również jako: „algoza”, „bansi”, „kolalu”, „kolavi”, „kukhl”, „murali”, „nar”, „pava”, „pillankuzhal”, „pillangrovi”, „pulangoil”, „vanu” czy „vamsi”."},{"page_url":"https://de.wikipedia.org/wiki/Super_Bowl_XXXVI","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c7/Kurt_Warner_on_USNS_Mercy_2-12-05_050212-N-6504N-007.jpg","page_title":"Super Bowl XXXVI","context_page_description":"Der Super Bowl XXXVI war der 36. Super Bowl, das Endspiel der Saison 2001 der National Football League im American Football. Es fand am 3. Februar 2002 im Louisiana Superdome von New Orleans statt, Kontrahenten waren der Meister der American Football Conference, die New England Patriots, und der Meister der National Football Conference, die St. Louis Rams. Die Patriots gewannen 20:17, und zum Super Bowl MVP wurde der Quarterback der Patriots, Tom Brady, gewählt."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D1%80%D1%8B%D0%B1%D0%BD%D1%8F%D0%BD%D1%81%D0%BA%D1%96_%D1%80%D0%B0%D1%91%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Sribnyanskiy_rayon_prapor.png","page_title":"Срыбнянскі раён","context_page_description":"Срыбнянскі раён — адміністрацыйная адзінка ў складзе Чарнігаўскай вобласці Украіны. Адміністрацыйны цэнтр — Срыбнэ.\\nУтвораны ў 1923 годзе. Насельніцтва раёна на 1 лютага 2015 года складае 11501 чалавек, плошча — 579 км²."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BF%D0%B0_%D0%95%D0%B2%D0%B3%D0%B5%D0%BD%D0%B8%D1%98%D0%B5_I","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/PopeeugeneI.jpg","page_title":"Папа Евгеније I","context_page_description":"Папа Еугеније I је био 75. папа од 10. августа 654. до 2. јуна 657."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D0%B0%D1%80%D0%B1%D0%BE%D0%BD%D0%B4%D0%B5%D1%98%D0%BB_(%D0%9A%D0%BE%D0%BB%D0%BE%D1%80%D0%B0%D0%B4%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Carbondale_Aerial.jpg","page_title":"Карбондејл (Колорадо)","context_page_description":"Карбондејл град је у америчкој савезној држави Колорадо."},{"page_url":"https://ms.wikipedia.org/wiki/Sekolah_Menengah_Kebangsaan_Ade_Putra","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Srttanda.jpg","page_title":"Sekolah Menengah Kebangsaan Ade Putra","context_page_description":"Sekolah Menengah Kebangsaan Ade Putra atau nama ringkasnya SMK Ade Putra, merupakan sebuah Sekolah menengah kebangsaan yang terletak di Masjid Tanah.\\nPada 2009, Sekolah Menengah Kebangsaan Ade Putra memiliki 376 orang pelajar lelaki dan 366 orang pelajar perempuan, menjadikan jumlah keseluruhan murid seramai 742 orang.²⁰⁰⁹\\nPada 2017, SMK Ade Putra mempunyai seramai 23 guru lelaki dan 42 orang guru perempuan serta 7 orang staf sokongan lelaki dan 9 orang staf sokongan perempun.²⁰¹⁷\\nKini setakat bulan Julai 2017, SMK Ade Putra mempunyai seramai 312 pelajar lelaki dan 293 pelajar perempuan. Terdapat 5 buah kelas tingkatan 1, 2 dan 3 serta 2 kelas Program Vokasional Menengah Atas dalam bidang penyediaan makanan. Selain itu, terdapat juga kelas Integrasi Kelas Khas Pembelajaran."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%86%D9%87%D8%B1_%D9%87%D8%AF%D8%B3%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/George_Washington_Bridge%2C_HAER_NY-129-66.jpg","page_title":"نهر هدسون","context_page_description":"نهر هدسون هو مجرى مائي يبلغ طوله 315 ميلا و يجرى النهر من الشمال إلى الجنوب، ويمر في شرق ولاية نيويورك في الولايات المتحدة الأمريكية. وينبع النهر من بحيرة هندرسن في نيوكومب، نيويورك."},{"page_url":"https://cs.wikipedia.org/wiki/Operace_Danny","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/LyddaAirportCapture.png","page_title":"Operace Danny","context_page_description":"Operace Danny byla izraelská vojenská ofenziva zahájená na konci prvního příměří izraelské války za nezávislost. Jejím cílem bylo dobytí území východně od Tel Avivu, postup směrem do vnitrozemí a ulehčení židovskému obyvatelstvu a vojákům v obleženém Jeruzalémě. Hlavními protivníky Izraelských obranných sil byla Arabská legie a palestinští dobrovolníci, kteří nebyli členy arabských armád. Operace byla zahájena 9. července 1948 na konci prvního příměří a trvala až do 19. července. Byla pojmenována po veliteli konvoje 35 Danny Massovi. Velitelem operace byl Jigal Alon a jeho zástupcem byl Jicchak Rabin.\\nV první fázi operace měla být dobyta města Lydda a Ramla, nacházející se jihovýchodně od Tel Avivu na cestě do Jeruzaléma. Ramla byla jednou z hlavních překážek blokujících židovskou dopravu. V druhé fázi operace měla být dobyta pevnost Latrun a mělo dojít k průlomu u Ramalláhu. Celou operaci provedly pod vedením Palmach brigády Jiftach, Harel, 8. obrněná brigáda a dva pluky brigád Kirjati a Alexandroni.\\nPrvní fáze operace byla úspěšná. Došlo při ní k dobytí obou zmíněných měst, mezinárodního letiště v Lyddě a strategicky významné železniční tratě."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%A7%E9%81%8B%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Error_in_Universiade_Station.jpg","page_title":"大運站","context_page_description":"大运站是深圳地铁的车站，属3号线、兴建中的14号线的中途站和16号线规划中的西端终点站。车站位于深圳市龙岗区园山街道龙岗大道8688号，近荷坳社区，该站3号线部分已于2010年12月28日正式启用，16号线部分预计在2020年后启用，而14号线部分则预计在2022年后启用。"},{"page_url":"https://de.wikipedia.org/wiki/1000-km-Rennen_von_Spa-Francorchamps_2010","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/AudiR15Plus_Nr9_Spa_2010.JPG","page_title":"1000-km-Rennen von Spa-Francorchamps 2010","context_page_description":"Das 27. 1000-km-Rennen von Spa-Francorchamps, auch 1000 Km de Spa Francorchamps, Spa-Francorchamps, fand am 9. Mai 2010 in Spa-Francorchamps statt und war der zweite Wertungslauf der Le Mans Series dieses Jahres."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Dreitausender_in_Osttirol","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d6/Keeskopf.jpg","page_title":"Liste der Dreitausender in Osttirol","context_page_description":"Diese Liste der Dreitausender in Osttirol listet alle selbständigen Berggipfel mit einer Höhe von mindestens 3000 m ü. A. in Osttirol auf."},{"page_url":"https://ro.wikipedia.org/wiki/Hontianske_Tes%C3%A1re","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Coat_of_Hontianske_Tes%C3%A1re_.png","page_title":"Hontianske Tesáre","context_page_description":"Hontianske Tesáre este o comună slovacă, aflată în districtul Krupina din regiunea Banská Bystrica. Localitatea se află la altitudinea de 162 m deasupra n.m., se întinde pe o suprafață de 33,11 km² și în 2017 număra 922 de locuitori."},{"page_url":"https://ro.wikipedia.org/wiki/Bremen","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/Bremen_Roland.jpg","page_title":"Bremen","context_page_description":"Bremen este un oraș din nord-vestul Germaniei, reședința landului Bremen. Orașul Bremen are un port major pe Râul Weser. Bremen se situează la 60 km la sud de gura de vărsare a râului Weser în Marea Nordului. Împreună cu Bremerhaven, orașul Bremen formează Landul Bremen. Nume oficial Freie Hansestadt Bremen evocă apartenența orașului la Liga Hanseatică de la sfârșitul evului mediu."},{"page_url":"https://zh.wikipedia.org/zh-my/ING%E8%87%BA%E5%8C%97%E5%9C%8B%E9%9A%9B%E9%A6%AC%E6%8B%89%E6%9D%BE%E6%AF%94%E8%B3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/2006INGTaipeiMarathon_TrafficControlRibbon.jpg","page_title":"ING臺北國際馬拉松比賽","context_page_description":"ING台北国际马拉松比赛，是因为ING安泰人寿自第八届起冠名赞助“台北国际马拉松比赛”而得此名。此项比赛不但创造台湾马拉松界，前所未有的多项纪录，并且成为台湾各项大型马拉松比赛的典范，使得之后在台湾举办的其他大型比赛，皆群起效尤。例如：2004年首度对外招募各行各业之菁英，投入运动赛会之志愿服务工作，服务赛会选手；并于2005年，开启了台湾马拉松比赛，首度引进国外芯片计时系统，针对竞赛组采用芯片计时的先例。\\n另外，ING安泰人寿为了要让台湾的各个长跑好手都能实际参与相关活动，也在各分区举办ING慢跑俱乐部训练活动以及分区的暖身赛，希望能借由各地区的训练活动中，来发掘出各地的慢跑菁英，进而让各地的好手能互相交流，达成良好的慢跑风气。\\n然而，因为台湾的行车文化极为不佳，而遭到各界的抨击之下，曾经一度传言要退出台北国际马拉松比赛赞助的ING安泰人寿，经过2006年12月15日的会议之后，在承办的中华民国路跑协会与主办的台北市政府承诺“比赛时，维持交通的良好秩序”的前提下，决议持续赞助至2009年，并且宣布在2007年确定会于12月16日举行正式比赛。\\n虽然ING台北国际马拉松比赛已成为台湾有史以来企业冠名赞助最长久，也是最让人印象深刻的马拉松比赛，但由于ING安泰人寿在2008年10月20日，被富邦金控合并的关系，因此在2008年12月21日的最后一次举办后，台北国际马拉松的冠名赞助权，将由2009年开始易手富邦金控，这个名词将随之走入历史。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%BE%D1%80%D0%BF%D1%81%D0%B2%D0%B5%D0%B4%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Wappen_Gemeinde_Worpswede.jpg","page_title":"Ворпсведе","context_page_description":"Ворпсведе — коммуна в Германии, в земле Нижняя Саксония.\\nВходит в состав района Остерхольц. Население составляет 9407 человек. Занимает площадь 76,13 км². Официальный код — 03 3 56 011.\\nКоммуна подразделяется на 8 сельских округов.\\nВорпсведе получил известность в 1889 г., когда здесь стали селиться и работать художники так называемой «Ворпсведской колонии художников». В настоящее время благодаря многочисленным учреждениям культуры и галереям курортный Ворпсведе привлекает как художников, так и туристов."},{"page_url":"https://en.wikipedia.org/wiki/Langwies_GR_railway_station","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/95/Langwieserviadukt1.jpg","page_title":"Langwies GR railway station","context_page_description":"Langwies GR railway station, often just Langweis railway station, is a railway station on the Chur–Arosa railway of the Rhaetian Railway. It is situated in Langwies, lower down the hillside from the centre of the village. A minor level crossing straddles the tracks at the station."},{"page_url":"https://es.wikipedia.org/wiki/Distrito_de_Enying","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/HUN_Enying_C%C3%ADmer.svg","page_title":"Distrito de Enying","context_page_description":"El distrito de Enying es un distrito húngaro perteneciente al condado de Fejér.\\nEn 2013 su población era de 13 187 habitantes. Su capital es Enying.​"},{"page_url":"https://fr.wikipedia.org/wiki/Kelaat-M%27Gouna","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Rose_M%27agouna_2.JPG","page_title":"Kelaat-M'Gouna","context_page_description":"Kelaat M'Gouna ou Tighremt n'Imgounen, est une ville située dans le sud du Maroc, dans la région de Drâa-Tafilalet et la province de Tinghir.\\nElle doit son nom à la région de l'ighil N' Imgoun et de l'assif du même nom qui y coule. Elle est habitée en grande majorité par une population amazighophone. Cette ville très animée constitue depuis longtemps un centre économique, commercial et social pour la population de la région. Elle est surtout connue pour son « festival des roses » qui a lieu chaque année au mois de mai."},{"page_url":"https://fi.wikipedia.org/wiki/Munkkivuoren_ala-aste","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Munkkivuori_lower_comprehensive_school_July_11_2009_01.jpg","page_title":"Munkkivuoren ala-aste","context_page_description":"Munkkivuoren ala-aste on helsinkiläinen peruskoulu, jossa on luokat 1–6. Koulu sijaitsee Raumantiellä Munkkivuoressa. Koulu toimi Munkkivuoren kansakouluna vuodet 1961–1977. Sen nykyisenä rehtorina toimii Mirja Pere."},{"page_url":"https://id.wikipedia.org/wiki/Marie_Jeanette_de_Lange","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Marie_Jeannette_de_Lange_%281865-1923%29.jpg","page_title":"Marie Jeanette de Lange","context_page_description":"Marie Jeanette de Lange adalah seorang pelukis amatir dan aktivis busana wanita asal Belanda. Ia tempil dalam sebuah potret pointilist karya Jan Toorop dalam busana yang direformasi pada 1900."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D0%B0%D1%81%D1%81%D0%B8-%D0%91%D0%B0%D1%85%D0%B1%D0%B0%D1%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Hassi_Bahbah%2C_Djelfa_Province_%28Algeria%29.jpg","page_title":"Хасси-Бахбах","context_page_description":"Хасси-Бахбах — город на севере Алжира, на территории вилайета Джельфа. Административный центр одноимённого округа."},{"page_url":"https://pt.wikipedia.org/wiki/Tratado_lituano-sovi%C3%A9tico_de_assist%C3%AAncia_m%C3%BAtua","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Lithuania_territory_1939-1940.svg","page_title":"Tratado lituano-soviético de assistência mútua","context_page_description":"O Tratado Lituano-Soviético de Assistência Mútua foi um tratado bilateral assinado entre a União Soviética e a Lituânia, em 10 de outubro de 1939. De acordo com as disposições definidas no tratado, a Lituânia iria adquirir cerca de um quinto da Região de Vilnius, incluindo capital histórica da Lituânia, Vilnius, e em troca permitiria cinco bases militares soviéticas, com 20.000 soldados a serem estabelecidas em toda a Lituânia. Em essência, o tratado com a Lituânia foi muito semelhante aos tratados que a União Soviética assinou com a Estônia em 28 de setembro, e com a Letônia em 5 de outubro.\\nDe acordo com fontes oficiais soviéticas, o exército soviético iria fortalecer as defesas de uma nação fraca contra possíveis ataques pela Alemanha nazista. O tratado previa que a soberania da Lituânia não seria afetada. No entanto, na realidade, o tratado abriu as portas para a primeira ocupação soviética da Lituânia e foi descrito pelo The New York Times como \\"sacrifício virtual da independência \\"."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_de_Tracheophyta_de_Bosnie-Herz%C3%A9govine","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Petteria_ramentacea1.jpg","page_title":"Liste de Tracheophyta de Bosnie-Herzégovine","context_page_description":"Cette liste de Tracheophyta de Bosnie-Herzégovine, ainsi que d’espèces introduites est un aperçu incomplet d’espèces de mousses, de fougères, de gymnospermes et d’angiospermes citées dans la littérature disponible en langues bosniaque, croate, serbe et serbo-croate. Cet aperçu n’inclue pas des espèces cultivées ni celles occasionnellement introduites.\\nRemarque : en raison de changements répétés dans la classification biologique et/ou taxonomique, certaines espèces apparaissent deux fois dans la liste. Cela est particulièrement vrai pour ces noms de la nomenclature binomiale, encore largement utilisées aujourd'hui. Le nom du genre et de la famille sont le plus souvent changés, et parfois aussi les noms d’espèces."},{"page_url":"https://de.wikipedia.org/wiki/Verti_Versicherung","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Logo-Verti.jpg","page_title":"Verti Versicherung","context_page_description":"Die Verti Versicherung AG ist ein Direktversicherer und seit 29. Mai 2015 Teil der spanischen Mapfre Gruppe. Bis zum 14. Juni 2017 hieß sie Direct Line Versicherung AG. Von 2002 bis Februar 2015 gehörte sie zur britischen Direct Line Insurance Group plc."},{"page_url":"https://es.wikipedia.org/wiki/Raphia","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Making_raffia_rope.jpg","page_title":"Raphia","context_page_description":"Raphia es un género de plantas fanerógamas perteneciente a la familia de las palmeras, es el único género de la subtribu Raphiinae.​ Está constituido por aproximadamente veinte especies nativas todas ellas de África; la única especie del género que existe en estado natural fuera del continente africano es el yolillo que es oriunda de las zonas húmedas de América Central y del Sur, además del oeste de África."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%96%E0%A5%81%E0%A4%B0%E0%A4%A8%E0%A4%95_%E0%A4%A6%E0%A5%81%E0%A4%B0%E0%A5%8D%E0%A4%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Aksai_detail.png","page_title":"खुरनक दुर्ग","context_page_description":"खुरनक दुर्ग या खुरनक क़िला जम्मू और कश्मीर के अक्साई चिन क्षेत्र के दक्षिणी भाग में पांगोंग त्सो के उत्तरी छोर के पास स्थित एक क़िला है जो अब खंडहर अवस्था में है। यह भारत और तिब्बत की पारम्परिक सीमा के पास स्थित है और सन् १९५८ तक यहाँ एक भारतीय सैनिक चौकी थी जहाँ भारतीय सैनिक व पुलिस दस्ते समय-समय पर जाया करते थे। जुलाई १९५८ के बाद यहाँ चीन का क़ब्ज़ा हो गया जो १९६२ के भारत-चीन युद्ध से जारी रहा है। चीन अब इसे तिब्बत के न्गारी विभाग का भाग बताता है।\\n१९६० में भारत व चीन के बीच हुई वार्ताओं में भारत ने अपन सम्प्रभुत्व स्थापित करने वाले अन्य सरकारी दस्तावेज़ों के साथ-साथ १९०८ की सेटलमेंट रिपोर्ट भी प्रस्तुत करी जिसमें प्रान्तीय सरकार द्वारा खुरनक में हुई कर-वसूली दर्ज थी। १९५६ में चीन ने जिस सीमा का दावा करा उसमें खुरनक भारत में दर्शाया गया था लेकिन १९६० में उसके नए दावे में खुरनक को भी तिब्बत में दर्शाया गया।"},{"page_url":"https://ca.wikipedia.org/wiki/Sant_Esteve_(Castellciutat)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/72/Sant_Esteve_del_Pont_absis.JPG","page_title":"Sant Esteve (Castellciutat)","context_page_description":"Sant Esteve és una partida de Castellciutat, al municipi de la Seu d'Urgell, situada a la riba esquerra del riu Valira. L'indret havia format part del municipi de Castellciutat fins al 1971 quan va ser annexat al de la Seu.\\nEn destaca la Torre de Solsona, l'església de Sant Esteve del Pont, la Borda de Sant Esteve, la Casa Navarro i una zona industrial. Travessada pel torrent dels Cortals d'oest a est i el camí de Sant Esteve del Pont a la riba del Valira, antic camí ral d'Andorra que havia estat una via romana. També hi ha les Cases Roges. El consell regulador de la IGP Vedella dels Pirineus Catalans es troba a la partida."},{"page_url":"https://pl.wikipedia.org/wiki/Konkurs_Piosenki_Eurowizji_2003","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Tatu.png","page_title":"Konkurs Piosenki Eurowizji 2003","context_page_description":"48. Konkurs Piosenki Eurowizji został zorganizowany 24 maja 2003 w wyremontowanej specjalnie na tę okazję Skonto Olympic Hall w Rydze. Gospodarzem wydarzenia był łotewski nadawca publiczny Latvijas Televīzija, dzięki zwycięstwu Marie N., reprezentantki Łotwy podczas konkursu w 2002.\\nKoncert finałowy prowadzili Marija Naumova i Renārs Kaupers. Finał konkursu wygrała Sertab Erener, reprezentantka Turcji z piosenką „Everyway That I Can” autorstwa jej samej i Demira Demirkana, za którą zdobyła łącznie 167 punktów."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A0%D0%B0%D1%81%D0%BA%D0%B0%D0%B7%D0%B0%D1%9E%D0%BA%D0%B0_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D1%8B%D1%8F_%D0%BC%D0%B5%D1%82%D1%80%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/MM_Rasskazovka.jpg","page_title":"Расказаўка (станцыя метро)","context_page_description":"«Расказаўка» — заходняя канцавая станцыя Солнцаўскай лініі Маскоўскага метрапалітэна."},{"page_url":"https://id.wikipedia.org/wiki/Nian","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/StandingMingLion.jpg","page_title":"Nian","context_page_description":"Dalam mitologi Tionghoa, nian adalah sejenis mahluk buas yang hidup di dasar laut atau di gunung. Sekali pada saat musim semi, atau sekitar tahun baru Imlek, ia keluar dari persembunyiannya untuk mengganggu manusia, terutama anak-anak. Nian tidak menyukai bunyi-bunyian ribut dan warna merah."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%A8%D8%A7%D8%A8_%D9%85%D8%BA%D8%A7%D8%B1%D8%A8%DB%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Old_Jerusalem_Dung_Gate_sign.jpg","page_title":"باب مغاربہ","context_page_description":"باب مغاربہ یا مراکشی دروازہ قدیم یروشلم کے دروازوں میں سے ایک ہے۔ دروازہ قدیم شہر کے جنوب مشرقی کونے میں حرم قدسی شریف کے جنوب مغرب میں واقع ہے۔ یہ مغربی دیوار سے قریب ترین دروازہ ہے اور گاڑیوں کی امد و رفت کے لیے ایک اہم راستہ ہے۔"},{"page_url":"https://be.wikipedia.org/wiki/%D0%90%D0%BB%D0%B0_%D0%91%D0%B0%D1%80%D1%8B%D1%81%D0%B0%D1%9E%D0%BD%D0%B0_%D0%9F%D1%83%D0%B3%D0%B0%D1%87%D0%BE%D0%B2%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Alla_Pugacheva_on_Slavianski_Bazaar_in_Vitebsk_01.jpg","page_title":"Ала Барысаўна Пугачова","context_page_description":"Ала Барысаўна Пугачова — савецкая і расійская эстрадная спявачка, прадзюсар, аўтар песень, кінаактрыса. Заслужаная артыстка РСФСР, Народная артыстка РСФСР, Народная артыстка СССР, Лаўрэат Дзяржаўнай прэміі Расійскай Федэрацыі."},{"page_url":"https://el.wikipedia.org/wiki/%CE%94%CE%AE%CE%BC%CE%BF%CF%82_%CE%91%CE%B3%CE%B1%CE%B8%CE%BF%CE%BD%CE%B7%CF%83%CE%AF%CE%BF%CF%85","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/07/2011_Dimos_Agathonisiou.png","page_title":"Δήμος Αγαθονησίου","context_page_description":"Ο Δήμος Αγαθονησίου είναι δήμος της περιφέρειας Νοτίου Αιγαίου με έδρα το Μεγάλο Χωριό. Δημιουργήθηκε με το Πρόγραμμα Καλλικράτης με την αναγνώριση σε Δήμο της κοινότητας Αγαθονησίου. Ο πληθυσμός του είναι 185 κάτοικοι σύμφωνα με την απογραφή του 2011. Δήμαρχος από το 2007 είναι ο Ευάγγελος Κοττόρος."},{"page_url":"https://en.wikipedia.org/wiki/Clomifene","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Clomifene_ball-and-stick.png","page_title":"Clomifene","context_page_description":"Clomifene, also known as clomiphene, is a medication used to treat infertility in women who do not ovulate. This includes those who have polycystic ovary syndrome. Use results in a greater chance of twins. It is taken by mouth once a day with a course of treatment generally lasting five days.\\nCommon side effects include pelvic pain and hot flashes. Other side effects can include changes in vision, vomiting, trouble sleeping, ovarian cancer, and seizures. It is not recommended in people with liver disease, abnormal vaginal bleeding of unknown cause, or who are pregnant. Clomifene is in the selective estrogen receptor modulator family of medication and is a nonsteroidal medication. It works by causing the release of GnRH by the hypothalamus, and subsequently gonadotropin from the anterior pituitary.\\nClomifene was approved for medical use in the United States in 1967. It is on the World Health Organization's List of Essential Medicines. Its introduction began the era of assisted reproductive technology."},{"page_url":"https://en.wikipedia.org/wiki/Calcium_guanylate","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Calcium_guanylate.png","page_title":"Calcium guanylate","context_page_description":"Calcium guanylate is a compound with formula Ca. It is the calcium salt of guanylic acid. It is present in all living cells as part of RNA, and is commercially prepared from yeast extract or fish.\\nAs a food additive, it is used as a flavor enhancer, particularly low-salt products and has the E number E629."},{"page_url":"https://es.wikipedia.org/wiki/Biarmosuchus","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Biarmosuchus_tagax.jpg","page_title":"Biarmosuchus","context_page_description":"Biarmosuchus es un género de terápsidos perteneciente a la familia Biarmosuchidae que vivió hace aproximadamente 255 millones de años, durante el Pérmico Superior. Sus restos fueron descubiertos en la región de Perm en Rusia. El espécimen fue encontrado en un canal de arenisca que fue depositado por la inundación de agua proveniente de los nacientes montes Urales. La especie denominada Biarmosuchus tener es la más primitiva de los reptiles similares a mamíferos y tenía miembros delgados. Tenía un gran agujero ocular y un orificio temporal pequeño; que le proporcionaba una mordida débil. Se ignora como se alimentaba.\\nTenía una dentadura de ocho incisivos pequeños en el paladar, seguido por un diente canino. Adicionalmente la especie tenía catorce dientes en el maxilar superior y veinte en el maxilar inferior, todos de pequeño tamaño."},{"page_url":"https://ro.wikipedia.org/wiki/Comitatul_Murray,_Georgia","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Courthouse_of_Murray_County%2C_Georgia.jpg","page_title":"Comitatul Murray, Georgia","context_page_description":"Comitatul Murray este un comitat din statul Georgia, Statele Unite ale Americii."},{"page_url":"https://id.wikipedia.org/wiki/Daftar_anggota_Dewan_Perwakilan_Rakyat_Amerika_Serikat","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Frank_Pallone_113th_Congress.jpg","page_title":"Daftar anggota Dewan Perwakilan Rakyat Amerika Serikat","context_page_description":"Berikut adalah daftar anggota Dewan Perwakilan Rakyat Amerika Serikat saat ini."},{"page_url":"https://eu.wikipedia.org/wiki/Soka","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Bindfaden.jpg","page_title":"Soka","context_page_description":"Soka lotzeko erabiltzeko den tresna luze, estu eta malgua bat da, zuntz-hari luzeak, naturalak nahiz artifizialak, batera jarriz eta bihurrituz ekoizten dena. Erabilera orokorreko tresna da eta objektuak batera jarri, paper edo beste estalki batean bildu, garraiatu eta finkatzeko erabili daiteke. Polea eta beste makina zenbaitetan ere erabiltzen da."},{"page_url":"https://de.wikipedia.org/wiki/Exponate_von_Museen_in_Dresden_auf_Briefmarken_der_Deutschen_Post_der_DDR","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Stamps_of_Germany_%28DDR%29_1977%2C_MiNr_2255.jpg","page_title":"Exponate von Museen in Dresden auf Briefmarken der Deutschen Post der DDR","context_page_description":"Exponate von Museen in Dresden wurden auf Briefmarken der Deutschen Post der DDR von 1955 bis 1984 rund 100-mal gewürdigt. Rund 90 % der Briefmarken zeigen Exponate von Museen, die den Staatlichen Kunstsammlungen Dresden angehören. Den größten Anteil dabei macht mit 37 Briefmarken die Gemäldegalerie Alte Meister aus, der unter anderem die Sondermarkenserie Von der UdSSR zurückgeführte Gemälde der Dresdner Gemäldegalerie von 1955 bis 1959 gewidmet war. Da auch die Galerie Neue Meister 19-fach vertreten ist, handelt es sich bei mehr als jedem zweiten abgebildeten Exponat eines Dresdner Museums um ein Gemälde.\\nZu den auf den Briefmarken verwendeten Objekten zählen auch 20 Uhren, Globen und andere Instrumente aus dem Mathematisch-Physikalischen Salon sowie Elfenbeinskulpturen und Goldschmiedearbeiten aus dem Grünen Gewölbe. Insgesamt sind Exponate aus zehn Museen abgebildet, darunter das Buchmuseum der SLUB, das Verkehrsmuseum Dresden und die beiden Naturhistorischen Sammlungen.\\nGleich zweifach wurden jeweils das „Bildnis eines jungen Mannes im schwarzen Rock“ von Frans Hals sowie „Die Alte mit dem Kohlenbecken“ von Peter Paul Rubens berücksichtigt."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Ripley_K%C5%ABn_(Missouri)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Ripley_County_MO_Courthouse_HDR.jpg","page_title":"Ripley Kūn (Missouri)","context_page_description":"Ripley Kūn sī Bí-kok Missouri chiu ê kūn, ū jîn-kháu 14032."},{"page_url":"https://en.wikipedia.org/wiki/Esgl%C3%A9sia_de_Sant_Pere_d%27Aixirivall","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/65/Sant_Pere_d%27Aixirivall.jpg","page_title":"Església de Sant Pere d'Aixirivall","context_page_description":"Església de Sant Pere d'Aixirivall is a church located in Aixirivall, Sant Julià de Lòria Parish, Andorra. It is a heritage property registered in the Cultural Heritage of Andorra. It was built in 1603."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BF%D1%80%D0%B8_%D0%91%D0%B5%D0%BD%D1%82%D0%BE%D0%BD%D0%B2%D0%B8%D0%BB%D0%BB%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Battle_of_Bentonville_map.png","page_title":"Сражение при Бентонвилле","context_page_description":"Сражение при Бентонвилле происходило 19-21 марта 1865 года в Бентонвилле, Северная Каролина, неподалеку от современного городка Фор Оакс, и было частью Каролинской кампании Американской гражданской войны. Это было последнее крупное сражение между армиями Вильяма Шермана и Джозефа Джонстона.\\nВ первый день сражения армия Конфедерации атаковала первое крыло федеральной армии и смогла отбросить две федеральные дивизии, но не смогла полностью разгромить противника. На следующий день подошло второе федеральное «крыло» и ещё два дня длилась перестрелка, после чего Джонстон отступил. Ввиду подавляющего численного превосходства противника и тяжелых потерь в сражении, Джонстон месяц спустя сдался Шерману в Беннет Плейс около станции Дургам. Эта капитуляция, ввиду капитуляции генерала Ли в апреле того года, стала фактическим концом войны."},{"page_url":"https://zh.wikipedia.org/zh-my/%E7%99%BD%E5%B7%9D%E9%84%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Shirakawa-go_houses_1.jpg","page_title":"白川鄉","context_page_description":"白川乡是指岐阜县内的庄川流域。相对大野郡白川村及旧庄川村，前者称作“下白川乡”，后者称作“上白川乡”。今天大多只指白川村。白川乡的荻町地区因合掌造而著称。白川乡与五箇山等具有独特景观的村落以“白川乡与五箇山的合掌造聚落”之名于1995年12月被登录为联合国教科文组织的世界遗产。"},{"page_url":"https://eo.wikipedia.org/wiki/Aleksandr_Nevskij_(filmo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Nevski3.jpg","page_title":"Aleksandr Nevskij (filmo)","context_page_description":"Aleksandr Nevskij estas historia drama filmo de 1938 reĝisorita de Sergej Eisenstein. Ĝi rakontas la klopoditan invadon de Novgorod en la 13a jarcento fare de Teŭtonaj Kavaliroj de la Sankta Romia Imperio kaj ties malvenkon fare de la Princo Aleksandro, konata populare kiel Aleksandro Nevskij.\\nEisenstein faris la filmon en asocio kun Dmitri Ivanoviĉ Vasiljev kaj kun scenaro verkita kun Pjotr Pavlenko; ili intencis certigi ke Eisenstein ne falu en \\"formalismon\\" kaj por faciligi la filmadon en akurata limdato. Ĝi estis produktorita de Goskino pere de la produktorejo Mosfilm, kun Nikolai Ĉerkasov en la titolrolo kaj muziko de Sergej Prokofjev, Aleksandr Nevskij kiu estis la unua kaj plej populara el la tri sonfilmoj de Eisenstein. En 1941 Eisenstein, Pavlenko, Ĉerkasov kaj Andrei Abrikosov ricevis la Stalin Premion pro la filmo.\\nEn 1978 la filmo estis inkludita en la listo de 100 plej bonkvalitaj filmoj de la mondo laŭ la opinienketo kondukita de itala eldonejo \\"A. Mondadori\\"."},{"page_url":"https://de.wikipedia.org/wiki/Rudolf_B%C3%A4umer_(Maler)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Rudolf_B%C3%A4umer_In_der_Urheide.jpg","page_title":"Rudolf Bäumer (Maler)","context_page_description":"Rudolf Bäumer war ein deutscher Maler."},{"page_url":"https://de.wikipedia.org/wiki/Japanische_Scheinkamelie","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Stewartia_pseudocamellia_3.jpg","page_title":"Japanische Scheinkamelie","context_page_description":"Die Japanische Scheinkamelie ist ein großer Strauch oder Baum mit 5 bis 7 Zentimeter großen, weißen Blüten aus der Familie der Teestrauchgewächse. Das natürliche Verbreitungsgebiet liegt in Japan und Südkorea. Sie wird manchmal aufgrund der dekorativen Blüten und der beeindruckenden Herbstfärbung als Zierpflanze verwendet."},{"page_url":"https://de.wikipedia.org/wiki/St._Martin_(Pullenreuth)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Pullenreuth_church.jpg","page_title":"St. Martin (Pullenreuth)","context_page_description":"Die Pfarrkirche St. Martin ist eine römisch-katholische Pfarrkirche in der Gemeinde Pullenreuth im oberpfälzischen Landkreis Tirschenreuth.\\nDie Martinskirche, eine Saalkirche, ist ein Baudenkmal zentral im Ort und ist durch die Lage auf einer Anhöhe ortsbildprägend und weithin sichtbar."},{"page_url":"https://hu.wikipedia.org/wiki/Csupros_M%C3%A1ria-szobor","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/CsuprosMaria1898.jpg","page_title":"Csupros Mária-szobor","context_page_description":"A Csupros Mária Miskolcon, a Mindszenti templom előtti terecskén áll. Ez volt Miskolc első köztéri szobra. Egy év múlva állították fel a diósgyőri, hasonló Immaculata-szobrot."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D0%B2%D0%B5%D1%82%D0%BB%D0%B0%D0%B3%D0%BE%D1%80%D1%81%D0%BA%D0%B0%D0%B5_%D0%B1%D0%BB%D0%B0%D0%B3%D0%B0%D1%87%D1%8B%D0%BD%D0%BD%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Pary%C4%8Dy%2C_Pu%C5%A1%C4%8Dyn._%D0%9F%D0%B0%D1%80%D1%8B%D1%87%D1%8B%2C_%D0%9F%D1%83%D1%88%D1%87%D1%8B%D0%BD_%281901-09%29_%282%29.jpg","page_title":"Светлагорскае благачынне","context_page_description":"Светлагорская благачынная акруга, Светлагорскае благачынне — акруга ў Гомельскай і Жлобінскай епархіі Беларускай праваслаўнай царквы. Аб’ядноўвае прыходы ў Светлагорскім раёне Гомельскай вобласці."},{"page_url":"https://sk.wikipedia.org/wiki/Walt_Disney","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Walt_disney_portrait.jpg","page_title":"Walt Disney","context_page_description":"Walter Elias „Walt“ Disney bol americký filmový producent, režisér, scenárista a animátor. Kreslil tiež ilustrácie do kníh a časopisov, založil zábavný park zvaný Disneyland.\\nUmenie miloval od detstva. Ako chlapec chodieval do kina na filmy s Charliem Chaplinom. Grotesky Chaplinovského druhu sa neskôr stali inšpiráciou pre príbehy s Mickey Mousom. Svoj prvý animovaný film vytvoril v roku 1923. Medzi postavičky, ktoré vyšli z jeho dielne, patrí Mickey Mouse, ktorý je považovaný za Disneyho alter-ego. Ďalšie známe postavičky sú káčer Donald, Goofy a pes Pluto.\\nJedným z animovaných filmov z dielne štúdia Walta Disneyho je Snehulienka a sedem trpaslíkov, za ktorý ako vôbec prvý v histórii získal Oscara za filmové novátorstvo. Snehulienka a sedem trpaslíkov sa stala jedným z najväčších úspechov v dejinách filmu a upevnila Disneyho nárok na označenie za najprestížnejšie animačné štúdio na svete. Potvrdenie tohto postavenia bolo jedným z cieľov, ktoré Disney od tohto filmu očakával. Zvukovú hranicu kresleného filmu prekonal vo filme Mickey kormidelníkom a o niekoľko rokov neskôr priniesol do animácie svet farby."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%9F%BD%E6%B0%A7%E6%A8%B9%E8%84%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/PDMS.png","page_title":"矽氧樹脂","context_page_description":"硅氧聚合物亦称为硅酮、硅利康，是一个介于有机与无机的聚合物，其化学式为[-R₂SiO-]ₙ，其R=甲基、苯基等有机集团。这些材料由无机硅氧键骨架和以共价键和硅原子结合的支链有机基团组成。通过控制骨架的长度、有机基团的种类和骨架的交联，可得到具有不同性质的硅氧聚合物，从液体的硅油到有柔软弹性的硅凝胶、硅橡胶和刚性的硅树脂。最常见的种类为线性的聚二甲基硅氧烷。第二常见的硅脂材料种类是基于硅树脂分子形态基于树状或笼状硅氧键。硅橡胶有时也被简称为硅胶，但英文中硅胶和硅酮是性质和用途不同的含硅化合物。"},{"page_url":"https://fr.wikipedia.org/wiki/Gare_de_Xining","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Xining_Railway_Station_Xining_Metro_Line_1_exit.jpg","page_title":"Gare de Xining","context_page_description":"La gare de Xining est la principale gare ferroviaire desservant la ville de Xining, capitale de la province du Qinghai, en Chine. C'est la première gare de la ligne Qinghai – Tibet qui relie Xining à Lhassa dans la région autonome du Tibet."},{"page_url":"https://cs.wikipedia.org/wiki/Bzikavka_slepoo%C4%8Dka","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Chrysops_caecutiens_01.JPG","page_title":"Bzikavka slepoočka","context_page_description":"Bzikavka slepoočka je hmyz z čeledi ovádovitých."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D9%8A%D8%A8_%D8%A7%D9%84%D8%B4%D8%B1%D9%82%D9%8A%D8%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/93/Seal_Point_Lighthouse-001.jpg","page_title":"كيب الشرقية","context_page_description":"كيب الشرقية هي إحدى محافظات جنوب أفريقيا حيث تم تشكيلها في عام 1994م وتنقسم إلى 46 بلدية."},{"page_url":"https://de.wikipedia.org/wiki/J%C3%BCngere_Dryaszeit","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7d/WiesenLabkraut.jpg","page_title":"Jüngere Dryaszeit","context_page_description":"Die Jüngere Dryaszeit, auch nur Jüngere Dryas, Jüngere Tundrazeit, Jüngere Tundrenzeit oder Dryas 3 war in der Erdgeschichte ein scharfer Kälterückfall nach dem Alleröd-Interstadial am Ende der Weichsel-Kaltzeit. Auf die Jüngere Dryaszeit folgte das Präboreal des Holozäns: die Jüngere Dryas ist somit der letzte Zeitabschnitt der letzten Kaltzeit und des Pleistozäns.\\nVerschiedene Berechnungen ergeben für die Jüngere Dryaszeit etwa einen Zeitraum von 10.730–9700 v. Chr. Sie setzte während des antarktischen Kälterückfalls ein."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B9%D8%A8%D8%A7%D8%B3_%DA%AF%D9%86%D8%AC%D9%88%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/%D8%B9%D8%A8%D8%A7%D8%B3_%DA%AF%D9%86%D8%AC%D9%88%DB%8C.jpg","page_title":"عباس گنجوی","context_page_description":"عباس گنجوی تدوین‌گر اهل ایران است."},{"page_url":"https://sv.wikipedia.org/wiki/Karl_G.H._Karlsson","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Elektra_14_V%C3%A4stberga_2015e.jpg","page_title":"Karl G.H. Karlsson","context_page_description":"Karl Gustav Henrik Karlsson, kallad Karl G.H. Karlsson, född 4 april 1919 i Stockholm, död 28 september 1979 i Stockholm, var en svensk byggnadsingenjör och arkitekt. Trots att Karlsson under tiden 1950 till 1970 var en av Sveriges mest anlitade industriarkitekter förblev han relativt okänd och hans arbeten publicerades aldrig i fackpressen."},{"page_url":"https://ne.wikipedia.org/wiki/%E0%A4%B0%E0%A4%A4%E0%A5%8D%E0%A4%A8%E0%A4%B8%E0%A4%BF%E0%A4%82%E0%A4%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Chittorgarh_fort.JPG","page_title":"रत्नसिंह","context_page_description":"रावल रत्नसिंह 14औं शताब्दीको आरम्भमा विद्यमान मेदपाट को शासक थिए । उनका शासनकाल अल्पकालिक थियो। ई.सा. १३०३ मा दिल्ली सल्तनतका अलाउद्दीन खिल्जीसंग परास्त भएका थिए ।"},{"page_url":"https://nl.wikipedia.org/wiki/Complementariteit_(moleculaire_biologie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/AT_base_pair_jypx3.png","page_title":"Complementariteit (moleculaire biologie)","context_page_description":"Complementariteit is de eigenschap van nucleïnezuren om bepaalde nucleotiden onderling te verbinden door middel van waterstofbruggen; het is de overeenstemming tussen twee nucleïnezuren die basenparing mogelijk maakt. In de natuur is complementariteit het basisprincipe van DNA-replicatie, transcriptie en translatie, omdat het zorgt dat DNA- of RNA-ketens antiparallel tegen elkaar worden uitgelijnd. De tegenovergelegen nucleotiden op elke positie in de sequentie zijn in dergelijke situatie complementair aan elkaar. In dubbelstrengs DNA gaat het hierbij om de verbinding van purines met pyrimidines. Door middel van complementariteit blijft genetische informatie gericht in stand.\\nDe mate van complementariteit tussen twee nucleïnezuurketens kan variëren. Volledige complementariteit zorgt voor een optimaal stabiel nucleïnezuur. DNA-reparatie en andere regulerende mechanismen in nucleïnezuren zijn gebaseerd op complementaire basenparen. In de biotechnologie wordt ook gebruik gemaakt van het principe van complementariteit. Met behulp van het enzym reverse-transcriptase kan langs een mRNA-keten enkelstrengs DNA worden gevormd."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%8Ele_aux_Ours","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/3puffins.jpg","page_title":"Île aux Ours","context_page_description":"L’île aux Ours, en norvégien Bjørnøya, est une île de Norvège située dans la partie occidentale de la mer de Barents, en bordure de la mer de Norvège et aux trois cinquièmes du chemin reliant la Norvège métropolitaine à l'archipel du Svalbard. Elle forme la partie la plus méridionale du Svalbard.\\nL'île fut découverte par Willem Barents et Jacob van Heemskerck le 10 juin 1596 et porte ce nom grâce à un ours polaire qui nageait dans les environs. L'île aux Ours était considérée terra nullius jusqu'au traité du Svalbard en 1920 qui l'a placée sous souveraineté norvégienne. Malgré son éloignement et sa nature aride, l'île a connu quelques activités commerciales aux siècles derniers comme l'extraction de la houille, la pêche et la chasse à la baleine. Aucun campement n'a été installé pour plus de quelques années et l'île n'est actuellement habitée que par les occupants d'une station météo. Elle a été déclarée réserve naturelle en 2002 ainsi que les eaux environnantes."},{"page_url":"https://it.wikipedia.org/wiki/Enzersdorf_an_der_Fischa","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Enzersdorf_an_der_Fischa_im_Bezirk_BL.PNG","page_title":"Enzersdorf an der Fischa","context_page_description":"Enzersdorf an der Fischa è un comune austriaco di 3 110 abitanti nel distretto di Bruck an der Leitha, in Bassa Austria; ha lo status di comune mercato. Nel 1970 ha inglobato il comune soppresso di Margarethen am Moos."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%BF%E3%82%AB%E3%83%8D%E3%83%88%E3%83%B3%E3%83%9C_(%E6%A4%8D%E7%89%A9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Platanthera_chorisiana_var._elata_5.JPG","page_title":"タカネトンボ (植物)","context_page_description":"タカネトンボは、ラン科ツレサギソウ属の地生の多年草。"},{"page_url":"https://ca.wikipedia.org/wiki/Charmoy_(Saona_i_Loira)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Tour_du_bost.JPG","page_title":"Charmoy (Saona i Loira)","context_page_description":"Charmoy és un municipi francès, situat al departament de Saona i Loira i a la regió de Borgonya - Franc Comtat. L'any 2007 tenia 254 habitants."},{"page_url":"https://fr.wikipedia.org/wiki/La_Habanera","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Zara_1931_035.jpg","page_title":"La Habanera","context_page_description":"La Habanera est un film allemand réalisé par Detlef Sierck et sorti en 1937."},{"page_url":"https://it.wikipedia.org/wiki/Audi_e-tron","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Audi_e-tron_Sportback_Genf_2019_1Y7A5437.jpg","page_title":"Audi e-tron","context_page_description":"L'Audi e-tron è una serie di concept car elettriche e ibride presentate dalla casa automobilistica Audi dal 2009 in poi. Nel 2012 Audi ha presentato una versione ibrida plug-in, l'Audi A3 Sportback e-tron, messa in commercio in Europa nell'agosto 2014 e prevista per gli Stati Uniti nel 2015.\\nNel 2019 è entrato in listino anche in Italia Audi e-tron, SUV elettrico a trazione integrale a cinque posti con un’autonomia superiore a 400 chilometri nel ciclo WLTP, dotato di un powertrain dalla potenza massima di 408 CV e una coppia di 664 Nm, con batterie da 95 kWh."},{"page_url":"https://es.wikipedia.org/wiki/Julio_Mariaca_Pando","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Estaci%C3%B3n_ENFE_interior.jpg","page_title":"Julio Mariaca Pando","context_page_description":"Julio Mariaca Pando fue un arquitecto y urbanista boliviano. Es considerado, junto a Emilio Villanueva y Adán Sánchez, uno de los tres arquitectos más importantes del modernismo en Bolivia."},{"page_url":"https://de.wikipedia.org/wiki/Salzlandkreis","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/75/Wappen_Wolmirsleben.png","page_title":"Salzlandkreis","context_page_description":"Der Salzlandkreis ist ein Landkreis im Land Sachsen-Anhalt, der im Zuge der Kreisgebietsreform am 1. Juli 2007 durch die Zusammenlegung der ehemaligen Landkreise Aschersleben-Staßfurt, Bernburg und Schönebeck gebildet wurde. Er ist in Sachsen-Anhalt der einzige Landkreis, der nicht an ein anderes deutsches Bundesland grenzt."},{"page_url":"https://de.wikipedia.org/wiki/Osmanische_Marine","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Nordenfelt_submarine_Abd%C3%BClhamid.jpg","page_title":"Osmanische Marine","context_page_description":"Die osmanische Marine war die Seestreitkraft des Osmanischen Reiches. Sie wurde im 14. Jahrhundert gegründet und nach der osmanischen Niederlage im Ersten Weltkrieg aufgelöst."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A7%D8%B4%D8%AA%D8%A7%DB%8C%D9%86%D9%81%D9%88%D8%B1%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Schloss.Burgsteinfurt.jpg","page_title":"اشتاینفورت","context_page_description":"اشتاینفورت آلمانین نوردراین-وستفالن ایالتینده یئر آلان بیر شهردیر و ۶۵ متر دنیز سوییه‌سیندن اۇجالیقی وار. ۲۰۱۵-جی ایلين نۆفوس ساییمی اساسیندا ۳۴۴۷۶ نفر دیر. بۇ شهرین ۱۱۱٫۴۲ کیلومتر موربّع ساحه‌سی وار."},{"page_url":"https://pt.wikipedia.org/wiki/Montanhas_Rochosas","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Grand_Tetons11.jpg","page_title":"Montanhas Rochosas","context_page_description":"As montanhas Rochosas são uma importante cordilheira localizada na América do Norte ocidental. As Montanhas Rochosas seguem por mais de 4 800 quilômetros a partir da parte norte da Columbia Britânica, no oeste do Canadá, até o Novo México, no sudoeste dos Estados Unidos. O pico mais alto é o monte Elbert localizado no estado norte-americano do Colorado, com 4.401 metros acima do nível do mar. Embora parte da cordilheira do Pacífico da América do Norte, as montanhas Rochosas são distintas da cadeia costeira do Pacífico ou do Sistema de Montanhas do Pacífico, que está localizada junto à costa do Pacífico.\\nAs montanhas Rochosas foram formadas há cerca de 70 milhões de anos no período Cretáceo, pela Orogenia Laramide. Desde então, a erosão pela água e os glaciares esculpiram a região dando origem a vales e picos íngremes. No final da última era glacial, os seres humanos começaram a habitar o lugar. São destaques deste período sir Alexander MacKenzie e a expedição de Lewis e Clark que dedicaram a busca de minerais e a obtenção de peles. Esta exploração econômica inicial das montanhas não propiciou o aumento da densidade populacional."},{"page_url":"https://en.wikipedia.org/wiki/Botanical_Garden_of_Valencia","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fc/Jardinbotanicodevalencia300.JPG","page_title":"Botanical Garden of Valencia","context_page_description":"The Botanical Garden of the University of Valencia is a botanical garden located on calle Quart in El Botànic neighbourhood of Valencia, Spain. The garden depends administratively on the University of Valencia. It is a member of Botanical Gardens Conservation International.\\nThe University was growing herbs for medicinal purposes as early as the 16th century. A botanical garden was projected from the mid-18th century, and the Garden opened on its present site in 1802. It remains a centre for study, education and public use."},{"page_url":"https://nl.wikipedia.org/wiki/Carl_Orff","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e8/Carl_Orff.jpg","page_title":"Carl Orff","context_page_description":"Carl Orff was een Duits componist, muziekpedagoog en theaterman.\\nIn Dießen am Ammersee ten zuiden van München is het Carl Orff Museum gewijd aan zijn werk en leven."},{"page_url":"https://en.wikipedia.org/wiki/Alberto_Rojo_Blas","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/%28Alberto_Rojo%29_Toma_de_posesi%C3%B3n_de_la_directora_del_Instituto_de_la_Mujer_y_el_delegado_de_la_Junta_en_Guadalajara_%2819648277652%29_%28cropped%29.jpg","page_title":"Alberto Rojo Blas","context_page_description":"Alberto Rojo Blas is a Spanish politician, Mayor of Guadalajara since June 2019. He previously served as Mayor of Hita from 2003 to 2011. He is a member of the Spanish Socialist Workers' Party."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A4%D7%99%D7%98%D7%90%D7%98%D7%95%D7%A1_(%D7%9E%D7%9B%D7%AA%D7%A9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Pitatus_crater_4119_h3.jpg","page_title":"פיטאטוס (מכתש)","context_page_description":"פיטאטוס הוא מכתש פגיעה הממוקם בצד הקרוב של הירח, בקצהו הדרומי של ים העננים. המכתש ממוקם בקואורדינטות סלנוגרפיות 29.8° דרום 13.5° מערב.\\nמצפון מערב למכתש מצוי מכתש הסודיוס המחובר אל מכתש פיטאטיוס. מדרום למכתש פיטאטיוס מצויים המכתשים וורצלבאוור וגאריוס.\\nקוטרו של המכתש 97 ק\\"מ ועומקו 900 מטרים. בתוך המכתש גבעה בגובה 500 מטרים.\\nהמכתש קרוי על שם האסטרונום פייטרו פיטאטי"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B8%D0%B2%D0%BD%D0%BE%D0%B3%D0%BE%D1%80%D1%8C%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/%D0%90%D1%80%D1%85%D0%B5%D0%BE%D0%BB%D0%BE%D0%B3%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D0%B0%D1%80%D0%BA.jpg","page_title":"Дивногорье","context_page_description":"Дивного́рье — возвышенность и музей-заповедник в Лискинском районе Воронежской области России. Находится в 10 км к западу от центра района на правом берегу реки Дон и в 80 км к югу от Воронежа, неподалёку от одноимённого хутора и посёлка. Музей здесь основан в 1988 году, а в 1991 он получил статус музея-заповедника. В настоящее время природный архитектурно-археологический музей-заповедник «Дивногорье» является одной из самых популярных и самых узнаваемых достопримечательностей Воронежской области. Каждый сезон, с мая по октябрь его посещает более 60 тыс. туристов.\\nС 2020 года является кандидатом на включение в список объектов Всемирного наследия."},{"page_url":"https://fi.wikipedia.org/wiki/Rasuwan_piirikunta","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Rasuwa_district_location.png","page_title":"Rasuwan piirikunta","context_page_description":"Rasuwan piirikunta on yksi Nepalin 75 piirikunnasta. Se sijaitsee Nepalin Keskisen kehitysalueen Bagmatin vyöhykkeen pohjoisosissa.\\nPiirikunta rajautuu pohjoisessa Kiinan Tiibetin autonomiseen alueeseen. Nepalin piirikunnista naapureita ovat Sindhupalchok ja Nuwakot etelässä sekä Dhading lännessä.\\nRasuwassa kirjattiin asuvan vuonna 2011 yhteensä 9 778 perhekuntaa ja kaikkiaan 43 300 ihmistä. Piirikunnan pinta-ala on 1 544 neliökilometriä ja asukastiheys 28 as./km². Hallinnollinen keskus on Dhunchen kylä.\\nLuonnonmaantieteellisesti piirikunta ryhmitellään tavallisesti osaksi Nepalin Keskistä vuoristovyöhykettä. Tarkemmassa kasvillisuusvyöhykejaottelussa piirikunnasta 1,2 % voidaan luokitella ylempään trooppiseen, 11,4 % subtrooppiseen, 20,8 % lauhkeaan, 20,0 % subalpiiniseen, 11,8 % alpiiniseen, 2,0 % Trans-Himalajan ja 32,9 % ylempään vuoristovyöhykkeeseen sekä hieman vesistöihin kuuluvaksi.\\nRasuwan piirikunta oli yksi suhteellisesti pahiten kärsineitä seutuja 25. huhtikuuta 2015 sattuneessa maanjäristyksessä. Piirikunnan rakennuksista yli 80 prosenttia raportoitiin tuhoutuneiksi."},{"page_url":"https://de.wikipedia.org/wiki/Robert_Homburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Robert_Homburg_MP.jpg","page_title":"Robert Homburg","context_page_description":"Robert Homburg war ein deutsch-australischer Richter, Politiker und Minister.\\nHomburg war der erste Migrant nichtbritischer Herkunft, der als Richter an den Supreme Court, das höchste Gericht South Australias, berufen wurde."},{"page_url":"https://cs.wikipedia.org/wiki/Sorrento","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Sorrento_Transparent.png","page_title":"Sorrento","context_page_description":"Sorrento je italské přímořské město v oblasti Kampánie, ležící 48 km od Neapole. Nachází se v severozápadní části Sorrentského poloostrova, na výběžku pevniny do Tyrhénského moře. Město leží na 50 metrů vysoké tufové skále prudce klesající k moři."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%82%E0%B9%89%E0%B8%AD%E0%B8%81%E0%B8%B3%E0%B8%AB%E0%B8%99%E0%B8%94%E0%B8%81%E0%B8%B2%E0%B8%A3%E0%B8%95%E0%B8%A3%E0%B8%A7%E0%B8%88%E0%B8%A5%E0%B8%87%E0%B8%95%E0%B8%A3%E0%B8%B2%E0%B8%AA%E0%B8%B3%E0%B8%AB%E0%B8%A3%E0%B8%B1%E0%B8%9A%E0%B8%9E%E0%B8%A5%E0%B9%80%E0%B8%A1%E0%B8%B7%E0%B8%AD%E0%B8%87%E0%B9%84%E0%B8%97%E0%B8%A2","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ed/Thailand_ePassport.jpg","page_title":"ข้อกำหนดการตรวจลงตราสำหรับพลเมืองไทย","context_page_description":"ในเดือนมิถุนายน 2019 พลเมืองไทยสามารถเดินทางเข้าประเทศและดินแดน โดยได้รับการยกเว้นไม่ต้องทำการตรวจลงตรา หรือการตรวจลงตรา ณ ด่านตรวจคนเข้าเมือง ทั้งสิ้น 85 ประเทศและดินแดน\\nหนังสือเดินทางของไทยเป็นหนังสือเดินทางที่มีอิสระด้านวีซามากเป็นอันดับที่ 53 ของโลก"},{"page_url":"https://hu.wikipedia.org/wiki/Steinernes_Meer","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Steinernes_meer.jpg","page_title":"Steinernes Meer","context_page_description":"A Steinernes Meer egy karsztfennsík az Északi-Mészkőalpokban. A Berchtesgadeni-Alpok kilenc részhegységének tagjaként a Steinernes Meer részben Németországhoz részben Ausztriához tartozik.\\nA bajor része a Berchtesgadeni-Nemzeti Parkhoz az osztrák része a Kalkhochalpen természetvédelmi területhez tartozik, melynek a Steinernes Meer tájvédelmi körzet a legnagyobb kiterjedésű része."},{"page_url":"https://en.wikipedia.org/wiki/Grand_Soho_Makati","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Grand_Soho_Makati.jpg","page_title":"Grand Soho Makati","context_page_description":"The Grand Soho Makati is a skyscraper for residential uses completed June 2010 in Makati, Philippines. It is estimated to rise 41 floors above ground. The construction of Grand Soho Makati, the residential condominium of top real estate developer Century Properties in prime Salcedo Village, has reached full completion in June.\\nPositioned as the first fully fitted and fully furnished condominium in the country with three interior design options, GSM is now undergoing going project turnover and has reached a total of 210 accepted units aproject as of July 30. Forty-six percent, or 168 out of a total of 360 residential unit owners, have moved into the building while the remaining 192 are still going through the turnover process.\\nAn additional six units are allocated for commercial spaces at the ground floor. The 41-storey residential building comes with high-speed elevators, a Travertine stone-clad lobby, and concierge services."},{"page_url":"https://de.wikipedia.org/wiki/Nanos","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/RK_0707_1702_Nanos_Planote.jpg","page_title":"Nanos","context_page_description":"Nanos ist ein mittelgebirgiger Bergzug am südöstlichen Rand der Julischen Alpen respektive Nordrand des Karst im Südwesten Sloweniens, zwischen Postojna und Triest gelegen, seine höchste Erhebung mit 1313 m ist der Suhi Vrh."},{"page_url":"https://eu.wikipedia.org/wiki/Opio","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/William_Ewart_Gladstone%2C_1892_%28cropped%29.jpg","page_title":"Opio","context_page_description":"Opioa droga bat da, lo-belarretik lortzen den lehortutako latexa. Duela milioika urte erabili zen droga da. Egiptoarrek, greziarrek eta erromatarrek erabili zuten, edozein min baretzen zuen analgesiko indartsu gisa. Opioa, osasunerako sendagaiak egiteko erabiltzeaz gain, beste droga batzuk ere lortzeko erabiltzen da, hala nola heroina, morfina, kodeina eta beste hainbat analgesiko. Opiotik eskuratzen diren zenbait deribatuk erabilera medizinala dute; beste batzuk, aldiz, legez kanpoko droga-salerosketarako bideratzen dira."},{"page_url":"https://lmo.wikipedia.org/wiki/Chippis","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Chippis.JPG","page_title":"Chippis","context_page_description":"Chippis a l'è un cumün svizzer del distret de Sierre, in del Canton Vales. La süperfiss del teritori del cumün l'è de 2.0 km² e in del Dicember 2011 al gh'eva una popolazion de 1644 abitant.\\nEl cumün de Chippis al se tröva a una altitüden de 532 meter sura al livel del mar e l'è tacaa ai cumün de Chalais, Anniviers, Sierre."},{"page_url":"https://en.wikipedia.org/wiki/M%C3%A1xima_Alerta","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Maxima_Alerta_%40_SOB%27s_in_NYC.jpg","page_title":"Máxima Alerta","context_page_description":"Máxima Alerta is a Cuban-American fusion music band known for its merging of Cuban reggaeton, or Cubaton, with traditional Cuban music and other Latin musical genres.\\nThe band, founded in 1999 by Ray Machado in Santa Clara, Cuba, is credited, along with the band Cubanito 20.02, for popularizing Cubaton. Stylistically, it is known for its incorporating son Cubano, conga, cumbia, salsa, merengue, and Cuban rumba, as well as styles and forms such as rap and ballads. After the band was banned from performing in Cuba, Machado emigrated to Hudson County, New Jersey in the United States, where it resumed performing in 2011, playing in local venues such as the Park Performing Arts Center and Maxwell's, and at New York City locations such as The Bitter End."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Farm_to_Market_Roads_in_Texas_(2500%E2%80%932599)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Hahn_TX_FM_2546_at_1160_South.JPG","page_title":"List of Farm to Market Roads in Texas (2500–2599)","context_page_description":"Farm to Market Roads in Texas are owned and maintained by the Texas Department of Transportation."},{"page_url":"https://en.wikipedia.org/wiki/Governorates_of_Syria","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Ar-Raqqah-map.png","page_title":"Governorates of Syria","context_page_description":"Syria is a unitary state, but for administrative purposes, it is divided into fourteen governorates, also called provinces or counties in English. The governorates are divided into sixty districts, which are further divided into subdistricts. The nawāḥī contain villages, which are the smallest administrative units.\\nEach governorate is headed by a governor, appointed by the president, subject to cabinet approval. The governor is responsible for administration, health, social services, education, tourism, public works, transportation, domestic trade, agriculture, industry, civil defense, and maintenance of law and order in the governorate. The minister of local administration works closely with each governor to coordinate and supervise local development projects. The governor is assisted by a provincial council, all of whose members are popularly elected for four-year terms. In addition, each council elects from among its members an executive bureau which administers the day to day issues between provincial council sessions. Each executive officer is charged with specific functions.\\nDistricts and subdistricts are administered by officials appointed by the governor."},{"page_url":"https://de.wikipedia.org/wiki/Allen_Daviau","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Deyellspielbergdaviau.jpg","page_title":"Allen Daviau","context_page_description":"John Allen Daviau war ein US-amerikanischer Kameramann."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%84%D9%88%D8%B1%D9%8A%D9%86_%D9%83%D9%8A%D9%84%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/LorraineKellywiki.jpg","page_title":"لورين كيلى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nلورين كيلى صحفيه من المملكه المتحده."},{"page_url":"https://cs.wikipedia.org/wiki/Parlamentn%C3%AD_volby_v_Ma%C4%8Farsku_2010","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/81/2010_plak_bm_6_vk.jpg","page_title":"Parlamentní volby v Maďarsku 2010","context_page_description":"Parlamentní volby v Maďarsku v roce 2010 byly šesté svobodné volby Maďarské republiky od pádu komunismu v roce 1989. Prezident republiky László Sólyom vypsal první kolo voleb na 11. dubna, druhé kolo na 25. dubna 2010.\\nVýsledkem voleb je, že se do parlamentu dostaly čtyři strany a jeden nezávislý kandidát: Fidesz-KDNP, MSZP, Jobbik, LMP a nezávislý kandidát Oszkár Molnár."},{"page_url":"https://es.wikipedia.org/wiki/Ana_Maria_Braga","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/AnaMariaBraga.jpg","page_title":"Ana Maria Braga","context_page_description":"Ana Maria Braga Maffeis es una presentadora de televisión, periodista y actriz brasileña.​"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D8%B3%D9%81%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Plateau2.jpg","page_title":"اسفی","context_page_description":"اَسفی یکی از شهرهای کشور مراکش است. این شهر در کرانه اقیانوس اطلس و نزدیک به شهر کازابلانکا قرار دارد.\\nاسفی مرکز استان دُکّاله عَبده مراکش است. خود شهر اسفی ۲۸۴٬۷۵۰ نفر جمعیت دارد ولی جمعیت اسفی با حومه‌های مسکونی آن به ۷۹۳٬۰۰۰ نفر می‌رسد.\\nشهر اسفی بندر اصلی ماهیگیری مراکش و صنعت ساردین آن است.\\nاین شهر با نام سفیم میان سال‌های ۱۴۸۸ تا ۱۵۴۱ تحت فرمانروایی پرتغالیان قرار داشت.\\nاسفی در جنگ جهانی دوم یکی از محل‌های فرود برای عملیات مشعل بود."},{"page_url":"https://id.wikipedia.org/wiki/Emisi_proton","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Zerfallsschema.png","page_title":"Emisi proton","context_page_description":"Emisi proton adalah jenis peluruhan radioaktif yang langka di mana proton terlontar dari inti atom. Emisi proton dapat terjadi dari kondisi tereksitasi tinggi dalam inti atom setelah peluruhan beta, yang dalam hal ini prosesnya dikenal sebagai emisi proton beta tertunda, atau dapat terjadi dari keadaan dasar inti atom kaya proton, yang dalam hal ini prosesnya sangat mirip dengan peluruhan alfa. Agar dapat terlepas dari inti atom, energi pemisahan proton harus negatif - sehingga proton menjadi tak terikat, dan meluncur keluar dari inti atom dalam waktu yang sangat singkat. Emisi proton tidak terlihat dalam isotop alami; pemancar proton dapat dihasilkan melalui reaksi nuklir, biasanya menggunakan akselerator partikel linier.\\nMeskipun emisi proton yang cepat teramati dari sebuah isomer kobalt-53 pada awal 1969, belum ada keadaan emisi proton yang ditemukan hingga tahun 1981, ketika keadaan dasar proton radioaktif lutesium-151 dan tulium-147 teramati pada percobaan di GSI, Jerman Barat. Penelitian di lapangan berkembang setelah terobosan ini, dan sampai saat ini telah ditemukan lebih dari 25 isotop yang menunjukkan emisi proton."},{"page_url":"https://sv.wikipedia.org/wiki/William_Cumback","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/William_Cumback.jpg","page_title":"William Cumback","context_page_description":"William \\"Will\\" Cumback, född 24 mars 1829 i Franklin County, Indiana, död 31 juli 1905 i Greensburg, Indiana, var en amerikansk politiker. Han var ledamot av USA:s representanthus 1855–1857 och Indianas viceguvernör 1869–1873. Han var först whig och senare republikan.\\nCumback utexaminerades från Miami University i Oxford i Ohio, studerade sedan juridik i Cincinnati och inledde 1853 sin karriär som advokat i Indiana.\\nCumback efterträdde 1855 James H. Lane som kongressledamot och efterträddes 1857 av James B. Foley. Han var Indianas viceguvernör 11 januari 1869–13 januari 1873.\\nCumback avled 1905 och gravsattes på South Park Cemetery i Greensburg."},{"page_url":"https://en.wikipedia.org/wiki/Landsat_7","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Landsat-7_Mission_Patch.png","page_title":"Landsat 7","context_page_description":"Landsat 7 is the seventh satellite of the Landsat program. Launched on 15 April 1999, Landsat 7's primary goal is to refresh the global archive of satellite photos, providing up-to-date and cloud-free images. The Landsat Program is managed and operated by the United States Geological Survey, and data from Landsat 7 is collected and distributed by the USGS. The NASA WorldWind project allows 3D images from Landsat 7 and other sources to be freely navigated and viewed from any angle. The satellite's companion, Earth Observing-1, trailed by one minute and followed the same orbital characteristics, but in 2011 its fuel was depleted and EO-1's orbit began to degrade. Landsat 7 was built by Lockheed Martin Space Systems.\\nIn 2016, NASA announced plans to attempt the first ever refueling of a live satellite by refueling Landsat 7 in 2020 with the OSAM-1 mission, as of 2019 the date slipped to 2022."},{"page_url":"https://fi.wikipedia.org/wiki/Kirkko_(rakennus)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Transept.png","page_title":"Kirkko (rakennus)","context_page_description":"Kirkko on kristinuskon pyhäkkö eli pyhä rakennus. Hiippakunnan keskuskirkkoa kutsutaan tuomiokirkoksi eli katedraaliksi.\\nSuomen sana kirkko on lainattu muinaisruotsin sanasta kirkia. Pohjimmiltaan se juontuu kreikan adjektiivista kȳriakón, joka tarkoittaa ”Herralle kuuluvaa”, ”Herran omaa”."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E8%AF%AD%E9%9F%B3%E4%BA%A4%E6%9B%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Sound_change_%26_Alternation.jpg","page_title":"语音交替","context_page_description":"語音交替指的是同一語素具有不同音位學實現的現象。每一種不同的實現形式叫做交替形式，交替形式可能受到音位學、詞法學、句法學環境的調控。\\n語音交替為同位異音和同位異形的確定提供了依據。"},{"page_url":"https://de.wikipedia.org/wiki/Autoverladung","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Autoveradestation_Realp_der_Matterhorn-Gotthardbahn.jpg","page_title":"Autoverladung","context_page_description":"Unter einer Autoverladung oder einem Autoverlad versteht man den Transport fahrtauglicher und für den Verkehr zugelassener Kraftfahrzeuge mit einem anderen Fahrzeug."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Jean-Baptiste_de_Larbey","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Fresque_du_plafond_%2813%29_-_%C3%89glise_Saint-Jean-Baptiste_de_Larbey.jpg","page_title":"Église Saint-Jean-Baptiste de Larbey","context_page_description":"L'église Saint-Jean-Baptiste est située dans la commune de Larbey, dans le département français des Landes. Elle est inscrite au titre des monuments historiques par arrêté du 28 septembre 1970. Elle renferme des peintures singulières qui ont été restaurées avec soin."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%88%D8%A7%D9%84%D8%AA%D8%B1_%D9%87%D9%8A%D9%88%D8%B3%D8%AA%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Walter_Huston_in_The_Treasure_of_the_Sierra_Madre_trailer.jpg","page_title":"والتر هيوستن","context_page_description":"والتر توماس هيوستن ‏، كان ممثل ومغني من أصل كندي-أمريكي. فاز بجائزة الأوسكار لأفضل ممثل مساعد عن دوره في فيلم كنز السييرا مادري. كان والد الممثل والمخرج جون هيوستن، وجد بابلو هيوستن، والتر أنتوني هيوستن، أنجيليكا هيوستن، داني هيوستن و أليغرا هيوستن."},{"page_url":"https://en.wikipedia.org/wiki/Sor%C3%A8de","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Population_-_Municipality_code_66196.svg","page_title":"Sorède","context_page_description":"Sorède is a commune in the Pyrénées-Orientales department in southern France."},{"page_url":"https://cs.wikipedia.org/wiki/Tobolsk%C3%BD_kreml","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/%D0%9A%D0%BE%D0%BB%D0%BE%D0%BA%D0%BE%D0%BB%D1%8C%D0%BD%D1%8F_%D0%A3%D0%B3%D0%BB%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%BA%D0%BE%D0%BB%D0%BE%D0%BA%D0%BE%D0%BB%D0%B0.jpg","page_title":"Tobolský kreml","context_page_description":"Tobolský kreml je městská pevnost z konce 17. století v západosibiřském městě Tobolsk. Jedná se o jediný kamenný kreml, který kdy byl postaven v Asii. Byl významným administrativním a obchodním centrem Sibiře, 19. století se zde nacházela věznice. V současnosti slouží jako muzeum."},{"page_url":"https://ja.wikipedia.org/wiki/RDS-1","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/RIAN_archive_749574_Display_at_%2280th_Anniversary_of_GOELRO%22_exhibition.jpg","page_title":"RDS-1","context_page_description":"RDS-1とは、1949年8月29日午前7時にソ連で行なわれたソ連では初の核実験である。"},{"page_url":"https://ceb.wikipedia.org/wiki/Parco_Nord","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Parco_Nord_Milano.jpg","page_title":"Parco Nord","context_page_description":"Parke ang Parco Nord sa Italya. Nahimutang ni sa rehiyon sa Lombardia, sa amihanan-kasadpang bahin sa nasod, 500 km sa amihanan-kasadpan sa Rome ang ulohan sa nasod. 148 metros ibabaw sa dagat kahaboga ang nahimutangan sa Parco Nord.\\nAng yuta palibot sa Parco Nord kay patag, ug nga tinakpan sa ubos sa habagatan. Ang kinahabogang dapit sa palibot dunay gihabogon nga 394 ka metro ug 18.9 km sa amihanan sa Parco Nord. Dunay mga 2,711 ka tawo kada kilometro kwadrado sa palibot sa Parco Nord may kaayo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Milano, 8.8 km sa habagatan sa Parco Nord. Hapit nalukop sa kabalayan ang palibot sa Parco Nord.\\nAng klima umogon ug subtropikal. Ang kasarangang giiniton 15 °C. Ang kinainitan nga bulan Hulyo, sa 28 °C, ug ang kinabugnawan Enero, sa 0 °C. Ang kasarangang pag-ulan 1,638 milimetro matag tuig. Ang kinabasaan nga bulan Nobiyembre, sa 274 milimetro nga ulan, ug ang kinaugahan Septiyembre, sa 83 milimetro."},{"page_url":"https://en.wikipedia.org/wiki/Rear_mid-engine,_rear-wheel-drive_layout","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/2013_Porsche_Boxster_--_2012_NYIAS.JPG","page_title":"Rear mid-engine, rear-wheel-drive layout","context_page_description":"In automotive design, a RMR or Rear Mid-engine, Rear-wheel-drive layout is one in which the rear wheels are driven by an engine placed just in front of them, behind the passenger compartment. In contrast to the rear-engined RR layout, the center of mass of the engine is in front of the rear axle. This layout is typically chosen for its low moment of inertia and relatively favorable weight distribution. The layout has a tendency toward being heavier in the rear than the front, which allows for best balance to be achieved under braking. However, since there is little weight over the front wheels, under acceleration, the front of the car is prone to lift and cause understeer. Most rear-engine layouts have historically been used in smaller vehicles, because the weight of the engine at the rear has an adverse effect on a larger car's handling, making it 'tail-heavy'. It is felt that the low polar inertia is crucial in selection of this layout. The mid-engined layout also uses up central space, making it impractical for any but two-seater sports cars. However, some microvans use this layout, with a small, low engine beneath the loading area."},{"page_url":"https://fr.wikipedia.org/wiki/Canton_de_Sill%C3%A9-le-Guillaume","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5f/Map_canton_code_72_30.svg","page_title":"Canton de Sillé-le-Guillaume","context_page_description":"Le canton de Sillé-le-Guillaume est une division administrative française située dans le département de la Sarthe et la région Pays de la Loire.\\nÀ la suite du redécoupage cantonal de 2014, les limites territoriales du canton sont remaniées. Le nombre de communes du canton passe de 10 à 50."},{"page_url":"https://it.wikipedia.org/wiki/Freddie_Mercury","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Jimi_Hendrix_1967_uncropped.jpg","page_title":"Freddie Mercury","context_page_description":"Freddie Mercury, nato Farrokh Bulsara, è stato un cantautore, compositore e musicista britannico di origini parsi.\\nNel 1970, insieme al chitarrista Brian May e al batterista Roger Meddows-Taylor, fondò i Queen, ai quali un anno più tardi si aggiunse il bassista John Deacon. Per il gruppo rock britannico, con cui restò fino alla prematura morte avvenuta all'età di 45 anni a causa di una broncopolmonite aggravata dall'AIDS, scrisse molte canzoni, tra cui si annoverano successi come Bohemian Rhapsody, Crazy Little Thing Called Love, Don't Stop Me Now, It's a Hard Life, Killer Queen, Love of My Life, Bicycle Race, Play the Game, Somebody to Love e We Are the Champions.\\nOltre all'attività con i Queen, negli anni ottanta intraprese un breve percorso da solista con la pubblicazione di due album, Mr. Bad Guy nel 1985 e Barcelona nel 1988, quest'ultimo frutto della collaborazione con il soprano spagnolo Montserrat Caballé."},{"page_url":"https://en.wikipedia.org/wiki/Semu","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/SS_Zhongshan_-_captain_Sa_Shijun_-_P1540055.JPG","page_title":"Semu","context_page_description":"Semu is the name of a caste established by the Yuan dynasty. The Semu categories refers to people who come from Central and West Asia, it is told that there are 31 categories among them. They had come to serve the Yuan dynasty by enfranchising under the dominant Mongol caste. The Semu were not a self-defined and homogeneous ethnic group per se, but one of the four castes of the Yuan dynasty: the Mongols, Semu, the \\"Han\\" and the Southerners. Among the Semu were Buddhist Turpan Uyghurs, Tanguts and Tibetans; Nestorian Christian tribes like the Ongud; Alans; Muslim Central Asian Persian and Turkic peoples including the Khwarazmians and Karakhanids; West Asian Arab, Jewish and other minor groups who are from even further west."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Nordostring_(Bautzen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/August-Bebel-Platz_4_Bautzen.JPG","page_title":"Liste der Kulturdenkmale in Nordostring (Bautzen)","context_page_description":"In der Liste der Kulturdenkmale in Nordostring (Bautzen) sind die Kulturdenkmale des Bautzener Stadtteils Nordostring verzeichnet, die bis März 2018 vom Landesamt für Denkmalpflege Sachsen erfasst wurden. Die Anmerkungen sind zu beachten."},{"page_url":"https://en.wikipedia.org/wiki/Ferrari_126C","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Ferrari_126C2B_Detroit_Grand_Prix_1983.jpeg","page_title":"Ferrari 126C","context_page_description":"The Ferrari 126C is the car with which Ferrari raced in the 1981 Formula One season. The team's first attempt at a turbocharged Formula 1 car, it was designed by Mauro Forghieri and Harvey Postlethwaite and used between the 1981 and 1984 seasons. The engine chief engineer was Nicola Materazzi."},{"page_url":"https://en.wikipedia.org/wiki/Loyola_Greyhounds_men%27s_lacrosse","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Ridley_Athletic_Complex.jpg","page_title":"Loyola Greyhounds men's lacrosse","context_page_description":"The Loyola Greyhounds men's lacrosse team represents Loyola University Maryland in NCAA Division I lacrosse. Its home matches are played at the Ridley Athletic Complex. Charley Toomey has served as its head coach since 2006. It became a member of the Patriot League along with the university's other intercollegiate athletic programs on July 1, 2013. The Greyhounds were a member of the ECAC Lacrosse League from 2005 to 2013. It became the first member of the conference to win a national championship in 2012. It was also the first national title in the university's Division I history.\\nLoyola, a Jesuit university with over 3,700 undergraduates, has produced 13 USILA First Team All-Americans, 25 Second Team All-Americans, 18 Third Team All-Americans, and 68 Honorable Mention All-Americans. The Greyhounds local rivals are the Johns Hopkins Blue Jays, located just down Charles Street. The annual lacrosse game played between these two institutions is known as the \\"Battle of Charles Street\\". The program also has another significant rival in Baltimore, maintaining an annual series with the Towson Tigers since 1959."},{"page_url":"https://en.wikipedia.org/wiki/Bucesvara_Temple,_Koravangala","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Southern_wall_of_Bucesvara_Temple%2C_Koravangala.jpg","page_title":"Bucesvara Temple, Koravangala","context_page_description":"The Bucesvara temple is a simple yet elegant specimen of 12th century of Hoysala architecture. It is located in the village of Korvangla, 10 km from Hassan city, in Hassan district or Karnataka state, India. The temple was built in 1173 A.D. by a rich officer called Buci, to celebrate the coronation of Hoysala King Veera Ballala II.\\nNearby are two more temples that are in ruins. From the inscriptions on the premises, it is evident that these two temples had been commissioned by Buci's older brothers, Govinda and Naka. This temple is protected as a monument of national importance by the Archaeological Survey of India."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%AF%D8%B1%D8%A8%D9%87%E2%80%8C%D9%85%D8%A7%D9%87%DB%8C_%D8%A8%D8%A8%D8%B1%DB%8C_%D8%AE%D8%A7%D9%84%E2%80%8C%D8%AE%D8%A7%D9%84%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Pseudoplatystoma_fasciatum.png","page_title":"گربه‌ماهی ببری خال‌خالی","context_page_description":"گربه‌ماهی ببری خال‌خالی نام یک گونه از سرده گربه‌ماهی‌های ببری است."},{"page_url":"https://vi.wikipedia.org/wiki/Triteleia","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Triteleia_ixioides_scabra_1.jpg","page_title":"Triteleia","context_page_description":"Triteleia là một chi thực vật có hoa trong họ Asparagaceae."},{"page_url":"https://es.wikipedia.org/wiki/Batalla_de_Santa_Clara","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Tren_del_Che.JPG","page_title":"Batalla de Santa Clara","context_page_description":"La batalla de Santa Clara fue una serie de eventos a finales de diciembre de 1958 que condujeron a la captura de la ciudad cubana de Santa Clara por los revolucionarios bajo el mando del comandante Che Guevara. La victoria fue decisiva en la lucha de los revolucionarios contra el régimen del general Fulgencio Batista: después de 12 horas de la captura de la ciudad, Batista huyó de Cuba y Fidel Castro anunció la victoria."},{"page_url":"https://en.wikipedia.org/wiki/List_of_ironclad_warships_of_France","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Cuirass%C3%A9_Henri_IV.jpg","page_title":"List of ironclad warships of France","context_page_description":"France built a series of ironclad warships between the 1850s and 1890s; these began with the Dévastation-class ironclad floating batteries built during the Crimean War, which presaged Gloire, the first sea-going ironclad to be built by any navy."},{"page_url":"https://ht.wikipedia.org/wiki/Ursa,_Ilinwa","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Ursa_Town_Hall_from_northwest.jpg","page_title":"Ursa, Ilinwa","context_page_description":"Ursa, Ilinwa se yon vil Etazini. Li sitye nan leta Ilinwa.\\nChèf-lye li se?."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Gengenbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Gengenbach%2C_Ecke_Victor-Kretz-Strasse_-_Engelgasse.jpg","page_title":"Liste der Kulturdenkmale in Gengenbach","context_page_description":"In der Liste der Kulturdenkmale in Gengenbach sind Bau- und Kunstdenkmale der Stadt Gengenbach verzeichnet, die im „Verzeichnis der unbeweglichen Bau- und Kunstdenkmale und der zu prüfenden Objekte“ des Landesamts für Denkmalpflege Baden-Württemberg verzeichnet sind. Dieses Verzeichnis ist nicht öffentlich und kann nur bei „berechtigtem Interesse“ eingesehen werden. Die folgende Liste ist daher nicht vollständig und beruht auf anderweitig veröffentlichten Angaben."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Plyos.JPG","page_title":"Ивановская область","context_page_description":"Ива́новская о́бласть — субъект Российской Федерации, входит в состав Центрального федерального округа.\\nНа северо-западе граничит с Ярославской областью, на севере с Костромской областью, на востоке с Нижегородской областью, на юге с Владимирской областью. Площадь — 21 437 км², население — 997 135 чел. Областной центр — город Иваново. Код региона — 37.\\nНаграждена орденом Ленина."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%A6%B4%E6%A7%A4%E5%B1%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Durio_mansonii_%28Gamble%29_Bakh._as_Boschia_mansonii_Gamble.jpg","page_title":"榴槤屬","context_page_description":"榴梿属是锦葵科山芝麻亚科榴梿族下的一属。\\n本属已知有32个物种，其中已知能生产可食用果实的有9种，在国际贸易最上常见的就是榴梿，其它几种只在原生地市场上出现。\\n其它物种则未发现或未确定是否有可食用果实。"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D8%A7%D8%B1%D9%8A%D8%AE_%D8%B9%D9%84%D9%85_%D8%A7%D9%84%D8%A3%D8%AD%D9%8A%D8%A7%D8%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Cycler.jpg","page_title":"تاريخ علم الأحياء","context_page_description":"يدرس تاريخ علم الأحياء تطور الأحياء من الزمن القديم إلى المعاصر. مع أن مفهوم علم الأحياء كمجال واحد متماسك ظهر في القرن التاسع عشر، فإن علوم الأحياء ظهرت من تقاليد الطب والتاريخ الطبيعي المأخوذة من أيورفيدا، الطب المصري القديم وكتابات أرسطو وجالينوس في العصور اليونانية والرومانية القديمة. تم تطوير هذا العمل القديم خلال القرون الوسطى من قبل الأطباء والعلماء المسلمين مثل ابن سينا. خلال عصر النهضة الأوروبية وبداية العصر الحديث، تم تحديث الفكر في علم الأحياء في أوروبا بسبب الاهتمام المتجدد بالفلسفة التجريبية واكتشاف العديد من الكائنات الحية التي لم تكن معروفة سابقاً. من أهم العلماء الذين ساهموا في هذه الحركة أندرياس فيزاليوس ووليام هارفي اللذين اعتمدا على التجريب والمعاينة الدقيقة في الفسيولوجيا، وعلماء الطبيعة من أمثال كارلوس لينيوس وجورج دي بوفون، اللذان ابتدءا بتصنيف تنوع الحياة وسجل المستحاثات، بالإضافة إلى دراسة النمو والسلوك في الكائنات الحية. كشفت الدراسات المجهرية عن عالم الميكروبات الذي لم يكن معروفاً من قبل، مما أتاح المجال لظهور نظرية الخلية. حث الاهتمام المتزايد باللاهوت الطبيعي، نظراً لظهور الفلسفة الاّلية، على النمو المتزايد في مجال التاريخ الطبيعي.\\nخلال القرنين الثامن عشر والتاسع عشر، تطورت العلوم الأحيائية كعلم النبات وعلم الحيوان إلى فروع معرفية ذات احترافية عالية."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturg%C3%BCter_in_Z%C3%BCrich/Kreis_1_(Ost)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dd/Zoologisches_Museum_Z%C3%BCrich.jpg","page_title":"Liste der Kulturgüter in Zürich/Kreis 1 (Ost)","context_page_description":"Die Liste der Kulturgüter in Zürich/Kreis 1 (Ost) enthält alle Objekte im östlichen Teil des Kreises 1 der Stadt Zürich, die gemäss der Haager Konvention zum Schutz von Kulturgut bei bewaffneten Konflikten, dem Bundesgesetz vom 20. Juni 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten sowie der Verordnung vom 29. Oktober 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten unter Schutz stehen.\\nDie Liste umfasst Kulturgüter rechts der Limmat. Objekte der Kategorien A und B sind vollständig in der Liste enthalten, Objekte der Kategorie C fehlen zurzeit. Unter übrige Baudenkmäler sind weitere geschützte Objekte zu finden, die im Verzeichnis der Objekte von überkommunaler Bedeutung der kantonalen Denkmalpflege zu finden und nicht bereits in der Liste der Kulturgüter enthalten sind."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%88%88%E6%88%88%E8%88%9E%E9%9D%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Go-go_boots_by_Andre_Courreges%2C_1965.jpg","page_title":"戈戈舞靴","context_page_description":"戈戈舞靴是1960年代中期首次推出的低腳跟風格的女性時尚靴子。最初的戈戈舞靴設計是白色、低腳跟和中小腿高的舞靴，這種特定樣式有時被稱為庫雷熱靴子。包括在1960年代和1970年代非常流行的膝高跟方頭靴，配以高跟鞋。以及許多樣式，包括小貓高跟鞋版和白色以外的顏色。"},{"page_url":"https://en.wikipedia.org/wiki/Alice_in_Chains","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/William_DuVall_-_Alice_in_Chains_-_Roskilde_Festival_2010.jpg","page_title":"Alice in Chains","context_page_description":"Alice in Chains is an American rock band from Seattle, Washington, formed in 1987 by guitarist and vocalist Jerry Cantrell and drummer Sean Kinney, who later recruited bassist Mike Starr and lead vocalist Layne Staley. Starr was replaced by Mike Inez in 1993. William DuVall joined the band in 2006 as co-lead vocalist and rhythm guitarist, replacing Staley, who died in 2002. The band took its name from Staley's previous group, the glam metal band Alice N' Chains.\\nAlthough widely associated with grunge music, Alice in Chains' sound incorporates heavy metal elements. The band is known for its distinctive vocal style, which often included the harmonized vocals between Staley and Cantrell. Cantrell started to sing lead vocals on the 1992 acoustic EP Sap, and his role continued to grow in the following albums, making Alice in Chains a two-vocal band.\\nAlice in Chains rose to international fame as part of the grunge movement of the early 1990s, along with other Seattle bands such as Nirvana, Pearl Jam, and Soundgarden. They achieved success during the era with the albums Facelift, Dirt, Alice in Chains, as well as the EP Jar of Flies."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AD%D0%BB%D0%B5%D0%BE%D0%BD%D0%BE%D1%80%D0%B0_%D0%A0%D0%BE%D1%81%D1%81%D0%B8_%D0%94%D1%80%D0%B0%D0%B3%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Estateviolenta1959-Drago_cropped.jpg","page_title":"Элеонора Росси Драго","context_page_description":"Элеонора Росси Драго — итальянская кинозвезда 50-60-х годов 20-го века."},{"page_url":"https://fi.wikipedia.org/wiki/The_Bellrays","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/The_Bellrays-1.jpg","page_title":"The Bellrays","context_page_description":"The Bellrays on yhdysvaltalainen \\"rock'n'soul\\"-yhtye. Se perustettiin 1990-luvun alussa Kalifornian Riversidessa. Laulaja Lisa Kekaulan lisäksi kokoonpanoon kuuluvat Bob Vennum, Stefan Litrownik ja Justin Andres."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_d%27%C5%93uvres_d%27art_public_dans_l%27Ain","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Buste_Allombert_Cerdon_Ain_4.jpg","page_title":"Liste d'œuvres d'art public dans l'Ain","context_page_description":"Cet article recense les œuvres d'art dans l'espace public de l'Ain, en France."},{"page_url":"https://simple.wikipedia.org/wiki/Habitation_at_Port-Royal","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Port-Royal_Nova-Scotia_3.jpg","page_title":"Habitation at Port-Royal","context_page_description":"The Habitation at Port-Royal was an early French colonial settlement. Today it is a National Historic Site in Port Royal in the Canadian province of Nova Scotia."},{"page_url":"https://ca.wikipedia.org/wiki/Parada_d%27autob%C3%BAs","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Estaci%C3%B3_Autobusos_Granollers.JPG","page_title":"Parada d'autobús","context_page_description":"Les parades d'autobús són elements urbans, pertanyents al mobiliari urbà i caracteritzats per ser un espai públic i polivalent d'ús social i col·lectiu. Se situa a les calçades, on funciona com a mode de referencia física visible de l'existència dels autobusos de transport públic i assolint l'objectiu d'accés al sistema de transport públic mitjançant l'aturada dels autobusos per permetre als usuaris entrar i sortir del vehicle.Poden estar cobertes mitjançant marquesines per protegir els usuaris d'inclemències climatològiques com el fred i la pluja, ja que aquest element urbà es considera un refugi de vianants bàsic. Solen tenir elements de senyalística, com plaques informatives amb els números i mapes del recorregut de les línies d'autobús que hi passen per ajudar als passatgers i operadors d'autobusos a identificar el lloc designat de la parada. També poden tenir cartells de publicitat."},{"page_url":"https://ru.wikipedia.org/wiki/Fallschirmj%C3%A4gerhelm_M38","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Bundesarchiv_Bild_101I-539-0380-15%2C_Dr._Bruno_Sassen.jpg","page_title":"Fallschirmjägerhelm M38","context_page_description":"Fallschirmjägerhelm M38 — стальной шлем для воздушно-десантных подразделений Третьего рейха."},{"page_url":"https://fr.wikipedia.org/wiki/Faim","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Carl_von_Bergen_M%C3%A4dchen_mit_Teller.jpg","page_title":"Faim","context_page_description":"La faim désigne la sensation, apparaissant après un certain temps sans manger, qui pousse un être vivant à rechercher de la nourriture.\\nMétaphoriquement, ce mot peut s'appliquer à la recherche d'un autre objet, comme dans l'expression : avoir faim de culture."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Walker_County,_Georgia","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/The_Store.jpg","page_title":"National Register of Historic Places listings in Walker County, Georgia","context_page_description":"This is a list of properties and districts in Walker County, Georgia that are listed on the National Register of Historic Places.\\nThis National Park Service list is complete through NPS recent listings posted June 28, 2019."},{"page_url":"https://ca.wikipedia.org/wiki/Av%C3%A8na","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Population_-_Municipality_code_34019.svg","page_title":"Avèna","context_page_description":"Avèna és un municipi occità del Llenguadoc, situat al departament de l'Erau i a la regió d'Occitània.\\nAvèna està situada ens el cantons nauts d'Erau, dins l'alta vall d'Òrb prop del departament d'Avairon. El poble fa part dels tres vilatges termals de l'Erau, juntament amb Los Banhs de Balaruc e l'Amalon,"},{"page_url":"https://en.wikipedia.org/wiki/Holocene_extinction","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Climate_March_1123_%2834327144666%29.jpg","page_title":"Holocene extinction","context_page_description":"The Holocene extinction, otherwise referred to as the sixth mass extinction or Anthropocene extinction, is an ongoing extinction event of species during the present Holocene epoch as a result of human activity. The included extinctions span numerous families of plants and animals, including mammals, birds, reptiles, amphibians, fishes and invertebrates. With widespread degradation of highly biodiverse habitats such as coral reefs and rainforests, as well as other areas, the vast majority of these extinctions are thought to be undocumented, as the species are undiscovered at the time of their extinction, or no one has yet discovered their extinction. The current rate of extinction of species is estimated at 100 to 1,000 times higher than natural background rates.\\nThe Holocene extinction includes the disappearance of large land animals known as megafauna, starting at the end of the last glacial period. Megafauna outside of the African mainland, which did not evolve alongside humans, proved highly sensitive to the introduction of new predation, and many died out shortly after early humans began spreading and hunting across the Earth."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%AD%E0%B8%B1%E0%B8%99%E0%B8%94%E0%B8%B1%E0%B8%9A%E0%B8%AA%E0%B8%B1%E0%B8%95%E0%B8%A7%E0%B9%8C%E0%B8%9F%E0%B8%B1%E0%B8%99%E0%B9%81%E0%B8%97%E0%B8%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/DendromysLovatiSmit_white_background.jpg","page_title":"อันดับสัตว์ฟันแทะ","context_page_description":"อันดับสัตว์ฟันแทะ เป็นหนึ่งในอันดับของสัตว์เลี้ยงลูกด้วยน้ำนม ซึ่งเป็นประมาณร้อยละ 40 ของสปีชีส์สัตว์เลี้ยงลูกด้วยนมทุกชนิด สัตว์ในอันดับสัตว์ฟันแทะมีถิ่นอาศัยอยู่บนหลายทวีปยกเว้นทวีปแอนตาร์กติกา\\nวิธีการอยู่อาศัยของสัตว์ฟันแทะมีความหลากหลาย เช่น การอาศัยอยู่บนต้นไม้ การขุดรูอาศัยใต้ดิน หรือการอาศัยแบบครึ่งบกครึ่งน้ำ ชนิดของสัตว์ฟันแทะที่มนุษย์รู้จักกันเป็นอย่างดี ได้แก่ หนู กระรอก แพรรีด็อก เม่น ชิปมังก์ เม่น บีเวอร์ หนูตะเภา แฮมสเตอร์ เจอร์บิล แคพิบารา เป็นต้น ในขณะที่กระต่าย กระต่ายแจ็ก กระแต ไพกา ตุ่น และชูการ์ไกลเดอร์ไม่ถูกนับว่าเป็นสัตว์ฟันแทะถึงแม้จะมีรูปลักษณะภายนอกที่คล้ายคลึงกัน และกระต่าย กระต่ายแจ็ก และไพกามีฟันดัดหน้าที่สามารถเติบโตได้เรื่อย ๆ แต่มีจำนวนฟันที่ไม่เท่ากัน และมีพฤติกรรมการเคี้ยวที่ต่างจากสัตว์ฟันแทะ อีกทั้งสัตว์เหล่านี้มีประวัติการวิวัฒนาการที่แตกต่างจากสัตว์ฟันแทะที่แท้จริง จึงได้ถูกจัดให้อยู่ในอันดับกระต่าย โดยอันดับกระต่ายและอันดับสัตว์ฟันแทะเป็น \\"พี่น้อง\\" ซึ่งมีบรรพบุรุษร่วมกันที่ฐานและสร้างเคลดที่มีชื่อกลิเรส"},{"page_url":"https://de.wikipedia.org/wiki/Hamburgischer_K%C3%BCnstlerklub","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/K%C3%BCnstlerClubAusstellung.jpg","page_title":"Hamburgischer Künstlerklub","context_page_description":"Der „Hamburgische Künstlerklub“ war eine im Frühjahr 1897 gegründete Künstlervereinigung in Hamburg. Nach Angaben von Arthur Illies entstand er sogar bereits im Herbst 1896 als ein Zusammenschluss der sogenannten „Jungen Hamburger“. Die Schreibweise des Namens, zum Beispiel auf den Grafikmappen, variierte oft zum „Künstlerclub“ mit c.\\nZiel war neben einem Austausch unter den Künstlern ein geschlosseneres Auftreten in der Öffentlichkeit, insbesondere nachdem es dem Kunsthallendirektor Alfred Lichtwark offiziell verboten worden war, in seinen Räumlichkeiten der Kunsthalle Bilder des späteren Künstlerklubs zu zeigen und zu verkaufen. Allerdings hatte Lichtwark Wilhelm Suhr – Inhaber der Galerie Commeter in der Hermannstrasse – dazu gebracht, einen Ausstellungsraum in seinem Laden einzurichten, in dem er bereit war, die „Jungen Hamburger“ zweimal im Jahr für jeweils einen Monat auszustellen."},{"page_url":"https://ne.wikipedia.org/wiki/%E0%A4%A8%E0%A4%BE%E0%A4%9C%E0%A5%80_%E0%A4%AA%E0%A4%BE%E0%A4%B0%E0%A5%8D%E0%A4%9F%E0%A5%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Bundesarchiv_Bild_119-0289%2C_M%C3%BCnchen%2C_Hitler_bei_Einweihung_%22Braunes_Haus%22.jpg","page_title":"नाजी पार्टी","context_page_description":"सामान्यतः नाजी पार्टी भनेर चिनिने यो पार्टीको औपचारीक नाम राष्ट्रिय समाजवादी जर्मन मजदुर पार्टी थियो। जर्मनीको यो राजनीतिक पार्टी सन् १९२० देखि १९४५ को बीच सक्रिय रही नाजीवाद अभ्यासरत थियो। यसको पूर्ववर्ती पार्टी जर्मन मजदुर 'पार्टी सन् १९१९ देखि १९२० सम्म सक्रिय थियो। यो पार्टी पहिलो विश्व युद्धपछि जर्मनीमा कम्युनिस्टहरु बिरुद्दको बढ्दो प्रभाव र अर्धसैनिक बल संस्कृति संगै प्रादुर्भाव हुन थाल्यो । यो पार्टी साम्यवाद देखि र völkisch राष्ट्रवाद सम्म कार्यकार्ता आकर्षित गर्ने एक साधनको रूपमा सृष्टि गरिएको थियो। सुरुमा नाजी राजनीतिक रणनीतिको मुख्य चुरो ठूलो व्यापारको, बुर्जुआ, र पूंजीपति बिरोधि नारामा केन्द्रित थियो, तर यस्ता पक्षहरू पछि औद्योगिक संस्थाहरू समर्थन पाउन छोडिदै गए, र सन् १९३० तिर पार्टीको मान्यता यहुदी र मार्क्सवाद बिरोधी विषयवस्तुहरूमा केन्द्रित रह्यो। नस्लवाद नाजीवादको केन्द्रीय मान्यता थियो। नाजीहरूले एक \\"मानिसहरूको समुदाय\\" को विचार प्रचार गर्दथे। अन्य बिदेशी नश्ल, राजनीतिक, शारीरिक वा मानसिक समुहका मानिस कमसल भएकोले उनीहरूको उद्देश्य एकै नश्लका जर्मनहरूमा एकतावाद्द हुनुपर्छ भन्ने उद्देश्य राख्दथे।"},{"page_url":"https://zh.wikipedia.org/wiki/%E9%98%BF%E5%8D%A1%E8%BF%AA%E4%BA%9E%E5%B7%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Nomos_Arkadias.png","page_title":"阿卡迪亞州","context_page_description":"阿卡迪亚州，希腊二级行政区，位于伯罗奔尼撒半岛，人们在此安居乐业。“阿卡迪亚”原文arkadia，ark原意为躲避、避开，后指为方舟，adia指阎王，arkadia就是指躲避灾难的意思，现在被西方国家广泛用作地名，引申为“世外桃源”。"},{"page_url":"https://fr.wikipedia.org/wiki/Le_Testament_de_Sherlock_Holmes","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Testament_of_SH_-_Holmes_closeup.JPG","page_title":"Le Testament de Sherlock Holmes","context_page_description":"Le Testament de Sherlock Holmes est un jeu vidéo d'aventure développé par Frogwares et sorti sur PC, Xbox 360 et PS3 le 20 septembre 2012.\\nCe jeu est le sixième volet de la série « Sherlock Holmes » développée par Frogwares, d'où l'abréviation « Sherlock Holmes 6 » ou « SH6 » sous laquelle le jeu est parfois désigné."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D9%83%D8%A7%D8%B1%D8%A7%D8%A8%D9%8A%D8%AF%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Green_Scarab_Beetle_%28Chiloloba_acuta%29_W_IMG_3437.jpg","page_title":"سكارابيدا","context_page_description":"الفصيلة سكارابيدا تضم أكثر من 30000 نوع من الخنافس على مستوى العالم حسبما يتم تعريفها حاليًا. غالبًا ما يطلق على الأنواع في هذه الفصيلة الكبيرة اسم سكارابس أو خنافس سكارابس. إن تصنيف هذه الفصيلة غير مستقر إلى حد ما مع العديد من النظريات المتنافسة ومقترحات جديدة تظهر كثيرًا. من المحتمل أن تكون العديد من التحت فصائل المدرجة هنا لا يمكن التعرف عليها أطول من ذلك حيث إنه من المحتمل أن يتم تنزيلها إلى أقل من مرتبة الفصيلة الفرعية أو رفعها إلى رتبة الفصيلة. فصائل أخرى قد تمت إزالتها مؤخرًا وتم تقريبًا قبول ذلك عالميـًا"},{"page_url":"https://nl.wikipedia.org/wiki/Jean_Colin","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Twee_dames_met_een_baby.jpg","page_title":"Jean Colin","context_page_description":"Jean Colin was een Brusselse kunstschilder. Hij was in de eerste plaats portrettist, maar maakte ook familiale taferelen, stillevens, stads- en plattelandsgezichten en marines. Naast olieverfschilderijen, creëerde hij ook aquarellen, gouaches, houtskooltekeningen, pentekeningen en etsen. Colin schilderde meestal in een impressionistisch getinte realistische stijl, maar maakte eveneens – vooral tijdens de jaren 1910, begin jaren 1920 – impressionistische en fauvistische schilderijen. Hij werkte zowel in het atelier als in de open lucht."},{"page_url":"https://en.wikipedia.org/wiki/Historic_Jamestowne","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/78/JamestownGraves.jpg","page_title":"Historic Jamestowne","context_page_description":"Historic Jamestown is the cultural heritage site that was the location of the 1607 James Fort and the later 17th-century city of Jamestown. It is located on Jamestown Island, on the James River at Jamestown, Virginia and operated as a partnership between Preservation Virginia and the U.S. National Park Service.\\nThe site was designated Jamestown National Historic Site on December 18, 1940 and listed on the National Register of Historic Places on October 15, 1966. It was also designated a National Historic Chemical Landmark in 2007 by the American Chemical Society. It is adjacent and complementary with Jamestown Settlement, a living history museum built run by the Commonwealth of Virginia to interpret the early colony."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Hameln","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Stolperstein_in_Hameln_f%C3%BCr_Leon_Schenk.jpg","page_title":"Liste der Stolpersteine in Hameln","context_page_description":"Die Liste der Stolpersteine in Hameln gibt eine Übersicht über die im Rahmen der Aktion des Künstlers Gunter Demnig verlegten Stolpersteine in der Stadt Hameln in Niedersachsen."},{"page_url":"https://en.wikipedia.org/wiki/M%C3%BCnchen_Hauptbahnhof","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/M%C3%BCnchener_Bahnhof%2C_around_1854.jpg","page_title":"München Hauptbahnhof","context_page_description":"München Hauptbahnhof is the main railway station in the city of Munich, Germany. It is one of the three stations with long-distance services in Munich, the others being München Ost and München-Pasing. München Hauptbahnhof sees about 450,000 passengers a day, which puts it on par with other large stations in Germany, such as Hamburg Hauptbahnhof and Frankfurt Hauptbahnhof. It is classified by Deutsche Bahn as a category 1 station, one of 21 in Germany and two in Munich, the other being München Ost. The mainline station is a terminal station with 32 platforms. The subterranean S-Bahn with 2 platforms and U-Bahn stations with 6 platforms are through stations.\\nThe first Munich station was built about 800 metres to the west in 1839. A station at the current site was opened in 1849 and it has been rebuilt numerous times, including to replace the main station building, which was badly damaged during World War II."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Cervillego_de_la_Cruz","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Fundaci%C3%B3n_Joaqu%C3%ADn_D%C3%ADaz_-_Iglesia_parroquial_de_San_Juan_Degollado_-_Cervillego_de_la_Cruz_%28Valladolid%29.jpg","page_title":"Cervillego de la Cruz","context_page_description":"Cervillego de la Cruz sī tī Se-pan-gâ Castilla kap León chū-tī siā-lí Valladolid séng ê chi̍t ê municipio."},{"page_url":"https://fr.wikipedia.org/wiki/Les_Paroches","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Les_Paroches_%28Meuse%29_%C3%89glise_de_l%27Invention-de-Saint-%C3%89tienne_ext%C3%A9rieur_%2801%29.JPG","page_title":"Les Paroches","context_page_description":"Les Paroches est une commune française située dans le département de la Meuse, en région Grand Est."},{"page_url":"https://nl.wikipedia.org/wiki/Forquilha","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Bras%C3%A3o_Forquilha.jpg","page_title":"Forquilha","context_page_description":"Forquilha is een gemeente in de Braziliaanse deelstaat Ceará. De gemeente telt 21.599 inwoners."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E7%AD%96%E5%A2%A8%E6%9E%97%C2%B7%E9%98%BF%E6%97%BA%E5%9C%9F%E7%99%BB%E5%87%AF%E7%8F%A0%E6%A0%BC%E5%8B%92%E5%98%89%E6%8E%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/%E7%AD%96%E5%A2%A8%E6%9E%97%C2%B7%E9%98%BF%E6%97%BA%E5%9C%9F%E7%99%BB%E5%87%AF%E7%8F%A0%E6%A0%BC%E5%8B%92%E5%98%89%E6%8E%AA.jpg","page_title":"策墨林·阿旺土登凯珠格勒嘉措","context_page_description":"策墨林·阿旺土登凱珠格勒嘉措，乳名姜史奴卜，藏族，甘肅省卓尼縣沙蓋族村人，第四世策墨林活佛。"},{"page_url":"https://pl.wikipedia.org/wiki/Gimmick","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Tiger_Mask_IV_2015.JPG","page_title":"Gimmick","context_page_description":"Gimmick – postać odgrywana przez wrestlera. Na gimmick składa się zbiór cech charakterystycznych dla zawodnika, jego ubiór oraz historia w kayfabe. Ma on swoje przełożenie na zachowanie zawodnika w czasie pojedynków i w segmentach promocyjnych. W zależności od swojego gimmicku wrestler może być face’em, czyli bohaterem pozytywnym, któremu kibicuje publiczność, lub heelem – czarnym charakterem znielubionym przez publiczność. Wrestler, który nie jest ani face’em, ani heelem, nazywany jest tweenerem.\\nTermin gimmick, w języku polskim oznaczający sztuczkę, chwyt lub gadżet, jest jak większość pojęć związanych z wrestlingiem zapożyczony bezpośrednio z języka angielskiego."},{"page_url":"https://en.wikipedia.org/wiki/Lepidospartum","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Lepidospartum_latisquamum_7.jpg","page_title":"Lepidospartum","context_page_description":"Lepidospartum is a genus of North American desert shrubs in the daisy family. They are known commonly as broomsages or scalebrooms. These are tall, woody shrubs with stiff twiggy branches that resemble brooms. They are native to the southwestern United States and far northern Mexico. These shrub have thin, narrow, needlelike or scalelike leaves and bear yellow daisy flowers.\\nLepidospartum burgessii is an endangered species.\\nSpecies\\nLepidospartum burgessii - gypsum scalebroom - New Mexico, Texas\\nLepidospartum latisquamum - Nevada broomsage - California, Nevada, Utah\\nLepidospartum squamatum - California broomsage - California, Arizona, Baja California"},{"page_url":"https://en.wikipedia.org/wiki/NZR_X_class","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/%22X%22_class_%28compound%29_steam_locomotive_588%2C_4-8-2_type._ATLIB_257736.png","page_title":"NZR X class","context_page_description":"The New Zealand X class was a pioneering class of eighteen 4-8-2 steam locomotives built for New Zealand Railways Department and designed by A. L. Beattie that operated on the national rail network of New Zealand. In 1908, a heavy and powerful locomotive was required to haul traffic on the newly completed mountainous central section of the North Island Main Trunk Railway, and as a logical progression of the 4-6-2 Q class design, the 4-8-2 wheel arrangement was created for the X class."},{"page_url":"https://en.wikipedia.org/wiki/Ortona,_Glades_County,_Florida","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Ortona_FL_Lake_Wobegon_sign01.jpg","page_title":"Ortona, Glades County, Florida","context_page_description":"Ortona is an unincorporated area and a populated place in Glades County, Florida.\\nOne of the area's attractions is the Ortona Indian Mound Park, which preserves part of the Ortona Prehistoric Village, and the hiking trail through that area. The prehistoric mounds, canoe canals and earthworks were constructed by Native Americans across a five-square-mile region along the north side of the Caloosahatchee River. The site is located on SR 78, north of LaBelle."},{"page_url":"https://sl.wikipedia.org/wiki/Galicija_(Koro%C5%A1ka)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Robeze_%28avstrijska_Koroska%29._Partizanski_spomenik_prve_uspesne_bitke_16._avgusta_1942_upornikov_-_partizanov_v_3._Rajhu%2C.JPG","page_title":"Galicija (Koroška)","context_page_description":"Galicija je danes dvojezična občina v okraju Velikovec na avstrijskem Koroškem."},{"page_url":"https://la.wikipedia.org/wiki/Sergiopolis_(Russia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Coat_of_Arms_of_Sergiev_Posad_%28Moscow_oblast%29.png","page_title":"Sergiopolis (Russia)","context_page_description":"Vide etiam paginam discretivam: Sergiopolis\\nSergiopolis urbs est Russiae regionis Moscuensis, ubi Laura Sacrosanctae Trinitatis Sanctique Sergii sita est. Circum lauram urbs crescebat. Ab anno 1930 usque ad annum 1990 Zagorsk de nomino revolutionarii celebris nominabatur. Circa 103 milia incolarum Sergiopoli habitant."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%87%D9%88%D8%B4%D8%A7%D9%86%D8%AC_%D8%AC%D9%88%D9%84%D9%85%D8%A7%D9%83%D8%A7%D9%86%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Houshang_Golmakani_2018-11-14.jpg","page_title":"هوشانج جولماكانى","context_page_description":"هوشانج جولماكانى صحفى من ايران."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Houghton_County,_Michigan","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Smith-Dengler_House_Houghton_County_MI_2009.jpg","page_title":"National Register of Historic Places listings in Houghton County, Michigan","context_page_description":"This is a list of the National Register of Historic Places listings in Houghton County, Michigan.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Houghton County, Michigan, United States. The locations of National Register properties and districts for which the latitude and longitude coordinates are included below, may be seen in a map.\\nThere are 42 properties and districts listed on the National Register in the county, including 2 National Historic Landmarks.\\nThis National Park Service list is complete through NPS recent listings posted July 17, 2020."},{"page_url":"https://vi.wikipedia.org/wiki/Anemone_cylindrica","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Anemone_cylindrica_BB-1913.png","page_title":"Anemone cylindrica","context_page_description":"Anemone cylindrica là một loài thực vật có hoa trong họ Mao lương. Loài này được A.Gray mô tả khoa học đầu tiên năm 1828-836."},{"page_url":"https://vi.wikipedia.org/wiki/M%C3%B9a_b%C3%A3o_T%C3%A2y_B%E1%BA%AFc_Th%C3%A1i_B%C3%ACnh_D%C6%B0%C6%A1ng_2017","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Kulap_2017-07-24_0230Z_%28cropped%29.jpg","page_title":"Mùa bão Tây Bắc Thái Bình Dương 2017","context_page_description":"Mùa bão Tây Bắc Thái Bình Dương 2017 là một sự kiện mà theo đó các xoáy thuận nhiệt đới hình thành ở vùng phía Tây Bắc của Thái Bình Dương trong năm 2017, chủ yếu từ tháng 5-12. Mùa bão diễn biến tương đối bất thường với quỹ đạo các cơn bão lệch rất nhiều về phía Tây, hầu hết các cơn bão tác động đến đất liền các quốc gia và vùng lãnh thổ gây thiệt hại hết sức nặng nề đặc biệt tại Trung Quốc, Nhật Bản, Việt Nam. Hiện đã có tổng cộng 42 ATNĐ trong số đó có 27 cơn mạnh lên thành bão, hơn một nửa đã đi vào Biển Đông. Trên toàn khu vực, mùa bão 2017 diễn biến khá giống mùa bão các năm 1971, 1984, 1999. Mùa bão 2017 ghi nhận số xoáy thuận nhiệt đới nhiều nhất trong tháng 7 kể từ năm 1994. Ngày Noru mạnh lên cấp bão cuồng phong là thời điểm muộn nhất trong lịch sử các mùa bão Tây Bắc Thái Bình Dương xuất hiện cơn bão cuồng phong đầu tiên. Sau đánh giá lại thì mùa bão 2017 không ghi nhận cơn bão nào mạnh cấp 5 lần đầu tiên từ năm 1977.\\nTại Việt Nam, những cơn bão đổ bộ trong năm 2017 tập trung ở các tỉnh từ Hà Tĩnh đến Quảng Trị."},{"page_url":"https://en.wikipedia.org/wiki/Green_March","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Gr%C3%BCner_Marsch_Karte.png","page_title":"Green March","context_page_description":"The Green March was a strategic mass demonstration in November 1975, coordinated by the Moroccan government, to force Spain to hand over the disputed, autonomous semi-metropolitan province of Spanish Sahara to Morocco. The demonstration of some 350,000 Moroccans advanced several kilometres into the Western Sahara territory, escorted by nearly 20,000 Moroccan troops, and meeting very little response from the Sahrawi Polisario Front. Nevertheless, the events quickly escalated into a fully waged war between Morocco and the militias of the Polisario, the Western Sahara War, which would last for 16 years. Morocco later gained control over most of the former Spanish Sahara, which it continues to hold."},{"page_url":"https://ca.wikipedia.org/wiki/Kliutx%C3%A9vskaia_sopka","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Klyuchevskaya_Volcano_Russia_11Mar2018_SkySat.jpg","page_title":"Kliutxévskaia sopka","context_page_description":"El Kliutxévskaia sopka és un estratovolcà i la muntanya més elevada de la península de Kamtxatka. Amb una alçada de 4750 msnm és també el volcà en actiu més elevat d'Euràsia. El seu con, escarpat i simètric, s'eleva a un centenar de quilòmetres del mar de Bering. El volcà forma part dels volcans naturals de Kamtxatka, Patrimoni de la Humanitat de la UNESCO.\\nEl volcà presenta un cràter principal acompanyat de fins a 70 cràters secundaris i cons repartits pels seus vessants. S'han registrat més de 50 erupcions des de l'any 1700. L'any 1935 l'estació vulcanològica de Kamtxatka va establir-se a la seva base.\\nEl Kliutxévskaia aparegué ara fa 6.000 anys. La seva primera erupció registrada fou l'any 1697, i des de llavors s'ha seguit registrant activitat de manera contínua, així com passa amb la majoria de volcans veïns. Va ser escalat per primer cop l'any 1788 per Daniel Gauss i dos altres membres de l'expedició Billings, i no es va tornar a escalar fins a l'any 1931, quan diferents escaladors van morir per culpa de la lava durant el descens. Com que actualment el perill de la lava es manté, es realitzen pocs ascensos."},{"page_url":"https://de.wikipedia.org/wiki/Golden_Pipeline","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Mundaring_Weir_SMC9.jpg","page_title":"Golden Pipeline","context_page_description":"Die Golden Pipeline oder offiziell Goldfields Water Supply Scheme genannt in Western Australia war mit 540 Kilometern Länge die weltlängste Süßwasser-Pipeline. Sie verbindet den Lake C.Y.O’Connor nahe Perth mit dem Mount Charlotte-Reservoir bei Kalgoorlie-Boulder. Die Pipeline versorgt auch Orte in der weiteren Umgebung der Pipeline über Land mit Wasser.\\nDie Golden Pipeline wurde 2008 von der American Society of Civil Engineers in die List of International Historic Civil Engineering Landmarks aufgenommen und am 23. Juni 2011 in die Australian National Heritage List eingetragen."},{"page_url":"https://et.wikipedia.org/wiki/K%C3%BCndmine","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/K%C3%BCndmine_Saaremaal_74_%282%29.jpg","page_title":"Kündmine","context_page_description":"Kündmine ehk künd on mullaharimisviis, mille käigus pööratakse muld ümber. Kündmist kasutatakse, et mulda külvamiseks või istutamiseks ette valmistada.\\nKündmise peamine eesmärk on mulla pinnale tuua värskeid toitaineid, samal ajal kui maetakse umbrohu ja eelmiste põllukultuuride jääke, mis seal lagunevad. Mullaharimine kindlustab taimede arenguks vajaliku keskkonna loomise läbi oluliste tingimuste muutmise nagu õhustamine, mulle temperatuur, mulla niiskus, mulla struktuur, umbrohtude tõrjumine, toitainete olemasolu ja taimede tervis. Õige mullaharimise süsteemi valikul tuleb arvestada ka sellega, et kõik tööd saaksid tehtud õigeaegselt. Vajalikud tingimused taimede arenguks tuleb saavutada võimalikult väikese energia-, aja- ja investeeringute kuluga.\\nTänapäeval kasutatakse kündmiseks peamiselt hõlmatra. Varem on kasutatud ka hark-, konks-, kulp- ja vannasatra. Künnisügavus sõltub mulla huumushorisondi tüsedusest."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%A7%84%ED%99%94%EB%B0%9C%EC%83%9D%EC%83%9D%EB%AC%BC%ED%95%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Newborn_with_polydactyly_of_both_feet.jpg","page_title":"진화발생생물학","context_page_description":"진화발생생물학 또는 이보디보은 다양한 동물과 식물의 발생과정을 비교하여 공통 조상에서부터 진화한 생물의 공통 요소와 변이를 연구하는 생물학의 한 분야이다.\\n진화발생생물학은 생물학의 한 분야로, 공통의 조상 관계를 결정짓기 위해 생물들의 발생과정을 비교하고 발생 과정 상의 진화에 대해 연구한다.\\n이보디보는 발생의 근원과 발생 경로의 진화, 발생에서의 변화가 낳은 새로운 형질들, 발생의 유동성이 진화에서 가지는 역할, 생태학이 발생적•진화적 변화에 미치는 영향, 진화적 상동의 발생학적 배경에 대해 정의한다.\\n진화발생생물학은 발생의 과정이 어떻게 진화했고, 유전의 과정에서 어떻게 변경되었으며, 그 결과 어떻게 생물 다양성이 형성되는지를 연구한다."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%82%D0%B5%D0%BD%D0%BE%D0%B3%D1%80%D0%B0%D1%84%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BC%D0%B0%D1%88%D0%B8%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Antonio_Michela_Zucco.JPG","page_title":"Стенографическая машина","context_page_description":"Стенографическая машина — вид пишущей машинки для стенографирования. Стенотипия — печать текста на стенографической машине.\\nУ стенографической машины несколько особенностей. Во-первых, аккордовая клавиатура. Клавиши выполняются из гладкого прочного материала и обычно не имеют буквенных обозначений. Во-вторых, результат набора — узкая бумажная лента, на которой один аккорд размещается на одной строке. В-третьих, количество клавиш у машинки значительно меньше, чем букв в алфавите. Поэтому некоторые буквы обозначаются сочетаниями нескольких других букв. В-четвёртых, и это самое важное, для каждого варианта машинки должны существовать простые, логичные и удобные правила стенографирования слов.\\nСледует различать проблему создания машины, выбор раскладки клавиатуры для машины и создание правил сокращения слов для данного языка. Для того, чтобы стенографическая машина стала использоваться профессионалами, изобретатель должен был более или менее удачно решить все три проблемы. Поскольку это довольно сложно было сделать, количество попыток и изобретений измеряется многими десятками."},{"page_url":"https://en.wikipedia.org/wiki/National_Academy_of_Sciences_Building","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/NationalAcademySciences_07110011.jpg","page_title":"National Academy of Sciences Building","context_page_description":"The National Academy of Sciences Building houses the executive offices of the National Academy of Sciences, National Academy of Engineering, and the National Academy of Medicine. It is located at 2101 Constitution Avenue, N.W., in Washington, D.C. Designed by Bertram Grosvenor Goodhue, the building's architecture combines elements of Classicism and irregular forms into a new “Alexandrian” style. President Calvin Coolidge gave the principal address at the building dedication ceremony on April 28, 1924, referring to the building as a \\"Temple of Science\\"."},{"page_url":"https://en.wikipedia.org/wiki/Arrondissement_of_Vannes","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Locator_map_of_Arrondissement_Vannes_2019.png","page_title":"Arrondissement of Vannes","context_page_description":"The arrondissement of Vannes is an arrondissement of France in the Morbihan department in the Brittany region. It has 99 communes. Its population is 279,964, and its area is 2,416.2 km²."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BB%D1%83%D0%BA%D1%81%D0%BD%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Al%C5%ABksne_kunstikool_02.JPG","page_title":"Алуксне","context_page_description":"А́луксне — місто на березі озера Алуксне на північному сході Латвії поблизу кордонів з Естонією та Росією."},{"page_url":"https://no.wikipedia.org/wiki/Templet_korps","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/10/Frelsesarmeen_oslo.jpg","page_title":"Templet korps","context_page_description":"Templet korps er Frelsesarmeens første menighet i Norge. Historien går tilbake til organisasjonens offisielle åpning med friluftsmøte på Grønland torg den 22. januar 1888. Korpset ble fra starten av kalt Oslo 1. korps og holdt sine møter i lokaliteter på Grønland. Da Frelsesarmeens nye bygg i Pilestredet 22 stod ferdig i desember 1888, flyttet Oslo 1. korps dit og et korps nummer to fortsatte på Grønland.\\nTemplet holdt til i Pilestredet 22 fram til 1978 da det på grunn av reguleringsplaner ble nødvendig for korpset og Frelsesarmeens hovedkvarter å bygge nye lokaliteter. I dag befinner korpset seg på Kommandør T.I. Øgrims plass 4.\\nTemplet er Frelsesarmeen største menighet i Norge, er kjent for sine gode musikkgrupper og har i dag også et bredt idrettstilbud.\\nLeder for menigheten er major Anders Skoland"},{"page_url":"https://en.wikipedia.org/wiki/Balraj_Pandit","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Balraj_Pandit.jpg","page_title":"Balraj Pandit","context_page_description":"Balraj Pandit was a well-known Hindi and Punjabi playwright besides being a theatre director, poet, painter and a popular teacher. His Paanchwan Sawaar is considered a classic and a significant play of Indian dramaturgy. The play has been staged many times by different theatre troupes with actors like Naseeruddin Shah, Om Puri and Manohar Singh among other playing roles. Lok Udaasi in Punjabi was another of his well-known plays besides Biwiyon Ka Madrasa an adaptation of Molière's L'École des Femmes.\\nPanditji, as he was fondly called, graduated from National School of Drama, New Delhi in 1969. He studied theatre under such stalwarts as Ebrahim Alkazi and then after a short stint of teaching in NSD he joined Theatre and Television Department at Punjabi University in Patiala. He taught generations of students there till his retirement.\\nHe lived at Patiala in Punjab until he died on 13 October 2006."},{"page_url":"https://ur.wikipedia.org/wiki/%D9%86%D8%A7%D9%86%D8%AC%D9%86%DA%AF_%D9%86%D8%A7%D8%B1%D9%85%D9%84_%DB%8C%D9%88%D9%86%DB%8C%D9%88%D8%B1%D8%B3%D9%B9%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Beautiful_Nanjing_Normal_University.jpg","page_title":"نانجنگ نارمل یونیورسٹی","context_page_description":"نان جنگ نارمل یونیورسٹی چینی زبان:南京师范大学، پینین: Nánjīng نانجنگ، جیانگسو، چین کی ایک یونیورسٹی ہے۔ یہ تاریخ چین کے چھ شاہی خاندانوں کے دار الحکومت اور قدیم شہر نانجنگ میں موجود چین کی بنیادی یونیورسٹیوں میں سے ایک ہے پروجیکٹ 211 کا ایک حصہ ہے اور وزارت تعلیم اور صوبہ جیانگسو کی زیر نگرینی علمی کام میں رواں دواں ہے۔یہ یونیورسٹی وزارت تعلیم کی ڈبل فرسٹ کلاس ڈسپلن یونیورسٹی ہے۔ اور کچھ شعبوں کو یہ درجہ حاصل ہے۔\\n1902ء میں سانجیانگ نورمل کالج کی بنیاد رکھی گئی۔ اب یہی کالج یونیورسٹی کا روپ لے چکا ہے۔ یہ اپنی تعلیم اور سائنسی ریسرچ کے کے لیے جانی جاتی ہے۔اسے کئی معنوں میں چین کی 50 اہم یونیورسٹیوں میں شامل کیا جاتا ہے۔\\nیونیورسٹی کے تین کیمپس ہیں،شیانلن، سیونیان اور شیجین۔"},{"page_url":"https://ja.wikipedia.org/wiki/%E7%A8%AE%E9%96%93%E5%AF%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Tanemazi_06.jpg","page_title":"種間寺","context_page_description":"種間寺は、高知県高知市にある寺院。山号は本尾山。院号は朱雀院と号する。宗旨は真言宗豊山派。本尊は薬師如来。\\n四国八十八箇所霊場の第三十四番札所。安産祈願の寺である。\\n本尊真言：おん ころころ せんだりまとうぎ そわか\\nご詠歌：世の中にまける五穀のたねまでら 深き如来の大悲なりけり\\n納経印：当寺本尊、奥之院瑠璃光佛"},{"page_url":"https://fr.wikipedia.org/wiki/Chad_Townsend","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Chad_Townsend.jpg","page_title":"Chad Townsend","context_page_description":"Chad Townsend, né le 10 janvier 1991 à Caringbah, est un joueur de rugby à XIII australien évoluant au poste de demi de mêlée ou de demi d'ouverture. Il fait ses débuts en National Rugby League avec les Sharks de Cronulla-Sutherland lors de la saison 2011, mais c'est lors de son départ en 2013 pour deux aux Warriors de New Zealand qu'il parvient à se faire une place de titulaire au sein d'une équipe de NRL, il retourne en 2016 aux Sharks de Cronulla-Sutherland. Il a également pris part à deux reprises au City vs Country Origin où il y compte deux victoires.\\nIl a remporté en 2016 la NRL aux Sharks de Cronulla-Sutherland où il compose la charnière avec James Maloney."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%BE%D0%B2%D0%BE%D0%B5_(%D0%AE%D1%80%D1%8C%D0%B5%D0%B2-%D0%9F%D0%BE%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Dup%2801%29IMG_%D0%9E%D1%82%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5.jpg","page_title":"Новое (Юрьев-Польский район)","context_page_description":"Новое — село в Юрьев-Польском районе Владимирской области России. Входит в состав Красносельского сельского поселения."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%A1%D1%8C%D0%BF%D1%96%D1%81_%D0%B3%D0%B0%D1%80%D0%B0%D0%B4%D0%BE%D1%9E_%D0%9D%D1%8F%D0%BC%D0%B5%D1%87%D1%87%D1%8B%D0%BD%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Freiburg_017.650.n.jpg","page_title":"Сьпіс гарадоў Нямеччыны","context_page_description":"Сьпіс гарадоў Нямеччыны паводле колькасьці насельніцтва. У сьпіс уключаныя гарады з насельніцтвам ня менш за 200 000 чалавек па стане на 31 сьнежня 2013 году. Колькасьць насельніцтва прыводзіцца адносна названага гораду без уліку пасяленьняў, якія складаюць яго прыгарады."},{"page_url":"https://az.wikipedia.org/wiki/Slavoy_Jijek","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Slavoj_%C5%BDi%C5%BEek_with_Arif_Herali%C4%87_shirt.jpg","page_title":"Slavoy Jijek","context_page_description":"Slavoy Jijek — Sloveniya filosofu, marksisti, mədəniyyət tənqidçisi. İlk dəfə bir ictimai nəzəriyyəçi kimi 1989-cu ildə, ilk ingiliscə kitabı olan \\"İdeologiyanın əzəmətli obyekti\\" kitabı sayəsində məşhur olmuşdur. O, bu kitabında ideologiyanın marksizm tərəfindən verilən izahını saxta şüur olduğunu irəli sürmüş və ideologiyanı reallığı formalaşdıran bir şüursuz fantaziya kimi təqdim etmişdir. Jijek özünü bir neoliberalizm tənqidçisi hesab edir.\\nQeyri-ənənəvi tərzi sayəsində məşhur olmuş, bəzən də \\"Fəlsəfənin Elvisi\\" adlandırılmışdır."},{"page_url":"https://sl.wikipedia.org/wiki/Odboj","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Reflexion_vinklar.svg","page_title":"Odboj","context_page_description":"Odbòj je v fiziki nenadna sprememba smeri valovnega čela na meji dveh različnih sredstev, pri čemer valovno čelo spremeni smer tako, da se vrne v sredstvo iz katerega je vpadla na mejo. Zgledi so odboj svetlobe, zvoka in valovanja na vodni gladini.\\nGlede na značilnosti meje sredstev je odboj svetlobe lahko zrcalni ali difuzni, pri katerem se ne ohranja podoba, ampak le energija. Faza odbitega valovanja je lahko enaka ali obrnjena kot faza vpadlega valovanja, odvisno od tega, ali valovanje vpada iz dielektrika v prevodnik ali iz dielektrika v drug dielektrik."},{"page_url":"https://de.wikipedia.org/wiki/Gokoku-Schrein","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Aichiken_Gokoku_Jinja_by_Ichibanto_in_Nagoya.jpg","page_title":"Gokoku-Schrein","context_page_description":"Gokoku-Schreine sind Shintō-Schreine, in denen Soldaten und andere Militärpersonen als Kami verehrt werden, die in Kriegen auf japanischer Seite gefallen sind. Sie sind dafür individuell namentlich in den Registern der jeweiligen Schreine verzeichnet.\\nBis zu einer Verordnung des Heimat-Ministeriums aus dem Jahr 1939 waren diese Schreine mehrheitlich als shōkonjō bzw. ab 1875 einheitlich als shōkonsha bekannt. Ursprünglich waren sie errichtet worden für die seit den späten 1840ern bis in die Wirren der Meiji-Restauration Gefallenen, zumeist Loyalisten auf der Seite des Tennō. Es existierten sowohl private als auch öffentliche shōkonsha. Die öffentlich geführten Schreine der Regierungsbezirke, Daimyate und Präfekturen wurden 1873/1874 in die Verwaltung der Zentralregierung überführt.\\nDie ersten shōkonsha wurden zum Ende des Shōgunats Mitte der 1860er gebaut. 1868 wurde der Bau eines nationalen shōkonsha für alle die Soldaten angeordnet, die für Japan gefallen waren. Dies sollte der spätere Yasukuni-Schrein werden, der noch heute diese Funktion erfüllt."},{"page_url":"https://cs.wikipedia.org/wiki/Hurricane_(Utah)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Hurricaneutah.jpg","page_title":"Hurricane (Utah)","context_page_description":"Hurricane je město v okresu Washington County ve státě Utah. K roku 2010 zde žilo 13 748 obyvatel. S celkovou rozlohou 81,7 km² byla hustota zalidnění 170 obyvatel na km²."},{"page_url":"https://en.wikipedia.org/wiki/1_yen_note","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Revised_1_Yen_Bank_of_Japan_Silver_convertible_-_back.jpg","page_title":"1 yen note","context_page_description":"The ¥1 note is a Japanese banknote from the Bank of Japan."},{"page_url":"https://en.wikipedia.org/wiki/Influence_of_Sesame_Street","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Joan_Ganz_Cooney.JPG","page_title":"Influence of Sesame Street","context_page_description":"The children's television program Sesame Street premiered in 1969 to high ratings, positive reviews, and some controversy, which have continued during its history. Even though the show aired on only 67% of American televisions at the time of its premiere, it earned a 3.3 Nielsen rating, or 1.9 million households. By its tenth anniversary in 1979, 9 million American children under the age of six were watching Sesame Street daily. Its ratings declined in the 1990s, due to societal changes. A survey conducted in 1996 found that by the age of three, 95% of all American children had watched it. By its fortieth anniversary in 2009, it was ranked the fifteenth most popular children's show.\\nAccording to writer Michael Davis, Sesame Street is \\"perhaps the most vigorously researched, vetted, and fretted-over program\\". By 2001, there were over 1,000 research studies regarding its efficacy, impact, and effect on American culture. Two landmark summative evaluations, conducted by the Educational Testing Service in 1970 and 1971, demonstrated that Sesame Street had a significant educational impact on its viewers."},{"page_url":"https://fr.wikipedia.org/wiki/Front_de_gauche_(Russie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Column_Left_Front_at_demonstration%2C_November_7%2C_2010.jpg","page_title":"Front de gauche (Russie)","context_page_description":"Le Front de gauche ou FDG est une coalition de mouvements et partis politiques russes d'extrême gauche créée le 18 octobre 2008. Elle est présidée par Sergueï Oudaltsov, prisonnier d'opinion reconnu par Amnesty International, et principalement entre 2013 et 2017. Cette organisation est connue pour être très critique envers Vladimir Poutine.\\nLe parti cesse pratiquement toute activité en 2016. Pour l'élection présidentielle russe de 2018, le parti apporte son soutien au candidat du Parti communiste de la fédération de Russie Pavel Groudinine."},{"page_url":"https://es.wikipedia.org/wiki/Juegos_Ol%C3%ADmpicos","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Olympic-flag-Victoria.jpg","page_title":"Juegos Olímpicos","context_page_description":"Los Juegos Olímpicos​ ​, ​ Olimpiadas​ u Olimpíadas​ son el mayor evento deportivo internacional multidisciplinario en el que participan atletas de diversas partes del mundo. Los Juegos Olímpicos son considerados la principal competición del mundo deportivo, con más de doscientas naciones participantes.​ Existen dos tipos: los Juegos Olímpicos de Verano y los Juegos Olímpicos de Invierno, que se realizan con un intervalo de dos años, según la Carta Olímpica: «Los Juegos de la Olimpiada se celebran durante el primer año de una Olimpiada, y los Juegos Olímpicos de Invierno durante su tercer año».​\\nLos Juegos Olímpicos modernos se inspiraron en los Juegos Olímpicos de la antigüedad del siglo VIII a. C. organizados en la antigua Grecia con sede en la ciudad de Olimpia, realizados entre los años 776 a. C. y el 393 de nuestra era. En el siglo XIX, surgió la idea de realizar unos eventos similares a los organizados en la antigüedad, los que se concretarían principalmente gracias a las gestiones del noble francés Pierre Frèdy, barón de Coubertin. El barón de Coubertin fundó el Comité Olímpico Internacional en 1894."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D1%81%D0%B5%D0%BE%D0%B1%D1%89%D0%B8%D0%B5_%D0%B2%D1%8B%D0%B1%D0%BE%D1%80%D1%8B_%D0%B2_%D0%9A%D0%BE%D1%81%D1%82%D0%B0-%D0%A0%D0%B8%D0%BA%D0%B5_(2014)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Resultados_electorales_por_provincia_2014.png","page_title":"Всеобщие выборы в Коста-Рике (2014)","context_page_description":"Всеобщие выборы в Коста-Рике проходили 2 февраля и 6 апреля 2014 года. На них избирались президент Коста-Рики, два вице-президента и 57 депутатов Законодательного собрания Коста-Рики. Голосование в стране являлось обязательным.\\nПрезидент Коста-Рики Лаура Чинчилья не могла баллотироваться на второй срок согласно статье 123 Конституции Коста-Рики.\\nВо втором туре президентских выборов с большим отрывом победил кандидат от Партии гражданское действие Луис Гильермо Солис.\\nПо итогам выборов правительственную коалицию в парламенте сформировали левые Партия гражданского действия и Широкий фронт с Объединённой социально-христианской партией."},{"page_url":"https://nl.wikipedia.org/wiki/NGC_3832","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/NGC3832_-_SDSS_DR14.jpg","page_title":"NGC 3832","context_page_description":"NGC 3832 is een balkspiraalstelsel in het sterrenbeeld Leeuw. Het hemelobject werd op 10 april 1785 ontdekt door de Duits-Britse astronoom William Herschel."},{"page_url":"https://it.wikipedia.org/wiki/Raymond_Collishaw","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/33/Colishaw.JPG","page_title":"Raymond Collishaw","context_page_description":"Raymond Collishaw è stato un aviatore canadese.\\nVicemaresciallo dell'aviazione CB, DSO & Bar, OBE, DSC, DFC e della RAF è stato un pilota di caccia canadese distintosi come asso dell'aviazione.\\nCaposquadriglia e comandante, ha servito nel Royal Naval Air Service e successivamente nella Royal Air Force, fu il detentore del miglior punteggio tra i piloti del Royal Naval Air Service ed il secondo più alto tra quelli canadesi della prima guerra mondiale. È stato un grande leader in volo, portando molte delle sue formazioni alla vittoria in battaglia, abbattendo durante il conflitto un totale di 66 aerei nemici.\\nCome membro della RAF durante la seconda guerra mondiale, comandò il No. 204 Group RAF nel Nordafrica."},{"page_url":"https://nl.wikipedia.org/wiki/Botulisme","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Botulisme_preventie.png","page_title":"Botulisme","context_page_description":"Botulisme is een vergiftiging door het vergif botulinetoxine waaraan vooral watervogels en vissen sterven. In het begin gaat het vooral gepaard met spierverlamming. Er zijn zeven verschillende typen botuline waaronder drie die gevaarlijk zijn voor de mens.\\nDe bacterie Clostridium botulinum, die botulisme veroorzaakt kan zich alleen onder bepaalde omstandigheden snel vermenigvuldigen:\\nin een eiwitrijk zuurstofarm milieu;\\nin water dat 20 graden Celsius of nog warmer is.\\nDe bacterie komt wereldwijd voor. De naam komt van botulus, omdat de ziekte voor het eerst werd beschreven einde 18e eeuw, toen in Wildbad een gezelschap ziek werd na het eten van worst.\\nNiet de bacterie zelf veroorzaakt de symptomen, maar het door die bacterie afgescheiden toxine. Dit veroorzaakt een blokkade van de signaaloverdracht van zenuw naar spier."},{"page_url":"https://fr.wikipedia.org/wiki/Aire_urbaine_de_Bayonne","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Bayonne_depuis_la_for%C3%AAt_du_Lazaret.jpg","page_title":"Aire urbaine de Bayonne","context_page_description":"L'aire urbaine de Bayonne est une aire urbaine française centrée sur les 27 communes de l'unité urbaine de Bayonne. Composé de soixante communes des Pyrénées-Atlantiques et des Landes, ses 288 359 habitants en faisaient la 36ᵉ aire urbaine française en 2012."},{"page_url":"https://de.wikipedia.org/wiki/Kfz-Kennzeichen_(Spanien)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Matr%C3%ADcula_automovil%C3%ADstica_Espa%C3%B1a_1971_R_7286_BBW_remolque.jpg","page_title":"Kfz-Kennzeichen (Spanien)","context_page_description":"Die Kfz-Kennzeichen in Spanien basieren seit 2001 auf einem national einheitlichen System, das keine Rückschlüsse auf die nähere Herkunft des Fahrzeuges zulässt.\\nBei den zuvor ausgegebenen Kennzeichen, die teilweise noch im Gebrauch sind, bezeichnet der erste bzw. die ersten beiden Buchstaben des Kennzeichens die Provinz, in der das Fahrzeug erstmals zugelassen wurde.\\nDiese waren, wie auch die aktuellen Kennzeichen, fahrzeuggebunden, d. h., das Kennzeichen verbleibt bei Besitzerwechsel am Fahrzeug."},{"page_url":"https://fr.wikipedia.org/wiki/Cromlech_de_Gors_Fawr","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Between_the_Standing_Stones_-_geograph.org.uk_-_1041038.jpg","page_title":"Cromlech de Gors Fawr","context_page_description":"Le cromlech de Gors Fawr est un cercle de pierres situé près de Mynachlog-ddu, au Pays de Galles."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Wasigny","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Wasigny%28Ardennes%29_city_limit_sign.JPG","page_title":"Wasigny","context_page_description":"Wasigny sī ūi-tī Hoat-kok Champagne-Ardenne toā-khu Ardennes koān ê chi̍t ê commune."},{"page_url":"https://en.wikipedia.org/wiki/Sruwaddacon_Bay","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Bottlenose_dolphins_play_in_Sruwaddacon_Estuary%2C_Broadhaven%2C_Erris%2C_Co._Mayo._August_2010.jpg","page_title":"Sruwaddacon Bay","context_page_description":"Sruwaddacon Bay is a tidal estuary which runs through the middle of the Gaeltacht Kilcommon parish in Erris, County Mayo, Ireland. It is of historical importance in Irish legend, an important marine habitat, an E.U. Special Area of Conservation and an EU Special Protected Area. Its translated name in English, \\"Stream of the Long Hound\\", reflects its general shape. It enters the Atlantic Ocean through Broadhaven Bay, another Special Area of Conservation.\\nThe estuary measures approximately 8.4 square kilometres and consists of a north-westerly-orientated main channel fed by the Glenamoy and Muingnabo rivers. A second channel flows around the village of Rossport from the northwest and is fed by the Gweedaney stream. Both channels join into a fast flowing channel which widens out into an exposed bay at the mouth of the estuary. The lower portion of Sruwaddacon Bay has exceptionally strong currents."},{"page_url":"https://it.wikipedia.org/wiki/Stazione_di_Olmeneta","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/40/Stazione_di_Olmeneta_Cabina_trazione_elettrica_20081221.jpg","page_title":"Stazione di Olmeneta","context_page_description":"La stazione di Olmeneta è una stazione ferroviaria dell'omonimo comune cremonese, ubicata presso la confluenza delle linee ferroviarie Treviglio-Cremona e Brescia-Cremona."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%9A%E0%B1%86%E0%B0%A8%E0%B1%8D%E0%B0%A8%E0%B1%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/MylaporeKapaleeshwararTemple.jpg","page_title":"చెన్నై","context_page_description":"చెన్నై, పలకడం, భారత దేశములోని తమిళనాడు రాష్ట్ర రాజధాని. ఇది భారత దేశములోని నాలుగవ పెద్ద మహానగరం. చెన్నై నగరము బంగాళా ఖాతము యొక్క తీరమున ఉంది. చెన్నై పూర్వపు పేరు మద్రాసు. ఇది తమిళనాడు రాష్ట్ర రాజధాని. 1953 వరకు ఆంధ్రకు కూడా రాజధాని. మద్రాసు రాజధానిగా వుండే ఆంధ్ర రాష్ట్రం కోసం పొట్టి శ్రీరాములు ప్రాణాలు విడిచాడు. మద్రాసు లేని ఆంధ్ర తలలేని మొండెం అన్నాడు శ్రీరాములు. ఈ మహానగరము బంగాళాఖాతం కోరమాండల్ దక్షిణ తీరములో ఉంది. 2007 జనాభా గణాంకాల ప్రకారం చెన్నై నగర జనాభా 70.6 లక్షలు ఉండవచ్చునని అంచనా. ఈ ప్రపంచములోనే 34వ మహానగరమైన చెన్నైకి 375 సంవత్సరాల చరిత్ర ఉంది. భారత దేశములో వాణిజ్య, పరిశ్రమల పరంగా చెన్నై నగరము మూడవ స్థానంలో నిలుస్తుంది. అంతే కాదు ఈ నగరములో ఉన్న దేవాలయాల నిర్మాణశైలి చాలా ప్రాచుర్యాన్ని పొందాయి. శాస్త్రీయ సంగీతానికి, శాస్త్రీయ నృత్యానికి చెన్నై నగరము కేంద్రబిందువు. భారతదేశములోని వాహన నిర్మాణ పరిశ్రమలు అన్నీ చెన్నై నగరంలో కేంద్రీకరించబడి ఉన్నాయి. అన్ని వాహననిర్మాణ పరిశ్రమలు ఉండడం వల్ల ఈ నగరాన్ని డెట్రాయిట్ ఆఫ్ ఆగ్నేయా ఆసియా అని కూడా పిలుస్తారు. ఔట్ సోర్సింగ్ కూడా చాలా మటుకు చెన్నై నగరము నుండి జరుగుతోంది. ఈ నగరము బంగాళా ఖాతం తూర్పుతీరం వెంబడి ఉండడం వల్ల ఈ నగరానికి 12 కి.మీ. బీచ్ రోడ్ ఉన్నది దీనినే మెరీనా బీచ్ అని పిలుస్తారు."},{"page_url":"https://sv.wikipedia.org/wiki/Louis_Calhern","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Louis_Calhern_in_Woman_Wanted_trailer.jpg","page_title":"Louis Calhern","context_page_description":"Louis Calhern, född 19 februari 1895 i Brooklyn i New York, död 12 maj 1956 i Tokyo i Japan, var en amerikansk skådespelare.\\nLouis Calhern medverkade i över 70 filmer, mer ofta i större biroller än i huvudroller. 1951 blev han nominerad till en Oscar för bästa manliga huvudroll för filmen The Magnificent Yankee. 1953 gjorde han titelrollen i Julius Caesar.\\n1956 befann sig Calhern i Japan för att spela i filmen Tehuset Augustimånen då han drabbades av en hjärtattack och dog."},{"page_url":"https://pl.wikipedia.org/wiki/Hornell","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Hornell_NY_St_Patricks_Day.jpg","page_title":"Hornell","context_page_description":"Hornell – miasto w Stanach Zjednoczonych, w stanie Nowy Jork, w hrabstwie Steuben. W 2010 roku liczyło 8563 mieszkańców."},{"page_url":"https://de.wikipedia.org/wiki/Alcides_metaurus","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/CSIRO_ScienceImage_1038_Alcides_metaurus_Uraniidae.jpg","page_title":"Alcides metaurus","context_page_description":"Alcides metaurus ist ein überwiegend in Australien vorkommender Schmetterling aus der Familie der Spanner."},{"page_url":"https://it.wikipedia.org/wiki/Guardia_aerea_svizzera_di_soccorso","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Zepper-BK_117-C2-%28EC145%29-SchweizerischeRettungsflugwacht.jpg","page_title":"Guardia aerea svizzera di soccorso","context_page_description":"La Guardia aerea svizzera di soccorso, anche nota come Rega è una fondazione autonoma svizzera di soccorso.\\nLa Rega è specializzata negli interventi di ricerca e soccorso e di soccorso alpino con elisoccorso, oltre che di rimpatrio sanitario con aeroambulanza.\\nIn quanto fondazione privata, la Rega non ha rapporti con lo Stato e finanzia le proprie attività grazie alle donazioni dei soci e al rimborso degli interventi da parte dei pazienti soccorsi, delle loro casse sanitarie o assicurazioni; è membro corporativo della Croce Rossa svizzera."},{"page_url":"https://ru.wikipedia.org/wiki/STS-131","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e4/STS-131_Alan_Poindexter_works_in_the_Leonardo_MPLM.jpg","page_title":"STS-131","context_page_description":"STS-131 — космический полёт MTKK «Дискавери» по программе «Спейс Шаттл». 33-й полет шаттла к Международной космической станции."},{"page_url":"https://de.wikipedia.org/wiki/Liste_M%C3%BCnchner_Gedenktafeln","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/M%C3%BCnchen-Schwabing_Otto_Falckenberg_798.jpg","page_title":"Liste Münchner Gedenktafeln","context_page_description":"Diese Seite gibt einen Überblick über einige Gedenktafeln in München, also aus Stein oder Metall gefertigte Plaketten, große Tafeln o. ä.\\nIn der Regel sind solche Gedenktafeln an Hauswänden angebracht. Es werden hier nur Tafeln aufgenommen, die sich im öffentlichen Raum befinden."},{"page_url":"https://uz.wikipedia.org/wiki/La_Chapelle-Blanche_(Savoie)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/50/Map_commune_FR_insee_code_73075.png","page_title":"La Chapelle-Blanche (Savoie)","context_page_description":"La Chapelle-Blanche Fransiyaning Rhône-Alpes mintaqasida joylashgan kommunadir. Savoie departamenti Chambéry tumani tarkibiga kiradi."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%B6%D8%AE%D8%A9_%D9%85%D8%AD%D9%88%D8%B1%D9%8A%D8%A9_%D8%A7%D9%84%D8%AA%D8%AF%D9%81%D9%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/2011MarchScottNCraig_207_1.jpg","page_title":"مضخة محورية التدفق","context_page_description":"المضخة محورية التدفق هي أحد أنواع المضخات الشائعة. تتكون أساساً من مروحة دافعة موضوعة في أنبوب.\\nيُمكن أن تُدارالمروحة الدافعة مباشرة عن طريقمحرك كهربائي معزول وموضوع في الأنبوب، أو عن طريق محرك كهربائي خارجي أومحرك ديزل أو محرك بنزين متصل بالأنبوب من الخارج، أو بواسطة عمود إدارة قائم الزاوية يثقب الأنبوب.\\nلا تغير جسيمات المائع مواضعها الشعاعية خلال تدفقها في المضخة، حيث أن التغير في قطر المروحة عند الدخول والخروج يكون صغير جداً، لذلك تُسمى المضخة محورية التدفق."},{"page_url":"https://hu.wikipedia.org/wiki/TER_Midi-Pyr%C3%A9n%C3%A9es","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Gare_de_Saint-Rome-de-Cernon_P1100414.jpg","page_title":"TER Midi-Pyrénées","context_page_description":"A TER Midi-Pyrénées egy regionális vasúthálózat Franciaországban, a Midi-Pyrénées régióban, melyet az SNCF üzemeltet. Az 1500 km-es hálózaton naponta kb. 330 vonat 30 ezer utast szállít el. A hálózat központja Gare de Toulouse-Matabiau."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%95%9C%EC%8A%A4_%ED%8F%B0_%EB%A0%88%EB%B0%9C%ED%8A%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Johann_von_Lewaldt_RSAO.png","page_title":"한스 폰 레발트","context_page_description":"한스 폰 레발트는 프로이센의 원수였다. 또한 요한 폰 레발트로도 알려져 있다. 그는 1700년에 군대에 입대하여, 7년 전쟁을 통해 스페인 계승 전쟁에서 모든 프로이센 현장 작전에 참여했다. 그는 프리드리히 대왕의 실레지아와 7년 전쟁에서 오스트리아와의 특별한 전쟁을 벌였다."},{"page_url":"https://it.wikipedia.org/wiki/Specie_di_Poeciliidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Poecilia_Mexicana.jpg","page_title":"Specie di Poeciliidae","context_page_description":"Di seguito l'elenco completo, aggiornato al 2020, delle 349 specie di Poeciliidae attualmente conosciute."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BD%D1%82%D0%BE%D0%BD%D0%B8%D0%BE_%D0%A0%D0%B8%D0%B2%D0%B5%D1%80%D0%B0_%D0%9A%D0%B0%D0%B1%D0%B5%D1%81%D0%B0%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Antonio_Rivera_Cabezas.jpg","page_title":"Антонио Ривера Кабесас","context_page_description":"Антонио Ривера Кабесас — центральноамериканский юрист и политик. Член Либеральной партии. С 10 июля 1823 по 4 октября 1823 года он был членом первого исполнительного триумвирата, который управлял Федеральной Республикой Центральной Америки. С 9 марта 1830 по 10 февраля 1831 г. он был главой Гватемалы.\\nРивера был курсантом в милиции, должность, отведенная для сыновей знатных семейств. Он стал адвокатом во время испанского колониального периода.\\nРивера сменил много политических позиций. Он был провинциальным депутатом. Он также был сторонником независимости от Испании и один из тех, кто подписал декларацию независимости 15 сентября 1821 года. Он был депутатом первого учредительного съезда Центральной Америки. После присоединения Центральной Америки к Мексике, он стал депутатом мексиканского конгресса. Он был членом правления триумвирата федерации в 1823 году, политический начальник отдела Гватемалы в 1824 году, секретарь финансов в 1835 году и окружной судья в 1832 и 1837 годах.\\nКак член триумвирата, с 1 июля 1823 года он подписал декларацию о независимости Центральной Америки от Испании, Мексики и других стран.\\nОн также был автором нескольких сатирических произведений по экономике."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%B5%D1%80%D0%B0%D1%81%D0%B8%D0%BC%D0%BE%D0%B2,_%D0%9A%D0%B8%D1%80%D0%B8%D0%BB%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Kirill_Gerasimov.jpg","page_title":"Герасимов, Кирилл","context_page_description":"Кирилл Герасимов — российский профессиональный игрок в покер.\\n24 раза финишировал в деньгах, когда участвовал в Мировой серии покера. Дважды выходил за финальный стол Европейского покерного тура и один раз на Мирового покерного тура\\nПо состоянию на 2009 год суммарный выигрыш Кирилла Герасимова составляет 2,500,000 долларов. При этом сумма выигрыша от участия в Мировой серии покера составила 1,323,409 долларов.\\nЯвляется наставником известного российского теннисиста Евгения Кафельникова, обучая того мастерству игры в покер. Сам Кирилл, в свою очередь, учился у известного голландского игрока Марселя Луске."},{"page_url":"https://fr.wikipedia.org/wiki/Oseille_commune","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/359_Rumex_acetosa.jpg","page_title":"Oseille commune","context_page_description":"Rumex acetosa, l’Oseille commune, Grande oseille, Oseille des prés ou vinette, est une plante vivace de la famille des Polygonacées. C'est une plante potagère fréquemment cultivée, l'espèce sauvage ayant été améliorée pour donner naissance à l'Oseille des jardins."},{"page_url":"https://sv.wikipedia.org/wiki/Eumorpha_translineatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Eumorpha_translineatus_MHNT_CUT_2010_0_272_Serra_do_Mar%2C_Santa_Catarina%2C_Brazil_male_ventral.jpg","page_title":"Eumorpha translineatus","context_page_description":"Eumorpha translineatus är en fjärilsart som beskrevs av Rothschild 1894. Eumorpha translineatus ingår i släktet Eumorpha och familjen svärmare. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A7%DB%8C%D8%B1%D9%84%D9%86%D8%AF%D9%84%DB%8C_%D9%82%DB%8C%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Schoolhouse_Ryan%27s_Daughter.jpg","page_title":"ایرلندلی قیز","context_page_description":"ایرلندلی قیز اینگیلیس دیلینده دۇزلمیش دراماتیک رومانتیک فیلم. فیلمین باش روْللارینی سارا مایلز، لئو مک‌کرن، جان میلز، کریستوفر جونز، تروور هاوارد، رابرت میچام جانلاندیریب. فیلمین موسیقیسین موریس ژار یارادیب. ۱۹۷۰ میلادی ایلینده ۴ بؤلومده اوسکارا نامیزد اوْلموش و ۲ جایزه‌یه لایق گؤرولموش‌دور."},{"page_url":"https://no.wikipedia.org/wiki/Lenny_Kuhr","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Nationale_finale_van_het_Eurovisie_Songfestival_in_Scheveningen%2C_Lenny_Kuhr_zong%2C_Bestanddeelnr_922-1416.jpg","page_title":"Lenny Kuhr","context_page_description":"Lenny Kuhr er en nederlandsk sanger og låtskriver.\\nI 1967 vant hun en konkurranse for nye artister, «Cabaret der Onbekenden». Da hun to år senere representerte hjemlandet under Eurovision Song Contest 1969 i Madrid med sangen «De troubadour», delte hun førsteplassen med Storbritannia, Frankrike og Spania. Kuhr hadde selv skrevet musikken til sangen, mens teksten var skrevet av David Hartsema.\\nFem år senere, i 1974, fikk hun sin neste nederlandske hit med samme musikk og endret tekst. Sangen het «De Generaal» og var en ode til fotballspilleren og -treneren Rinus Michels. I mellomtiden hadde hun hatt en nummer én-hit i Frankrike med sangen «Jesu Christo» og hadde dessuten opptrådt i Georges Brassens' show. Den største nederlandske hiten kom i 1980, da hun sammen med Les Poppys utga sangen «Visite».\\nKuhr har vært gift to ganger, i 1974 med Gideon Bialijstock som hun fikk to døtre med, og i 2003 med Rob Frank. I 1981–1993 var hun sammen med tekstskriveren Herman Pieter de Boer.\\nDa hun i 2007 kunne feire 40-årsjubileum som sanger, spilte hun inn et konsertalbum med 40 sanger, 40 jaar verliefd."},{"page_url":"https://hu.wikipedia.org/wiki/Szerbia_uralkod%C3%B3inak_list%C3%A1ja","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Mihailo_Obrenovi%C4%87_III.jpg","page_title":"Szerbia uralkodóinak listája","context_page_description":"Szerbia történelme hozzávetőleg a 7. századig nyúlik vissza, amikor egy ismeretlen szerb fejedelem a szláv származású népével a Balkán-félszigetre érkezett. Az új haza elfoglalása körülbelül 680-ra fejeződött be. Mégis a szerbek saját népük ősatyját még a kaukázusi szálláshelyről tisztelik. Hozzávetőleg 50-ben élhetett a tisztelt szerb ős, akit Zorszinesznek neveztek.\\nAz első név szerint ismert vezér, vagy ahogyan szerbül nevezik őket zsupán Kuver volt, aki a Balkánra érkezett törzsek élén állt 668-tól egészen 685-ig. A szláv törzsek letelepedtek, és hat különálló uradalomra oszlottak, amelyek mindmáig meghatározzák a Balkán és főként Szerbia és Montenegró hatalmi helyzetét. A hat különböző terület a horvátok és az illírek törzsei közé ékelődve alakították ki kicsiny államaikat. Ezek a történelmi államok a következők voltak:\\nRáczország, más néven Ráska vagy Rassza volt a szerb államok közül a legnagyobb és legbefolyásosabb. Ma ez felel meg leginkább Szerbiának.\\nBosznia, más néven Ráma volt a második legnagyobb állam.\\nHum, vagy más néven Zachumlje. Később Magyarország része lett."},{"page_url":"https://en.wikipedia.org/wiki/Svitavy_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Moravsk%C3%A1_T%C5%99ebov%C3%A1-n%C3%A1m%C4%9Bst%C3%AD_s_radnic%C3%AD.jpg","page_title":"Svitavy District","context_page_description":"Svitavy District is a district within Pardubice Region of the Czech Republic. Its capital is the town of Svitavy. As a part of Pardubice Region the district has borders with Ústí nad Orlicí District to the north and Chrudim District to the west. The district was administratively formed in 1960, when the former districts of Litomyšl, Moravská Třebová, Polička and Svitavy were merged.\\nSvitavy District incorporates parts of historical regions of Bohemia and Moravia. From a total of 116 municipalities, 44 municipalities are situated in Moravia. As of 1 January 2007, 48,864 inhabitants live in the Moravian part of the district. The Bohemian part counted 67 municipalities with 50,885 inhabitants. Five municipalities lie in Bohemia as well as Moravia."},{"page_url":"https://fi.wikipedia.org/wiki/Strutsisaurit","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Struthiomimus_BW.jpg","page_title":"Strutsisaurit","context_page_description":"Strutsisaurit eli strutsiliskot on ruumiinrakenteeltaan strutsia muistuttaneiden teropodien osalahko. Ne olivat myös yhtä nopeita kuin nykyinen strutsi. Strutsisaurit kykenivät mahdollisesti juoksemaan 80 kilometrin tuntivauhtia, minkä johdosta ne olivat kaikkein nopeimpia dinosauruksia. Strutsisaurien juoksutapa oli mahdollisesti suurten loikkien ottaminen juoksun aikana, kuten strutseilla nykyisin.\\nVaikka strutsisaurit kehittyivät lihaa syöneistä teropodeista, niiden nokat ja hampaat viittaavat niiden olleen kaikkiruokaisia. Strutsisaureille tyypillisiä piirteitä olivat pitkät jalat, pitkä kaula, pieni nokkamainen pää ja suuret silmät. Hampaat olivat joko pieniä tai niitä ei ollut laisinkaan. Monet tutkijat uskovat, että strutsisaurit eivät olleet pelkästään suomuisen ihon peitossa, vaan niillä oli alkeellisia höyheniä muiden läheistä sukua olleiden dinosaurusten tapaan. Strutsisaurit olivat yleensä\\n3–4 metriä pitkiä, mutta Deinocheirus kasvoi jopa 11 metriä pitkäksi.\\nStrutsisaurit ilmestyivät varhaisliitukaudella 130 miljoonaa vuotta sitten, ja hävisivät myöhäisliitukaudella liitukauden joukkosukupuutossa 65 miljoonaa vuotta sitten."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BB%D0%B5%D0%B0%D0%BD%D1%82%D0%B8%D1%81_%D0%92%D0%B8%D0%BA%D0%B5%D0%BB%D0%B8%D0%B4%D0%B8%D1%81_(%D1%81%D1%82%D0%B0%D0%B4%D0%B8%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Stadium_Kleanthis_Vikelidis_2.jpg","page_title":"Клеантис Викелидис (стадион)","context_page_description":"«Клеа́нтис Викели́дис» — стадион в городе Салоники, Греция. Построен в 1951 году. Домашний стадион футбольного клуба «Арис», принадлежит спортивному обществу «Арис». На протяжении многих лет стадион имел название «Арис», но в 2004 году был переименован в честь игрока «Ариса» 1940-х годов Клеантиса Викелидиса. Чаще стадион называют «Хирилау», из-за того, что стадион расположен в округе Хирилау.\\nВ 2004 году во время летних Олимпийских игр стадион служил в качестве тренировочного поля. Во многом из-за Олимпийских игр стадион подвергся небольшой реконструкции. В помещениях стадиона есть тренажёрный зал, бассейн, различные спортивные залы, ресторан «Aris Sports Cafe», фирменный клубный магазин «Aris Megastore», магазин сотовой связи «Aris Mobile», а также помещения для тележурналистов и представителей прессы.\\n11 марта 1979 года на матче «Арис» — АЕК было зафиксировано рекордное число зрителей 27 500, этот рекорд держится и по сей день."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%BF%E3%83%B3%E3%82%AF_(%E3%83%90%E3%83%B3%E3%83%89)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/20170708_Ballenstedt_RockHarz_Tank_0001_Tank.jpg","page_title":"タンク (バンド)","context_page_description":"タンクは、イングランド出身のヘヴィメタル・バンド。\\nNWOBHMを代表する一角として1980年代に活動。「モーターヘッド」から支援を受け、弟分的存在であった。一度解散したが1997年に再結成し、2013年から2派に分裂している。"},{"page_url":"https://en.wikipedia.org/wiki/Humphrey,_Nebraska","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/33/Humphrey%2C_Nebraska_from_SW.JPG","page_title":"Humphrey, Nebraska","context_page_description":"Humphrey is a city in Platte County, Nebraska, United States. The population was 760 at the 2010 census."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%A4%E0%AE%AE%E0%AE%BF%E0%AE%B4%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Idioma_tamil.png","page_title":"தமிழ்","context_page_description":"தமிழ் மொழி தமிழர்களினதும், தமிழ் பேசும் பலரதும் தாய்மொழி ஆகும். தமிழ் திராவிட மொழிக் குடும்பத்தின் முதன்மையான மொழிகளில் ஒன்றும் செம்மொழியும் ஆகும். இந்தியா, இலங்கை, மலேசியா, சிங்கப்பூர் ஆகிய நாடுகளில் அதிக அளவிலும், ஐக்கிய அரபு அமீரகம், தென்னாப்பிரிக்கா, மொரிசியசு, பிஜி, இரீயூனியன், திரினிடாடு போன்ற நாடுகளில் சிறிய அளவிலும் தமிழ் பேசப்படுகிறது. 1997-ஆம் ஆண்டுப் புள்ளி விவரப்படி உலகம் முழுவதிலும் 8 கோடி மக்களால் பேசப்படும் தமிழ், ஒரு மொழியைத் தாய்மொழியாகக் கொண்டு பேசும் மக்களின் எண்ணிக்கை அடிப்படையில் பதினெட்டாவது இடத்தில் உள்ளது. இணையத்தில் அதிகம் பயன்படுத்தப்படும் இந்திய மொழிகளில் தமிழ் முதன்மையாக உள்ளதாக 2017ஆம் ஆண்டு நடைபெற்ற கூகுள் கணக்கெடுப்பில் தெரிய வந்தது.\\nஇரண்டாயிரத்து ஐநூறு ஆண்டுகளுக்கும் மேல் பழமை வாய்ந்த இலக்கிய மரபைக் கொண்டுள்ள தமிழ் மொழி, தற்போது வழக்கில் இருக்கும் ஒரு சில செம்மொழிகளில் ஒன்றாகும். திராவிட மொழிக்குடும்பத்தின் பொதுக்குணத்தினால் ஒலி மற்றும் சொல்லமைப்புகளில் சிறிய மாற்றங்களே ஏற்பட்டுள்ளதாலும் மேலும் கவனமாகப் பழைய அமைப்புக்களைக் காக்கும் மரபினாலும் பழங்கால இலக்கிய நடை கூட மக்களால் புரிந்து கொள்ளும் நிலையில் உள்ளது. எடுத்துக்காட்டாக, பள்ளிக் குழந்தைகள் சிறுவயதில் கற்கும் அகர வரிசையான ஆத்திசூடி 1,000 ஆண்டுகளுக்கு முன்னர் இயற்றப்பட்டது."},{"page_url":"https://ca.wikipedia.org/wiki/Merluccius","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Merluccius_merluccius.001_-_Aquarium_Finisterrae.JPG","page_title":"Merluccius","context_page_description":"Merluccius és un gènere de peixos pertanyent a la família dels merlúccids."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B5%D0%BA%D0%B0%D0%BD%D1%82%D0%BE_(%D0%BC%D1%83%D0%BD%D0%B8%D1%86%D0%B8%D0%BF%D0%B0%D0%BB%D0%B8%D1%82%D0%B5%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/San_Francisco_Dzon%2C_Yucat%C3%A1n_%2804%29.jpg","page_title":"Теканто (муниципалитет)","context_page_description":"Теканто́ — муниципалитет в Мексике, штат Юкатан, с административным центром в одноимённом городе. Численность населения, по данным переписи 2010 года, составила 3683 человека."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%94%E1%83%92%E1%83%95%E1%83%98%E1%83%9E%E1%83%A2%E1%83%94_(%E1%83%A0%E1%83%9D%E1%83%9B%E1%83%98%E1%83%A1_%E1%83%9E%E1%83%A0%E1%83%9D%E1%83%95%E1%83%98%E1%83%9C%E1%83%AA%E1%83%98%E1%83%90)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/REmpire-Aegyptus.png","page_title":"ეგვიპტე (რომის პროვინცია)","context_page_description":"ეგვიპტე რომის პროვინციად იქცა ძვ. წ. 30 წელს აქციუმის ბრძოლის შემდეგ, როდესაც ოქტავიანემ დაამარცხა მარკუს ანტონიუსის და კლეოპატრას ფლოტი. სხვა პროვინციებისგან განსხვავებით ეგვიპტე პირადად იმპერატორს ექვემდებარებოდა."},{"page_url":"https://eu.wikipedia.org/wiki/Euskaltzaindia","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Inazio_Maria_Etxaide.jpg","page_title":"Euskaltzaindia","context_page_description":"Euskaltzaindia euskara zaindu, aztertu, zabaldu, batu eta hobetzea helburu duen hizkuntza akademia ofiziala da, 1919an sortua. Gehienez, 32 euskaltzain osoz osatzen da eta, Euskaltzain oso horiez gainera, baditu —kopuru mugarik gabe— hainbat euskaltzain urgazle eta euskaltzain ohorezko ere. Euskaltzaindiaren goiburua Ekin eta jarrai da.\\nEuskaltzaindia, zuzenbidez, Hego Euskal Herriko lau aldundiek sortu zuten, Eusko Ikaskuntzarekin batera. Egoitza Bilboko Zazpikaleetako Plaza Barrian du, eta ordezkaritzak ditu Gasteizen, Donostian, Iruñean eta Baionan. Euskaltzaindiaren finantzaketa iturri nagusia diru laguntzak dira eta, egun, lau erakunde publiko hauek ditu finantzatzaile nagusi: Eusko Jaurlaritza, Arabako Foru Aldundia, Bizkaiko Foru Aldundia eta Gipuzkoako Foru Aldundia."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AD%D1%80%D1%83%D1%8D%D0%BB%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Irwell%2C_Salford.jpg","page_title":"Эруэлл","context_page_description":"Эруэлл — река в Северо-Западной Англии, которая течёт через долину Эруэлл в округах Ланкашир и Большой Манчестер. Река имеет протяжённость 63 километра. Река берёт начало с Ключей Эруэлл, которые расположены приблизительно в 2,4 км к северу от городка Бейкап, в округе Кливиджер графства Ланкашир. Река Эруэлл течёт через центры городов Манчестер и Солфорд, прежде чем влиться в реку Мерси.\\nПологие берега реки в XVII—XVIII веках использовались как торговый маршрут, связывающий город Манчестер с городками на реке Мерси, что способствовало развитию навигации по реке Эруэлл. Большие участки реки к западу от Манчестера были радикально преобразованы во время постройки Манчестерского канала, который открылся в 1896 году, превратив Манчестер и Солфорд в главные морские порты Англии и дав развитие Trafford Park, который стал самой большой промышленной зоной в Европе.\\nТаким образом, река Эруэлл способствовала индустриализации Северо-Западной Англии, результатом чего стало загрязнение самой реки промышленными отходами и полностью лишило её рыбы."},{"page_url":"https://it.wikipedia.org/wiki/Isenb%C3%BCttel","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Wappen_Isenbuettel.png","page_title":"Isenbüttel","context_page_description":"Isenbüttel è un comune di 6.099 abitanti della Bassa Sassonia, in Germania.\\nAppartiene al circondario di Gifhorn ed è parte della comunità amministrativa di Isenbüttel."},{"page_url":"https://zh.wikipedia.org/zh-my/%E5%9F%94%E9%87%8C%E7%9B%86%E5%9C%B0%E7%BE%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Niudong_Valley%2C_Nankang_River_20080607.jpg","page_title":"埔里盆地群","context_page_description":"埔里盆地群是台湾位于南投县中央地带分布着大小不等的数十座盆地，其中以埔里盆地为埔里盆地群是面积最大，故以此命名。\\n埔里盆地群的分布，除了埔里、草湳两座盆地是在埔里境内，还是主要集中在鱼池境内居多，它的位置是座落在脊梁板岩山地之东，断层山地之西，白姑山脉之南，玉山山块之北，全境属于埔里板岩山地，分布呈自北北东－南南西方向排列。据地质学家林朝棨先生所著《台湾地形》记载，埔里盆地群共计十七座盆地，现今所见日月潭是埔里盆地群的高地湖泊其中一座，形成在第四纪更新世初期，其余盆地已经受河川切割而宣泄，这便是现今所见的埔里盆地群。埔里盆地群之中被归类为主要盆地是以面积超过1平方公里来区分，由北至南分别埔里、鱼池、日月潭、头社等4座盆地。\\n关于小盆地群介绍，请参见小盆地群。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_%C3%B6ffentlicher_B%C3%BCcherschr%C3%A4nke_im_Landkreis_Ludwigsburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/DI_OffB%C3%BCchrank.jpg","page_title":"Liste öffentlicher Bücherschränke im Landkreis Ludwigsburg","context_page_description":"In der Liste öffentlicher Bücherschränke im Landkreis Ludwigsburg sind öffentliche Bücherschränke für Orte, die zum Landkreis Ludwigsburg in Baden-Württemberg gehören, aufgeführt. Sie ist primär nach Orten sortiert, unabhängig davon, ob es sich um Ortsteile, Gemeinden oder Städte handelt. Der Artikel ist Teil der übergeordneten Liste öffentlicher Bücherschränke in Baden-Württemberg. Ein öffentlicher Bücherschrank ist ein Schrank oder schrankähnlicher Aufbewahrungsort mit Büchern, der dazu dient, Bücher kostenlos, anonym und ohne jegliche Formalitäten zum Tausch oder zur Mitnahme anzubieten. Die Liste erhebt keinen Anspruch auf Vollständigkeit."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%AB%98%E9%80%9F%E9%81%93%E8%B7%AF%E3%81%A7%E3%81%AE%E3%82%AA%E3%83%BC%E3%83%88%E3%83%90%E3%82%A4%E3%81%AE%E9%80%9A%E8%A1%8C%E6%9D%A1%E4%BB%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Iigura_Entrance_Ramp_Shutokosoku_Tokyo_2011.jpg","page_title":"高速道路でのオートバイの通行条件","context_page_description":"高速道路でのオートバイの通行条件は、オートバイの高速道路での通行に関連した規則をいう。"},{"page_url":"https://cs.wikipedia.org/wiki/%C5%98%C3%A1d_zlat%C3%A9ho_rouna","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f3/Curtius_GuldenVlies_Spaanse_tak_2010-02-04.jpg","page_title":"Řád zlatého rouna","context_page_description":"Řád zlatého rouna je rytířský řád, založený roku 1430, a jako spolek rytířů organizovaný po vzoru duchovních rytířských řádů. Později byl stále více privilegovaným a byl udělován velmistrem jako odměna za zásluhy."},{"page_url":"https://it.wikipedia.org/wiki/Apaloderma","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/HapalodermaVittatumKeulemans.jpg","page_title":"Apaloderma","context_page_description":"Apaloderma Swainson, 1833 è un genere di uccelli appartenente alla famiglia Trogonidae. Al genere vengono ascritte 3 specie diffuse in Africa."},{"page_url":"https://en.wikipedia.org/wiki/Asmundo_family","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Bernardo_Celentano_-_%22Provenzan_Salvani_nella_piazza_del_Campo%22%2C_1856_c..jpg","page_title":"Asmundo family","context_page_description":"Asmundo is an old Sicilian noble family that has played a notable role in the island's political, cultural, and economic history."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D9%88%D8%B1%DA%A9%DB%8C%D9%86%DA%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Dorking_-_geograph.org.uk_-_788645.jpg","page_title":"دورکینگ","context_page_description":"دورکینگ یک شهر بازاری و شهرک در بریتانیا است که در جنوب شرقی انگلستان واقع شده‌است."},{"page_url":"https://fi.wikipedia.org/wiki/Palpan_piirikunta","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Rani_Mahal%2CPalpa.jpg","page_title":"Palpan piirikunta","context_page_description":"Palpan piirikunta on yksi Nepalin 75 piirikunnasta. Se sijaitsee Nepalin Läntisen kehitysalueen Lumbinin vyöhykkeellä.\\nPalpan piirikunnan naapureita ovat etelässä Nawalparasi ja Rupandehi, lännessä Arghakhanchi, pohjoisessa Gulmi, Syangja ja Tanahu sekä idässä Chitawan.\\nVuonna 2011 Palpan piirikunnan väkiluku oli 261 180. Piirikunnan pinta-ala on 1 373 neliökilometriä ja väestötiheys 190 as./km². Hallinnollinen keskus on Tansen; se oli piirikunnan ainoa kaupunki vielä vuonna 2011. Toukokuussa 2014 piirikuntaan muodostettiin uusi kaupunki: Rampur.\\nLuonnonmaantieteellisesti piirikunta ryhmitellään yleensä osaksi Nepalin Läntistä kumpuvyöhykettä. Tarkemmassa kasvillisuusvyöhykejaottelussa piirikunnasta 0,3 % voidaan luokitella alempaan trooppiseen, 51,3 % ylempään trooppiseen ja 47,3 % subtrooppiseen vyöhykkeeseen ja 1,0 % vesistöihin kuuluvaksi.\\nNepalin vuoden 2015 maanjäristyksen seurauksena piirikunnassa syntyi merkittäviä järistystuhoja; muun muassa suuruusluokkaa 1 000–10 000 rakennusta tuhoutui tai vaurioitui piirikunnassa."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%85%AB%E6%88%B8%E4%BA%8B%E4%BB%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Li_Hongzhang.jpg","page_title":"八戸事件","context_page_description":"八戸事件は、同治5年12月に清国広州の新聞『中外新聞』に掲載された、「八戸順叔」なる香港在住の日本人が寄稿した征韓論の記事がきっかけとなり、日本と李氏朝鮮および清国との間の外交関係を悪化させた事件である。征韓論は江戸時代末期の吉田松陰や勝海舟らの思想にその萌芽が見られるが、現実の外交問題として日清朝三国に影響を及ぼしたのはこの八戸事件が最初である。さらにこの事件はその後も10年近く尾を引き、後の江華島事件における両国間交渉にまで影響を及ぼした。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Ko%C5%A1ice_I-Star%C3%A9_Mesto_(Ko%C5%A1ice)/Stredn%C3%A9_Mesto_(K%E2%80%93M)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Ko%C5%A1ice_-_pam._budova_-_Mlynsk%C3%A1_4.jpg","page_title":"Liste der denkmalgeschützten Objekte in Košice I-Staré Mesto (Košice)/Stredné Mesto (K–M)","context_page_description":"Die Liste der denkmalgeschützten Objekte in Košice I-Staré Mesto (Košice)/Stredné Mesto (K–M) enthält 165 nach slowakischen Denkmalschutzvorschriften geschützten Objekte im Stadtteil Staré Mesto der Stadt Košice der Straßen mit dem Anfangsbuchstaben K–M."},{"page_url":"https://et.wikipedia.org/wiki/Steinsbergi_krahvilinnus","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Steinsbergi_krahvilinnus_1.jpg","page_title":"Steinsbergi krahvilinnus","context_page_description":"Steinsbergi krahvilinnus oli keskaegne kivist aadlikulinnus Saksamaal Baden-Württembergi liidumaal Reini-Neckari maakonnas Sinsheimi linnas Weileri külas."},{"page_url":"https://az.wikipedia.org/wiki/Ofris","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Ophrys_mammosa_Rhodos_02.jpg","page_title":"Ofris","context_page_description":"Xarıbülbül — səhləbkimilər fəsiləsinə aid bitki cinsidir.\\nOfris cinsinin 50-dən çox növü var və bunların bir çoxu Azərbaycanın müxtəlif bölgələrində, ümumiyyətlə Qafqaz və Zaqafqaziya ərazisində mövcuddur. Digərləri isə Türkiyə, Yunanıstan, Krım və başqa yerlərdə bitir. Bu bitkinin Azərbaycanda bitən bütün növləri Xarıbülbül adı ilə tanınır və latınca ophrys caucasica və ya ophrys mammosa adlanır.\\nOphrys — yunan mənşəli sözdür, mənası \\"qaş\\" deməkdir. Alimlər bu adı bitkiyə verməklə məcazi mənada bu gülün digərlərinə üstdən aşağı \\"baxmağını\\" eyham ediblər. Səhləb fəsiləsinin bir çox nümayəndələri kimi ofrislər də kök toxumasında müştərək surətdə yaşayan və bitkiyə lüzum olan simbiotik göbələklərdən asılıdır. Məhz bu səbəbdən bu bitkiləri başqa yerdə əkmək olmur – onlar məhv olur. Ofrislərin tozlanması zarqanadlı cücülərin köməyi ilə baş verir və onların çiçəkləri həmin cücülərin formasını və görünüşünü təkrarlayaraq, onları özünə cəlb edir. Ofrislərin çiçəkləri şirə ixrac eləmir, ətri isə demək olar ki, yoxdur. Lakin bəzi növlərinin çiçəkləri müəyyən növ cücülərin dişi fərdlərinə xas olan və erkək fərdlərini cəlb edən feromonun iyinə oxşar ətir qoxuya bilər."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%86%D8%AE%D9%88%D8%AF%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Chickpea_grains.jpg","page_title":"نخودی","context_page_description":"نُخودی رنگی از پرده‌های زرد مایل به خاکستری است.\\nاین رنگ، رنگی ترکیبی است که همرنگ نخود ایرانی می‌باشد و از ترکیب هر سه رنگ اصلی و سفید به دست می‌آید و رنگ‌های سفید و زرد غلبه دارند. رنگ‌های کرِم و بژ نزدیک به این رنگ هستند.\\nرنگ نخودی در سفالگری‌های پیش از تاریخ بسیار دیده می‌شود.\\nدر هزاره پنجم پیش از میلاد نوعی سفال نخودی با نقش سیاه که خوب پخته شده در دشت خوزستان و جنوب و جنوب باختری ایران متداول شد و به سایر نقاط نیز راه یافت.\\nرنگ نخودی را دارای سرشت شادی‌آور برای انسان نمی‌دانند و کاربرد زیاد آن در رنگ‌آمیزی شهری را در تقابل با سرزندگی می‌دانند."},{"page_url":"https://sl.wikipedia.org/wiki/Japonski_dresnik","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Fallopia_japonica_MdE_2.jpg","page_title":"Japonski dresnik","context_page_description":"Japonski dresnik je invazivna trajnica, z grmičasto razrastjo, ki izvira iz Japonske. Sodi med 100 najbolj invazivnih rastlin sveta, za katero v Sloveniji velja prepoved sajenja v okrasne in druge namene."},{"page_url":"https://en.wikipedia.org/wiki/Campus_Galli","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Campus_Galli-Schmied153918.jpg","page_title":"Campus Galli","context_page_description":"Campus Galli is a Carolingian monastic community under construction in Meßkirch, Baden-Württemberg, Germany. The construction project includes plans to build a medieval monastery according to the early ninth-century Plan of Saint Gall using techniques from that era. The long-term financing of the project is to come from revenue generated from the site's operation as a tourist attraction. The construction site has been open for visitors since June 2013."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%B9%E0%AF%81%E0%AE%95%E0%AF%8D%E0%AE%95%E0%AE%BE","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0f/Hookah-lookthrough.svg","page_title":"ஹுக்கா","context_page_description":"ஹூக்கா அல்லது வாட்டர் பைப் என்றழைக்கப்படும் இது ஒரு ஒற்றை அல்லது பல-தண்டு அமைப்பைக் கொண்ட கருவியாகும். தண்ணீரால் கடத்தப்பட்டு குளிரான புகையைக் கொடுக்க, புகையிலையைப் புகைப்பதற்கு பயன்படுத்தப்படும் கருவியாகும். இந்திய நாட்டின் மூலமே, ஹூக்கா பிரசித்தி அடைந்தது அதிலும் குறிப்பாக மத்திய கிழக்குப் பகுதி மற்றும் வட அமெரிக்கா, ஐரோப்பா, ஆஸ்திரேலியா மற்றும் பிரேசில் போன்ற நாடுகளிலும் நாளடைவில் பிரபலமடைந்தது."},{"page_url":"https://it.wikipedia.org/wiki/Axe_(marchio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Large_collection_of_Axe_products.jpg","page_title":"Axe (marchio)","context_page_description":"Axe è un marchio francese di prodotti per l'igiene maschile, di proprietà della multinazionale olandese-britannica Unilever.\\nLa principale linea di prodotti della Axe è rappresentata dai deodoranti spray, ma il marchio include anche deodoranti stick, roll-on, anti traspiranti, dopobarba e gel per la doccia."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AA%E3%83%95%E3%83%AC%E3%83%BC%E3%83%AB%E3%82%B9%E3%83%86%E3%83%BC%E3%82%B7%E3%83%A7%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/ToyohashiORS.JPG","page_title":"オフレールステーション","context_page_description":"オフレールステーションは、日本貨物鉄道の貨物駅の一形態。当初からオフレールステーションとして設立されたものと、自動車代行駅・コンテナセンターからの改称で発足したものとがある。\\nなお、2010年代後半からはオフレールステーションの一部について業態規模を見直し、「新営業所」へ名称変更された例がある。本稿では新営業所についても合わせて記載する。"},{"page_url":"https://pt.wikipedia.org/wiki/Escritas_paleo-hisp%C3%A2nicas","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Bronce_luzaga.jpg","page_title":"Escritas paleo-hispânicas","context_page_description":"As escritas paleo-hispânicas são as escritas criadas na Península Ibérica antes de o alfabeto latino se ter convertido na escrita dominante.\\nSilabário de Espanca\\nEscrita do sudoeste\\nAlfabeto greco-ibérico\\nEscrita ibérica sudeste\\nEscrita ibérica nordeste\\nVariante dual\\nVariante não-dual\\nEscrita celtibérica\\nVariante oriental\\nVariante ocidental"},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%A1%D1%8C%D0%BF%D1%96%D1%81_%D0%B3%D1%96%D1%81%D1%82%D0%BE%D1%80%D1%8B%D0%BA%D0%B0-%D0%BA%D1%83%D0%BB%D1%8C%D1%82%D1%83%D1%80%D0%BD%D1%8B%D1%85_%D0%BA%D0%B0%D1%88%D1%82%D0%BE%D1%9E%D0%BD%D0%B0%D1%81%D1%8C%D1%86%D1%8F%D1%9E_%D0%86%D1%9E%D0%B5%D1%9E%D1%81%D0%BA%D0%B0%D0%B3%D0%B0_%D1%80%D0%B0%D1%91%D0%BD%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/%D0%9B%D0%B0%D0%B7%D0%B4%D1%83%D0%BD%D1%8B_1._%D0%9A%D0%B0%D1%81%D1%86%D1%91%D0%BB_%D0%A1%D0%B2%D1%8F%D1%82%D1%8B%D1%85_%D0%A1%D1%8B%D0%BC%D0%BE%D0%BD%D0%B0_%D1%96_%D0%A2%D0%B0%D0%B4%D1%8D%D0%B2%D1%83%D1%88%D0%B0_%2804%29.jpg","page_title":"Сьпіс гісторыка-культурных каштоўнасьцяў Іўеўскага раёну","context_page_description":"У Іўеўскім раёне знаходзяцца 27 аб’ектаў, якія ўключаныя ў Дзяржаўны сьпіс гісторыка-культурных каштоўнасьцяў Рэспублікі Беларусь, зь іх: 10 — помнікі археалёгіі, 14 — помнікі архітэктуры, 3 — помнікі гісторыі."},{"page_url":"https://en.wikipedia.org/wiki/Anglo-Saxon_brooches","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Square-Headed_Brooch_MET_DP30025.jpg","page_title":"Anglo-Saxon brooches","context_page_description":"Anglo-Saxon brooches are a large group of decorative brooches found in England from the fifth to the eleventh centuries. In the early Anglo-Saxon era, there were two main categories of brooch: the long brooch and the circular brooch. The long brooch category includes cruciform, square-headed, radiate-headed, and small-long brooch brooches. The long brooches went out of fashion by the end of the sixth century.\\nThe circular brooch form developed from jewelled disc brooches produced in Kent in the early sixth century. In the early Anglo-Saxon era, the circular brooch type included the saucer, the applied saucer, the button, the annular, the penannular, and the quoit brooches. The circular was the most common brooch form during the middle to late Anglo-Saxon era, with the enamelled and non-enamelled circular brooches being the predominant brooch styles.\\nThere are a few styles that fall into the miscellaneous category. These include the bird and S-shaped brooch of the early Anglo-Saxon era and the safety-pin, strip, ottonian, rectangular, and bird motif of the middle to late Anglo-Saxon era."},{"page_url":"https://it.wikipedia.org/wiki/Eyvan","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/%D8%B4%D9%87%D8%B1_%D8%A7%DB%8C%D9%88%D8%A7%D9%86_-_Eyvan_City.jpg","page_title":"Eyvan","context_page_description":"Eyvān, anche Aivan o Īvān è il capoluogo dello shahrestān di Eyvan, circoscrizione Centrale, nella provincia di Ilam. Aveva, nel 2006, una popolazione di 27.752 abitanti, in maggioranza di etnia curda."},{"page_url":"https://pl.wikipedia.org/wiki/Kaszalot_spermacetowy","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Pottwal_brehm_m.png","page_title":"Kaszalot spermacetowy","context_page_description":"Kaszalot spermacetowy, kaszalot, potwal, potwal olbrotowiec – gatunek ssaka z rodziny kaszalotowatych, największy przedstawiciel kladu zębowców. Występuje we wszystkich oceanach. Jest największym współcześnie żyjącym zwierzęciem mięsożernym."},{"page_url":"https://cs.wikipedia.org/wiki/Souilly","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Souilly2.JPG","page_title":"Souilly","context_page_description":"Souilly je francouzská obec v departementu Meuse v regionu Grand Est. Žije zde 446 obyvatel."},{"page_url":"https://en.wikipedia.org/wiki/John_W._Nields_Jr.","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Ford_A5306_NLGRF_photo_contact_sheet_%281975-06-30%29%28Gerald_Ford_Library%29.jpg","page_title":"John W. Nields Jr.","context_page_description":"John W. Nields Jr. is a lawyer who was chief counsel for the House Committee investigating the Iran–Contra affair."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%91%D0%B0%D1%84%D0%B8_%D1%83%D0%B1%D0%B8%D0%B5%D1%86_%D0%BD%D0%B0_%D0%B2%D0%B0%D0%BC%D0%BF%D0%B8%D1%80%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/THS_facade.jpg","page_title":"Бафи убиец на вампири","context_page_description":"Бафи Убиец на Вампири е Американска телевизиска серија која започнала да се емитува Март 10 1997 сè до Мај 20 2003. Серијата е напишана во 1997 од писател и директор Џош Ведон Заедно со неговиот тим, Mutant Enemy Productions со подоцнежниот продуцерски тим Џејн Еспенсон, Давид Фури, Давид Гринвалт, Даг Петри, Марти Ноксон, И Давид Соломон. Серијата ја прати Бафи Самерс, последната од линијата млади жени познати како Убијци на вампири или едноставно убиец. Во приказната Убијците се нарекуваат да се бори против Вампири, Демони, и други сили на злото. Како и претходните убијци на вампири, Бафи е водена од чувар, кој ја води, учи и тренира. За разлика од нејзините претходници, Бафи околу себе има круг на верни пријатели кои се нарекуваат „Скуби Ганг“.\\nСеријата доби позитивни критики и достигна од 4 до 6 милиони гледачи од епизода."},{"page_url":"https://de.wikipedia.org/wiki/Hohentauern_(Gemeinde_Hohentauern)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Celt_museum_village%2C_Hohentauern.jpg","page_title":"Hohentauern (Gemeinde Hohentauern)","context_page_description":"Hohentauern ist ein Ort in den Niederen Tauern in der Steiermark wie auch Hauptort und Ortschaft der Gemeinde Hohentauern im Bezirk Murtal."},{"page_url":"https://simple.wikipedia.org/wiki/Zuoz","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Primarschulhaus_in_Zuoz_GR.jpg","page_title":"Zuoz","context_page_description":"Zuoz is a municipality of the district Maloja in the canton of Graubünden in Switzerland.\\nLyceum Alpinum Zuoz, a private school, is in Zuoz."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%99%D7%96%D7%A8_(%D7%9E%D7%97%D7%95%D7%96)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Flag_of_Is%C3%A8re.svg","page_title":"איזר (מחוז)","context_page_description":"איזר הוא מחוז במזרחה של צרפת, בחבל אוברן-רון-אלפ. הוא נקרא לפי שם הנהר איזר, יובל של הגדה השמאלית של הנהר רון. בירתו עם מושב הפרפקטורה שלו היא העיר גרנובל\\nהמחוז איזר מהווה חלק גדול מחבל דופינה ההיסטורי שבירתו הייתה גרנובל .הוא המחוז בעל השטח הגדול ביותר והמחוז השני לפי מספר התושבים במסגרת חבל אוברן-רון-אלפ. תושביו, בני איזר, נקראים בצרפתית Isérois ו-Iséroises"},{"page_url":"https://nl.wikipedia.org/wiki/Sirius_(ster)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Sirius_A_and_B_Hubble_photo.jpg","page_title":"Sirius (ster)","context_page_description":"Sirius is de helderste ster van de nachtelijke sterrenhemel. Met een helderheid van −1,46 is hij bijna dubbel zo helder als Canopus, de helderste ster na hem. Omdat Sirius de helderste ster is van het sterrenbeeld Grote Hond staat hij ook bekend als de Hondsster. Andere namen zijn Canicula en Aschere. Met een afstand van 8,6 lichtjaar is Sirius na de Zon het op zes na dichtstbijzijnde stersysteem. Deze ster maakt deel uit van de Winterzeshoek."},{"page_url":"https://en.wikipedia.org/wiki/List_of_churches_in_the_Roman_Catholic_Diocese_of_Wilmington","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/St._Mary_Star_of_the_Sea_%2821618371412%29.jpg","page_title":"List of churches in the Roman Catholic Diocese of Wilmington","context_page_description":"This is a list of current and former Roman Catholic churches in the Roman Catholic Diocese of Wilmington. The diocese covers the entire state of Delaware and the Eastern Shore of Maryland. The cathedral church of the diocese is the Cathedral of St. Peter in Wilmington, Delaware."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_western_Cincinnati","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Freeman_Grant_Cary_Pleasant_Hill_Academy.jpg","page_title":"National Register of Historic Places listings in western Cincinnati","context_page_description":"This is a list of the National Register of Historic Places listings in western Cincinnati, Ohio.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in western Cincinnati, Ohio, United States. Western Cincinnati is defined as being all of the city outside of downtown and west of Vine Street. The locations of National Register properties and districts may be seen in a Google map.\\nThere are 266 properties and districts listed on the National Register in Cincinnati, including 12 National Historic Landmarks. Western Cincinnati includes 92 of these properties and districts, including 3 National Historic Landmarks; the city's remaining properties and districts are listed elsewhere. Another 2 properties in western Cincinnati were once listed but have been removed.\\nThis National Park Service list is complete through NPS recent listings posted August 21, 2020."},{"page_url":"https://sl.wikipedia.org/wiki/Neko%C4%8D_pred_davnimi_%C4%8Dasi","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Robert_Carlyle_2011_cropped.jpg","page_title":"Nekoč pred davnimi časi","context_page_description":"Nekoč pred davnimi časi je ameriška fantazijska serija avtorjev Edwarda Kitsisa in Adama Horowitza, ki jo snemajo v studiu ABC za televizijsko postajo ABC.Serija. Zgodba govori o Emmi Swan, ki jo na njen 28. rojstni dan obišče desetletni sin Henry, ki ga je po rojstvu oddala v posvojitev. Ta jo odpelje v Storybrook, Maine, kjer so, kot sam pravi, vsi ljudje, ki tam živijo, nekoč bili liki iz otroških pravljic, česar se pa ne spomnijo več. V ZDA so to serijo pričeli predvajati 23. 10. 2011 na programu ABC.\\nObstaja tudi Spin-off serija Nekoč pred davnimi časi v Čudežni deželi."},{"page_url":"https://en.wikipedia.org/wiki/C%C3%BAcuta","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Parque_en_el_Malec%C3%B3n_C%C3%BAcuta_%282%29.JPG","page_title":"Cúcuta","context_page_description":"Cúcuta, officially San José de Cúcuta, is a Colombian city, capital of Norte de Santander department. It is located in the northeast of the country, in the eastern branch of the Colombian Andes, on the border with Venezuela. Cúcuta has a population of 711,715 people according to the 2018 census, making it the 6th largest city in the country. Due to its proximity with Venezuela, Cúcuta is an important commercial center, hosting many billion dollar companies. The international border in Cúcuta is said to be the most dynamic of South America.\\nThe city has a length of 12 kilometres from north to south and 11 kilometres from east to west. It is divided into 10 communes and it is the political, economic, administrative, industrial, cultural and tourism hub of the Norte de Santander department.\\nCúcuta has experienced a great urban development, as a result other cities have been formed around it, like Los Patios in the east, and Villa del Rosario in the south. They are part of the Metropolitan Area of Cúcuta which has a population of about 850,000 people."},{"page_url":"https://en.wikipedia.org/wiki/2010_United_States_House_of_Representatives_elections_in_Utah","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/39/Jason_Chaffetz%2C_official_portrait%2C_111th_Congress.jpg","page_title":"2010 United States House of Representatives elections in Utah","context_page_description":"Elections were held on November 2, 2010 to determine Utah's three members of the United States House of Representatives. Representatives were elected for two-year terms to serve in the 112th United States Congress from January 3, 2011 until January 3, 2013. Primary elections were held on June 22, 2010.\\nAll three of Utah's U.S. Representatives were re-elected. Of the three elections, only the 2nd district was rated as competitive by The Cook Political Report.\\nA total of 640,495 votes were cast, of which 390,969 were for Republican candidates, 218,236 were for Democratic candidates, 18,317 were for Constitution Party candidates, 7,252 were for Libertarian Party candidates and 5,721 were for independent candidates."},{"page_url":"https://en.wikipedia.org/wiki/Nervous_shark","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Carcharhinus_cautus_csiro-nfc.jpg","page_title":"Nervous shark","context_page_description":"The nervous shark is a species of requiem shark, and part of the family Carcharhinidae, so named because of its timid behavior in regard to humans. It is common in shallow, coastal waters off northern Australia, Papua New Guinea, and the Solomon Islands. A small brownish or grayish shark typically measuring 1.0–1.3 m long, this species has a short, blunt snout, oval eyes, and a relatively large second dorsal fin. The leading margins of most fins are finely edged with black, and the lower caudal fin lobe is black-tipped.\\nSmall bony fishes are the main prey of the nervous shark, while crustaceans, molluscs, and snakes may also be eaten. It is viviparous, with the developing embryos nourished through a placental connection. The details of its life history seem to vary depending on latitude—for example, the timing of the breeding season and the length of the gestation period. Females produce litters of one to six young either annually or biennially. The harmless nervous shark is caught incidentally by coastal gillnet fisheries and perhaps also by line and trawl fisheries. The International Union for Conservation of Nature has been listed under Least Concern."},{"page_url":"https://en.wikipedia.org/wiki/Ernfrid_Malmgren","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Malmgren.jpg","page_title":"Ernfrid Malmgren","context_page_description":"Ernfrid Cart Malmgren was a Swedish Esperantist, teacher, and president of the Universal Esperanto Association."},{"page_url":"https://pl.wikipedia.org/wiki/Bitwa_ko%C5%82o_Przyl%C4%85dka_%C5%9Awi%C4%99tego_Wincentego_(1833)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/BatalhaCaboS.Vicente.jpg","page_title":"Bitwa koło Przylądka Świętego Wincentego (1833)","context_page_description":"Bitwa przy Przylądku Św. Wincentego – starcie zbrojne, które miało miejsce w roku 1833 podczas portugalskiej wojny domowej liberałów z miguelistami.\\nW 1828 konserwatywny książę Miguel Bragança dokonał zamachu stanu, co spowodowało wybuch wojny domowej ze stronnictwem liberalnym, popierającym jego bratanicę i legalną dziedziczkę tronu Marię. W 1831 Pedro I włączył się w konflikt po stronie córki. Dążąc przede wszystkim do wzmocnienia floty, gdyż panowanie na morzu było decydujące dla zwycięstwa, zaangażował wielu oficerów z Royal Navy. Z pomocą komandora George'a Sartoriusa, a następnie Charlesa Napiera, zorganizował niewielką eskadrę, której trzon stanowiły fregaty \\"Dom Pedro\\", \\"Rainha de Portugal\\", \\"Dona Maria\\" oraz korwety \\"Vila Flor\\" i \\"Portaense\\".\\nDo decydującego starcia doszło w 1833 roku. Po wysadzeniu desantu na południu kraju, eskadra podążała w ślad za armią na północ. Po opłynięciu Przylądka Świętego Wincentego, napotkała eskadrę miguelistów liczącą dwa okręty liniowe, niosące po 86 dział, kolejny okręt uzbrojony w 50 armat, fregatę, trzy korwety, dwa brygi i szebekę."},{"page_url":"https://oc.wikipedia.org/wiki/Saulg%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Mairie_de_Saulg%C3%A9.jpg","page_title":"Saulgé","context_page_description":"Saulgé es una comuna peitavina, situada dins lo departament de Viena e la region de Nòva Aquitània."},{"page_url":"https://cs.wikipedia.org/wiki/Halt%C3%BD%C5%99_(rybn%C3%ADk,_Radonice)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Halt%C3%BD%C5%99_%28006%29.jpg","page_title":"Haltýř (rybník, Radonice)","context_page_description":"Haltýř je název vodní plochy v centru vsi Radonice v okrese Praha-východ. Konkrétně se nachází na konci ulice U Haltýře. Má podlouhlý tvar délky asi 50 m a šířky 15 m. Je orientován z jihovýchodu na severozápad. V jeho okolí se nachází zeleň, cesta a tenisové kurty. Voda z něj odtéká Radonickým potokem. Vodní plocha vznikla po roce 1869."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%B5%D0%B9%D0%BA%D1%84%D1%96%D0%BB%D0%B4-%D0%9F%D1%96%D1%81%D0%B4%D0%B5%D0%B9%D0%BB_(%D0%A0%D0%BE%D0%B4-%D0%90%D0%B9%D0%BB%D0%B5%D0%BD%D0%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Peace_Dale_Congregational_Church.JPG","page_title":"Вейкфілд-Пісдейл (Род-Айленд)","context_page_description":"Вейкфілд-Пісдейл — переписна місцевість в США, в окрузі Вашингтон штату Род-Айленд. Населення — 8487 осіб."},{"page_url":"https://de.wikipedia.org/wiki/Gregor_M%C3%BChlberger","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Rund_um_K%C3%B6ln_2017_054.jpg","page_title":"Gregor Mühlberger","context_page_description":"Gregor Mühlberger ist ein österreichischer Radrennfahrer und österreichischer Meister im Straßenrennen."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Linnich","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Linnich-Boslar_Denkmal-Nr._9%2C_Gereonstra%C3%9Fe_48_%286535%29.jpg","page_title":"Liste der Baudenkmäler in Linnich","context_page_description":"Die Liste der Baudenkmäler in Linnich enthält die denkmalgeschützten Bauwerke auf dem Gebiet der Stadt Linnich im Kreis Düren in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Linnich eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://it.wikipedia.org/wiki/Turceni","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/ROU_GJ_Turceni_CoA.png","page_title":"Turceni","context_page_description":"Turceni è una città della Romania di 8.328 abitanti, ubicata nel distretto di Gorj, nella regione storica dell'Oltenia.\\nFanno parte dell'area amministrativa anche le località di Gârbovu, Jilţu, Murgeşti, Strâmba-Jiu e Valea Viei.\\nGran parte della popolazione attiva viene impiegata nelle due centrali elettriche, una termica ed una idroelettrica, presenti sul territorio cittadino."},{"page_url":"https://zh.wikipedia.org/wiki/2019%E5%B9%B4%E4%BA%9E%E8%B6%B3%E8%81%AF%E4%BA%9E%E6%B4%B2%E7%9B%83%E6%B1%BA%E8%B3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Ravshan_Irmatov.jpg","page_title":"2019年亞足聯亞洲盃決賽","context_page_description":"2019年亚足联亚洲杯决赛是决出2019年亚足联亚洲杯冠军的足球比赛。赛事于2019年2月1日在阿联酋阿布扎比萨耶德体育城球场举行，比赛双方是日本和卡塔尔。日本第五次杀入决赛，该队前四次决赛的成绩斐然。卡塔尔则是第一次参加比赛，在前六场比赛中保持着零封对手的纪录。最终，卡塔尔 3-1 取胜，首次获得亚洲杯冠军，同时日本首次输掉亚洲杯决赛。"},{"page_url":"https://ko.wikipedia.org/wiki/%ED%97%A4%EB%84%88%ED%95%80%EA%B5%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/82/Hennepin_County_Government_Center_5.jpg","page_title":"헤너핀군","context_page_description":"헤너핀군 또는 헤너핀 카운티는 미국 미네소타주에 위치한 군이다. 2010년 기준으로 이 지역의 인구 수는 총 1,152,425명이다. 2019년 추산으로 이 지역의 총 인구 수는 1,265,843명이다."},{"page_url":"https://eu.wikipedia.org/wiki/Antiseptiko","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/ExAntiseptic.jpg","page_title":"Antiseptiko","context_page_description":"Antiseptikoa mikrobioak suntsitu eta horien ugaltzea eragozteko ehun bizidunei aplikatzen zaien substantzia da, infekzio aukerak murrizteko helburuarekin. Antiseptikoak aplikatzeko prozesuari eta horren efektuari antisepsia deritze. Antiseptikoak ez dira desinfektatzaileen berdinak, efektu baliokideak dituzten arren: desinfektatzaileak ehun bizigabeen gainean dauden mikroorganismoak deusezteko balio baitute; horrela kirofano batean instrumental kirurgikoa desinfektatu egiten da, baina mediku, erizain eta gaixoen larruazalak antiseptikoz tratatzen dira.\\nAntiseptiko batzuk bakterizidak dira, hau da, bakterioen heriotza eragiten dute, beste batzuk aldiz bakteriostatikoak dira, bakterioen hazkuntza ekiditen dute horiek hil gabe."},{"page_url":"https://en.wikipedia.org/wiki/Friedrichshafen_Stadt_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Bahnhof_Friedrichshafen_Stadt_-_BR_628.JPG","page_title":"Friedrichshafen Stadt station","context_page_description":"Friedrichshafen Stadt station is the largest railway station of the city of Friedrichshafen on Lake Constance and a railway junction in the German state of Baden-Württemberg. It has five tracks and is classified by Deutsche Bahn as a category 3 station. Each day it is used by about 160 trains operated by Deutsche Bahn and the Bodensee-Oberschwaben-Bahn. Ulm–Friedrichshafen railway from Ulm ends at the station, where it meets the Lake Constance Belt Railway. Another major railway station in the city, Friedrichshafen Hafen station, which is operated as part of Friedrichshafen Stadt station, was used until 1976 for loading and unloading carriages on the Lake Constance train ferry to Romanshorn in Switzerland."},{"page_url":"https://uz.wikipedia.org/wiki/O%CA%BBqquloq_ko%CA%BBrshapalaklar","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Plecotus_auritus_2013-2_%28cropped%29.jpg","page_title":"Oʻqquloq koʻrshapalaklar","context_page_description":"Oʻqquloq koʻrshapalaklar — silliq burun koʻrshapalaklar urugʻi. Quloq suprasi 4 sm gacha. Bir necha turi bor. Gʻarbiy Osiyo va Shim. Afrikaning quruq iqlimli hududlarida tarqalgan. Oʻrta Osiyo va Qozogʻistonda oqqorinli Oʻqquloq koʻrshapalaklar uchraydi. Oʻqquloq koʻrshapalaklar uchun qoyalar yorigʻi va imoratlar pana joy boʻladi. Tunda faol."},{"page_url":"https://pl.wikipedia.org/wiki/Dwadzie%C5%9Bcia_tysi%C4%99cy_mil_podmorskiej_%C5%BCeglugi","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b9/%27Twenty_Thousand_Leagues_Under_the_Sea%27_by_Neuville_and_Riou_029.jpg","page_title":"Dwadzieścia tysięcy mil podmorskiej żeglugi","context_page_description":"Dwadzieścia tysięcy mil podmorskiej żeglugi – powieść przygodowa i fantastyczno-naukowa Juliusza Verne’a. Warto zwrócić uwagę, że w tytule jednostką długości jest \\"lieue\\" równa trzem milom morskim.\\nJest to druga część tak zwanej dużej trylogii Juliusza Verne’a.\\nPowieść wydał w Paryżu w swym wydawnictwie Pierre-Jules Hetzel w serii Niezwykłe podróże.\\nPierwszy polski przekład pojawił się w odcinkach i w postaci książkowej w 1870.\\nW powieści opisano szczegóły życia pod wodą i techniczne środki do tego służące. Akcja rozgrywa się w roku 1866, a główne postacie to tajemniczy kapitan Nemo, zoolog profesor Pierre Aronnax, jego służący – Conseil, harpunnik Ned Land. Według rękopisu Verne’a Nemo był Polakiem, powstańcem styczniowym zesłanym na Syberię, który po powrocie pragnął pomścić śmierć rodziny wskutek rosyjskich represji po powstaniu styczniowym, zatapiając statki rosyjskiej floty handlowej. Wydawca Pierre-Jules Hetzel ze względu na dobro stosunków francusko-rosyjskich zasugerował mu jednak zmianę – w Tajemniczej wyspie kapitan okazuje się być Hindusem, księciem Dakkarem."},{"page_url":"https://es.wikipedia.org/wiki/Louis_Hercule_Timol%C3%A9on_de_Coss%C3%A9-Brissac","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Louis_Hercule_Timol%C3%A9on_de_Coss%C3%A9-Brissac%2C_Duke_of_Brissac.png","page_title":"Louis Hercule Timoléon de Cossé-Brissac","context_page_description":"Louis Hercule Timoléon de Cossé-Brissac, duque de Brissac, fue un comandante y par de Francia."},{"page_url":"https://id.wikipedia.org/wiki/Keluaran_18","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b2/Torah2.jpg","page_title":"Keluaran 18","context_page_description":"Keluaran 18 adalah bagian dari Kitab Keluaran dalam Alkitab Ibrani dan Perjanjian Lama di Alkitab Kristen. Termasuk dalam kumpulan kitab Taurat yang disusun oleh Musa."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%88%9D%E6%9C%AC%E7%91%9E%E7%A9%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Mizuho20190922.JPG","page_title":"初本瑞穂","context_page_description":"初本 瑞穂は、日本のタレント。兵庫県出身。シンフォニア所属。A型。左利き。"},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%AB%D5%BD%D5%A5%D5%B6_%D5%8E%D5%AB%D5%AC%D5%B0%D5%A1%D5%B4%D5%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Missen-Wilhams_-_Missen_-_Auf_der_Farm_-_Missen_1.JPG","page_title":"Միսեն Վիլհամս","context_page_description":"Միսեն Վիլհամս, կոմունա Գերմանիայի Բավարիա երկրամասում։\\nԵնթարկվում է Շվաբիա վարչական շրջանին։ Գտնվում է Վերին Ալգոյ շրջանի կազմում։ Բնակչությունը կազմում է 1410 մարդ Տարածքը կազմում է 34,96 կմ²։ Պաշտոնական կոդ՝ 09 7 80 127։\\nԿումանը բաժանվում է 7 գյուղական համայնքների"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%97%D0%B0%D1%82%D0%BE%D1%80_(%C2%AB%D0%94%D0%BE%D0%BA%D1%82%D0%BE%D1%80_%D0%A5%D1%82%D0%BE%C2%BB)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Face_of_Boe_%282658982087%29.jpg","page_title":"Затор («Доктор Хто»)","context_page_description":"Затор — третій епізод третього сезону поновленого британського науково-фантастичного телесеріалу «Доктор Хто». Уперше транслювався на телеканалі BBC One 14 квітня 2007 року. Сценаристом епізоду був Расселл Ті Девіс, режисер — Річард Кларк.\\nПодії епізоду відбуваються за п'ять мільярдів років у майбутньому на Новій Землі в місті Нью-Нью-Йорку. В епізоді іншопланетний мандрівник у часі Десятий Доктор та його супутниця Марта Джонс знаходять на планеті залишки людства, яке проживає у постійно заблокованій магістралі на нижніх рівнях міста. Після викрадення Марти Доктор намагається її знайти до того, як автомобіль з нею виїде на небезпечне «швидкісне шосе».\\nРазом з епізодами «Кінець світу» та «Нова Земля» «Затор» складає трилогію та вміщує в собі підказки до сюжетної арки третього сезону. Зйомки епізоду відбувались у вересні та жовтні 2006 року. Більшість епізоду була знята в студії та використовувала велику кількість копм'ютерно згенерованих зображень. Епізод було переглянуто 8,41 мільйонами глядачів у Великій Британії та він отримав переважно позитивні відгуки критиків."},{"page_url":"https://es.wikipedia.org/wiki/Centennial_Place","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/56/Centennial_Place_Roof_%282010%29.jpg","page_title":"Centennial Place","context_page_description":"Centennial Place es un complejo de dos rascacielos situados en Calgary, Alberta, Canadá. Llamado en honor al Centenario de Alberta, contiene un aparcamiento subterráneo de cinco plantas con 793 plazas. El espacio de oficinas cubre 110 000 m². La construcción de Centennial Place se completó en 2010. Las características medioambientales del complejo incluyen el muro cortina, sensores de movimiento para la iluminación, instalaciones de fontanería de bajo consumo, sistema de calefacción y refrigeración de alta eficiencia, y un techo “verde” con el 30% de su superficie plantada.\\nLa azotea de la torre este de 39 plantas tiene una altura de 165,2 m​ mientras que la aguja alcanza los 182,6 m.\\nLa azotea de la torre oeste de 23 plantas tiene una altura de 100,1 m, mientras que la aguja alcanza los 117,6 m.​\\nLos ocupantes más importantes de Centennial Place son Vermilion Energy, Borden Ladner Gervais, Divestco, Baytex Energy, ERCB, Murphy Oil, la Comisión de Seguridad de Alberta, Spencer Stuart y OMERS Worldwide."},{"page_url":"https://en.wikipedia.org/wiki/Malumel","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Malumel_Bhagavathi.jpg","page_title":"Malumel","context_page_description":"Malumel is a village in the Karunagappalli Municipality of Kollam district, Kerala, India."},{"page_url":"https://hu.wikipedia.org/wiki/Oszecsi","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Oseti.jpg","page_title":"Oszecsi","context_page_description":"Japánban az újév három nélkülözhetetlen eleme az oszecsi, az otoszo és az ozoni. Az újév első 3 napjára előre elkészített ételek összefoglaló neve oszecsi rjóri, röviden oszecsi, melyet a könnyen felismerhető dzsúbakoban tárolnak. Eredetileg csak tradicionális módon tartósított japán ételeket jelölt a megnevezés, de az ételtartósítási technikák fejlődésével ma már sokféle nyers, kínai stílusú és nyugati stílusú ételt tartalmazhat, amiket régen nem használt fűszerekkel ízesítenek. Hagyományosan otthon készítették el az oszecsit, de a modernizációval az újévi ételcsomagokat árusító és házhoz szállító élelmiszer boltok, áruházak, tradicionális japán éttermek, konbinik és az internetes üzletek száma, valamint az ezektől vásárló háztartások száma évről évre nő."},{"page_url":"https://sv.wikipedia.org/wiki/334_f.Kr.","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4d/BattleofGranicus.JPG","page_title":"334 f.Kr.","context_page_description":"Vid kung Pixodaros av Karien död efterträds han av sin svärson Orontobates.\\nDå de persiska satraperna har samlats för att hålla krigsråd vid Zeleia, anser Memnon att perserna bör undvika öppen strid och istället tillämpa brända jordens taktik. Det hellespontiska Frygiens satrap Arsites tillåter inte att hans land bränns och bestämmer sig tillsammans med andra satraper att rösta mot detta försiktighetsråd."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%A8%E0%A5%80%E0%A4%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Port_Of_Nice%2C_C%C3%B4te_d%27Azur.jpg","page_title":"नीस","context_page_description":"नीस भूमध्य सागर के तट पर स्थित दक्षिणी फ्रान्स का एक प्रमुख नगर है। २००६ की जनगणना के अनुसार इसकी जनसंख्या ३, ७४, ०६० है। यह एक ऐतिहासिक नगर है जहाँ ४ लाख वर्ष पुराने, मानव के निवास के प्रमाण मिले हैं। यहाँ वर्ष भर आरामदायक भूमध्यसागरीय जलवायु पाई जाती है।"},{"page_url":"https://ru.wikipedia.org/wiki/Donacia_dentata","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Donacia_dentata_Hoppe%2C_1795.jpg","page_title":"Donacia dentata","context_page_description":"Donacia dentata — вид жуков-листоедов из подсемейства радужниц. Распространён в Европе, Западной Сибири, Алтае и восточном Казахстане."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%AE%AD%E7%BB%83%E8%88%B9","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fa/IJN_Kashima_1940_at_Shanghai.jpg","page_title":"训练船","context_page_description":"訓練船，又稱訓練艦、練習艦等，是一種用於培養人員海上勤務能力的船隻。\\n訓練船一般可以分為兩類：一類系留在岸邊，多系駁船或舊船改造而來，可讓受訓者熟悉船上環境、學習艦船器械的操作；另一類則具有航海能力，可讓受訓者進行實操演練。受訓者在陸地上接受相關的知識和技能的學習後，往往要到訓練船上進行實際的練習。\\n按照使用者區分，訓練船又可以分為民用和軍用。軍用訓練艦有時會被譽為「海軍的搖籃」。"},{"page_url":"https://es.wikipedia.org/wiki/Mormyrinae","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Campylomormyrus_numenius.jpg","page_title":"Mormyrinae","context_page_description":"La subfamilia Mormyrinae contiene casi todos los géneros de la familia de peces africanos de agua dulce Mormyridae —salvo aquella perteneciente a la subfamilia Petrocephalinae—, constituyéndose en una de las mayores subfamilias en el orden de Osteoglossiformes, con aproximadamente 170 especies distribuidas en 19 géneros.​\\nComúnmente son llamados peces elefante debido a la larga protuberancia flexible en la mandíbula inferior, y que es utilizada para detectar invertebrados enterrados.​ Dicha extensión mandibular aparenta la forma de un colmillo o un cofre —similares al Marcusenius senegalensis gracilis, que a veces es llamado pez cofre, aunque este término se asocia generalmente con un grupo de peces no relacionado—. Esta subfamilia también es llamada peces tapir."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%8C%8C%EC%8A%A4%ED%8B%B0%EB%82%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Pasta_2006_4.jpg","page_title":"파스티나","context_page_description":"파스티나는 파스타의 일종으로 면의 크기가 아주 작으며 형태가 다양하다. 현재 생산되는 것으로는 가장 작은 파스타면이다. 밀가루로 만들며 달걀을 반죽에 포함하기도 한다.\\n보통 파스티나 면을 사용한 요리는 수프와 함께 먹으며, 특히 아이들이 많이 먹는다.\\n파스티나는 이탈리아어로 작은 파스타라는 뜻이다."},{"page_url":"https://eo.wikipedia.org/wiki/Kresto_(plumoj)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Umbrella_Cockatoo_%28Cacatua_alba%29_-Free_Flight_Aviary_-San_Diego.jpg","page_title":"Kresto (plumoj)","context_page_description":"La kresto estas elstara karaktero montrata de kelkaj specioj de birdoj kaj dinosaŭroj en siaj kapoj.\\nĜenerale uzataj por memontraj celoj, krestoj povas esti fiksaj aŭ leveblaj, depende de la specio. Ekzemple, Kakatuedoj posedas krestojn kiujn povas esti levataj aŭ mallevataj laŭvole. Tiuj krestoj estas uzataj por komuniki kun samspecianoj, aŭ kiel formo de defendo por timigi alproksimiĝantajn individuojn de aliaj specioj, ĉar ili igas la birdojn ŝajni pli grandaj kiam la kresto estas subite kaj neatendite levata.\\nLa kresto estas formata de duonplumoj mildaj kaj faldeblaj. Ĉe birdoj, tiuj duonplumoj estas komunaj en kapo, kolo, kaj supra dorso, kaj ili povas esti uzataj por memsekurigo kaj sentigo."},{"page_url":"https://fr.wikipedia.org/wiki/NGC_4650A","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/NGC_4650A_I_HST2002.jpg","page_title":"NGC 4650A","context_page_description":"NGC 4650A est une galaxie à anneau polaire située dans le constellation du Centaure à environ 115 millions d'années-lumière de la Voie lactée. C'est l'une des plus emblématiques galaxies ayant cette structure atypique, dont on dénombre une centaine d'occurrences. L'origine de cette morphologie particulière n'est d'ailleurs pas pleinement comprise. Elle pourrait être le fruit d'une collision de galaxies intervenue dans un passé suffisamment lointain, sans doute plus d'un milliard d'années. Le disque jaunâtre est constitué d'une population uniforme de vieilles étoiles rouges d'au moins 3 à 5 milliards d'années peut-être issues de l'une de ces galaxies en interaction, tandis que l'anneau bleuâtre est constitué d'étoiles plus jeunes de type OB formées il y a moins d'un milliard d'années.\\nL'anneau polaire ne montre aucune structure spirale identifiable et ne s'inscrit visiblement pas dans un plan, puisque des étoiles se forment au-dessus du plan médian d'un côté et en dessous de ce plan de l'autre côté. Il contient beaucoup de gaz froid, contrairement au disque principal qui en est quasiment dépourvu."},{"page_url":"https://de.wikipedia.org/wiki/Frank_Baltrusch","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Bundesarchiv_Bild_183-1983-0616-031%2C_Frank_Baltrusch.jpg","page_title":"Frank Baltrusch","context_page_description":"Frank Baltrusch ist ein ehemaliger deutscher Schwimmer."},{"page_url":"https://fr.wikipedia.org/wiki/B%26R","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Firma_B%26R_2009.jpg","page_title":"B&R","context_page_description":"La société B&R est une société autrichienne fondée en 1979 par Erwin Bernecker et Josef Rainer à Eggelsberg près de Salzbourg."},{"page_url":"https://it.wikipedia.org/wiki/Bacino_della_Zungaria","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Altai%2C_Tienschan-Orte.png","page_title":"Bacino della Zungaria","context_page_description":"Il bacino della Zungaria è un bacino strutturale con spesse sequenze di rocce risalenti al Paleozoico-Pleistocene, e che si stima abbia estese riserve di petrolio. Il bacino è posizionato al centro della Zungaria, una regione situata nel nord-ovest della Cina corrispondente alla metà settentrionale della provincia autonoma del Sinkiang."},{"page_url":"https://it.wikipedia.org/wiki/Regio_IX_degli_scavi_archeologici_di_Pompei","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Casa_senza_nome_IX.5.6._2.JPG","page_title":"Regio IX degli scavi archeologici di Pompei","context_page_description":"Nella lista seguono i monumenti presenti nella Regio IX degli scavi archeologici di Pompei."},{"page_url":"https://fr.wikipedia.org/wiki/Hans_van_den_Broek","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Hans_van_den_Broek_1983.jpg","page_title":"Hans van den Broek","context_page_description":"Henri « Hans » van den Broek, né le 11 décembre 1936 à Paris, est un homme politique néerlandais."},{"page_url":"https://de.wikipedia.org/wiki/Minoische_Keramik","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/AMI_-_Oktopusvase.jpg","page_title":"Minoische Keramik","context_page_description":"Als minoische Keramik oder Kreto-Minoische Keramik werden Keramikstile der minoischen Kultur zusammengefasst, die sich auf dem bronzezeitlichen Kreta etwa zwischen 2800 und 1100 v. Chr. entwickelten. Die minoische Vasenmalerei hatte ihre Höhepunkte in der Zeit der Alten und Neuen Paläste. Die minoische Keramik spielt als Indikator auch eine große Rolle in der minoischen Chronologie."},{"page_url":"https://ca.wikipedia.org/wiki/Pseudotriton_montanus","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Pseudotriton_montanus.jpg","page_title":"Pseudotriton montanus","context_page_description":"Pseudotriton montanus és una espècie d'amfibis urodels de la família Plethodontidae.\\nÉs endèmica als Estats Units. Es troba en el costat est del país, en gran part de la costa atlàntica i les valls adjacents.\\nEls seus hàbitats naturals són els boscos, rius, pantans, i deus d'aigua dolça."},{"page_url":"https://en.wikipedia.org/wiki/Allied_(film)","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/Dunas_de_Maspalomas.jpg","page_title":"Allied (film)","context_page_description":"Allied is a 2016 war thriller film directed by Robert Zemeckis and written by Steven Knight. It stars Brad Pitt as a Canadian intelligence officer and Marion Cotillard as a French Resistance fighter who fall in love while posing as a married couple during a mission in Casablanca. Jared Harris, Simon McBurney and Lizzy Caplan also star.\\nKnight developed the script from the story told to him as a 21 year old man. Principal photography began in February 2016 in London, and continued in May 2016 in the Canary Islands, used to stand in for Morocco. Joanna Johnston acted as costume designer for the film, and would match the designs of the costumes around the character's mindset and situations.\\nThe film premiered in Los Angeles on November 9, 2016, and was released in the United States on November 23, 2016 by Paramount Pictures. It received mixed reviews from critics, with praise for its costume design, but saw criticism for its screenplay and the lack of chemistry between the actors. The film grossed $40.1 million domestic and $119 million worldwide against an approximate $85–113 million budget, becoming regarded as a box office flop."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AE%D8%B1%DA%AF%D9%88%D8%B4_%DA%A9%D8%A7%D9%84%DB%8C%D9%81%D8%B1%D9%86%DB%8C%D8%A7%DB%8C%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Jackrabbit2_crop.JPG","page_title":"خرگوش کالیفرنیایی","context_page_description":"خرگوش کالیفرنیایی نام یک گونه از سرده خرگوش صحرایی است."},{"page_url":"https://it.wikipedia.org/wiki/Raimondo_Orsini_del_Balzo","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/39/Raimondo_del_Balzo_Castel_Nuovo_Napoli.jpg","page_title":"Raimondo Orsini del Balzo","context_page_description":"Raimondo Orsini del Balzo, conosciuto anche come Raimondello, è stato un condottiero italiano.\\nFu principe di Taranto, duca di Bari e Benevento, conte di Bisceglie, Lecce e Soleto, signore di Gallipoli, Martina Franca, Nardò, Oria, Ostuni, Otranto, Tricase e Ugento, gran connestabile del Regno di Napoli e Gonfaloniere della Chiesa."},{"page_url":"https://nn.wikipedia.org/wiki/MS_%C2%ABNordkapp%C2%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/MS_Nordkapp_i_Moldefjorden.jpg","page_title":"MS «Nordkapp»","context_page_description":"MS Nordkapp er eit norsk cruiseskip som vart bygd i 1996 av Kleven Verft AS, for Ofotens og Vesteraalens Dampskibsselskab for bruk i Hurtigruten langs norskekysten. «Nordkapp» er systerskipet til MS «Polarlys» og MS «Nordnorge». Skipet vart kontrahert på 50 årsdagen til Kleven Verft."},{"page_url":"https://de.wikipedia.org/wiki/Isernhagen","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/74/Kirche_Kirchhorst.jpg","page_title":"Isernhagen","context_page_description":"Isernhagen ist eine selbständige Gemeinde in der Region Hannover, die sich aus sieben Ortsteilen, darunter vier althergebrachte Bauerschaften, zusammensetzt. Die Gemeinde grenzt nordöstlich an die Stadt Hannover in Richtung der Städte Celle und Burgdorf. Isernhagen ist nach dem durchschnittlichen Einkommen ihrer Bürger die wohlhabendste Gemeinde Niedersachsens."},{"page_url":"https://id.wikipedia.org/wiki/ARM_Cortex-M","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/ARM_Cortex-M0_and_M3_ICs_in_SMD_Packages.jpg","page_title":"ARM Cortex-M","context_page_description":"The ARM Cortex-M adalah sekelompok inti prosesor 32-bit RISC ARM lisensi dari ARM Holdings digunakan pada mikrokontroler. Inti tersebut terdiri dari Cortex-M0, Cortex-M0+, Cortex-M1, Cortex-M3, Cortex-M4, Cortex-M7, Cortex-M23, Cortex-M33. Jika silikon Cortex-M4 / M7 / M33 memiliki fasilitas FPU, maka inti ini dikenal sebagai Cortex-M4F / Cortex-M7F / Cortex-M33F. ARM Cortex-M core telah dikirim dalam puluhan miliar perangkat."},{"page_url":"https://es.wikipedia.org/wiki/Drag%C3%B3n_vietnamita","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Dragon_%28Le_dynasty%2C_Vietnam%29.jpg","page_title":"Dragón vietnamita","context_page_description":"Los dragones vietnamitas son criaturas simbólicas del folclore y mitología de Vietnam. Según un antiguo mito, los vietnamitas son descendientes de un dragón y un hada.\\nPara los vietnamitas, el dragón trae la lluvia, esencial para la agricultura. Representa el emperador, la prosperidad y el poder de la nación. Al igual que el dragón chino, el dragón vietnamita es el símbolo del yang, lo que representa el universo, la vida, la existencia y el crecimiento.\\nReferencias existentes al dragón vietnamita son raros ahora debido a los feroces cambios en la historia que acompañaron a la sinización del dinastía Nguyen."},{"page_url":"https://sv.wikipedia.org/wiki/Skebo_bruk","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Skebo%C3%A5n.jpg","page_title":"Skebo bruk","context_page_description":"Skebo bruk är ett järnbruk grundat under 1600-talet. Det ligger i den nutida tätorten Skebobruk. Vid bruket tillverkades stångjärn. Det tackjärn som behövdes för produktionen hämtades från den 1686 uppförda Edsbro masugn, som ägdes av Skebo. Malmen kom bland annat från Dannemora gruva. Järnet gick sedan på export. Bruket består i dag av vallonsmedjan, herrgården och bruksgator, där arbetarna på bruket bodde. Verksamheten lades ned 1924."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AC%E3%82%A4%E3%82%AF%E9%83%A1_(%E3%82%A4%E3%83%AA%E3%83%8E%E3%82%A4%E5%B7%9E)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cf/USA_Lake_County%2C_Illinois_age_pyramid.svg","page_title":"レイク郡 (イリノイ州)","context_page_description":"レイク郡は、アメリカ合衆国イリノイ州の北東隅、ミシガン湖岸に位置する郡である。2010年国勢調査での人口は703,462人であり、2000年の644,356人から9.2%増加した。郡庁所在地はウォーキーガン市であり、同郡で人口最大の都市でもある。\\nレイク郡はシカゴ大都市圏に属しており、2000年国勢調査では、一人当たり収入で全米第31位の郡である。湖岸にあるレイクフォレストやハイランドパークは裕福なノースショア地域に入っている。元々はマクヘンリー郡の一部だったが、1839年に現在のレイク郡を構成する郡区が分離して設立された。\\nアメリカ海軍五大湖基地が郡内ノースシカゴ市にある。海軍の訓練用司令本部であり、海軍唯一の新兵訓練基地である。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%90%E3%82%A4%E3%83%B3%E3%83%A9%E3%83%B3%E3%83%89_(%E3%83%8B%E3%83%A5%E3%83%BC%E3%82%B8%E3%83%A3%E3%83%BC%E3%82%B8%E3%83%BC%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Landis_Marquee.JPG","page_title":"バインランド (ニュージャージー州)","context_page_description":"バインランドは、アメリカ合衆国ニュージャージー州の南部、カンバーランド郡にある都市である。2010年国勢調査では人口60,724人であり、2000年の56,271人からは4,453人、7.9%増加、1990年の54,780人からは5,944人、10.9%増加だった。バインランド・ミルビル・ブリッジトン大都市圏の主要都市であり、この3市以外にカンバーランド郡全体が入っている。2010年の都市圏人口は156,898人だった。\\nバインランドは、1952年2月5日に行われた住民投票の結果に基づき、ランディス・タウンシップとバインランド・ボロの合併によって、1952年7月1日に結成された。合併が有効となった7月1日の祝祭では、パレードがあり、エステス・キーフォーヴァー上院議員など著名人の挨拶があった。"},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%BE%D5%A5%D5%BF%D5%AB%D6%84_%D4%BB%D5%BD%D5%A1%D5%B0%D5%A1%D5%AF%D5%B5%D5%A1%D5%B6%D5%AB_%D5%AF%D5%AB%D5%BD%D5%A1%D5%B6%D5%A4%D6%80%D5%AB_(%D4%B3%D5%B5%D5%B8%D6%82%D5%B4%D6%80%D5%AB)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/%D5%8F%D5%B8%D6%82%D5%B6-%D5%A9%D5%A1%D5%B6%D5%A3%D5%A1%D6%80%D5%A1%D5%B6%60_%D4%B1%D5%BE._%D4%BB%D5%BD%D5%A1%D5%B0%D5%A1%D5%AF%D5%B5%D5%A1%D5%B6%D5%AB_%281%29.JPG","page_title":"Ավետիք Իսահակյանի կիսանդրի (Գյումրի)","context_page_description":"Անվան այլ կիրառումների համար տե՛ս՝ Ավետիք Իսահակյանի հուշարձան\\nԱվետիք Իսահակյանի կիսանդրի, գտնվում է Շիրակի մարզի Գյումրի քաղաքում՝ Ավետիք Իսահակյանի տուն-թանգարանի բակում։ Կիսանդրին տեղադրվել է 1975 թվականին։ Ընդգրկված է Գյումրիի պատմության և մշակույթի անշարժ հուշարձանների ցանկում։"},{"page_url":"https://it.wikipedia.org/wiki/%C3%89variste_Carpentier","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/La_poup%C3%A9e_cass%C3%A9e.jpg","page_title":"Évariste Carpentier","context_page_description":"Évariste Carpentier è stato un pittore belga.\\nDipinse scene storiche, di genere e paesaggi. Passò dall'accademismo iniziale al naturalismo, per poi approdare al luminismo impressionista. Fu professore e poi Direttore dell'Accademia di Belle Arti di Liegi."},{"page_url":"https://sv.wikipedia.org/wiki/Combefa","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/00/Map_commune_FR_insee_code_81068.png","page_title":"Combefa","context_page_description":"Combefa är en kommun i departementet Tarn i regionen Occitanien i södra Frankrike. Kommunen ligger i kantonen Monestiés som tillhör arrondissementet Albi. År 2009 hade Combefa 148 invånare."},{"page_url":"https://nl.wikipedia.org/wiki/Dirk_IV_van_Wisch","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Wisch_Wapenboek_Gelre_wapen.svg","page_title":"Dirk IV van Wisch","context_page_description":"Dirk IV van Wisch was bannerheer van de heerlijkheid Wisch"},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D8%A8%D9%84_%D8%B0%D8%A7_%D8%AA%D8%B4%D9%8A%DA%A4%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Otleychevin.jpg","page_title":"جبل ذا تشيڤين","context_page_description":"ذا تشيڤين هوا جبل فى المملكه المتحده."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%85%AD%E5%9B%9B%E8%A5%9F%E7%AB%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/2006%E5%B9%B4_%E5%85%AD%E5%9B%9B%E8%A5%9F%E7%AB%A0.jpg","page_title":"六四襟章","context_page_description":"六四襟章是香港民間一種悼念六四事件的象徵物品，自1997年6月4日前夕民間自行製作派發後，逐漸發展成香港六四活動的傳統。襟章以黑、白兩色為主調，常以隱晦字眼講述六四事件，製作的開銷由一個自稱「六四襟章製作小組」的組織自行募集，並拒絕外界捐款；迄今，六四襟章的派發量約累積超過20萬個。"},{"page_url":"https://en.wikipedia.org/wiki/Ernie_White","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Ernie_White_Cardinals.jpg","page_title":"Ernie White","context_page_description":"Ernest Daniel White was an American professional baseball player who pitched in the Major Leagues from 1940 to 1943 and from 1946 to 1948. A native of Pacolet Mills, South Carolina, he threw left-handed, batted right-handed, stood 5 ft 11 ¹⁄₂ in tall and weighed 175 pounds.\\nWhite pitched for two National League clubs, the St. Louis Cardinals and Boston Braves, during his seven-year MLB career, and was a member of three pennant-winners and one World Series champion. In 108 games, he won 30 and lost 21 contests, with an earned run average of 2.78. All thirty victories came during his first four years in the league as a Cardinal.\\nWhite pitched a complete-game shutout in Game 3 of the 1942 World Series, defeating the New York Yankees 2–0 at Yankee Stadium, as the Cardinals beat New York in five games in the only World Series ever lost by the Yanks during Joe McCarthy's 15+-year term as manager. During the previous season, 1941, White enjoyed his best campaign, winning 17 of 24 decisions, compiling an ERA of 2.40, and finishing sixth in the NL Most Valuable Player poll.\\nWhite served in the U.S. Army during World War II missing the 1944–45 seasons."},{"page_url":"https://es.wikipedia.org/wiki/Singer_Motors","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Singer_and_Company_1903.jpg","page_title":"Singer Motors","context_page_description":"Singer Motors Limited fue una empresa británica fabricante de vehículos automóviles. Fundada en 1874 como Singer & Co por George Singer en Coventry, Inglaterra, originalmente estaba dedicada a construir bicicletas, que continuó produciendo hasta 1915. A partir de 1901 inició la fabricación de automóviles y vehículos comerciales.\\nFue el primer fabricante británico en lanzar al mercado vehículos económicos y de tamaño reducido, que incorporaban elementos de modelos superiores, demostrando que un automóvil pequeño podía ser una propuesta práctica.​ Sus primeros diseños ya tenían una construcción mucho más robusta que los entonces populares ciclocoches, que todavía utilizaban muchos elementos propios de las bicicletas.\\nCon su motor de cuatro cilindros y diez caballos de potencia, el Singer Ten se lanzó en el Salón del Motor de 1912 organizado en el Olympia de Londres. William Rootes, un vendedor de automóviles consumado, firmó un contrato para comprar 50 unidades a Singer, el suministro de todo el primer año.​ El pequeño coche se convirtió rápidamente en un éxito de ventas.​"},{"page_url":"https://zh.wikipedia.org/wiki/%E6%85%95%E5%B0%BC%E9%BB%91%E5%A4%A7%E5%AD%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/LMU_M%C3%BCnchen_-_Lichthof1.JPG","page_title":"慕尼黑大学","context_page_description":"路德维希-马克西米利安-慕尼黑大学，简称为“慕尼黑大学”或“LMU”，是一所位于德国巴伐利亚州首府慕尼黑的综合性大学。\\n公元1472年，由巴伐利亚－兰茨胡特公国的路德维希公爵所创建，为欧洲历史最为悠久的大学之一。公元1802年为纪念创建人路德维希公爵和选帝侯马克西米利安一世，将校名变更为Universitas Ludovico-Maximilianea Monacensis，并赋予今日的德语名称Ludwig-Maximilians Universität。\\n慕尼黑大学为欧洲最著名的大学之一，以其雄厚的学术研究实力享誉国际，曾经培养造就过42位诺贝尔奖得主。2006年10月，慕尼黑大学成为德国为提升大学研究质量的“德国大学卓越计划”中的“精英大学”之一，并且为首轮第一批入选的三所学校之一。在2012年6月揭晓的第二轮卓越计划评选和2019年7月揭晓的第三轮卓越计划评选中，依旧维持其精英大学的地位，并获得德国联邦政府的研究资助。截止2017年，共有42位校友、教职工及研究人员获得过诺贝尔奖。\\n慕尼黑大学在各类世界大学排行榜上皆稳居全球前70名内和德国前三甲，为德国学术资源最为集中、声誉最佳的前三大高校之一。在2020年泰晤士高等教育世界大学排名中，慕尼黑大学名列德国第1，全球第32位。在2020年“《美国新闻和世界报导》的全球大学排名”U.S. News & World Report Best Global Universities Ranking中，慕尼黑大学名列德国第1，全球第43位。在2020年QS世界大学排名中，名列德国第2，全球第63位。\\n在2019年“上海交通大学世界大学学术排名”中，名列德国第2，全球第52位。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_New_York_state_parks","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Jones_Beach_Nov_2008.jpg","page_title":"List of New York state parks","context_page_description":"This is a list of state parks in the U.S. state of New York. Also listed are state golf courses, seasonal hunting areas, and former state parks.\\nIn New York, state parks are managed by the Office of Parks, Recreation and Historic Preservation, with the exception of the Adirondack and Catskill Parks which are managed by the Department of Environmental Conservation. Outside of the Adirondacks and the Catskills, the state parks department is organized into eleven regions:\\nNiagara\\nAllegany\\nGenesee\\nFinger Lakes\\nCentral\\nTaconic\\nPalisades\\nLong Island\\nThousand Islands\\nSaratoga/Capital District\\nNew York City"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%B0%D1%82%D0%B8%D0%BC%D0%B5%D1%82%D1%80%D1%96%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/AYool_topography_15min.png","page_title":"Батиметрія","context_page_description":"Батиметрія — вивчення рельєфу морського дна, отримання даних про глибини в зоні дослідження.\\nУ середовищі фахівців даний термін може використовуватися як сукупність даних про глибини водного об'єкта, результат батиметричної зйомки. Вимір глибин здійснюють спеціальними приладами."},{"page_url":"https://cs.wikipedia.org/wiki/%C3%9Amrt%C3%AD_v_roce_2018","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Petr_Weigl_2011.jpg","page_title":"Úmrtí v roce 2018","context_page_description":"Na této stránce naleznete seznam významných osobností, které zemřely v roce 2018."},{"page_url":"https://lb.wikipedia.org/wiki/Torn_Curtain","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Torn_Curtain_title.jpg","page_title":"Torn Curtain","context_page_description":"Torn Curtain ass en US-amerikanesche Film vum Regisseur Alfred Hitchcock aus dem Joer 1966."},{"page_url":"https://jv.wikipedia.org/wiki/Pang%C3%A9ran_Wales","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/George_IV_bust1.jpg","page_title":"Pangéran Wales","context_page_description":"Pangéran Wales wujud gelar ingkang dipunparingaken dhumateng pawaris tahta Britania Raya. Mila, panyandhang kalungguhan puniki limrahipun wujud putra pambajeng Raja utawi Ratu Britania. Wales wujud salah satunggil saking sekawan nagari panyusun Britania Raya."},{"page_url":"https://sco.wikipedia.org/wiki/Dave_Batista","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Dave_Batista_-_Guardians_of_the_Galaxy_premiere_-_July_2014_%28cropped%29.jpg","page_title":"Dave Batista","context_page_description":"David Michael \\"Dave\\" Bautista, Jr. is an American actor, professional mixed mairtial airtist, an professional wrestler who is currently signed tae WWE unner the ring name Batista."},{"page_url":"https://de.wikipedia.org/wiki/Harald_Mellerowicz","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Bundesarchiv_B_145_Bild-P103765%2C_Berlin%2C_Institut_f%C3%BCr_Leistungsmedizin%2C_Prof._Mellerowicz.jpg","page_title":"Harald Mellerowicz","context_page_description":"Harald Mellerowicz war ein deutscher Sportmediziner, der in der Zeit des Nationalsozialismus mehrfacher deutscher Leichtathletikmeister war."},{"page_url":"https://de.wikipedia.org/wiki/Juxtaorales_Organ","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/HistologischerQuerschnittJuxtaoralOrgan.jpg","page_title":"Juxtaorales Organ","context_page_description":"Das juxtaorale Organ ist ein kleines längliches Organ in der Wange, bestehend aus einem knospenreichen epithelialen Parenchym, das in ein nerven- und zellreiches Bindegewebe eingebettet und von einer straffen perineuriumartigen Hülle umgeben wird.\\nFrüher als nur in der Embryonalentwicklung auftretendes Gebilde bekannt, wurde es 1953 von Zenker beim erwachsenen Menschen als regelmäßig vorkommendes Organ nachgewiesen. Unter Berücksichtigung seiner Lokalisation bei Mensch und Tier erhielt es von Zenker und Salzer den Namen juxtaorales Organ. Diese Bezeichnung wurde von der Internationalen Anatomischen Nomenklaturkommission akzeptiert und in die Nomina anatomica aufgenommen."},{"page_url":"https://fr.wikipedia.org/wiki/Mary_de_Teck","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Queen_mary_post_card_sr1807.jpg","page_title":"Mary de Teck","context_page_description":"La princesse Mary de Teck, née le 26 mai 1867 à Londres et morte le 24 mars 1953 dans la même ville, était l'épouse du roi George V. Elle portait le titre de reine consort du Royaume-Uni et impératrice des Indes.\\nAvant l'accession au trône de George V, elle avait successivement porté, après son mariage, les titres de duchesse d'York puis de duchesse de Cornouailles et enfin de princesse de Galles.\\nLa reine Mary manifesta un intérêt aigu pour les affaires de l'État. Elle fut aussi la première épouse royale à assister au couronnement d'un des successeurs de son mari.\\nLa valeur de sa collection de joyaux, amassés au fil des ans, est aujourd'hui inestimable."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%88%E0%B8%B1%E0%B8%81%E0%B8%A3%E0%B8%9E%E0%B8%A3%E0%B8%A3%E0%B8%94%E0%B8%B4%E0%B8%AD%E0%B8%B4%E0%B9%82%E0%B8%95%E0%B8%81%E0%B8%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7a/Tenn%C5%8D_Itoku_thumb.jpg","page_title":"จักรพรรดิอิโตกุ","context_page_description":"จักรพรรดิอิโตกุ จักรพรรดิองค์ที่ 4 แห่งราชวงศ์ญี่ปุ่น ตามที่ได้บันทึกไว้ใน รายพระนามจักรพรรดิญี่ปุ่น\\nจักรพรรดิอิโตกุครองสิริราชสมบัติระหว่าง 510 ปีก่อนคริสตกาล - 477 ปีก่อนคริสตกาล\\nจักรพรรดิอิโตกุเป็นหนึ่งในเก้าจักรพรรดิที่นักประวัติศาสตร์กล่าวกันว่าเป็นจักรพรรดิในตำนาน"},{"page_url":"https://fr.wikipedia.org/wiki/Hector_Cattolica","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Couv_Hector_Cattolica_Ed_Maspero.JPG","page_title":"Hector Cattolica","context_page_description":"Hector Cattolica est un affichiste, graphiste, illustrateur, peintre, poète, argentin, né le 31 août 1933 à Bragado et mort en juillet 1993, à Paris. Il est le fondateur de la revue Margen et membre de l'Espace Latino-Américain à Paris. Il est le premier à avoir donné une identité visuelle au Centre de Création Industrielle."},{"page_url":"https://it.wikipedia.org/wiki/Craveggia","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Craveggia_-_sullo_sfondo_il_Monte_Rosa.jpg","page_title":"Craveggia","context_page_description":"Craveggia è un comune italiano di 764 abitanti della provincia del Verbano-Cusio-Ossola in Piemonte.\\nÈ uno dei borghi più pittoreschi della Val Vigezzo ed è famoso per i suoi innumerevoli camini in pietra che svettano sopra i tetti in beole delle case. In passato gli alti camini erano considerati simbolo di ricchezza delle famiglie borghesi del luogo che facevano a gara per chi ne costruiva di più imponenti e numerosi.\\nLa località Bagni di Craveggia è accessibile per gli automezzi solo dalla Svizzera, attraverso la valle Onsernone, mentre è possibile raggiungerla a piedi passando dal crinale del monte che la sovrasta."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%90%84%E5%9B%BD%E9%A2%86%E5%AF%BC%E4%BA%BA%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Tourism%2C_development_and_peace_-_The_story_of_Rwanda_%2841565511561%29.jpg","page_title":"各国领导人列表","context_page_description":"本列表列舉了當今世界各國的現任領導人，包括國家元首、政府首腦和最高領導人。應注意的是，這種職務劃分的主要依據議會民主制國家的權力分配習慣。而對於總統制、半總統制或採用其他政體的國家而言，此劃分可能並不十分準確。比如總統制國家的總統本身兼任政府首腦，一黨執政下的社會主義國家的執政黨領導人一般為黨和國家最高領導人。而有些國家的實際最高領導人並不享有該國國家元首或政府首腦的法定頭銜。此外領導人頭銜或稱號也可能存在翻譯不夠準確的問題。列表以國家或其首都所在的大洲區分。"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D8%A8%D9%8A%D8%AF%D8%AC_%D8%B9%D9%85%D9%84%D8%A7%D9%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Alecton_giant_squid_1861.png","page_title":"سبيدج عملاق","context_page_description":"السَّبِيدَج العِمْلاق أو الصَبِّيدَج العملاق ‏ وهو أشد أنواع السَبادِج هولا وضخامة بعد السبيدج الضخم ‏ ويعتبر أيضاً أكبر اللافقاريات أو الحيوانات التي ليس لها عمود فقري."},{"page_url":"https://en.wikipedia.org/wiki/Abu_Dhabi","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/YasMarina2.jpeg","page_title":"Abu Dhabi","context_page_description":"Abu Dhabi is the capital and the second-most populous city of the United Arab Emirates. The city of Abu Dhabi is located on an island in the Persian Gulf, off the Central West Coast. Most of the city and the Emirate reside on the mainland connected to the rest of the country. As of 2020, Abu Dhabi's urban area had an estimated population of 1.48 million, out of 2.9 million in the emirate of Abu Dhabi, as of 2016.\\nAbu Dhabi houses local and federal government offices and is the home of the United Arab Emirates Government and the Supreme Petroleum Council. The city is home to the President of the UAE, who is a member of the Al Nahyan family. Abu Dhabi's rapid development and urbanization, coupled with the massive oil and gas reserves and production and relatively high average income, have transformed it into a large, developed metropolis. It is the country's center of politics and industry, and a major culture and commerce center. Abu Dhabi accounts for about two-thirds of the roughly $400 billion UAE economy."},{"page_url":"https://en.wikipedia.org/wiki/List_of_crossings_of_the_Willamette_River","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Aerial_view_of_Willamette_River_crossings_in_Portland%2C_February_2018.JPG","page_title":"List of crossings of the Willamette River","context_page_description":"This is a list of bridges and other crossings of the Willamette River in the U.S. state of Oregon from the Columbia River upstream to the confluence of the Middle Fork Willamette River and Coast Fork Willamette River. This confluence, at 44.023318°N 123.023897°W, is considered the source of the Willamette River."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D9%8A%D8%B1_%D8%AA%D9%88%D8%B3%D9%83%D9%8A%D8%AF%D8%A7%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Geir_Sigbj%C3%B8rn_Toskedal_%28KrF%29_%28cropped%29.JPG","page_title":"جير توسكيدال","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nجير توسكيدال سياسى من النرويج."},{"page_url":"https://pa.wikipedia.org/wiki/%E0%A8%AE%E0%A8%BE%E0%A8%B0%E0%A9%80%E0%A8%86_%E0%A8%97%E0%A9%8B%E0%A8%87%E0%A8%AA%E0%A8%B0%E0%A8%9F-%E0%A8%AE%E0%A8%BE%E0%A8%87%E0%A8%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Maria_Goeppert-Mayer.jpg","page_title":"ਮਾਰੀਆ ਗੋਇਪਰਟ-ਮਾਇਰ","context_page_description":"ਮਾਰੀਆ ਗੋਇਪਰਟ-ਮਾਇਰ ਦਾ ਜਨਮ 28 ਜੂਨ 1906 ਨੂੰ ਹੋਇਆ ਸੀ। ਇਹ ਇੱਕ ਅਮਰੀਕੀ ਵਿਗਿਆਨੀ ਸੀ। 1963 ਵਿੱਚ ਉਸ ਨੂੰ ਭੋਤਿਕ ਵਿਗਿਆਨ ਵਿੱਚ ਨੋਬਲ ਪੁਰਸਕਾਰ ਦਿਤਾ ਗਿਆ।"},{"page_url":"https://de.wikipedia.org/wiki/Bretx","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/BretxMairie.jpg","page_title":"Bretx","context_page_description":"Bretx ist eine französische Gemeinde mit 646 Einwohnern im Département Haute-Garonne in der Region Okzitanien. Sie gehört zum Arrondissement Toulouse und zum Kanton Léguevin. Die Einwohner werden Bretxois genannt."},{"page_url":"https://en.wikipedia.org/wiki/Castle_Airport","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Castle_Airport_CA_2006_USGS.jpg","page_title":"Castle Airport","context_page_description":"Castle Airport is a public airport eight miles northwest of Merced, in Merced County, California. The airport is operated by the Merced County Department of Commerce, Aviation, and Economic Development. It is owned jointly by the city of Merced, the city of Atwater, and Merced County. The airport was formerly designated as Castle Air Force Base, a United States Air Force Strategic Air Command base which was closed after the end of the Cold War in 1995.\\nThe Federal Aviation Administration's National Plan of Integrated Airport Systems for 2017–2021 categorized it as a general aviation airport, serving a regional role. The United States Department of Commerce designates the airport and its hangars, warehouses, industrial buildings, and distribution facilities as a Foreign-Trade Zone. The United States Forest Service uses Castle Airport as reloading base for aerial firefighting, its large runway, aprons, and taxiways being able to accommodate any aircraft in the Forest Service inventory.\\nCastle Airport serves as the headquarters for the Sierra Academy of Aeronautics, which specializes in training foreign pilots, primarily from the People's Republic of China."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_%C5%93uvres_de_J%C3%A9r%C3%B4me_Bosch","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Possibly_Jheronimus_Bosch_003_recto_01.jpg","page_title":"Liste des œuvres de Jérôme Bosch","context_page_description":"La liste des œuvres de Jérôme Bosch recense la quarantaine de peintures et de dessins réalisés par cet artiste ainsi que la plupart des autres œuvres attribués à celui-ci ou à son atelier."},{"page_url":"https://en.wikipedia.org/wiki/Frederick_Varley","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Frederick_Varley_-_The_Young_Man%27s_Element%2C_the_Air.jpg","page_title":"Frederick Varley","context_page_description":"Frederick Horsman Varley RCA was a member of the Canadian Group of Seven artists."},{"page_url":"https://nl.wikipedia.org/wiki/Attila_Bal%C3%A1zs","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Balazs_WMQ18_%2829%29_%2842647726635%29.jpg","page_title":"Attila Balázs","context_page_description":"Attila Bálazs is een Hongaarse tennisser."},{"page_url":"https://en.wikipedia.org/wiki/Coutrallam_Falls","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b2/Boat_House.jpg","page_title":"Coutrallam Falls","context_page_description":"Coutrallam Falls is located in Tenkasi district in the South Indian state of Tamil Nadu bordering to Kollam district, Kerala. The falls is located on the Western Ghats on the river Chittar and is considered a \\"medical spa\\" on account of the medical smell in the waters. It is located 5 km from the nearest city Tenkasi. There are a total of nine falls of which Peraruvi, Aintharuvi and Puli Aruvi being the most prominent.\\nThe Tirunelveli district administration organises Saral Vizha, an eight-day festival every year during the Tamil month of Aadi. The falls is the most prominent tourist destination in the region and usually frequented by devotees of the Papanasanathar Temple and Sabarimala. The season starts with the South West monsoon from July to September. The Tamil Nadu Tourism Development Corporation has a boat house that operates boating during season.\\nKuttalam palace is Travancore monument situated near to Waterfalls. Before 1956 kuttalam was also a part of Travancore state."},{"page_url":"https://en.wikipedia.org/wiki/Ferroalloy","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/51/Ferrosilicon.JPG","page_title":"Ferroalloy","context_page_description":"Ferroalloy refers to various alloys of iron with a high proportion of one or more other elements such as manganese, aluminium, or silicon. They are used in the production of steels and alloys. The alloys impart distinctive qualities to steel and cast iron or serve important functions during production and are, therefore, closely associated with the iron and steel industry, the leading consumer of ferroalloys. The leading producers of ferroalloys in 2014 were China, South Africa, India, Russia and Kazakhstan, which accounted for 84% of the world production. World production of ferroalloys was estimated as 52.8 million tonnes in 2015."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AC%E3%82%B7%E3%83%84%E3%82%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Resita_Sud_%28centru%29%2C_in_departare_Resita_Nord%2C_1_nov_2008.jpg","page_title":"レシツァ","context_page_description":"レシツァ は、ルーマニア西部、バナト地方のカラシュ＝セヴェリン県の都市で県都。"},{"page_url":"https://de.wikipedia.org/wiki/Maria_Crescentia_H%C3%B6ss","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Kloster-kaufbeuren.jpg","page_title":"Maria Crescentia Höss","context_page_description":"Maria Crescentia Höss war Oberin des Klosters Kaufbeuren und wird in der römisch-katholischen Kirche als Heilige verehrt."},{"page_url":"https://be.wikipedia.org/wiki/%D0%90%D0%BF%D0%BE%D0%BB%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Oppeln_2009.jpg","page_title":"Аполе","context_page_description":"Апо́ле, да 1945 года Опельн — горад па поўдні Польшчы, з'яўляецца гаспадарчым, навуковым, культурным і адміністрацыйным цэнтрам Апольскага ваяводства. Аполе з'яўляецца адным з самых старых гарадоў Польшчы. Горад знаходзіцца ў гістарычнай вобласці Верхняя Сілезія і з сярэднявечча да пачатку ХХ стагоддзя быў яе сталіцай. Першыя згадкі аб Аполі датуюцца 845 годам. Колькасць насельніцтва горада дасягае 120,2 тыс. чалавек.\\nПраз Аполе цячэ рака Одра, Сворніца і Пручкоўскі Паток, таксама ёсць невялікія рэкі Маліна, Альшчанка і Чарнка. Самы высокі пункт горада ўзносіцца на вышыню 176 м над узроўнем мора."},{"page_url":"https://en.wikipedia.org/wiki/Marcus_Peters","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Marcus_Peters.png","page_title":"Marcus Peters","context_page_description":"Marcus Peters is an American football cornerback for the Baltimore Ravens of the National Football League. He was drafted by the Kansas City Chiefs in the first round of the 2015 NFL Draft. He played college football at Washington."},{"page_url":"https://it.wikipedia.org/wiki/R%C3%BCst%C9%99m_Mustafayev","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/R%C3%BCst%C9%99m_Mustafayev_-_B%C9%99dii_t%C9%99rtibat._1930-cu_ill%C9%99r.jpg","page_title":"Rüstəm Mustafayev","context_page_description":"Rüstəm Mammad oglu Mustafayev è stato un pittore e scenografo azero. Fu pioniere delle arti decorative teatrali in Azerbaigian."},{"page_url":"https://de.wikipedia.org/wiki/Leordina","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Leodina_Fluss_Viseu.JPG","page_title":"Leordina","context_page_description":"Leordina ist eine Gemeinde im Kreis Maramureș in Rumänien."},{"page_url":"https://pl.wikipedia.org/wiki/Farschweiler","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9d/Farschweiler01.jpg","page_title":"Farschweiler","context_page_description":"Farschweiler – miejscowość i gmina w Niemczech, w kraju związkowym Nadrenia-Palatynat, w powiecie Trier-Saarburg, wchodzi w skład gminy związkowej Ruwer."},{"page_url":"https://nl.wikipedia.org/wiki/NGC_1175","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/NGC_1175_SDSS.jpg","page_title":"NGC 1175","context_page_description":"NGC 1175 is een spiraalvormig sterrenstelsel in het sterrenbeeld Perseus. Het hemelobject werd op 24 oktober 1786 ontdekt door de Duits-Britse astronoom William Herschel."},{"page_url":"https://en.wikipedia.org/wiki/Skellig_Michael","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Skelligs_Splash.jpg","page_title":"Skellig Michael","context_page_description":"Skellig Michael is a twin-pinnacled crag 11.6 kilometres west of the Iveragh Peninsula in County Kerry, Ireland. The island is named after the archangel Michael, while \\"Skellig\\" is derived from the Irish language word sceilig, meaning a splinter of stone. Its twin island, Little Skellig, is smaller and inaccessible. The two islands rose c. 374–360 million years ago during a period of mountain formation, along with the MacGillycuddy's Reeks mountain range. Later, they were separated from the mainland by rising water levels.\\nSkellig Michael consists of approximately 22 hectares of rock, with its highest point, known as the Spit, 218 m above sea level. The island is defined by its twin peaks and intervening valley, which make its landscape steep and inhospitable. It is best known for its Gaelic monastery, founded between the 6th and 8th centuries, and its variety of inhabiting species, which include gannets, puffins, a colony of razorbills and a population of approximately fifty grey seals. The island is of especial interest to archaeologists, as the monastic settlement is in unusually good condition."},{"page_url":"https://fr.wikipedia.org/wiki/Joseph_Babinski","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c1/Jozef_Babinski2.jpg","page_title":"Joseph Babinski","context_page_description":"Joseph Jules François Félix Babinski, né à Paris le 17 novembre 1857 et mort dans la même ville le 29 octobre 1932, est un médecin neurologue français d'ascendance polonaise."},{"page_url":"https://pl.wikipedia.org/wiki/Zas%C5%82aw_(Ukraina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/%D0%9A%D0%BE%D1%81%D1%82%D0%B5%D0%BB_%D0%BC%D1%96%D1%81%D1%96%D0%BE%D0%BD%D0%B5%D1%80%D1%96%D0%B2_%D0%A1%D0%B2.%D0%99%D0%BE%D1%81%D0%B8%D1%84%D0%B0%2C_%D0%86%D0%B7%D1%8F%D1%81%D0%BB%D0%B0%D0%B2.jpg","page_title":"Zasław (Ukraina)","context_page_description":"Zasław – miasto na Ukrainie w obwodzie chmielnickim nad rzeką Horyń, siedziba władz rejonu zasławskiego. Jedno z najstarszych miast na Wołyniu, dawna rezydencja Ostrogskich-Zasławskich, w 2016 roku liczyło 17 tys. mieszkańców.\\nPrywatne miasto szlacheckie położone było w XVI wieku w województwie wołyńskim."},{"page_url":"https://en.wikipedia.org/wiki/%C5%A0ipovo","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/%C5%A0ipovo.jpg","page_title":"Šipovo","context_page_description":"Šipovo is a town and municipality located in Republika Srpska, an entity of Bosnia and Herzegovina. It is situated in the southern part of the Bosanska Krajina region. As of 2013, it has a population of 10,293 inhabitants, while the town of Šipovo has a population of 4,052 inhabitants.\\nThe municipality covers an area of 510 km², much of which is forested."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Straupitz_(Spreewald)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Straupitz_Haus_Cottbuser_Strasse_1_3.jpg","page_title":"Liste der Baudenkmale in Straupitz (Spreewald)","context_page_description":"Die Liste der Baudenkmale in Straupitz enthält alle Baudenkmale der brandenburgischen Gemeinde Straupitz (Spreewald) und ihrer Ortsteile. Grundlage ist die Landesdenkmalliste mit dem Stand vom 31. Dezember 2019. Die Bodendenkmale sind in der Liste der Bodendenkmale in Straupitz (Spreewald) aufgeführt."},{"page_url":"https://br.wikipedia.org/wiki/Turtzioz","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Bizkaia_municipalities_Turtzioz.PNG","page_title":"Turtzioz","context_page_description":"Turtzioz zo ur gumun eus Bizkaia en Euskal Herria."},{"page_url":"https://sv.wikipedia.org/wiki/Alucita","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/40364-Alucita-hexadactyla-most-alike.jpg","page_title":"Alucita","context_page_description":"Alucita är ett släkte av fjärilar som beskrevs av Carl von Linné 1758. Alucita ingår i familjen Mångfliksmott."},{"page_url":"https://en.wikipedia.org/wiki/Oonopidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Spinestis_nikita_%28female%29.jpg","page_title":"Oonopidae","context_page_description":"Oonopidae, also known as goblin spiders, is a family of spiders consisting of over 1,600 described species in about 113 genera worldwide, with total species diversity estimated at 2000 to 2500 species. The type genus of the family is Oonops Keyserling, 1835.\\nGoblin spiders are generally tiny, measuring about 1 to 3 millimeters. Some have scuta, hardened plates on their abdomens. Oonopids usually have six eyes, the anterior median eyes having been lost. However, four-eyed, two-eyed and even completely eyeless species are also known. The family is permeated with unusual morphological traits, many of which are limited to males. Examples include heavily modified mouthparts, sternal pouches and extensions of the carapace. The male pedipalps are also often highly modified. The genus Opopaea, for example, exhibits an expanded palpal patella while male Ischnothyreus are characterized by completely sclerotized, pitch-black pedipalps. Members of the genus Orchestina are believed to be able to jump, as both sexes have greatly enlarged femora on the fourth leg pair.\\nOonopidae are seldom seen by people as they are too small to be easily noticed."},{"page_url":"https://az.wikipedia.org/wiki/G%C3%B6z%C9%99l_reyhan","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Starr_030202-0053_Ocimum_gratissimum.jpg","page_title":"Gözəl reyhan","context_page_description":"Gözəl reyhan - reyhan cinsinə aid bitki növü."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%BB%D0%B0%D0%B3_%D0%A1%D1%82%D0%B0%D1%80%D0%BE%D1%8E%D1%80%D1%8C%D0%B5%D0%B2%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/64/Flag_of_Staroyurevsky_rayon_%28Tambov_oblast%29.png","page_title":"Флаг Староюрьевского района","context_page_description":"Флаг муниципального образования Старою́рьевский район Тамбовской области Российской Федерации — опознавательно-правовой знак, служащий официальным символом муниципального образования.\\nНыне действующий флаг утверждён 26 августа 2011 года и 2 ноября 2011 года внесён в Государственный геральдический регистр Российской Федерации с присвоением регистрационного номера 7214."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_D%C3%B6schnitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/D%C3%B6schnitz_D%C3%B6schnitz_Ortsstra%C3%9Fe_17_Scheune.jpg","page_title":"Liste der Kulturdenkmale in Döschnitz","context_page_description":"In der Liste der Kulturdenkmale in Döschnitz sind alle Kulturdenkmale der thüringischen Gemeinde Döschnitz und ihrer Ortsteile aufgelistet."},{"page_url":"https://en.wikipedia.org/wiki/Manuel_Polo_y_Peyrol%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Polo_y_Peyrolon%2C_Elementos_de_etica%2C.jpg","page_title":"Manuel Polo y Peyrolón","context_page_description":"Manuel Polo y Peyrolón was a Spanish writer, theorist, academic, and politician. He is best known as the author of 5 novels falling in-between Romanticism and Realism; classified as part of costumbrismo, they are currently considered second-rate literature. As a philosopher he stuck to neo-Thomism and focused mostly on confronting Krausism. In education he represented the Catholic regenarationism, fiercely pitted against the Liberal current. In politics he was active within Carlism; his career climaxed during the 1896-1898 term in the Congress of Deputies and during the 1907-1915 terms in the Senate."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AF%D8%A7%D8%B1%D9%8A%D9%86_%D8%B3%D8%AA%D9%8A%D9%81%D9%86%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Darren_Stevens_batting.JPG","page_title":"دارين ستيفنز","context_page_description":"دارين ستيفنز ‏ هو لاعب كريكت نيوزلندي. لعب مع Cumilla Warriors وKent County Cricket Club وLeicestershire County Cricket Club وDhaka Platoon وفريق أوتاغو للكريكت."},{"page_url":"https://de.wikipedia.org/wiki/Yomiuri_Giants","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Eiji_Sawamura.jpg","page_title":"Yomiuri Giants","context_page_description":"Die Yomiuri Giants aus Tokio sind die älteste und erfolgreichste Mannschaft im japanischen Baseball mit 42 Ligatiteln in der Central League und 21 Nippon-Series-Siegen. In der Öffentlichkeit werden sie oft kurz mit Kyojin bezeichnet."},{"page_url":"https://vi.wikipedia.org/wiki/N%E1%BB%99i_soi_hu%E1%BB%B3nh_quang","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Normal_barium_swallow_animation.gif","page_title":"Nội soi huỳnh quang","context_page_description":"Nội soi huỳnh quang là một kỹ thuật hình ảnh sử dụng tia X để thu được hình ảnh chuyển động theo thời gian thực của phần bên trong của vật thể. Trong ứng dụng chính của hình ảnh y khoa, huỳnh quang nghiệm cho phép một bác sĩ nhìn thấy cấu trúc bên trong và chức năng của bệnh nhân, để hành động bơm của tim hoặc chuyển động của nuốt, ví dụ, có thể được xem. Điều này hữu ích cho cả chẩn đoán và điều trị và xảy ra trong X quang nói chung, X quang can thiệp và ngoại khoa theo hướng dẫn bằng hình ảnh. Ở dạng đơn giản nhất, đèn huỳnh quang bao gồm màn hình nguồn tia X và màn hình huỳnh quang, giữa bệnh nhân được đặt. Tuy nhiên, từ những năm 1950, hầu hết các đèn huỳnh quang đều có máy tăng cường hình ảnh tia X và máy ảnh cũng vậy, để cải thiện khả năng hiển thị của hình ảnh và làm cho nó có sẵn trên màn hình hiển thị từ xa. Trong nhiều thập kỷ, huỳnh quang có xu hướng tạo ra những bức ảnh sống không được ghi lại, nhưng từ những năm 1960, khi công nghệ được cải thiện, việc ghi và phát lại đã trở thành chuẩn mực."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Fulton_K%C5%ABn_(Indiana)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Fulton_County_Courthouse_in_Rochester.jpg","page_title":"Fulton Kūn (Indiana)","context_page_description":"Fulton Kūn sī Bí-kok Indiana chiu ê kūn, ū jîn-kháu 20449."},{"page_url":"https://pl.wikipedia.org/wiki/Hrabstwo_Inyo","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Inyo_County%2C_California_seal.png","page_title":"Hrabstwo Inyo","context_page_description":"Hrabstwo Inyo – hrabstwo w USA w stanie Kalifornia znajdujące się w południowo-wschodniej części stanu. Jedno z największych i najsłabiej zaludnionych. W roku 2000, liczba mieszkańców wyniosła 17.945. Stolicą jest Independence."},{"page_url":"https://de.wikipedia.org/wiki/Chevrolet_Silverado","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Chevrolet_Silverado%2C_Jeff_Davis_County_Courthouse_parking_lot.JPG","page_title":"Chevrolet Silverado","context_page_description":"Der Chevrolet Silverado ist ein Pick-up-Modell des US-amerikanischen Autoherstellers General Motors. Auch in den aktuellen Modellen weist er die typischen Stilmerkmale amerikanischer Pick-up-Trucks auf: eine große Fahrerkabine, optional mit zweiter Sitzbank, starken Motorisierungen, einer offenen Ladefläche und Leiterrahmen. Die Modellversion mit zweiter Sitzbank ist sowohl zwei- als auch viertürig erhältlich.\\nDer Silverado ist das Volumenmodell von Chevrolet, der Pickup rangiert hinter der Ford F-Serie auf Platz zwei der Zulassungsstatistik, wobei hier die Zulassungen des fast baugleichen GMC Sierra nicht eingerechnet sind.\\nDiese Art von Pickups findet man in den USA auf dem Land häufig vor. Der Silverado baut auf der gleichen Plattform wie der Chevrolet Tahoe und Chevrolet Suburban, insoweit weisen alle diese Modelle hinsichtlich Karosseriemerkmalen und Innenraumdesign Ähnlichkeiten auf. Seit der ersten Modellpflege haben die Silverado-Modelle aber eine eigenständige Frontgestaltung, die sie von den Schwestermodellen optisch unterscheidet."},{"page_url":"https://lt.wikipedia.org/wiki/Altoni%C5%A1kiai","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dc/Altoni%C5%A1ki%C5%B3_kaimas.JPG","page_title":"Altoniškiai","context_page_description":"Altoniškiai – kaimas Kauno rajone, 6 km į šiaurės vakarus nuo Zapyškio, prie kelio Kaunas-Šakiai. Veikia Zapyškio mokyklos skyrius, biblioteka. Stūkso Altoniškių piliakalnis ir alkakalnis."},{"page_url":"https://no.wikipedia.org/wiki/Martin_Heinrich","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Martin_Heinrich%2C_official_portrait%2C_113th_Congress.jpg","page_title":"Martin Heinrich","context_page_description":"Martin Trevor Heinrich er en demokratisk politiker som representerer New Mexico i USAs senat. Han tok over setet til Jeff Bingaman 3. januar 2013.\\nHar også representert New Mexicos 1. distrikt i Representantenes hus."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%97%D0%B0%D0%BF%D0%B0%D0%B4%D0%BD%D0%B8_%D0%9A%D0%B0%D0%B2%D0%BA%D0%B0%D0%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/CaucasianBison-Demidoff1898.png","page_title":"Западни Кавказ","context_page_description":"Западни Кавказ западни део планинског венца Великог Кавказа, од Црног мора до планине Елбрус у Русији. Како је то једини планински венац у Европи који није претрпио значајне промене људским деловањем уписан је 1978. године на УНЕСКО-ву листу резервата биосфере у оквиру програма МаБ, а 1999. године на листу Светске баштине."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D1%81%D1%82%D0%BD%D0%B8%D0%BA%D0%BE%D0%B2,_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B9_%D0%9D%D0%B5%D1%81%D1%82%D0%BE%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3f/Nestor_Postnikov.jpg","page_title":"Постников, Сергей Несторович","context_page_description":"Сергей Несторович Постников — самарский политический деятель и предприниматель, городской голова Самары с 1905 года."},{"page_url":"https://en.wikipedia.org/wiki/Pest_County","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Volt_K%C3%A1rolyi_kast%C3%A9ly_%287023._sz%C3%A1m%C3%BA_m%C5%B1eml%C3%A9k%29.jpg","page_title":"Pest County","context_page_description":"Pest is a county in central Hungary. It covers an area of 6,393.14 square kilometres, and has a population of 1,213,090. It surrounds the national capital Budapest and the majority of the county's population live in the suburbs of Budapest. It shares borders with Slovakia and the Hungarian counties Nógrád, Heves, Jász-Nagykun-Szolnok, Bács-Kiskun, Fejér, and Komárom-Esztergom. The River Danube flows through the county. The capital of Pest County is Budapest, but it is planned to completely separate the capital from the county at least until 2020, as it loses catch-up aids from the European Union because of the high development of Budapest."},{"page_url":"https://ca.wikipedia.org/wiki/Volta_a_Andalusia_2020","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/UAE_NC.png","page_title":"Volta a Andalusia 2020","context_page_description":"La Volta a Andalusia 2020 fou la 66a edició de la Volta a Andalusia. La cursa es disputà entre el 19 i el 23 de febrer de 2020, amb un recorregut de 686,6 km repartits en un cinc etapes, la darrera d'elles contrarellotge individual. La cursa formava part de l'UCI ProSeries 2020, en la categoria 2.Pro.\\nEl vencedor final fou el danès Jakob Fuglsang, que revalidà la victòria aconseguida el 2019. Fuglsang dominà la cursa des del primer dia i guanyà amb gairebé un minut sobre el seu immediat perseguidor Jack Haig."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A0%D7%99%D7%95%D7%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Burla_Street%2C_Nayot%2C_Jerusalem.jpg","page_title":"ניות","context_page_description":"ניות היא שכונה בדרום-מרכז ירושלים, שהוקמה בשנת 1960. השכונה ממוקמת בסמוך לגבעת רם ולעמק המצלבה, בין השכונות רחביה, רסקו, גבעת מרדכי ונווה שאנן. היא בנויה ממבנים מוארכים דו-קומתיים, \\"בלוקים\\"."},{"page_url":"https://en.wikipedia.org/wiki/Jim_Slaton","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Jim_Slaton_-_Milwaukee_Brewers.jpg","page_title":"Jim Slaton","context_page_description":"James Michael Slaton is a former pitcher with a 16-year career from 1971-1986. He played in the American League with the Milwaukee Brewers from 1971–1977 and 1979–1983, the Detroit Tigers in 1978 and 1986, and the California Angels from 1984-1986."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BB%D0%B0%D0%BC%D0%B0%D0%BD%D0%B4%D0%B5%D1%80_(%D0%9A%D0%BE%D1%80%D0%BD%D0%B2%D0%B5%D1%81%D1%82%D1%85%D0%B0%D0%B9%D0%BC)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Bundesarchiv_B_145_Bild-P008144%2C_Kornwestheim%2C_Salamander-Schuhfabrik.jpg","page_title":"Саламандер (Корнвестхайм)","context_page_description":"Фабрика «Саламандер» — бывшее здание обувной фабрики «Саламандер», располагающееся в баден-вюртембергском городе Корнвестхайм; первая штаб-квартира компании «J. Sigle & Cie.», сегодня являющаяся местом расположения торгового центра, офисных помещений и центральный земельного кадастра федеральной земли Баден-Вюртемберг. Кирпичное здание было построено в 1885 году и расширено до 77 000 квадратных метров в 1923; является городским памятником архитектуры."},{"page_url":"https://sv.wikipedia.org/wiki/Agave_pachycentra","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Agave_pachycentra_1.jpg","page_title":"Agave pachycentra","context_page_description":"Agave pachycentra är en sparrisväxtart som beskrevs av William Trelease. Agave pachycentra ingår i släktet Agave och familjen sparrisväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://sl.wikipedia.org/wiki/Znojmo","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Znojmo-The_Underground_Passages_1.jpg","page_title":"Znojmo","context_page_description":"Znojmo je mesto v Južni Moravski na Češkem, tudi upravno središče okrožja Znojmo."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%83%D0%B4%D0%BE%D0%BB,_%D0%AD%D0%BB%D0%B8%D1%81%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Alison_Sudol_by_Gage_Skidmore_%282%29.jpg","page_title":"Судол, Элисон","context_page_description":"Элисон Лорен Судол, известна как A Fine Frenzy — американская альтернативная певица, композитор и пианистка. Её дебютный альбом «One Cell in the Sea» был выпущен в 2007 году, затем в 2009 году вышел второй студийный альбом «Bomb in a Birdcage». Судол попала в музыкальные чарты США, Германии, Австралии, Швейцарии, Польши и Франции, а также других стран. Её музыка была отмечена в многочисленных телевизионных шоу, а также использовалась в нескольких крупных кинофильмах."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E9%B1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Mottenfl%C3%BCgel_in_Mikroskop.jpg","page_title":"鱗","context_page_description":"鱗，又叫鱗片，動物皮上細片，硬身，保護自己之用。昆蟲之中，鱗翅目好似蝶蛾咁，翼上有鱗，鱗色千變萬化。鱗極之常見，動物品種相異，都演化到鱗，有種種用處，亦有種構造。\\n鱗時時歸入表皮系統，內裏歸類，就跟品種屬綱同形狀而定。"},{"page_url":"https://bs.wikipedia.org/wiki/Darda","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Pogled_sa_silosa_-_panoramio.jpg","page_title":"Darda","context_page_description":"Darda je naseljeno mjesto i općina u Hrvatskoj, u Osječko-baranjskoj županiji."},{"page_url":"https://en.wikipedia.org/wiki/Omnia_(DJ)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Omnia.jpg","page_title":"Omnia (DJ)","context_page_description":"Evgeny Smirnov, better known by his stage name Omnia, is a Ukrainian DJ and music producer, born May 18, 1987 in Donetsk. His music is a blend of trance and progressive house sounds. He has been included twice in the DJ Mag Top 100 DJs poll."},{"page_url":"https://vec.wikipedia.org/wiki/Saint-Cl%C3%A9ment_(Yonne)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b0/02stclement.jpg","page_title":"Saint-Clément (Yonne)","context_page_description":"Saint-Clément el xé on comun de 2 756 abitanti del departemento de Yonne che el fa parte del rejon Bourgogne-Franche-Comté in Fransa."},{"page_url":"https://es.wikipedia.org/wiki/Nicky_Degrendele","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Nicky_Degrendele_2016-17_WCup_Apeldoorn.jpg","page_title":"Nicky Degrendele","context_page_description":"Nicky Degrendele es una deportista belga que compite en ciclismo en la modalidad de pista, especialista en la prueba de keirin.\\nGanó dos medallas en el Campeonato Mundial de Ciclismo en Pista, oro en 2018 y bronce en 2017, y dos medallas de plata en el Campeonato Europeo de Ciclismo en Pista, en los años 2016 y 2018.​"},{"page_url":"https://it.wikipedia.org/wiki/Yasodharapura","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/The_new_capital_was_named_Yasodharapura.jpg","page_title":"Yasodharapura","context_page_description":"Yaśodharapura fu la capitale dell'impero Khmer nel suo periodo di maggior splendore. Il sito che la ospitava è oggi universalmente noto come Angkor, ma si tratta di un termine entrato in uso quando oramai era pressoché disabitato, come testimoniato da iscrizioni su pietra che ancora agli inizi del XIV secolo citano la capitale col nome originario. Il suo nucleo venne riedificato più volte, mantenendo il nome originario anche nella sua ultima incarnazione: la città cinta da possenti mura edificata da Jayavarman VII, oggi nota come Angkor Thom."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Loiching","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Heimlichleiden1.jpg","page_title":"Liste der Baudenkmäler in Loiching","context_page_description":"Auf dieser Seite sind die Baudenkmäler der niederbayerischen Gemeinde Loiching zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://da.wikipedia.org/wiki/Sucuk","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Sudzhuk_from_Armenia_2.JPG","page_title":"Sucuk","context_page_description":"Sucuk er en tør, krydret pølse oprindeligt fra det tyrkiske Mellemøsten. Pølsen spises også på Balkan og i centralasien."},{"page_url":"https://nl.wikipedia.org/wiki/De_Bueren","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Kasteel_de_Bueren_-_Melle-Kwatrecht_6-3-2018_15-50-26.JPG","page_title":"De Bueren","context_page_description":"De Bueren was een Belgische adellijke familie."},{"page_url":"https://fa.wikipedia.org/wiki/%DB%8C%D9%88%D8%A7%D8%B3%E2%80%8C%D8%A7%D8%B3_%D9%BE%D8%A7%DB%8C%D9%88%D9%86%DB%8C%D8%B1_(%D8%A7%D9%85%E2%80%8C%D8%B3%DB%8C%E2%80%8C%D8%A7%D9%85-%DB%B9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/USS_Pioneer_%28MCM-9%29_starboard_side_4.JPG","page_title":"یواس‌اس پایونیر (ام‌سی‌ام-۹)","context_page_description":"یواس‌اس پایونیر (ام‌سی‌ام-۹) یک کشتی است که طول آن ۲۲۴ فوت می‌باشد. این کشتی در سال ۱۹۹۰ ساخته شد."},{"page_url":"https://hu.wikipedia.org/wiki/Reykjanes-f%C3%A9lsziget","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Salt_lake_at_Reykjanesskagi.jpg","page_title":"Reykjanes-félsziget","context_page_description":"A Reykjanes-félsziget Izland fővárosa, Reykjavík mellett található, a sziget délnyugati részén. A vulkáni utóműködés számos hőforrást és kénforrást táplál a félsziget déli részén a Kleifarvatn tó környékén a Krýsuvík geotermális területen. Itt található a Svartsengi geotermális erőmű, amelynek közelében az erőműből származó meleg víz hasznosítására egy uszodát hoztak létre, amelynek vize számos ásványi anyagot tartalmaz. A helyiek „Kék lagúnaként” emlegetik.\\nA „Szerencsés Leif” híd ível át a Grindavík melletti Alfagjá hasadékvölgy felett. Ezen a helyen találkozik az eurázsiai és az észak-amerikai kontinentális lemez, pontosabban itt válnak szét. A hidat 2002-ben adták át, majd Leif Eriksson izlandi felfedező tiszteletére nevezték el, aki Európából 500 évvel korábban jutott el Amerikába, mint Kolumbusz Kristóf.\\nA félsziget partvidékén néhány halászkikötő is található, mint például Grindavík és Njarðvík. A félszigeten található Keflavík is, amely a Keflavík nemzetközi repülőtérnek ad otthont, illetve a Leifur Eriksson légikikötőnek."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%AC%D9%86_%D9%85%D8%A7%D8%A4_%D9%B9%D8%A7%D9%88%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Jin_Mao_Building-2005.JPG","page_title":"جن ماؤ ٹاور","context_page_description":"جن ماؤ بلڈنگ یا جن ماؤ ٹاور چین کے شہر شنگھائی کی ایک 88 منزلہ عمارت ہے جو دنیا کی اولین 10 بلند ترین عمارات میں شامل ہے۔ اس عمارت میں دفاتر اور شنگھائی کا گرینڈ حیات ہوٹل بھی واقع ہے۔ 2005ء کے مطابق یہ چین کی سب سے بلند اور دنیا میں پانچویں سب سے بلند عمارت ہے۔ چین کی بلند ترین عمارت ہونے کا اعزاز 2008ء میں شنگھائی ورلڈ فنانشل سینٹر نامی عمارت کو مل جائے گا جو اس وقت زیر تعمیر ہے۔\\nعمارت میں قائم گرینڈ حیات ہوٹل 53 ویں سے 87 ویں منزل تک واقع ہے جس میں 555 کمرے ہیں۔ یہ زمین سے سب سے زیادہ بلندی پر واقع ہوٹل ہے تاہم مکمل طور پر ہوٹل کی عمارت ہونے کے باعث سب سے زیادہ بلند ہوٹل کی عمارت برج العرب ہے جو متحدہ عرب امارات کے شہر دبئی میں قائم ہے۔\\nعمارت کی 88 ویں منزل ہوٹل کا حصہ نہیں بلکہ 1520 مربع میٹر پر پھیلا ہوا ایک مشاہداتی عرشہ ہے جہاں ایک ہزار سے زائد افراد کی گنجائش ہے۔ یہاں سے پورے شنگھائی شہر کا انتہائی دلکش نظارہ دیکھنے کو ملتا ہے۔\\nعمارت میں نصب کی گئی لفٹیں 9.1 میٹر فی سیکنڈ کی رفتار سے چلتی ہیں اور محض 45 سیکنڈ میں نچلی منزل سے 88 ویں منزل پر پہنچادیتی ہیں۔\\n5 اکتوبر 2003ء کو چین کے قومی دن کے موقع پر فضاء سے چھلانگ لگانے والے ایک بین الاقوامی گروپ نے جن ماؤ ٹاور کی چھت سے چھلانگ لگائی۔"},{"page_url":"https://ca.wikipedia.org/wiki/Fangdiekgraben","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/88/Eidelsteed_-_Fangdiekgraben_-_Muehlenau.jpg","page_title":"Fangdiekgraben","context_page_description":"El Fangdiekgraben també anomenat Fangdieckgraben és un riu d'Hamburg.\\nNeix a Lurup, sorgeix de la seva vida entubada a prop del carrer Elbgaustraße i desemboca al Mühlenau a Eidelstedt. El seu nom prové del Fangdiek, un mot baix alemany que significa conca de dipòsit. El rierol que va degenerar a l'era industrial del segle passat, va ser adoptat per a una escola veïna, el Goethe Gymnasium i després pel grup Seilmanns Natur-Ranger -que van treure'l de la seva triste sort monofuncional d'evacuador d'aigua excedentària a un medi ambient estimat per a una varietat creixent de fauna i de flora. Van posar-hi grava o blocs erràtics, van plantar verònica beccabunga. El concurs de totes aquestes intervencions va conduir a un èxit ecològic: més diversitat, més espècies, menys de pol·lució.\\nFotos del naixement cap a la desembocadura:"},{"page_url":"https://nl.wikipedia.org/wiki/Strumigenys_consanii","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Strumigenys_consanii_inbiocri001284017_profile_1.jpg","page_title":"Strumigenys consanii","context_page_description":"Strumigenys consanii is een mierensoort uit de onderfamilie van de Myrmicinae. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1954 door Brown."},{"page_url":"https://eo.wikipedia.org/wiki/Taviano","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/97/Piazza_Taviano.jpg","page_title":"Taviano","context_page_description":"Taviano estas komunumo de Italio. Ĝi apartenas al la regiono Apulio kaj al la provinco Lecce. Fine de 2018 en la komunumo vivis 11 972 loĝantoj. Najbaras la komunumoj Gallipoli, Matino, Melissano kaj Racale. Kristanisma patrono de la komunumo estas la sanktulo Marteno de Tours, kies religia memortago sekve estas la komunuma festotago."},{"page_url":"https://de.wikipedia.org/wiki/Riemenzungen","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Comperia_comperiana2.jpg","page_title":"Riemenzungen","context_page_description":"Die Gattung der Riemenzungen in der Familie der Orchideen enthält nur wenige Arten. Sie sind in den wärmeren Gebieten Europas beheimatet, lediglich die Bocks-Riemenzunge kommt auch im Norden Europas vor."},{"page_url":"https://sl.wikipedia.org/wiki/Nebesni_disk_iz_Nebre","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/1600_Himmelsscheibe_von_Nebra_sky_disk_anagoria.jpg","page_title":"Nebesni disk iz Nebre","context_page_description":"Nebesni disk iz Nebre je bronast disk s premerom približno 30 centimetrov in težo 2,2 kilograma, z modro-zeleno patino in intarzijo z zlatimi simboli. Te se običajno razlaga kot sonce ali polna luna, lunarni polmesec in zvezde. Kasneje sta bila dodana dva zlata loka ob straneh, ki označujeta kot med solsticiji. Končni dodatek je bil še en lok na dnu, obdan z več potezami.\\nDisk je pripisan najdišču v bližini Nebre, Saška-Anhalt, v Nemčiji in asociativno datiran v c. 1600 pr. n. št., povezan je z bronastodobno Unjetiško kulturo. Disk ni podoben nobenemu znanemu umetniškemu slogu iz tistega obdobja in je bilo sprva stališče zgodovinarjev, da je ponaredek, zdaj pa je splošno sprejet kot verodostojen.\\nNebesni disk iz Nebre je najstarejša znana konkretna upodobitev vesolja na svetu. Junija 2013 je bil vključen v Unescov register svetovnega spomina in imenovan za »eno najpomembnejših arheoloških najdb v 20. stoletju«."},{"page_url":"https://es.wikipedia.org/wiki/Boomerang_(canal_de_televisi%C3%B3n)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Boomerang-From-Cartoon-Network.png","page_title":"Boomerang (canal de televisión)","context_page_description":"Boomerang es un canal de televisión por suscripción de origen estadounidense que se especializa en emitir programación clásica y contemporánea de la biblioteca audiovisual de WarnerMedia, incluyendo a los Looney Tunes, Tom y Jerry y Scooby-Doo, junto con repeticiones de series en producción del canal hermano Cartoon Network, en los que se incluye a Sonic Boom y The Powerpuff Girls. Es propiedad de WarnerMedia y es operado por medio de Warner Bros. Entertainment.​\\nLanzado en 1992 a nivel internacional y en el 2000 en los Estados Unidos, Boomerang fue al principio un bloque de programación y una extensión de Cartoon Network. Al final, este bloque se separó y se convirtió en un canal independiente con su propia identidad gráfica, con la misma marca comercial y similitud hacia Cartoon Network. Posee un horario de programación fluido e improvisado de bloques de programación y series de televisión —ambas de índole temporal—, con una programación ininterrumpida sin cortes comerciales.\\nHasta febrero de 2015, cerca de 43.6 millones de hogares pueden sintonizar el canal."},{"page_url":"https://cs.wikipedia.org/wiki/Lenny_White","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Lenny_White.jpg","page_title":"Lenny White","context_page_description":"Lenny White je americký bubeník. Počátkem sedmdesátých let hrál ve skupině Azteca a v letech 1973−1976 a znovu v letech 1983, 2008 a od roku 2010 dodnes působí ve skupině Return to Forever. Koncem osmdesátých let byl členem kapely Jamaica Boys. Vydal také několik sólových alb; v roce 2004 vydal album Tribute to Earth, Wind and Fire na kterém předělal skladby skupiny Earth, Wind & Fire. Rovněž spolupracoval s dalšími hudebníky, mezi něž patří Marcus Miller, Chaka Khan, Joe Henderson, Freddie Hubbard a v roce 1969 hrál na albu Bitches Brew trumpetisty Milese Davise."},{"page_url":"https://tg.wikipedia.org/wiki/%D0%A1%D0%B0%D1%84%D0%B5%D0%B4%D0%BE%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Populier_Populus_canadensis.jpg","page_title":"Сафедор","context_page_description":"Сафедор — ҷинси дарахтест аз оилаи бедиҳо."},{"page_url":"https://de.wikipedia.org/wiki/Bernstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Magdalenenberg_collier.jpg","page_title":"Bernstein","context_page_description":"Bernstein bezeichnet den seit Jahrtausenden bekannten und insbesondere im Ostseeraum weit verbreiteten klaren bis undurchsichtigen gelben Schmuckstein aus fossilem Harz.\\nDamit ist überwiegend nur ein bestimmtes fossiles Harz gemeint, dieser Bernstein im engeren Sinne ist die Bernsteinart mit dem wissenschaftlichen Namen Succinit. Die Bezeichnungen Succinit und Baltischer Bernstein werden oft synonym verwendet, da Succinit den weitaus überwiegenden Teil des Baltischen Bernsteins ausmacht. Die anderen fossilen Harze im Baltischen Bernstein stammen von unterschiedlichen Pflanzenarten und werden auch als „Bernstein im weiteren Sinne“ bezeichnet. Manche kommen mit dem Succinit zusammen vor, z. B. die schon lange aus den baltischen Vorkommen bekannten Bernsteinarten Gedanit, Glessit, Beckerit und Stantienit. Diese werden auch als akzessorische Harze bezeichnet. Andere fossile Harze verschiedener botanischer Herkunft bilden hingegen eigenständige Lagerstätten unterschiedlichen geologischen Alters, wie z. B. der Dominikanische Bernstein und der Libanon-Bernstein."},{"page_url":"https://da.wikipedia.org/wiki/Keeping_Up_with_the_Kardashians","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Keeping_Up_with_the_Kardashians_s11_logo.png","page_title":"Keeping Up with the Kardashians","context_page_description":"Keeping Up with the Kardashians er en amerikansk reality tv-serie som har været udsendt siden den 14. oktober 2007 på E,\\nmen bliver den dag i dag sendt på Hayu. Serien fokuserer på det personlige og professionelle liv i Kardashian- og Jennerfamilien.\\nSerien fokuserer på søstrene Kim, Kourtney og Khloé Kardashian, men derudover ses deres bror Rob Kardashian, deres mor Kris Jenner, deres stedfar Bruce Jenner - nu Caitlyn Jenner, deres halvsøstre Kendal og Kylie Jenner, og Kourtney's kæreste Scott Disick. Khloé's eksmand Lamar Odom blev til en vigtig del af at lave klippene i fjerde sæson, selvom at han ikke var en man fik set i de efterfølgende sæsoner, og sjældent set i sæson 8 hvor han dog prøvede at få sit ægteskab med Khloé tilbage igen.\\nKeeping Up with the Kardashians har modtaget rigtig gode anmeldelser fra anmeldere. Men alligevel kritiseres de for at være \\"kendt for at være kendt\\".\\nSøstrene og familien generelt er ofte i medierne:\\nKourtney Kardashian har tre børn med Scott Disick. Parret har haft et turbulent forhold pga. Scott har haft et misbrug, hvilket blev forværret da hans mistede sine forældre kort tid efter hinanden grundet sygdom."},{"page_url":"https://de.wikipedia.org/wiki/Anastas_Mikojan","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Bundesarchiv_Bild_183-24000-0339%2C_Berlin%2C_IV._SED-Parteitag%2C_Pieck%2C_Mikojan.jpg","page_title":"Anastas Mikojan","context_page_description":"Anastas Iwanowitsch Mikojan war ein sowjetischer Politiker armenischer Herkunft."},{"page_url":"https://fi.wikipedia.org/wiki/Tukkilaiskisat","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Diploma_for_Log_driver_competitions_in_Finland.jpg","page_title":"Tukkilaiskisat","context_page_description":"Tukkilaiskisat on uittoperinnettä. Kilpailusta voidaan käyttää myös nimitystä tukkilaiset. Alun perin tukkilaiset olivat uittomiehiä, mutta uitto on kadonnut Suomen joilta. Tukkilaistaidot, joita esitellään tukkilaiskisoissa ja -näytöksissä, ovat säilyneet. Tukkilaiskisoja järjestetään kesäjuhlien yhteydessä kisoihin soveltuvissa koskissa. Kilpailuihin kuuluu useita lajeja: koskenlasku tukilla, sauvonta, puomillajuoksu, rullaus, sestominen, soutu."},{"page_url":"https://sv.wikipedia.org/wiki/Viggo_Mortensen","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Viggo_Mortensen_Cannes_2016.jpg","page_title":"Viggo Mortensen","context_page_description":"Viggo Peter Mortensen Jr., född 20 oktober 1958 i New York, New York, är en amerikansk-dansk skådespelare, musiker, poet, konstnär och fotograf. Mortensen har medverkat i filmer som Sagan om ringen, Hidalgo, Ett perfekt mord, A History of Violence och Eastern Promises."},{"page_url":"https://tr.wikipedia.org/wiki/T%C3%BCrkiye_faunas%C4%B1","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ed/Cappadocia_074_n.jpg","page_title":"Türkiye faunası","context_page_description":"Türkiye direyi, hayvanlar âleminin Türkiye sınırları içerisinde yaşayan üyelerinin tümüdür. Birçok farklı hayvan türünü barındırması ile dikkat çeker. Anadolu'nun Asya ile Avrupa arasındaki konumu bunda başlıca etkendir. Farklı iklim özelliklerinde coğrafi bölgelere sahip olduğu için, bitki örtüsünün diğer Orta Doğu ülkelerine göre daha zengin olması ise diğer önemli etkendir ve bu yüzden, farklı iklim ve besin ihtiyacı olan birçok hayvan türü kendisine uygun yaşam alanı bulabilmektedir.\\nBöylece, Türkiye'de yalnızca Akdeniz direyinin değil, Orta ve Doğu Avrupa, Orta Doğu, Kafkaslar ve Arap Yarımadası direylerinin de tipik türleri bulunmaktadır. Ayrıca Avrupa ülkeleri ile karşılaştırıldığında, çok daha fazla memeli tür barındırır ve bu da Türkiye direyinin ne tipik Avrupa direyine ne de tipik Orta Doğu direyine sınıflandırılabildiğini gösterir.\\nTürkiye direyine ait 160 memeli, 466 kuş, 120 sürüngen, 22 kurbağa, 127 tatlısu balığı, 384 deniz balığı olmak üzere toplam 1279 civarında omurgalı tür tanınır. Ama bu türlerin bazıları tamamen tükenmek üzeredir, bazıları da tehlike altında bulunmaktadır."},{"page_url":"https://pl.wikipedia.org/wiki/Igor_Andrejew","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Igor_Andriejew_gr%C3%B3b.JPG","page_title":"Igor Andrejew","context_page_description":"Igor Andrejew – polski prawnik, profesor nauk prawnych, nauczyciel akademicki Wydziału Prawa i Administracji Uniwersytetu Warszawskiego."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%9E%A3%E8%8A%B1%E9%85%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/35/Blurred_polyphenols-rich_nutritionlabel_us.png","page_title":"鞣花酸","context_page_description":"鞣花酸是存在於眾多水果和蔬菜中的天然酚類抗氧化劑，包括黑莓、覆盆子、草莓、蔓越莓、山核桃、石榴、枸杞等植物。鞣花酸的抗增生和抗氧化特性，刺激了對鞣花酸潛在價值的研究。"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A4%D0%9A_%D0%9B%D0%B5%D1%85%D0%B8%D1%98%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/PGE_Arena.jpeg","page_title":"ФК Лехија","context_page_description":"ФК Лехија је пољски фудбалски клуб из града Гдањска. Основан је 1945., а основали су га становници Лавова, у жељи да их подсећа на ФК Лехија Лавов. Од 2011. клуб своје утакмице игра на ПГЕ арени, стадиону који је саграђен за потребе Европског првенства у фудбалу 2012. и који има капацитет од 43.615 седећих места.\\nЛехија је била најјача 50-их година 20. века, а све до осамдесетих година нису играли у 1. лиги, а последњи пут су играли 1996. године, пре него што су се у сезони 2007/08. поново пласирали у Екстракласу.\\nИграли су у Купу победника купова у сезони 1983/84. и то против Јувентуса из Торина и изгубили су са укупно 2:10."},{"page_url":"https://de.wikipedia.org/wiki/Porsche_906","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Porsche_906%2C_Bj._1966_%282011-08-13_Sp%29.JPG","page_title":"Porsche 906","context_page_description":"Der Porsche 906, offiziell vertrieben als Carrera 6, war ein Rennwagen der Porsche KG. Das ab Frühjahr 1966 ausgelieferte Coupé war eine Entwicklung auf Basis des bereits 1965 in der Europa-Bergmeisterschaft eingesetzten Porsche 906 Bergspyders und Nachfolger des Porsche 904.\\n1966 setzte das Werksteam den 906 in der Sportwagen-Weltmeisterschaft und in der Europa-Bergmeisterschaft ein, die Gerhard Mitter mit dem Wagen gewann. In der Markenweltmeisterschaft siegte Porsche in der 2-Liter-Prototypen- und 2-Liter-Sportwagen-Klasse.\\nVon 1967 bis 1971 fuhren nur noch private Teams den Porsche 906 in der Sportwagen-Weltmeisterschaft, Europa-Bergmeisterschaft und nationalen Meisterschaften."},{"page_url":"https://es.wikipedia.org/wiki/Bachy","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Bachy_Mairie.jpg","page_title":"Bachy","context_page_description":"Bachy es una población y comuna francesa, en la región de Norte-Paso de Calais, departamento de Norte, en el distrito de Lille y cantón de Cysoing."},{"page_url":"https://en.wikipedia.org/wiki/Farkadona","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Dimos_Farkadonas_Topo.png","page_title":"Farkadona","context_page_description":"Farkadona is a municipality in the southeastern Trikala regional unit, part of Thessaly in Greece. In 2011 its population was 2,652 for the town and 13,396 for the municipality. It is located about halfway between the cities Larissa to the east, and Trikala to the west, at about 30 km from both. It is situated in the Thessalian Plain, near the river Pineios. Farkadona is on the Greek National Road 6."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D0%B0-%D0%9C%D0%B0%D0%B9%D1%80%D0%B5-%D1%81%D1%8E%D1%80-%D0%A1%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/La_Mailleraye-sur-Seine.JPG","page_title":"Ла-Майре-сюр-Сен","context_page_description":"Ла-Майре́-сюр-Сен — муніципалітет у Франції, у регіоні Верхня Нормандія, департамент Приморська Сена. Населення — 2053 осіб.\\nМуніципалітет розташований на відстані близько 135 км на північний захід від Парижа, 25 км на захід від Руана."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BD-%D0%9F%D0%B0%D1%83%D0%BB%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Cicero_pompeu_de_toledo_-_panoramic_-_01.jpg","page_title":"Сан-Паулу","context_page_description":"Сан-Па́улу — город на юго-востоке Бразилии, столица одноимённого штата. Самый населенный город в пределах страны, континента, португалоязычного сообщества и всего Южного полушария. Расположен в долине реки Тиете, в 70 км от побережья Атлантического океана.\\nГород носит имя апостола Павла, в день памяти которого он был основан иезуитами на месте индейского поселения 25 января в 1554 году.\\nПлощадь города составляет 523 км², а население — 11,3 млн человек, что делает его третьим по численности населения городом в Западном полушарии.\\nАрхитектурный образ города создан смешением самых разных эпох и стилей. В Сан-Паулу сохранилось множество старинных зданий, музеев и церквей. В то же время Сан-Паулу — один из самых современных городов, основная его часть застроена небоскрёбами из стекла и металла, включая второй по высоте небоскрёб Бразилии — Миранти-ду-Вали. Подобное соседство стилей не выглядит надуманным и чужеродным — наоборот, древняя церковь может гармонично смотреться на фоне самого современного здания.\\nДевиз на гербе: лат. NON DVCOR DVCO — «Не мной управляют, а я управляю»."},{"page_url":"https://de.wikipedia.org/wiki/Grogarnsberget","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Grogarnsberget_%2817%29.JPG","page_title":"Grogarnsberget","context_page_description":"Grogarnsberget ist eine ehemalige Höhenburg in Östergarn auf der schwedischen Insel Gotland und gehört neben der Torsburg zu den vier größten vorgeschichtlichen Wallburgen Skandinaviens.\\nDie Burg lag auf dem Grogarnshaupt, der Nordspitze des Grogarnberges. Der 30 m hohe aufs Meer hinausragende Felsen bietet Schutz nach drei Seiten. Im Süden wurden zwei bis zu 100 Meter lange Steinwälle aufgeschichtet, die wahrscheinlich Palisaden trugen. Von der Burg aus kann man die übrigen großen Burgen dieser Region sehen. Bei archäologischen Untersuchungen der äußeren Wallanlage wurden Pfeilspitzen aus der späten Vendelzeit entdeckt, die einen Anhaltspunkt für die Datierung der Burg liefern. Gefundene Holzpfosten, vermutlich ehemals Teil der Palisaden, konnten auf das Jahr 740 datiert werden.\\nIm Westen, Osten und Süden liegen die historischen Häfen Katthammarsvik, Herrvik und Sandviken, die Ausgangspunkte für Fahrten ins Baltikum darstellen. Die Häfen gehen wahrscheinlich auf vendel- und wikingerzeitliche Häfen in der damals tief eingeschnittenen Bucht zwischen dem Östergarns- und dem Grogarnsberg zurück.\\nAuf Gotland sind 82 derartige Burganlagen bekannt."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D1%83%D0%BD%D1%8C_%D0%AF%D1%82%D1%81%D0%B5%D0%BD_(%D0%BC%D0%BE%D0%BD%D1%96%D1%82%D0%BE%D1%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/%D0%98%D0%BB%D0%BB%D1%8E%D1%81%D1%82%D1%80%D0%B0%D1%86%D0%B8%D1%8F_%D0%BA_%D1%81%D1%82%D0%B0%D1%82%D1%8C%D0%B5_%C2%AB%D0%90%D0%BC%D1%83%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D1%84%D0%BB%D0%BE%D1%82%D0%B8%D0%BB%D0%B8%D1%8F%C2%BB_%E2%84%96_2._%D0%92%D0%BE%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D1%8D%D0%BD%D1%86%D0%B8%D0%BA%D0%BB%D0%BE%D0%BF%D0%B5%D0%B4%D0%B8%D1%8F_%D0%A1%D1%8B%D1%82%D0%B8%D0%BD%D0%B0_%28%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3%2C_1911-1915%29.jpg","page_title":"Сунь Ятсен (монітор)","context_page_description":"Сунь Ятсен — канонерський човен, у часи СРСР класифікувався як монітор, броненосний артилерійський корабель прибережної дії ВМФ СРСР. Брав участь у радянсько-японській війні. За героїзм особового складу отримав почесне найменування «Гвардійський»."},{"page_url":"https://eo.wikipedia.org/wiki/Torecko","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/%22%D0%A2%D0%BE%D1%80%D0%B5%D1%86%D1%8C%D0%BA_-_%D0%BC%D1%96%D1%81%D1%82%D0%BE_%D1%88%D0%B0%D1%85%D1%82%D0%B0%D1%80%D1%96%D0%B2%22_-_%D0%BD%D0%B0%D0%BF%D0%B8%D1%81_%D0%BD%D0%B0_%D0%BF%D0%B0%D0%B3%D0%BE%D1%80%D0%B1%D1%96_%D0%BF%D0%B5%D1%80%D0%B5%D0%B4_%D1%88%D0%B0%D1%85%D1%82%D0%BE%D1%8E_%D1%96%D0%BC%D0%B5%D0%BD%D1%96_%D0%94%D0%B7%D0%B5%D1%80%D0%B6%D0%B8%D0%BD%D1%81%D1%8C%D0%BA%D0%BE%D0%B3%D0%BE.jpg","page_title":"Torecko","context_page_description":"Torecko estas urbo de regiona signifo en la oriento de Ukrainio."},{"page_url":"https://de.wikipedia.org/wiki/Samsonfigur","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/df/Samson-ramingstein-mit-kapelle-3.jpg","page_title":"Samsonfigur","context_page_description":"Samsonfiguren sind eine spezielle Form von Umzugsriesen, großen Figuren, die bei verschiedenen Arten von Festumzügen getragen werden. Ein Teil der in mehreren europäischen Ländern populären Umzugsriesen stellt biblische oder mythologische Riesen dar. Vierzehn dieser Figuren sind überlebensgroße Nachbildungen des biblischen Samson mit der Ausrüstung eines römischen Legionärs oder eines Soldaten aus der napoleonischen Zeit. Sie bestehen aus Holz oder Leichtmetall und werden bei traditionellen Straßenumzügen von je einer Person getragen. Es gibt sie in Ath, im Westen der Wallonie, und im inneralpinen Österreich. Die mittlerweile 13 Samsonfiguren im Lungau und in der angrenzenden Steiermark werden auf ihren Umzügen von der Musikkapelle und teilweise von zwei Hilfsfiguren in Form je eines männlichen und weiblichen Zwergs, von Schützen und von Volkstanzgruppen begleitet. Die Samsonfigur von Ath ist eine mehrerer Riesen-Figuren des jährlichen Festivals Ducasse d’Ath.\\nDas Samsontragen im Lungau und Bezirk Murau wurde 2010 in die Liste Immaterielles Kulturerbe in Österreich aufgenommen."},{"page_url":"https://he.wikipedia.org/wiki/%D7%93%D7%90%D7%92%D7%9C%D7%A1_%D7%94%D7%99%D7%99%D7%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Douglas_Haig.jpg","page_title":"דאגלס הייג","context_page_description":"פילדמרשל דאגלס הייג, הרוזן הראשון של הייג. היה גנרל בריטי שהתפרסם בזכות לחימתו במלחמת העולם הראשונה."},{"page_url":"https://pl.wikipedia.org/wiki/Pierwszy_gabinet_Henry%E2%80%99ego_Pelhama","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/William_Stanhope%2C_1st_Earl_of_Harrington.jpg","page_title":"Pierwszy gabinet Henry’ego Pelhama","context_page_description":"Henry Pelham został powołany na stanowisko premiera Wielkiej Brytanii 27 sierpnia 1743 r. 10 lutego 1746 r. podał swój pierwszy gabinet do dymisji. Powrócił na stanowisko kilka dni później."},{"page_url":"https://es.wikipedia.org/wiki/Cartel_de_cine","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Douglas_Fairbanks_Robin_Hood_1922_film_poster.jpg","page_title":"Cartel de cine","context_page_description":"Un cartel de cine es un cartel que se usa para anunciar una película. En su origen solían incluir escenas significativas del filme o imágenes de los actores principales o sus nombres; más tarde se añadió el nombre del director y a veces un logo o imagen representativa o, en su caso, los premios obtenidos.​ Comenzaron como publicidad exterior anunciando el programa de las películas o cortos que se mostraban dentro de las nacientes salas de representación. El uso inicial de ilustraciones más o menos artísticas dentro de una cierta variedad de estilos y acompañadas de textos escritos a mano, cuadros horarios y frases publicitarias, fue luego sustituido por montajes fotográficos y diseños digitales de imagen.​\\nEl uso del cartel es común en los expositores exteriores e interiores de las salas de cine -junto a las tarjetas o programas de mano- y en todo tipo de vallas publicitarias de la calle. Las mismas imágenes aparecen en el álbum de prensa de la película y también se puede utilizar en los sitios web, la carátula del DVD, el ocasional CD de la banda musical, la publicidad ambulante, los anuncios en periódicos y revistas, etc."},{"page_url":"https://en.wikipedia.org/wiki/Carlos_Amorales","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Carlos_Amorales_Studio.jpg","page_title":"Carlos Amorales","context_page_description":"Carlos Amorales is a multidisciplinary artist who studied at the Gerrit Rietveld Academy and the Rijksakademie in Amsterdam. The most extensive researches in his work encompass Los Amorales, Liquid Archive, Nuevos Ricos, and a typographic exploration in junction with cinema."},{"page_url":"https://nl.wikipedia.org/wiki/Kabinet-Lubbers_I","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Caspar_W._Weinberger_hosts_an_Armed_Forces_Full_Honors_Arrival_Ceremony_for_Job_de_Ruiter_outside_the_Pentagon_-_HD-SC-98-07496.jpg","page_title":"Kabinet-Lubbers I","context_page_description":"Het kabinet-Lubbers I was het Nederlandse kabinet van 4 november 1982 tot 14 juli 1986. Het kabinet werd gevormd door de politieke partijen Christen-Democratisch Appèl en de Volkspartij voor Vrijheid en Democratie na de Tweede Kamerverkiezingen van 1982. Het centrum-rechtse kabinet-Lubbers I was een meerderheidskabinet dat zowel in de Eerste Kamer en Tweede Kamer kon rekenen op een ruime meerderheid. Het kabinet-Lubbers I was het eerste kabinet waarin een nieuwe minister-president afkomstig was van de zelfde partij als zijn voorganger sinds het kabinet-Cals in 1965.\\nHet kabinet-Lubbers I maakte zijn volledige termijn vol. Op 24 mei 1986 bood de premier het ontslag aan van zijn kabinet, daarmee werd het kabinet demissionair."},{"page_url":"https://fr.wikipedia.org/wiki/Odilon_Redon","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/16_sep_13_redon.jpg","page_title":"Odilon Redon","context_page_description":"Odilon Redon, pseudonyme de Bertrand Redon, né le 20 avril 1840 à Bordeaux et mort le 6 juillet 1916 à Paris, est un peintre et graveur symboliste français.\\nSon art explore les aspects de la pensée, la part sombre et ésotérique de l'âme humaine, empreinte des mécanismes du rêve."},{"page_url":"https://nl.wikipedia.org/wiki/Picarvie","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Saint-Valery_%28Somme%29%2C_mus%C3%A9e_Picarvie.jpg","page_title":"Picarvie","context_page_description":"Picarvie is een museum in de tot het departement Somme behorende stad Saint-Valery-sur-Somme.\\nHet museum ontstond einde jaren '80 van de 20e eeuw toen Paul Longuein, die al 30 jaar lang oude gereedschappen verzamelde, deze voor het publiek openstelde. De verzameling en het bijbehorende pand werd aangekocht door het departement.\\nIn het museum is een 19e-eeuws Picardisch dorpje gereconstrueerd met een schooltje, winkeltjes en werkplaatsen. In de laatste zijn de ambachten uitgebeeld zoals die toen beoefend werden: de slotenmaker, de hoefsmid, de fabricage van lemen wanden, het turfsteken en het vlasbewerken worden getoond, evenals een boerderij met een ciderkelder, een veestal en een paardenstal, en een woninginterieur. Bij dit alles hoort een verzameling van ongeveer 6000 gereedschappen."},{"page_url":"https://sv.wikipedia.org/wiki/Lisandro_L%C3%B3pez","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Lopez_%283%29.JPG","page_title":"Lisandro López","context_page_description":"Lisandro López, född 2 mars 1983 i Buenos Aires i Argentina, är en argentinsk fotbollsspelare som för närvarande spelar för Racing Club i den argentinska ligan. Lisandro eller ”Licha” som han också kallas i hemlandet Argentina, är I första hand en anfallare men han kan också spela på kanten. Lisandro López har även spelat för det franska fotbollslaget Olympique Lyonnais, dit han kom år 2009 från portugisiska FC Porto. Han har även spelat för det argentinska landslaget.\\nMed Porto vann han ligan och cupen säsongen 2005/2006."},{"page_url":"https://en.wikipedia.org/wiki/Nad_jazerom","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Mosty_-_panoramio_%281%29.jpg","page_title":"Nad jazerom","context_page_description":"Nad jazerom is a borough of Košice, Slovakia. The borough is situated in the Košice IV district and lies to the southeast and south of the neighbouring boroughs of Košice-Juh and Vyšné Opátske, at an altitude of roughly 192 metres above sea level."},{"page_url":"https://de.wikipedia.org/wiki/Haddekuche","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Haddekuche.jpg","page_title":"Haddekuche","context_page_description":"Haddekuche ist ein traditionelles hessisches Gebäck, eine Art rautenförmiger Pfefferkuchen, der besonders in Frankfurt und in Städten in Rheinhessen sowie Südhessen hergestellt wird oder wurde. Das hessische Wort Haddekuche heißt schlicht „Harter Kuchen“. Seinen Namen hat dieses Gebäck wohl daher, dass es relativ schnell trocknet und dann sehr hart wird.\\nHaddekuchen sind rautenförmig und mit einem Rautenmuster bedeckt, welches an das Muster auf den Frankfurter Apfelweingläsern erinnert, die Gerippten. Die Abrundungen der spitz zulaufenden Ecken sind backtechnisch bedingt und verhindern zudem Beschädigungen beim Transport.\\nSie werden in Frankfurt am Main üblicherweise von fliegenden Brezelverkäufern angeboten, die durch die Apfelweinstuben der Stadt ziehen.\\nIn Bingen wird Haddekuche auch nach wie vor traditionsgemäß angeboten. Er ist in zwei alteingesessenen Bäckereien dort das ganze Jahr über erhältlich. Statt des Rautenmusters ist er mit groben Zuckerkristallen bestreut.\\nDer Haddekuche ist auch vereinzelt noch in Mainz und Alzey erhältlich. Haddekuche kann als Soßenlebkuchen Verwendung finden, z. B. zum Würzen von Sauerbraten."},{"page_url":"https://es.wikipedia.org/wiki/San_Luis_Potos%C3%AD_(ciudad)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/SIERRA_DE_ALAVAREZ_SAN_LUIS_POTOSI_MEXICO.JPG","page_title":"San Luis Potosí (ciudad)","context_page_description":"San Luis Potosí es una ciudad y municipio mexicano, capital y ciudad más poblada del estado de San Luis Potosí, La ciudad se encuentra en la zona centro norte del estado, sede de los poderes ejecutivo, legislativo y judicial del estado. Cuenta con una altitud media sobre el nivel del mar de 1860 msnm. Desde 2005, la mancha urbana colinda con los municipios de Cerro de San Pedro, Villa de Zaragoza, Soledad de Graciano Sánchez, Mexquitic de Carmona y Villa de Arriaga.​\\nSu población municipal es de 824 299 habitantes, ​ su zona metropolitana alcanza una población de aproximadamente 1,345,443 habitantes, ​​​​ lo cual la ubica como la octava zona metropolitana más poblada de México. El centro histórico de la ciudad es reconocido como Patrimonio de la Humanidad por parte de la Unesco. Su importante y acelerado desarrollo industrial ha favorecido de manera positiva en el crecimiento económico y demográfico de la zona."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%BA%90%EC%84%9C%EB%A6%B0_%EB%9D%BC%EB%82%98%EC%82%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Katherine_LaNasa_1990.jpg","page_title":"캐서린 라나사","context_page_description":"캐서린 라나사는 미국의 배우이다."},{"page_url":"https://da.wikipedia.org/wiki/Joseph_Heller","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Joseph_Heller1986_crop.jpg","page_title":"Joseph Heller","context_page_description":"Joseph Heller var en amerikansk forfatter.\\nHan har studeret ved Columbia University. Under 2. verdenskrig var han bombepilot stationeret på Korsika. Her hentede han inspiration til sin store satiriske roman Punkt 22, der foregår ved en bombeeskadrille under anden verdenskrig."},{"page_url":"https://de.wikipedia.org/wiki/Uwe_Sch%C3%BCnemann","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Landtag_Niedersachsen_DSCF7716.JPG","page_title":"Uwe Schünemann","context_page_description":"Uwe Schünemann ist ein deutscher Politiker der CDU. Von 2003 bis 2013 war er niedersächsischer Innenminister."},{"page_url":"https://cy.wikipedia.org/wiki/Sweetwater,_Texas","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Tex_Robertson_1935.jpg","page_title":"Sweetwater, Texas","context_page_description":"Dinas yn Nolan County, yn nhalaith Texas, Unol Daleithiau America yw Sweetwater, Texas."},{"page_url":"https://en.wikipedia.org/wiki/Gary_K._Adams","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Gary_K._Adams_Petro_DSC_0182.JPG","page_title":"Gary K. Adams","context_page_description":"Gary K. Adams is the former president and CEO of Chemical Market Associates Inc. and chief chemical advisor for its successor IHS Markit. He serves on the board of directors of Phillips 66, and Trecora Resources. He has been a board member of Westlake Chemical Partners and Phillips 66 Partners LP"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B5%D1%80%D0%B5%D0%B4%D0%BD%D0%B8%D0%BA%D0%BE%D0%B2%D0%BE_(%D0%A8%D0%B0%D1%82%D1%83%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/%D0%9C%D0%B5%D0%BC%D0%BE%D1%80%D0%B8%D0%B0%D0%BB_%D0%B2_%D1%81%D0%B5%D0%BB%D0%B5_%D0%A1%D0%B5%D1%80%D0%B5%D0%B4%D0%BD%D0%B8%D0%BA%D0%BE%D0%B2%D0%BE_%28%D0%A8%D0%B0%D1%82%D1%83%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD%29.JPG","page_title":"Середниково (Шатурский район)","context_page_description":"Середнико́во — село в Шатурском муниципальном районе Московской области. Входит в состав сельского поселения Дмитровское. Расположено в юго-восточной части Московской области на реке Летовке. Население — 1189 чел.\\nСело известно с 1624 года. День села приурочен к празднованию дня памяти святителя Николая, и отмечается 19 декабря или в ближайшие к этой дате выходные."},{"page_url":"https://fi.wikipedia.org/wiki/Nokia_770","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Nokia770-fi-wiki.jpg","page_title":"Nokia 770","context_page_description":"Nokia 770 Internet Tablet oli Nokian ensimmäinen Linux-pohjainen kämmenlaite. Laitetta hallitsi suuri laajakuvanäyttö, jonka tarkkuus oli 800x480 pikseliä, minkä lisäksi laitteessa oli 252 megahertsinen Texas Instrumentsin OMAP-alustaan perustuva ARM-suoritin. Nokia 770:lla pystyi liittymään WLAN-verkkoon, ja se toimi hyvin yhdessä GPRS/EDGE/UMTS-tekniikoita tukevien puhelimien kanssa.\\nNokia 770:n seuraaja Nokia N800 julkaistiin tammikuussa 2007. Hinta julkaisuvuonna oli 369 euroa."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9E%D0%B3%D0%BB%D1%8F%D0%B4%D0%BE%D0%B2%D0%B8%D0%B9_%D0%BA%D0%BE%D0%BB%D0%BE%D0%B4%D1%8F%D0%B7%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/ManholePMG_gobeirne.jpg","page_title":"Оглядовий колодязь","context_page_description":"Оглядо́вий коло́дязь — загальна назва камери під землею, яка є частиною системи водопостачання, водовідведення, газопостачання, теплопостачання, кабельної каналізації. В разі виходу камери на поверхню для зручності в обслуговуванні оглядові колодязі можуть облаштовуватись спеціальними люками з чавунною чи полімерною кришкою або дренажними решітками, якщо це системи дощового водовідведення. В разі, коли обслуговування передбачається надзвичайно рідко, над камерою люк може не встановлюватись, тоді вся камера може накриватись плитою, доступ до якої поновлюється при знятті частини дорожнього покриття."},{"page_url":"https://fr.wikipedia.org/wiki/Forteresse_d%27Ehrenbreitstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Koblenz_-_Panorama_von_Festung_Ehrenbreitstein.jpg","page_title":"Forteresse d'Ehrenbreitstein","context_page_description":"La forteresse d'Ehrenbreitstein se trouve sur le rocher du même nom, 118 mètres au-dessus du Rhin à son confluent avec la Moselle, en face de la ville allemande de Coblence. Si le lieu est occupé depuis très longtemps en raison de sa position stratégique, les fortifications actuelles datent du XIXᵉ siècle. Elles comptent parmi les plus puissantes et les mieux conservées en Allemagne."},{"page_url":"https://eo.wikipedia.org/wiki/Dimocarpus_longan","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d1/ARS_longan_13.jpg","page_title":"Dimocarpus longan","context_page_description":"Dimocarpus longan aŭ longano estas plantspecio el la familio de Sapindacoj."},{"page_url":"https://no.wikipedia.org/wiki/Barrow_upon_Soar","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Barrow_Upon_Soar_parish_church_2006-04-14_034web.jpg","page_title":"Barrow upon Soar","context_page_description":"Barrow upon Soar er en stor landsby i distriktet Charnwood i grevskapet Leicestershire, England. Den ligger i Soardalen mellom byene Leicester og Loughborough. Landsbyen ligger, som navnet indikerer, på østre bredd av elva Soar, like overfor Quorndon ved hovedveien A6. Barrow har stoppested for tog på både Midland Main Line og Ivanhoe Line. I henhold til folketellingen i 2011 har landsbyen en befolkning på 5856 innbyggere.\\nLandsbyen er berømt på grunn av en plesiosaurus av arten Rhomaleosaurus megacephalus, også kjent som The Barrow Kipper, som ble gravd ut der. Dinosauren ble funnet i et kalksteinsbrudd utenfor landsbyen i 1851, og en rundkjøring med et skilt med bilde av den markerer lansbyens sentrum. Beinene fra dinosauren er på utstilling i Leicestershire Museum and Art Gallery som ligger på New Walk i Leicester."},{"page_url":"https://is.wikipedia.org/wiki/%C3%8Dsbj%C3%B6rn","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Polar-bear.jpg","page_title":"Ísbjörn","context_page_description":"Ísbjörn eða hvítabjörn, er sérstök tegund af stórum bjarndýrum sem lifa á hafís umhverfis Norðurheimskautið."},{"page_url":"https://fr.wikipedia.org/wiki/Youri_Khanon","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Khanon_Scriabin_comme_Face.jpg","page_title":"Youri Khanon","context_page_description":"Youri Khanon est un compositeur et homme de lettres russe né le 16 juin 1965 à Léningrad, lauréat du prix «Felix» pour la meilleure musique et récipiendaire du prix russe «Nika» en 1989. S'étant rendu célèbre, dans les années 1988—1992, au cinéma et à la télévision grâce à ses œuvres et à une série de concerts dans toute la Russie, Youri Khanon a quitté la vie publique en 1993. N’étant membre d’aucune organisation officielle, il mène une vie très hermétique et isolée à Saint-Pétersbourg."},{"page_url":"https://ga.wikipedia.org/wiki/B%C3%A1isteach_aig%C3%A9adach","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Acid_rain_woods1.JPG","page_title":"Báisteach aigéadach","context_page_description":"Báisteach, sneachta is flichshneachta a bhfuil a pH níos lú na 5.6. Déantar báisteach níos aigéadaí ná mar a bheadh normálta ag déocsaíd sulfair is ocsaídí nítrigine a sceitear san atmaisféar, ag loscadh breoslaí iontaisithe i bhfoirnéisí ollmhóra, stáisiúin ginte leictreachais agus innill dócháin inmheánaigh. Imoibríonn na ceimiceáin seo le galuisce san atmaisféar chun aigéad sulfarach is aigéad nítriúil a tháirgeadh. Is féidir go dtitfidh an bháisteach aigéadach na mílte ciliméadar i gcéin ón mbunionad dóite. Níl sé cinnte go gcuireann sí isteach go díreach ar dhaoine, ach cuireann isteach go tubaisteach ar éisc is gach beo uisciúil eile. Déanann sí damáiste tubaisteach do chrainn freisin. Ó dheireadh na 1980idí tá comhaontuithe idir na príomhthíortha tionsclaíocha, an tAontas Eorpach, na Stáit Aontaithe is an tSeapáin, chun na hastaíochtaí tionsclaíocha is cúis léi a laghdú de réir a chéile."},{"page_url":"https://sv.wikipedia.org/wiki/Nicaragua","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Santo_Domingo_I.jpg","page_title":"Nicaragua","context_page_description":"Nicaragua, formellt Republiken Nicaragua, är Centralamerikas till ytan största stat. Landet har kust mot Stilla havet och Karibiska sjön och gränsar till Costa Rica i söder och Honduras i norr. I Nicaragua finns Centralamerikas största färskvattenkälla, Nicaraguasjön."},{"page_url":"https://fr.wikipedia.org/wiki/Pierre_de_Porcaro","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Pierre_de_Porcaro_Dachau_Arolsen_Archives.jpg","page_title":"Pierre de Porcaro","context_page_description":"Pierre de Porcaro, né le 10 août 1904 à Dinan et mort le 12 mars 1945 au camp de concentration de Dachau, est un prêtre du diocèse de Versailles."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%BE%B7%E5%85%8B%E8%98%AD%C2%B7%E5%B8%8C%E7%88%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Declan_Hill_At_Play_The_Game_2009.jpg","page_title":"德克蘭·希爾","context_page_description":"德克兰·希尔是一名记者、学者及顾问，也是研究国际体坛关于假球及贪污问题的知名专家。他于2008年，作为 Chevening 学者，得到牛津大学的社会学博士学位。他的书＂The Fix: Organized Crime and Soccer＂已经被翻译成十五种语言。该书概述了赌博市场全球化对国际体坛所带来的新危机，其中包括对职业足球可能存在的操控。他也是一名Global Integrity评论家，并深入探讨过俄罗斯黑手党对专业冰上曲棍球的影响。"},{"page_url":"https://hu.wikipedia.org/wiki/Maastricht_ostroma_(1748)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Hobbe_Esaias%2C_baron_van_Aylva%2C_painted_by_Johann_Valentin_Tischbein%2C_ca_1750.jpg","page_title":"Maastricht ostroma (1748)","context_page_description":"Maastricht ostromára 1748 április–májusában került sor az osztrák örökösödési háború során. Szász Móric francia seregeivel a flandriai hadjáratának befejezéseként vette ostrom alá a várost. A hosszú ostrom után a védők kapituláltak és szabadon elvonulhattak a városból."},{"page_url":"https://de.wikipedia.org/wiki/Aldo_Rossi","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fd/Rossiberlin.jpg","page_title":"Aldo Rossi","context_page_description":"Aldo Rossi war einer der richtungsweisenden Architekten und Designer des 20. Jahrhunderts."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%8D%9A%E7%88%BE%E8%82%AF%E6%B2%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Borkener-Aa_Marbeck.jpg","page_title":"博爾肯河","context_page_description":"博爾肯河，是德國的河流，位於該國西部，流經北萊茵-威斯伐倫州，屬於博科爾特河的支流，河道全長11.2公里，流域面積75.2平方公里。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D0%B5%D1%82%D1%8E%D1%87%D0%B0_%D0%B6%D0%B0%D0%B1%D0%B0_%D1%8F%D0%B2%D0%B0%D0%BD%D1%81%D1%8C%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Rhacophorus_reinwardtii.png","page_title":"Летюча жаба яванська","context_page_description":"Летюча жаба яванська — вид земноводних з роду Летюча жаба родини Веслоногі. Інша назва «летюча жаба Рейнвардта»."},{"page_url":"https://lv.wikipedia.org/wiki/Trolejbuss","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Trol_Tatra_T_401_Brno.jpg","page_title":"Trolejbuss","context_page_description":"Trolejbuss ir pilsētas sabiedriskā transporta veids, parasti ar elektrodzinēju, kas tiek lietots pilsētās pasažieru pārvadāšanai noteiktajos maršrutos. Trolejbuss ir būvēts tāpat kā autobuss, tomēr tam nav iekšdedzes dzinējs, bet gan viens vai vairāki elektrodzinēji. Elektroenerģiju tas saņem tāpat kā tramvajs caur kontaktstieņiem, no virs brauktuves esošajiem vadiem. Tādēļ trolejbusam ir jābrauc pa kontakttīkla posmu, bet mūsdienās trolejbusiem tiek iebūvēts arī dīzeļģenerators, kas ļauj trolejbusam novirzīties no kontakttīkla posma vai turpināt maršrutu aiz šī posma beigām.\\nPirmās trolejbusu līnijas tika ierīkotas 20. gadsimta sākumā un šobrīd visā pasaulē 318 pilsētās, 47 valstīs eksistē pa kādai trolejbusu līnijai. Pārsvarā trolejbusu sistēmas ir sastopamas Viduseiropā, bijušajā PSRS teritorijā, Ķīnā, Ziemeļkorejā un Šveicē. Aptuveni 550 trolejbusu pārvadājumus veicošie uzņēmumi visā pasaulē ir likvidēti, pārsvarā Rietumeiropā, kur trolejbuss savus ziedu laikus piedzīvoja 1950. un 1960. gados. 29 valstīs šobrīd vairs nebrauc trolejbusi."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8E%D5%AB%D5%A4%D5%B5%D5%A1_%D4%B2%D5%A1%D5%AC%D5%A1%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Vidya_2008.jpeg","page_title":"Վիդյա Բալան","context_page_description":"Վիդյա Բալան, հնդիկ կինոդերասանուհի և մոդել: Հիմնականում նկարահանվում է հինդի ֆիլմերում: Առաջադրվել է մի քանի տասնյակ անվանակարգերում, ստացել է հնդկական կինոմրցանակներ՝ մեծամասամբ «Լավագույն կանացի դեր» կատեգորիայում։ 2014 թվականին հնդկական կինեմատոգրաֆիայում ունեցած ներդրման համար արժանացել է Պադմա Շրի պետական մրցանակի։"},{"page_url":"https://it.wikipedia.org/wiki/Parco_nazionale_dell%27Artico_russo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Walross_fjl.jpg","page_title":"Parco nazionale dell'Artico russo","context_page_description":"Il parco nazionale dell'Artico russo è un parco nazionale russo istituito nel giugno del 2009. Ricopre una grande superficie desertica dell'Artico, la parte settentrionale della Novaja Zemlja e la Terra di Francesco Giuseppe. Non deve essere confuso con la riserva naturale del Grande Artico, posta più a est."},{"page_url":"https://id.wikipedia.org/wiki/Pesawat_peringatan_dini","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/E-767_%28501.2%29.jpg","page_title":"Pesawat peringatan dini","context_page_description":"Pesawat peringatan dini adalah sebuah sistem radar yang dibawa oleh sebuah pesawat terbang yang dirancang untuk mendeteksi pesawat terbang lain. Radar ini dapat membedakan antara pesawat terbang kawan dan pesawat terbang musuh dari jarak jauh. Pesawat peringatan dini digunakan dalam operasi penerbangan defensif maupun ofensif. Secara ofensif, sistem ini bertugas untuk mengarahkan pesawat tempur ke targetnya. Secara defensif, sistem bertugas untuk mengawasi serangan musuh.\\nBeberapa negara mempunyai sistem pesawat peringatan dininya masing-masing. E-3 Sentry dan Grumman E-2C Hawkeye adalah pesawat terbang peringatan dini yang populer. Sentry dibuat oleh Boeing Defense and Space Group dan secara internasional dianggap sebagai standar pesawat peringatan dini. E-3 Sentry dibuat berbasiskan Boeing 707. E-2 Hawkeye yang memasuki dinas pada 1965 merupakan pesawat peringatan dini yang paling banyak digunakan. Pertahanan Udara Jepang menggunakan teknologi E-3 yang diaplikasikan ke Boeing 767.\\nBritania Raya juga mengembangkan pesawat peringatan dininya sendiri yaitu Nimrod AEW.3, yang dikembangkan oleh De Havilland. Akan tetapi, program Nimrod AEW kemudian dibatalkan."},{"page_url":"https://pl.wikipedia.org/wiki/Senatorowie_IV_kadencji_Senatu_Rzeczypospolitej_Polskiej_(1997%E2%80%932001)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/2008.06.22._Krzysztof_Kozlowski_Fot_Mariusz_Kubik_01.JPG","page_title":"Senatorowie IV kadencji Senatu Rzeczypospolitej Polskiej (1997–2001)","context_page_description":"Senatorowie IV kadencji zostali wybrani 21 września 1997 oraz w wyniku wyborów uzupełniających 25 czerwca 2000 i 28 stycznia 2001. Senatorowie złożyli ślubowanie na pierwszym posiedzeniu Senatu V kadencji wyznaczonym na 20 października 1997, ich kadencja upłynęła w przeddzień pierwszego posiedzenia następnego Sejmu, tj. 18 października 2001.\\nW wyniku wyborów parlamentarnych w 1997 wybrano 100 senatorów. Zostali oni wyłonieni w głosowaniu większościowym w 49 okręgach wyborczych obejmujących jedno województwo, w których wybierano 2 senatorów na zasadzie większości względnej. 51 nowo wybranych senatorów reprezentowało Akcję Wyborczą Solidarność, 28 kandydowało z ramienia Sojuszu Lewicy Demokratycznej, 8 Unii Wolności, 5 Ruchu Odbudowy Polski, 3 Polskiego Stronnictwa Ludowego, 5 mandatów uzyskali kandydaci niezależni. Wśród nich znalazło się 12 kobiet i 88 mężczyzn. 68 osób po raz pierwszy uzyskały mandaty w polskim parlamencie, 42 osoby posiadało doświadczenie parlamentarne wynikające z zasiadania w Sejmie lub Senacie.\\n1. posiedzenie Senatu VI kadencji rozpoczęło się w dniu 21 października 1997, funkcję marszałka seniora pełnił najstarszy wiekiem senator – Władysław Bartoszewski."},{"page_url":"https://sv.wikipedia.org/wiki/Lista_%C3%B6ver_%C3%B6ar_i_Medelhavet","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/MapBrac.jpg","page_title":"Lista över öar i Medelhavet","context_page_description":"Detta är en lista över öar i Medelhavet."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%86%E0%A6%B2%E0%A7%80%E0%A6%AC%E0%A6%B0%E0%A7%8D%E0%A6%A6%E0%A7%80_%E0%A6%96%E0%A6%BE%E0%A6%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/AlivardiKhanTomb.jpg","page_title":"আলীবর্দী খান","context_page_description":"নবাব আলীবর্দী খান ছিলেন ১৭৪০ থেকে ১৭৫৬ সাল পর্যন্ত বাংলা, বিহার ও উড়িষ্যার নবাব। তিনি দীর্ঘ ১৬ বছর বাংলার নবাব ছিলেন এবং তার শাসনামলের অধিকাংশ সময়ই মারাঠা আক্রমণকারী ও আফগান বিদ্রোহীদের বিরুদ্ধে যুদ্ধে ব্যয়িত হয়। একজন অসমসাহসী ও রণনিপুণ সেনাপতি হিসেবে তিনি পরিচিত ছিলেন এবং কর্মদক্ষ ও দূরদর্শী শাসক হিসেবে তার খ্যাতি ছিল।"},{"page_url":"https://en.wikipedia.org/wiki/Eastgate_Shopping_Centre_(Inverness)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Eastgate_Shopping_Centre%2C_Inverness_%28geograph_5854776%29.jpg","page_title":"Eastgate Shopping Centre (Inverness)","context_page_description":"Eastgate Shopping Centre is located in Inverness, serving the largest shopping catchment area in the United Kingdom.\\nThe Eastgate shopping centre in Inverness has been taken over by UK-owned real estate company, Savills plc.\\npopular amongst locals and tourists alike. Each hour a monkey is seen raising up a tree and chiming a bell in order to tell the hour. On each hour the clock diorama also plays an animal themed song and a single set of doors open to show pictures of the animal associated with the song. At midday each day a longer display takes place where all of the tunes are played, all the windows are opened and the rest of the diorama also operates. It is still common to see crowds watching the clock for the extended 12 o'clock performance."},{"page_url":"https://en.wikipedia.org/wiki/The_Glen_Bridge","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/The_Glen_Bridge_from_Thurman_shore.jpg","page_title":"The Glen Bridge","context_page_description":"The Glen Bridge is a two lane bridge that carries NY 28 across the Hudson River connecting Johnsburg, New York with Chester, built in 1959."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%90%89%E6%B5%8E%E4%BA%9A","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f5/Map_commune_FR_insee_code_39255.png","page_title":"吉济亚","context_page_description":"吉济亚是法国汝拉省的一个市镇，位于该省西南部，属于隆斯勒索涅区。该市镇总面积7.35平方公里，2009年时的人口为223人。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BC%D1%81%D1%82%D0%B5%D1%80%D0%B4%D0%B0%D0%BC%D1%81%D0%BA%D0%B8%D0%B9_%D1%82%D1%80%D0%B0%D0%BC%D0%B2%D0%B0%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/GVB_tram_910_a.jpg","page_title":"Амстердамский трамвай","context_page_description":"Амстердамский трамвай — один из видов общественного транспорта столицы Нидерландов города Амстердама; наибольшая трамвайная сеть страны и крупнейшая в Западной Европе. Эксплуатируется коммунальной организацией G'emeentelijkVervoerbedrijf."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%83%D8%B3%D9%8A%D8%A7%D9%88_%D9%8A%D9%88%D9%85%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Xiao_Youmei.jpg","page_title":"اكسياو يومى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nاكسياو يومى كان ملحن مزيكا من سلاله تشينج الحاكمه و جمهوريه الصين."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_im_Stadtbezirk_Eving","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/An_den_Stahlh%C3%A4usern_11.JPG","page_title":"Liste der Baudenkmale im Stadtbezirk Eving","context_page_description":"Die Liste der Baudenkmale im Stadtbezirk Eving enthält die denkmalgeschützten Bauwerke auf dem Gebiet des Stadtbezirks Dortmund-Eving in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Dortmund eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen.\\nBaudenkmäler sind „Denkmäler, die aus baulichen Anlagen oder Teilen baulicher Anlagen bestehen “. Die Denkmalliste der Stadt Dortmund umfasst im Stadtbezirk Eving 43 Baudenkmäler, darunter 22 Wohnhäuser oder Wohnsiedlungen, elf landwirtschaftliche Gebäude, vier Sakralbauten, zwei Industrieanlagen sowie je ein Wohn- und Geschäftshaus, öffentliches Gebäude, Friedhof und Geschäftshaus.\\nDer Stadtbezirk Eving umfasst die Ortsteile Brechten, Eving, Holthausen, Kemminghausen und Lindenhorst."},{"page_url":"https://fr.wikipedia.org/wiki/Christian_Mayer_(j%C3%A9suite)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Christian_Mayer.jpg","page_title":"Christian Mayer (jésuite)","context_page_description":"Christian Mayer, né le 20 août 1719 à Mödritz et décédé le 16 avril 1783 à Heidelberg, était un prêtre jésuite morave, astronome, philosophe et physicien.\\nIl est surtout connu pour avoir été un des premiers à étudier les étoiles binaires, bien que son équipement soit inadapté pour distinguer entre de vraies binaires et un alignement d'étoiles fortuit. En 1777-78, il compila un catalogue de 80 étoiles doubles, qu'il publia en 1781.\\nLe cratère C. Mayer sur la Lune porte son nom."},{"page_url":"https://sq.wikipedia.org/wiki/Massimiliano_Fuksas","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Fuksas.jpg","page_title":"Massimiliano Fuksas","context_page_description":"Massimiliano Fuksas është një arkitekt Italian."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AA%DB%8C%D8%AA%D8%A7%D9%86_%D8%A2%D9%86%D8%AF%D8%B1%D8%B2%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Tintin_Anderzon_2015.jpg","page_title":"تیتان آندرزون","context_page_description":"تیتان آندرزون هنرپیشه اهل سوئد است.\\nاز فیلم‌ها یا برنامه‌های تلویزیونی که وی در آن نقش داشته‌است می‌توان به ماریان اشاره کرد."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D8%A7%D8%B1%D9%8A%D8%AE_%D9%86%D8%A7%D9%88%D8%B1%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Nauru_Annexation_Germany_1888.jpg","page_title":"تاريخ ناورو","context_page_description":"تاريخ النشاط البشري في ناورو -جزيرة في المحيط الهادي- بدأ منذ حوالي 3000 عام عندما قامت اثنا عشر قبيلة من ميكرونيسيا وبولينيزيا بزيارة الجزيرة والاستقرار فيها."},{"page_url":"https://de.wikipedia.org/wiki/Maler_von_Athen_894","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Antikensammlung-Kykladenmuseum_0096.JPG","page_title":"Maler von Athen 894","context_page_description":"Als Maler von Athen 894 wird ein attisch-spätgeometrischer Vasenmaler und wohl auch Töpfer bezeichnet, dessen Werke in das letzte Drittel des 8. Jahrhunderts v. Chr. datiert werden.\\nDer Maler von Athen 894 ist namensgebend für die Werkstatt von Athen 894, eine der bedeutendsten attischen Keramikwerkstätten der Phase SG II b der spätgeometrischen Zeit. Seine Namenvase befindet sich heute im Nationalmuseum von Athen und hat die Inventarnummer 894. John Nicolas Coldstream schrieb ihm sieben Gefäße zu. Bei der Verzierung der Gefäße weicht er nicht von den anderen Werken der Werkstatt ab, die um seine Werke herum gruppiert werden."},{"page_url":"https://de.wikipedia.org/wiki/Wahre_Jesus-Kirche","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Big_root_church.JPG","page_title":"Wahre Jesus-Kirche","context_page_description":"Die Wahre Jesus-Kirche oder Wahre Jesus Gemeinde ist eine chinesische christliche Kirche, die 1917 in Peking gegründet wurde. Sie zählt somit zu den indigenen bzw. einheimischen Denominationen in der Volksrepublik China. Zur Doktrin dieser Kirche gehört der Glaube an die ausschließliche Göttlichkeit Jesu, das heißt die Lehre der Dreieinigkeit wird abgelehnt. Die Gemeinschaft war zudem eine von drei einheimischen chinesischen Hauskirchen, die vor der Übernahme der Kommunisten 1949 in China existierten. Das Ziel der Kirche ist, das Evangelium allen Nationen vor der Rückkehr Jesu zu predigen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D1%80%D0%BA_%D0%B8%D0%BC%D0%B5%D0%BD%D0%B8_%D0%A3%D1%80%D0%B8%D1%86%D0%BA%D0%BE%D0%B3%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/%D0%97%D0%B0%D0%BC%D0%BA%D0%B8_%D0%BD%D0%B0_%D0%BC%D0%BE%D1%81%D1%82%D1%83_%D0%B2_%D0%BF%D0%B0%D1%80%D0%BA%D0%B5_%D0%A3%D1%80%D0%B8%D1%86%D0%BA%D0%BE%D0%B3%D0%BE_%28%D0%9A%D0%B0%D0%B7%D0%B0%D0%BD%D1%8C%29.JPG","page_title":"Парк имени Урицкого","context_page_description":"Парк имени Урицкого — один из наиболее крупных и ухоженных парков г. Казани, расположенный в Московском районе между улицами Хасана Туфана, Академика Королёва, Васильченко и Гагарина."},{"page_url":"https://hr.wikipedia.org/wiki/Mursi","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/MursiTribe.jpg","page_title":"Mursi","context_page_description":"Mursi su surmska pastoralistička etnička skupina u Etiopiji. Uglavnom borave u Zoni Debub Omo u Regiji Južnih naroda, narodnosti i etničkih grupa, blizu granice s Južnim Sudanom. Prema nacionalnom popisu stanovništva iz 2007. godine, Mursija je bilo 11.500, od čega 848 živi u urbanim područjima. Od ukupnog broja, 92,25% živi u Regiji Južnih naroda, narodnosti i etničkih grupa.\\nOkružen planinama između rijeke Omo i njezina pritoka Mago, dom Mursija jedan je od najizoliranijih kutaka Etiopije. Njihovi susjedi uključuju narode Aari, Banna, Bodi, Karo, Kwegu, Nyangatom i Suri. Zajedno s narodima Me'en i Suri, etiopska vlada ih svrstava u etničku grupu Surmi."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%A8%D7%99%D7%9E%D7%91%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/GuatemalanMarimbaGourds.JPG","page_title":"מרימבה","context_page_description":"מרימבה הוא כלי הקשה שהתפתח במרכז אמריקה על ידי עבדים אפריקאים על בסיס כלים אפריקאיים קדומים.\\nלמרימבה יש ארבע אוקטבות ובדרך כלל היא עשויה מעץ.\\nהמרימבה דומה לקסילופון אך יש לה יותר אוקטבות והצינורות מהן יוצא הצליל בצורה שונה.\\nהצליל יוצא מן הקלידים ולא מן הרזונטורים. הרזונטורים מעבים ומאריכים את הצלילים, למרימבה יש חמש אוקטבות והקלידים עשויים מעץ סיסם או פאדוק. הרזונטורים לא שונים בצורתם מהקסילופון, רק גדולים יותר פרט לאוקטבה הראשונה של הכלי בה הרזונטורים מתעקמים כלפי מעלה."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Santo_Hip%C3%B3lito","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ec/Brasaostohipolito.png","page_title":"Santo Hipólito","context_page_description":"Santo Hipólito sī ūi-tī Pa-se Minas Gerais chiu ê chi̍t ê chū-tī-thé.\\nChe sī chi̍t phiⁿ koan-î Pa-se tē-lí ê phí-á-kiáⁿ. Chhiáⁿ tàu khok-chhiong."},{"page_url":"https://en.wikipedia.org/wiki/Great_River_Charter_Montessori_School","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Great_River_Charter_Montessori_School.jpg","page_title":"Great River Charter Montessori School","context_page_description":"Great River School is a Montessori charter school in Saint Paul, Minnesota, United States. It functions as a primary, junior high, and high school.\\nGreat River serves 1st through 12th grade and offers the International Baccalaureate program in its 11th and 12th grades."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%B8%D6%82%D5%BD%D5%BF%D5%A5%D5%BC%D5%AC%D5%AB%D6%81%D5%AB_%D5%B3%D5%A1%D5%AF%D5%A1%D5%BF%D5%A1%D5%B4%D5%A1%D6%80%D5%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Battle_of_Austerlitz_-_Situation_at_0900%2C_2_December_1805.png","page_title":"Աուստեռլիցի ճակատամարտ","context_page_description":"Աուստեռլիցի ճակատամարտ, տեղի է ունեցել 1805 թվականի դեկտեմբերի 2-ին Մորավիայի հարավում գտնվող Աուստեռլից քաղաքի մոտ ։ Աուստեռլիցի ճակատամարտը հայտնի է նաև «3 կայսրերի ճակատամարտ» անվանումով, քանի որ ճակատամարտին մասնակցում էին միանգամից 3 կայսրեր՝ Նապոլեոն, Ռուսաստան, Ֆրանց II ։ Մոտ 9 ժամ տևած ճակատամարտում Ֆրանսիայի «Մեծ Բանակը» Նապոլեոնի գլխավորությամբ ջախջախեց ռուս-ավստրիական բանակը՝ Ալեքսանդրի և Ֆրանցի գլխավորությամբ։ Ճակատամարտը վերջ դրեց Անգլիայի ստեղծած երրորդ կոալիցիային:"},{"page_url":"https://it.wikipedia.org/wiki/Biblioteca_presidenziale","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/GRFord-Presidential.jpg","page_title":"Biblioteca presidenziale","context_page_description":"Si definisce biblioteca presidenziale una rete di biblioteche degli Stati Uniti, ciascuna delle quali istituita da un ex Presidente da cui prende il nome. Queste non sono biblioteche vere e proprie, ma luoghi dove sono conservati e resi disponibili i documenti, i registri, le collezioni storiche e altri oggetti appartenuti ad ogni Presidente."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Marktzeuln","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Marktzeuln%2C_Am_Flecken_7%2C_003.jpg","page_title":"Liste der Baudenkmäler in Marktzeuln","context_page_description":"Auf dieser Seite sind die Baudenkmäler des oberfränkischen Marktes Marktzeuln zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 3. Juli 2018 wieder und enthält 60 Baudenkmäler."},{"page_url":"https://pt.wikipedia.org/wiki/Parque_Ecol%C3%B3gico_da_Cachoeira_do_Urubu","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Vista_da_Passarela_do_Parque_Ecol%C3%B3gico_da_Cachoeira_do_Urubu.jpg","page_title":"Parque Ecológico da Cachoeira do Urubu","context_page_description":"A Área de Proteção Ambiental da Cachoeira do Urubu, conhecida popularmente como Parque Ecológico da Cachoeira do Urubu, é uma área protegida localizada no norte do Estado do Piauí. Localizada entre os municípios de Batalha e Esperantina, ela se encontra junto ao curso do Rio Longá, e a 180 km de Teresina.\\nDurante o primeiro semestre do ano, devido ao período das chuvas, as quedas d'água se transformam num belo espetáculo. O lugar é uma área de preservação ambiental e conta com infra-estrutura de apoio para turistas."},{"page_url":"https://no.wikipedia.org/wiki/John_Lydon","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/John_Lydon%2C_Primavera_Sound_Festival_2011.jpg","page_title":"John Lydon","context_page_description":"John Joseph Lydon, bedre kjent som vokalist Johnny Rotten i bandet Sex Pistols, er en engelsk musiker. Lydon, som er av irsk avstemning, ble senere vokalist i pop/punk-bandet Public Image Ltd."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D0%B0%D1%80%D0%B0%D1%92%D0%BE%D1%80%D1%92%D0%B5%D0%B2_%D0%BA%D0%BE%D0%BD%D0%B0%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Wiki_%C5%A0umadija_V_Kara%C4%91or%C4%91ev_konak_304.jpg","page_title":"Карађорђев конак","context_page_description":"Карађорђев конак, који се у литератури назива Kарађорђев двор или његова престона резиденција, најрепрезентативнија је грађевина у оквиру комплекса Карађорђевог града."},{"page_url":"https://pl.wikipedia.org/wiki/Plac_Tysi%C4%85clecia_w_Siedlcach","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0a/Ko%C5%9Bci%C3%B3%C5%82_Garnizonowy.JPG","page_title":"Plac Tysiąclecia w Siedlcach","context_page_description":"Plac Tysiąclecia – jeden z głównych placów Siedlec."},{"page_url":"https://en.wikipedia.org/wiki/List_of_breads","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2a/Scone_varieties.jpg","page_title":"List of breads","context_page_description":"This is a list of baked or steamed bread varieties. It does not include cakes, pastries, or fried dough foods, which are listed in separate Wikipedia articles. It also does not list foods in which bread is an ingredient which is processed further before serving."},{"page_url":"https://gl.wikipedia.org/wiki/Premio_Nobel_de_Literatura","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Alice_Munro.jpg","page_title":"Premio Nobel de Literatura","context_page_description":"O Premio Nobel de Literatura é un dos 5 premios especificamente sinalados no testamento do escandinavo Alfred Nobel. Segundo as súas palabras, o premio debe entregarse cada ano \\"a quen produza no campo da literatura a obra máis salientábel, na dirección correcta\\". A institución encargada de seleccionar ó gañador é a Academia Sueca.\\nOnce dos galardoados co premio no século XX foron escritores en lingua castelá —entre eles un galego— e un en lingua portuguesa: os españois José Echegaray, Jacinto Benavente, Juan Ramón Jiménez, Vicente Aleixandre, e o galego Camilo José Cela; os chilenos Gabriela Mistral e Pablo Neruda; o guatemalteco Miguel Ángel Asturias; o colombiano Gabriel García Márquez, o mexicano Octavio Paz e o peruano Mario Vargas Llosa; en lingua portuguesa o portugués José Saramago."},{"page_url":"https://eo.wikipedia.org/wiki/Pruszk%C3%B3w","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9d/PL_Pruszkow_stary.jpg","page_title":"Pruszków","context_page_description":"Pruszków estas urbo en la provinco Mazovio de Pollando. Ĝi apartenas al samnoma komunumo en la distrikto Pruszkowski kaj estas parto de la Aglomeraĵo de Warszawa."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9C%D0%B0%D0%B9%D1%81%D1%82%D0%BE%D1%80_%D0%BD%D0%B0_%D0%B8%D1%81%D1%82%D0%BE%D1%80%D0%B8%D1%8F%D1%82%D0%B0_%D0%B7%D0%B0_%D0%93%D1%80%D0%B8%D0%B7%D0%B5%D0%BB%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/%D0%98%D1%81%D1%82%D0%BE%D1%80%D0%B8%D1%8F_%D0%93%D1%80%D0%B8%D0%B7%D0%B5%D0%BB%D1%8C%D0%B4%D1%8B_%D1%87%D0%B0%D1%81%D1%82%D1%8C_3.JPG","page_title":"Майстор на историята за Гризелда","context_page_description":"Майстор на историята за Гризелда - италиански художник от епохата на Ренесанса от."},{"page_url":"https://eu.wikipedia.org/wiki/Marmosops_paulensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Marmosops_incanus_2.jpg","page_title":"Marmosops paulensis","context_page_description":"Marmosops paulensis Marmosops generoko animalia da. Didelphimorphia ordenaren barruko ugaztuna da. Didelphinae azpifamilia eta Didelphidae familian sailkatuta dago."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%95%E0%AE%A3%E0%AE%BF%E0%AE%A4%E0%AE%B5%E0%AE%BF%E0%AE%AF%E0%AE%B2%E0%AE%BE%E0%AE%B3%E0%AE%B0%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Georg_Friedrich_Bernhard_Riemann.jpeg","page_title":"கணிதவியலாளர்","context_page_description":"கணிதவியலாளர் என்பவர் கணிதத்தில் பரந்த அறிவுடையவரும், கணிதச் சிக்கல்களைத் தீர்ப்பதற்கு அந்த அறிவைப் பயன்படுத்துபவரும் ஆவார். கணிதம் என்பது எண்கள், தரவுகள், தொகுப்புக்கள், கணியங்கள், அமைப்பு, வெளி, மாதிரிகள், மாற்றம் என்பவற்றோடு தொடர்புடையது.\\nதூய கணிதத்துக்குப் புறம்பான சிக்கல்களைத் தீர்க்கும் கணிதவியலாளர் பிரயோக கணிதவியலாளராவார். பிரயோக கணிதவியலாளர்கள் என்போர், தமது சிறப்பு அறிவையும், துறைசார் வழிமுறைகளையும் பயன்படுத்திப் பல்வேறு அறிவியல் துறைகளோடு தொடர்புள்ள கணிதப் பிரச்சினைகளை அணுகும் கணித அறிவியலாளர்கள் ஆவர். பல்வேறுபட்ட பிரச்சினைகளில் துறைசார் கவனத்துடனும், கோட்பாட்டு முறைகளைப் பயன்படுத்தியும், கணித மாதிரிகளை ஆய்வு செய்தல் அவற்றை உருவாக்குதல் போன்ற செயற்பாடுகளில் பிரயோக கணிதவியலாளர்கள் ஈடுபடுகின்றனர்.\\nபிரயோக கணிதத் துறையானது அறிவியல், பொறியியல், வணிகம், தொழிற்றுறை போன்றவற்றில் பொதுவாகப் பயன்படுகின்ற கணித முறைகளோடு தொடர்புபட்டது. அதனால், இத்துறைசார் வல்லுனர்களான பிரயோக கணிதவியலாளர்கள், அறிவியல், பொறியியல், வணிகம் என்பவற்றை உட்படுத்திய பல்வேறு கணிதம்சார் செயற்பாடுகளைக் கொண்ட துறைகளில், தமது அறிவைப் பயன்படுத்துகின்றனர்."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%98%D0%B3%D0%BE%D1%80_%D0%A1%D1%82%D1%80%D0%B0%D0%B2%D0%B8%D0%BD%D1%81%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Popiersie_Igor_Strawi%C5%84ski_ssj_20060914.jpg","page_title":"Игор Стравински","context_page_description":"Игор Фјодорович Стравински био је руски композитор, којег данас многи, и на западу и у његовој родној домовини, сматрају једним од најутицајнијих композитора 20. века. Од 1910. године живио је у Швајцарској и Француској, а од 1937. године у САД. Амерички држављанин је постао 1945.\\nБио је отелотворење космоплитског Руса којег је Тајм навео као једног од најутицајнијих људи XX века. Поред признања која је добио за своје композиције, стекао је славу и као диригент и као пијаниста, најчешће на премијерама властитих дела. Године 1939. и 1940. предавао је музичку естетику на Харвард универзитету у Бостону.\\nОдликује се великом разноврсношћу музичког израза и стилске оријентације. У првој фази је спајао руске фолклорне елементе са импресионизмом, затим је био експресиониста са честим ослањањем на џез, а касније је применио неокласични стил. У последњој фази је користио принципе додекафоније. Имао је велики утицај на своје млађе савременике у многим земљама.\\nМеђународну славу прво је стекао са своја три балета, која је наручио Сергеј Дјагиљев, а чији их је Бале русе и премијерно извео. Та три балета су Жар-птица, Петрушка и Посвећење пролећа."},{"page_url":"https://sv.wikipedia.org/wiki/Stenandrium_dulce","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Sweet_Shaggytuft_%285670016751%29.jpg","page_title":"Stenandrium dulce","context_page_description":"Stenandrium dulce är en akantusväxtart som först beskrevs av Antonio José Cavanilles, och fick sitt nu gällande namn av Christian Gottfried Daniel Nees von Esenbeck. Stenandrium dulce ingår i släktet Stenandrium och familjen akantusväxter. Utöver nominatformen finns också underarten S. d. floridana."},{"page_url":"https://en.wikipedia.org/wiki/Robert_L._Stephens","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/36/Lockheed_YF-12A_%282183418677%29.jpg","page_title":"Robert L. Stephens","context_page_description":"Robert L. \\"Silver Fox\\" Stephens was a United States Air Force test pilot who set several speed and altitude records while testing the Lockheed YF-12 and SR-71."},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_norgesmestere_i_langrenn","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/KristenSkjeldal.jpg","page_title":"Liste over norgesmestere i langrenn","context_page_description":"Liste over norgesmestere i langrenn inneholder de som er blitt norgesmestere i langrenn siden det første norgesmesterskapet i 1909."},{"page_url":"https://sv.wikipedia.org/wiki/Otava_(%C3%B6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Ravintola_R%C3%B6%C3%B6l%C3%A4nranta%2C_R%C3%B6%C3%B6l%C3%A4n_kes%C3%A4kauppa_ja_asuinkerrostalo%2C_R%C3%B6%C3%B6l%C3%A4%2C_Rym%C3%A4ttyl%C3%A4%2C_Naantali%2C_7.8.2012..jpg","page_title":"Otava (ö)","context_page_description":"Otava är en finsk ö som ligger i Skärgårdshavets havsområde i kommunen Nådendal, väster om huvudorten. Ön är 105 km² stor och har en högsta höjd av knappt 60 meter över havet. Till arealen är ön den tionde största i Finland.\\nOtala sitter ihop med Rimito i söder men sjön Paskaperänjärvi och vikarna Ruokorauma i öster och Kolkka i väster bildar en tydlig skiljelinje."},{"page_url":"https://pl.wikipedia.org/wiki/Trzy_Strza%C5%82y","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Standards_for_Roter_Frontk%C3%A4mpferbund%2C_c._1925%2C_and_Iron_Front_%28Eiserne_Front%29%2C_1932_-_Braunschweigisches_Landesmuseum_-_DSC04754.JPG","page_title":"Trzy Strzały","context_page_description":"Trzy Strzały – symbol zaprojektowany w 1931 roku przez Rosjanina Siergieja Czachotina i Niemca Karla Mierendorffa dla niemieckiej organizacji antyfaszystowskiej Front Żelazny. Jest jednym z symboli światowego ruchu antyfaszystowskiego."},{"page_url":"https://nn.wikipedia.org/wiki/Den_Sorte_Dame","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ab/Den_sorte_dame_3.jpg","page_title":"Den Sorte Dame","context_page_description":"Den Sorte Dame er sjørøvarskipet til den oppdikta sjørøvaren Kaptein Sabeltann, skapt av Terje Formoe.\\nEin modell i full størrelse vart bygd ved Risør Trebåtbyggeri under leiing av Ole Jacob Broch og Ingar Sørensen i 1993 som kulisse til teaterframføringane med Kaptein Sabeltann i Kristiansand Dyrepark. Det var sistnemnde som stod for designet av skuta. Det tok berre tre månader frå bygginga starta til sjøsettinga i Risør. Skipet vart så segla til Kristiansand.\\nVåren 2005 vart Den Sorte Dame restaurert, og fargen på ansiktet på akterenden vart forandra frå gull til sølv."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%99%B6%E5%82%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Tsaoex.JPG","page_title":"陶傑","context_page_description":"陶 傑本名は曹捷である。香港、イギリス、中国において16年、中国語の作家ならびに、メディアでの評論家、知識人タレントである。香港政府、中国政府と中国文化の政治と文化を酷評する一方、アメリカ、ヨーロッパ、日本の文化をほめる傾向がある。"},{"page_url":"https://de.wikipedia.org/wiki/Bundesratswahl_1999","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Annemarie_Huber-Hotz_in_Rapperswil.jpg","page_title":"Bundesratswahl 1999","context_page_description":"Am 15. Dezember 1999 fanden in der Schweiz die Gesamterneuerungswahlen des Bundesrates statt. Die beiden Kammern des neu gewählten Parlaments, die Vereinigte Bundesversammlung, wählten die Schweizer Regierung, den Bundesrat, für die von 2000 bis 2003 dauernde Amtszeit. Die Sitze wurden einzeln in der Reihenfolge des Amtsalters der Sitzinhaber bestellt.\\nNach den Ersatzwahlen wenige Monate zuvor kandidierten alle bisherigen Mitglieder des Bundesrates erneut. Eine Nichtwiederwahl eines amtierenden Bundesrates war äusserst unüblich. Die SVP, die bei den vorangehenden Parlamentswahlen stärkste Partei wurde, forderte vergeblich einen zweiten Sitz."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%AA%D7%A7%D7%A4%D7%AA_%D7%94%D7%A1%D7%99%D7%99%D7%91%D7%A8_%D7%A2%D7%9C_Dyn","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Level3_Outage_Map_%28US%29_-_21_October_2016.png","page_title":"מתקפת הסייבר על Dyn","context_page_description":"מתקפת הסייבר על חברת Dyn התרחשה ב-21 באוקטובר 2016. המתקפה כללה התקפת מניעת שירות מבוזרת שכוונה למערכות Domain Name System‏ המופעלות על ידי חברת Dyn ואשר גרמה לשירותים ופלטפורמות אינטרנט שונים להפוך ללא זמינים למשתמשים באירופה ובצפון אמריקה. קבוצות אנונימוס ו-New World Hackers לקחו אחריות על התקיפה.\\nכספק שירותי DNS, חברת Dyn מספקת למשתמשי הקצה את האפשרות להמיר את שם תחום לכתובת IP אליה מקושר האתר. בהתקפת מניעת שירות מבוזרת מפעילים עשרות מיליוני בקשות DNS ממספר גדול של כתובות IP. על פי הערכות, הפעילות כללה הפעלת בוטנטים רבים אשר פעלו באופן מתואם דרך מכשירי האינטרנט של הדברים כגון מדפסות, מצלמות רשת, נתבים ביתיים ומוניטורים לתינוקות, אשר נדבקו בנוזקת מיראי."},{"page_url":"https://sv.wikipedia.org/wiki/Pseudochalcothea_auripes","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Scarabaeidae_-_Pseudochalcothea_auripes.JPG","page_title":"Pseudochalcothea auripes","context_page_description":"Pseudochalcothea auripes är en skalbaggsart som beskrevs av John Obadiah Westwood 1874. Pseudochalcothea auripes ingår i släktet Pseudochalcothea och familjen Cetoniidae. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://cs.wikipedia.org/wiki/Chopin%C5%AFv_alt%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Karlovy_Vary_Chopin%C5%AFv_alt%C3%A1n_1.jpg","page_title":"Chopinův altán","context_page_description":"Chopinův altán, uváděn též jako Chopinova chata, stojí na rozcestí lesních cest v sedle pod Výšinou přátelství jihozápadně od města Karlovy Vary. Patří mezi typické altány postavené v lázeňských lesích; slouží jako turistický přístřešek k zastavení a odpočinku."},{"page_url":"https://de.wikipedia.org/wiki/Flugplatz_Staaken","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/B%C3%B6ttcherstra%C3%9Fe_%28Bremen%29_Condor_Rekordflug%2C_Focke-Wulf.JPG","page_title":"Flugplatz Staaken","context_page_description":"Der Flugplatz Staaken in Berlin-Staaken am Brunsbütteler Damm entwickelte sich im Laufe seiner rund 40-jährigen Geschichte von einem Werftplatz der Zeppelinwerke hin zu einem der ersten Verkehrsflughäfen in Deutschland in den 1920er Jahren und schließlich zur Hauptwerft der damaligen Deutschen Lufthansa AG. Gemessen an der Vielzahl der Werks- und Überführungsflüge ab Mitte der 1930er Jahre entsprach der Flugplatz Staaken einem Großflughafen nach damaligen Maßstäben, allerdings mit der Besonderheit, dass der Passagierverkehr der Lufthansa in Berlin seit den 1930er Jahren ausschließlich auf dem Zentralflughafen Tempelhof abgefertigt wurde. Diese Besonderheit führte dazu, dass der Flugplatz Staaken nach der Zeppelin-Ära in den 1920er Jahren sehr schnell nicht mehr im Blickpunkt der Öffentlichkeit stand, sodass er nach seiner Schließung Ende 1953 nahezu in Vergessenheit geriet. Zugleich war dieses Schattendasein eine willkommene Gelegenheit für die Luftstreitkräfte sowohl der Reichswehr als später auch der Wehrmacht, im großen Stil und dennoch von der Öffentlichkeit zunächst unbemerkt militärische Luftfahrttechnik unter dem Vorwand ziviler Zwecke zu entwickeln und zu testen."},{"page_url":"https://en.wikipedia.org/wiki/Lowthorpe_railway_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Lowthorpe_railway_station.jpg","page_title":"Lowthorpe railway station","context_page_description":"Lowthorpe railway station was a minor railway station serving the village of Lowthorpe on the Yorkshire Coast Line from Scarborough to Hull and was opened on 6 October 1846 by the York and North Midland Railway. It closed on 5 January 1970."},{"page_url":"https://ca.wikipedia.org/wiki/Skarsterl%C3%A2n","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Joure%2C_straatzicht_met_kerk_foto4_2011-04-26_17.19.JPG","page_title":"Skarsterlân","context_page_description":"Skarsterlân és un antic municipi de la província de Frísia, al nord dels Països Baixos. L'1 de gener de 2009 tenia 27.241 habitants repartits en una superfície de 216,89 km². Limita al nord amb Sneek i Boarnsterhim, a l'oest amb Wymbritseradiel, a l'est amb Heerenveen i al sud amb Gaasterlân-Sleat, Lemsterland i Weststellingwerf. A partir de l'1 de gener de 2014, Skarsterlân es fusiona amb Gaasterlân-Sleat i Lemsterland i conformen el municipi nou De Friese Meren."},{"page_url":"https://it.wikipedia.org/wiki/Jimena_D%C3%ADaz","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Ciclo_cidiano_Do%C3%B1a_Jimena.jpg","page_title":"Jimena Díaz","context_page_description":"Jimena Díaz, detta anche Doña Jimena, moglie di Rodrigo Díaz de Vivar \\"el Cid\\", fu signora consorte di Valencia dal 1093 al 1099 e signora di Valencia dal 1099 al 1102."},{"page_url":"https://de.wikipedia.org/wiki/Juan_Pedro_Damiani","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Juan_Pedro_Damiani_2011.jpg","page_title":"Juan Pedro Damiani","context_page_description":"Juan Pedro Damiani ist ein uruguayischer Fußballfunktionär und Rechtsanwalt.\\nVon 2006 bis zu seinem Rücktritt am 6. April 2016 war er Mitglied in der Ethik-Kommission der FIFA und dort Mitglied der 2012 eingeführten rechtsprechenden Kammer. Damianis Rücktritt steht dabei im Zusammenhang mit seiner Verbindung zu den sogenannten Panama Papers. Er soll drei Angeklagten im sogenannten FIFA-Skandal geholfen haben, Offshore-Firmen zu gründen. Im März 2016 war zudem klar geworden, dass zwischen Juan Pedro Damiani und dem uruguayischen Fußballfunktionär Eugenio Figueredo geschäftliche Verbindungen existierten. Der FIFA-Funktionär Figueredo steht im Zentrum von Korruptionsermittlungen.\\nDamiani ist seit 2008 Präsident von Peñarol Montevideo. Im November 2011 und im Dezember 2014 wurde er für eine Wahlperiode von jeweils drei weiteren Jahren im Amt bestätigt."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9D%D0%BE%D0%B1%D0%B5%D0%BB%D0%BE%D0%B2%D0%B0_%D0%BD%D0%B0%D0%B3%D1%80%D0%B0%D0%B4%D0%B0_%D0%B7%D0%B0_%D1%85%D0%B5%D0%BC%D0%B8%D1%98%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Nobel_Prize_2010-Press_Conference_KVA-DSC_7398.jpg","page_title":"Нобелова награда за хемија","context_page_description":"Нобелова награда за хемија — годишна награда што ја доделува Кралската академија на науките на научници од различни области на хемијата. Таа е една од петте Нобелови награди што ја основал во 1895 година пронаоѓачот на динамитот, шведскиот физичар Алфред Нобел. Останатите награди се: Нобелова награда за физика, Нобелова награда за физиологија или медицина, Нобелова награда за литература, Нобелова награда за мир и Нобелова награда за економија.\\nСпоред тестаментот на Нобел, наградата се исплатува од средствата на фондацијата „Нобел“, а ја доделува комитет од пет члена кои ги избира Кралската академија на науките. Првата Нобелова награда за хемија е доделена во 1901 година на Јакоб Хенрик вант Хоф, од Холандија.\\nСекој добитник добива медал, диплома и парична награда која не е иста секоја година. Во 2007 година, Гехарт Ертл добил десет милиони шведски круни,"},{"page_url":"https://id.wikipedia.org/wiki/Protes_Mesir_2012%E2%80%932013","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Tahrir_Square_on_November_27_2012_%28Evening%29.jpg","page_title":"Protes Mesir 2012–2013","context_page_description":"Protes Mesir 2012-13 dimulai pada tanggal 22 November 2012. Ratusan ribu pengunjuk rasa berdemonstrasi menentang Presiden Mesir Muhammad Mursi, setelah ia memberikan kekuatan kepada dirinya sendiri secara tak terbatas untuk \\"melindungi\\" negara, dan kekuatan untuk mengatur legislasi tanpa peninjauan secara yuridis. Morsi melanjutkan dekritnya dengan membuat upaya untuk mendorong referendum konstitusi yang baru.\\nDemonstrasi ini diselenggarakan oleh organisasi oposisi Mesir dan individu, terutama kaum pro-demokrasi liberal, sayap kiri, kaum sekuler, dan kaum Kristen. Demonstrasi telah menyebabkan bentrokan antara anggota Partai Kebebasan dan Keadilan yang disokong Ikhwanul Muslimin dan pengunjuk rasa anti-Mursi, dengan setidaknya tujuh orang tewas dan ratusan terluka. Para pengunjuk rasa berkumpul di luar istana kepresidenan, yang pada gilirannya dikelilingi oleh tank dan kendaraan lapis baja Pengawal Republik. Pengunjuk rasa anti-Mursi di Kairo saja telah berjumlah lebih dari 200.000 orang di beberapa kesempatan.\\nSejumlah penasihat Mursi mengundurkan diri sebagai protes, dan banyak hakim berbicara menentang tindakannya."},{"page_url":"https://es.wikipedia.org/wiki/Raphael_Diaz","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Raphael_Diaz_Canucks.jpg","page_title":"Raphael Diaz","context_page_description":"Raphael Diaz o Rafael Díaz, nacido el 9 de enero de 1986 en Baar, es un jugador profesional de hockey sobre hielo que juega en las filas de EV Zug"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_gemeentelijke_monumenten_in_Arnhem","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Arnhem-nijhoffstraat-trapgevel.jpg","page_title":"Lijst van gemeentelijke monumenten in Arnhem","context_page_description":"De gemeente Arnhem kent 2016 gemeentelijke monumenten, hieronder een overzicht. Zie ook de rijksmonumenten in Arnhem."},{"page_url":"https://sv.wikipedia.org/wiki/Heuchera_grossulariifolia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Heuchera_grossulariifolia1.jpg","page_title":"Heuchera grossulariifolia","context_page_description":"Heuchera grossulariifolia är en stenbräckeväxtart som beskrevs av Per Axel Rydberg. Heuchera grossulariifolia ingår i släktet alunrötter, och familjen stenbräckeväxter. Utöver nominatformen finns också underarten H. g. tenuifolia."},{"page_url":"https://fr.wikipedia.org/wiki/Route_nationale_377","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Rumigny_%28Ardennes%29_city_limit_sign.JPG","page_title":"Route nationale 377","context_page_description":"La route nationale 377 ou RN 377 était une route nationale française reliant Laon à Rocroi. À la suite de la réforme de 1972, elle a été déclassée en RD 977 dans l'Aisne et en RD 877 dans les Ardennes.\\nVoir le tracé de la RN 377 sur Google Maps"},{"page_url":"https://hu.wikipedia.org/wiki/%C3%9Ajpuszta","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/97/%C3%9Ajpuszta06.JPG","page_title":"Újpuszta","context_page_description":"Újpuszta falu Szlovákiában, a Nyitrai kerületben, a Komáromi járásban. Egyike az 1920-as években keletkezett szlovák telepesfalvaknak. Ritkán használt magyar nevét a korábban itt állt majorról kapta."},{"page_url":"https://eu.wikipedia.org/wiki/Higuera_la_Real","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Templo_de_San_Bartolom%C3%A9.jpg","page_title":"Higuera la Real","context_page_description":"Higuera la Real Badajozko udalerria da, Sierra Suroeste eskualdean dagoena.\\n2009ko urtarrilaren 1eko erroldaren arabera 2.474 biztanle zituen."},{"page_url":"https://fr.wikipedia.org/wiki/Orlando_(Floride)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Walt_Disney_World_Resort_entrance.jpg","page_title":"Orlando (Floride)","context_page_description":"Orlando est une ville des États-Unis, siège du comté d'Orange, en Floride. La ville compte 280 257 habitants en 2017. Son agglomération comprend quant à elle 1 800 000 personnes selon des estimations de 2004 effectuées par le Bureau du recensement des États-Unis. C'est la sixième ville de Floride, et la première située à l'intérieur des terres de l'État. Orlando et ses environs constituent à présent l'une des zones métropolitaines américaines à la croissance la plus rapide.\\nElle est surtout connue pour son complexe de loisirs Walt Disney World Resort créé par la Walt Disney Company en 1971, ainsi que pour l'Universal Orlando Resort composé de deux grands parcs, le premier sur le cinéma Universal Studios le deuxième avec des attractions en rapport avec les héros de comics Islands of Adventure. Sans oublier City Walk, lieu composé de restaurants, bars, cinémas et discothèques aux thèmes divers. La zone consacrée au monde magique de la saga Harry Potter n'est pas un parc à part entière mais un land du parc Universal Studios et un land d'Islands of Adventure. On trouve également dans la ville un SeaWorld, parc d'attractions dont le concept est basé sur des spectacles avec des animaux."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%BE%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B5_%D0%B7%D0%B2%D0%B0%D0%BD%D0%B8%D1%8F_%D0%B8_%D0%B7%D0%BD%D0%B0%D0%BA%D0%B8_%D1%80%D0%B0%D0%B7%D0%BB%D0%B8%D1%87%D0%B8%D1%8F_%D0%B2_%D0%92%D0%BE%D0%BE%D1%80%D1%83%D0%B6%D1%91%D0%BD%D0%BD%D1%8B%D1%85_%D1%81%D0%B8%D0%BB%D0%B0%D1%85_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B9_%D0%A4%D0%B5%D0%B4%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D0%B8_(1994%E2%80%942010)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/RAF_N_R7CPO_1994-2010par.png","page_title":"Воинские звания и знаки различия в Вооружённых силах Российской Федерации (1994—2010)","context_page_description":"Знаки различия воинских званий в Вооружённых Силах Российской Федерации в период 1994—2010 годов — знаки различия по воинским званиям, носившиеся военнослужащими, с 1994 по 2010 год.\\nОтменены указом Президента Российской Федерации от 11 марта 2010 года № 293."},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%93%E0%A4%A4%E0%A5%8D%E0%A4%A4%E0%A5%8B_%E0%A4%AA%E0%A5%87%E0%A4%B0%E0%A5%87%E0%A4%9D_%E0%A4%AE%E0%A5%8B%E0%A4%B2%E0%A4%BF%E0%A4%A8%E0%A4%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Otto_Perez_Molina_at_World_Economic_Forum_2013-cropped.jpg","page_title":"ओत्तो पेरेझ मोलिना","context_page_description":"ओत्तो पेरेझ मोलिना हा मध्य अमेरिकेमधील ग्वातेमाला देशाचा निवृत्त लष्करी अधिकारी व माजी राष्ट्राध्यक्ष आहे. जानेवारी २०१२ पासून राष्ट्राध्यक्षपदावर असलेल्या मोलिनाने २ सप्टेंबर २०१५ रोजी भ्रष्टाचाराच्या आरोपांवरून पदाचा राजीनामा दिला. दुसऱ्याच दिवशी त्याला अटक करण्यात आली."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kathedralen_und_Bischofskirchen_in_Deutschland","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/VerdenerDomSued.jpg","page_title":"Liste der Kathedralen und Bischofskirchen in Deutschland","context_page_description":"Die Liste der Kathedralen in Deutschland enthält bestehende sowie ehemalige römisch-katholische, orthodoxe und altkatholische Kathedralen sowie die evangelischen Bischofskirchen in Deutschland."},{"page_url":"https://oc.wikipedia.org/wiki/Bagneaux","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Bagneaux-89-3.jpg","page_title":"Bagneaux","context_page_description":"Bagneaux es una comuna francesa, situada dins lo departament d'Yonne e la region de Borgonha."},{"page_url":"https://de.wikipedia.org/wiki/Powiat_Gryfi%C5%84ski","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Gryfino_p-gm.png","page_title":"Powiat Gryfiński","context_page_description":"Der Powiat Gryfiński ist ein Powiat im Südwesten der polnischen Woiwodschaft Westpommern, der flächenmäßig der größte der Woiwodschaft ist. Der nördliche Teil mit vier Gemeinden umfasst den einstigen Kreis Greifenhagen und gehört auch historisch zu Pommern. Im Süden umfasst er den größten Teil des einstigen Kreises Königsberg in der ehemaligen Neumark."},{"page_url":"https://cy.wikipedia.org/wiki/Ocsitania","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Prosper_Sainton_001.jpg","page_title":"Ocsitania","context_page_description":"Gwlad hanesyddol ac endid ieithyddol-ddiwylliannol ydy Ocsitania, sydd heddiw yn y rhan honno o Ffrainc a elwir yn Profens, rhannau o'r Eidal, rhannau o Sbaen a rhan o Fonaco. Yn answyddogol, gelwir yr ardaloedd hyn yn Ocsitania. Yn aml, yn yr Ocsitaneg, gelwir yr ardal yn lo país, h.y. 'y wlad', neu lo País d'Òc h.y. 'gwlad yr Oc'.\\nYstyriwyd hi'n endid ieithyddol-diwylliannol ers yr Oesoedd Canol, ond nid yw wedi bod yn endid statudol, gyfreithiol. Mae'r Ocsitaneg, fodd bynnag, yn iaith swyddogol yng Nghatalwnia. Yn oes y Rhufeiniaid, roedd yn wlad unedig, a gelwid hi gan y Rhufeinwyr yn Septem Provinciæ ac felly hefyd yn yr Oesoedd Canol pan galwyd hi'n Aquitanica gan y Fisigothiaid cyn i'r Ffrancwyr gychwyn ei choncro yn niwedd y 13g."},{"page_url":"https://de.wikipedia.org/wiki/B%C3%B6hmische_Masse","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3f/Czech_Republic_geomorphological_division_map_level1_colour.png","page_title":"Böhmische Masse","context_page_description":"Die Böhmische Masse oder Böhmisches Massiv ist das geologisch alte Rumpfgebirge in Tschechien und angrenzenden Gebieten in Österreich, Deutschland und Polen. Es ist als stark erodierter Rest eines jungpaläozoischen Faltengebirges ein charakteristisches Element der Geologie Mitteleuropas und Teil der europäischen Mittelgebirgsschwelle."},{"page_url":"https://fr.wikipedia.org/wiki/Les_Adopt%C3%A9s","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/M%C3%A9lanie_Laurent_2011.jpg","page_title":"Les Adoptés","context_page_description":"Les Adoptés est un film français réalisé par Mélanie Laurent, sorti le 23 novembre 2011. C'est le premier long métrage de Mélanie Laurent en tant que réalisatrice, après deux courts-métrages en 2008."},{"page_url":"https://fy.wikipedia.org/wiki/Slidehockey_op_de_Paralympyske_Winterspullen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Paralympics_2010_-_UBC_Thunderbird_Winter_Sports_Centre.jpg","page_title":"Slidehockey op de Paralympyske Winterspullen","context_page_description":"Slidehockey is ien fan de sporten dy’t op it programma fan de ‘’’Paralympyske Winterspullen’’’ steane. De sport is tagonklik foar sporters mei in Lichaamlike beheining oan de skonken.\\nDizze sport is in foarm fan iishockey mar dan op in prikslyde. De klean en it grutste part fan de spulregels komme oerien mei dy fan it iishockey."},{"page_url":"https://nl.wikipedia.org/wiki/660","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Petrus_Christus_003.jpg","page_title":"660","context_page_description":"Het jaar 660 is het 60e jaar in de 7e eeuw volgens de christelijke jaartelling."},{"page_url":"https://de.wikipedia.org/wiki/Kilmaurs","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Kilmaurs_Village_-_geograph.org.uk_-_1232551.jpg","page_title":"Kilmaurs","context_page_description":"Kilmaurs ist ein Dorf mit 2833 Einwohnern in der Council Area East Ayrshire im Südwesten Schottlands. Es liegt östlich des Carmel Water und etwa drei Kilometer nördlich von Kilmarnock an der A735."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A7%D9%85%D8%B1%D9%87_%DA%A9%DB%8C%D9%86%D8%A7%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Emre_K%C4%B1nay.jpg","page_title":"امره کینای","context_page_description":"امره کینای تورکیه‌لی اوْیونچو. ۵ مارس ۱۹۷۰ ‏ ایلینده ایستانبول شهرینده دۆنیایا گؤز آچیب. 1990–گۆنوموز ایللر آراسیندا سینما ساحه‌سینده چالیشیب."},{"page_url":"https://en.wikipedia.org/wiki/Insular_biogeography","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Insular_Biogeography_%28Size%29.png","page_title":"Insular biogeography","context_page_description":"Insular biogeography or island biogeography is a field within biogeography that examines the factors that affect the species richness and diversification of isolated natural communities. The theory was originally developed to explain the pattern of the species–area relationship occurring in oceanic islands. Under either name it is now used in reference to any ecosystem that is isolated due to being surrounded by unlike ecosystems, and has been extended to mountain peaks, seamounts, oases, fragmented forests, and even natural habitats isolated by human land development. The field was started in the 1960s by the ecologists Robert H. MacArthur and E. O. Wilson, who coined the term island biogeography in their inaugural contribution to Princeton's Monograph in Population Biology series, which attempted to predict the number of species that would exist on a newly created island."},{"page_url":"https://en.wikipedia.org/wiki/Charles_Humbert","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5d/Charles_Humbert_-Proc%C3%A8s.jpg","page_title":"Charles Humbert","context_page_description":"Charles Humbert was a French army captain, tax collector, Senator and newspaper proprietor."},{"page_url":"https://eu.wikipedia.org/wiki/Ameerega_bassleri","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Flickr_-_ggallice_-_Pleasing_poison_frog.jpg","page_title":"Ameerega bassleri","context_page_description":"Ameerega bassleri Ameerega generoko animalia da. Anfibioen barruko Dendrobatidae familian sailkatuta dago, Anura ordenan."},{"page_url":"https://pt.wikipedia.org/wiki/Breteni%C3%A8re","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/43/Map_commune_FR_insee_code_21106.png","page_title":"Bretenière","context_page_description":"Bretenière é uma comuna francesa na região administrativa da Borgonha-Franco-Condado, no departamento de Côte-d'Or. Estende-se por uma área de 6,03 km². Em 2010 a comuna tinha 736 habitantes."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A0%E1%83%9D%E1%83%9B%E1%83%98%E1%83%A1_%E1%83%98%E1%83%9B%E1%83%9E%E1%83%94%E1%83%A0%E1%83%90%E1%83%A2%E1%83%9D%E1%83%A0%E1%83%94%E1%83%91%E1%83%98%E1%83%A1_%E1%83%A1%E1%83%98%E1%83%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Alba_Iulia_National_Museum_of_the_Union_2011_-_Possible_Statue_of_Roman_Emperor_Pertinax_Close_Up%2C_Apulum.JPG","page_title":"რომის იმპერატორების სია","context_page_description":"ტიტული რომის იმპერატორი გარკვეული გაგებით თანამედროვე ცნებაა და ერთგვარ შეჯამებას უკეთებს პოსტს, რომელიც ეჭირათ იმ პიროვნებებს, რომელთაც რომის იმპერიის ძალაუფლების სადავეების ხელთ ჩაგდება მოახერხეს. რომის იმპერია განვითარდა რომის რესპუბლიკისგან, მას შემდეგ, რაც მან ევროპაში დომინანტური როლი დაიჭირა და მისთვის დამახასიათებელი გახდა ერთპიროვნული მმართველობა, „სენატისა და რომის მოქალაქეთა“ ნაცვლად. თუმცა ავგუსტუსი, საყოველთაოდ აღიარებული, როგორც პირველი იმპერატორი, ფრთხილობდა რესპუბლიკური მმართველობის ფასადის შენარჩუნებას, და რაიმე სპეციფიკური ტიტული მისთვის არ მიუღია. ამის ნაცვლად მან ადრე არსებული რომის მაგისტრატის ძალაუფლება საკუთარ თავს დაუქვემდებარა და არსებული ტიტული „Princeps Senatus“ მოირგო. მმართველობის ეს სტილი, რომელიც დაახლოებით 300 წელს გაგრძელდა, შესაბამისად „პრინციპატად“ იწოდება. სიტყვის „იმპერატორი“ თანამედროვე მნიშვნელობა მომდინარეობს ამავე სახელწოდების ტიტულიდან, რომელსაც არმია წარმატებულ გენერალს ანიჭებდა; შესაბამისად, რომის იმპერიის საწყის ფაზაში, „პრინცეპს“ ის ჯერ უნდა მოეხვეჭა."},{"page_url":"https://eu.wikipedia.org/wiki/Pointe-Calumet_(Quebec)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Pointe-Calumet_QC_1.jpg","page_title":"Pointe-Calumet (Quebec)","context_page_description":"Pointe-Calumet Quebeceko udalerri bat da, Kanadan. Laurentides eskualdean kokatuta dago, eta horren barruan dagoen Deux-Montagnes konderriko eskualde udalerria da..\\n2011ko zentsoaren arabera 6,396 biztanle zituen 4.63 kilometro koadroko azaleran."},{"page_url":"https://sk.wikipedia.org/wiki/Pont-de-Buis-l%C3%A8s-Quimerch","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Quimerch_02_L%27%C3%A9glise_paroissiale_vue_du_sud.jpg","page_title":"Pont-de-Buis-lès-Quimerch","context_page_description":"Pont-de-Buis-lès-Quimerch je francúzska obec, ktorá sa nachádza v departemente Finistère, v regióne Bretónsko."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D8%B1%D8%A7%D9%83%D8%B2_%D9%85%D8%AD%D8%A7%D9%81%D8%B8%D8%A7%D8%AA_%D9%85%D8%B5%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/%D9%85%D8%B1%D9%83%D8%B2_%D9%86%D8%AC%D8%B9_%D8%AD%D9%85%D8%A7%D8%AF%D9%8A.png","page_title":"مراكز محافظات مصر","context_page_description":"تضم محافظة الجيزة 9 مراكز."},{"page_url":"https://es.wikipedia.org/wiki/Comunidad_serial","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Secondary_succesion_cm01.jpg","page_title":"Comunidad serial","context_page_description":"Una comunidad serial es una etapa intermedia hallada en una sucesión ecológica de un ecosistema avanzando hacia su comunidad clímax.​ Un ejemplo de comunidades seriales en sucesión secundaria es una recientemente talada forestación de coníferas; durante los primeros dos años, los pastos, ericáceas y plantas herbáceas como la Epilobium angustifolium abundarán, y después de algunos años más, aparecen arbustos, y seis a ochot años después del aclareo, el área comienza a cubrirse de Betula. Cada una de estos estadios puede referirse a una comunidad serial.\\nUna comunidad serial es el nombre dado a cada grupo de plantas dentro de la sucesión. Una sucesión primaria describe aquellas comunidades vegetales que ocupan un sitio que no ha sido previamente vegetado. Eso puede también ser descripto como una comunidad pionera.\\nUna priserie es una colección de series desarrollándose en un área con superficies no vegetadas, hacia una comunidad clímax."},{"page_url":"https://sk.wikipedia.org/wiki/United_States_Marine_Corps_Aviation","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Insitu_RQ-21_Blackjack_%28cropped%29.jpg","page_title":"United States Marine Corps Aviation","context_page_description":"United States Marine Corps Aviation je označenie pre leteckú zložku Zboru Námornej pechoty Spojených štátov, ktorej vznik sa datuje už v roku 1912. Jej úlohou je predovšetkým podpora operácií námornej pechoty poskytnutím vzdušnej podpory a zabezpečením ich protivzdušnej obrany. Z toho vyplýva špecifická požiadavka na vybavenie jej útvarov, perutí a krídel, aj výkonnými bojovými lietadlami, aké sa väčšinou nenachádzajú vo výzbroji typických armádnych letectiev, a súčasne schopnosť ich integrácie do organizačných štruktúr Marine Air Ground Task Forces rôznych veľkostí, počnúc Marine Expeditionary Unit.\\nSúčasne je tiež organizované a cvičené tak, aby bolo schopné úzkej spolupráce s námorníctvom, napríklad pri zabezpečovaní obojživelných operácií námornej pechoty, vrátane operácií z lietadlových lodí."},{"page_url":"https://fr.wikipedia.org/wiki/J%C3%BCrgen_Kuczynski","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/J%C3%BCrgen_Kuczynski_%281997%29_by_Guenter_Prust.jpg","page_title":"Jürgen Kuczynski","context_page_description":"Jürgen Kuczynski [jʏʁɡn̩ kutʃɪnskiː], né le 17 septembre 1904 à Elberfeld et mort le 6 août 1997 à Berlin, est un économiste allemand."},{"page_url":"https://en.wikipedia.org/wiki/Coase_theorem","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Jonespeartree_graphs.JPG","page_title":"Coase theorem","context_page_description":"In law and economics, the Coase theorem describes the economic efficiency of an economic allocation or outcome in the presence of externalities. The theorem states that if trade in an externality is possible and there are sufficiently low transaction costs, bargaining will lead to a Pareto efficient outcome regardless of the initial allocation of property. In practice, obstacles to bargaining or poorly defined property rights can prevent Coasean bargaining. This 'theorem' is commonly attributed to Nobel Memorial Prize in Economic Sciences winner Ronald Coase during his tenure at the London School of Economics, SUNY at Buffalo, University of Virginia, and University of Chicago.\\nThis 1960 paper, along with his 1937 paper on the nature of the firm, earned Ronald Coase the 1991 Nobel Memorial Prize in Economic Sciences. In this 1960 paper, Coase argued that real-world transaction costs are rarely low enough to allow for efficient bargaining and hence the theorem is almost always inapplicable to economic reality."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Turkish_desserts","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Kabak_tatl%C4%B1s%C4%B1.jpg","page_title":"List of Turkish desserts","context_page_description":"This is a list of desserts from Turkish cuisine."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_monuments_del_Maresme","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/087_Sant_Jaume.jpg","page_title":"Llista de monuments del Maresme","context_page_description":"Llista de monuments del Maresme inclosos en l'Inventari del Patrimoni Arquitectònic Català per la comarca del Maresme. Inclou els inscrits en el Registre de Béns Culturals d'Interès Nacional amb la classificació de monuments històrics, els Béns Culturals d'Interès Local de caràcter immoble i la resta de béns arquitectònics integrants del patrimoni cultural català."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%98%E3%83%AC%E3%83%AD%E8%AA%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Distribution_of_Otjiherero_in_Namibia.png","page_title":"ヘレロ語","context_page_description":"ヘレロ語は、バントゥー語群に属する言語である。話者はナミビアおよびボツワナに居住するヘレロの人々である。話者数は両国を合わせて約24万人である。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%A9%D7%9E%D7%95%D7%A8%D7%AA_%D7%94%D7%A4%D7%90%D7%A8%D7%A7_%D7%94%D7%9C%D7%90%D7%95%D7%9E%D7%99_%D7%A0%D7%90%D7%94%D7%90%D7%A0%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Mason%27s_Rock.jpg","page_title":"שמורת הפארק הלאומי נאהאני","context_page_description":"שמורת הפארק הלאומי נאהאני, הנמצאת בטריטוריות הצפון-מערביות בקנדה, מגינה על חלק מהאזור הטבעי של הרי מקנזי. במרכז השמורה זורם נהר סאות' נאהאני. מקורו של השם נאהאני הוא בשם המקום בשפת הדנה - Nahʔa Dehé, שמשמעותו היא \\"נהר אדמת אנשי ה-Nahʔa\\"."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%B5%E0%AE%BF%E0%AE%B5%E0%AF%87%E0%AE%95%E0%AF%8D_(%E0%AE%A8%E0%AE%95%E0%AF%88%E0%AE%9A%E0%AF%8D%E0%AE%9A%E0%AF%81%E0%AE%B5%E0%AF%88_%E0%AE%A8%E0%AE%9F%E0%AE%BF%E0%AE%95%E0%AE%B0%E0%AF%8D)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9b/Vivek_Tamil_actor.jpg","page_title":"விவேக் (நகைச்சுவை நடிகர்)","context_page_description":"விவேக் தமிழ்த் திரைப்பட நகைச்சுவை நடிகர் ஆவார். 1961 நவம்பர் 19 ஆம் நாளில் அங்கய்யர், மணியம்மாள் ஆகியோருக்கு மதுரையில் பிறந்தார். இவரது சொந்த ஊர் கோயில்பட்டி - இலுப்பை ஊரணி. இவரது தந்தை இராமநாதபுரம் மாவட்டம் மண்டபத்தில் ஆசிரியராக பணியாற்றியவர். இவரது நகைச்சுவை இலஞ்சம், மக்கள்தொகைப் பெருக்கம், அரசியல் ஊழல்கள், மூட நம்பிக்கை போன்றவற்றை இடித்துரைப்பதால் இவரை சிலர் சின்னக் கலைவாணர் என்றும் சனங்களின் கலைஞன் என்றும் அடைமொழியிட்டு அழைக்கின்றனர். 1990களின் தொடக்கத்தில் துணைநடிகராகத் தமிழ்த் திரையுலகில் நடிக்கத் தொடங்கிய இவர் தற்போது புகழ்பெற்ற நடிகராக உள்ளார். பெரும்பாலான திரைப்படங்களில் கதை நாயகனின் நண்பனாக வேடம் ஏற்று நடித்துள்ளார். சிந்திக்க வைக்கும் கருத்துக்களை பரப்புவதற்காக இவர் பாராட்டப்பட்டாலும், இவர் பேசும் இரட்டை பொருள் பொதிந்த வசனங்களுக்காக விமர்சிக்கப்படுவதும் உண்டு. புதுப்புது அர்த்தங்கள், மின்னலே, பெண்ணின் மனதை தொட்டு, ரன், நம்மவீட்டுக் கல்யாணம், தூள் முதலிய படங்கள் இவரது நகைச்சுவை நடிப்பில் வெளிவந்த குறிப்பிடத்தக்க திரைப்படங்களாகும்.\\nபுதுப்புது அர்த்தங்கள் படத்தில் இவர் பேசிய 'இன்னைக்கு செத்தா நாளைக்கு பால்' என்ற வசனம் இவரை பிரபலபடுத்தியது.\\nஇந்திய அரசு வழங்கும் 2009 ம் ஆண்டுக்கான பத்ம ஸ்ரீ விருதை இவர் பெற்றார்."},{"page_url":"https://nn.wikipedia.org/wiki/Leticia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Leticia.jpg","page_title":"Leticia","context_page_description":"Leticia er ein by i republikken Colombia, hovudstaden i Amazonas-departementet, den sørlegaste byen i landet og den einaste store hamna i Colombia som ligg ved Amazonaselva. Han ligg 96 meter over havet og her er den gjennomsnittlege lufttemperaturen 27 °Celsius. Leticia har lengje vore utskipingshamna i landet for tropiske akvariefiskar. Leticia har ca. 33 000 innbyggjarar på vestre breidda av Amazonas, og ligg på det punktet der Colombia, Brasil og Peru møtast i eit område som blir nemnt Tres Fronteras.\\nEin langvarig grensestvist mellom Colombia og Peru som mellom anna femna om territoriet for Leticia, vart avslutta med hjelp av Folkeforbundet i 1934 etter at desse to nasjonane var engasjert i ein væpna konflikt kjent som Colombia-Peru-krigen."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%96%E3%83%AC%E3%83%83%E3%83%89%E3%83%9C%E3%83%BC%E3%83%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Breadboard_complex.jpg","page_title":"ブレッドボード","context_page_description":"ブレッドボードとは、電子回路の実験や試作をするための板のことである。「プロトタイプ基板」や「プロトタイピング基板」とも。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B7%E3%83%B3%E3%82%AC%E3%83%9D%E3%83%BC%E3%83%AB%E6%97%A5%E6%9C%AC%E4%BA%BA%E5%AD%A6%E6%A0%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Singapore_Japanese_Secondary_School_5.JPG","page_title":"シンガポール日本人学校","context_page_description":"シンガポール日本人学校は、シンガポール共和国にある日本人学校。"},{"page_url":"https://es.wikipedia.org/wiki/Pappo%27s_Blues_Volumen_1","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Pappo%27s_Blues_-_Pappo%27s_Blues.jpg","page_title":"Pappo's Blues Volumen 1","context_page_description":"Pappo's Blues, es el primer álbum de estudio del trío de blues argentino Pappo's Blues, lanzado en 1971. Reúne estándares de la carrera de Pappo, históricas canciones que se entonan con aire legendario: el furibundo blues rock psicodélico de \\"Algo ha cambiado\\", la declamación urbana de \\"El hombre suburbano\\", la queja en formato blusero de \\"Adónde está la libertad\\" y demás gemas. Este álbum junto al primer álbum de Manal tuvo una capital importancia en la instalación del blues como forma en la Argentina."},{"page_url":"https://pl.wikipedia.org/wiki/Uniwersytet_Wisconsin_w_Madison","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Frank_Lloyd_Wright_portrait.jpg","page_title":"Uniwersytet Wisconsin w Madison","context_page_description":"Uniwersytet Wisconsin w Madison – amerykański uniwersytet publiczny znajdujący się w Madison w stanie Wisconsin. Został założony w 1848 i jest największym uniwersytetem w stanie. Uczęszcza na niego ogółem 41 000 studentów, z czego około 29 000 stanowią studenci studiów licencjackich.\\nOd 1848 do 1956 uniwersytet był częścią zespołu szkolnictwa wyższego w Wisconsin, w którego skład wchodziło miasteczko uniwersyteckie Madison, dziesięć wydziałów dla studentów pierwszego i drugiego roku University of Wisconsin Colleges oraz University of Wisconsin-Extension. W latach 1956–1971 uczelnia była częścią Uniwersytetu Wisconsin. W 1971 stała się niezależną częścią zespołowego Uniwersytetu Wisconsin.\\nInstytucja oferuje szeroki zakres studiów nauk liberalnych, profesjonalne programy i działalności studencką. Szkoła często jest określana jako „publiczny Ivy” i w 2007 czasopismo US News and World Report umieściło ją na siódmym miejscu wśród najlepszych uniwersytetów w Stanach Zjednoczonych. Uczelnia ma kilka specyficznych programów, które są zaliczane do najlepszych programów w USA, np. socjologia, edukacja."},{"page_url":"https://en.wikipedia.org/wiki/List_of_works_by_Claude_Monet","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Monet_-_the-pyramids-of-port-coton-belle-ile-en-mer.jpg","page_title":"List of works by Claude Monet","context_page_description":"This is an incomplete list of works, including nearly all the finished paintings but excluding preparatory black and white sketches, by Claude Monet, who was a founder of French impressionist painting, and the most consistent and prolific practitioner of the movement's philosophy of expressing one's perceptions before nature, especially as applied to plein-air landscape painting. The term Impressionism is derived from the title of his painting Impression, Sunrise.\\nWhat made Monet different from the other Impressionist painters was his innovative idea of creating Series paintings devoted to paintings of a single theme or subject. With the repetitious study of the subject at different times of day Monet's paintings show the effects of sunlight, time and weather through color and contrast. Monet's \\"Series paintings\\" are well known and notable, and include Haystacks, Water Lilies, Rouen Cathedrals, Houses of Parliament, Charing Cross Bridge, and Poplar Trees. His prodigious output of nearly 2000 paintings was catalogued by Daniel Wildenstein in the Monet: Catalogue Raisonné."},{"page_url":"https://nl.wikipedia.org/wiki/Stratovulkaan","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Popocat%C3%A9petl_sunrise.jpg","page_title":"Stratovulkaan","context_page_description":"Een stratovulkaan is een hoge kegelvormige vulkaan die is opgebouwd uit lagen van gestolde lava en tefra. Stratovulkanen hebben relatief steile hellingen en worden gekenmerkt door regelmatig explosieve uitbarstingen. De samenstelling van lava's uit stratovulkanen is relatief felsisch wat de lava viskeus maakt. Lavastromen reiken dan ook niet tot op grote afstand van de vulkaan. Pyroclastische stromen en asregens daarentegen wel. Uitvloeiingsgesteenten die worden gevormd door stratovulkanen zijn andesieten, dacieten en ryolieten. Dit in tegenstelling tot de mafischere lava bij schildvulkanen. De meeste stratovulkanen bereiken hoogtes boven de 2500 meter en de meeste vulkanen op Aarde die niet onder water gevormd zijn, zijn stratovulkanen."}]`),L={name:"App",components:{PoemCard:M},data(){return{searchQuery:"",visibleCount:4,poemsData:P,isLoading:!1}},computed:{filteredPoems(){const a=this.searchQuery.trim().toLowerCase();return a?this.poemsData.filter(e=>e.page_title&&e.page_title.toLowerCase().includes(a)||e.context_page_description&&e.context_page_description.toLowerCase().includes(a)):this.poemsData},displayedPoems(){return this.searchQuery.trim()?this.filteredPoems:this.filteredPoems.slice(0,this.visibleCount)},hasMorePoems(){return!this.searchQuery.trim()&&this.visibleCount<this.poemsData.length}},methods:{async loadMore(){this.isLoading=!0,await new Promise(a=>setTimeout(a,1e3)),this.visibleCount+=4,this.isLoading=!1}}},T={class:"search-container"},F={class:"card-container"},R={key:0,class:"empty-state"},N=["disabled"],G={key:0},I={key:1};function H(a,e,s,m,o,r){const d=h("PoemCard");return t(),n("section",null,[e[4]||(e[4]=i("div",{class:"top-banner"},[i("div",{class:"top-banner-title"},[i("div",{class:"top-banner-title-text"},"🤔AI Techniques🧠")])],-1)),i("div",T,[e[3]||(e[3]=i("span",{class:"search-icon"},"🔍",-1)),_(i("input",{type:"text",class:"search-input","onUpdate:modelValue":e[0]||(e[0]=l=>o.searchQuery=l),placeholder:"Search..."},null,512),[[k,o.searchQuery]]),o.searchQuery?(t(),n("button",{key:0,class:"clear-search",onClick:e[1]||(e[1]=l=>o.searchQuery="")}," ✕ ")):p("",!0)]),i("div",F,[(t(!0),n(w,null,b(r.displayedPoems,(l,c)=>(t(),D(d,{key:c,poem:l},null,8,["poem"]))),128)),r.displayedPoems.length===0?(t(),n("div",R,' No results found for "'+u(o.searchQuery)+'". ',1)):p("",!0)]),r.hasMorePoems?(t(),n("button",{key:0,class:"load-more-button",disabled:o.isLoading,onClick:e[2]||(e[2]=(...l)=>r.loadMore&&r.loadMore(...l))},[o.isLoading?(t(),n("span",I,"Loading...")):(t(),n("span",G,"See more"))],8,N)):p("",!0)])}cons